                    { 64, null, "R", "Two men share an odd friendship while they care for two women who are both in deep comas.", 112, "Spanish", "/ePERgbqEI1sYTzSVIHDYD9MJ1IS.jpg", 7.5999999999999996, new DateTime(2002, 3, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), "Talk to Her" },
