                    { 69, null, "PG-13", "A chronicle of country music legend Johnny Cash's life, from his early days on an Arkansas cotton farm to his rise to fame with Sun Records in Memphis, where he recorded alongside Elvis Presley, Jerry Lee Lewis and Carl Perkins.", 136, "English", "/zMkD6FVikyPNnigoupO7vD5ti9p.jpg", 7.5, new DateTime(2005, 9, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), "Walk the Line" },
                    { 70, null, "PG-13", "Despondent over a painful estrangement from his daughter, trainer Frankie Dunn isn't prepared for boxer Maggie Fitzgerald to enter his life. But Maggie's determined to go pro and to convince Dunn and his cohort to help her.", 132, "English", "/jcfEqKdWF1zeyvECPqp3mkWLct2.jpg", 8.0, new DateTime(2004, 12, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Million Dollar Baby" },
                    { 71, null, "PG-13", "Set against the background of the 1984 Miners' Strike, 11-year-old Billy Elliot stumbles out of the boxing ring and onto the ballet floor. He faces many trials and triumphs as he strives to conquer his family's set ways, inner conflict, and standing on his toes.", 110, "English", "/yvvDDdxNy1aYzG5OPVEVTsfCqdq.jpg", 7.5999999999999996, new DateTime(2000, 5, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), "Billy Elliot" },
                    { 73, null, "R", "Derek Vineyard is paroled after serving 3 years in prison for killing two African-American men. Through his brother, Danny Vineyard's narration, we learn that before going to prison, Derek was a skinhead and the leader of a violent white supremacist gang that committed acts of racial crime throughout L.A. and his actions greatly influenced Danny. Reformed and fresh out of prison, Derek severs contact with the gang and becomes determined to keep Danny from going down the same violent path as he did.", 119, "English", "/c2gsmSQ2Cqv8zosqKOCwRS0GFBS.jpg", 8.4000000000000004, new DateTime(1998, 10, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "American History X" },
                    { 76, null, "R", "On his way to Vienna, American Jesse meets Céline, a student returning to Paris. After long conversations forge a surprising connection between them, Jesse convinces Celine to get off the train with him in Vienna. Since his flight to the U.S. departs the next morning and he has no money for lodging, they wander the city together, taking in the experiences of Vienna and each other.", 101, "English", "/6KWnXYoV1htDT3TGYdFWucfTt6t.jpg", 7.9000000000000004, new DateTime(1995, 1, 27, 0, 0, 0, 0, DateTimeKind.Unspecified), "Before Sunrise" },
                    { 77, null, "R", "Leonard Shelby is tracking down the man who raped and murdered his wife. The difficulty of locating his wife's killer, however, is compounded by the fact that he suffers from a rare, untreatable form of short-term memory loss. Although he can recall details of life before his accident, Leonard cannot remember what happened fifteen minutes ago, where he's going, or why.", 113, "English", "/yuNs09hvpHVU1cBTCAk9zxsL2oW.jpg", 8.1999999999999993, new DateTime(2000, 10, 11, 0, 0, 0, 0, DateTimeKind.Unspecified), "Memento" },
                    { 78, null, "R", "In the smog-choked dystopian Los Angeles of 2019, blade runner Rick Deckard is called out of retirement to terminate a quartet of replicants who have escaped to Earth seeking their creator for a way to extend their short life spans.", 117, "English", "/qLX91FhHWCVrxDVsw0g2UD5c3Zk.jpg", 7.9000000000000004, new DateTime(1982, 6, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "Blade Runner" },
                    { 79, null, "PG-13", "One man defeated three assassins who sought to murder the most powerful warlord in pre-unified China.", 99, "Mandarin", "/vxgZto2Cz7ILHAlmRXt50I2brB2.jpg", 7.5, new DateTime(2002, 7, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), "Hero" },
                    { 80, null, "R", "Nine years later, Jesse travels across Europe giving readings from a book he wrote about the night he spent in Vienna with Celine. After his reading in Paris, Celine finds him, and they spend part of the day together before Jesse has to again leave for a flight. They are both in relationships now, and Jesse has a son, but as their strong feelings for each other start to return, both confess a longing for more.", 80, "English", "/gycdE1ARByGQcK4fYR2mgpU6OO.jpg", 7.7999999999999998, new DateTime(2004, 2, 10, 0, 0, 0, 0, DateTimeKind.Unspecified), "Before Sunset" },
                    { 81, null, "PG", "After a global war, the seaside kingdom known as the Valley of the Wind remains one of the last strongholds on Earth untouched by a poisonous jungle and the powerful insects that guard it. Led by the courageous Princess Nausicaä, the people of the Valley engage in an epic struggle to restore the bond between humanity and Earth.", 117, "Japanese", "/sIpcATxMrKHRRUJAGI5UIUT7XMG.jpg", 7.9000000000000004, new DateTime(1984, 3, 11, 0, 0, 0, 0, DateTimeKind.Unspecified), "Nausicaä of the Valley of the Wind" },
