                    { 87, null, "PG", "After arriving in India, Indiana Jones is asked by a desperate village to find a mystical stone. He agrees – and stumbles upon a secret cult plotting a terrible plan in the catacombs of an ancient palace.", 118, "English", "/wu0m7HiZyZr4pOp8IpnFHNvGkVV.jpg", 7.2999999999999998, new DateTime(1984, 5, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), "Indiana Jones and the Temple of Doom" },
                    { 88, null, "PG-13", "Expecting the usual tedium that accompanies a summer in the Catskills with her family, 17-year-old Frances 'Baby' Houseman is surprised to find herself stepping into the shoes of a professional hoofer—and unexpectedly falling in love.", 100, "English", "/dvEggyDTTIBDvrUNjTEa9depT0f.jpg", 7.4000000000000004, new DateTime(1987, 8, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), "Dirty Dancing" },
                    { 89, null, "PG-13", "When Dr. Henry Jones Sr. suddenly goes missing while pursuing the Holy Grail, eminent archaeologist Indiana must team up with Marcus Brody, Sallah and Elsa Schneider to follow in his father's footsteps and stop the Nazis from recovering the power of eternal life.", 127, "English", "/acgJPtbeXdBaKYAUVdfYLVwKzAC.jpg", 7.7999999999999998, new DateTime(1989, 5, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), "Indiana Jones and the Last Crusade" },
                    { 93, null, "NR", "Semi-retired Michigan lawyer Paul Biegler takes the case of Army Lt. Manion, who murdered a local innkeeper after his wife claimed that he raped her. Over the course of an extensive trial, Biegler parries with District Attorney Lodwick and out-of-town prosecutor Claude Dancer to set his client free, but his case rests on the victim's mysterious business partner, who's hiding a dark secret.", 161, "English", "/lMWWs7IskGldLfwwnVxHhffsVLw.jpg", 7.9000000000000004, new DateTime(1959, 7, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "Anatomy of a Murder" },
                    { 98, null, "R", "In the year 180, the death of emperor Marcus Aurelius throws the Roman Empire into chaos.  Maximus is one of the Roman army's most capable and trusted generals and a key advisor to the emperor.  As Marcus' devious son Commodus ascends to the throne, Maximus is set to be executed.  He escapes, but is captured by slave traders.  Renamed Spaniard and forced to become a gladiator, Maximus must battle to the death with other men for the amusement of paying audiences.", 155, "English", "/ehGpN04mLJIrSnxcZBMvHeG0eDc.jpg", 8.1999999999999993, new DateTime(2000, 5, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "Gladiator" },
                    { 99, null, "R", "A single mother in Madrid sees her only son die on his birthday as he runs to seek an actress' autograph. Beside herself with grief, she returns to Barcelona to tell the boy's father about the death of the son he never knew he had.", 101, "Spanish", "/hjQhzhkGYXPNM96k0mOgob6HMmn.jpg", 7.7000000000000002, new DateTime(1999, 4, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), "All About My Mother" },
                    { 100, null, "R", "A card shark and his unwillingly-enlisted friends need to make a lot of cash quick after losing a sketchy poker match. To do this they decide to pull a heist on a small-time gang who happen to be operating out of the flat next door.", 105, "English", "/8kSerJrhrJWKLk1LViesGcnrUPE.jpg", 8.1999999999999993, new DateTime(1998, 3, 5, 0, 0, 0, 0, DateTimeKind.Unspecified), "Lock, Stock and Two Smoking Barrels" },
                    { 101, null, "R", "Léon, the top hit man in New York, has earned a rep as an effective \"cleaner\". But when his next-door neighbors are wiped out by a loose-cannon DEA agent, he becomes the unwilling custodian of 12-year-old Mathilda. Before long, Mathilda's thoughts turn to revenge, and she considers following in Léon's footsteps.", 111, "English", "/wHqGb8J6tXBVwjqWooGMtNEjs2A.jpg", 8.3000000000000007, new DateTime(1994, 9, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), "Léon: The Professional" },
                    { 103, null, "R", "A mentally unstable Vietnam War veteran works as a night-time taxi driver in New York City where the perceived decadence and sleaze feed his urge for violent action, attempting to save a preadolescent prostitute in the process.", 114, "English", "/ekstpH614fwDX8DUln1a2Opz0N8.jpg", 8.1999999999999993, new DateTime(1976, 2, 9, 0, 0, 0, 0, DateTimeKind.Unspecified), "Taxi Driver" },
                    { 104, null, "R", "Lola receives a phone call from her boyfriend Manni. He lost 100,000 DM in a subway train that belongs to a very bad guy. She has 20 minutes to raise this amount and meet Manni. Otherwise, he will rob a store to get the money. Three different alternatives may happen depending on some minor event along Lola's run.", 81, "German", "/v0giIi4bTILVhNhJajet3WWY3FA.jpg", 7.2999999999999998, new DateTime(1998, 3, 3, 0, 0, 0, 0, DateTimeKind.Unspecified), "Run Lola Run" },
                    { 105, null, "PG", "Eighties teenager Marty McFly is accidentally sent back in time to 1955, inadvertently disrupting his parents' first meeting and attracting his mother's romantic interest. Marty must repair the damage to history by rekindling his parents' romance and - with the help of his eccentric inventor friend Doc Brown - return to 1985.", 116, "English", "/xlBivetfrtF84Yx0zISShnNtHYe.jpg", 8.3000000000000007, new DateTime(1985, 7, 3, 0, 0, 0, 0, DateTimeKind.Unspecified), "Back to the Future" },
                    { 106, null, "R", "Dutch and his group of commandos are hired by the CIA to rescue downed airmen from guerillas in a Central American jungle. The mission goes well but as they return they find that something is hunting them. Nearly invisible, it blends in with the forest, taking trophies from the bodies of its victims as it goes along. Occasionally seeing through its eyes, the audience sees it is an intelligent alien hunter, hunting them for sport, killing them off one at a time.", 107, "English", "/biznhvfedHPp9GKjlVFXH6OZtyU.jpg", 7.5, new DateTime(1987, 6, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), "Predator" }
