                    { 107, null, "R", "Unscrupulous boxing promoters, violent bookmakers, a Russian gangster, incompetent amateur robbers and supposedly Jewish jewelers fight to track down a priceless stolen diamond.", 104, "English", "/56mOJth6DJ6JhgoE2jtpilVqJO.jpg", 7.7999999999999998, new DateTime(2000, 9, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "Snatch" },
                    { 108, null, "R", "Julie is haunted by her grief after living through a tragic auto wreck that claimed the life of her composer husband and young daughter. Her initial reaction is to withdraw from her relationships, lock herself in her apartment and suppress her pain. But avoiding human interactions on the bustling streets of Paris proves impossible, and she eventually meets up with Olivier, an old friend who harbors a secret love for her, and who could draw her back to reality.", 98, "French", "/teDQRqy5STEhSvLERfGERBX25Br.jpg", 7.7000000000000002, new DateTime(1993, 9, 8, 0, 0, 0, 0, DateTimeKind.Unspecified), "Three Colors: Blue" },
                    { 109, null, "R", "Polish immigrant Karol Karol finds himself out of a marriage, a job and a country when his French wife, Dominique, divorces him after six months due to his impotence. Forced to leave France after losing the business they jointly owned, Karol enlists fellow Polish expatriate Mikolah to smuggle him back to their homeland.", 92, "French", "/4jDSCLCWxHutCAZRve8Kkso2UfA.jpg", 7.5, new DateTime(1994, 1, 26, 0, 0, 0, 0, DateTimeKind.Unspecified), "Three Colors: White" },
                    { 110, null, "R", "Part-time model Valentine meets a retired judge who lives in her neighborhood after she runs over his dog. At first the judge gifts Valentine with the dog, but her possessive boyfriend won't allow her to keep it. When she returns with the dog to the judge's house, she discovers him listening in on his neighbors' phone conversations. At first Valentine is outraged, but her debates with the judge over his behavior soon leads them to form a strange bond.", 100, "French", "/5YIzZaQlwYJY5ZEqHRs9dG9DduB.jpg", 8.0, new DateTime(1994, 5, 27, 0, 0, 0, 0, DateTimeKind.Unspecified), "Three Colors: Red" },
                    { 111, null, "R", "After getting a green card in exchange for assassinating a Cuban government official, Tony Montana stakes a claim on the drug trade in Miami. Viciously murdering anyone who stands in his way, Tony eventually becomes the biggest drug lord in the state, controlling nearly all the cocaine that comes through Miami. But increased pressure from the police, wars with Colombian drug cartels and his own drug-fueled paranoia serve to fuel the flames of his eventual downfall.", 170, "English", "/iQ5ztdjvteGeboxtmRdXEChJOHh.jpg", 8.1999999999999993, new DateTime(1983, 12, 9, 0, 0, 0, 0, DateTimeKind.Unspecified), "Scarface" },
                    { 113, null, "15", "An isolated lake, where an old monk lives in a small floating temple. The monk has a young boy living with him, learning to become a monk. We watch as seasons and years pass by.", 103, "Korean", "/6SQQ5REuAz7k0FMQ9mSCT40T2LN.jpg", 7.9000000000000004, new DateTime(2003, 9, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), "Spring, Summer, Fall, Winter... and Spring" },
                    { 114, null, "R", "When a millionaire wheeler-dealer enters a business contract with a Hollywood hooker Vivian Ward, he loses his heart in the bargain.", 119, "English", "/hMVMMy1yDUvdufpTl8J8KKNYaZX.jpg", 7.4000000000000004, new DateTime(1990, 3, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), "Pretty Woman" },
                    { 115, null, "R", "Jeffrey 'The Dude' Lebowski, a Los Angeles slacker who only wants to bowl and drink White Russians, is mistaken for another Jeffrey Lebowski, a wheelchair-bound millionaire, and finds himself dragged into a strange series of events involving nihilists, adult film producers, ferrets, errant toes, and large sums of money.", 117, "English", "/d4J7GotCjvDJBAYayZBTc5nLbbP.jpg", 7.9000000000000004, new DateTime(1998, 3, 6, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Big Lebowski" },
                    { 116, null, "R", "Match Point is Woody Allen’s satire of the British High Society and the ambition of a young tennis instructor to enter into it. Yet when he must decide between two women - one assuring him his place in high society, and the other that would take him far from it - palms start to sweat and a dark psychological match in his head begins.", 124, "English", "/vHjEVTD8ucuwKSFOZJeyAnTZYli.jpg", 7.2999999999999998, new DateTime(2005, 10, 26, 0, 0, 0, 0, DateTimeKind.Unspecified), "Match Point" },
                    { 117, null, "R", "Young Treasury Agent Elliot Ness arrives in Chicago and is determined to take down Al Capone, but it's not going to be easy because Capone has the police in his pocket. Ness meets Jimmy Malone, a veteran patrolman and probably the most honorable one on the force. He asks Malone to help him get Capone, but Malone warns him that if he goes after Capone, he is going to war.", 119, "English", "/iK4twY48a1nVCez0qXE5w4JFvXw.jpg", 7.7999999999999998, new DateTime(1987, 6, 3, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Untouchables" },
                    { 120, null, "PG-13", "Young hobbit Frodo Baggins, after inheriting a mysterious ring from his uncle Bilbo, must leave his home in order to keep it from falling into the hands of its evil creator. Along the way, a fellowship is formed to protect the ringbearer and make sure that the ring arrives at its final destination: Mt. Doom, the only place where it can be destroyed.", 179, "English", "/6oom5QYQ2yQTMJIbnvbkBL9cHo6.jpg", 8.3000000000000007, new DateTime(2001, 12, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Lord of the Rings: The Fellowship of the Ring" },
                    { 121, null, "PG-13", "Frodo and Sam are trekking to Mordor to destroy the One Ring of Power while Gimli, Legolas and Aragorn search for the orc-captured Merry and Pippin. All along, nefarious wizard Saruman awaits the Fellowship members at the Orthanc Tower in Isengard.", 179, "English", "/5VTN0pR8gcqV3EPUHHfMGnJYN9L.jpg", 8.3000000000000007, new DateTime(2002, 12, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Lord of the Rings: The Two Towers" },
                    { 122, null, "PG-13", "Aragorn is revealed as the heir to the ancient kings as he, Gandalf and the other members of the broken fellowship struggle to save Gondor from Sauron's forces. Meanwhile, Frodo and Sam take the ring closer to the heart of Mordor, the dark lord's realm.", 201, "English", "/rCzpDGLbOoPwLjy3OAm5NUPOTrC.jpg", 8.5, new DateTime(2003, 12, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Lord of the Rings: The Return of the King" },
                    { 128, null, "PG-13", "Ashitaka, a prince of the disappearing Emishi people, is cursed by a demonized boar god and must journey to the west to find a cure. Along the way, he encounters San, a young human woman fighting to protect the forest, and Lady Eboshi, who is trying to destroy it. Ashitaka must find a way to bring balance to this conflict.", 134, "Japanese", "/pdtzEreKvKAlqa2YEBaGwiA45V8.jpg", 8.3000000000000007, new DateTime(1997, 7, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), "Princess Mononoke" },
                    { 129, null, "PG", "A young girl, Chihiro, becomes trapped in a strange new world of spirits. When her parents undergo a mysterious transformation, she must call upon the courage she never knew she had to free her family.", 125, "Japanese", "/39wmItIWsg5sZMyRUHLkWBcuVCM.jpg", 8.5, new DateTime(2001, 7, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), "Spirited Away" },
                    { 134, null, "PG-13", "In the deep south during the 1930s, three escaped convicts search for hidden treasure while a relentless lawman pursues them. On their journey they come across many comical characters and incredible situations. Based upon Homer's 'Odyssey'.", 107, "English", "/2YztYilviFCYcEtDAnrOstUWGie.jpg", 7.2999999999999998, new DateTime(2000, 8, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "O Brother, Where Art Thou?" },
                    { 136, null, "NR", "A circus' beautiful trapeze artist agrees to marry the leader of side-show performers, but his deformed friends discover she is only marrying him for his inheritance.", 62, "English", "/j2dwljljOrLTcnwfKeUBBeNB8t7.jpg", 7.7999999999999998, new DateTime(1932, 2, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), "Freaks" },
                    { 137, null, "PG", "A narcissistic TV weatherman, along with his attractive-but-distant producer, and his mawkish cameraman, is sent to report on Groundhog Day in the small town of Punxsutawney, where he finds himself repeating the same day over and over.", 101, "English", "/gCgt1WARPZaXnq523ySQEUKinCs.jpg", 7.5999999999999996, new DateTime(1993, 2, 11, 0, 0, 0, 0, DateTimeKind.Unspecified), "Groundhog Day" },
                    { 140, null, "NC-17", "Two children, Ignacio and Enrique, know love, the movies and fear in a religious school at the beginning of the 1960s. Father Manolo, director of the school and its professor of literature, is witness to and part of these discoveries. The three are followed through the next few decades, their reunion marking life and death.", 106, "Spanish", "/du716YH0PKiL2kZgIPLkEblgHLX.jpg", 7.4000000000000004, new DateTime(2004, 3, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), "Bad Education" },
                    { 141, null, "R", "After narrowly escaping a bizarre accident, a troubled teenager is plagued by visions of a large bunny rabbit that manipulates him to commit a series of crimes.", 114, "English", "/fhQoQfejY1hUcwyuLgpBrYs6uFt.jpg", 7.7999999999999998, new DateTime(2001, 10, 26, 0, 0, 0, 0, DateTimeKind.Unspecified), "Donnie Darko" },
                    { 142, null, "R", "Two modern-day cowboys meet on a shepherding job in the summer of '63, the two share a raw and powerful summer together that turns into a lifelong relationship conflict", 134, "English", "/1A2EU80gL5KXXjjcUZZt8UI4Zot.jpg", 7.7999999999999998, new DateTime(2005, 9, 10, 0, 0, 0, 0, DateTimeKind.Unspecified), "Brokeback Mountain" },
                    { 143, null, "NR", "A young soldier faces profound disillusionment in the soul-destroying horror of World War I. Together with several other young German soldiers, he experiences the horrors of war, such evil of which he had not conceived of when signing up to fight. They eventually become sad, tormented, and confused of their purpose.", 133, "English", "/yAU6jklJLUjZot3WyvyJrxVdLKb.jpg", 7.7999999999999998, new DateTime(1930, 4, 29, 0, 0, 0, 0, DateTimeKind.Unspecified), "All Quiet on the Western Front" },
                    { 144, null, "PG-13", "Two angels, Damiel and Cassiel, glide through the streets of Berlin, observing the bustling population, providing invisible rays of hope to the distressed but never interacting with them. When Damiel falls in love with lonely trapeze artist Marion, the angel longs to experience life in the physical world, and finds -- with some words of wisdom from actor Peter Falk -- that it might be possible for him to take human form.", 128, "German", "/iZQs2vUeCzvS1KfZJ6uYNCGJBBV.jpg", 7.9000000000000004, new DateTime(1987, 5, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), "Wings of Desire" },
                    { 145, null, "R", "In a small and conservative Scottish village, a woman's paralytic husband convinces her to have extramarital intercourse so she can tell him about it and give him a reason for living.", 159, "Danish", "/dQWMcdHXUOSHtr7ypOCa5T79JMS.jpg", 7.5, new DateTime(1996, 5, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), "Breaking the Waves" },
                    { 146, null, "PG-13", "Two warriors in pursuit of a stolen sword and a notorious fugitive are led to an impetuous, physically-skilled, teenage nobleman's daughter, who is at a crossroads in her life.", 120, "Mandarin", "/iNDVBFNz4XyYzM9Lwip6atSTFqf.jpg", 7.4000000000000004, new DateTime(2000, 7, 6, 0, 0, 0, 0, DateTimeKind.Unspecified), "Crouching Tiger, Hidden Dragon" },
                    { 147, null, "NR", "For young Parisian boy Antoine Doinel, life is one difficult situation after another. Surrounded by inconsiderate adults, including his neglectful parents, Antoine spends his days with his best friend, Rene, trying to plan for a better life. When one of their schemes goes awry, Antoine ends up in trouble with the law, leading to even more conflicts with unsympathetic authority figures.", 99, "French", "/12PuU23kkDLvTd0nb8hMlE3oShB.jpg", 8.0999999999999996, new DateTime(1959, 6, 3, 0, 0, 0, 0, DateTimeKind.Unspecified), "The 400 Blows" },
                    { 149, null, "R", "A secret military project endangers Neo-Tokyo when it turns a biker gang member into a rampaging psychic psychopath that only two teenagers and a group of psychics can stop.", 124, "Japanese", "/5KlRFKKSbyCiyYpZSS3A6G5bW0K.jpg", 7.9000000000000004, new DateTime(1988, 7, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), "Akira" },
                    { 153, null, "R", "Two lost souls visiting Tokyo -- the young, neglected wife of a photographer and a washed-up movie star shooting a TV commercial -- find an odd solace and pensive freedom to be real in each other's company, away from their lives in America.", 102, "English", "/wkSzJs7oMf8MIr9CQVICsvRfwA7.jpg", 7.4000000000000004, new DateTime(2003, 9, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), "Lost in Translation" },
                    { 154, null, "PG", "It is the 23rd century. The Federation Starship U.S.S. Enterprise™ is on routine training maneuvers and Admiral James T. Kirk (William Shatner) seems resigned to the fact that this inspection may well be the last space mission of his career. But Khan is back. Aided by his exiled band of genetic supermen, Khan (Ricardo Montalban) - brilliant renegade of 20th century Earth - has raided Space Station Regula One, stolen a top secret device called Project Genesis, wrested control of another Federation Starship and sets out in pursuit of the Enterprise, determined to let nothing stand in the way of his mission: kill Admiral Kirk... even if it means universal Armageddon.", 113, "English", "/uPyLsKl8Z0LOoxeaFXsY5MxhR5s.jpg", 7.4000000000000004, new DateTime(1982, 6, 4, 0, 0, 0, 0, DateTimeKind.Unspecified), "Star Trek II: The Wrath of Khan" },
                    { 155, null, "PG-13", "Batman raises the stakes in his war on crime. With the help of Lt. Jim Gordon and District Attorney Harvey Dent, Batman sets out to dismantle the remaining criminal organizations that plague the streets. The partnership proves to be effective, but they soon find themselves prey to a reign of chaos unleashed by a rising criminal mastermind known to the terrified citizens of Gotham as the Joker.", 152, "English", "/qJ2tW6WMUDux911r6m7haRef0WH.jpg", 8.5, new DateTime(2008, 7, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Dark Knight" },
                    { 158, null, "12", "Two young men, Martin and Rudi, both suffering from terminal cancer, get to know each other in a hospital room. They drown their desperation in tequila and decide to take one last trip to the sea. Drunk and still in pajamas they steal the first fancy car they find, a 60's Mercedes convertible. The car happens to belong to a bunch of gangsters, which immediately start to chase it, since it contains more than the pistol Martin finds in the glove box.", 87, "German", "/9pTUCXcMDZurDmZRtOrnk9mjSFH.jpg", 7.5999999999999996, new DateTime(1997, 2, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), "Knockin' on Heaven's Door" },
                    { 161, null, "PG-13", "Less than 24 hours into his parole, charismatic thief Danny Ocean is already rolling out his next plan: In one night, Danny's hand-picked crew of specialists will attempt to steal more than $150 million from three Las Vegas casinos. But to score the cash, Danny risks his chances of reconciling with ex-wife, Tess.", 116, "English", "/hQQCdZrsHtZyR6NbKH2YyCqd2fR.jpg", 7.4000000000000004, new DateTime(2001, 12, 7, 0, 0, 0, 0, DateTimeKind.Unspecified), "Ocean's Eleven" },
                    { 162, null, "PG-13", "A small suburban town receives a visit from a castaway unfinished science experiment named Edward.", 105, "English", "/1RFIbuW9Z3eN9Oxw2KaQG5DfLmD.jpg", 7.7000000000000002, new DateTime(1990, 12, 5, 0, 0, 0, 0, DateTimeKind.Unspecified), "Edward Scissorhands" },
                    { 164, null, "G", "The names Audrey Hepburn and Holly Golightly have become synonymous since this dazzling romantic comedy was translated to the screen from Truman Capote’s best-selling novella. Holly is a deliciously eccentric New York City playgirl determined to marry a Brazilian millionaire. George Peppard plays her next-door neighbour, a writer who is “sponsored” by a wealthy Patricia Neal. Guessing who’s the right man for Holly is easy. Seeing just how that romance blossoms is one of the enduring delights of this gem-like treat set to Henry Mancini’s Oscar®-winning score and the Oscar®-winning Mancini-Johnny Mercer song “Moon River.”", 114, "English", "/h3GDLoBUTiVFm4UMrok5tibFwqC.jpg", 7.7000000000000002, new DateTime(1961, 10, 6, 0, 0, 0, 0, DateTimeKind.Unspecified), "Breakfast at Tiffany's" },
                    { 165, null, "PG", "Marty and Doc are at it again in this wacky sequel to the 1985 blockbuster as the time-traveling duo head to 2015 to nip some McFly family woes in the bud. But things go awry thanks to bully Biff Tannen and a pesky sports almanac. In a last-ditch attempt to set things straight, Marty finds himself bound for 1955 and face to face with his teenage parents -- again.", 108, "English", "/YBawEsTkUZBDajKbd5LiHkmMGf.jpg", 7.7000000000000002, new DateTime(1989, 11, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), "Back to the Future Part II" },
                    { 175, null, "PG-13", "Two men answer the call of the ocean in this romantic fantasy-adventure.  Jacques and Enzo are a pair of friends who have been close since childhood, and who share a passion for the dangerous sport of free diving. Professional diver Jacques opted to follow in the footsteps of his father, who died at sea when Jacques was a boy; to the bewilderment of scientists, Jacques harbors a remarkable ability to adjust his heart rate and breathing pattern in the water, so that his vital signs more closely resemble that of dolphins than men.  As Enzo persuades a reluctant Jacques to compete against him in a free diving contest -- determining who can dive deeper and longer without scuba gear -- Jacques meets Johana, a beautiful insurance investigator from America, and he finds that he must choose between his love for her and his love of the sea.", 168, "French", "/vbi56h6a1BGjnhq2RnUrcQZs2aV.jpg", 7.5, new DateTime(1988, 5, 10, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Big Blue" },
                    { 176, null, "R", "Obsessed with teaching his victims the value of life, a deranged, sadistic serial killer abducts the morally wayward. Once captured, they must face impossible choices in a horrific game of survival. The victims must fight to win their lives back, or die trying...", 103, "English", "/pparEGTCxcTiImyVFoKD0LX11N8.jpg", 7.4000000000000004, new DateTime(2004, 10, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "Saw" },
                    { 177, null, "R", "Two troubled men face their terrible destinies and events of their past as they join together on a mission to find the Holy Grail and thus to save themselves.", 138, "English", "/5mb1IV53luUNTRyF3TSC77X1KZs.jpg", 7.2999999999999998, new DateTime(1991, 9, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Fisher King" },
                    { 180, null, "PG-13", "John Anderton is a top 'Precrime' cop in the late-21st century, when technology can predict crimes before they're committed. But Anderton becomes the quarry when another investigator targets him for a murder charge.", 145, "English", "/ccqpHq5tk5W4ymbSbuoy4uYOxFI.jpg", 7.2999999999999998, new DateTime(2002, 6, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), "Minority Report" },
                    { 184, null, "R", "Jackie Brown is a flight attendant who gets caught in the middle of smuggling cash into the country for her gunrunner boss. When the cops try to use Jackie to get to her boss, she hatches a plan — with help from a bail bondsman — to keep the money for herself.", 154, "English", "/ewbLUXvm4riZL0aepy90o0vMesn.jpg", 7.2999999999999998, new DateTime(1997, 4, 10, 0, 0, 0, 0, DateTimeKind.Unspecified), "Jackie Brown" },
                    { 185, null, "R", "In a near-future Britain, young Alexander DeLarge and his pals get their kicks beating and raping anyone they please. When not destroying the lives of others, Alex swoons to the music of Beethoven. The state, eager to crack down on juvenile crime, gives an incarcerated Alex the option to undergo an invasive procedure that'll rob him of all personal agency. In a time when conscience is a commodity, can Alex change his tune?", 137, "English", "/4sHeTAp65WrSSuc05nRBKddhBxO.jpg", 8.1999999999999993, new DateTime(1971, 12, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), "A Clockwork Orange" },
                    { 186, null, "R", "Slevin is mistakenly put in the middle of a personal war between the city’s biggest criminal bosses. Under constant watch, Slevin must try not to get killed by an infamous assassin and come up with an idea of how to get out of his current dilemma. A film with many twists and turns.", 110, "English", "/zX4Z8DzCsp7OtPpYoJmQNxCW9SI.jpg", 7.5, new DateTime(2006, 2, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), "Lucky Number Slevin" }
                });

            migrationBuilder.InsertData(
                table: "Movies",
                columns: new[] { "Id", "ActorId", "Certification", "Description", "Duration", "Language", "Picture", "Ratings", "ReleaseDate", "Title" },
                values: new object[,]
                {
                    { 187, null, "R", "Welcome to Sin City. This town beckons to the tough, the corrupt, the brokenhearted. Some call it dark… Hard-boiled. Then there are those who call it home — Crooked cops, sexy dames, desperate vigilantes. Some are seeking revenge, others lust after redemption, and then there are those hoping for a little of both. A universe of unlikely and reluctant heroes still trying to do the right thing in a city that refuses to care.", 124, "English", "/8qGW691AOyqbKsEhpe7nHwMEbRe.jpg", 7.4000000000000004, new DateTime(2005, 4, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "Sin City" },
                    { 192, null, "R", "14th-century Franciscan monk William of Baskerville and his young novice arrive at a conference to find that several monks have been murdered under mysterious circumstances. To solve the crimes, William must rise up against the Church's authority and fight the shadowy conspiracy of monastery monks using only his intelligence – which is considerable.", 130, "English", "/d6dlbTBb3N7nXDz7tQslDJs2jgv.jpg", 7.4000000000000004, new DateTime(1986, 9, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Name of the Rose" },
                    { 194, null, "R", "At a tiny Parisian café, the adorable yet painfully shy Amélie accidentally discovers a gift for helping others. Soon Amelie is spending her days as a matchmaker, guardian angel, and all-around do-gooder. But when she bumps into a handsome stranger, will she find the courage to become the star of her very own love story?", 122, "French", "/slVnvaH6fpF22154vnjQJdXCVZd.jpg", 7.9000000000000004, new DateTime(2001, 4, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "Amélie" },
                    { 196, null, "PG", "The final installment of the Back to the Future trilogy finds Marty digging the trusty DeLorean out of a mineshaft and looking for Doc in the Wild West of 1885. But when their time machine breaks down, the travelers are stranded in a land of spurs. More problems arise when Doc falls for pretty schoolteacher Clara Clayton, and Marty tangles with Buford Tannen.", 119, "English", "/crzoVQnMzIrRfHtQw0tLBirNfVg.jpg", 7.4000000000000004, new DateTime(1990, 5, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "Back to the Future Part III" },
                    { 197, null, "R", "Enraged at the slaughter of Murron, his new bride and childhood love, Scottish warrior William Wallace slays a platoon of the local English lord's soldiers. This leads the village to revolt and, eventually, the entire country to rise up against English rule.", 178, "English", "/or1gBugydmjToAEq7OZY0owwFk.jpg", 7.9000000000000004, new DateTime(1995, 5, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), "Braveheart" },
                    { 198, null, "12", "During the Nazi occupation of Poland, an acting troupe becomes embroiled in a Polish soldier's efforts to track down a German spy.", 99, "English", "/dDQRpEoyjHT4fzw9cNklIvZuXYg.jpg", 7.9000000000000004, new DateTime(1942, 3, 5, 0, 0, 0, 0, DateTimeKind.Unspecified), "To Be or Not to Be" },
                    { 199, null, "PG-13", "The Borg, a relentless race of cyborgs, are on a direct course for Earth. Violating orders to stay away from the battle, Captain Picard and the crew of the newly-commissioned USS Enterprise E pursue the Borg back in time to prevent the invaders from changing Federation history and assimilating the galaxy.", 111, "English", "/vrC1lkTktFQ4AqBfqf4PXoDDLcw.jpg", 7.2000000000000002, new DateTime(1996, 11, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), "Star Trek: First Contact" },
                    { 204, null, "PG-13", "In the South American jungle, supplies of nitroglycerine are needed at a remote oil field. The oil company pays four men to deliver the supplies in two trucks. A tense rivalry develops between the two sets of drivers on the rough remote roads where the slightest jolt can result in death.", 153, "French", "/dZyZSosIlWcpQkV0f7pXcrV2TQV.jpg", 8.0999999999999996, new DateTime(1953, 4, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Wages of Fear" },
                    { 205, null, "PG-13", "Inspired by true events, this film takes place in Rwanda in the 1990s when more than a million Tutsis were killed in a genocide that went mostly unnoticed by the rest of the world. Hotel owner Paul Rusesabagina houses over a thousand refuges in his hotel in attempt to save their lives.", 121, "English", "/p3pHw85UMZPegfMZBA6dZ06yarm.jpg", 7.7000000000000002, new DateTime(2004, 3, 4, 0, 0, 0, 0, DateTimeKind.Unspecified), "Hotel Rwanda" },
                    { 207, null, "PG", "At an elite, old-fashioned boarding school in New England, a passionate English teacher inspires his students to rebel against convention and seize the potential of every day, courting the disdain of the stern headmaster.", 128, "English", "/ai40gM7SUaGA6fthvsd87o8IQq4.jpg", 8.3000000000000007, new DateTime(1989, 6, 2, 0, 0, 0, 0, DateTimeKind.Unspecified), "Dead Poets Society" },
                    { 212, null, "NR", "Mortimer Brewster, a newspaper drama critic, playwright and author known for his diatribes against marriage, suddenly falls in love and gets married;  but when he makes a quick trip home to tell his two maiden aunts, he finds out his aunts' hobby - killing lonely old men and burying them in the cellar!", 118, "English", "/xG1GEEQGgExKl0WT5sRo1Arst5D.jpg", 7.5999999999999996, new DateTime(1944, 9, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "Arsenic and Old Lace" },
                    { 213, null, "NR", "Advertising man Roger Thornhill is mistaken for a spy, triggering a deadly cross-country chase.", 136, "English", "/9pf8CuIT64cFvsyocWOjbKGcXmt.jpg", 8.0, new DateTime(1959, 7, 8, 0, 0, 0, 0, DateTimeKind.Unspecified), "North by Northwest" },
                    { 216, null, "12", "Emmi Kurowski, a cleaning lady, is lonely in her old age. Her husband died years ago, and her grown children offer little companionship. One night she goes to a bar frequented by Arab immigrants and strikes up a friendship with middle-aged mechanic Ali. Their relationship soon develops into something more, and Emmi's family and neighbors criticize their spontaneous marriage. Soon Emmi and Ali are forced to confront their own insecurities about their future.", 93, "German", "/raYnFIAXuxl3GwVPg1GkODi9dVq.jpg", 7.7999999999999998, new DateTime(1974, 6, 5, 0, 0, 0, 0, DateTimeKind.Unspecified), "Ali: Fear Eats the Soul" },
                    { 218, null, "R", "In the post-apocalyptic future, reigning tyrannical supercomputers teleport a cyborg assassin known as the \"Terminator\" back to 1984 to kill Sarah Connor, whose unborn son is destined to lead insurgents against 21st century mechanical hegemony. Meanwhile, the human-resistance movement dispatches a lone warrior to safeguard Sarah. Can he stop the virtually indestructible killing machine?", 108, "English", "/qvktm0BHcnmDpul4Hz01GIazWPr.jpg", 7.5999999999999996, new DateTime(1984, 10, 26, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Terminator" },
                    { 219, null, "R", "Raimunda lives and works in Madrid with her husband Paco and their daughter Paula. Raimunda's sister Sole lives nearby. The two sisters miss their mother Irene who died several years ago in a house fire along with their father. When a former neighbor from their hometown reports that she has seen the ghost of Irene, the daughters do not believe her. After a murder and a family tragedy, however, Irene's spirit materializes around her daughters to comfort them.", 121, "Spanish", "/ljRPzuI1xybiFUGU1uCRdx68h0K.jpg", 7.5, new DateTime(2006, 3, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), "Volver" },
                    { 220, null, "PG", "In the Salinas Valley in and around World War I, Cal Trask feels he must compete against overwhelming odds with his brother for the love of their father. Cal is frustrated at every turn, from his reaction to the war, how to get ahead in business and in life, and how to relate to his estranged mother.", 115, "English", "/4MXfPlVS5aY6FJlJ5Y0qXsPnNcy.jpg", 7.5999999999999996, new DateTime(1955, 3, 9, 0, 0, 0, 0, DateTimeKind.Unspecified), "East of Eden" },
                    { 221, null, "PG-13", "After moving to a new town, troublemaking teen Jim Stark is supposed to have a clean slate, although being the new kid in town brings its own problems. While searching for some stability, Stark forms a bond with a disturbed classmate, Plato, and falls for local girl Judy. However, Judy is the girlfriend of neighborhood tough, Buzz. When Buzz violently confronts Jim and challenges him to a drag race, the new kid's real troubles begin.", 111, "English", "/qNmYLRadv106IhG6T2wSFH3Bc7W.jpg", 7.5999999999999996, new DateTime(1955, 10, 29, 0, 0, 0, 0, DateTimeKind.Unspecified), "Rebel Without a Cause" },
                    { 223, null, "NR", "Story of a young woman who marries a fascinating widower only to find out that she must live in the shadow of his former wife, Rebecca, who died mysteriously several years earlier. The young wife must come to grips with the terrible secret of her handsome, cold husband, Max De Winter. She must also deal with the jealous, obsessed Mrs. Danvers, the housekeeper, who will not accept her as the mistress of the house.", 130, "English", "/3Gla0nxHboX3nxQzaU4SoqOtTjh.jpg", 8.0, new DateTime(1940, 3, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), "Rebecca" },
                    { 226, null, "R", "A young transgender man explores his gender identity and searches for love in rural Nebraska.", 118, "English", "/mnnGtVKxDyLCsqfHC0WfXCJRJvR.jpg", 7.5, new DateTime(1999, 9, 2, 0, 0, 0, 0, DateTimeKind.Unspecified), "Boys Don't Cry" },
                    { 227, null, "PG", "When two poor Greasers, Johnny, and Ponyboy are assaulted by a vicious gang, the Socs, and Johnny kills one of the attackers, tension begins to mount between the two rival gangs, setting off a turbulent chain of events.", 90, "English", "/t0dy2Q1j9hlQ8kkt0TzGImYNt2C.jpg", 7.2999999999999998, new DateTime(1983, 3, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Outsiders" },
                    { 229, null, "NR", "Bride of Frankenstein begins where James Whale's Frankenstein from 1931 ended. Dr. Frankenstein has not been killed as previously portrayed and now he wants to get away from the mad experiments. Yet when his wife is kidnapped by his creation, Frankenstein agrees to help him create a new monster, this time a woman.", 75, "English", "/5241zUwe7rC17MNc2QpCBKKdp1N.jpg", 7.5999999999999996, new DateTime(1935, 4, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Bride of Frankenstein" },
                    { 234, null, "NR", "Francis, a young man, recalls in his memory the horrible experiences he and his fiancée Jane recently went through. Francis and his friend Alan visit The Cabinet of Dr. Caligari, an exhibit where the mysterious doctor shows the somnambulist Cesare, and awakens him for some moments from his death-like sleep.", 77, "German", "/myK9DeIsXWGKgUTZyGXg2IfFk0W.jpg", 7.9000000000000004, new DateTime(1920, 2, 27, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Cabinet of Dr. Caligari" },
                    { 235, null, "R", "Gordie, Chris, Teddy and Vern are four friends who decide to hike to find the corpse of Ray Brower, a local teenager, who was hit by a train while plucking blueberries in the wild.", 89, "English", "/vz0w9BSehcqjDcJOjRaCk7fgJe7.jpg", 7.9000000000000004, new DateTime(1986, 8, 8, 0, 0, 0, 0, DateTimeKind.Unspecified), "Stand by Me" },
                    { 238, null, "R", "Spanning the years 1945 to 1955, a chronicle of the fictional Italian-American Corleone crime family. When organized crime family patriarch, Vito Corleone barely survives an attempt on his life, his youngest son, Michael steps in to take care of the would-be killers, launching a campaign of bloody revenge.", 175, "English", "/3bhkrj58Vtu7enYsRolD1fZdja1.jpg", 8.6999999999999993, new DateTime(1972, 3, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Godfather" },
                    { 239, null, "NR", "Two musicians witness a mob hit and struggle to find a way out of the city before they are found by the gangsters. Their only opportunity is to join an all-girl band as they leave on a tour. To make their getaway they must first disguise themselves as women, then keep their identities secret and deal with the problems this brings - such as an attractive bandmate and a very determined suitor.", 122, "English", "/2MMgcZpW17fzF9q0yjuFoVDulio.jpg", 8.1999999999999993, new DateTime(1959, 3, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), "Some Like It Hot" },
                    { 240, null, "R", "In the continuing saga of the Corleone crime family, a young Vito Corleone grows up in Sicily and in 1910s New York. In the 1950s, Michael Corleone attempts to expand the family business into Las Vegas, Hollywood and Cuba.", 202, "English", "/hek3koDUyRQk7FIhPXsa6mT2Zc3.jpg", 8.5999999999999996, new DateTime(1974, 12, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Godfather: Part II" },
                    { 242, null, "R", "In the midst of trying to legitimize his business dealings in 1979 New York and Italy, aging mafia don, Michael Corleone seeks forgiveness for his sins while taking a young protege under his wing.", 170, "English", "/lm3pQ2QoQ16pextRsmnUbG2onES.jpg", 7.4000000000000004, new DateTime(1990, 12, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Godfather: Part III" },
                    { 244, null, "NR", "A film crew discovers the \"eighth wonder of the world,\" a giant prehistoric ape, and brings him back to New York, where he wreaks havoc.", 104, "English", "/lHlnxKL5GbgRibyRFI7n1Ey850i.jpg", 7.5999999999999996, new DateTime(1933, 3, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "King Kong" },
                    { 246, null, "R", "Zatoichi is a 19th century blind nomad who makes his living as a gambler and masseur. However, behind this humble facade, he is a master swordsman gifted with a lightning-fast draw and breathtaking precision. While wandering, Zatoichi discovers a remote mountain village at the mercy of Ginzo, a ruthless gang-leader. Ginzo disposes of anyone who gets in his way, especially after hiring the mighty samurai ronin, Hattori, as a bodyguard. After a raucous night of gambling in town, Zatoichi encounters a pair of geishas--as dangerous as they are beautiful--who've come to avenge their parents' murder. As the paths of these and other colorful characters intertwine, Ginzo's henchmen are soon after Zatoichi. With his legendary cane sword at his side, the stage is set for a riveting showdown.", 111, "Japanese", "/iCIycswWbX1EDS6PYYBcR9ohrC.jpg", 7.2999999999999998, new DateTime(2003, 9, 6, 0, 0, 0, 0, DateTimeKind.Unspecified), "Zatoichi" },
                    { 247, null, "NR", "Career criminal Johnny Clay recruits a sharpshooter, a crooked police officer, a bartender and a betting teller named George, among others, for one last job before he goes straight and gets married. But when George tells his restless wife about the scheme to steal millions from the racetrack where he works, she hatches a plot of her own.", 85, "English", "/lnbuDjMNw2mUeJ2NsGF7HMMTWfU.jpg", 7.7000000000000002, new DateTime(1956, 6, 6, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Killing" },
                    { 252, null, "G", "Eccentric candy man Willy Wonka prompts a worldwide frenzy when he announces that golden tickets hidden inside five of his delicious candy bars will admit their lucky holders into his top-secret confectionary. But does Wonka have an agenda hidden amid a world of Oompa Loompas and chocolate rivers?", 100, "English", "/vmpsZkrs4Uvkp9r1atL8B3frA63.jpg", 7.5, new DateTime(1971, 6, 29, 0, 0, 0, 0, DateTimeKind.Unspecified), "Willy Wonka & the Chocolate Factory" },
                    { 255, null, "R", "The third in a series of films featuring François Truffaut's alter-ego, Antoine Doinel, the story resumes with Antoine being discharged from military service. His sweetheart Christine's father lands Antoine a job as a security guard, which he promptly loses. Stumbling into a position assisting a private detective, Antoine falls for his employers' seductive wife, Fabienne, and finds that he must choose between the older woman and Christine.", 90, "French", "/5qHh1Vp2TOOX5IaTVt4wyT8OTnR.jpg", 7.4000000000000004, new DateTime(1968, 9, 4, 0, 0, 0, 0, DateTimeKind.Unspecified), "Stolen Kisses" },
                    { 260, null, "NR", "Richard Hanney has a rude awakening when a glamorous female spy falls into his bed -- with a knife in her back. Having a bit of trouble explaining it all to Scotland Yard, he heads for the hills of Scotland to try to clear his name by locating the spy ring known as \"The 39 Steps.\"", 86, "English", "/paI9Tmqm2cZG6xy4Tnjw3Ydjuw5.jpg", 7.4000000000000004, new DateTime(1935, 6, 6, 0, 0, 0, 0, DateTimeKind.Unspecified), "The 39 Steps" },
                    { 261, null, "NR", "An alcoholic ex-football player drinks his days away, having failed to come to terms with his sexuality and his real feelings for his football buddy who died after an ambiguous accident. His wife is crucified by her desperation to make him desire her: but he resists the affections of his wife. His reunion with his father—who is dying of cancer—jogs a host of memories and revelations for both father and son.", 108, "English", "/vWf1AR8rC6WjGKELlmLv2VAUZJB.jpg", 7.7999999999999998, new DateTime(1958, 8, 29, 0, 0, 0, 0, DateTimeKind.Unspecified), "Cat on a Hot Tin Roof" },
                    { 262, null, "PG", "Aspiring comic Rupert Pupkin attempts to achieve success in show business by stalking his idol, a late night talk-show host who craves his own privacy.", 109, "English", "/m24EbHxT9NGYEkOlu29YcLOgjgK.jpg", 7.7999999999999998, new DateTime(1982, 12, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), "The King of Comedy" },
                    { 266, null, "16", "A philistine in the art film business, Jeremy Prokosch is a producer unhappy with the work of his director. Prokosch has hired Fritz Lang to direct an adaptation of \"The Odyssey,\" but when it seems that the legendary filmmaker is making a picture destined to bomb at the box office, he brings in a screenwriter to energize the script. The professional intersects with the personal when a rift develops between the writer and his wife.", 103, "French", "/kNElbRcp4Qz6wmJ9kH5vdY004Hq.jpg", 7.2000000000000002, new DateTime(1963, 10, 29, 0, 0, 0, 0, DateTimeKind.Unspecified), "Contempt" },
                    { 269, null, "U", "A young car thief kills a policeman and tries to persuade a girl to hide in Italy with him.", 90, "French", "/9Wx0Wdn2EOqeCZU4SP6tlS3LOml.jpg", 7.7000000000000002, new DateTime(1960, 3, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), "Breathless" },
                    { 272, null, "PG-13", "Driven by tragedy, billionaire Bruce Wayne dedicates his life to uncovering and defeating the corruption that plagues his home, Gotham City.  Unable to work within the system, he instead creates a new identity, a symbol of fear for the criminal underworld - The Batman.", 140, "English", "/1P3ZyEq02wcTMd3iE4ebtLvncvH.jpg", 7.7000000000000002, new DateTime(2005, 6, 10, 0, 0, 0, 0, DateTimeKind.Unspecified), "Batman Begins" },
                    { 274, null, "R", "Clarice Starling is a top student at the FBI's training academy. Jack Crawford wants Clarice to interview Dr. Hannibal Lecter, a brilliant psychiatrist who is also a violent psychopath, serving life behind bars for various acts of murder and cannibalism. Crawford believes that Lecter may have insight into a case and that Starling, as an attractive young woman, may be just the bait to draw him out.", 119, "English", "/rplLJ2hPcOQmkFhTqUte0MkEaO2.jpg", 8.3000000000000007, new DateTime(1991, 2, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Silence of the Lambs" },
                    { 275, null, "R", "Jerry, a small-town Minnesota car salesman is bursting at the seams with debt... but he's got a plan. He's going to hire two thugs to kidnap his wife in a scheme to collect a hefty ransom from his wealthy father-in-law. It's going to be a snap and nobody's going to get hurt... until people start dying. Enter Police Chief Marge, a coffee-drinking, parka-wearing - and extremely pregnant - investigator who'll stop at nothing to get her man. And if you think her small-time investigative skills will give the crooks a run for their ransom... you betcha!", 98, "English", "/rt7cpEr1uP6RTZykBFhBTcRaKvG.jpg", 7.9000000000000004, new DateTime(1996, 3, 8, 0, 0, 0, 0, DateTimeKind.Unspecified), "Fargo" },
                    { 278, null, "R", "Framed in the 1940s for the double murder of his wife and her lover, upstanding banker Andy Dufresne begins a new life at the Shawshank prison, where he puts his accounting skills to work for an amoral warden. During his long stretch in prison, Dufresne comes to be admired by the other inmates -- including an older prisoner named Red -- for his integrity and unquenchable sense of hope.", 142, "English", "/q6y0Go1tsGEsmtFryDOJo3dEmqu.jpg", 8.6999999999999993, new DateTime(1994, 9, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Shawshank Redemption" },
                    { 279, null, "R", "Wolfgang Amadeus Mozart is a remarkably talented young Viennese composer who unwittingly finds a fierce rival in the disciplined and determined Antonio Salieri. Resenting Mozart for both his hedonistic lifestyle and his undeniable talent, the highly religious Salieri is gradually consumed by his jealousy and becomes obsessed with Mozart's downfall, leading to a devious scheme that has dire consequences for both men.", 160, "English", "/tsqcwBp1jYZdcceXXoVEby0dZkt.jpg", 8.0, new DateTime(1984, 9, 6, 0, 0, 0, 0, DateTimeKind.Unspecified), "Amadeus" }
                });

            migrationBuilder.InsertData(
                table: "Movies",
                columns: new[] { "Id", "ActorId", "Certification", "Description", "Duration", "Language", "Picture", "Ratings", "ReleaseDate", "Title" },
                values: new object[,]
                {
                    { 280, null, "R", "Nearly 10 years have passed since Sarah Connor was targeted for termination by a cyborg from the future. Now her son, John, the future leader of the resistance, is the target for a newer, more deadly terminator. Once again, the resistance has managed to send a protector back to attempt to save John and his mother Sarah.", 137, "English", "/weVXMD5QBGeQil4HEATZqAkXeEc.jpg", 8.0, new DateTime(1991, 7, 3, 0, 0, 0, 0, DateTimeKind.Unspecified), "Terminator 2: Judgment Day" },
                    { 284, null, "NR", "Bud Baxter is a minor clerk in a huge New York insurance company, until he discovers a quick way to climb the corporate ladder. He lends out his apartment to the executives as a place to take their mistresses. Although he often has to deal with the aftermath of their visits, one night he's left with a major problem to solve.", 125, "English", "/jA7mnWbCYudQXJx89zTsO7BZrn9.jpg", 8.1999999999999993, new DateTime(1960, 6, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Apartment" },
                    { 288, null, "U", "Will Kane, the sheriff of a small town in New Mexico, learns a notorious outlaw he put in jail has been freed, and will be arriving on the noon train. Knowing the outlaw and his gang are coming to kill him, Kane is determined to stand his ground, so he attempts to gather a posse from among the local townspeople.", 85, "English", "/bc1x6kIO9oF30y3IMFuKMJV2uOj.jpg", 7.7000000000000002, new DateTime(1952, 6, 9, 0, 0, 0, 0, DateTimeKind.Unspecified), "High Noon" },
                    { 289, null, "PG", "In Casablanca, Morocco in December 1941, a cynical American expatriate meets a former lover, with unforeseen complications.", 102, "English", "/5K7cOHoay2mZusSLezBOY0Qxh8a.jpg", 8.1999999999999993, new DateTime(1942, 11, 26, 0, 0, 0, 0, DateTimeKind.Unspecified), "Casablanca" },
                    { 290, null, "R", "A renowned New York playwright is enticed to California to write for the movies and discovers the hellish truth of Hollywood.", 116, "English", "/s8Jd8T2UktNkECPfaleruDt3zUf.jpg", 7.5, new DateTime(1991, 8, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "Barton Fink" },
                    { 301, null, "NR", "The sheriff of a small town in southwest Texas must keep custody of a murderer whose brother, a powerful rancher, is trying to help him escape. After a friend is killed trying to muster support for him, he and his deputies - a disgraced drunk and a cantankerous old cripple - must find a way to hold out against the rancher's hired guns until the marshal arrives. In the meantime, matters are complicated by the presence of a young gunslinger - and a mysterious beauty who just came in on the last stagecoach.", 141, "English", "/5hFxzqpucuT3AjnvcO1pHkR122S.jpg", 7.9000000000000004, new DateTime(1959, 3, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), "Rio Bravo" },
                    { 303, null, "U", "In order to help bring Nazis to justice, U.S. government agent T.R. Devlin recruits Alicia Huberman, the American daughter of a convicted German war criminal, as a spy. As they begin to fall for one another, Alicia is instructed to win the affections of Alexander Sebastian, a Nazi hiding out in Brazil. When Sebastian becomes serious about his relationship with Alicia, the stakes get higher, and Devlin must watch her slip further undercover.", 103, "English", "/4RERYb1NIQrJHYY5e8nUlYM7t2z.jpg", 7.7999999999999998, new DateTime(1946, 8, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), "Notorious" },
                    { 307, null, "T", "A realistic portrayal of the underground resistance in Italy in 1945. The film has strong impacting imagery with its mix of fiction and reality that strengthened Italian Neo-realism and the film industry.", 103, "Italian", "/ijGV4v8JxgbNzgEhqKdzHdaZn8a.jpg", 8.0999999999999996, new DateTime(1945, 9, 27, 0, 0, 0, 0, DateTimeKind.Unspecified), "Rome, Open City" },
                    { 309, null, "11", "A grandiose party to celebrate a sixtieth birthday unleashes a family drama with all the lies that conceal horrendous secrets. The eldest son, Christian, stages a showdown with the popular pater familias; his provocative, moving after-dinner speech dislodges all the masks, which finally fall completely as the father-son conflict intensifies and the bewildered guests look on.", 105, "Danish", "/b0YDV5j53Y5xRscI14UieetvNLB.jpg", 7.7000000000000002, new DateTime(1998, 6, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Celebration" },
                    { 311, null, "R", "A former Prohibition-era Jewish gangster returns to the Lower East Side of Manhattan over thirty years later, where he once again must confront the ghosts and regrets of his old life.", 229, "English", "/i0enkzsL5dPeneWnjl1fCWm6L7k.jpg", 8.5, new DateTime(1984, 5, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), "Once Upon a Time in America" },
                    { 319, null, "R", "Clarence marries hooker Alabama, steals cocaine from her pimp, and tries to sell it in Hollywood, while the owners of the coke try to reclaim it.", 120, "English", "/39lXk6ud6KiJgGbbWI2PUKS7y2.jpg", 7.5999999999999996, new DateTime(1993, 9, 9, 0, 0, 0, 0, DateTimeKind.Unspecified), "True Romance" },
                    { 322, null, "R", "The lives of three men who were childhood friends are shattered when one of them has a family tragedy.", 138, "English", "/e2VNohx5jb7I6HUamCuGhKvzXDR.jpg", 7.7000000000000002, new DateTime(2003, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "Mystic River" },
                    { 329, null, "PG-13", "A wealthy entrepreneur secretly creates a theme park featuring living dinosaurs drawn from prehistoric DNA. Before opening day, he invites a team of experts and his two eager grandchildren to experience the park and help calm anxious investors. However, the park is anything but amusing as the security systems go off-line and the dinosaurs escape.", 127, "English", "/9i3plLl89DHMz7mahksDaAo7HIS.jpg", 7.9000000000000004, new DateTime(1993, 6, 11, 0, 0, 0, 0, DateTimeKind.Unspecified), "Jurassic Park" },
                    { 334, null, "R", "An epic mosaic of many interrelated characters in search of happiness, forgiveness, and meaning in the San Fernando Valley.", 189, "English", "/uq2u8HgtLFJkjNq2kHb2jvipIPT.jpg", 7.7000000000000002, new DateTime(1999, 12, 10, 0, 0, 0, 0, DateTimeKind.Unspecified), "Magnolia" },
                    { 335, null, "T", "As the railroad builders advance unstoppably through the Arizona desert on their way to the sea, Jill arrives in the small town of Flagstone with the intention of starting a new life.", 166, "Italian", "/qbYgqOczabWNn2XKwgMtVrntD6P.jpg", 8.3000000000000007, new DateTime(1968, 12, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), "Once Upon a Time in the West" },
                    { 336, null, "PG", "At the beginning of the 1913 Mexican Revolution, greedy bandit Juan Miranda and idealist John H. Mallory, an Irish Republican Army explosives expert on the lam from the British, fall in with a band of revolutionaries plotting to strike a national bank. When it turns out that the government has been using the bank as a hiding place for illegally detained political prisoners -- who are freed by the blast -- Miranda becomes a revolutionary hero against his will.", 157, "Italian", "/nWmAtZf83qpOai0fzehf7Hn1S3R.jpg", 7.7999999999999998, new DateTime(1971, 10, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), "Duck, You Sucker" },
                    { 338, null, "R", "An affectionate and refreshing East/West-Germany comedy about a boy whose mother was in a coma while the Berlin wall fell and when she wakes up he must try to keep her from learning what happened (as she was an avid communist supporter) to avoid shocking her which could lead to another heart attack.", 121, "German", "/2MTa1vMnOH9w2FLOINiSY3sJcAe.jpg", 7.5, new DateTime(2003, 2, 9, 0, 0, 0, 0, DateTimeKind.Unspecified), "Good Bye Lenin!" },
                    { 339, null, "R", "An anthology of 5 different cab drivers in 5 American and European cities and their remarkable fares on the same eventful night.", 128, "English", "/ktejUHCo6c8DekpOtR3uSb6oDXr.jpg", 7.5999999999999996, new DateTime(1991, 12, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), "Night on Earth" },
                    { 340, null, "PG-13", "A young Jewish American man endeavors—with the help of eccentric, distant relatives—to find the woman who saved his grandfather during World War II—in a Ukrainian village which was ultimately razed by the Nazis.", 106, "English", "/q1NS6tyZBAlnmnfSKP3goezEE0A.jpg", 7.2999999999999998, new DateTime(2005, 9, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), "Everything is Illuminated" },
                    { 343, null, "PG", "The young Harold lives in his own world of suicide-attempts and funeral visits to avoid the misery of his current family and home environment. Harold meets an 80-year-old woman named Maude who also lives in her own world yet one in which she is having the time of her life. When the two opposites meet they realize that their differences don’t matter and they become best friends and love each other.", 91, "English", "/9qf5iOYuUUggYST1byTBRFNz5tg.jpg", 7.7000000000000002, new DateTime(1971, 12, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), "Harold and Maude" },
                    { 345, null, "R", "After Dr. Bill Harford's wife, Alice, admits to having sexual fantasies about a man she met, Bill becomes obsessed with having a sexual encounter. He discovers an underground sexual group and attends one of their meetings -- and quickly discovers that he is in over his head.", 159, "English", "/a0YOhU3zq0RkOYrVlPXCeE1oFkR.jpg", 7.4000000000000004, new DateTime(1999, 7, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), "Eyes Wide Shut" },
                    { 346, null, "NR", "A samurai answers a village's request for protection after he falls on hard times. The town needs protection from bandits, so the samurai gathers six others to help him teach the people how to defend themselves, and the villagers provide the soldiers with food. A giant battle occurs when 40 bandits attack the village.", 207, "Japanese", "/1wCRVLGI7SoTOoDRzWlbt2dMDuy.jpg", 8.4000000000000004, new DateTime(1954, 4, 26, 0, 0, 0, 0, DateTimeKind.Unspecified), "Seven Samurai" },
                    { 348, null, "R", "During its return to the earth, commercial spaceship Nostromo intercepts a distress signal from a distant planet. When a three-member team of the crew discovers a chamber containing thousands of eggs on the planet, a creature inside one of the eggs attacks an explorer. The entire crew is unaware of the impending nightmare set to descend upon them when the alien parasite planted inside its unfortunate host is birthed.", 117, "English", "/vfrQk5IPloGg1v9Rzbh2Eg3VGyM.jpg", 8.0999999999999996, new DateTime(1979, 5, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "Alien" },
                    { 350, null, "PG-13", "Andy moves to New York to work in the fashion industry. Her boss is extremely demanding, cruel and won't let her succeed if she doesn't fit into the high class elegant look of their magazine.", 109, "English", "/vJDNtAsMsQNfy8uG6jy9HnlVXYo.jpg", 7.4000000000000004, new DateTime(2006, 6, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Devil Wears Prada" },
                    { 363, null, "R", "Head On is German director Fatih Akin’s story of the alcoholic Cahit and Turkish Sibel. Akin tells the story of a love that can never be between two people who are too alike to not be together.", 121, "German", "/5cPrr36unu3TTbdLdrfV1o7t8Sp.jpg", 7.5, new DateTime(2004, 3, 11, 0, 0, 0, 0, DateTimeKind.Unspecified), "Head-On" },
                    { 377, null, "R", "Teenagers in a small town are dropping like flies, apparently in the grip of mass hysteria causing their suicides. A cop's daughter, Nancy Thompson, traces the cause to child molester Fred Krueger, who was burned alive by angry parents many years before. Krueger has now come back in the dreams of his killers' children, claiming their lives as his revenge. Nancy and her boyfriend, Glen, must devise a plan to lure the monster out of the realm of nightmares and into the real world...", 91, "English", "/wGTpGGRMZmyFCcrY2YoxVTIBlli.jpg", 7.2999999999999998, new DateTime(1984, 11, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), "A Nightmare on Elm Street" },
                    { 379, null, "R", "Set in 1929, a political boss and his advisor have a parting of the ways when they both fall for the same woman.", 115, "English", "/ab3pnsTKp3BgcAFy0FgWBFBg9FL.jpg", 7.5, new DateTime(1990, 9, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), "Miller's Crossing" },
                    { 380, null, "R", "Selfish yuppie Charlie Babbitt's father left a fortune to his savant brother Raymond and a pittance to Charlie; they travel cross-country.", 134, "English", "/8L6EMburnnVx8cvQmhGgC826JNc.jpg", 7.7999999999999998, new DateTime(1988, 12, 11, 0, 0, 0, 0, DateTimeKind.Unspecified), "Rain Man" },
                    { 381, null, "PG", "An ex-thief is accused of enacting a new crime spree, so to clear his name he sets off to catch the new thief, who’s imitating his signature style.", 107, "English", "/9UdAlTenWqxj2l5oFExkjuVHmKO.jpg", 7.4000000000000004, new DateTime(1955, 8, 3, 0, 0, 0, 0, DateTimeKind.Unspecified), "To Catch a Thief" },
                    { 387, null, "R", "A German submarine hunts allied ships during the Second World War, but it soon becomes the hunted. The crew tries to survive below the surface, while stretching both the boat and themselves to their limits.", 150, "German", "/eSdji6BTfeCzC9SHUXwo4UFUbT7.jpg", 8.0999999999999996, new DateTime(1981, 9, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), "Das Boot" },
                    { 388, null, "R", "When an armed, masked gang enter a Manhattan bank, lock the doors and take hostages, the detective assigned to effect their release enters negotiations preoccupied with corruption charges he is facing.", 129, "English", "/mf4i9zZVXMmqWsEb9D0OAY7k3t.jpg", 7.4000000000000004, new DateTime(2006, 3, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), "Inside Man" },
                    { 389, null, "NR", "The defense and the prosecution have rested and the jury is filing into the jury room to decide if a young Spanish-American is guilty or innocent of murdering his father. What begins as an open and shut case soon becomes a mini-drama of each of the jurors' prejudices and preconceptions about the trial, the accused, and each other.", 97, "English", "/ppd84D2i9W8jXmsyInGyihiSyqz.jpg", 8.5, new DateTime(1957, 4, 10, 0, 0, 0, 0, DateTimeKind.Unspecified), "12 Angry Men" },
                    { 391, null, "R", "The Man With No Name enters the Mexican village of San Miguel in the midst of a power struggle among the three Rojo brothers and sheriff John Baxter. When a regiment of Mexican soldiers bearing gold intended to pay for new weapons is waylaid by the Rojo brothers, the stranger inserts himself into the middle of the long-simmering battle, selling false information to both sides for his own benefit.", 99, "Italian", "/lBwOEpwVeUAmrmglcstnaGcJq3Y.jpg", 7.9000000000000004, new DateTime(1964, 1, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), "A Fistful of Dollars" },
                    { 393, null, "R", "The Bride unwaveringly continues on her roaring rampage of revenge against the band of assassins who had tried to kill her and her unborn child. She visits each of her former associates one-by-one, checking off the victims on her Death List Five until there's nothing left to do … but kill Bill.", 136, "English", "/2yhg0mZQMhDyvUQ4rG1IZ4oIA8L.jpg", 7.9000000000000004, new DateTime(2004, 4, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), "Kill Bill: Vol. 2" },
                    { 396, null, "NR", "A bitter, aging couple, with the help of alcohol, use a young couple to fuel anguish and emotional pain towards each other.", 131, "English", "/mC4kv6O02wqkKa48WKQPrl6dsVV.jpg", 7.7999999999999998, new DateTime(1966, 6, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), "Who's Afraid of Virginia Woolf?" },
                    { 403, null, "PG", "The story of an old Jewish widow named Daisy Werthan and her relationship with her black chauffeur, Hoke. From an initial mere work relationship grew in 25 years a strong friendship between the two very different characters in a time when those types of relationships where shunned.", 99, "English", "/iaCzvcY42HihFxQBTZCTKMpsI0P.jpg", 7.2999999999999998, new DateTime(1989, 12, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), "Driving Miss Daisy" },
                    { 404, null, "G", "A retired farmer and widower in his 70s, Alvin Straight learns one day that his distant brother Lyle has suffered a stroke and may not recover. Alvin is determined to make things right with Lyle while he still can, but his brother lives in Wisconsin, while Alvin is stuck in Iowa with no car and no driver's license. Then he hits on the idea of making the trip on his old lawnmower, thus beginning a picturesque and at times deeply spiritual odyssey.", 112, "English", "/tT9cMiVDdtlcdZxOoFy3VRmEoKk.jpg", 7.7000000000000002, new DateTime(1999, 10, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Straight Story" },
                    { 405, null, "NR", "When Gelsomina, a naïve young woman, is purchased from her impoverished mother by brutish circus strongman Zampanò to be his wife and partner, she loyally endures her husband's coldness and abuse as they travel the Italian countryside performing together. Soon Zampanò must deal with his jealousy and conflicted feelings about Gelsomina when she finds a kindred spirit in Il Matto, the carefree circus fool, and contemplates leaving Zampanò.", 115, "Italian", "/zykmPmJCwFdrrbmbsRcirYxXn7Q.jpg", 8.0, new DateTime(1954, 9, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), "La Strada" },
                    { 406, null, "NR", "After a chaotic night of rioting in a marginal suburb of Paris, three young friends, Vinz, Hubert and Saïd, wander around unoccupied waiting for news about the state of health of a mutual friend who has been seriously injured when confronting the police.", 98, "French", "/akrPnklXaXZWqodM3HmPSXvfcPF.jpg", 8.0999999999999996, new DateTime(1995, 5, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "La Haine" },
                    { 422, null, "NR", "Guido Anselmi, a film director, finds himself creatively barren at the peak of his career. Urged by his doctors to rest, Anselmi heads for a luxurious resort, but a sorry group gathers—his producer, staff, actors, wife, mistress, and relatives—each one begging him to get on with the show. In retreat from their dependency, he fantasizes about past women and dreams of his childhood.", 139, "Italian", "/9wvOlM8f3obvG9tNTkpZvF0CUU1.jpg", 8.3000000000000007, new DateTime(1963, 2, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), "8½" },
                    { 423, null, "R", "The true story of pianist Władysław Szpilman's experiences in Warsaw during the Nazi occupation. When the Jews of the city find themselves forced into a ghetto, Szpilman finds work playing in a café; and when his family is deported in 1942, he stays behind, works for a while as a laborer, and eventually goes into hiding in the ruins of the war-torn city.", 150, "English", "/3DzePKMbLMIM636S6syCy3cLPqj.jpg", 8.4000000000000004, new DateTime(2002, 9, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Pianist" },
                    { 424, null, "R", "The true story of how businessman Oskar Schindler saved over a thousand Jewish lives from the Nazis while they worked as slaves in his factory during World War II.", 195, "English", "/sF1U4EUQS8YHUYjNl3pMGNIQyr0.jpg", 8.5999999999999996, new DateTime(1993, 11, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Schindler's List" }
                });

            migrationBuilder.InsertData(
                table: "Movies",
                columns: new[] { "Id", "ActorId", "Certification", "Description", "Duration", "Language", "Picture", "Ratings", "ReleaseDate", "Title" },
                values: new object[,]
                {
                    { 425, null, "PG", "With the impending ice age almost upon them, a mismatched trio of prehistoric critters – Manny the woolly mammoth, Diego the saber-toothed tiger and Sid the giant sloth – find an orphaned infant and decide to return it to its human parents. Along the way, the unlikely allies become friends but, when enemies attack, their quest takes on far nobler aims.", 81, "English", "/gLhHHZUzeseRXShoDyC4VqLgsNv.jpg", 7.2999999999999998, new DateTime(2002, 3, 10, 0, 0, 0, 0, DateTimeKind.Unspecified), "Ice Age" },
                    { 426, null, "PG", "A retired San Francisco detective suffering from acrophobia investigates the strange activities of an old friend's wife, all the while becoming dangerously obsessed with her.", 128, "English", "/15uOEfqBNTVtDUT7hGBVCka0rZz.jpg", 8.1999999999999993, new DateTime(1958, 5, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), "Vertigo" },
                    { 427, null, "e Livre", "Genial, bumbling Monsieur Hulot loves his top-floor apartment in a grimy corner of the city, and cannot fathom why his sister's family has moved to the suburbs. Their house is an ultra-modern nightmare, which Hulot only visits for the sake of stealing away his rambunctious young nephew. Hulot's sister, however, wants to win him over to her new way of life, and conspires to set him up with a wife and job.", 118, "French", "/wH6RyPiXFy8INLbViVkchLVOmBc.jpg", 7.4000000000000004, new DateTime(1958, 5, 10, 0, 0, 0, 0, DateTimeKind.Unspecified), "Mon Oncle" },
                    { 429, null, "R", "While the Civil War rages between the Union and the Confederacy, three men – a quiet loner, a ruthless hit man and a Mexican bandit – comb the American Southwest in search of a strongbox containing $200,000 in stolen gold.", 161, "Italian", "/eWivEg4ugIMAd7d4uWI37b17Cgj.jpg", 8.5, new DateTime(1966, 12, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Good, the Bad and the Ugly" },
                    { 430, null, "e 10", "C.R. MacNamara will do anything to get a promotion within the Coca-Cola company, including looking after boss W.P. Hazeltine's rebellious teenage daughter, Scarlett. When Scarlett visits Berlin, where C.R. is stationed, she reveals that she is married to a communist named Otto Piffl -- and C.R. recognizes that Otto's anti-establishment stance will clash with his boss's own political views, possibly jeopardizing his promotion.", 115, "English", "/A2o9SzOgrE9secTLZpYRgiWKofs.jpg", 7.7000000000000002, new DateTime(1961, 12, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "One, Two, Three" },
                    { 433, null, "G", "A magical nanny employs music and adventure to help two neglected children become closer to their father.", 139, "English", "/ei8hhYCMfURfPOXKBnyl61be2iV.jpg", 7.5999999999999996, new DateTime(1964, 8, 27, 0, 0, 0, 0, DateTimeKind.Unspecified), "Mary Poppins" },
                    { 436, null, "R", "A pregnant Colombian teenager becomes a drug mule to make some desperately needed money for her family.", 101, "Spanish", "/uNiu0ybWivhRqX4jQyLLb96gR23.jpg", 7.2999999999999998, new DateTime(2004, 1, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), "Maria Full of Grace" },
                    { 439, null, "NR", "Journalist and man-about-town Marcello struggles to find his place in the world, torn between the allure of Rome's elite social scene and the stifling domesticity offered by his girlfriend, all the while searching for a way to become a serious writer.", 176, "Italian", "/5Zq9pAs3Y9TrFHxO0nEbq3QVTtj.jpg", 8.1999999999999993, new DateTime(1960, 2, 5, 0, 0, 0, 0, DateTimeKind.Unspecified), "La Dolce Vita" },
                    { 451, null, "R", "Ben Sanderson, an alcoholic Hollywood screenwriter who lost everything because of his drinking, arrives in Las Vegas to drink himself to death. There, he meets and forms an uneasy friendship and non-interference pact with prostitute Sera.", 111, "English", "/6HdPc8Cvw0v6SuX3DLsZty3f9Ll.jpg", 7.2999999999999998, new DateTime(1995, 10, 27, 0, 0, 0, 0, DateTimeKind.Unspecified), "Leaving Las Vegas" },
                    { 453, null, "PG-13", "John Nash is a brilliant but asocial mathematician fighting schizophrenia. After he accepts secret work in cryptography, his life takes a turn for the nightmarish.", 135, "English", "/zwzWCmH72OSC9NA0ipoqw5Zjya8.jpg", 7.7999999999999998, new DateTime(2001, 12, 11, 0, 0, 0, 0, DateTimeKind.Unspecified), "A Beautiful Mind" },
                    { 457, null, "6", "The young Bavarian princess Elisabeth, who all call Sissi, goes with her mother and older sister Néné to Austria where Néné will be wed to an emperor named Franz Joseph, Yet unexpectedly Franz runs into Sissi while out fishing and they fall in love.", 102, "German", "/zTAyOq9FTaw3vurMJcura0OEBn9.jpg", 7.2999999999999998, new DateTime(1955, 12, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), "Sissi" },
                    { 459, null, "6", "After a wonderful time in Hungary Sissi falls extremely ill and must retreat to a Mediterranean climate to rest. The young empress’ mother takes her from Austria to recover in Madeira.", 109, "German", "/6LQaN8KGQcakpRHkGac2FqWfLxQ.jpg", 7.2999999999999998, new DateTime(1957, 12, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), "Sissi: The Fateful Years of an Empress" },
                    { 462, null, "R", "A twice-divorced mother of three who sees an injustice, takes on the bad guy and wins -- with a little help from her push-up bra. Erin goes to work for an attorney and comes across medical records describing illnesses clustered in one nearby town. She starts investigating and soon exposes a monumental cover-up.", 131, "English", "/xbMEHLu36LyptPD29FxVTndpYZ1.jpg", 7.4000000000000004, new DateTime(2000, 3, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), "Erin Brockovich" },
                    { 469, null, "AL", "Rootless Hungarian émigré Willie, his pal Eddie, and visiting sixteen-year-old cousin Eva always manage to make the least of any situation, whether aimlessly traversing the drab interiors and environs of New York City, Cleveland, or an anonymous Florida suburb.", 89, "English", "/xo3gzcdeyC6YO3dpW1K875my48p.jpg", 7.2000000000000002, new DateTime(1984, 10, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "Stranger Than Paradise" },
                    { 470, null, "R", "This is the story of three gentle persons: Paul Rivers, an ailing mathematician lovelessly married to an English émigré; Christina Peck, an upper-middle-class suburban housewife, happily married and mother of two little girl; and Jack Jordan, an ex-convict who has found in his Christian faith the strength to raise a family. They will be brought together by a terrible accident that will change their lives. By the final frame, none of them will be the same as they will learn harsh truths about love, faith, courage, desire and guilt, and how chance can change our worlds irretrievably—forever.", 124, "English", "/wZ0l6or5juuVWqDkLEgaghs4f9l.jpg", 7.2999999999999998, new DateTime(2003, 3, 5, 0, 0, 0, 0, DateTimeKind.Unspecified), "21 Grams" },
                    { 475, null, "R", "In the 1930s, bored waitress Bonnie Parker falls in love with an ex-con named Clyde Barrow and together they start a violent crime spree through the country, stealing cars and robbing banks.", 110, "English", "/sE0B42SAVLga4Qwzt4IgqwEsEUQ.jpg", 7.5, new DateTime(1967, 7, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), "Bonnie and Clyde" },
                    { 488, null, "PG", "At the start of the First World War, in the middle of Africa’s nowhere, a gin soaked riverboat captain is persuaded by a strong-willed missionary to go down river and face-off a German warship.", 105, "English", "/nSXgNRzjfqwH9iX25qiuHozGmGB.jpg", 7.4000000000000004, new DateTime(1952, 1, 7, 0, 0, 0, 0, DateTimeKind.Unspecified), "The African Queen" },
                    { 489, null, "R", "Will Hunting has a genius-level IQ but chooses to work as a janitor at MIT. When he solves a difficult graduate-level math problem, his talents are discovered by Professor Gerald Lambeau, who decides to help the misguided youth reach his potential. When Will is arrested for attacking a police officer, Professor Lambeau makes a deal to get leniency for him if he will get treatment from therapist Sean Maguire.", 127, "English", "/bABCBKYBK7A5G1x0FzoeoNfuj2.jpg", 8.0999999999999996, new DateTime(1997, 12, 5, 0, 0, 0, 0, DateTimeKind.Unspecified), "Good Will Hunting" },
                    { 490, null, "NR", "When disillusioned Swedish knight Antonius Block returns home from the Crusades to find his country in the grips of the Black Death, he challenges Death to a chess match for his life. Tormented by the belief that God does not exist, Block sets off on a journey, meeting up with traveling players Jof and his wife, Mia, and becoming determined to evade Death long enough to commit one redemptive act while he still lives.", 96, "Swedish", "/gOIVE53CEGdKRNrrdR3I6rsb8lM.jpg", 8.1999999999999993, new DateTime(1957, 2, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Seventh Seal" },
                    { 492, null, "R", "One day at work, unsuccessful puppeteer Craig finds a portal into the head of actor John Malkovich. The portal soon becomes a passion for anybody who enters its mad and controlling world of overtaking another human body.", 113, "English", "/oS3zTDxqHtyKDidHHvG66P7Mcg.jpg", 7.4000000000000004, new DateTime(1999, 10, 29, 0, 0, 0, 0, DateTimeKind.Unspecified), "Being John Malkovich" },
                    { 497, null, "R", "A supernatural tale set on death row in a Southern prison, where gentle giant John Coffey possesses the mysterious power to heal people's ailments. When the cell block's head guard, Paul Edgecomb, recognizes Coffey's miraculous gift, he tries desperately to help stave off the condemned man's execution.", 189, "English", "/velWPhVMQeQKcxggNEU8YmIo52R.jpg", 8.5, new DateTime(1999, 12, 10, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Green Mile" },
                    { 499, null, null, "Agnès Varda eloquently captures Paris in the sixties with this real-time portrait of a singer set adrift in the city as she awaits test results of a biopsy. A chronicle of the minutes of one woman’s life, Cléo from 5 to 7 is a spirited mix of vivid vérité and melodrama, featuring a score by Michel Legrand and cameos by Jean-Luc Godard and Anna Karina.", 90, "French", "/hvprnfDDRE4boZjH6x9xF9Q8NJV.jpg", 7.7999999999999998, new DateTime(1962, 4, 11, 0, 0, 0, 0, DateTimeKind.Unspecified), "Cléo from 5 to 7" },
                    { 500, null, "R", "A botched robbery indicates a police informant, and the pressure mounts in the aftermath at a warehouse. Crime begets violence as the survivors -- veteran Mr. White, newcomer Mr. Orange, psychopathic parolee Mr. Blonde, bickering weasel Mr. Pink and Nice Guy Eddie -- unravel.", 99, "English", "/AjTtJNumZyUDz33VtMlF1K8JPsE.jpg", 8.1999999999999993, new DateTime(1992, 9, 2, 0, 0, 0, 0, DateTimeKind.Unspecified), "Reservoir Dogs" },
                    { 502, null, "NR", "Because of a technical defect an American bomber team mistakenly orders the destruction of Moscow. The President of the United States has but little time to prevent an atomic catastrophe from occurring.", 112, "English", "/qrsj5hort5xkLOKw9NyraGMnlVP.jpg", 7.7999999999999998, new DateTime(1964, 10, 7, 0, 0, 0, 0, DateTimeKind.Unspecified), "Fail Safe" },
                    { 504, null, "R", "An emotionally scarred highway drifter shoots a sadistic trick who rapes her, and ultimately becomes the United States' first female serial killer.", 110, "English", "/aevmNtJCNG4ZlfEeEGZ79frMUes.jpg", 7.2000000000000002, new DateTime(2003, 12, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), "Monster" },
                    { 506, null, "PG", "Marnie is a thief, a liar, and a cheat. When her new boss, Mark Rutland, catches on to her routine kleptomania, she finds herself being blackmailed.", 131, "English", "/itd4eQVOCLvyi17yNXGAC0TmWzJ.jpg", 7.2000000000000002, new DateTime(1964, 7, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), "Marnie" },
                    { 509, null, "PG-13", "William Thacker is a London bookstore owner whose humdrum existence is thrown into romantic turmoil when famous American actress Anna Scott appears in his shop. A chance encounter over spilled orange juice leads to a kiss that blossoms into a full-blown affair. As the average bloke and glamorous movie star draw closer and closer together, they struggle to reconcile their radically different lifestyles in the name of love.", 124, "English", "/cBpef6K40Su2CcBb3c18WdwRFCL.jpg", 7.2000000000000002, new DateTime(1999, 5, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), "Notting Hill" },
                    { 510, null, "R", "While serving time for insanity at a state mental hospital, implacable rabble-rouser, Randle Patrick McMurphy, inspires his fellow patients to rebel against the authoritarian rule of head nurse, Mildred Ratched.", 133, "English", "/3jcbDmRFiQ83drXNOvRDeKHxS0C.jpg", 8.4000000000000004, new DateTime(1975, 11, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), "One Flew Over the Cuckoo's Nest" },
                    { 521, null, "PG", "An ex-tennis pro carries out a plot to have his wife murdered after discovering she is having an affair, and assumes she will soon leave him for the other man anyway. When things go wrong, he improvises a new plan—to frame her for murder instead.", 105, "English", "/xrpK1PyckNWmRxU4kZURfaCyboS.jpg", 8.0, new DateTime(1954, 5, 29, 0, 0, 0, 0, DateTimeKind.Unspecified), "Dial M for Murder" },
                    { 522, null, "R", "The mostly true story of the legendary \"worst director of all time\", who, with the help of his strange friends, filmed countless B-movies without ever becoming famous or successful.", 127, "English", "/ilNYwPc8v5jyGl2F7srrEJLUboK.jpg", 7.5, new DateTime(1994, 9, 27, 0, 0, 0, 0, DateTimeKind.Unspecified), "Ed Wood" },
                    { 524, null, "R", "In early-1970s Las Vegas, low-level mobster Sam \"Ace\" Rothstein gets tapped by his bosses to head the Tangiers Casino. At first, he's a great success in the job, but over the years, problems with his loose-cannon enforcer Nicky Santoro, his ex-hustler wife Ginger, her con-artist ex Lester Diamond and a handful of corrupt politicians put Sam in ever-increasing danger.", 179, "English", "/4TS5O1IP42bY2BvgMxL156EENy.jpg", 8.0, new DateTime(1995, 11, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), "Casino" },
                    { 525, null, "R", "Jake Blues, just released from prison, puts his old band back togther to save the Catholic home where he and his brother Elwood were raised.", 133, "English", "/3DiSrcYELCLkwnjl9EZp2pkKGep.jpg", 7.7000000000000002, new DateTime(1980, 6, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Blues Brothers" },
                    { 527, null, "R", "A drama about a Maori family living in Auckland, New Zealand. Lee Tamahori tells the story of Beth Heke’s strong will to keep her family together during times of unemployment and abuse from her violent and alcoholic husband.", 99, "English", "/1nd4SsytVc96hy92g8NNVPD3mzf.jpg", 7.5, new DateTime(1994, 9, 2, 0, 0, 0, 0, DateTimeKind.Unspecified), "Once Were Warriors" },
                    { 530, null, "NR", "Wallace and Gromit have run out of cheese and this provides an excellent excuse for the animated duo to take their holiday on the moon, where, as everyone knows, there is ample cheese. The moon is inhabited by a mechanical caretaker, who is not too happy about the two visitors from earth that nibble on the moon.", 23, "English", "/sOpRGXsYAXDCQn6Yy7mTFnVmknL.jpg", 7.5, new DateTime(1990, 5, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), "A Grand Day Out" },
                    { 531, null, "NR", "Gromit finds himself being pushed out of his room and home by a new lodger who is actually a ruthless criminal (and a small penguin). The penguin is planning a robbery and needs to use Wallace and his mechanical remote controlled trousers to pull off the raid. However, Gromit is wise to the penguin and comes to the rescue.", 30, "English", "/wRTCxYHx1d9diFFmOHQZT7CjdUV.jpg", 7.7000000000000002, new DateTime(1993, 12, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Wrong Trousers" },
                    { 532, null, "NR", "Wallace falls in love with wool-shop owner Wendolene, not suspecting that she (or rather, her dog) is at the head of a fiendish sheep-rustling plot. Gromit is set up and jailed, but his new-found sheepish friend is determined to give Wallace a helping hand in finding out the real truth.", 30, "English", "/7e24jyYlWoho8Vqwj7fCb6TCNk5.jpg", 7.5, new DateTime(1995, 4, 10, 0, 0, 0, 0, DateTimeKind.Unspecified), "A Close Shave" },
                    { 539, null, "R", "When larcenous real estate clerk Marion Crane goes on the lam with a wad of cash and hopes of starting a new life, she ends up at the notorious Bates Motel, where manager Norman Bates cares for his housebound mother.", 109, "English", "/5j5tdV8tMTy7FBdSNiYxp9Fj1Or.jpg", 8.4000000000000004, new DateTime(1960, 6, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), "Psycho" },
                    { 548, null, "NR", "Brimming with action while incisively examining the nature of truth, \"Rashomon\" is perhaps the finest film ever to investigate the philosophy of justice. Through an ingenious use of camera and flashbacks, Kurosawa reveals the complexities of human nature as four people recount different versions of the story of a man's murder and the rape of his wife.", 88, "Japanese", "/mwNCpjejHwq9KlpNB2gKII2yvbr.jpg", 8.1999999999999993, new DateTime(1950, 8, 26, 0, 0, 0, 0, DateTimeKind.Unspecified), "Rashomon" },
                    { 550, null, "R", "A ticking-time-bomb insomniac and a slippery soap salesman channel primal male aggression into a shocking new form of therapy. Their concept catches on, with underground \"fight clubs\" forming in every town, until an eccentric gets in the way and ignites an out-of-control spiral toward oblivion.", 139, "English", "/8kNruSfhk5IoE4eZOc4UpvDn6tq.jpg", 8.4000000000000004, new DateTime(1999, 10, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Fight Club" },
                    { 553, null, "R", "A barren soundstage is stylishly utilized to create a minimalist small-town setting in which a mysterious woman named Grace hides from the criminals who pursue her. The town is two-faced and offers to harbor Grace as long as she can make it worth their effort, so Grace works hard under the employ of various townspeople to win their favor. Tensions flare, however, and Grace's status as a helpless outsider provokes vicious contempt and abuse from the citizens of Dogville.", 178, "English", "/80iFKwaNumOuk5xDKSoS5H3qICc.jpg", 7.7999999999999998, new DateTime(2003, 5, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), "Dogville" },
                    { 562, null, "R", "NYPD cop John McClane's plan to reconcile with his estranged wife is thrown for a serious loop when, minutes after he arrives at her office, the entire building is overtaken by a group of terrorists. With little help from the LAPD, wisecracking McClane sets out to single-handedly rescue the hostages and bring the bad guys down.", 131, "English", "/yFihWxQcmqcaBR31QM6Y8gT6aYV.jpg", 7.7000000000000002, new DateTime(1988, 7, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Die Hard" },
                    { 567, null, "PG", "A wheelchair-bound photographer spies on his neighbors from his apartment window and becomes convinced one of them has committed murder.", 112, "English", "/qitnZcLP7C9DLRuPpmvZ7GiEjJN.jpg", 8.4000000000000004, new DateTime(1954, 9, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "Rear Window" }
                });

            migrationBuilder.InsertData(
                table: "Movies",
                columns: new[] { "Id", "ActorId", "Certification", "Description", "Duration", "Language", "Picture", "Ratings", "ReleaseDate", "Title" },
                values: new object[,]
                {
                    { 568, null, "PG", "The true story of technical troubles that scuttle the Apollo 13 lunar mission in 1970, risking the lives of astronaut Jim Lovell and his crew, with the failed journey turning into a thrilling saga of heroism. Drifting more than 200,000 miles from Earth, the astronauts work furiously with the ground crew to avert tragedy.", 140, "English", "/jokiCLdNS58eJTALfNcerQRhwAo.jpg", 7.4000000000000004, new DateTime(1995, 6, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Apollo 13" },
                    { 571, null, "PG-13", "Chic socialite Melanie Daniels enjoys a passing flirtation with an eligible attorney in a San Francisco pet shop and, on an impulse, follows him to his hometown bearing a gift of lovebirds. But upon her arrival, the bird population runs amok. Suddenly, the townsfolk face a massive avian onslaught, with the feathered fiends inexplicably attacking people all over Bodega Bay.", 119, "English", "/z0iYrJ6GsAMP3abOha7uGMuc5kZ.jpg", 7.5, new DateTime(1963, 3, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Birds" },
                    { 574, null, "PG", "A widescreen, Technicolor remake by Hitchcock of his 1934 film of the same title. A couple vacationing in Morocco with their young son accidentally stumble upon an assassination plot. When the child is kidnapped to ensure their silence, they have to take matters into their own hands to save him.", 120, "English", "/gy8YBRjCQRIT9x9G9F5fpnFD4xw.jpg", 7.5, new DateTime(1956, 5, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Man Who Knew Too Much" },
                    { 575, null, "16", "Das Experiment is a shocking psycho thriller about the potential for brutality that humans hide. Even more shocking is the fact that it’s based on an actual occurrence — a 1971 psychological experiment at Stanford University that was aborted prematurely when the experimenters lost control.", 120, "German", "/nIAJnivbh5N8gpbyVmtPFC9psON.jpg", 7.5, new DateTime(2001, 3, 7, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Experiment" },
                    { 576, null, "R", "Aging outlaw, Pike Bishop prepares to retire after one final robbery. Joined by his gang, Dutch Engstrom and brothers Lyle and Tector Gorch, Bishop discovers the heist is a setup orchestrated in part by a former partner, Deke Thornton. As the remaining gang takes refuge in Mexican territory, Thornton trails them—resulting in fierce gunfights with plenty of casualties.", 145, "English", "/zZhp7p8qvfVrSLKpOFHcKjpEj8f.jpg", 7.7000000000000002, new DateTime(1969, 6, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Wild Bunch" },
                    { 578, null, "PG", "When an insatiable great white shark terrorizes the townspeople of Amity Island, the police chief, an oceanographer and a grizzled shark hunter seek to destroy the blood-thirsty beast.", 124, "English", "/s2xcqSFfT6F7ZXHxowjxfG0yisT.jpg", 7.5999999999999996, new DateTime(1975, 6, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), "Jaws" },
                    { 581, null, "PG-13", "Wounded Civil War soldier, John Dunbar tries to commit suicide—and becomes a hero instead. As a reward, he's assigned to his dream post, a remote junction on the Western frontier, and soon makes unlikely friends with the local Sioux tribe.", 181, "English", "/cvaBVpS0GzKqBd63pFT8f1E8OKv.jpg", 7.9000000000000004, new DateTime(1990, 3, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Dances with Wolves" },
                    { 582, null, "R", "A tragic love story set in East Berlin with the backdrop of an undercover Stasi controlled culture. Stasi captain Wieler is ordered to follow author Dreyman and plunges deeper and deeper into his life until he reaches the threshold of doubting the system.", 137, "German", "/5BCyeLJHPcRwhu0YaRqUzw00JJ4.jpg", 8.0999999999999996, new DateTime(2006, 3, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Lives of Others" },
                    { 583, null, "R", "Brian Cohen is an average young Jewish man, but through a series of ridiculous events, he gains a reputation as the Messiah. When he's not dodging his followers or being scolded by his shrill mother, the hapless Brian has to contend with the pompous Pontius Pilate and acronym-obsessed members of a separatist movement. Rife with Monty Python's signature absurdity, the tale finds Brian's life paralleling Biblical lore, albeit with many more laughs.", 94, "English", "/lSSA64WF0M0BXnjwr2quMh6shCl.jpg", 7.7999999999999998, new DateTime(1979, 8, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), "Life of Brian" },
                    { 585, null, "G", "James Sullivan and Mike Wazowski are monsters, they earn their living scaring children and are the best in the business... even though they're more afraid of the children than they are of them. When a child accidentally enters their world, James and Mike suddenly find that kids are not to be afraid of and they uncover a conspiracy that could threaten all children across the world.", 92, "English", "/sgheSKxZkttIe8ONsf2sWXPgip3.jpg", 7.7999999999999998, new DateTime(2001, 11, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "Monsters, Inc." },
                    { 587, null, "PG-13", "Throughout his life Edward Bloom has always been a man of big appetites, enormous passions and tall tales. In his later years, he remains a huge mystery to his son, William. Now, to get to know the real man, Will begins piecing together a true picture of his father from flashbacks of his amazing adventures.", 125, "English", "/tjK063yCgaBAluVU72rZ6PKPH2l.jpg", 7.7999999999999998, new DateTime(2003, 12, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "Big Fish" },
                    { 590, null, "PG-13", "\"The Hours\" is the story of three women searching for more potent, meaningful lives. Each is alive at a different time and place, all are linked by their yearnings and their fears. Their stories intertwine, and finally come together in a surprising, transcendent moment of shared recognition.", 114, "English", "/bNxCndh11o28oJGgm85nkt1bmQV.jpg", 7.2999999999999998, new DateTime(2002, 12, 27, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Hours" },
                    { 592, null, "PG", "Surveillance expert Harry Caul is hired by a mysterious client's brusque aide to tail a young couple. Tracking the pair through San Francisco's Union Square, Caul and his associate Stan manage to record a cryptic conversation between them. Tormented by memories of a previous case that ended badly, Caul becomes obsessed with the resulting tape, trying to determine if the couple are in danger.", 113, "English", "/dhgW1uGaRj8vIgq54VnCP96X7Sv.jpg", 7.5999999999999996, new DateTime(1974, 4, 7, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Conversation" },
                    { 593, null, "PG", "A psychologist is sent to a space station orbiting a planet called Solaris to investigate the death of a doctor and the mental problems of cosmonauts on the station. He soon discovers that the water on the planet is a type of brain which brings out repressed memories and obsessions.", 167, "Russian", "/tn1ITjdVn6jwjKdG0rnm65RFbFb.jpg", 7.9000000000000004, new DateTime(1972, 3, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), "Solaris" },
                    { 594, null, "PG-13", "Viktor Navorski is a man without a country; his plane took off just as a coup d'etat exploded in his homeland, leaving it in shambles, and now he's stranded at Kennedy Airport, where he's holding a passport that nobody recognizes. While quarantined in the transit lounge until authorities can figure out what to do with him, Viktor simply goes on living – and courts romance with a beautiful flight attendant.", 128, "English", "/pXNomqKcKXAQbuWxehb2N3XFKfn.jpg", 7.2999999999999998, new DateTime(2004, 6, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Terminal" },
                    { 595, null, "NR", "Scout Finch, 6, and her older brother Jem live in sleepy Maycomb, Alabama, spending much of their time with their friend Dill and spying on their reclusive and mysterious neighbor, Boo Radley. When Atticus, their widowed father and a respected lawyer, defends a black man named Tom Robinson against fabricated rape charges, the trial and tangent events expose the children to evils of racism and stereotyping.", 129, "English", "/fqIj7oE79qbyqHv5NBjtTI7yXP7.jpg", 8.0, new DateTime(1962, 12, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "To Kill a Mockingbird" },
                    { 596, null, "G", "Tom Joad returns to his home after a jail sentence to find his family kicked out of their farm due to foreclosure. He catches up with them on his Uncle’s farm, and joins them the next day as they head for California and a new life... Hopefully.", 129, "English", "/jRbRDNi9MgvhRc68PSQPMqnG24x.jpg", 7.7999999999999998, new DateTime(1940, 3, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Grapes of Wrath" },
                    { 597, null, "PG-13", "101-year-old Rose DeWitt Bukater tells the story of her life aboard the Titanic, 84 years later. A young Rose boards the ship with her mother and fiancé. Meanwhile, Jack Dawson and Fabrizio De Rossi win third-class tickets aboard the ship. Rose tells the whole story from Titanic's departure through to its death—on its first and last voyage—on April 15, 1912.", 194, "English", "/9xjZS2rlVxm8SFx8kPC3aIGCOYQ.jpg", 7.9000000000000004, new DateTime(1997, 11, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), "Titanic" },
                    { 598, null, "R", "Buscapé was raised in a very violent environment. Despite the feeling that all odds were against him, he finds out that life can be seen with other eyes...", 130, "Portuguese", "/k7eYdWvhYQyRQoU2TB2A2Xu2TfD.jpg", 8.4000000000000004, new DateTime(2002, 2, 5, 0, 0, 0, 0, DateTimeKind.Unspecified), "City of God" },
                    { 599, null, "PG", "A hack screenwriter writes a screenplay for a former silent film star who has faded into Hollywood obscurity.", 110, "English", "/zt8aQ6ksqK6p1AopC5zVTDS9pKT.jpg", 8.4000000000000004, new DateTime(1950, 8, 10, 0, 0, 0, 0, DateTimeKind.Unspecified), "Sunset Boulevard" },
                    { 600, null, "R", "A pragmatic U.S. Marine observes the dehumanizing effects the U.S.-Vietnam War has on his fellow recruits from their brutal boot camp training to the bloody street fighting in Hue.", 117, "English", "/kMKyx1k8hWWscYFnPbnxxN4Eqo4.jpg", 8.0999999999999996, new DateTime(1987, 6, 26, 0, 0, 0, 0, DateTimeKind.Unspecified), "Full Metal Jacket" },
                    { 601, null, "PG", "After a gentle alien becomes stranded on Earth, the being is discovered and befriended by a young boy named Elliott. Bringing the extraterrestrial into his suburban California house, Elliott introduces E.T., as the alien is dubbed, to his brother and his little sister, Gertie, and the children decide to keep its existence a secret. Soon, however, E.T. falls ill, resulting in government intervention and a dire situation for both Elliott and the alien.", 115, "English", "/an0nD6uq6byfxXCfk6lQBzdL2J1.jpg", 7.5, new DateTime(1982, 6, 11, 0, 0, 0, 0, DateTimeKind.Unspecified), "E.T. the Extra-Terrestrial" },
                    { 603, null, "R", "Set in the 22nd century, The Matrix tells the story of a computer hacker who joins a group of underground insurgents fighting the vast and powerful computers who now rule the earth.", 136, "English", "/f89U3ADr1oiB1s9GkdPOEpXUk5H.jpg", 8.0999999999999996, new DateTime(1999, 3, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Matrix" },
                    { 613, null, "R", "In April of 1945, Germany stands at the brink of defeat with the Russian Army closing in from the east and the Allied Expeditionary Force attacking from the west. In Berlin, capital of the Third Reich, Adolf Hitler proclaims that Germany will still achieve victory and orders his generals and advisers to fight to the last man. When the end finally does come, and Hitler lies dead by his own hand, what is left of his military must find a way to end the killing that is the Battle of Berlin, and lay down their arms in surrender.", 156, "German", "/cP1ElGjBhbZAAqmueXjHDKlSwiP.jpg", 7.7999999999999998, new DateTime(2004, 9, 8, 0, 0, 0, 0, DateTimeKind.Unspecified), "Downfall" },
                    { 614, null, "15", "Crotchety retired doctor Isak Borg travels from Stockholm to Lund, Sweden, with his pregnant and unhappy daughter-in-law, Marianne, in order to receive an honorary degree from his alma mater. Along the way, they encounter a series of hitchhikers, each of whom causes the elderly doctor to muse upon the pleasures and failures of his own life. These include the vivacious young Sara, a dead ringer for the doctor's own first love.", 91, "Swedish", "/iyTD2QnySNMPUPE3IedZQipSWfz.jpg", 8.1999999999999993, new DateTime(1957, 12, 26, 0, 0, 0, 0, DateTimeKind.Unspecified), "Wild Strawberries" },
                    { 615, null, "R", "A graphic portrayal of the last twelve hours of Jesus of Nazareth's life.", 127, "English", "/2C9vyK6leWDb2ds65R7uIwSmh8V.jpg", 7.4000000000000004, new DateTime(2004, 2, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Passion of the Christ" },
                    { 616, null, "R", "Nathan Algren is an American hired to instruct the Japanese army in the ways of modern warfare, which finds him learning to respect the samurai and the honorable principles that rule them. Pressed to destroy the samurai's way of life in the name of modernization and open trade, Algren decides to become an ultimate warrior himself and to fight for their right to exist.", 154, "English", "/lsasOSgYI85EHygtT5SvcxtZVYT.jpg", 7.5, new DateTime(2003, 1, 9, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Last Samurai" },
                    { 620, null, "PG", "After losing their academic posts at a prestigious university, a team of parapsychologists goes into business as proton-pack-toting \"ghostbusters\" who exterminate ghouls, hobgoblins and supernatural pests of all stripes. An ad campaign pays off when a knockout cellist hires the squad to purge her swanky digs of demons that appear to be living in her refrigerator.", 107, "English", "/h5Qz8J4T8YQnbZzHXM73WVYYVPK.jpg", 7.4000000000000004, new DateTime(1984, 6, 8, 0, 0, 0, 0, DateTimeKind.Unspecified), "Ghostbusters" },
                    { 621, null, "PG", "Australian good girl Sandy and greaser Danny fell in love over the summer. But when they unexpectedly discover they're now in the same high school, will they be able to rekindle their romance despite their eccentric friends?", 110, "English", "/9L4p8N1nQmAdAAfiaWlLuYs7dZt.jpg", 7.4000000000000004, new DateTime(1978, 7, 7, 0, 0, 0, 0, DateTimeKind.Unspecified), "Grease" },
                    { 623, null, "R", "A diamond advocate is attempting to steal a collection of diamonds, yet troubles arise when he realizes that he is not the only one after the diamonds.", 109, "English", "/hkSGFNVfEEUXFCxRZDITFHVhUlu.jpg", 7.2000000000000002, new DateTime(1988, 7, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "A Fish Called Wanda" },
                    { 625, null, "R", "The real-life story of a friendship between two journalists, an American and a Cambodian, during the bloody Khmer Rouge takeover of Cambodia in 1975, which led to the death of 2-3 million Cambodians during the next four years, until Pol Pot's regime was toppled by the intervening Vietnamese in 1979.", 142, "English", "/cPtW4lp8to8jMKHqhUWMMjWPmAG.jpg", 7.5, new DateTime(1984, 11, 2, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Killing Fields" },
                    { 626, null, "18", "Un Chien Andalou is a classic European avant-garde surrealist film from the cooperation of director Luis Buñuel and Salvador Dali. The film changed the way people made movies.", 21, "French", "/obvE7ElAvCUhKtWFwDSvNbPw9PV.jpg", 7.5, new DateTime(1929, 6, 5, 0, 0, 0, 0, DateTimeKind.Unspecified), "Un Chien Andalou" },
                    { 627, null, "R", "Heroin addict Mark Renton stumbles through bad ideas and sobriety attempts with his unreliable friends -- Sick Boy, Begbie, Spud and Tommy. He also has an underage girlfriend, Diane, along for the ride. After cleaning up and moving from Edinburgh to London, Mark finds he can't escape the life he left behind when Begbie shows up at his front door on the lam, and a scheming Sick Boy follows.", 94, "English", "/6UTzw3kipgTYAJCX8GExoXzcVOx.jpg", 8.0, new DateTime(1996, 2, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), "Trainspotting" },
                    { 628, null, "R", "A vampire relates his epic life story of love, betrayal, loneliness, and dark hunger to an over-curious reporter.", 123, "English", "/t7NU8IcmcNBrlunCxiycX9JV7Rp.jpg", 7.4000000000000004, new DateTime(1994, 11, 11, 0, 0, 0, 0, DateTimeKind.Unspecified), "Interview with the Vampire" },
                    { 629, null, "R", "Held in an L.A. interrogation room, Verbal Kint attempts to convince the feds that a mythic crime lord, Keyser Soze, not only exists, but was also responsible for drawing him and his four partners into a multi-million dollar heist that ended with an explosion in San Pedro harbor – leaving few survivors. Verbal lures his interrogators with an incredible story of the crime lord's almost supernatural prowess.", 106, "English", "/bUPmtQzrRhzqYySeiMpv7GurAfm.jpg", 8.1999999999999993, new DateTime(1995, 7, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Usual Suspects" },
                    { 630, null, "G", "Young Dorothy finds herself in a magical world where she makes friends with a lion, a scarecrow and a tin man as they make their way along the yellow brick road to talk with the Wizard and ask for the things they miss most in their lives. The Wicked Witch of the West is the only thing that could stop them.", 102, "English", "/pfAZFD7I2hxW9HCChTuAzsdE6UX.jpg", 7.5999999999999996, new DateTime(1939, 8, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Wizard of Oz" },
                    { 631, null, "NR", "A married farmer falls under the spell of a slatternly woman from the city, who tries to convince him to drown his wife.", 94, "English", "/tyxjxpwr9NiVtSeITtVXuhp84Zl.jpg", 7.9000000000000004, new DateTime(1927, 11, 4, 0, 0, 0, 0, DateTimeKind.Unspecified), "Sunrise: A Song of Two Humans" },
                    { 632, null, "PG", "It's a dreary Christmas 1944 for the American POWs in Stalag 17 and the men in Barracks 4, all sergeants, have to deal with a grave problem—there seems to be a security leak.", 120, "English", "/wAmBeYMJPoS5sbAH9iUy5GLZNL0.jpg", 7.7000000000000002, new DateTime(1953, 5, 29, 0, 0, 0, 0, DateTimeKind.Unspecified), "Stalag 17" },
                    { 637, null, "PG-13", "A touching story of an Italian book seller of Jewish ancestry who lives in his own little fairy tale. His creative and happy life would come to an abrupt halt when his entire family is deported to a concentration camp during World War II. While locked up he tries to convince his son that the whole thing is just a game.", 116, "Italian", "/74hLDKjD5aGYOotO6esUVaeISa2.jpg", 8.5, new DateTime(1997, 12, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), "Life Is Beautiful" },
                    { 638, null, "R", "A tormented jazz musician finds himself lost in an enigmatic story involving murder, surveillance, gangsters, doppelgangers, and an impossible transformation inside a prison cell.", 134, "English", "/5POhfNeFPIi4VUNwCTaK85sh98r.jpg", 7.5999999999999996, new DateTime(1997, 1, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Lost Highway" },
                    { 639, null, "R", "During their travel from Chicago to New York, Harry and Sally debate whether or not sex ruins a friendship between a man and a woman. Eleven years later, and they're still no closer to finding the answer.", 96, "English", "/3wkbKeowUp1Zpkw1KkBqMWbt0P9.jpg", 7.4000000000000004, new DateTime(1989, 1, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), "When Harry Met Sally..." },
                    { 640, null, "PG-13", "A true story about Frank Abagnale Jr. who, before his 19th birthday, successfully conned millions of dollars worth of checks as a Pan Am pilot, doctor, and legal prosecutor. An FBI agent makes it his mission to put him behind bars. But Frank not only eludes capture, he revels in the pursuit.", 141, "English", "/ctjEj2xM32OvBXCq8zAdK3ZrsAj.jpg", 7.9000000000000004, new DateTime(2002, 12, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "Catch Me If You Can" }
                });

            migrationBuilder.InsertData(
                table: "Movies",
                columns: new[] { "Id", "ActorId", "Certification", "Description", "Duration", "Language", "Picture", "Ratings", "ReleaseDate", "Title" },
                values: new object[,]
                {
                    { 641, null, "R", "The hopes and dreams of four ambitious people are shattered when their drug addictions begin spiraling out of control. A look into addiction and how it overcomes the mind and body.", 102, "English", "/nOd6vjEmzCT0k4VYqsA2hwyi87C.jpg", 8.0, new DateTime(2000, 10, 6, 0, 0, 0, 0, DateTimeKind.Unspecified), "Requiem for a Dream" },
                    { 642, null, "PG", "In late 1890s Wyoming, Butch Cassidy is the affable, clever and talkative leader of the outlaw Hole in the Wall Gang. His closest companion is the laconic dead-shot 'Sundance Kid'. As the west rapidly becomes civilized, the law finally catches up to Butch, Sundance and their gang.  Chased doggedly by a special posse, the two decide to make their way to South America in hopes of evading their pursuers once and for all.", 111, "English", "/oDpDXln1x3sbnt8wQBKsU6J5txT.jpg", 7.5999999999999996, new DateTime(1969, 9, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), "Butch Cassidy and the Sundance Kid" },
                    { 643, null, "NR", "A dramatized account of a great Russian naval mutiny and a resultant public demonstration, showing support, which brought on a police massacre. The film had an incredible impact on the development of cinema and is a masterful example of montage editing.", 75, "Russian", "/tjnaRiHUsxBADaOwrQpnTnjHVwi.jpg", 7.7000000000000002, new DateTime(1925, 12, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), "Battleship Potemkin" },
                    { 648, null, "16", "The story of a gentle-hearted beast in love with a simple and beautiful girl. She is drawn to the repellent but strangely fascinating Beast, who tests her fidelity by giving her a key, telling her that if she doesn't return it to him by a specific time, he will die of grief. She is unable to return the key on time, but it is revealed that the Beast is the genuinely handsome one. A simple tale of tragic love that turns into a surreal vision of death, desire, and beauty.", 96, "French", "/lSVmztoFVBlCUxD6lxfobmajSwj.jpg", 7.5, new DateTime(1946, 10, 29, 0, 0, 0, 0, DateTimeKind.Unspecified), "Beauty and the Beast" },
                    { 649, null, "16", "Beautiful young housewife Séverine Serizy cannot reconcile her masochistic fantasies with her everyday life alongside dutiful husband Pierre. When her lovestruck friend Henri mentions a secretive high-class brothel run by Madame Anais, Séverine begins to work there during the day under the name Belle de Jour. But when one of her clients grows possessive, she must try to go back to her normal life.", 101, "French", "/iUAFECovwPA0cVV9bo4uNGLJSGL.jpg", 7.5, new DateTime(1967, 5, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), "Belle de Jour" },
                    { 650, null, "R", "Boyz n the Hood is the popular and successful film and social criticism from John Singleton about the conditions in South Central Los Angeles where teenagers are involved in gun fights and drug dealing on a daily basis.", 112, "English", "/v4ox4aSCNT5vyLXl4Q71JiWwCXW.jpg", 7.5, new DateTime(1991, 7, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), "Boyz n the Hood" },
                    { 653, null, "NR", "Vampire Count Orlok is interested in a new residence and in his real estate agent’s young wife. F. W. Murnau’s unauthorized adaptation of Bram Stoker’s “Dracula.”", 94, "German", "/zx24O7VAs6NbJhiIrUhWysAiHS0.jpg", 7.7000000000000002, new DateTime(1922, 2, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), "Nosferatu" },
                    { 654, null, "NR", "Terry Malloy dreams about being a prize fighter, while tending his pigeons and running errands at the docks for Johnny Friendly, the corrupt boss of the dockers union. Terry witnesses a murder by two of Johnny's thugs, and later meets the dead man's sister and feels responsible for his death. She introduces him to Father Barry, who tries to force him to provide information for the courts that will smash the dock racketeers.", 108, "English", "/v1RtJ1qR4v9nrnfoBVBl6hjTW9.jpg", 8.0, new DateTime(1954, 6, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), "On the Waterfront" },
                    { 655, null, "R", "A man wanders out of the desert not knowing who he is. His brother finds him, and helps to pull his memory back of the life he led before he walked out on his family and disappeared four years earlier.", 146, "English", "/6NuFYT1f1rG0AeIVTJEgsRa7AOi.jpg", 8.0999999999999996, new DateTime(1984, 8, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), "Paris, Texas" },
                    { 658, null, "PG", "Special agent 007 comes face to face with one of the most notorious villains of all time, and now he must outwit and outgun the powerful tycoon to prevent him from cashing in on a devious scheme to raid Fort Knox -- and obliterate the world's economy.", 110, "English", "/r2sYC8RVVO37mSZchf8LuFPEYyP.jpg", 7.4000000000000004, new DateTime(1964, 9, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), "Goldfinger" },
                    { 662, null, "NR", "A man is sent back and forth and in and out of time in an experiment that attempts to unravel the fate and the solution to the problems of a post-apocalyptic world during the aftermath of WW3. The experiment results in him getting caught up in a perpetual reminiscence of past events that are recreated on an airport’s viewing pier.", 28, "French", "/vIwQv880vRTmxFNVZa0K6fapyoZ.jpg", 8.0, new DateTime(1962, 2, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), "La Jetée" },
                    { 665, null, "G", "In 25 AD,Judah Ben-Hur, a Jew in ancient Judea, opposes the occupying Roman empire.  Falsely accused by a Roman childhood friend-turned-overlord of trying to kill the Roman governor, he is put into slavery and his mother and sister are taken away as prisoners.  Three years later and freed by a grateful Roman galley commander whom he has rescued from drowning, he becomes an expert charioteer for Rome, all the while plotting to return to Judea, find and rescue his family, and avenge himself on his former friend.  All the while, the form and work of Jesus move in the background of his life...", 222, "English", "/m4WQ1dBIrEIHZNCoAjdpxwSKWyH.jpg", 7.7999999999999998, new DateTime(1959, 12, 26, 0, 0, 0, 0, DateTimeKind.Unspecified), "Ben-Hur" },
                    { 666, null, "L", "An emotive journey of a former school teacher, who writes letters for illiterate people, and a young boy, whose mother has just died, as they search for the father he never knew.", 113, "Portuguese", "/zJvp7XjQ2LhPbDVYhFXyucs40vR.jpg", 8.0999999999999996, new DateTime(1998, 11, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), "Central Station" },
                    { 670, null, "R", "With no clue how he came to be imprisoned, drugged and tortured for 15 years, a desperate businessman seeks revenge on his captors.", 120, "Korean", "/pWDtjs568ZfOTMbURQBYuT4Qxka.jpg", 8.3000000000000007, new DateTime(2003, 11, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), "Oldboy" },
                    { 671, null, "PG", "Harry Potter has lived under the stairs at his aunt and uncle's house his whole life. But on his 11th birthday, he learns he's a powerful wizard -- with a place waiting for him at the Hogwarts School of Witchcraft and Wizardry. As he learns to harness his newfound powers with the help of the school's kindly headmaster, Harry uncovers the truth about his parents' deaths -- and about the villain who's to blame.", 152, "English", "/wuMc08IPKEatf9rnMNXvIDxqP4W.jpg", 7.9000000000000004, new DateTime(2001, 11, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), "Harry Potter and the Philosopher's Stone" },
                    { 672, null, "PG", "Cars fly, trees fight back, and a mysterious house-elf comes to warn Harry Potter at the start of his second year at Hogwarts. Adventure and danger await when bloody writing on a wall announces: The Chamber Of Secrets Has Been Opened. To save Hogwarts will require all of Harry, Ron and Hermione’s magical abilities and courage.", 161, "English", "/sdEOH0992YZ0QSxgXNIGLq1ToUi.jpg", 7.7000000000000002, new DateTime(2002, 11, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), "Harry Potter and the Chamber of Secrets" },
                    { 673, null, "PG", "Year three at Hogwarts means new fun and challenges as Harry learns the delicate art of approaching a Hippogriff, transforming shape-shifting Boggarts into hilarity and even turning back time. But the term also brings danger: soul-sucking Dementors hover over the school, an ally of the accursed He-Who-Cannot-Be-Named lurks within the castle walls, and fearsome wizard Sirius Black escapes Azkaban. And Harry will confront them all.", 141, "English", "/aWxwnYoe8p2d2fcxOqtvAtJ72Rw.jpg", 8.0, new DateTime(2004, 5, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Harry Potter and the Prisoner of Azkaban" },
                    { 674, null, "PG-13", "When Harry Potter's name emerges from the Goblet of Fire, he becomes a competitor in a grueling battle for glory among three wizarding schools — the Triwizard Tournament. But since Harry never submitted his name for the Tournament, who did? Now Harry must confront a deadly dragon, fierce water demons and an enchanted maze only to find himself in the cruel grasp of He Who Must Not Be Named. In this fourth film adaptation of J.K. Rowling's Harry Potter series, everything changes as Harry, Ron and Hermione leave childhood forever and take on challenges greater than anything they could have imagined.", 157, "English", "/fECBtHlr0RB3foNHDiCBXeg9Bv9.jpg", 7.7999999999999998, new DateTime(2005, 11, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), "Harry Potter and the Goblet of Fire" },
                    { 675, null, "PG-13", "The rebellion begins! Lord Voldemort has returned, but the Ministry of Magic is doing everything it can to keep the wizarding world from knowing the truth – including appointing Ministry official Dolores Umbridge as the new Defence Against the Dark Arts professor at Hogwarts. When Umbridge refuses to teach practical defensive magic, Ron and Hermione convince Harry to secretly train a select group of students for the wizarding war that lies ahead. A terrifying showdown between good and evil awaits in this enthralling film version of the fifth novel in J.K. Rowling’s Harry Potter series. Prepare for battle!", 138, "English", "/s836PRwHkLjrOJrfW0eo7B4NJOf.jpg", 7.7000000000000002, new DateTime(2007, 6, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), "Harry Potter and the Order of the Phoenix" },
                    { 678, null, null, "Jeff Bailey seems to be a mundane gas station owner in remote Bridgeport, CA. He is dating local girl Ann Miller and lives a quiet life. But Jeff has a secret past, and when a mysterious stranger arrives in town, Jeff is forced to return to the dark world he had tried to escape.", 97, "English", "/yAnhMsPxDNjAEhOZ9iNlgU29Zfc.jpg", 7.7000000000000002, new DateTime(1947, 11, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "Out of the Past" },
                    { 679, null, "R", "When Ripley's lifepod is found by a salvage crew over 50 years later, she finds that terra-formers are on the very planet they found the alien species. When the company sends a family of colonists out to investigate her story—all contact is lost with the planet and colonists. They enlist Ripley and the colonial marines to return and search for answers.", 137, "English", "/r1x5JGpyqZU8PYhbs4UcrO1Xb6x.jpg", 7.9000000000000004, new DateTime(1986, 7, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), "Aliens" },
                    { 680, null, "R", "A burger-loving hit man, his philosophical partner, a drug-addled gangster's moll and a washed-up boxer converge in this sprawling, comedic crime caper. Their adventures unfurl in three stories that ingeniously trip back and forth in time.", 154, "English", "/x1QZHSq9AzreIVbsp8VgYemAjV0.jpg", 8.5, new DateTime(1994, 9, 10, 0, 0, 0, 0, DateTimeKind.Unspecified), "Pulp Fiction" },
                    { 686, null, "PG", "Contact is a science fiction film about an encounter with alien intelligence. Based on the novel by Carl Sagan the film starred Jodie Foster as the one chosen scientist who must make some difficult decisions between her beliefs, the truth, and reality.", 150, "English", "/bCpMIywuNZeWt3i5UMLEIc0VSwM.jpg", 7.4000000000000004, new DateTime(1997, 7, 11, 0, 0, 0, 0, DateTimeKind.Unspecified), "Contact" },
                    { 687, null, "R", "A justice drama based on a true story about a man on death row who, in his last days, forms a strong relationship with a nun who teaches him forgiveness and gives him spirituality, as she accompanies him to his execution.", 122, "English", "/wQmmJi5ypfHH2boXrQBmsep7qb2.jpg", 7.4000000000000004, new DateTime(1995, 12, 29, 0, 0, 0, 0, DateTimeKind.Unspecified), "Dead Man Walking" },
                    { 688, null, "PG-13", "Photographer Robert Kincaid wanders into the life of housewife Francesca Johnson for four days in the 1960s.", 135, "English", "/8TfLAfIh5Qxp2J4ZjOafHYhWtDb.jpg", 7.7000000000000002, new DateTime(1995, 5, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Bridges of Madison County" },
                    { 690, null, "6", "Michel takes up pickpocketing on a lark and is arrested soon after. His mother dies shortly after his release, and despite the objections of his only friend, Jacques, and his mother's neighbor Jeanne, Michel teams up with a couple of petty thieves in order to improve his craft. With a police inspector keeping an eye on him, Michel also tries to get a straight job, but the temptation to steal is hard to resist.", 75, "French", "/d2AOcE7Wgcey6pAa4ti6RdKBQsw.jpg", 7.4000000000000004, new DateTime(1959, 12, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), "Pickpocket" },
                    { 694, null, "R", "Jack Torrance accepts a caretaker job at the Overlook Hotel, where he, along with his wife Wendy and their son Danny, must live isolated from the rest of the world for the winter. But they aren't prepared for the madness that lurks within.", 144, "English", "/b6ko0IKC8MdYBBPkkA1aBPLe2yz.jpg", 8.1999999999999993, new DateTime(1980, 5, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Shining" },
                    { 695, null, "R", "Many loosely connected characters cross paths in this film, based on the stories of Raymond Carver. Waitress Doreen Piggot accidentally runs into a boy with her car. Soon after walking away, the child lapses into a coma. While at the hospital, the boy's grandfather tells his son, Howard, about his past affairs. Meanwhile, a baker starts harassing the family when they fail to pick up the boy's birthday cake.", 187, "English", "/nAEBc3g9bHAcF9whKFMfIxHxVwn.jpg", 7.2000000000000002, new DateTime(1993, 9, 5, 0, 0, 0, 0, DateTimeKind.Unspecified), "Short Cuts" },
                    { 696, null, "R", "Manhattan explores how the life of a middle-aged television writer dating a teenage girl is further complicated when he falls in love with his best friend's mistress.", 96, "English", "/k4eT3EvfxW1L9Wmt04UqJqCvCR6.jpg", 7.7999999999999998, new DateTime(1979, 4, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "Manhattan" },
                    { 702, null, "PG", "Disturbed Blanche DuBois moves in with her sister in New Orleans and is tormented by her brutish brother-in-law while her reality crumbles around her.", 125, "English", "/aicdlO5vt7z2ARm279eGzJeYCLQ.jpg", 7.7999999999999998, new DateTime(1951, 9, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), "A Streetcar Named Desire" },
                    { 703, null, "PG", "New York comedian Alvy Singer falls in love with the ditsy Annie Hall.", 93, "English", "/dEtjPywhDbAXYjoFfhBC4U9unU7.jpg", 7.7999999999999998, new DateTime(1977, 4, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), "Annie Hall" },
                    { 704, null, "G", "Capturing John Lennon, Paul McCartney, George Harrison and Ringo Starr in their electrifying element, 'A Hard Day's Night' is a wildly irreverent journey through this pastiche of a day in the life of The Beatles during 1964. The band have to use all their guile and wit to avoid the pursuing fans and press to reach their scheduled television performance, in spite of Paul's troublemaking grandfather and Ringo's arrest.", 88, "English", "/bCjjAVPHKTqtX7TTzL4QRuu91Pc.jpg", 7.5, new DateTime(1964, 7, 7, 0, 0, 0, 0, DateTimeKind.Unspecified), "A Hard Day's Night" },
                    { 705, null, "PG", "From the moment she glimpses her idol at the stage door, Eve Harrington is determined to take the reins of power away from the great actress Margo Channing. Eve maneuvers her way into Margo's Broadway role, becomes a sensation and even causes turmoil in the lives of Margo's director boyfriend, her playwright and his wife. Only the cynical drama critic sees through Eve, admiring her audacity and perfect pattern of deceit.", 139, "English", "/6numIZH6uR3NlJgY9m7nGH0jhs.jpg", 8.1999999999999993, new DateTime(1950, 10, 6, 0, 0, 0, 0, DateTimeKind.Unspecified), "All About Eve" },
                    { 713, null, "R", "After a long voyage from Scotland, pianist Ada McGrath and her young daughter, Flora, are left with all their belongings, including a piano, on a New Zealand beach. Ada, who has been mute since childhood, has been sold into marriage to a local man named Alisdair Stewart. Making little attempt to warm up to Alisdair, Ada soon becomes intrigued by his Maori-friendly acquaintance, George Baines, leading to tense, life-altering conflicts.", 116, "English", "/rx8RKXn8OtuS6lqloYsjyrGOUp4.jpg", 7.4000000000000004, new DateTime(1993, 5, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Piano" },
                    { 745, null, "PG-13", "An eight year old boy named Cole Sear, who believes he can see dead people, aids the help of a child psychologist named Malcolm Crowe.", 107, "English", "/fIssD3w3SvIhPPmVo4WMgZDVLID.jpg", 7.9000000000000004, new DateTime(1999, 8, 6, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Sixth Sense" },
                    { 746, null, "PG-13", "A dramatic history of Pu Yi, the last of the Emperors of China, from his lofty birth and brief reign in the Forbidden City, the object of worship by half a billion people; through his abdication, his decline and dissolute lifestyle; his exploitation by the invading Japanese, and finally to his obscure existence as just another peasant worker in the People's Republic.", 219, "English", "/dJFPPQHtRAOxMRf7DzdYbQ4rQBC.jpg", 7.5999999999999996, new DateTime(1987, 5, 27, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Last Emperor" },
                    { 747, null, "R", "Shaun lives a supremely uneventful life, which revolves around his girlfriend, his mother, and, above all, his local pub. This gentle routine is threatened when the dead return to life and make strenuous attempts to snack on ordinary Londoners.", 99, "English", "/13vOO3DtEG0OYEbgcvVS6XimoIP.jpg", 7.5, new DateTime(2004, 4, 9, 0, 0, 0, 0, DateTimeKind.Unspecified), "Shaun of the Dead" },
                    { 752, null, "R", "In a world in which Great Britain has become a fascist state, a masked vigilante known only as “V” conducts guerrilla warfare against the oppressive British government. When V rescues a young woman from the secret police, he finds in her an ally with whom he can continue his fight to free the people of Britain.", 132, "English", "/kxekpqZUpO5W65QT12goucFvyx9.jpg", 7.9000000000000004, new DateTime(2006, 2, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), "V for Vendetta" },
                    { 756, null, "G", "Walt Disney's timeless masterpiece is an extravaganza of sight and sound! See the music come to life, hear the pictures burst into song and experience the excitement that is Fantasia over and over again.", 124, "English", "/mSJgxrTaTgDSOoggIPcj3ZoZswT.jpg", 7.4000000000000004, new DateTime(1940, 11, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), "Fantasia" },
                    { 759, null, "NR", "Lorelei Lee is a beautiful showgirl engaged to be married to the wealthy Gus Esmond, much to the disapproval of Gus' rich father, Esmond Sr., who thinks that Lorelei is just after his money. When Lorelei goes on a cruise accompanied only by her best friend, Dorothy Shaw, Esmond Sr. hires Ernie Malone, a private detective, to follow her and report any questionable behavior that would disqualify her from the marriage.", 91, "English", "/o37B6gW7L5S2bmY52nDcf4JcnwH.jpg", 7.2999999999999998, new DateTime(1953, 7, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), "Gentlemen Prefer Blondes" },
                    { 760, null, "6", "In this riot of frantic disguises and mistaken identities, Victor Pivert, a blustering, bigoted French factory owner, finds himself taken hostage by Slimane, an Arab rebel leader. The two dress up as rabbis as they try to elude not only assasins from Slimane's country, but also the police, who think Pivert is a murderer. Pivert ends up posing as Rabbi Jacob, a beloved figure who's returned to France for his first visit after 30 years in the United States. Adding to the confusion are Pivert's dentist-wife, who thinks her husband is leaving her for another woman, their daughter, who's about to get married, and a Parisian neighborhood filled with people eager to celebrate the return of Rabbi Jacob.", 100, "French", "/80dKVpKKxexxoFvpCJayxJ7cDif.jpg", 7.4000000000000004, new DateTime(1973, 10, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Mad Adventures of Rabbi Jacob" },
                    { 762, null, "PG", "King Arthur, accompanied by his squire, recruits his Knights of the Round Table, including Sir Bedevere the Wise, Sir Lancelot the Brave, Sir Robin the Not-Quite-So-Brave-As-Sir-Lancelot and Sir Galahad the Pure. On the way, Arthur battles the Black Knight who, despite having had all his limbs chopped off, insists he can still fight. They reach Camelot, but Arthur decides not  to enter, as \"it is a silly place\".", 91, "English", "/jVztLnCw6F5YNOgEchm3QFydbYZ.jpg", 7.7999999999999998, new DateTime(1975, 5, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "Monty Python and the Holy Grail" }
                });

            migrationBuilder.InsertData(
                table: "Movies",
                columns: new[] { "Id", "ActorId", "Certification", "Description", "Duration", "Language", "Picture", "Ratings", "ReleaseDate", "Title" },
                values: new object[,]
                {
                    { 763, null, "R", "When a Sumatran rat-monkey bites Lionel Cosgrove's mother, she's transformed into a zombie and begins killing (and transforming) the entire town while Lionel races to keep things under control.", 103, "English", "/ba2IvCjv6H1oVdHjaKtJ82rTDmK.jpg", 7.4000000000000004, new DateTime(1992, 8, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), "Braindead" },
                    { 764, null, "R", "When a group of college students finds a mysterious book and recording in the old wilderness cabin they've rented for the weekend, they unwittingly unleash a demonic force from the surrounding forest.", 85, "English", "/uYxQ6xhP3WjqPZtxyAOnZQWnZqn.jpg", 7.2999999999999998, new DateTime(1981, 9, 10, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Evil Dead" },
                    { 765, null, "R", "Ash Williams and his girlfriend Linda find a log cabin in the woods with a voice recording from an archeologist who had recorded himself reciting ancient chants from \"The Book of the Dead.\" As they play the recording an evil power is unleashed taking over Linda's body.", 84, "English", "/4zqCKJVHUolGs6C5AZwAZqLWixW.jpg", 7.5999999999999996, new DateTime(1987, 3, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), "Evil Dead II" },
                    { 766, null, "R", "Ash is transported back to medieval days, where he is captured by the dreaded Lord Arthur. Aided by the deadly chainsaw that has become his only friend, Ash is sent on a perilous mission to recover the Book of the Dead, a powerful tome that gives its owner the power to summon an army of ghouls.", 81, "English", "/mOsWtjRGABrPrqqtm0U6WQp4GVw.jpg", 7.2999999999999998, new DateTime(1992, 10, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Army of Darkness" },
                    { 767, null, "PG", "As Lord Voldemort tightens his grip on both the Muggle and wizarding worlds, Hogwarts is no longer a safe haven. Harry suspects perils may even lie within the castle, but Dumbledore is more intent upon preparing him for the final battle fast approaching. Together they work to find the key to unlock Voldemorts defenses and to this end, Dumbledore recruits his old friend and colleague Horace Slughorn, whom he believes holds crucial information. Even as the decisive showdown looms, romance blossoms for Harry, Ron, Hermione and their classmates. Love is in the air, but danger lies ahead and Hogwarts may never be the same again.", 153, "English", "/z7uo9zmQdQwU5ZJHFpv2Upl30i1.jpg", 7.7000000000000002, new DateTime(2009, 7, 7, 0, 0, 0, 0, DateTimeKind.Unspecified), "Harry Potter and the Half-Blood Prince" },
                    { 769, null, "R", "The true story of Henry Hill, a half-Irish, half-Sicilian Brooklyn kid who is adopted by neighbourhood gangsters at an early age and climbs the ranks of a Mafia family under the guidance of Jimmy Conway.", 145, "English", "/6QMSLvU5ziIL2T6VrkaKzN2YkxK.jpg", 8.4000000000000004, new DateTime(1990, 9, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), "GoodFellas" },
                    { 770, null, "G", "The spoiled daughter of a well-to-do plantation owner is forced to use every means at her disposal to claw her way out of poverty, following Maj. Gen. William Sherman's destructive \"March to the Sea,” during the American Civil War.", 233, "English", "/pDXbS9V8ZoF7oiL4LUL5U31T1B5.jpg", 8.0, new DateTime(1939, 12, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Gone with the Wind" },
                    { 771, null, "PG", "Eight-year-old Kevin McCallister makes the most of the situation after his family unwittingly leaves him behind when they go on Christmas vacation. But when a pair of bungling burglars set their sights on Kevin's house, the plucky kid stands ready to defend his territory. By planting booby traps galore, adorably mischievous Kevin stands his ground as his frantic mother attempts to race home before Christmas Day.", 103, "English", "/9wSbe4CwObACCQvaUVhWQyLR5Vz.jpg", 7.2999999999999998, new DateTime(1990, 11, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), "Home Alone" },
                    { 773, null, "R", "A family loaded with quirky, colorful characters piles into an old van and road trips to California for little Olive to compete in a beauty pageant.", 102, "English", "/tFnTds88mCuLcLPBseK1kF2E3qv.jpg", 7.7000000000000002, new DateTime(2006, 7, 26, 0, 0, 0, 0, DateTimeKind.Unspecified), "Little Miss Sunshine" },
                    { 775, null, null, "Professor Barbenfouillis and five of his colleagues from the Academy of Astronomy travel to the Moon aboard a rocket propelled by a giant cannon. Once on the lunar surface, the bold explorers face the many perils hidden in the caves of the mysterious satellite.", 14, "French", "/aaNIFWrq6eGi259APbB5yaqBFdm.jpg", 8.0, new DateTime(1902, 4, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), "A Trip to the Moon" },
                    { 776, null, "NR", "A weekend at a marquis’ country château lays bare some ugly truths about a group of haut bourgeois acquaintances.", 106, "French", "/8JOzt7uFZyshcuzCBmYU6CDJL4D.jpg", 7.7999999999999998, new DateTime(1939, 7, 9, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Rules of the Game" },
                    { 777, null, "U", "A group of French soldiers, including the patrician Captain de Boeldieu and the working-class Lieutenant Maréchal, grapple with their own class differences after being captured and held in a World War I German prison camp. When the men are transferred to a high-security fortress, they must concoct a plan to escape beneath the watchful eye of aristocratic German officer von Rauffenstein, who has formed an unexpected bond with de Boeldieu.", 114, "French", "/lWg41zE0FVixkNsFgxnlRyvDYv9.jpg", 7.7999999999999998, new DateTime(1937, 6, 4, 0, 0, 0, 0, DateTimeKind.Unspecified), "Grand Illusion" },
                    { 779, null, "PG-13", "Traveler Allan Gray arrives in the village of Courtempierre and takes lodgings in a small inn. Gray has a great interest in the supernatural, particularly vampires. He's barely settled in when he feels a sinister force descending upon him. In the night an old man enters his room to tell him 'she must not die'. One of the old man's daughters, Leone, has been bitten by a vampire. In order to break the curse, Gray and Leone's sister Gisele must find the original vampire and drive a stake through her heart.", 74, "German", "/m7BKgeW06cgW5512wukfGhLsWGL.jpg", 7.5, new DateTime(1932, 5, 6, 0, 0, 0, 0, DateTimeKind.Unspecified), "Vampyr" },
                    { 780, null, "NR", "A classic of the silent age, this film tells the story of the doomed but ultimately canonized 15th-century teenage warrior. On trial for claiming she'd spoken to God, Jeanne d'Arc is subjected to inhumane treatment and scare tactics at the hands of church court officials. Initially bullied into changing her story, Jeanne eventually opts for what she sees as the truth. Her punishment, a famously brutal execution, earns her perpetual martyrdom.", 82, "French", "/8OYGtQlO8k9PcOm49apV62eVJQo.jpg", 8.0999999999999996, new DateTime(1928, 4, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Passion of Joan of Arc" },
                    { 782, null, "PG-13", "In a future society in the era of indefinite eugenics, humans are set on a life course depending on their DNA. Young Vincent Freeman is born with a condition that would prevent him from space travel, yet is determined to infiltrate the GATTACA space program.", 106, "English", "/eSKr5Fl1MEC7zpAXaLWBWSBjgJq.jpg", 7.5, new DateTime(1997, 9, 7, 0, 0, 0, 0, DateTimeKind.Unspecified), "Gattaca" },
                    { 783, null, "PG", "In the early years of the 20th century, Mohandas K. Gandhi, a British-trained lawyer, forsakes all worldly possessions to take up the cause of Indian independence. Faced with armed resistance from the British government, Gandhi adopts a policy of 'passive resistance', endeavouring to win freedom for his people without resorting to bloodshed.", 191, "English", "/mGIDXmuCeLu1nzOxLbN8fWwn1fN.jpg", 7.5, new DateTime(1982, 11, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Gandhi" },
                    { 786, null, "R", "In 1973, 15-year-old William Miller's unabashed love of music and aspiration to become a rock journalist lands him an assignment from Rolling Stone magazine to interview and tour with the up-and-coming band Stillwater—fronted by lead guitar Russell Hammond, and lead singer Jeff Bebe.", 122, "English", "/asGfT3PExH4CUyyiClt5X6wJedk.jpg", 7.5, new DateTime(2000, 9, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Almost Famous" },
                    { 792, null, "R", "As a young and naive recruit in Vietnam, Chris Taylor faces a moral crisis when confronted with the horrors of war and the duality of man.", 120, "English", "/m3mmFkPQKvPZq5exmh0bDuXlD9T.jpg", 7.7000000000000002, new DateTime(1986, 12, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), "Platoon" },
                    { 793, null, "R", "The discovery of a severed human ear found in a field leads a young man on an investigation related to a beautiful, mysterious nightclub singer and a group of criminals who have kidnapped her child.", 120, "English", "/7hlgzJXLgyECS1mk3LSN3E72l5N.jpg", 7.7000000000000002, new DateTime(1986, 9, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), "Blue Velvet" },
                    { 794, null, "R", "Immediately after their miscarriage, the US diplomat Robert Thorn adopts the newborn Damien without the knowledge of his wife. Yet what he doesn’t know is that their new son is the son of the devil.", 111, "English", "/p0LcWxOIoBx0MEZMn8tFcrvDXR1.jpg", 7.4000000000000004, new DateTime(1976, 6, 6, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Omen" },
                    { 797, null, "15", "A young nurse, Alma, is put in charge of Elisabeth Vogler: an actress who is seemingly healthy in all respects, but will not talk. As they spend time together, Alma speaks to Elisabeth constantly, never receiving any answer. The time they spend together only strengthens the crushing realization that one does not exist.", 84, "Swedish", "/bdXbfUir63TQHA5NTNcXPICZCW8.jpg", 8.3000000000000007, new DateTime(1966, 10, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), "Persona" },
                    { 800, null, "16", "A group of juvenile delinquents lives a criminal, violent life in the festering slums of Mexico City, among them the young Pedro, whose morality is gradually corrupted and destroyed by the others.", 85, "Spanish", "/3bdfN2gosYSxpHBAXPkAhxkUJFr.jpg", 8.0999999999999996, new DateTime(1950, 12, 9, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Young and the Damned" },
                    { 801, null, "R", "Radio funny man Adrian Cronauer is sent to Vietnam to bring a little comedy back into the lives of the soldiers. After setting up shop, Cronauer delights the G.I.s but shocks his superior officer, Sergeant Major Dickerson, with his irreverent take on the war. While Dickerson attempts to censor Cronauer's broadcasts, Cronauer pursues a relationship with a Vietnamese girl named Trinh, who shows him the horrors of war first-hand.", 121, "English", "/sreISlFUn5TyR41QNjlfAdX5SEW.jpg", 7.4000000000000004, new DateTime(1987, 12, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), "Good Morning, Vietnam" },
                    { 802, null, "NR", "Humbert Humbert is a middle-aged British novelist who is both appalled by and attracted to the vulgarity of American culture. When he comes to stay at the boarding house run by Charlotte Haze, he soon becomes obsessed with Lolita, the woman's teenaged daughter.", 154, "English", "/lPdCVPf0hkuCJc8mAGPCnHo05Z9.jpg", 7.4000000000000004, new DateTime(1962, 6, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), "Lolita" },
                    { 804, null, "G", "Overwhelmed by her suffocating schedule, touring European princess Ann takes off for a night while in Rome. When a sedative she took from her doctor kicks in, however, she falls asleep on a park bench and is found by an American reporter, Joe Bradley, who takes her back to his apartment for safety. At work the next morning, Joe finds out Ann's regal identity and bets his editor he can get exclusive interview with her, but romance soon gets in the way.", 119, "English", "/7W3afdX2eDuRGIBm1YJgGcLJx8q.jpg", 7.9000000000000004, new DateTime(1953, 8, 26, 0, 0, 0, 0, DateTimeKind.Unspecified), "Roman Holiday" },
                    { 805, null, "18A", "A young couple, Rosemary and Guy, moves into an infamous New York apartment building, known by frightening legends and mysterious events, with the purpose of starting a family.", 138, "English", "/y7fK8Ak8nsPL8r5t7fy5vyrcJwC.jpg", 7.7999999999999998, new DateTime(1968, 6, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), "Rosemary's Baby" },
                    { 807, null, "R", "Two homicide detectives are on a desperate hunt for a serial killer whose crimes are based on the \"seven deadly sins\" in this dark and haunting film that takes viewers from the tortured remains of one victim to the next. The seasoned Det. Sommerset researches each sin in an effort to get inside the killer's mind, while his novice partner, Mills, scoffs at his efforts to unravel the case.", 127, "English", "/69Sns8WoET6CfaYlIkHbla4l7nC.jpg", 8.3000000000000007, new DateTime(1995, 9, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), "Se7en" },
                    { 808, null, "PG", "It ain't easy bein' green -- especially if you're a likable (albeit smelly) ogre named Shrek. On a mission to retrieve a gorgeous princess from the clutches of a fire-breathing dragon, Shrek teams up with an unlikely compatriot -- a wisecracking donkey.", 90, "English", "/iB64vpL3dIObOtMZgX3RqdVdQDc.jpg", 7.5999999999999996, new DateTime(2001, 5, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), "Shrek" },
                    { 812, null, "G", "Princess Jasmine grows tired of being forced to remain in the palace, so she sneaks out into the marketplace, in disguise, where she meets street-urchin Aladdin.  The couple falls in love, although Jasmine may only marry a prince.  After being thrown in jail, Aladdin becomes embroiled in a plot to find a mysterious lamp, with which the evil Jafar hopes to rule the land.", 90, "English", "/eLFfl7vS8dkeG1hKp5mwbm37V83.jpg", 7.5999999999999996, new DateTime(1992, 11, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "Aladdin" },
                    { 813, null, "PG", "The persons and events in this film are fictitious - fortunately! A masterpiece of off-the-wall comedy, Airplane! features Robert Hays as an ex-fighter pilot forced to take over the controls of an airliner when the flight crew succumbs to food poisoning; Julie Hagerty as his girlfriend/stewardess/co-pilot; and a cast of all-stars including Robert Stack, Lloyd Bridges, Peter Graves, Leslie Nielsen, Kareem Abdul-Jabbar... and more. Their hilarious high jinks spoof airplane disaster flicks, religious zealots, television commercials, romantic love... the list whirls by in rapid succession. And the story races from one moment of zany fun to the next.", 88, "English", "/hiURvJjCgk0s10urHVCg80TFF11.jpg", 7.2999999999999998, new DateTime(1980, 7, 2, 0, 0, 0, 0, DateTimeKind.Unspecified), "Airplane!" },
                    { 814, null, "R", "Two American tourists in England are attacked by a werewolf that none of the locals will admit exists.", 97, "English", "/3vCDeq3mWJY0uJ5CvmJwOXWNBft.jpg", 7.4000000000000004, new DateTime(1981, 8, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), "An American Werewolf in London" },
                    { 819, null, "R", "Two gangsters seek revenge on the state jail worker who during their stay at a youth prison sexually abused them. A sensational court hearing takes place to charge him for the crimes.", 147, "English", "/yUpiEk2EojS9ZEXb3nIQonQCYYF.jpg", 7.5, new DateTime(1996, 10, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), "Sleepers" },
                    { 820, null, "R", "Follows the investigation into the assassination of President John F. Kennedy led by New Orleans district attorney Jim Garrison.", 189, "English", "/r0VWVTYlqdRCK5ZoOdNnHdqM2gt.jpg", 7.5999999999999996, new DateTime(1991, 12, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), "JFK" },
                    { 821, null, "PG", "In 1947, four German judges who served on the bench during the Nazi regime face a military tribunal to answer charges of crimes against humanity. Chief Justice Haywood hears evidence and testimony not only from lead defendant Ernst Janning and his defense attorney Hans Rolfe, but also from the widow of a Nazi general, an idealistic U.S. Army captain and reluctant witness Irene Wallner.", 179, "English", "/cqumfgd74ftVzOKJpFGOG64WlXL.jpg", 8.0, new DateTime(1961, 12, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "Judgment at Nuremberg" },
                    { 823, null, "R", "A member of an elite paramilitary counter-terrorism unit becomes traumatized after witnessing the suicide bombing of a young girl and is forced to undergo retraining. However, unbeknownst to him, he becomes a key player in a dispute between rival police divisions, as he finds himself increasingly involved with the sister of the girl he saw die.", 102, "Japanese", "/63EMBxmcafkc4cWuUWQh2Ttd2jh.jpg", 7.5, new DateTime(1999, 11, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), "Jin-Roh: The Wolf Brigade" },
                    { 824, null, "PG-13", "A celebration of love and creative inspiration takes place in the infamous, gaudy and glamorous Parisian nightclub, at the cusp of the 20th century. A young poet, who is plunged into the heady world of Moulin Rouge, begins a passionate affair with the club's most notorious and beautiful star.", 127, "English", "/elj5J1p09UdO1eqjfQuIafSpftp.jpg", 7.5999999999999996, new DateTime(2001, 5, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), "Moulin Rouge!" },
                    { 826, null, "PG", "The classic story of English POWs in Burma forced to build a bridge to aid the war effort of their Japanese captors. British and American intelligence officers conspire to blow up the structure, but Col. Nicholson , the commander who supervised the bridge's construction, has acquired a sense of pride in his creation and tries to foil their plans.", 161, "English", "/fuWtWy49Dbzz9UAnIHhKA0Z5LuT.jpg", 7.7999999999999998, new DateTime(1957, 10, 11, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Bridge on the River Kwai" },
                    { 827, null, "NR", "The cruel and abusive headmaster of a boarding school, Michel Delassalle, is murdered by an unlikely duo -- his meek wife and the mistress he brazenly flaunts. The women become increasingly unhinged by a series of odd occurrences after Delassalle's corpse mysteriously disappears.", 117, "French", "/pNcwhz3Eyfn3KQ2XykTozbARMpr.jpg", 7.9000000000000004, new DateTime(1955, 1, 29, 0, 0, 0, 0, DateTimeKind.Unspecified), "Diabolique" },
                    { 828, null, "G", "An alien and a robot land on Earth after World War II and tell mankind to be peaceful or face destruction.", 92, "English", "/x2DquTpLTq54aPFDnqlwY7apCC3.jpg", 7.5, new DateTime(1951, 9, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Day the Earth Stood Still" },
                    { 829, null, "R", "Private eye Jake Gittes lives off of the murky moral climate of sunbaked, pre-World War II Southern California. Hired by a beautiful socialite to investigate her husband's extra-marital affair, Gittes is swept into a maelstrom of double dealings and deadly deceits, uncovering a web of personal and political scandals that come crashing together.", 130, "English", "/AmPEv5Tve4DuJ4QWhpY5lSsmXcv.jpg", 7.9000000000000004, new DateTime(1974, 6, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), "Chinatown" },
                    { 830, null, "G", "Starship C57D travels to planet Altair 4 in search of the crew of spaceship \"Bellerophon,\" a scientific expedition that has been missing for 20 years, only to find themselves unwelcome by the expedition's lone survivor and warned of destruction by an invisible force if they don't turn back immediately.", 98, "English", "/aq0OQfRS7hDDI8vyD0ICbH9eguC.jpg", 7.2999999999999998, new DateTime(1956, 3, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), "Forbidden Planet" },
                    { 832, null, "PG-13", "In this classic German thriller, Hans Beckert, a serial killer who preys on children, becomes the focus of a massive Berlin police manhunt. Beckert's heinous crimes are so repellant and disruptive to city life that he is even targeted by others in the seedy underworld network. With both cops and criminals in pursuit, the murderer soon realizes that people are on his trail, sending him into a tense, panicked attempt to escape justice.", 117, "German", "/6hg2UClwHGnBojemFrLgiF1WK8A.jpg", 8.0999999999999996, new DateTime(1931, 5, 11, 0, 0, 0, 0, DateTimeKind.Unspecified), "M" }
                });

            migrationBuilder.InsertData(
                table: "Movies",
                columns: new[] { "Id", "ActorId", "Certification", "Description", "Duration", "Language", "Picture", "Ratings", "ReleaseDate", "Title" },
                values: new object[,]
                {
                    { 833, null, "6", "When elderly pensioner Umberto Domenico Ferrari returns to his boarding house from a protest calling for a hike in old-age pensions, his landlady demands her 15,000-lire rent by the end of the month or he and his small dog will be turned out onto the street. Unable to get the money in time, Umberto fakes illness to get sent to a hospital, giving his beloved dog to the landlady's pregnant and abandoned maid for temporary safekeeping.", 91, "Italian", "/fayAl6RBBvkruxZ4laI9peqeov7.jpg", 7.9000000000000004, new DateTime(1952, 1, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), "Umberto D." },
                    { 837, null, "R", "As the president of a trashy TV channel, Max Renn is desperate for new programming to attract viewers. When he happens upon \"Videodrome,\" a TV show dedicated to gratuitous torture and punishment, Max sees a potential hit and broadcasts the show on his channel. However, after his girlfriend auditions for the show and never returns, Max investigates the truth behind Videodrome and discovers that the graphic violence may not be as fake as he thought.", 88, "English", "/dBqp1SxlqnJEHYDM9sNelXoQsO1.jpg", 7.2999999999999998, new DateTime(1983, 2, 4, 0, 0, 0, 0, DateTimeKind.Unspecified), "Videodrome" },
                    { 839, null, "PG", "Traveling businessman David Mann angers the driver of a rusty tanker while crossing the California desert. A simple trip turns deadly, as Mann struggles to stay on the road while the tanker plays cat and mouse with his life.", 90, "English", "/vGVxYIAstgGIjjhXXXfmeqtNLmz.jpg", 7.4000000000000004, new DateTime(1971, 11, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), "Duel" },
                    { 840, null, "PG", "After an encounter with UFOs, a line worker feels undeniably drawn to an isolated area in the wilderness where something spectacular is about to happen.", 135, "English", "/kzD5ng3BvRUxW9vBfCkg61XjITR.jpg", 7.4000000000000004, new DateTime(1977, 11, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), "Close Encounters of the Third Kind" },
                    { 843, null, "15", "A melancholy story set in Hong Kong in 1962. A woman and a man who live in the same crowded apartment building discover that their husband and wife are having an affair.", 99, "Cantonese", "/iYypPT4bhqXfq1b6EnmxvRt6b2Y.jpg", 8.0999999999999996, new DateTime(2000, 9, 29, 0, 0, 0, 0, DateTimeKind.Unspecified), "In the Mood for Love" },
                    { 844, null, "R", "Women enter and exit a science fiction author's life, over the course of a few years, after the author loses the woman he considers his one true love.", 128, "Mandarin", "/jIN65qw0Giplo4CshzMrxz204Wn.jpg", 7.2000000000000002, new DateTime(2004, 5, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), "2046" },
                    { 845, null, "PG", "A deranged socialite accosts a tennis star with his theory that if two strangers trade murders, they can disguise their motives and avoid suspicion.", 101, "English", "/ihC083U7ef56Ui4x0P0dobojrZ1.jpg", 7.7000000000000002, new DateTime(1951, 6, 27, 0, 0, 0, 0, DateTimeKind.Unspecified), "Strangers on a Train" },
                    { 850, null, "PG", "The comic mishaps and adventures of a young boy named Ralph, trying to convince his parents, teachers, and Santa that a Red Ryder B.B. gun really is the perfect Christmas gift for the 1940s.", 93, "English", "/qE5ZcJQA0tSG1KCiy4Fv0W91dS7.jpg", 7.2999999999999998, new DateTime(1983, 11, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), "A Christmas Story" },
                    { 851, null, "NR", "Returning home from a shopping trip to a nearby town, bored suburban housewife Laura Jesson is thrown by happenstance into an acquaintance with virtuous doctor Alec Harvey. Their casual friendship soon develops during their weekly visits into something more emotionally fulfilling than either expected, and they must wrestle with the potential havoc their deepening relationship would have on their lives and the lives of those they love.", 86, "English", "/46yqnRK0XwxP686pkWwfLW8NwyV.jpg", 7.7999999999999998, new DateTime(1945, 11, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), "Brief Encounter" },
                    { 853, null, "R", "A Russian and a German sniper play a game of cat-and-mouse during the Battle of Stalingrad in WWII.", 131, "English", "/9cSoNnB31hGY2mL78VT8mAbz6nR.jpg", 7.4000000000000004, new DateTime(2001, 3, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), "Enemy at the Gates" },
                    { 855, null, "R", "When U.S. Rangers and an elite Delta Force team attempt to kidnap two underlings of a Somali warlord, their Black Hawk helicopters are shot down, and the Americans suffer heavy casualties, facing intense fighting from the militia on the ground.", 145, "English", "/7fU5dSqKRL4XHeEUz62rCKBfYok.jpg", 7.4000000000000004, new DateTime(2001, 12, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), "Black Hawk Down" },
                    { 856, null, "PG", "'Toon star Roger is worried that his wife Jessica is playing pattycake with someone else, so the studio hires detective Eddie Valiant to snoop on her. But the stakes are quickly raised when Marvin Acme is found dead and Roger is the prime suspect.", 104, "English", "/5xwYo64Wc64llsfF0tQk3RpvZ5Q.jpg", 7.5, new DateTime(1988, 6, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), "Who Framed Roger Rabbit" },
                    { 857, null, "R", "As U.S. troops storm the beaches of Normandy, three brothers lie dead on the battlefield, with a fourth trapped behind enemy lines. Ranger captain John Miller and seven men are tasked with penetrating German-held territory and bringing the boy home.", 169, "English", "/1wY4psJ5NVEhCuOYROwLH2XExM2.jpg", 8.1999999999999993, new DateTime(1998, 7, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), "Saving Private Ryan" },
                    { 859, null, "R", "In 18th century France, Marquise de Merteuil asks her ex-lover Vicomte de Valmont to seduce the future wife of another ex-lover of hers in return for one last night with her. Yet things don’t go as planned.", 119, "English", "/5MEl1xrbM93zjpFgS3sHJ2SlIFm.jpg", 7.2999999999999998, new DateTime(1988, 12, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), "Dangerous Liaisons" },
                    { 861, null, "R", "Construction worker Douglas Quaid discovers a memory chip in his brain during a virtual-reality trip. He also finds that his past has been invented to conceal a plot of planetary domination. Soon, he's off to Mars to find out who he is and who planted the chip.", 113, "English", "/wVbeL6fkbTKSmNfalj4VoAUUqJv.jpg", 7.2000000000000002, new DateTime(1990, 6, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "Total Recall" },
                    { 862, null, "G", "Led by Woody, Andy's toys live happily in his room until Andy's birthday brings Buzz Lightyear onto the scene. Afraid of losing his place in Andy's heart, Woody plots against Buzz. But when circumstances separate Buzz and Woody from their owner, the duo eventually learns to put aside their differences.", 81, "English", "/uXDfjJbdP4ijW5hWSBrPrlKpxab.jpg", 7.9000000000000004, new DateTime(1995, 10, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Toy Story" },
                    { 863, null, "G", "Andy heads off to Cowboy Camp, leaving his toys to their own devices. Things shift into high gear when an obsessive toy collector named Al McWhiggen, owner of Al's Toy Barn kidnaps Woody. Andy's toys mount a daring rescue mission, Buzz Lightyear meets his match and Woody has to decide where he and his heart truly belong.", 92, "English", "/eVGu0zsezaSCuN67zgNhzjeNI9Z.jpg", 7.5999999999999996, new DateTime(1999, 10, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Toy Story 2" },
                    { 866, null, "PG", "During a writing slump, playwright J.M. Barrie meets a widow and her three children—who soon become an important part of Barrie’s life and the inspiration that lead him to create his masterpiece. Peter Pan'.", 106, "English", "/A9jgLICNCEb3lvWdNaIKAG9pRdp.jpg", 7.2999999999999998, new DateTime(2004, 10, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), "Finding Neverland" },
                    { 871, null, "G", "An  U.S. Spaceship lands on a desolate planet, stranding astronaut Taylor in a world dominated by apes, 2000 years into the future, who use a primitive race of humans for experimentation and sport. Soon Taylor finds himself among the hunted, his life in the hands of a benevolent chimpanzee scientist.", 112, "English", "/hjRLPGCbADVsSaa26pdjV0qlSjt.jpg", 7.5999999999999996, new DateTime(1968, 2, 7, 0, 0, 0, 0, DateTimeKind.Unspecified), "Planet of the Apes" },
                    { 872, null, "G", "In 1927 Hollywood, a silent film production company and cast make a difficult transition to sound.", 103, "English", "/62plaLItfJDXKcLUJdOQ35wASms.jpg", 8.1999999999999993, new DateTime(1952, 4, 9, 0, 0, 0, 0, DateTimeKind.Unspecified), "Singin' in the Rain" },
                    { 873, null, "PG", "An epic tale spanning forty years in the life of Celie, an African-American woman living in the South who survives incredible abuse and bigotry. After Celie's abusive father marries her off to the equally debasing 'Mister' Albert Johnson, things go from bad to worse, leaving Celie to find companionship anywhere she can. She perseveres, holding on to her dream of one day being reunited with her sister in Africa.", 154, "English", "/ziosRyziefrmEmAMIswpjQzvAur.jpg", 7.7999999999999998, new DateTime(1985, 12, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Color Purple" },
                    { 874, null, "G", "A depiction of the conflict between King Henry VIII of England and his Lord Chancellor, Sir Thomas More, who refuses to swear the Oath of Supremacy declaring Henry Supreme Head of the Church in England.", 120, "English", "/fKdIMxsxt2PQlHGqmnl8uSS2C54.jpg", 7.4000000000000004, new DateTime(1966, 12, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), "A Man for All Seasons" },
                    { 877, null, "15", "A murderous thug shoots his way to the top of the mobs while trying to protect his sister from the criminal life.", 93, "English", "/zH6q4rZEwGTDBEPdGiFUkRybiJX.jpg", 7.5999999999999996, new DateTime(1932, 4, 9, 0, 0, 0, 0, DateTimeKind.Unspecified), "Scarface" },
                    { 881, null, "R", "When cocky military lawyer Lt. Daniel Kaffee and his co-counsel, Lt. Cmdr. JoAnne Galloway, are assigned to a murder case, they uncover a hazing ritual that could implicate high-ranking officials such as shady Col. Nathan Jessep.", 138, "English", "/rLOk4z9zL1tTukIYV56P94aZXKk.jpg", 7.5, new DateTime(1992, 12, 11, 0, 0, 0, 0, DateTimeKind.Unspecified), "A Few Good Men" },
                    { 887, null, "NR", "It's the hope that sustains the spirit of every GI: the dream of the day when he will finally return home. For three WWII veterans, the day has arrived. But for each man, the dream is about to become a nightmare. Captain Fred Derry is returning to a loveless marriage; Sergeant Al Stephenson is a stranger to a family that's grown up without him; and young sailor Homer Parrish is tormented by the loss of his hands. Can these three men find the courage to rebuild their world? Or are the best years of their lives a thing of the past?", 171, "English", "/gd5EoAU4MM57sW3vlWxJ0NMM8cV.jpg", 7.7999999999999998, new DateTime(1946, 12, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Best Years of Our Lives" },
                    { 891, null, "PG", "During the 1972 elections, two reporters' investigation sheds light on the controversial Watergate scandal that compels President Richard Nixon to resign from his post.", 138, "English", "/cPtSHR7D2WGsDBfnC5DxV927hKn.jpg", 7.7000000000000002, new DateTime(1976, 4, 4, 0, 0, 0, 0, DateTimeKind.Unspecified), "All the President's Men" },
                    { 892, null, "R", "This bizarre surrealistic black comedy takes place in a small fictitious post-apocalyptic town where food is scarce and butcher Clapet has the macabre business of using human flesh to feed his customers. Yet when his daughter falls in love with his next slaughter victim things turn into chaos.", 99, "French", "/89yw7xrAhnhGCldvyssPjINJQRb.jpg", 7.2999999999999998, new DateTime(1991, 4, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), "Delicatessen" },
                    { 895, null, "12", "An expansive Russian drama, this film focuses on the life of revered religious icon painter Andrei Rublev. Drifting from place to place in a tumultuous era, the peace-seeking monk eventually gains a reputation for his art. But after Rublev witnesses a brutal battle and unintentionally becomes involved, he takes a vow of silence and spends time away from his work. As he begins to ease his troubled soul, he takes steps towards becoming a painter once again.", 205, "Russian", "/910xRIUmNJrWH2hkQifBJtoPp5R.jpg", 8.0999999999999996, new DateTime(1966, 12, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), "Andrei Rublev" },
                    { 900, null, "NR", "David Huxley is waiting to get a bone he needs for his museum collection. Through a series of strange circumstances, he meets Susan Vance, and the duo have a series of misadventures which include a leopard called Baby.", 102, "English", "/3mEq3sykPfItN3nTMqBm1hHwFAY.jpg", 7.5999999999999996, new DateTime(1938, 2, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), "Bringing Up Baby" },
                    { 901, null, "G", "In this sound-era silent film, a tramp falls in love with a beautiful blind flower seller.", 87, "English", "/bXNvzjULc9jrOVhGfjcc64uKZmZ.jpg", 8.4000000000000004, new DateTime(1931, 2, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "City Lights" },
                    { 902, null, "15", "A scientist in a surrealist society kidnaps children to steal their dreams, hoping that they slow his aging process.", 108, "French", "/whwT3Q9JxbAYzEc3t7uYYcCbTMf.jpg", 7.4000000000000004, new DateTime(1995, 8, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), "The City of Lost Children" },
                    { 903, null, "PG", "When petty criminal Luke Jackson is sentenced to two years in a Florida prison farm, he doesn't play by the rules of either the sadistic warden or the yard's resident heavy, Dragline, who ends up admiring the new guy's unbreakable will. Luke's bravado, even in the face of repeated stints in the prison's dreaded solitary confinement cell, \"the box,\" make him a rebel hero to his fellow convicts and a thorn in the side of the prison officers.", 127, "English", "/sqelBKOEdYruo497Jx6SAC3jBMY.jpg", 7.7999999999999998, new DateTime(1967, 6, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), "Cool Hand Luke" },
                    { 907, null, "PG-13", "The life of a Russian physician and poet who, although married to another, falls in love with a political activist's wife and experiences hardship during World War I and then the October Revolution.", 200, "English", "/mTy6RoFAOtvFsdELTSN838JuvSD.jpg", 7.5, new DateTime(1965, 12, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), "Doctor Zhivago" },
                    { 910, null, "NR", "Private Investigator Philip Marlowe is hired by wealthy General Sternwood regarding a matter involving his youngest daughter Carmen. Before the complex case is over, Marlowe sees murder, blackmail, deception, and what might be love.", 116, "English", "/pZUBI77RMu652QmtWL9RBWF1uO6.jpg", 7.7000000000000002, new DateTime(1946, 8, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Big Sleep" },
                    { 914, null, "NR", "Dictator Adenoid Hynkel tries to expand his empire while a poor Jewish barber tries to avoid persecution from Hynkel's regime.", 125, "English", "/bTW7RvjX3OkNMr3YcXVwW7aCBiF.jpg", 8.4000000000000004, new DateTime(1940, 10, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Great Dictator" },
                    { 921, null, "PG-13", "The true story of boxer Jim Braddock who, in the 1920’s following his retirement, makes a surprise comeback in order to get him and his family out of a socially poor state.", 144, "English", "/wkeOjIcpuqLMW4GnVowlM9VI0JE.jpg", 7.5, new DateTime(2005, 6, 2, 0, 0, 0, 0, DateTimeKind.Unspecified), "Cinderella Man" },
                    { 922, null, "R", "On the run after murdering a man, accountant William Blake encounters a strange North American man named Nobody who prepares him for his journey into the spiritual world.", 121, "English", "/65iVwc0t5eTDhQJsddsR14uBuGr.jpg", 7.2999999999999998, new DateTime(1995, 12, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), "Dead Man" },
                    { 923, null, "NR", "During an ever-growing epidemic of zombies that have risen from the dead, two Philadelphia SWAT team members, a traffic reporter, and his television-executive girlfriend seek refuge in a secluded shopping mall.", 127, "English", "/9kGESwH451kRgm1h6Q0svAVK60N.jpg", 7.5, new DateTime(1978, 9, 2, 0, 0, 0, 0, DateTimeKind.Unspecified), "Dawn of the Dead" },
                    { 925, null, "R", "Salvatore \"Sal\" Fragione is the Italian owner of a pizzeria in Brooklyn. A neighborhood local, Buggin' Out, becomes upset when he sees that the pizzeria's Wall of Fame exhibits only Italian actors. Buggin' Out believes a pizzeria in a black neighborhood should showcase black actors, but Sal disagrees. The wall becomes a symbol of racism and hate to Buggin' Out and to other people in the neighborhood, and tensions rise.", 120, "English", "/63rmSDPahrH7C1gEFYzRuIBAN9W.jpg", 7.7999999999999998, new DateTime(1989, 6, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), "Do the Right Thing" },
                    { 934, null, "16", "Out of prison after a five-year stretch, jewel thief Tony turns down a quick job his friend Jo offers him, until he discovers that his old girlfriend Mado has become the lover of local gangster Pierre Grutter during Tony's absence. Expanding a minor smash-and-grab into a full-scale jewel heist, Tony and his crew appear to get away clean, but their actions after the job is completed threaten the lives of everyone involved.", 118, "French", "/6MbRycXyrLaFmToyOBPSKHmqkYy.jpg", 7.9000000000000004, new DateTime(1955, 4, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), "Rififi" },
                    { 935, null, "PG", "After the insane General Jack D. Ripper initiates a nuclear strike on the Soviet Union, a war room full of politicians, generals and a Russian diplomat all frantically try to stop the nuclear strike.", 95, "English", "/gHm96BRW4GoI339rF1vYoYTB6Qe.jpg", 8.1999999999999993, new DateTime(1964, 1, 29, 0, 0, 0, 0, DateTimeKind.Unspecified), "Dr. Strangelove or: How I Learned to Stop Worrying and Love the Bomb" },
                    { 938, null, "R", "Two bounty hunters are in pursuit of \"El Indio,\" one of the most wanted fugitives in the western territories, and his gang.", 132, "Italian", "/3yv5WcpTqzIq8FsoVUs4pvFqk9j.jpg", 8.0, new DateTime(1965, 5, 10, 0, 0, 0, 0, DateTimeKind.Unspecified), "For a Few Dollars More" }
                });

            migrationBuilder.InsertData(
                table: "Movies",
                columns: new[] { "Id", "ActorId", "Certification", "Description", "Duration", "Language", "Picture", "Ratings", "ReleaseDate", "Title" },
                values: new object[,]
                {
                    { 940, null, "NR", "On a train headed for England a group of travelers is delayed by an avalanche. Holed up in a hotel in a fictional European country, young Iris befriends elderly Miss Froy. When the train resumes, Iris suffers a bout of unconsciousness and wakes to find the old woman has disappeared. The other passengers ominously deny Miss Froy ever existed, so Iris begins to investigate with another traveler and, as the pair sleuth, romantic sparks fly.", 96, "English", "/e9yjeqzcsFEhwTsv2Lv9RTZhHaJ.jpg", 7.5, new DateTime(1938, 10, 7, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Lady Vanishes" },
                    { 941, null, "R", "Veteran buttoned-down LAPD detective Roger Murtaugh is partnered with unhinged cop Martin Riggs, who -- distraught after his wife's death -- has a death wish and takes unnecessary risks with criminals at every turn. The odd couple embark on their first homicide investigation as partners, involving a young woman known to Murtaugh with ties to a drug and prostitution ring.", 110, "English", "/fTq4ThIP3pQTYR9eDepsbDHqdcs.jpg", 7.2000000000000002, new DateTime(1987, 3, 6, 0, 0, 0, 0, DateTimeKind.Unspecified), "Lethal Weapon" },
                    { 947, null, "PG", "The story of British officer T.E. Lawrence's mission to aid the Arab tribes in their revolt against the Ottoman Empire during the First World War. Lawrence becomes a flamboyant, messianic figure in the cause of Arab unity but his psychological instability threatens to undermine his achievements.", 227, "English", "/yBc8a5wQL7FmSra4TgcdNrBcoP9.jpg", 8.0, new DateTime(1962, 12, 11, 0, 0, 0, 0, DateTimeKind.Unspecified), "Lawrence of Arabia" },
                    { 948, null, "R", "Fifteen years after murdering his sister on Halloween night 1963, Michael Myers escapes from a mental hospital and returns to the small town of Haddonfield, Illinois to kill again.", 91, "English", "/yzVhqSi3XkEQOovR4yy2lVTZiQO.jpg", 7.5999999999999996, new DateTime(1978, 10, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), "Halloween" },
                    { 949, null, "R", "Obsessive master thief, Neil McCauley leads a top-notch crew on various daring heists throughout Los Angeles while determined detective, Vincent Hanna pursues him without rest. Each man recognizes and respects the ability and the dedication of the other even though they are aware their cat-and-mouse game may end in violence.", 170, "English", "/obpPQskaVpSiC9RcJRB6iWDTCXS.jpg", 7.9000000000000004, new DateTime(1995, 12, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Heat" },
                    { 961, null, "NR", "During America’s Civil War, Union spies steal engineer Johnnie Gray's beloved locomotive, 'The General'—with Johnnie's lady love aboard an attached boxcar—and he single-handedly must do all in his power to both get The General back and to rescue Annabelle.", 79, "English", "/tmyxr4ZkUKtcUwBc7ptyIWdLZEH.jpg", 8.0999999999999996, new DateTime(1926, 12, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "The General" },
                    { 962, null, "L", "A lone prospector ventures into Alaska looking for gold. He soon gets mixed up with some burly characters, falls in love with the beautiful Georgia, and tries to win her heart with his singular charm.", 95, "English", "/eQRFo1qwRREYwj47Yoe1PisgOle.jpg", 8.0, new DateTime(1925, 7, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Gold Rush" },
                    { 963, null, "NR", "A private detective takes on a case that involves him with three eccentric criminals, a beautiful liar, and their quest for a priceless statuette.", 100, "English", "/wcGLnRsuKyCYg3WLXQqIuB0lsJB.jpg", 7.7999999999999998, new DateTime(1941, 10, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Maltese Falcon" },
                    { 965, null, "NR", "The spoiled young heir to the decaying Amberson fortune comes between his widowed mother and the man she has always loved.", 88, "English", "/sB7CfN7hWeTVdyUrFrEAapoPmXH.jpg", 7.2999999999999998, new DateTime(1942, 7, 10, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Magnificent Ambersons" },
                    { 966, null, "16", "An oppressed Mexican peasant village hires seven gunfighters to help defend their homes.", 128, "English", "/6rVIjriV3Sv1B9INrzGRXW8Q7aY.jpg", 7.5999999999999996, new DateTime(1960, 4, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Magnificent Seven" },
                    { 967, null, "PG-13", "The rebellious Thracian Spartacus, born and raised a slave, is sold to Gladiator trainer Batiatus. After weeks of being trained to kill for the arena, Spartacus turns on his owners and leads the other slaves in rebellion. As the rebels move from town to town, their numbers swell as escaped slaves join their ranks. Under the leadership of Spartacus, they make their way to southern Italy, where they will cross the sea and return to their homes.", 197, "English", "/prdCmV8GkDLpguwoxBQczFAwvci.jpg", 7.5999999999999996, new DateTime(1960, 10, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), "Spartacus" },
                    { 968, null, "R", "Based on the true story of would-be Brooklyn bank robbers John Wojtowicz and Salvatore Naturale. Sonny and Sal attempt a bank heist which quickly turns sour and escalates into a hostage situation and stand-off with the police. As Sonny's motives for the robbery are slowly revealed and things become more complicated, the heist turns into a media circus.", 125, "English", "/mavrhr0ig2aCRR8d48yaxtD5aMQ.jpg", 7.7999999999999998, new DateTime(1975, 9, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), "Dog Day Afternoon" },
                    { 975, null, "NR", "A commanding officer defends three scapegoats on trial for a failed offensive that occurred within the French Army in 1916.", 88, "English", "/kHMZTjBH99GghtFF9rjA7d7IylH.jpg", 8.3000000000000007, new DateTime(1957, 10, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "Paths of Glory" },
                    { 976, null, "PG", "New York City newspaper writer J.J. Hunsecker holds considerable sway over public opinion with his Broadway column, but one thing that he can't control is his younger sister, Susan, who is in a relationship with aspiring jazz guitarist Steve Dallas. Hunsecker strongly disapproves of the romance and recruits publicist Sidney Falco to find a way to split the couple, no matter how ruthless the method.", 97, "English", "/4SzW8u7avVczndyR3UbU87ZpE0V.jpg", 7.5999999999999996, new DateTime(1957, 7, 4, 0, 0, 0, 0, DateTimeKind.Unspecified), "Sweet Smell of Success" },
                    { 979, null, "NC-17", "Events over the course of one traumatic night in Paris unfold in reverse-chronological order as the beautiful Alex is brutally raped and beaten by a stranger in the underpass. Her boyfriend and ex-lover take matters into their own hands and subsequently seek revenge upon the assailant. A simultaneously beautiful and terrible examination of the destructive nature of cause and effect, and how time destroys everything.", 93, "French", "/rxeDxo8FvZpLu6iplNpxdtAVnfu.jpg", 7.2000000000000002, new DateTime(2002, 5, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), "Irreversible" },
                    { 980, null, "NR", "Gil Carter and Art Croft ride into a small Nevada town plagued by cattle thieves. Initially suspected of being the rustlers themselves, Carter and Croft eventually join a posse out to get the criminals, who also may be involved in a recent shooting. When the posse closes in on a group that could be the fugitives, they must decide on a course of action, with numerous lives hanging in the balance.", 76, "English", "/bCuK2h4tizhCWpQT51y1wmca8DY.jpg", 7.7999999999999998, new DateTime(1943, 3, 11, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Ox-Bow Incident" },
                    { 981, null, "NR", "When a rich woman's ex-husband and a tabloid-type reporter turn up just before her planned remarriage, she begins to learn the truth about herself.", 113, "English", "/o4cYWubhrBFF56IyEyce89lMb5y.jpg", 7.7000000000000002, new DateTime(1940, 12, 5, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Philadelphia Story" },
                    { 982, null, "PG-13", "Near the end of the Korean War, a platoon of U.S. soldiers is captured by communists and brainwashed. Following the war, the platoon is returned home, and Sergeant Raymond Shaw is lauded as a hero by the rest of his platoon. However, the platoon commander, Captain Bennett Marco, finds himself plagued by strange nightmares and soon races to uncover a terrible plot.", 126, "English", "/2xQ856kd9hw6bB3OnusGyTvvkwB.jpg", 7.7000000000000002, new DateTime(1962, 10, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Manchurian Candidate" },
                    { 983, null, "PG", "A robust adventure about two British adventurers who take over primitive Kafiristan as \"godlike\" rulers, meeting a tragic end through their desire for a native girl. Based on a short story by Rudyard Kipling.", 129, "English", "/21BANIzXEKyZDUFOr9NdUEgP4EA.jpg", 7.5, new DateTime(1975, 12, 3, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Man Who Would Be King" },
                    { 984, null, "R", "When a madman dubbed 'Scorpio' terrorizes San Francisco, hard-nosed cop, Harry Callahan – famous for his take-no-prisoners approach to law enforcement – is tasked with hunting down the psychopath. Harry eventually collars Scorpio in the process of rescuing a kidnap victim, only to see him walk on technicalities. Now, the maverick detective is determined to nail the maniac himself.", 102, "English", "/UHxxkYe9tRdiPu0JFgcEL5hmQ4.jpg", 7.5, new DateTime(1971, 7, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), "Dirty Harry" },
                    { 985, null, "NR", "Henry Spencer tries to survive his industrial environment, his angry girlfriend, and the unbearable screams of his newly born mutant child.", 89, "English", "/fjq2xZvWWKZJtg8FGNHXdbVoAAf.jpg", 7.5, new DateTime(1978, 2, 3, 0, 0, 0, 0, DateTimeKind.Unspecified), "Eraserhead" },
                    { 987, null, "e 10", "A journalist suffering from burn-out wants to finally say goodbye to his office – but his boss doesn’t like the idea one bit.", 105, "English", "/r4RtbJk8wVyZ1yk6yBZjzGD4ANU.jpg", 7.2999999999999998, new DateTime(1974, 12, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Front Page" },
                    { 988, null, "PG", "While doing a series of reports on alternative energy sources, opportunistic reporter Kimberly Wells witnesses an accident at a nuclear power plant. Wells is determined to publicize the incident, but soon finds herself entangled in a sinister conspiracy to keep the full impact of the incident a secret.", 122, "English", "/uHwwQIlt4XwpTFhX9ZT1A8xSW7F.jpg", 7.2000000000000002, new DateTime(1979, 3, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), "The China Syndrome" },
                    { 990, null, "NR", "Fast Eddie Felson is a small-time pool hustler with a lot of talent but a self-destructive attitude. His bravado causes him to challenge the legendary Minnesota Fats to a high-stakes match.", 134, "English", "/aSwY6gsACNgtoKpXFPwDovfWF1m.jpg", 7.7999999999999998, new DateTime(1961, 9, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Hustler" },
                    { 992, null, "NR", "A film projectionist longs to be a detective, and puts his meagre skills to work when he is framed by a rival for stealing his girlfriend's father's pocketwatch.", 45, "English", "/1G9r3rqtbFAQuyWKOZm4Y5J5s7Q.jpg", 8.1999999999999993, new DateTime(1924, 4, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), "Sherlock Jr." },
                    { 993, null, "PG", "A mystery novelist devises an insurance scam with his wife’s lover – but things aren’t exactly as they seem.", 138, "English", "/avFuamkwshZr9FURRD9HZPAGtkQ.jpg", 7.7000000000000002, new DateTime(1972, 12, 10, 0, 0, 0, 0, DateTimeKind.Unspecified), "Sleuth" },
                    { 995, null, "NR", "A group of people traveling on a stagecoach find their journey complicated by the threat of Geronimo, and learn something about each other in the process.", 96, "English", "/zgMnfnwWZ3nkx4t0bUDEKtW24O8.jpg", 7.7000000000000002, new DateTime(1939, 3, 3, 0, 0, 0, 0, DateTimeKind.Unspecified), "Stagecoach" },
                    { 996, null, "NR", "A rich woman and a calculating insurance agent plot to kill her unsuspecting husband after he signs a double indemnity policy. Against a backdrop of distinctly Californian settings, the partners in crime plan the perfect murder to collect the insurance, which pays double if the death is accidental.", 108, "English", "/3FxPFG4IEg1kX00oAJn7L06GoCS.jpg", 8.1999999999999993, new DateTime(1944, 6, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), "Double Indemnity" },
                    { 1018, null, "R", "Blonde Betty Elms has only just arrived in Hollywood to become a movie star when she meets an enigmatic brunette with amnesia. Meanwhile, as the two set off to solve the second woman's identity, filmmaker Adam Kesher runs into ominous trouble while casting his latest project.", 147, "English", "/tVxGt7uffLVhIIcwuldXOMpFBPX.jpg", 7.7999999999999998, new DateTime(2001, 6, 6, 0, 0, 0, 0, DateTimeKind.Unspecified), "Mulholland Drive" },
                    { 1023, null, "R", "A neo-nazi sentenced to community service at a church clashes with the blindly devotional priest.", 94, "Danish", "/v5KtTI8uFWqOed7dL3nzAvOTCn2.jpg", 7.5, new DateTime(2005, 4, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Adam's Apples" },
                    { 1040, null, "12", "As Garibaldi's troops begin the unification of Italy in the 1860s, an aristocratic Sicilian family grudgingly adapts to the sweeping social changes undermining their way of life. Proud but pragmatic Prince Don Fabrizio Salina allows his war hero nephew, Tancredi, to marry Angelica, the beautiful daughter of gauche, bourgeois Don Calogero, in order to maintain the family's accustomed level of comfort and political clout.", 186, "Italian", "/uRTf779enqJfeqoINKDyzo4teFS.jpg", 7.7000000000000002, new DateTime(1963, 3, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Leopard" },
                    { 1051, null, "R", "Tough narcotics detective 'Popeye' Doyle is in hot pursuit of a suave French drug dealer who may be the key to a huge heroin-smuggling operation.", 104, "English", "/5XSGvIKl2yPvOkieFjc3rzLw7x0.jpg", 7.5, new DateTime(1971, 10, 9, 0, 0, 0, 0, DateTimeKind.Unspecified), "The French Connection" },
                    { 1052, null, "NR", "A successful mod photographer in London whose world is bounded by fashion, pop music, marijuana, and easy sex, feels his life is boring and despairing. But in the course of a single day he accidentally captures on film the commission of a murder. The fact that he has photographed a murder does not occur to him until he studies and then blows up his negatives, uncovering details, blowing up smaller and smaller elements, and finally putting the puzzle together.", 111, "English", "/iVtUdWsT6Ed2DK762zZxjaQAdHy.jpg", 7.5, new DateTime(1966, 12, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), "Blow-Up" },
                    { 1059, null, "U", "Japanese peasants Matashichi and Tahei try and fail to make a profit from a tribal war. They find a man and woman whom they believe are simple tribe members hiding in a fortress. Although the peasants don't know that Rokurota is a general and Yuki is a princess, the peasants agree to accompany the pair to safety in return for gold. Along the way, the general must prove his expertise in battle while also hiding his identity.", 139, "Japanese", "/ccGA4zIC6EAsFWUlCqaFEcznWA2.jpg", 8.0, new DateTime(1958, 12, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Hidden Fortress" },
                    { 1075, null, "R", "Matko is a small time hustler, living by the Danube with his 17-year-old son Zare. After a failed business deal he owes money to the much more successful gangster Dadan. Dadan has a sister, Afrodita, that he desperately wants to see get married so they strike a deal: Zare is to marry her.", 127, "Serbian", "/gGtt1IQUAzEjOPS1xHoC9PDX2VT.jpg", 7.7000000000000002, new DateTime(1998, 6, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "Black Cat, White Cat" },
                    { 1088, null, "PG-13", "On the east coast of New Zealand, the Whangara people believe their presence there dates back a thousand years or more to a single ancestor, Paikea, who escaped death when his canoe capsized by riding to shore on the back of a whale. From then on, Whangara chiefs, always the first-born, always male, have been considered Paikea's direct descendants. Pai, an 11-year-old girl in a patriarchal New Zealand tribe, believes she is destined to be the new chief. But her grandfather Koro is bound by tradition to pick a male leader. Pai loves Koro more than anyone in the world, but she must fight him and a thousand years of tradition to fulfill her destiny.", 101, "English", "/1ZQSkyEDRJdk6TCAThBojB5hJcK.jpg", 7.2000000000000002, new DateTime(2003, 1, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Whale Rider" },
                    { 1091, null, "R", "Members of an American scientific research outpost in Antarctica find themselves battling a parasitic alien organism capable of perfectly imitating its victims. They soon discover that this task will be harder than they thought, as they don't know which members of the team have already been assimilated and their paranoia threatens to tear them apart.", 109, "English", "/tzGY49kseSE9QAKk47uuDGwnSCu.jpg", 8.0, new DateTime(1982, 6, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Thing" },
                    { 1092, null, "NR", "In postwar Vienna, Austria, Holly Martins, a writer of pulp Westerns, arrives penniless as a guest of his childhood chum Harry Lime, only to learn he has died. Martins develops a conspiracy theory after learning of a \"third man\" present at the time of Harry's death, running into interference from British officer Major Calloway, and falling head-over-heels for Harry's grief-stricken lover, Anna.", 105, "English", "/rO2Fq0AZZx9obs52KJdx4mRE8p5.jpg", 8.0, new DateTime(1949, 8, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Third Man" },
                    { 1093, null, null, "A self-assured businessman murders his employer, the husband of his mistress, which unintentionally provokes an ill-fated chain of events.", 91, "French", "/dLbf8LtbLQFM7KUaVgwkfKIPqXu.jpg", 7.7000000000000002, new DateTime(1958, 1, 29, 0, 0, 0, 0, DateTimeKind.Unspecified), "Elevator to the Gallows" },
                    { 1116, null, "NR", "In 1920s Ireland young doctor Damien O'Donovan prepares to depart for a new job in a London hospital. As he says his goodbyes at a friend's farm, British Black and Tans arrive, and a young man is killed. Damien joins his brother Teddy in the Irish Republican Army, but political events are soon set in motion that tear the brothers apart.", 127, "English", "/9XquDdOGrlC0EAbPoOXALqS2dDh.jpg", 7.4000000000000004, new DateTime(2006, 3, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Wind That Shakes the Barley" },
                    { 1124, null, "PG-13", "A mysterious story of two magicians whose intense rivalry leads them on a life-long battle for supremacy -- full of obsession, deceit and jealousy with dangerous and deadly consequences.", 130, "English", "/Ag2B2KHKQPukjH7WutmgnnSNurZ.jpg", 8.1999999999999993, new DateTime(2006, 10, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Prestige" },
                    { 1245, null, "PG", "A rule bound head butler's world of manners and decorum in the household he maintains is tested by the arrival of a housekeeper who falls in love with him in post-WWI Britain. The possibility of romance and his master's cultivation of ties with the Nazi cause challenge his carefully maintained veneer of servitude.", 134, "English", "/qtwipjmSypSQuSvz5BNirSxZqbg.jpg", 7.4000000000000004, new DateTime(1993, 11, 5, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Remains of the Day" }
                });

            migrationBuilder.InsertData(
                table: "Movies",
                columns: new[] { "Id", "ActorId", "Certification", "Description", "Duration", "Language", "Picture", "Ratings", "ReleaseDate", "Title" },
                values: new object[,]
                {
                    { 1251, null, "R", "The story of the battle of Iwo Jima between the United States and Imperial Japan during World War II, as told from the perspective of the Japanese who fought it.", 141, "English", "/kZokxQtzMPURvijWYFuvh1fAvnv.jpg", 7.5, new DateTime(2006, 12, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), "Letters from Iwo Jima" },
                    { 1254, null, null, "A 19-year-old searches for her twin brother after he runs away from home, following a fight with their father.", 96, "French", "/yD6skMZZq0Rgn2NhI9dk4B2Dipu.jpg", 7.2999999999999998, new DateTime(2006, 9, 6, 0, 0, 0, 0, DateTimeKind.Unspecified), "Don't Worry, I'm Fine" },
                    { 1262, null, "PG-13", "Harold Crick is a lonely IRS agent whose mundane existence is transformed when he hears a mysterious voice narrating his life.", 113, "English", "/frsmEKSW2T0lx5sU4w3m3GwPeeS.jpg", 7.2000000000000002, new DateTime(2006, 9, 9, 0, 0, 0, 0, DateTimeKind.Unspecified), "Stranger Than Fiction" },
                    { 1265, null, "PG", "Jesse Aarons trained all summer to become the fastest runner in school, so he's very upset when newcomer Leslie Burke outruns him and everyone else. Despite this and other differences, including that she's rich, he's poor, and she's a city girl, he's a country boy, the two become fast friends. Together, they create Terabithia, a land of monsters, trolls, ogres, and giants and rule as king and queen.", 96, "English", "/3xFxGodKPMFLheS8rujFSmLfcq4.jpg", 7.2000000000000002, new DateTime(2007, 2, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Bridge to Terabithia" },
                    { 1278, null, "NC-17", "A young American studying in Paris in 1968 strikes up a friendship with a French brother and sister.", 112, "English", "/abdsharkteGNBA1BchSZ1DCoMtZ.jpg", 7.2999999999999998, new DateTime(2003, 9, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Dreamers" },
                    { 1280, null, "15세 이상 관람가", "A young man, whose only possession is a motorcycle, spends his time riding around the city looking for empty apartments. After finding one, he hangs out for a while, fixing himself something to eat, washing laundry or making small repairs in return. He always tries to leave before the owners get back but in one ostensibly empty mansion he meets the abused wife of a rich man and she escapes with him...", 88, "Korean", "/hr8ghKbdo3UGUROYafpN38Sohfe.jpg", 7.7999999999999998, new DateTime(2004, 10, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "3-Iron" },
                    { 1359, null, "R", "A wealthy New York investment banking executive hides his alternate psychopathic ego from his co-workers and friends as he escalates deeper into his illogical, gratuitous fantasies.", 102, "English", "/3ddHhfMlZHZCefHDeaP8FzSoH4Y.jpg", 7.2999999999999998, new DateTime(2000, 4, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), "American Psycho" },
                    { 1360, null, "R", "A biography of artist Frida Kahlo, who channeled the pain of a crippling injury and her tempestuous marriage into her work.", 123, "English", "/a4hgR6aKoohB6MHni171jbi9BkU.jpg", 7.5, new DateTime(2002, 8, 29, 0, 0, 0, 0, DateTimeKind.Unspecified), "Frida" },
                    { 1366, null, "PG", "When world heavyweight boxing champion, Apollo Creed wants to give an unknown fighter a shot at the title as a publicity stunt, his handlers choose palooka Rocky Balboa, an uneducated collector for a Philadelphia loan shark. Rocky teams up with trainer  Mickey Goldmill to make the most of this once in a lifetime break.", 120, "English", "/i5xiwdSsrecBvO7mIfAJixeEDSg.jpg", 7.7999999999999998, new DateTime(1976, 11, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), "Rocky" },
                    { 1368, null, "R", "When former Green Beret John Rambo is harassed by local law enforcement and arrested for vagrancy, the Vietnam vet snaps, runs for the hills and rat-a-tat-tats his way into the action-movie hall of fame. Hounded by a relentless sheriff, Rambo employs heavy-handed guerilla tactics to shake the cops off his tail.", 93, "English", "/fVamGe8rfEQUrMbzumL1t0DslCA.jpg", 7.4000000000000004, new DateTime(1982, 10, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), "First Blood" },
                    { 1372, null, "R", "An ex-mercenary turned smuggler. A Mende fisherman. Amid the explosive civil war overtaking 1999 Sierra Leone, these men join for two desperate missions: recovering a rare pink diamond of immense value and rescuing the fisherman's son, conscripted as a child soldier into the brutal rebel forces ripping a swath of torture and bloodshed countrywide.", 143, "English", "/m6rZ3dmqjcTvVNKtqwQ6hxYQ9nk.jpg", 7.5, new DateTime(2006, 1, 26, 0, 0, 0, 0, DateTimeKind.Unspecified), "Blood Diamond" },
                    { 1391, null, "NR", "In Mexico, two teenage boys and an attractive older woman embark on a road trip and learn a thing or two about life, friendship, sex, and each other.", 106, "Spanish", "/izw41PkE8y891yraO6fN1tCNmOG.jpg", 7.4000000000000004, new DateTime(2001, 6, 8, 0, 0, 0, 0, DateTimeKind.Unspecified), "Y Tu Mamá También" },
                    { 1394, null, "12", "A Russian poet and his interpreter travel to Italy to research the life of an 18th-century composer.", 126, "Russian", "/6WgNWQscUYva10u1YPc4HAyJzW1.jpg", 7.9000000000000004, new DateTime(1983, 5, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "Nostalgia" },
                    { 1396, null, "0+", "A dying man in his forties recalls his childhood, his mother, the war and personal moments that tell of and juxtapose pivotal moments in Soviet history with daily life.", 107, "Russian", "/9PknVc5uubhVLZ6ofvfJAprM9UZ.jpg", 8.0999999999999996, new DateTime(1975, 3, 7, 0, 0, 0, 0, DateTimeKind.Unspecified), "Mirror" },
                    { 1398, null, "NR", "Near a gray and unnamed city is the Zone, a place guarded by barbed wire and soldiers, and where the normal laws of physics are victim to frequent anomalies. A stalker guides two men into the Zone, specifically to an area in which deep-seated desires are granted.", 162, "Russian", "/lUE0Bp7wH0EterJ44qMRsqtKFnp.jpg", 8.3000000000000007, new DateTime(1979, 5, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "Stalker" },
                    { 1402, null, "PG-13", "A struggling salesman takes custody of his son as he's poised to begin a life-changing professional career.", 117, "English", "/lBYOKAMcxIvuk9s9hMuecB9dPBV.jpg", 7.9000000000000004, new DateTime(2006, 12, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Pursuit of Happyness" },
                    { 1407, null, "PG-13", "From the mean streets of the Belleville district of Paris to the dazzling limelight of New York's most famous concert halls, Edith Piaf's life was a constant battle to sing and survive, to live and love. Raised in her grandmother's brothel, Piaf was discovered in 1935 by nightclub owner Louis Leplee, who persuaded her to sing despite her extreme nervousness. Piaf became one of France's immortal icons, her voice one of the indelible signatures of the 20th century.", 140, "French", "/pmKVYXBb57iQ9cKXuYF1GCWxBip.jpg", 7.5, new DateTime(2007, 2, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), "La Vie en Rose" },
                    { 1417, null, "R", "Living with her tyrannical stepfather in a new home with her pregnant mother, 10-year-old Ofelia feels alone until she explores a decaying labyrinth guarded by a mysterious faun who claims to know her destiny. If she wishes to return to her real father, Ofelia must complete three terrifying tasks.", 118, "Spanish", "/hyZ8srM2hmrtDhw1ED9Ny9r0AKW.jpg", 7.7000000000000002, new DateTime(2006, 8, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "Pan's Labyrinth" },
                    { 1422, null, "R", "To take down South Boston's Irish Mafia, the police send in one of their own to infiltrate the underworld, not realizing the syndicate has done likewise. While an undercover cop curries favor with the mob kingpin, a career criminal rises through the police ranks. But both sides soon discover there's a mole among them.", 151, "English", "/kWWAt2FMRbqLFFy8o5R4Zr8cMAb.jpg", 8.1999999999999993, new DateTime(2006, 10, 5, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Departed" },
                    { 1427, null, "R", "Jean-Baptiste Grenouille, born in the stench of 18th century Paris, develops a superior olfactory sense, which he uses to create the world's finest perfumes. However, his work takes a dark turn as he tries to preserve scents in the search for the ultimate perfume.", 147, "English", "/2wrFrUej8ri5EpjgIkjKTAnr686.jpg", 7.2999999999999998, new DateTime(2006, 9, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), "Perfume: The Story of a Murderer" },
                    { 1429, null, "R", "In New York City in the days following the events of 9/11, Monty Brogan is a convicted drug dealer about to start a seven-year prison sentence, and his final hours of freedom are devoted to hanging out with his closest buddies and trying to prepare his girlfriend for his extended absence.", 135, "English", "/8AYVa7X4kMlQkn1sC6nVyKnzikV.jpg", 7.4000000000000004, new DateTime(2002, 12, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), "25th Hour" },
                    { 1433, null, "B", "Spain, 1939. In the last days of the Spanish Civil War, the young Carlos arrives at the Santa Lucía orphanage, where he will make friends and enemies as he follows the quiet footsteps of a mysterious presence eager for revenge.", 108, "Spanish", "/es3NIsfzm3rlyjzqDV2fCoJRwTX.jpg", 7.2999999999999998, new DateTime(2001, 4, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Devil's Backbone" },
                    { 1480, null, "PG-13", "When a car bomb explodes on the American side of the U.S./Mexico border, Mexican drug enforcement agent Miguel Vargas begins his investigation, along with American police captain Hank Quinlan. When Vargas begins to suspect that Quinlan and his shady partner, Menzies, are planting evidence to frame an innocent man, his investigations into their possible corruption quickly put himself and his new bride, Susie, in jeopardy.", 111, "English", "/g8pF0oEj7i76FlTzurxMIT8rQUn.jpg", 7.7999999999999998, new DateTime(1958, 3, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Touch of Evil" },
                    { 1491, null, "PG-13", "With his eye on a lovely aristocrat, a gifted illusionist named Eisenheim uses his powers to win her away from her betrothed, a crown prince. But Eisenheim's scheme creates tumult within the monarchy and ignites the suspicion of a dogged inspector.", 110, "English", "/wlRNgr1AsodUmpUTl3eFz2Hfl20.jpg", 7.2999999999999998, new DateTime(2006, 8, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Illusionist" },
                    { 1523, null, "R", "Young Scottish doctor, Nicholas Garrigan decides it's time for an adventure after he finishes his formal education, so he decides to try his luck in Uganda, and arrives during the downfall of President Obote. General Idi Amin comes to power and asks Garrigan to become his personal doctor.", 123, "English", "/quckyadj0bYCzIXMDIi4lrwJfth.jpg", 7.4000000000000004, new DateTime(2006, 1, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Last King of Scotland" },
                    { 1541, null, "R", "Whilst on a short weekend getaway, Louise shoots a man who had tried to rape Thelma. Due to the incriminating circumstances, they make a run for it and thus a cross country chase ensues for the two fugitives. Along the way, both women rediscover the strength of their friendship and surprising aspects of their personalities and self-strengths in the trying times.", 130, "English", "/xN0HD9hX5OohZcq0YPwy5HXlwsq.jpg", 7.5, new DateTime(1991, 5, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), "Thelma & Louise" },
                    { 1542, null, "R", "Three office workers strike back at their evil employers by hatching a hapless attempt to embezzle money.", 89, "English", "/gA49wTJMIr3TUM6fEDkjeGxkYgZ.jpg", 7.4000000000000004, new DateTime(1999, 2, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), "Office Space" },
                    { 1544, null, "R", "During her wedding ceremony, Rachel notices Luce in the audience and feels instantly drawn to her. The two women become close friends, and when Rachel learns that Luce is a lesbian, she realizes that despite her happy marriage to Heck, she is falling for Luce. As she questions her sexual orientation, Rachel must decide between her stable relationship with Heck and her exhilarating new romance with Luce.", 93, "English", "/a7CbxY3TMwFKX6awlBxhb7Es6tS.jpg", 7.5, new DateTime(2005, 2, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "Imagine Me & You" },
                    { 1554, null, "R", "A disc jockey, a pimp and an Italian tourist escape from jail in New Orleans.", 106, "English", "/4IyxoUQ7BB5kcSd7gASe2dTyWu7.jpg", 7.4000000000000004, new DateTime(1986, 9, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), "Down by Law" },
                    { 1567, null, "16", "The Butcher has done some time in jail after beating up the guy who tried to seduce his teenage mentally-handicapped daughter. Now he wants to start a new life. He leaves his daughter in an institution and moves to Lille suburbs with his mistress. She promised him a new butcher shop. She lied. The butcher decides to go back to Paris and find his daughter.", 89, "French", "/4kMB2AAcDQ5diRuh7NTxuS90bx7.jpg", 7.5999999999999996, new DateTime(1998, 5, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), "I Stand Alone" },
                    { 1578, null, "R", "The life of boxer Jake LaMotta, whose violence and temper that led him to the top in the ring destroyed his life outside of it.", 129, "English", "/rEviyDWNbAFmvvCPlkMRPAGUElG.jpg", 8.0, new DateTime(1980, 11, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), "Raging Bull" },
                    { 1579, null, "R", "Set in the Mayan civilization, when a man's idyllic presence is brutally disrupted by a violent invading force, he is taken on a perilous journey to a world ruled by fear and oppression where a harrowing end awaits him. Through a twist of fate and spurred by the power of his love for his woman and his family he will make a desperate break to return home and to ultimately save his way of life.", 139, "English", "/cBFQsU1LDBEOl0Ik0cygeB6wCLE.jpg", 7.5, new DateTime(2006, 12, 7, 0, 0, 0, 0, DateTimeKind.Unspecified), "Apocalypto" },
                    { 1580, null, "PG", "Two men attempt to prove they committed the perfect crime by hosting a dinner party after strangling their former classmate to death.", 81, "English", "/tJlmMbaleBT8IwuidgI0ZvlLbWA.jpg", 8.0, new DateTime(1948, 3, 11, 0, 0, 0, 0, DateTimeKind.Unspecified), "Rope" },
                    { 1585, null, "PG", "A holiday favourite for generations...  George Bailey has spent his entire life giving to the people of Bedford Falls.  All that prevents rich skinflint Mr. Potter from taking over the entire town is George's modest building and loan company.  But on Christmas Eve the business's $8,000 is lost and George's troubles begin.", 130, "English", "/bSqt9rhDZx1Q7UZ86dBPKdNomp2.jpg", 8.3000000000000007, new DateTime(1946, 12, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), "It's a Wonderful Life" },
                    { 1587, null, "PG-13", "Gilbert Grape is a small-town young man with a lot of responsibility. Chief among his concerns are his mother, who is so overweight that she can't leave the house, and his mentally impaired younger brother, Arnie, who has a knack for finding trouble. Settled into a job at a grocery store and an ongoing affair with local woman Betty Carver, Gilbert finally has his life shaken up by the free-spirited Becky.", 118, "English", "/8FxWgsfDNosewo7H65oE4QkOb7g.jpg", 7.7000000000000002, new DateTime(1993, 12, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), "What's Eating Gilbert Grape" },
                    { 1592, null, "R", "An arrogant, high-powered attorney takes on the case of a poor altar boy found running away from the scene of the grisly murder of the bishop who has taken him in. The case gets a lot more complex when the accused reveals that there may or may not have been a third person in the room. The intensity builds when a surprise twist alters everyone's perception of the crime.", 129, "English", "/qJf2TzE8nRTFbFMPJNW6c8mI0KU.jpg", 7.7000000000000002, new DateTime(1996, 3, 6, 0, 0, 0, 0, DateTimeKind.Unspecified), "Primal Fear" },
                    { 1594, null, "PG", "A Shot in the Dark is the second and more successful film from the Pink Panther film series where both animated and real life sequences are mixed. A cult classic from Blake Edwards based on the play L’Idiot by Marcel Achard and Harry Kurnitz.", 102, "English", "/pR6tNqNLYIbRRYC5TFKWVWaVvvK.jpg", 7.4000000000000004, new DateTime(1964, 6, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), "A Shot in the Dark" },
                    { 1598, null, "R", "Sam Bowden is a small-town corporate attorney. Max Cady is a tattooed, cigar-smoking, bible-quoting, psychotic rapist. What do they have in common? Fourteen years ago, Sam was a public defender assigned to Max Cady's rape trial, and he made a serious error: he hid a document from his illiterate client that could have gotten him acquitted. Now, the cagey, bibliophile Cady has been released, and he intends to teach Sam Bowden and his family a thing or two about loss.", 128, "English", "/meJZAAuVcjic2ipvbOPz5UlE4P9.jpg", 7.2999999999999998, new DateTime(1991, 11, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Cape Fear" },
                    { 1600, null, "R", "Véronique is a beautiful young French woman who aspires to be a renowned singer; Weronika lives in Poland, has a similar career goal and looks identical to Véronique, though the two are not related. The film follows both women as they contend with the ups and downs of their individual lives, with Véronique embarking on an unusual romance with Alexandre Fabbri, a puppeteer who may be able to help her with her existential issues.", 98, "French", "/oqRyO9xrNBRaxqF9pCHHgLuaATx.jpg", 7.5999999999999996, new DateTime(1991, 5, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Double Life of Véronique" },
                    { 1607, null, "R", "Set in the Bronx during the tumultuous 1960s, an adolescent boy is torn between his honest, working-class father and a violent yet charismatic crime boss. Complicating matters is the youngster's growing attraction - forbidden in his neighborhood - for a beautiful black girl.", 121, "English", "/sDbO6LmLYtyqAoFTPpRcMgPSCEO.jpg", 7.7000000000000002, new DateTime(1993, 9, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), "A Bronx Tale" },
                    { 1626, null, "NR", "Twelve episodic tales in the life of a Parisian woman and her slow descent into prostitution.", 84, "French", "/lYTAYclvYIa1SR4wRwMW7OwGp86.jpg", 7.7999999999999998, new DateTime(1962, 8, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), "Vivre Sa Vie" },
                    { 1628, null, "NR", "In the carefree days before World War I, introverted Austrian author Jules strikes up a friendship with the exuberant Frenchman Jim. Both men fall for the impulsive and beautiful Catherine, but it's Jules who wins her hand. After the war, Jim visits Jules, Catherine and their daughter in their Austrian home and discovers not only that his feelings for Catherine are unchanged, but also that they're reciprocated.", 110, "French", "/92Sb34OoSxE9DuQt0OOVLvwKwjU.jpg", 7.7000000000000002, new DateTime(1962, 1, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), "Jules and Jim" }
                });

            migrationBuilder.InsertData(
                table: "Movies",
                columns: new[] { "Id", "ActorId", "Certification", "Description", "Duration", "Language", "Picture", "Ratings", "ReleaseDate", "Title" },
                values: new object[,]
                {
                    { 1632, null, "R", "Two FBI agents investigating the murder of civil rights workers during the 60s seek to breach the conspiracy of silence in a small Southern town where segregation divides black and white. The younger agent trained in FBI school runs up against the small town ways of his partner, a former sheriff.", 128, "English", "/hTv8Bkq3W1vwKi1IWCLWQW9PNU4.jpg", 7.7000000000000002, new DateTime(1988, 12, 8, 0, 0, 0, 0, DateTimeKind.Unspecified), "Mississippi Burning" },
                    { 1633, null, "PG-13", "Amidst her own personality crisis, southern housewife Evelyn Couch meets Ninny, an outgoing old woman who tells her the story of Idgie Threadgoode and Ruth Jamison, two young women who experienced hardships and love in Whistle Stop, Alabama in the 1920s.", 130, "English", "/g71l1vbJwyAAYk8zKCkIQQ58qcb.jpg", 7.7000000000000002, new DateTime(1991, 12, 27, 0, 0, 0, 0, DateTimeKind.Unspecified), "Fried Green Tomatoes" },
                    { 1640, null, "R", "In post-Sept. 11 Los Angeles, tensions erupt when the lives of a Brentwood housewife, her district attorney husband, a Persian shopkeeper, two cops, a pair of carjackers and a Korean couple converge during a 36-hour period.", 112, "English", "/86BdPC6RDX88NC880pLidKn2LCj.jpg", 7.2999999999999998, new DateTime(2005, 5, 6, 0, 0, 0, 0, DateTimeKind.Unspecified), "Crash" },
                    { 1645, null, "R", "A young lawyer defends a black man accused of murdering two white men who raped his 10-year-old daughter, sparking a rebirth of the KKK.", 149, "English", "/apUSR9WE7lMATBGYhzZ8RnPDYsK.jpg", 7.2999999999999998, new DateTime(1996, 7, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), "A Time to Kill" },
                    { 1646, null, "PG-13", "A young teacher inspires her class of at-risk students to learn tolerance, apply themselves, and pursue education beyond high school.", 123, "English", "/bffP9cAgOHsMNnc55zIXrDnz7QD.jpg", 7.9000000000000004, new DateTime(2007, 1, 5, 0, 0, 0, 0, DateTimeKind.Unspecified), "Freedom Writers" },
                    { 1653, null, "R", "Based on the journals of Che Guevara, leader of the Cuban Revolution. In his memoirs, Guevara recounts adventures he and best friend Alberto Granado had while crossing South America by motorcycle in the early 1950s.", 126, "Spanish", "/qz2aBYT8CAiJYvX4fRZpJ5G0Oz1.jpg", 7.4000000000000004, new DateTime(2004, 2, 6, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Motorcycle Diaries" },
                    { 1654, null, "15", "12 American military prisoners in World War II are ordered to infiltrate a well-guarded enemy château and kill the Nazi officers vacationing there. The soldiers, most of whom are facing death sentences for a variety of violent crimes, agree to the mission and the possible commuting of their sentences.", 150, "English", "/iFpgjfE4gt7guOLvrqgZZoO4Rjk.jpg", 7.5999999999999996, new DateTime(1967, 6, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Dirty Dozen" },
                    { 1669, null, "PG-13", "Based on Tom Clancy's bestseller, directed by John McTiernan (Die Hard) and starring Sean Connery and Alec Baldwin, The Hunt For Red October seethes with high-tech excitement and sweats with the tension of men who hold Doomsday in their hands. A new technologically-superior Soviet nuclear sub, the Red October, is heading for the U.S. coast under the command of Captain Marko Ramius (Connery). The American government thinks Ramius is planning to attack. A lone CIA analyst (Baldwin) has a different idea: he thinks Ramius is planning to defect, but he has only a few hours to find him and prove it - because the entire Russian naval and air commands are trying to find him, too. The hunt is on!", 135, "English", "/yVl7zidse4KiWtGMqHFtZCx4X3N.jpg", 7.4000000000000004, new DateTime(1990, 3, 2, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Hunt for Red October" },
                    { 1672, null, "U", "French secret agent Joss Baumont is sent to kill the president Njala of an African country. However, a counter-order is given before he can execute his mission and he is abandoned in the hands of foreign authorities. He escapes and seeks revenge by pursuing what was his original mission.", 108, "French", "/dhAZ8T0tTlTNw3D7Cn8wc87sk1w.jpg", 7.2000000000000002, new DateTime(1981, 10, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Professional" },
                    { 1675, null, "PG", "A committed film director struggles to complete his movie while coping with a myriad of crises, personal and professional, among the cast and crew.", 116, "French", "/5GqtoMYV2XxYkn1Wzg8kib8JTkj.jpg", 7.9000000000000004, new DateTime(1973, 5, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), "Day for Night" },
                    { 1677, null, "PG-13", "Born on a sharecropping plantation in Northern Florida, Ray Charles went blind at seven. Inspired by a fiercely independent mom who insisted he make his own way, He found his calling and his gift behind a piano keyboard. Touring across the Southern musical circuit, the soulful singer gained a reputation and then exploded with worldwide fame when he pioneered couping gospel and country together.", 152, "English", "/nweucNFvw8B5u8Mi0UQqUQCk8TG.jpg", 7.4000000000000004, new DateTime(2004, 10, 29, 0, 0, 0, 0, DateTimeKind.Unspecified), "Ray" },
                    { 1678, null, "16", "Japan is thrown into a panic after several ships explode and are sunk near Odo Island. An expedition to the island led by paleontologist Kyohei Yemani soon discover something more devastating than imagined in the form of a 50 meter tall monster whom the natives call Gojira. Now the monster begins a rampage that threatens to destroy not only Japan, but the rest of the world as well.", 96, "Japanese", "/fg635r7DxfmbQpnIh7vLCOsGoOG.jpg", 7.5999999999999996, new DateTime(1954, 11, 3, 0, 0, 0, 0, DateTimeKind.Unspecified), "Godzilla" },
                    { 1700, null, "R", "Novelist Paul Sheldon crashes his car on a snowy Colorado road. He is found by Annie Wilkes, the \"number one fan\" of Paul's heroine Misery Chastaine. Annie is also somewhat unstable, and Paul finds himself crippled, drugged and at her mercy.", 107, "English", "/klPO5oh1LOxiPpdDXZo1ADgpKcw.jpg", 7.7000000000000002, new DateTime(1990, 11, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Misery" },
                    { 1712, null, "NR", "Sprawling epic covering the life of a Texas cattle rancher and his family and associates.", 201, "English", "/oQ1Arue52pFLSvvwfcNTy16hTCG.jpg", 7.5999999999999996, new DateTime(1956, 11, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), "Giant" },
                    { 1716, null, "PG", "In occupied Paris, an actress married to a Jewish theater owner must keep him hidden from the Nazis while doing both of their jobs.", 131, "French", "/yJbA6jjuj9h8x2tZSgTkzpQ8PzS.jpg", 7.2999999999999998, new DateTime(1980, 9, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Last Metro" },
                    { 1725, null, "PG", "In the slums of the upper West Side of Manhattan, New York, a gang of Polish-American teenagers called the Jets compete with a rival gang of recently immigrated Puerto Ricans, the Sharks, to \"own\" the neighborhood streets. Tensions are high between the gangs but two kids, one from each rival gang, fall in love leading to tragedy.", 152, "English", "/vCtErvzF6S93DtoD7URwy9Mr7oe.jpg", 7.2999999999999998, new DateTime(1961, 12, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), "West Side Story" },
                    { 1726, null, "PG-13", "After being held captive in an Afghan cave, billionaire engineer Tony Stark creates a unique weaponized suit of armor to fight evil.", 126, "English", "/78lPtwv72eTNqFW9COBYI0dWDJa.jpg", 7.5999999999999996, new DateTime(2008, 4, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Iron Man" },
                    { 1786, null, "PG", "Au revoir les enfants tells a heartbreaking story of friendship and devastating loss concerning two boys living in Nazi-occupied France. At a provincial Catholic boarding school, the precocious youths enjoy true camaraderie—until a secret is revealed. Based on events from writer-director Malle’s own childhood, the film is a subtle, precisely observed tale of courage, cowardice, and tragic awakening.", 105, "French", "/A6qG9X7O3eTaGUPmU67g9yIPVPT.jpg", 7.5, new DateTime(1987, 10, 7, 0, 0, 0, 0, DateTimeKind.Unspecified), "Au Revoir les Enfants" },
                    { 1791, null, "R", "Erika Kohut, a sexually repressed piano teacher living with her domineering mother, meets a young man who starts romantically pursuing her.", 131, "French", "/gNHKYQnP1RnqEhkivHJzBPb4MOP.jpg", 7.2999999999999998, new DateTime(2001, 7, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Piano Teacher" },
                    { 1813, null, "R", "Aspiring Florida defense lawyer Kevin Lomax accepts a job at a New York law firm. With the stakes getting higher every case, Kevin quickly learns that his boss has something far more evil planned.", 144, "English", "/5ZzBGpxy55OQzHxKVY11IpY6a0o.jpg", 7.4000000000000004, new DateTime(1997, 10, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Devil's Advocate" },
                    { 1830, null, "R", "Yuri Orlov is a globetrotting arms dealer and, through some of the deadliest war zones, he struggles to stay one step ahead of a relentless Interpol agent, his business rivals and even some of his customers who include many of the world's most notorious dictators. Finally, he must also face his own conscience.", 122, "English", "/xEdwdFZRwrNAvTDx0fAV3MAInaA.jpg", 7.2999999999999998, new DateTime(2005, 9, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), "Lord of War" },
                    { 1847, null, "R", "Detective Philip Marlowe tries to help a friend who is accused of murdering his wife.", 112, "English", "/oBhUK54yBJ0aH6u9zCzSV5iV7OP.jpg", 7.5, new DateTime(1973, 3, 7, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Long Goodbye" },
                    { 1850, null, "R", "The story of the life and career of eccentric avant-garde comedian, Andy Kaufman.", 118, "English", "/msOZS07xRIFnapwp3fprGbKEAfT.jpg", 7.2999999999999998, new DateTime(1999, 12, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), "Man on the Moon" },
                    { 1859, null, "NR", "A stern Russian woman sent to Paris on official business finds herself attracted to a man who represents everything she is supposed to detest.", 110, "English", "/pmrUI5x8JouxVQNAPebfIOr3SMj.jpg", 7.5999999999999996, new DateTime(1939, 11, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), "Ninotchka" },
                    { 1878, null, "R", "Raoul Duke and his attorney Dr. Gonzo drive a red convertible across the Mojave desert to Las Vegas with a suitcase full of drugs to cover a motorcycle race. As their consumption of drugs increases at an alarming rate, the stoned duo trash their hotel room and fear legal repercussions. Duke begins to drive back to L.A., but after an odd run-in with a cop, he returns to Sin City and continues his wild drug binge.", 118, "English", "/jwUnGcLBzKNEIzgUUVWAUSwuuBt.jpg", 7.2000000000000002, new DateTime(1998, 5, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), "Fear and Loathing in Las Vegas" },
                    { 1879, null, "NR", "Matt and Christina Drayton are a couple whose attitudes are challenged when their daughter brings home a fiancé who is black.", 108, "English", "/mrRVl6ck9v23SjmdblwP8GajVS.jpg", 7.5999999999999996, new DateTime(1967, 12, 11, 0, 0, 0, 0, DateTimeKind.Unspecified), "Guess Who's Coming to Dinner" },
                    { 1883, null, "PG-13", "A tribute to the controversial black activist and leader of the struggle for black liberation. He hit bottom during his imprisonment in the '50s, he became a Black Muslim and then a leader in the Nation of Islam. His assassination in 1965 left a legacy of self-determination and racial pride.", 202, "English", "/e9Pid0ZVhU3VrsQCxKdxQjSzKoY.jpg", 7.5, new DateTime(1992, 11, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), "Malcolm X" },
                    { 1891, null, "PG", "The epic saga continues as Luke Skywalker, in hopes of defeating the evil Galactic Empire, learns the ways of the Jedi from aging master Yoda. But Darth Vader is more determined than ever to capture Luke. Meanwhile, rebel leader Princess Leia, cocky Han Solo, Chewbacca, and droids C-3PO and R2-D2 are thrown into various stages of capture, betrayal and despair.", 124, "English", "/7BuH8itoSrLExs2YZSsM01Qk2no.jpg", 8.4000000000000004, new DateTime(1980, 5, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Empire Strikes Back" },
                    { 1892, null, "PG", "Luke Skywalker leads a mission to rescue his friend Han Solo from the clutches of Jabba the Hutt, while the Emperor seeks to destroy the Rebellion once and for all with a second dreaded Death Star.", 135, "English", "/mDCBQNhR6R0PVFucJl0O4Hp5klZ.jpg", 7.9000000000000004, new DateTime(1983, 5, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "Return of the Jedi" },
                    { 1895, null, "PG-13", "The evil Darth Sidious enacts his final plan for unlimited power -- and the heroic Jedi Anakin Skywalker must choose a side.", 140, "English", "/xfSAoBEm9MNBjmlNcDYLvLSMlnq.jpg", 7.2999999999999998, new DateTime(2005, 5, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), "Star Wars: Episode III - Revenge of the Sith" },
                    { 1902, null, "R", "A very handsome man finds the love of his life, but he suffers an accident and needs to have his face rebuilt by surgery after it is severely disfigured.", 117, "Spanish", "/orjSy9xEGI9jxrtodACH04gANmF.jpg", 7.5, new DateTime(1997, 12, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), "Open Your Eyes" },
                    { 1904, null, "PG-13", "A sweeping romantic epic set in Japan in the years before World War II, a penniless Japanese child is torn from her family to work as a maid in a geisha house.", 146, "English", "/pBwYsQaSTgnPphIy02DJjCF2cqs.jpg", 7.7000000000000002, new DateTime(2005, 12, 6, 0, 0, 0, 0, DateTimeKind.Unspecified), "Memoirs of a Geisha" },
                    { 1908, null, "12", "This gripping adaptation of the Jerome Lawrence-Robert E. Lee play examines an issue that still causes great controversy—the role religion should play in the schools.", 128, "English", "/7oaHcF0gCOt2lKaT2zajhajP0Zo.jpg", 7.7999999999999998, new DateTime(1960, 6, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), "Inherit the Wind" },
                    { 1913, null, "PG-13", "The Sea Inside is about Spaniard Ramón Sampedro, who fought a 30-year campaign to win the right to end his life with dignity. It is the story of Ramón’s relationships with two women: Julia a lawyer who supports his cause, and Rosa, a local woman who wants to convince him that life is worth living.", 125, "Spanish", "/mQW1JJKCUg02cmWBzr9JFu9vM1V.jpg", 7.5999999999999996, new DateTime(2004, 9, 3, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Sea Inside" },
                    { 1923, null, "R", "In the questionable town of Deer Meadow, Washington, FBI Agent Desmond inexplicably disappears while hunting for the man who murdered a teen girl. The killer is never apprehended, and, after experiencing dark visions and supernatural encounters, Agent Dale Cooper chillingly predicts that the culprit will claim another life. Meanwhile, in the more cozy town of Twin Peaks, hedonistic beauty Laura Palmer hangs with lowlifes and seems destined for a grisly fate.", 135, "English", "/mxsGXqetGnirf99qapYd5MMY1VL.jpg", 7.2999999999999998, new DateTime(1992, 6, 3, 0, 0, 0, 0, DateTimeKind.Unspecified), "Twin Peaks: Fire Walk with Me" },
                    { 1933, null, "PG-13", "Grace is a religious woman who lives in an old house kept dark because her two children, Anne and Nicholas, have a rare sensitivity to light. When the family begins to suspect the house is haunted, Grace fights to protect her children at any cost in the face of strange events and disturbing visions.", 101, "English", "/p8g1vlTvpM6nr2hMMiZ1fUlKF0D.jpg", 7.5999999999999996, new DateTime(2001, 8, 2, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Others" },
                    { 1939, null, "NR", "A police detective falls in love with the woman whose murder he's investigating.", 88, "English", "/utpUn9TdBIx6x2QX91YhYzFZxg1.jpg", 7.7000000000000002, new DateTime(1944, 10, 11, 0, 0, 0, 0, DateTimeKind.Unspecified), "Laura" },
                    { 1949, null, "R", "The true story of the investigation of the \"Zodiac Killer\", a serial killer who terrified the San Francisco Bay Area, taunting police with his ciphers and letters. The case becomes an obsession for three men as their lives and careers are built and destroyed by the endless trail of clues.", 157, "English", "/dr8RlckQZPbuyUToMGZlINRAsMR.jpg", 7.5, new DateTime(2007, 3, 2, 0, 0, 0, 0, DateTimeKind.Unspecified), "Zodiac" },
                    { 1954, null, "R", "A young man struggles to access sublimated childhood memories. He finds a technique that allows him to travel back into the past, to occupy his childhood body and change history. However, he soon finds that every change he makes has unexpected consequences.", 113, "English", "/jY0hIz8eolynHqWN8vrTo0cypBI.jpg", 7.5, new DateTime(2004, 1, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Butterfly Effect" },
                    { 1955, null, "PG", "A Victorian surgeon rescues a heavily disfigured man being mistreated by his \"owner\" as a side-show freak. Behind his monstrous façade, there is revealed a person of great intelligence and sensitivity. Based on the true story of Joseph Merrick (called John Merrick in the film), a severely deformed man in 19th century London.", 124, "English", "/rk2lKgEtjF9HO9N2UFMRc2cMGdj.jpg", 8.0999999999999996, new DateTime(1980, 10, 2, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Elephant Man" },
                    { 2000, null, "12", "A few decades after the destruction of the Inca Empire, a Spanish expedition led by the infamous Aguirre leaves the mountains of Peru and goes down the Amazon River in search of the lost city of El Dorado. When great difficulties arise, Aguirre’s men start to wonder whether their quest will lead them to prosperity or certain death.", 93, "German", "/6MNqmGe0JjEuGX1PMjRBAEI6aXg.jpg", 7.5999999999999996, new DateTime(1972, 12, 29, 0, 0, 0, 0, DateTimeKind.Unspecified), "Aguirre, the Wrath of God" },
                    { 2009, null, "U", "Two college roommates have 24 hours to make the ultimate choice as they finalize arrangements for a black market abortion.", 114, "Romanian", "/pcpPPNipfPhczHO8hlRUSayvoFh.jpg", 7.5, new DateTime(2007, 8, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), "4 Months, 3 Weeks and 2 Days" }
                });

            migrationBuilder.InsertData(
                table: "Movies",
                columns: new[] { "Id", "ActorId", "Certification", "Description", "Duration", "Language", "Picture", "Ratings", "ReleaseDate", "Title" },
                values: new object[,]
                {
                    { 2011, null, "U", "In 1970s Iran, Marjane 'Marji' Statrapi watches events through her young eyes and her idealistic family of a long dream being fulfilled of the hated Shah's defeat in the Iranian Revolution of 1979. However as Marji grows up, she witnesses first hand how the new Iran, now ruled by Islamic fundamentalists, has become a repressive tyranny on its own.", 95, "French", "/6hG18PnomOoQ4m6pgCvofVOXaV0.jpg", 7.9000000000000004, new DateTime(2007, 6, 27, 0, 0, 0, 0, DateTimeKind.Unspecified), "Persepolis" },
                    { 2013, null, "PG-13", "The true story of Elle France editor Jean-Dominique Bauby, who, in 1995 at the age of 43, suffered a stroke that paralyzed his entire body, except his left eye. Using that eye to blink out his memoir, Bauby eloquently described the aspects of his interior world, from the psychological torment of being trapped inside his body to his imagined stories from lands he'd only visited in his mind.", 112, "French", "/3MJUo4bCPai5r9zrw7nTS8sVzQ7.jpg", 7.5999999999999996, new DateTime(2007, 5, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Diving Bell and the Butterfly" },
                    { 2034, null, "R", "On his first day on the job as a narcotics officer, a rookie cop works with a rogue detective who isn't what he appears.", 122, "English", "/sEQansIwI6SfNSpop3N0EBZayWk.jpg", 7.4000000000000004, new DateTime(2001, 10, 5, 0, 0, 0, 0, DateTimeKind.Unspecified), "Training Day" },
                    { 2056, null, "R", "When his only friend dies, a man born with dwarfism moves to rural New Jersey to live a life of solitude, only to meet a chatty hot dog vendor and a woman dealing with her own personal loss.", 88, "English", "/kjJg6eJa9I9flfHaJG67ecEv8YX.jpg", 7.4000000000000004, new DateTime(2003, 1, 26, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Station Agent" },
                    { 2062, null, "G", "Remy, a resident of Paris, appreciates good food and has quite a sophisticated palate. He would love to become a chef so he can create and enjoy culinary masterpieces to his heart's delight. The only problem is, Remy is a rat. When he winds up in the sewer beneath one of Paris' finest restaurants, the rodent gourmet finds himself ideally placed to realize his dream.", 111, "English", "/npHNjldbeTHdKKw28bJKs7lzqzj.jpg", 7.7000000000000002, new DateTime(2007, 6, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), "Ratatouille" },
                    { 2108, null, "R", "Five high school students from different walks of life endure a Saturday detention under a power-hungry principal. The disparate group includes rebel John, princess Claire, outcast Allison, brainy Brian and Andrew, the jock. Each has a chance to tell his or her story, making the others see them a little differently -- and when the day ends, they question whether school will ever be the same.", 98, "English", "/c0bdxKVRevkw50LOnk6B8d3e4s.jpg", 7.7999999999999998, new DateTime(1985, 2, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Breakfast Club" },
                    { 2118, null, "R", "Three detectives in the corrupt and brutal L.A. police force of the 1950s use differing methods to uncover a conspiracy behind the shotgun slayings of the patrons at an all-night diner.", 138, "English", "/Rzope4Pk93Rg1Q2Ae8H0FYwa7n.jpg", 7.7999999999999998, new DateTime(1997, 9, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), "L.A. Confidential" },
                    { 2134, null, "G", "A Victorian Englishman travels to the far future and finds that humanity has divided into two hostile species.", 103, "English", "/x3BOzx2rUc5c3gG9UCelzSxv8n4.jpg", 7.4000000000000004, new DateTime(1960, 5, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Time Machine" },
                    { 2252, null, "R", "A Russian teenager, living in London, dies during childbirth but leaves clues to a midwife in her journal, that could tie her child to a rape involving a violent Russian mob family.", 100, "English", "/dpiJWb4NrWgcOg2rusuLhDM0hTm.jpg", 7.4000000000000004, new DateTime(2007, 9, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), "Eastern Promises" },
                    { 2270, null, "PG-13", "In a countryside town bordering on a magical land, a young man makes a promise to his beloved that he'll retrieve a fallen star by venturing into the magical realm. His journey takes him into a world beyond his wildest dreams and reveals his true identity.", 127, "English", "/AsCrevARwF6eCrF2v8zpLdn0gth.jpg", 7.2000000000000002, new DateTime(2007, 8, 9, 0, 0, 0, 0, DateTimeKind.Unspecified), "Stardust" },
                    { 2277, null, "PG", "Richard Martin buys a gift, a new NDR-114 robot. The product is named Andrew by the youngest of the family's children. \"Bicentennial Man\" follows the life and times of Andrew, a robot purchased as a household appliance programmed to perform menial tasks. As Andrew begins to experience emotions and creative thought, the Martin family soon discovers they don't have an ordinary robot.", 131, "English", "/wrs23eO0VEWwOQpXoOasMnlW9Y4.jpg", 7.2000000000000002, new DateTime(1999, 12, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), "Bicentennial Man" },
                    { 2291, null, "R", "After returning home from the Vietnam War, veteran Jacob Singer struggles to maintain his sanity. Plagued by hallucinations and flashbacks, Singer rapidly falls apart as the world and people around him morph and twist into disturbing images. His girlfriend, Jezzie, and ex-wife, Sarah, try to help, but to little avail. Even Singer's chiropractor friend, Louis, fails to reach him as he descends into madness.", 113, "English", "/wTHHuGAlSRNStTHEeObYT82qRsN.jpg", 7.4000000000000004, new DateTime(1990, 11, 2, 0, 0, 0, 0, DateTimeKind.Unspecified), "Jacob's Ladder" },
                    { 2292, null, "R", "Convenience and video store clerks Dante and Randal are sharp-witted, potty-mouthed and bored out of their minds. So in between needling customers, the counter jockeys play hockey on the roof, visit a funeral home and deal with their love lives.", 92, "English", "/eIDNdsO3ao2r5rpSZIEp5pW1xOI.jpg", 7.4000000000000004, new DateTime(1994, 9, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), "Clerks" },
                    { 2433, null, "G", "Delphine and Solange are two sisters living in Rochefort. Delphine is a dancing teacher and Solange composes and teaches the piano. Maxence is a poet and a painter. He is doing his military service. Simon owns a music shop, he left Paris once month ago to come back where he fell in love 10 years ago. They are looking for love, looking for each other, without being aware that their ideal partner is very close...", 126, "French", "/jtxhyGaYhurH6KsjvP1jV3dDypz.jpg", 7.7000000000000002, new DateTime(1967, 3, 8, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Young Girls of Rochefort" },
                    { 2440, null, "15", "In the DMZ separating North and South Korea, two North Korean soldiers have been killed, supposedly by one South Korean soldier. But the 11 bullets found in the bodies, together with the 5 remaining bullets in the assassin's magazine clip, amount to 16 bullets for a gun that should normally hold 15 bullets. The investigating Swiss/Swedish team from the neutral countries overseeing the DMZ suspects that another, unknown party was involved - all of which points to some sort of cover up. The truth is much simpler and much more tragic.", 110, "Korean", "/ftss3ZUM12G87RKyQuoEHZYwQeY.jpg", 7.7999999999999998, new DateTime(2000, 9, 9, 0, 0, 0, 0, DateTimeKind.Unspecified), "Joint Security Area" },
                    { 2457, null, "U", "Filmed during the German occupation, this French milestone centers around the theatrical life of a beautiful courtesan and the four men who love her. Voted the “Best French Film in History” by the French Film Academy in 1990.", 191, "French", "/yiy9stl1jjVhW44ypkWMFDT8Ix3.jpg", 8.1999999999999993, new DateTime(1945, 3, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Children of Paradise" },
                    { 2487, null, "16", "Yuki's family is nearly wiped out before she is born due to the machinations of a band of criminals. These criminals kidnap and brutalize her mother but leave her alive. Later her mother ends up in prison with only revenge to keep her alive. She creates an instrument for this revenge by purposefully getting pregnant. Yuki never knows the love of a family but only killing and revenge.", 97, "Japanese", "/zE2wCBCzeg7sKJM4KFUdTgVpdBP.jpg", 7.5999999999999996, new DateTime(1973, 12, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "Lady Snowblood" },
                    { 2493, null, "PG", "In this enchantingly cracked fairy tale, the beautiful Princess Buttercup and the dashing Westley must overcome staggering odds to find happiness amid six-fingered swordsmen, murderous princes, Sicilians and rodents of unusual size. But even death can't stop these true lovebirds from triumphing.", 99, "English", "/whF3YddFYSwJNuHEvi5lpsnty2l.jpg", 7.5999999999999996, new DateTime(1987, 9, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Princess Bride" },
                    { 2501, null, "PG-13", "Wounded to the brink of death and suffering from amnesia, Jason Bourne is rescued at sea by a fisherman. With nothing to go on but a Swiss bank account number, he starts to reconstruct his life, but finds that many people he encounters want him dead. However, Bourne realizes that he has the combat and mental skills of a world-class spy—but who does he work for?", 119, "English", "/vN6jGCuzefysLVFrzK3Vs6xAdu1.jpg", 7.4000000000000004, new DateTime(2002, 6, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Bourne Identity" },
                    { 2502, null, "PG-13", "When a CIA operation to purchase classified Russian documents is blown by a rival agent, who then shows up in the sleepy seaside village where Bourne and Marie have been living. The pair run for their lives and Bourne, who promised retaliation should anyone from his former life attempt contact, is forced to once again take up his life as a trained assassin to survive.", 108, "English", "/7IYGiDrquvX3q7e9PV6Pejs6b2g.jpg", 7.2999999999999998, new DateTime(2004, 7, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Bourne Supremacy" },
                    { 2503, null, "PG-13", "Bourne is brought out of hiding once again by reporter Simon Ross who is trying to unveil Operation Blackbriar, an upgrade to Project Treadstone, in a series of newspaper columns. Information from the reporter stirs a new set of memories, and Bourne must finally uncover his dark past while dodging The Company's best efforts to eradicate him.", 115, "English", "/d4DuphCHCjVUyffExnK5nLbn39K.jpg", 7.4000000000000004, new DateTime(2007, 8, 3, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Bourne Ultimatum" },
                    { 2517, null, "12", "In a small Tokyo apartment, twelve-year-old Akira must care for his younger siblings after their mother leaves them and shows no sign of returning.", 141, "Japanese", "/deR9dplFVFCfMP0YxLMPDKV9sp.jpg", 8.0, new DateTime(2004, 8, 7, 0, 0, 0, 0, DateTimeKind.Unspecified), "Nobody Knows" },
                    { 2576, null, "NR", "The true, harrowing story of a young Jewish girl who, with her family and their friends, is forced into hiding in an attic in Nazi-occupied Amsterdam.", 180, "English", "/9oBQj09CuLQmxMeQugXk35TNAYg.jpg", 7.2000000000000002, new DateTime(1959, 3, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Diary of Anne Frank" },
                    { 2609, null, "R", "An irritable marketing executive, Neal Page, is heading home to Chicago for Thanksgiving when a number of delays force him to travel with a well meaning but overbearing shower ring curtain salesman, Del Griffith.", 93, "English", "/3RSucVsX96Ste8WDJfZP1hbNGqQ.jpg", 7.2000000000000002, new DateTime(1987, 11, 26, 0, 0, 0, 0, DateTimeKind.Unspecified), "Planes, Trains and Automobiles" },
                    { 2639, null, "R", "This film tells the story of a successful writer called Harry Block, played by Allen himself, who draws inspiration from people he knows in real-life, and from events that happened to him, sometimes causing these people to become alienated from him as a result.", 96, "English", "/2ZkTBt5wunAIIEx6UFtxxLdzkKM.jpg", 7.4000000000000004, new DateTime(1997, 12, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), "Deconstructing Harry" },
                    { 2640, null, "R", "A girl who halfheartedly tries to be part of the \"in crowd\" of her school meets a rebel who teaches her a more devious way to play social politics: by killing the popular kids.", 103, "English", "/rtzcrwgsuESV2adSDhIuLyQoZmp.jpg", 7.4000000000000004, new DateTime(1989, 3, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Heathers" },
                    { 2649, null, "R", "In honor of his birthday, San Francisco banker Nicholas Van Orton, a financial genius and a cold-hearted loner, receives an unusual present from his younger brother, Conrad: a gift certificate to play a unique kind of game. In nary a nanosecond, Nicholas finds himself consumed by a dangerous set of ever-changing rules, unable to distinguish where the charade ends and reality begins.", 129, "English", "/4UOa079915QjiTA2u5hT2yKVgUu.jpg", 7.5999999999999996, new DateTime(1997, 9, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Game" },
                    { 2654, null, "R", "An insurance investigator begins discovering that the impact a horror writer's books have on his fans is more than inspirational.", 95, "English", "/yzX7IHfnET3rQQakQ1yKvD9ltXA.jpg", 7.2999999999999998, new DateTime(1995, 2, 3, 0, 0, 0, 0, DateTimeKind.Unspecified), "In the Mouth of Madness" },
                    { 2657, null, "PG-13", "Geeky teenager David and his popular twin sister, Jennifer, get sucked into the black-and-white world of a 1950s TV sitcom called \"Pleasantville,\" and find a world where everything is peachy keen all the time. But when Jennifer's modern attitude disrupts Pleasantville's peaceful but boring routine, she literally brings color into its life.", 124, "English", "/m1hhYP6OScjKU5Z9iZaWirSn4I6.jpg", 7.2000000000000002, new DateTime(1998, 9, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), "Pleasantville" },
                    { 2666, null, "R", "A man struggles with memories of his past, including a wife he cannot remember, in a nightmarish world with no sun and run by beings with telekinetic powers who seek the souls of humans.", 100, "English", "/AdBe2ow8hdlT2aLBYuUjs0Xkqkw.jpg", 7.2999999999999998, new DateTime(1998, 2, 27, 0, 0, 0, 0, DateTimeKind.Unspecified), "Dark City" },
                    { 2690, null, "12", "A Parisian policeman gives up everything for the love of a free-living sex worker.", 135, "English", "/3aYvC1ySkxR0FfRRHS6LaeK7JxS.jpg", 7.5, new DateTime(1963, 6, 5, 0, 0, 0, 0, DateTimeKind.Unspecified), "Irma la Douce" },
                    { 2721, null, "U", "Repression is the rule of the day in this film that skewers Greek governance of the 1960s. Z, a leftist rabble rouser, is killed in what appears to be a traffic accident. But given the political climate, the death of such a prominent activist raises troubling questions. Though it's too late to save Z's life, a postmortem examination suggests that the ruling party was behind his death. As the facts leak out, those who tell the truth pay the price for their honesty.", 127, "French", "/sHPwsRJvKUYrHAnXO0oFkPtnFjI.jpg", 7.9000000000000004, new DateTime(1969, 2, 26, 0, 0, 0, 0, DateTimeKind.Unspecified), "Z" },
                    { 2756, null, "PG-13", "A civilian oil rig crew is recruited to conduct a search and rescue effort when a nuclear submarine mysteriously sinks. One diver soon finds himself on a spectacular odyssey 25,000 feet below the ocean's surface where he confronts a mysterious force that has the power to change the world or destroy it.", 139, "English", "/jel2BuDv7Bq4fuv2pUrTfiBm69o.jpg", 7.2999999999999998, new DateTime(1989, 8, 9, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Abyss" },
                    { 2757, null, "R", "A love-lorn script writer grows increasingly desperate in his quest to adapt the book 'The Orchid Thief'.", 115, "English", "/ffEmHQAiD0m5dEQ6rlsuA9vlllW.jpg", 7.4000000000000004, new DateTime(2002, 12, 6, 0, 0, 0, 0, DateTimeKind.Unspecified), "Adaptation." },
                    { 2759, null, "R", "Two drag queens and a transgender woman contract to perform a drag show at a resort in Alice Springs, a town in the remote Australian desert. As they head west from Sydney aboard their lavender bus, Priscilla, the three friends come to the forefront of a comedy of errors, encountering a number of strange characters, as well as incidents of homophobia, whilst widening comfort zones and finding new horizons.", 104, "English", "/4XZGeeGUKHlzO5lnGQLdwmjmJVZ.jpg", 7.4000000000000004, new DateTime(1994, 5, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Adventures of Priscilla, Queen of the Desert" },
                    { 2771, null, "R", "An original mix of fiction and reality illuminates the life of comic book hero everyman Harvey Pekar.", 101, "English", "/27kxQEvyMJH1SM2mEa6Es0pfx6Z.jpg", 7.2000000000000002, new DateTime(2003, 8, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "American Splendor" },
                    { 2786, null, "R", "Pierrot escapes his boring society and travels from Paris to the Mediterranean Sea with Marianne, a girl chased by hit-men from Algeria. They lead an unorthodox life, always on the run.", 110, "French", "/i124H6iQB4CawrgFW9aZaZs7OBO.jpg", 7.5999999999999996, new DateTime(1965, 8, 29, 0, 0, 0, 0, DateTimeKind.Unspecified), "Pierrot le Fou" },
                    { 2798, null, "U", "This film originated as a play in Paris. The story focuses on the one-day adventures of Bertrand Barnier played with a genius of French cinema, Louis de Funes. In the same morning he learns that his daughter is pregnant, an employee stole a large amount of money from his company, his maid is about to resign in order to marry a wealthy neighbor and his body builder is interested in marrying his daughter. The seemingly complicated story-line is full of comedy or errors and some of the most hilarious mime scenes of the French cinema.", 85, "French", "/imsP4Vl1UpsLf27DPxX1atIubBB.jpg", 7.4000000000000004, new DateTime(1967, 10, 11, 0, 0, 0, 0, DateTimeKind.Unspecified), "Oscar" },
                    { 2841, null, "R", "In 1919, Mathilde was 19 years old. Two years earlier, her fiancé Manech left for the front at the Somme. Like millions of others he was \"killed on the field of battle.\" It's written in black and white on the official notice. But Mathilde refuses to believe it. If Manech had died, she would know. She hangs on to her intuition as tightly as she would onto the last thread of hope linking her to her lover. A former sergeant tells her in vain that Manech died in the no man's land of a trench named Bingo Crepescule, in the company of four other men condemned to die for self-inflicted wounds. Her path ahead is full of obstacles but Mathilde is not frightened. Anything is possible to someone who is willing to challenge fate...", 133, "French", "/t73m7lX0eFYDjlB1Gcb7r3S5Yt.jpg", 7.2999999999999998, new DateTime(2004, 10, 26, 0, 0, 0, 0, DateTimeKind.Unspecified), "A Very Long Engagement" },
                    { 2898, null, "PG-13", "New York City. Melvin Udall, a cranky, bigoted, obsessive-compulsive writer, finds his life turned upside down when neighboring gay artist Simon is hospitalized and his dog is entrusted to Melvin. In addition, Carol, the only waitress who will tolerate him, must leave work to care for her sick son, making it impossible for Melvin to eat breakfast.", 139, "English", "/e4DQl8UobpJ0DqTEmQInbWH174A.jpg", 7.4000000000000004, new DateTime(1997, 12, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), "As Good as It Gets" },
                    { 2899, null, "PG", "The Egyptian Queen Cleopatra bets against the Roman Emperor, Julius Caesar, that her people are still great, even if the times of the Pharaohs has long passed. She vows (against all logic) to build a new palace for Caesar within three months. Since all her architects are either busy otherwise or too conservative in style, this ambivalent honor falls to Edifis. He is to build the palace and be covered in gold or, if not, his fate is to be eaten by crocodiles. Edifis calls upon an old friend to help him out: The fabulous Druid Getafix from Gaul, who brews a fantastic potion that gives supernatural strength. In order to help and protect the old Druid, Asterix and Obelix accompany him on his journey to Egypt. When Julius Caesar gets wind of the project succeeding, he has the building site attacked by his troops in order to win the bet and not lose face. But just like the local pirates, he hasn't counted on Asterix and Obelix.", 108, "French", "/sDrF8Z2GaRQjYzDuusEABohmMir.jpg", 7.4000000000000004, new DateTime(2002, 1, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Asterix & Obelix: Mission Cleopatra" },
                    { 2977, null, "PG", "A biographical portrait of a pre-fame Jane Austen and her romance with a young Irishman.", 120, "English", "/w9hZkLtF3457x8t6HbeXQzrCkWD.jpg", 7.2999999999999998, new DateTime(2007, 3, 2, 0, 0, 0, 0, DateTimeKind.Unspecified), "Becoming Jane" }
                });

            migrationBuilder.InsertData(
                table: "Movies",
                columns: new[] { "Id", "ActorId", "Certification", "Description", "Duration", "Language", "Picture", "Ratings", "ReleaseDate", "Title" },
                values: new object[,]
                {
                    { 3001, null, "NR", "A woman must steal a statue from a Paris museum to help conceal her father's art forgeries.", 123, "English", "/jQuBlzvWABKIqZSin3cpPn9r7br.jpg", 7.5, new DateTime(1966, 7, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), "How to Steal a Million" },
                    { 3009, null, "12", "An unassuming office worker is arrested and stands trial, but he is never made aware of his charges.", 118, "English", "/nNgdpzaD9RbbkMfWj6eeXkMiljq.jpg", 7.5999999999999996, new DateTime(1962, 12, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Trial" },
                    { 3034, null, "PG", "A young neurosurgeon inherits the castle of his grandfather, the famous Dr. Victor von Frankenstein. In the castle he finds a funny hunchback, a pretty lab assistant and the elderly housekeeper. Young Frankenstein believes that the work of his grandfather was delusional, but when he discovers the book where the mad doctor described his reanimation experiment, he suddenly changes his mind.", 106, "English", "/tQJAWbIjvvqVKLLbIZHtwGw2HTf.jpg", 7.9000000000000004, new DateTime(1974, 12, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Young Frankenstein" },
                    { 3035, null, "NR", "Dr. Henry Frankenstein attempts to create life by assembling a creature from body parts of the deceased. Aided by his loyal misshapen assistant, Fritz, Frankenstein succeeds in animating his monster, but, confused and traumatized, it escapes into the countryside and begins to wreak havoc. Frankenstein searches for the elusive being, and eventually must confront his tormented creation.", 71, "English", "/jFpc9w3RmYeaOXMEfrtgshwVf4u.jpg", 7.5, new DateTime(1931, 11, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), "Frankenstein" },
                    { 3063, null, "NR", "Rufus T. Firefly is named president/dictator of bankrupt Freedonia and declares war on neighboring Sylvania over the love of wealthy Mrs. Teasdale.", 69, "English", "/7ZJKzr5U3MGUCHUOyrVjMT7tIQD.jpg", 7.4000000000000004, new DateTime(1933, 11, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), "Duck Soup" },
                    { 3078, null, "NR", "A renegade reporter and a crazy young heiress meet on a bus heading for New York, and end up stuck with each other when the bus leaves them behind at one of the stops.", 105, "English", "/wx4ptyx3vlPBVl5DzBA8KomcJww.jpg", 7.9000000000000004, new DateTime(1934, 2, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), "It Happened One Night" },
                    { 3082, null, "G", "The Tramp struggles to live in modern industrial society with the help of a young homeless woman.", 87, "English", "/7uoiKOEjxBBW0AgDGQWrlfGQ90w.jpg", 8.3000000000000007, new DateTime(1936, 2, 11, 0, 0, 0, 0, DateTimeKind.Unspecified), "Modern Times" },
                    { 3083, null, "NR", "Naive and idealistic Jefferson Smith, leader of the Boy Rangers, is appointed to the United States Senate by the puppet governor of his state. He soon discovers, upon going to Washington, many shortcomings of the political process as his earnest goal of a national boys' camp leads to a conflict with the state political boss.", 129, "English", "/qZfL7UDj6KtkvAAQ5sv0v8ITKyM.jpg", 8.0, new DateTime(1939, 10, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), "Mr. Smith Goes to Washington" },
                    { 3085, null, "NR", "Hildy, the journalist former wife of newspaper editor Walter Burns, visits his office to inform him that she's engaged and will be getting remarried the next day. Walter can't let that happen and frames the fiancé, Bruce Baldwin, for one thing after another, to keep him temporarily held in prison, while trying to steer Hildy into returning to her old job as his employee.", 92, "English", "/fmQLvnDEL9wlE6FzB1S84yskdkT.jpg", 7.4000000000000004, new DateTime(1940, 1, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), "His Girl Friday" },
                    { 3088, null, "e 12", "Wyatt Earp and his brothers Morgan and Virgil ride into Tombstone and leave brother James in charge of their cattle herd. On their return they find their cattle stolen and James dead. Wyatt takes on the job of town marshal, making his brothers deputies, and vows to stay in Tombstone until James' killers are found. He soon runs into the brooding, coughing, hard-drinking Doc Holliday as well as the sullen and vicious Clanton clan. Wyatt discovers the owner of a trinket stolen from James' dead body and the stage is set for the Earps' long-awaited revenge.", 97, "English", "/38wgzzG1sW9YYTU0TneSQ5k94q2.jpg", 7.5, new DateTime(1946, 10, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), "My Darling Clementine" },
                    { 3089, null, "NR", "Headstrong Thomas Dunson starts a thriving Texas cattle ranch with the help of his faithful trail hand, Groot, and his protégé, Matthew Garth, an orphan Dunson took under his wing when Matt was a boy. In need of money following the Civil War, Dunson and Matt lead a cattle drive to Missouri, where they will get a better price than locally, but the crotchety older man and his willful young partner begin to butt heads on the exhausting journey.", 133, "English", "/vcTBAss5S1Y0BOVWB35ewDLY3MX.jpg", 7.4000000000000004, new DateTime(1948, 8, 26, 0, 0, 0, 0, DateTimeKind.Unspecified), "Red River" },
                    { 3090, null, "NR", "Fred C. Dobbs and Bob Curtin, both down on their luck in Tampico, Mexico in 1925, meet up with a grizzled prospector named Howard and decide to join with him in search of gold in the wilds of central Mexico. Through enormous difficulties, they eventually succeed in finding gold, but bandits, the elements, and most especially greed threaten to turn their success into disaster.", 126, "English", "/qvExr87oqKHvNiFRK5VqDoZrS5D.jpg", 8.0, new DateTime(1948, 1, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Treasure of the Sierra Madre" },
                    { 3109, null, "G", "An American man returns to the village of his birth in Ireland, where he finds love and conflict.", 129, "English", "/9twLidKb0ZmPPyslgpvJI8Gbjyd.jpg", 7.4000000000000004, new DateTime(1952, 7, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Quiet Man" },
                    { 3110, null, "6", "A weary gunfighter attempts to settle down with a homestead family, but a smouldering settler and rancher conflict forces him to act.", 118, "English", "/fPCjyrZK1evjm2vocMpsHZ0xFOa.jpg", 7.4000000000000004, new DateTime(1953, 4, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), "Shane" },
                    { 3112, null, "NR", "In the Deep South, a serial-killing preacher hunts two young children who know the whereabouts of a stash of money.", 93, "English", "/rBka0nFWiHxabHRLr0KfIA8Yiaq.jpg", 7.9000000000000004, new DateTime(1955, 8, 26, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Night of the Hunter" },
                    { 3114, null, "NR", "As a Civil War veteran spends years searching for a young niece captured by Indians, his motivation becomes increasingly questionable.", 119, "English", "/jLBmgW0epNzJ1N9uzaVCjbyT94v.jpg", 7.7000000000000002, new DateTime(1956, 5, 7, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Searchers" },
                    { 3116, null, "R", "Joe Buck is a wide-eyed hustler from Texas hoping to score big with wealthy New York City women; he finds a companion in Enrico \"Ratso\" Rizzo, an ailing swindler with a bum leg and a quixotic fantasy of escaping to Florida.", 113, "English", "/ckklq45UxUkwgHve9xItXqXr06r.jpg", 7.5, new DateTime(1969, 5, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "Midnight Cowboy" },
                    { 3121, null, "R", "The intersecting stories of twenty-four characters—from country star to wannabe to reporter to waitress— connect to the music business in Nashville, Tennessee.", 160, "English", "/2N4cpHzRmSUMyA1ZCkRZ2g17dhi.jpg", 7.2999999999999998, new DateTime(1975, 6, 11, 0, 0, 0, 0, DateTimeKind.Unspecified), "Nashville" },
                    { 3131, null, "R", "It's 1863. America was born in the streets. Amsterdam Vallon returns to the Five Points of America to seek vengeance against the psychotic gangland kingpin, Bill the Butcher, who murdered his father years earlier. With an eager pickpocket by his side and a whole new army, Vallon fights his way to seek vengeance on the Butcher and restore peace in the area.", 167, "English", "/lemqKtcCuAano5aqrzxYiKC8kkn.jpg", 7.2999999999999998, new DateTime(2002, 12, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), "Gangs of New York" },
                    { 3133, null, "PG", "A dramatization of the Starkweather-Fugate killing spree of the 1950s, in which a teenage girl and her twenty-something boyfriend slaughtered her entire family and several others in the Dakota badlands.", 94, "English", "/z81rBzHNgiNLean2JTGHgxjJ8nq.jpg", 7.5999999999999996, new DateTime(1973, 10, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Badlands" },
                    { 3175, null, "PG", "An Irish rogue uses his cunning and wit to work his way up the social classes of 18th century England, transforming himself from the humble Redmond Barry into the noble Barry Lyndon.", 185, "English", "/3YJEv83HWWgCKezTiQ9LhdR7cFU.jpg", 8.0, new DateTime(1975, 11, 26, 0, 0, 0, 0, DateTimeKind.Unspecified), "Barry Lyndon" },
                    { 3176, null, "R", "In the future, the Japanese government captures a class of ninth-grade students and forces them to kill each other under the revolutionary \"Battle Royale\" act.", 114, "Japanese", "/gFX7NuBUeKysOB9nEzRqVpHNT32.jpg", 7.2999999999999998, new DateTime(2000, 12, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), "Battle Royale" },
                    { 3309, null, "NR", "After her unfaithful husband leaves her, Mildred Pierce proves she can become independent and successful. However winning the approval of her spoiled daughter proves a greater challenge.", 111, "English", "/1CxM5dNRG3m3woa3cEgTCJwi1yG.jpg", 7.7000000000000002, new DateTime(1945, 10, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), "Mildred Pierce" },
                    { 3529, null, "NR", "A husband and wife detective team takes on the search for a missing inventor and almost get killed for their efforts.", 91, "English", "/kVYDx3jOGS4Hbs3ykvewHmwAw9B.jpg", 7.5999999999999996, new DateTime(1934, 5, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Thin Man" },
                    { 3543, null, "12", "A surreal comedy depicting a diverse cast of characters and the changes they undergo as the German tourist Jasmin interacts with each of them at a remote truck stop in the middle of the Mojave desert.", 95, "German", "/zeEa3jVkLE8C0KjOiiKqMbhHgaL.jpg", 7.2999999999999998, new DateTime(1987, 11, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), "Bagdad Cafe" },
                    { 3558, null, "R", "Set in the changing world of the late 1960s, Susanna Kaysen's prescribed \"short rest\" from a psychiatrist she had met only once becomes a strange, unknown journey into Alice's Wonderland, where she struggles with the thin line between normal and crazy. Susanna soon realizes how hard it is to get out once she has been committed, and she ultimately has to choose between the world of people who belong inside or the difficult world of reality outside.", 127, "English", "/ssaiAUIpJ2ciOORf6jXYEze7Maf.jpg", 7.5999999999999996, new DateTime(1999, 3, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), "Girl, Interrupted" },
                    { 3580, null, "R", "Christine Collins is overjoyed when her kidnapped son is brought back home. But when Christine suspects that the boy returned to her isn't her child, the police captain has her committed to an asylum.", 141, "English", "/dsCAryPlgLlpZu80hhLTwQHRIpU.jpg", 7.5999999999999996, new DateTime(2008, 1, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Changeling" },
                    { 3763, null, "NC-17", "While her son, Kichi, is away at war, a woman and her daughter-in-law survive by killing samurai who stray into their swamp, then selling whatever valuables they find. Both are devastated when they learn that Kichi has died, but his wife soon begins an affair with a neighbor who survived the war, Hachi. The mother disapproves and, when she can't steal Hachi for herself, tries to scare her daughter-in-law with a mysterious mask from a dead samurai.", 105, "Japanese", "/3jRBxiATS9HqbbPzoxUN3uq2D9g.jpg", 7.7999999999999998, new DateTime(1964, 11, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), "Onibaba" },
                    { 3766, null, "NR", "A romantic drifter gets caught between a corrupt tycoon and his voluptuous wife.", 87, "English", "/whqdqWavNMSoeXTx1X3DauO1LG6.jpg", 7.4000000000000004, new DateTime(1947, 12, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Lady from Shanghai" },
                    { 3767, null, "NR", "A gambler discovers an old flame while in Argentina, but she's married to his new boss.", 110, "English", "/wuE3QgrdzFYBORm9nYolPDBlhrP.jpg", 7.5999999999999996, new DateTime(1946, 4, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "Gilda" },
                    { 3777, null, "12", "Returning to their lord's castle, samurai warriors Washizu and Miki are waylaid by a spirit who predicts their futures. When the first part of the spirit's prophecy comes true, Washizu's scheming wife, Asaji, presses him to speed up the rest of the spirit's prophecy by murdering his lord and usurping his place. Director Akira Kurosawa's resetting of William Shakespeare's \"Macbeth\" in feudal Japan is one of his most acclaimed films.", 108, "Japanese", "/iDmEAMZd3eYxfcK9EXVOddtEb7e.jpg", 8.0, new DateTime(1957, 1, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Throne of Blood" },
                    { 3782, null, "PG", "Kanji Watanabe is a middle-aged man who has worked in the same monotonous bureaucratic position for decades. Learning he has cancer, he starts to look for the meaning of his life.", 143, "Japanese", "/dgNTS4EQDDVfkzJI5msKuHu2Ei3.jpg", 8.4000000000000004, new DateTime(1952, 10, 9, 0, 0, 0, 0, DateTimeKind.Unspecified), "Ikiru" },
                    { 3870, null, "16", "Set in Bertolucci's ancestral region of Emilia, the film chronicles the lives of two men during the political turmoils that took place in Italy in the first half of the 20th century.", 317, "Italian", "/87ELdlKW5h5qpJfVRXITvsDqYJ.jpg", 7.9000000000000004, new DateTime(1976, 9, 3, 0, 0, 0, 0, DateTimeKind.Unspecified), "1900" },
                    { 3933, null, "PG", "Set in a 19th-century european village, this stop-motion animation feature follows the story of Victor, a young man whisked away to the underworld and wed to a mysterious corpse bride, while his real bride Victoria waits bereft in the land of the living.", 77, "English", "/isb2Qow76GpqYmsSyfdMfsYAjts.jpg", 7.4000000000000004, new DateTime(2005, 9, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), "Corpse Bride" },
                    { 4011, null, "PG", "Thanks to an untimely demise via drowning, a young couple end up as poltergeists in their New England farmhouse, where they fail to meet the challenge of scaring away the insufferable new owners, who want to make drastic changes. In desperation, the undead newlyweds turn to an expert frightmeister, but he's got a diabolical agenda of his own.", 92, "English", "/nnl6OWkyPpuMm595hmAxNW3rZFn.jpg", 7.4000000000000004, new DateTime(1988, 3, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Beetlejuice" },
                    { 4024, null, "NR", "In a strange and isolated chateau, a man becomes acquainted with a woman and insists that they have met before.", 95, "French", "/tizZ7JnXRFMvoNegu2CtM2ab9E7.jpg", 7.5999999999999996, new DateTime(1961, 5, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "Last Year at Marienbad" },
                    { 4032, null, "PG", "Vada Sultenfuss is obsessed with death. Her mother is dead, and her father runs a funeral parlor. She is also in love with her English teacher, and joins a poetry class over the summer just to impress him. Thomas J., her best friend, is \"allergic to everything\", and sticks with Vada despite her hangups. When Vada's father hires Shelly, and begins to fall for her, things take a turn to the worse...", 103, "English", "/qyJJNHteA7BUwQSey05t7qP4vRV.jpg", 7.2999999999999998, new DateTime(1991, 11, 27, 0, 0, 0, 0, DateTimeKind.Unspecified), "My Girl" },
                    { 4133, null, "R", "A boy named George Jung grows up in a struggling family in the 1950's. His mother nags at her husband as he is trying to make a living for the family. It is finally revealed that George's father cannot make a living and the family goes bankrupt. George does not want the same thing to happen to him, and his friend Tuna, in the 1960's, suggests that he deal marijuana. He is a big hit in California in the 1960's, yet he goes to jail, where he finds out about the wonders of cocaine. As a result, when released, he gets rich by bringing cocaine to America. However, he soon pays the price.", 124, "English", "/ii4sylRdQnLFPMCLhaER7vb0J6N.jpg", 7.4000000000000004, new DateTime(2001, 4, 4, 0, 0, 0, 0, DateTimeKind.Unspecified), "Blow" },
                    { 4147, null, "R", "Mike Sullivan works as a hit man for crime boss John Rooney. Sullivan views Rooney as a father figure, however after his son is witness to a killing, Mike Sullivan finds himself on the run in attempt to save the life of his son and at the same time looking for revenge on those who wronged him.", 117, "English", "/loSpBeirRfTPJ3cMIqpQArstGhh.jpg", 7.4000000000000004, new DateTime(2002, 7, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), "Road to Perdition" },
                    { 4174, null, "13", "When Dr. Anthony Edwardes arrives at a Vermont mental hospital to replace the outgoing hospital director, Dr. Constance Peterson, a psychoanalyst, discovers Edwardes is actually an impostor. The man confesses that the real Dr. Edwardes is dead and fears he may have killed him, but cannot recall anything. Dr. Peterson, however is convinced his impostor is innocent of the man's murder, and joins him on a quest to unravel his amnesia through psychoanalysis.", 111, "English", "/qzqt6aZrCMicCZbCoKa6JNv0aJq.jpg", 7.5, new DateTime(1945, 11, 8, 0, 0, 0, 0, DateTimeKind.Unspecified), "Spellbound" },
                    { 4203, null, "APTA", "Pepa resolves to kill herself with a batch of sleeping-pill-laced gazpacho after her lover leaves her. Fortunately, she is interrupted by a deliciously chaotic series of events.", 88, "Spanish", "/lOehCiqghODNrNBpI1JS76zl6Lx.jpg", 7.4000000000000004, new DateTime(1988, 3, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), "Women on the Verge of a Nervous Breakdown" },
                    { 4232, null, "R", "A killer known as Ghostface begins killing off teenagers, and as the body count begins rising, one girl and her friends find themselves contemplating the 'rules' of horror films as they find themselves living in a real-life one.", 112, "English", "/aXAByjBN8UhaYvotqRCwa5MsMGu.jpg", 7.2999999999999998, new DateTime(1996, 12, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), "Scream" }
                });

            migrationBuilder.InsertData(
                table: "Movies",
                columns: new[] { "Id", "ActorId", "Certification", "Description", "Duration", "Language", "Picture", "Ratings", "ReleaseDate", "Title" },
                values: new object[,]
                {
                    { 4254, null, "PG", "Naina, an introverted, perpetually depressed girl's life changes when she meets Aman. But Aman has a secret of his own which changes their lives forever. Embroiled in all this is Rohit, Naina's best friend who conceals his love for her.", 186, "Hindi", "/zhMI6I0kSLnewTMwE0A8Tz3Cj2f.jpg", 7.5, new DateTime(2003, 11, 27, 0, 0, 0, 0, DateTimeKind.Unspecified), "Kal Ho Naa Ho" },
                    { 4291, null, "AL", "Brash, loudmouthed and opportunistic, Kikujiro is the unlikely companion for Masao who is determined to see the mother he has never met. The two begin a series of adventures which soon turns out to be a whimsical journey of laughter and tears with a wide array of surprises and unique characters along the way.", 117, "Japanese", "/zTelT1xAO4Owxk1jHJM4puoei5N.jpg", 7.5999999999999996, new DateTime(1999, 6, 5, 0, 0, 0, 0, DateTimeKind.Unspecified), "Kikujiro" },
                    { 4347, null, "R", "As a 13-year-old, fledgling writer Briony Tallis irrevocably changes the course of several lives when she accuses her older sister's lover of a crime he did not commit.", 123, "English", "/hMRIyBjPzxaSXWM06se3OcNjIQa.jpg", 7.7000000000000002, new DateTime(2007, 9, 7, 0, 0, 0, 0, DateTimeKind.Unspecified), "Atonement" },
                    { 4348, null, "PG", "A story of love and life among the landed English gentry during the Georgian era. Mr. Bennet is a gentleman living in Hertfordshire with his overbearing wife and five daughters, but if he dies their house will be inherited by a distant cousin whom they have never met, so the family's future happiness and security is dependent on the daughters making good marriages.", 127, "English", "/sZEXhhnEKh9hjzoiIi9XgHGqtYm.jpg", 8.0999999999999996, new DateTime(2005, 9, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), "Pride & Prejudice" },
                    { 4476, null, "R", "An epic tale of three brothers and their father living in the remote wilderness of 1900s USA and how their lives are affected by nature, history, war, and love.", 133, "English", "/t1KPGlW0UGd0m515LPQmk2F4nu1.jpg", 7.4000000000000004, new DateTime(1994, 12, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), "Legends of the Fall" },
                    { 4480, null, "PG", "In a rural French village, an old man and his only remaining relative cast their covetous eyes on an adjoining vacant property. They need its spring water for growing their flowers, and are dismayed to hear that the man who has inherited it is moving in. They block up the spring and watch as their new neighbour tries to keep his crops watered from wells far afield through the hot summer. Though they see his desperate efforts are breaking his health and his wife and daughter's hearts, they think only of getting the water.", 120, "French", "/car13dBvNvVN8EgQWXYqOSFwbDq.jpg", 7.7000000000000002, new DateTime(1986, 8, 27, 0, 0, 0, 0, DateTimeKind.Unspecified), "Jean de Florette" },
                    { 4481, null, "PG", "In this, the sequel to Jean de Florette, Manon (Beart) has grown into a beautiful young shepherdess living in the idyllic Provencal countryside. She plots vengeance on the men who greedily conspired to acquire her father's land years earlier.", 113, "French", "/1qpu6Zc1PSDL3UbDNIZJ6YuhJDW.jpg", 7.5999999999999996, new DateTime(1986, 11, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), "Manon of the Spring" },
                    { 4495, null, null, "In the aftermath of the Spanish Civil War, Ana, a sensitive seven-year-old girl in a rural Spanish hamlet is traumatized after a traveling projectionist screens a print of James Whale's 1931 \"Frankenstein\" for the village. The youngster is profoundly disturbed by the scenes in which the monster murders the little girl and is later killed himself by the villagers. She questions her sister about the profundities of life and death and believes her older sibling when she tells her that the monster is not dead, but exists as a spirit inhabiting a nearby barn. When a Loyalist soldier, a fugitive from Franco's victorious army, hides out in the barn, Ana crosses from reality into a fantasy world of her own.", 97, "Spanish", "/o6pUTkoCh4r6EA2dHNFKA40OmH2.jpg", 7.7000000000000002, new DateTime(1973, 10, 8, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Spirit of the Beehive" },
                    { 4497, null, "U", "Viridiana is preparing to start her life as a nun when she is sent, somewhat unwillingly, to visit her aging uncle, Don Jaime. He supports her; but the two have met only once. Jaime thinks Viridiana resembles his dead wife. Viridiana has secretly despised this man all her life and finds her worst fears proven when Jaime grows determined to seduce his pure niece. Viridiana becomes undone as her uncle upends the plans she had made to join the convent.", 90, "Spanish", "/yFnUCrPY3ffjkqOkOupLro3sO7X.jpg", 7.7000000000000002, new DateTime(1961, 5, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), "Viridiana" },
                    { 4543, null, "R", "Life's questions are 'answered' in a series of outrageous vignettes, beginning with a staid London insurance company which transforms before our eyes into a pirate ship. Then there's the National Health doctors who try to claim a healthy liver from a still-living donor. The world's most voracious glutton brings the art of vomiting to new heights before his spectacular demise.", 107, "English", "/nSi1MYrNbhKa5pLyQcopSWDfUap.jpg", 7.2999999999999998, new DateTime(1983, 3, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Meaning of Life" },
                    { 4550, null, "R", "After a 13-year imprisonment for the kidnap and murder of a 6 year old boy, beautiful Lee Guem-ja starts seeking revenge on the man that was really responsible for the boy's death. With the help of fellow inmates and reunited with her daughter, she gets closer and closer to her goal. But will her actions lead to the relief she seeks?", 115, "Korean", "/pxgjBSwsa2IBSJoVrsLT6qxOO6N.jpg", 7.5, new DateTime(2005, 7, 29, 0, 0, 0, 0, DateTimeKind.Unspecified), "Sympathy for Lady Vengeance" },
                    { 4553, null, "R", "The Machinist is the story of Trevor Reznik, a lathe-operator who is suffering from insomnia. In a machine shop, occupational hazards are bad enough under normal circumstances; yet for Trevor the risks are compounded by fatigue. Trevor has lost the ability to sleep. This is no ordinary insomnia...", 101, "English", "/ukMORT211Xi7I8mvtg9aXgzs374.jpg", 7.5, new DateTime(2004, 2, 9, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Machinist" },
                    { 4584, null, "PG", "Rich Mr. Dashwood dies, leaving his second wife and her daughters poor by the rules of inheritance. Two daughters are the titular opposites.", 136, "English", "/cBK2yL3HqhFvIVd7lLtazWlRZPR.jpg", 7.5, new DateTime(1995, 12, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), "Sense and Sensibility" },
                    { 4593, null, "U", "In Luis Buñuel’s deliciously satiric masterpiece, an upper-class sextet sits down to dinner but never eats, their attempts continually thwarted by a vaudevillian mixture of events both actual and imagined.", 101, "French", "/zN4ILX2x64PvT2jIOAHXxCOi5WA.jpg", 7.5999999999999996, new DateTime(1972, 9, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Discreet Charm of the Bourgeoisie" },
                    { 4638, null, "R", "As a former London constable, Nicholas Angel finds it difficult to adapt to his new assignment in the sleepy British village of Sandford. Not only does he miss the excitement of the big city, but he also has a well-meaning oaf for a partner. However, when a series of grisly accidents rocks Sandford, Angel smells something rotten in the idyllic village.", 121, "English", "/zPib4ukTSdXvHP9pxGkFCe34f3y.jpg", 7.5, new DateTime(2007, 2, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), "Hot Fuzz" },
                    { 4689, null, "R", "This is the story of Ryu, a deaf man, and his sister, who requires a kidney transplant. In order to afford the transplant, Ryu and his girlfriend develop a plan to kidnap Park's daughter. Things go horribly wrong, and the situation spirals rapidly into a cycle of violence and revenge.", 129, "Korean", "/8ICeU0RLHQErvoKsPTLYh6Nluw.jpg", 7.4000000000000004, new DateTime(2002, 3, 29, 0, 0, 0, 0, DateTimeKind.Unspecified), "Sympathy for Mr. Vengeance" },
                    { 4771, null, "R", "When 4 year old Amanda McCready disappears from her home and the police make little headway in solving the case, the girl's aunt, Beatrice McCready hires two private detectives, Patrick Kenzie and Angie Gennaro. The detectives freely admit that they have little experience with this type of case, but the family wants them for two reasons - they're not cops and they know the tough neighborhood in which they all live. As the case progresses, Kenzie and Gennaro face drug dealers, gangs and pedophiles. When they are about to solve the case, they are faced with a moral dilemma that tears them apart.", 113, "English", "/uIo4a0fCUFth4yVG3QToquAxuRG.jpg", 7.2999999999999998, new DateTime(2007, 6, 6, 0, 0, 0, 0, DateTimeKind.Unspecified), "Gone Baby Gone" },
                    { 4808, null, "PG", "After Regina Lampert falls for the dashing Peter Joshua on a skiing holiday in the French Alps, she discovers upon her return to Paris that her husband has been murdered. Soon, she and Peter are giving chase to three of her late husband's World War II cronies, Tex, Scobie and Gideon, who are after a quarter of a million dollars the quartet stole while behind enemy lines. But why does Peter keep changing his name?", 113, "English", "/ijJ73UgR6nOqjSP8MO0Z7hawCdm.jpg", 7.7000000000000002, new DateTime(1963, 12, 5, 0, 0, 0, 0, DateTimeKind.Unspecified), "Charade" },
                    { 4816, null, "R", "An African-American Mafia hit man who models himself after the samurai of old finds himself targeted for death by the mob.\r Jarmusch's spiritual gangster film tells the story of an inner-city hit man (Whitaker) who lives on a rooftop, training himself as a samurai in the strictest sense. He communicates primarily by carrier pigeon, while remaining loyal to a gangster (Tormey) who once saved his life.", 116, "English", "/aw7DbBqiM41Yd5YaJ7mWMoxJCIO.jpg", 7.2999999999999998, new DateTime(1999, 6, 2, 0, 0, 0, 0, DateTimeKind.Unspecified), "Ghost Dog: The Way of the Samurai" },
                    { 4909, null, "PG", "An international assassin known as ‘The Jackal’ is employed by disgruntled French generals to kill President Charles de Gaulle, with a dedicated gendarme on the assassin’s trail.", 143, "English", "/p4z0vPrhTlYcBpB5vYyDB4pmkPT.jpg", 7.5, new DateTime(1973, 5, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Day of the Jackal" },
                    { 4922, null, "PG-13", "I was born under unusual circumstances. And so begins .The Curious Case of Benjamin Button, adapted from the 1920s story by F. Scott Fitzgerald about a man who is born in his eighties and ages backwards: a man, like any of us, who is unable to stop time. We follow his story, set in New Orleans, from the end of World War I in 1918 into the 21st century, following his journey that is as unusual as any man's life can be. Directed by David Fincher and starring Brad Pitt and Cate Blanchett with Taraji P. Henson, Tilda Swinton, Jason Flemyng, Elias Koteas and Julia Ormond, Benjamin Button, is a grand tale of a not-so-ordinary man and the people and places he discovers along the way, the loves he finds, the joys of life and the sadness of death, and what lasts beyond time.", 166, "English", "/26wEWZYt6yJkwRVkjcbwJEFh9IS.jpg", 7.5999999999999996, new DateTime(2008, 12, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Curious Case of Benjamin Button" },
                    { 4935, null, "PG", "When Sophie, a shy young woman, is cursed with an old body by a spiteful witch, her only chance of breaking the spell lies with a self-indulgent yet insecure young wizard and his companions in his legged, walking castle.", 119, "Japanese", "/TkTPELv4kC3u1lkloush8skOjE.jpg", 8.4000000000000004, new DateTime(2004, 11, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), "Howl's Moving Castle" },
                    { 4951, null, "PG-13", "On the first day at his new school, Cameron instantly falls for Bianca, the gorgeous girl of his dreams. The only problem is that Bianca is forbidden to date until her ill-tempered, completely un-dateable older sister Kat goes out, too. In an attempt to solve his problem, Cameron singles out the only guy who could possibly be a match for Kat: a mysterious bad boy with a nasty reputation of his own.", 97, "English", "/ujERk3aKABXU3NDXOAxEQYTHe9A.jpg", 7.5, new DateTime(1999, 3, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "10 Things I Hate About You" },
                    { 4960, null, "R", "A theater director struggles with his work, and the women in his life, as he attempts to create a life-size replica of New York inside a warehouse as part of his new play.", 124, "English", "/2O4DjlTESG4d3WIWxQsQuE1zbC0.jpg", 7.5999999999999996, new DateTime(2008, 10, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), "Synecdoche, New York" },
                    { 4977, null, "R", "When a machine that allows therapists to enter their patient's dreams is stolen, all hell breaks loose. Only a young female therapist can stop it: Paprika.", 90, "Japanese", "/bLUUr474Go1DfeN1HLjE3rnZXBq.jpg", 7.7999999999999998, new DateTime(2006, 10, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "Paprika" },
                    { 4982, null, "R", "Following the death of his employer and mentor, Bumpy Johnson, Frank Lucas establishes himself as the number one importer of heroin in the Harlem district of Manhattan. He does so by buying heroin directly from the source in South East Asia and he comes up with a unique way of importing the drugs into the United States. Partly based on a true story.", 157, "English", "/8sV6nWuKczuXRt0C6EWoXqJAj6G.jpg", 7.5999999999999996, new DateTime(2007, 11, 2, 0, 0, 0, 0, DateTimeKind.Unspecified), "American Gangster" },
                    { 4995, null, "R", "Set in 1977, back when sex was safe, pleasure was a business and business was booming, idealistic porn producer Jack Horner aspires to elevate his craft to an art form. Horner discovers Eddie Adams, a hot young talent working as a busboy in a nightclub, and welcomes him into the extended family of movie-makers, misfits and hangers-on that are always around. Adams' rise from nobody to a celebrity adult entertainer is meteoric, and soon the whole world seems to know his porn alter ego, \"Dirk Diggler\". Now, when disco and drugs are in vogue, fashion is in flux and the party never seems to stop, Adams' dreams of turning sex into stardom are about to collide with cold, hard reality.", 156, "English", "/wnE24UPCPQsQnbBOu4zVE2qaDNm.jpg", 7.5999999999999996, new DateTime(1997, 10, 7, 0, 0, 0, 0, DateTimeKind.Unspecified), "Boogie Nights" },
                    { 5123, null, "PG", "An orphaned musical prodigy uses his gift as a clue to finding his birth parents.", 114, "English", "/oA6ZeICPINiS6YtD5WZeBaGVmuT.jpg", 7.4000000000000004, new DateTime(2007, 11, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), "August Rush" },
                    { 5143, null, "PG-13", "Between two Thanksgivings, Hannah's husband falls in love with her sister Lee, while her hypochondriac ex-husband rekindles his relationship with her sister Holly.", 107, "English", "/gARgIRb2QFRFVrsziwWE389u1pK.jpg", 7.5999999999999996, new DateTime(1986, 2, 7, 0, 0, 0, 0, DateTimeKind.Unspecified), "Hannah and Her Sisters" },
                    { 5156, null, "NR", "A working man's livelihood is threatened when someone steals his bicycle.", 89, "Italian", "/7ZiSTZN5FWsphVmlwFVFfn5EOl.jpg", 8.3000000000000007, new DateTime(1948, 11, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), "Bicycle Thieves" },
                    { 5165, null, "NR", "Claudia and Anna join Anna's lover, Sandro, on a boat trip to a remote volcanic island. When Anna goes missing, a search is launched. In the meantime, Sandro and Claudia become involved in a romance despite Anna's disappearance, though the relationship suffers from guilt and tension.", 144, "Italian", "/c6hdG99CsskD9V0QDyS2l6gDOJa.jpg", 7.5999999999999996, new DateTime(1960, 6, 29, 0, 0, 0, 0, DateTimeKind.Unspecified), "L'Avventura" },
                    { 5503, null, "PG-13", "Wrongfully convicted of murdering his wife and sentenced to death, Richard Kimble escapes from the law in an attempt to find the real killer and clear his name.", 131, "English", "/b3rEtLKyOnF89mcK75GXDXdmOEf.jpg", 7.4000000000000004, new DateTime(1993, 8, 6, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Fugitive" },
                    { 5506, null, "NR", "Five oddball criminals planning a bank robbery rent rooms on a cul-de-sac from an octogenarian widow under the pretext that they are classical musicians.", 91, "English", "/9LJ6ZV59Q92LAJAbmb7xm9dUBGU.jpg", 7.2999999999999998, new DateTime(1955, 12, 8, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Ladykillers" },
                    { 5511, null, "16", "In a career-defining performance, Alain Delon plays Jef Costello, a contract killer with samurai instincts. After carrying out a flawlessly planned hit, Jef finds himself caught between a persistent police investigator and a ruthless employer, and not even his armor of fedora and trench coat can protect him. An elegantly stylized masterpiece of cool by maverick director Jean‑Pierre Melville, Le samouraï is a razor-sharp cocktail of 1940s American gangster cinema and 1960s French pop culture—with a liberal dose of Japanese lone-warrior mythology.", 105, "French", "/axuBeLVBeXfVZPGg6ph2taWRDFq.jpg", 7.9000000000000004, new DateTime(1967, 10, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "Le Samouraï" },
                    { 5528, null, "PG", "Set in 1940's France, a new teacher at a school for disruptive boys gives hope and inspiration.", 96, "French", "/zsWq5fa4Db7im4a3QnkoOns6782.jpg", 7.7000000000000002, new DateTime(2004, 3, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Chorus" },
                    { 5544, null, "15", "The deep conversation between a Japanese architect and a French actress forms the basis of this celebrated French film, considered one of the vanguard productions of the French New Wave. Set in Hiroshima after the end of World War II, the couple -- lovers turned friends -- recount, over many hours, previous romances and life experiences. The two intertwine their stories about the past with pondering the devastation wrought by the atomic bomb dropped on the city.", 92, "French", "/fViod4QCEDm0Yhlk15LACPdaqZk.jpg", 7.9000000000000004, new DateTime(1959, 6, 10, 0, 0, 0, 0, DateTimeKind.Unspecified), "Hiroshima Mon Amour" },
                    { 5548, null, "R", "In a violent, near-apocalyptic Detroit, evil corporation Omni Consumer Products wins a contract from the city government to privatize the police force. To test their crime-eradicating cyborgs, the company leads street cop Alex Murphy into an armed confrontation with crime lord Boddicker so they can use his body to support their untested RoboCop prototype. But when RoboCop learns of the company's nefarious plans, he turns on his masters.", 102, "English", "/hHtOgGb3NihlyRATHlKPaFApbrd.jpg", 7.2000000000000002, new DateTime(1987, 7, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), "RoboCop" },
                    { 5590, null, "U", "A fairy godmother helps a princess disguise herself so she won't have to marry her father.", 90, "French", "/2Fs3KcNRr0muXiw0VXehx0RhpKI.jpg", 7.2999999999999998, new DateTime(1970, 12, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), "Donkey Skin" },
                    { 5708, null, "R", "The story of Joy Division’s lead singer Ian Curtis, from his schoolboy days in 1973 to his suicide on the eve of the band's first American tour in 1980.", 121, "English", "/jOJiaOhwrDdwqTRZvZOhbndqHGp.jpg", 7.5999999999999996, new DateTime(2007, 9, 26, 0, 0, 0, 0, DateTimeKind.Unspecified), "Control" },
                    { 5723, null, "R", "A vacuum repairman moonlights as a street musician and hopes for his big break. One day a Czech immigrant, who earns a living selling flowers, approaches him with the news that she is also an aspiring singer-songwriter. The pair decide to collaborate, and the songs that they compose reflect the story of their blossoming love.", 85, "English", "/7nW363kSYRCkr4VGOMvuSGwtzKs.jpg", 7.4000000000000004, new DateTime(2007, 3, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), "Once" },
                    { 5781, null, "R", "After dumping a bucket of water on a beautiful young woman from the window of a train car, wealthy Frenchman Mathieu, regales his fellow passengers with the story of the dysfunctional relationship between himself and the young woman in question, a fiery 19-year-old flamenco dancer named Conchita. What follows is a tale of cruelty, depravity and lies -- the very building blocks of love.", 103, "French", "/9iUdC4dftkjYSBUJq5DAxC6WqB9.jpg", 7.5, new DateTime(1977, 8, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), "That Obscure Object of Desire" },
                    { 5801, null, "AL", "Impoverished priest Harihar Ray, dreaming of a better life for himself and his family, leaves his rural Bengal village in search of work. Alone, his wife, Sarbojaya, looks after her rebellious daughter, Durga, and her young son, Apu, as well as Harihar's elderly aunt Indir. The children enjoy the small pleasures of their difficult life, while their parents suffer the daily indignities heaped upon them.", 125, "Bengali", "/frZj5djlU9hFEjMcL21RJZVuG5O.jpg", 8.1999999999999993, new DateTime(1955, 8, 26, 0, 0, 0, 0, DateTimeKind.Unspecified), "Pather Panchali" }
                });

            migrationBuilder.InsertData(
                table: "Movies",
                columns: new[] { "Id", "ActorId", "Certification", "Description", "Duration", "Language", "Picture", "Ratings", "ReleaseDate", "Title" },
                values: new object[,]
                {
                    { 5825, null, "PG-13", "It's Christmastime, and the Griswolds are preparing for a family seasonal celebration. But things never run smoothly for Clark, his wife Ellen, and their two kids. Clark's continual bad luck is worsened by his obnoxious family guests, but he manages to keep going, knowing that his Christmas bonus is due soon.", 97, "English", "/64NKasFKx6aOTKRg4mv76l0IwZR.jpg", 7.2000000000000002, new DateTime(1989, 11, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "National Lampoon's Christmas Vacation" },
                    { 5910, null, "R", "A police officer leaves the force in the face of harrowing personal and professional difficulties. Spiraling into a depression, he makes questionable decisions.", 103, "Japanese", "/kODRulaJ71pSQF5TcfuCIFUKTn.jpg", 7.7000000000000002, new DateTime(1997, 11, 5, 0, 0, 0, 0, DateTimeKind.Unspecified), "Fireworks" },
                    { 5915, null, "R", "After graduating from Emory University in 1992, top student and athlete Christopher McCandless abandons his possessions, gives his entire $24,000 savings account to charity, and hitchhikes to Alaska to live in the wilderness.", 148, "English", "/2MSGZEE6XZd2r4ODNziwAw7Hpw0.jpg", 7.7999999999999998, new DateTime(2007, 9, 11, 0, 0, 0, 0, DateTimeKind.Unspecified), "Into the Wild" },
                    { 5924, null, "PG", "A man befriends a fellow criminal as the two of them begin serving their sentence on a dreadful prison island, which inspires the man to plot his escape.", 151, "English", "/356oqQpug682OERsWV0bGZ0YxwQ.jpg", 7.9000000000000004, new DateTime(1973, 12, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), "Papillon" },
                    { 5925, null, "NR", "The Nazis, exasperated at the number of escapes from their prison camps by a relatively small number of Allied prisoners, relocate them to a high-security 'escape-proof' camp to sit out the remainder of the war. Undaunted, the prisoners plan one of the most ambitious escape attempts of World War II. Based on a true story.", 173, "English", "/aCPW2GTrFguhI06pdU2DBrO50pU.jpg", 8.0, new DateTime(1963, 6, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Great Escape" },
                    { 5961, null, "R", "As children in the loving Ekdahl family, Fanny and Alexander enjoy a happy life with their parents, who run a theater company. After their father dies unexpectedly, however, the siblings end up in a joyless home when their mother, Emilie, marries a stern bishop. The bleak situation gradually grows worse as the bishop becomes more controlling, but dedicated relatives make a valiant attempt to aid Emilie, Fanny and Alexander.", 188, "Swedish", "/q8jlA3Wc1Z987hNKRFA44g5OugC.jpg", 7.7999999999999998, new DateTime(1982, 12, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), "Fanny and Alexander" },
                    { 5967, null, "PG-13", "This simple romantic tragedy begins in 1957. Guy Foucher, a 20-year-old French auto mechanic, has fallen in love with 17-year-old Geneviève Emery, an employee in her widowed mother's chic but financially embattled umbrella shop. On the evening before Guy is to leave for a two-year tour of combat in Algeria, he and Geneviève make love. She becomes pregnant and must choose between waiting for Guy's return or accepting an offer of marriage from a wealthy diamond merchant.", 91, "French", "/hlOrI5DZlSzyc4fiYzbuz42hknH.jpg", 7.4000000000000004, new DateTime(1964, 2, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Umbrellas of Cherbourg" },
                    { 6003, null, "PG", "Director Franco Zeffirelli's beloved version of one of the most well-known love stories in the English language. Romeo Montague and Juliet Capulet fall in love against the wishes of their feuding families. Driven by their passion, the young lovers defy their destiny and elope, only to suffer the ultimate tragedy.", 138, "English", "/hzE63Fah1BbqGQ3srVhOXoPPkBb.jpg", 7.4000000000000004, new DateTime(1968, 4, 2, 0, 0, 0, 0, DateTimeKind.Unspecified), "Romeo and Juliet" },
                    { 6037, null, "PG", "Lionel Twain invites the world's five greatest detectives to a 'dinner and murder'. Included are a blind butler, a deaf-mute maid, screams, spinning rooms, secret passages, false identities and more plot turns and twists than are decently allowed.", 94, "English", "/9HlvA3JUn0yuUvWUXJTfMJB1Vge.jpg", 7.2999999999999998, new DateTime(1976, 6, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), "Murder by Death" },
                    { 6075, null, "R", "A Puerto-Rican ex-con, just released from prison, pledges to stay away from drugs and violence despite the pressure around him, and lead a better life outside NYC.", 144, "English", "/9E3GQQOjGlxSneLftFfOsnQGwSF.jpg", 7.9000000000000004, new DateTime(1993, 11, 10, 0, 0, 0, 0, DateTimeKind.Unspecified), "Carlito's Way" },
                    { 6114, null, "R", "When Dracula leaves the captive Jonathan Harker and Transylvania for London in search of Mina Harker, the reincarnation of Dracula's long-dead wife Elisabeta, obsessed vampire hunter Dr. Van Helsing sets out to end the madness.", 128, "English", "/n39glC4GkBeCbwdenES8ZBodim8.jpg", 7.4000000000000004, new DateTime(1992, 11, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), "Bram Stoker's Dracula" },
                    { 6145, null, "R", "A husband is on trial for the attempted murder of his wife, in what is seemingly an open/shut case for the ambitious district attorney trying to put him away. However, there are surprises for both around every corner, and, as a suspenseful game of cat-and-mouse is played out, each must manipulate and outwit the other.", 113, "English", "/wNfmx8HvlIouzT54ptMWzXw5XiG.jpg", 7.2999999999999998, new DateTime(2007, 4, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), "Fracture" },
                    { 6396, null, "R", "Two former geeks become 1980s punks, then party and go to concerts while deciding what to do with their lives.", 97, "English", "/7u3IZPuIOPjICi55K7cJgzV3e3B.jpg", 7.2000000000000002, new DateTime(1998, 9, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), "SLC Punk" },
                    { 6404, null, "PG", "Jonathan Harker, a real estate agent, goes to Transylvania to visit the mysterious Count Dracula and formalize the purchase of a property in Wismar. Once Jonathan is caught under his evil spell, Dracula travels to Wismar where he meets the beautiful Lucy, Jonathan's wife, while a plague spreads through the town, now ruled by death.", 107, "German", "/jHKzGYwf7P34vz8MhJBTN6cnaYD.jpg", 7.4000000000000004, new DateTime(1979, 1, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), "Nosferatu the Vampyre" },
                    { 6537, null, "R", "A woman brings her family back to her childhood home, which used to be an orphanage, intent on reopening it. Before long, her son starts to communicate with a new invisible friend.", 105, "Spanish", "/icMuU0iUvctuXJ0Cr05BdEmHLen.jpg", 7.2000000000000002, new DateTime(2007, 5, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Orphanage" },
                    { 6619, null, "PG", "Composer Gustav von Aschenbach travels to Venice for health reasons. There, he becomes obsessed with the stunning beauty of an adolescent Polish boy named Tadzio who is staying with his family at the same Grand Hôtel des Bains on the Lido as is Aschenbach.", 130, "Italian", "/s81SuFBSqY8T5Lrn5R8ucX8LKxi.jpg", 7.2000000000000002, new DateTime(1971, 3, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "Death in Venice" },
                    { 6620, null, "U", "Linus and David Larrabee are the two sons of a very wealthy family. Linus is all work – busily running the family corporate empire, he has no time for a wife and family. David is all play – technically he is employed by the family business, but never shows up for work, spends all his time entertaining, and has been married and divorced three times. Meanwhile, Sabrina Fairchild is the young, shy, and awkward daughter of the household chauffeur, who goes away to Paris for two years, and returns to capture David's attention, while falling in love with Linus.", 113, "English", "/e1Po9NDrH7IJZhv89467gJH5FS0.jpg", 7.5, new DateTime(1954, 9, 10, 0, 0, 0, 0, DateTimeKind.Unspecified), "Sabrina" },
                    { 6644, null, "G", "Cole Thornton, a gunfighter for hire, joins forces with an old friend, Sheriff J.P. Hara. Together with an old indian fighter and a gambler, they help a rancher and his family fight a rival rancher that is trying to steal their water.", 120, "English", "/poJxkMtTA3E95lJ6RnBgNxF0Vmx.jpg", 7.4000000000000004, new DateTime(1966, 12, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), "El Dorado" },
                    { 6844, null, "G", "Escaping death, a Hebrew infant is raised in a royal household to become a prince. Upon discovery of his true heritage, Moses embarks on a personal quest to reclaim his destiny as the leader and liberator of the Hebrew people.", 220, "English", "/3Ei59AR64x6dMZfWobPCkZjbqTL.jpg", 7.7000000000000002, new DateTime(1956, 10, 5, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Ten Commandments" },
                    { 6916, null, "G", "After a tied 1st place in a local stunt race, two drivers start a contest to decide who of them will own the prize, a dune buggy. But when a mobster destroys the car, they are determined to get it back.", 102, "Italian", "/rC1xGxoMyMV1dImSZ0ub0Wza6Be.jpg", 7.5, new DateTime(1974, 3, 29, 0, 0, 0, 0, DateTimeKind.Unspecified), "Watch Out, We're Mad" },
                    { 6949, null, "G", "The accidental mix-up of four identical plaid overnight bags leads to a series of increasingly wild and wacky situations.", 94, "English", "/m3Lc10lNU500lCTWUh26I8Iw5C2.jpg", 7.2999999999999998, new DateTime(1972, 3, 9, 0, 0, 0, 0, DateTimeKind.Unspecified), "What's Up, Doc?" },
                    { 6977, null, "R", "Llewelyn Moss stumbles upon dead bodies, $2 million and a hoard of heroin in a Texas desert, but methodical killer Anton Chigurh comes looking for it, with local sheriff Ed Tom Bell hot on his trail. The roles of prey and predator blur as the violent pursuit of money and justice collide.", 122, "English", "/6d5XOczc226jECq0LIX0siKtgHR.jpg", 7.9000000000000004, new DateTime(2007, 11, 8, 0, 0, 0, 0, DateTimeKind.Unspecified), "No Country for Old Men" },
                    { 6978, null, "PG-13", "When trucker Jack Burton agreed to take his friend, Wang Chi, to pick up his fiancee at the airport, he never expected to get involved in a supernatural battle between good and evil. Wang's fiancee has emerald green eyes, which make her a perfect target for immortal sorcerer Lo Pan and his three invincible cronies. Lo Pan must marry a girl with green eyes so he can regain his physical form.", 99, "English", "/gI2Qs1yTTj3NcESJyttCkbmJ4k9.jpg", 7.2000000000000002, new DateTime(1986, 5, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Big Trouble in Little China" },
                    { 7214, null, "PG-13", "Based on a true story, in which Richmond High School head basketball coach Ken Carter made headlines in 1999 for benching his undefeated team due to poor academic results.", 136, "English", "/y3HOTTyM5nLsdUzXFtFCohG28qj.jpg", 7.5, new DateTime(2005, 1, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), "Coach Carter" },
                    { 7249, null, "NR", "The Planet Express crew return from cancellation, only to be robbed blind by hideous \"sprunging\" scam artists.  Things go from bad to worse when the scammers hack Bender, start traveling through time, and take Earth over entirely!  Will the crew be able to save the day, or will Bender's larcenous tendencies and their general incompetence doom them all?", 88, "English", "/bmVE90IHvx4uXQgtbRtu4RyMWpt.jpg", 7.4000000000000004, new DateTime(2007, 11, 27, 0, 0, 0, 0, DateTimeKind.Unspecified), "Futurama: Bender's Big Score" },
                    { 7340, null, "R", "Carrie White, a shy and troubled teenage girl who is tormented by her high school peers and her fanatically religious mother, begins to use her powers of telekinesis to exact revenge upon them.", 98, "English", "/uc3OvgmbnYaS5Y0BOjSmC1EmSz1.jpg", 7.2000000000000002, new DateTime(1976, 11, 3, 0, 0, 0, 0, DateTimeKind.Unspecified), "Carrie" },
                    { 7345, null, "R", "Ruthless silver miner, turned oil prospector, Daniel Plainview, moves to oil-rich California. Using his son to project a trustworthy, family-man image, Plainview cons local landowners into selling him their valuable properties for a pittance. However, local preacher Eli Sunday suspects Plainview's motives and intentions, starting a slow-burning feud that threatens both their lives.", 158, "English", "/fa0RDkAlCec0STeMNAhPaF89q6U.jpg", 8.0999999999999996, new DateTime(2007, 12, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), "There Will Be Blood" },
                    { 7347, null, "R", "In 1997, before the visit of the pope to Rio de Janeiro, Captain Nascimento from BOPE (Special Police Operations Battalion) is assigned to eliminate the risks of the drug dealers in a dangerous slum nearby where the pope intends to be lodged.", 115, "Portuguese", "/lwIXz785N2fXi8hsBr1IXciFlkM.jpg", 8.0999999999999996, new DateTime(2007, 10, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), "Elite Squad" },
                    { 7452, null, "NC-17", "The wife of an abusive criminal finds solace in the arms of a kind regular guest in her husband's restaurant.", 124, "English", "/15xMqAnFsROopAT66zdRyu2Dtek.jpg", 7.4000000000000004, new DateTime(1989, 10, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Cook, the Thief, His Wife & Her Lover" },
                    { 7500, null, "R", "Kitano plays Murakawa, a Tokyo yakuza tiring of gangster life. Along with a few of his henchmen, he is sent by his boss to Okinawa to help end a gang war, supposedly to mediate between two warring clans. He finds that the dispute between the clans is insignificant and whilst wondering why he was sent to Okinawa at all, Murakawa's headquarters are bombed and he and his gang are ambushed in a bar.", 94, "Japanese", "/mX9E4fEuG17L2e7bZmhBc0XdRbw.jpg", 7.5, new DateTime(1993, 4, 10, 0, 0, 0, 0, DateTimeKind.Unspecified), "Sonatine" },
                    { 7508, null, "PG", "Ishaan Awasthi is an eight-year-old whose world is filled with wonders that no one else seems to appreciate. Colours, fish, dogs, and kites don't seem important to the adults, who are much more interested in things like homework, marks, and neatness. Ishaan cannot seem to get anything right in class; he is then sent to boarding school, where his life changes forever.", 165, "Hindi", "/fwXhw9bERqKrJfJK6WGakPIh3FS.jpg", 8.0, new DateTime(2007, 12, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), "Like Stars on Earth" },
                    { 7549, null, "PG-13", "Huo Yuan Jia became the most famous martial arts fighter in all of China at the turn of the 20th Century. Huo faced personal tragedy but ultimately fought his way out of darkness, defining the true spirit of martial arts and also inspiring his nation. The son of a great fighter who didn't wish for his child to follow in his footsteps, Huo resolves to teach himself how to fight - and win.", 103, "Mandarin", "/91VK3YzeQ7t6yONV6dTohP4QL3q.jpg", 7.4000000000000004, new DateTime(2006, 1, 26, 0, 0, 0, 0, DateTimeKind.Unspecified), "Fearless" },
                    { 7735, null, "12", "A school teacher discusses types of government with his class. His students find it too boring to repeatedly go over national socialism and believe that dictatorship cannot be established in modern Germany. He starts an experiment to show how easily the masses can become manipulated.", 107, "German", "/i4mCYeVXB8BFt2VYdDHYZN8M18u.jpg", 7.5, new DateTime(2008, 3, 11, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Wave" },
                    { 7857, null, "R", "In an Italian seaside town, young Titta gets into trouble with his friends and watches various local eccentrics as they engage in often absurd behavior. Frequently clashing with his stern father and defended by his doting mother, Titta witnesses the actions of a wide range of characters, from his extended family to Fascist loyalists to sensual women, with certain moments shifting into fantastical scenarios.", 123, "Italian", "/ruVrgGjSMDfDL3dABWzPxUXNNi6.jpg", 8.0, new DateTime(1973, 12, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), "Amarcord" },
                    { 7862, null, "12", "The story Jewish counterfeiter, Salomon Sorowitsch, coerced into assisting the Nazi operation of the Sachsenhausen concentration camp during World War II.", 98, "German", "/Af6I9RZF0SIPeNnp8hAleGDTnKd.jpg", 7.4000000000000004, new DateTime(2007, 2, 9, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Counterfeiters" },
                    { 7863, null, "PG-13", "Pianist David Helfgott, driven by his father and teachers, has a breakdown. Years later he returns to the piano, to popular if not critical acclaim.", 105, "English", "/z6WM18EoqfkSnaOYPCttNEMp0aC.jpg", 7.4000000000000004, new DateTime(1996, 8, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Shine" },
                    { 7913, null, "PG-13", "After a group of friends graduate from Delhi University, they listlessly haunt their old campus, until a British filmmaker casts them in a film she's making about freedom fighters under British rule. Although the group is largely apolitical, the tragic death of a friend owing to local government corruption awakens their patriotism. Inspired by the freedom fighters they represent in the film, the friends collectively decide to avenge the killing.", 157, "Hindi", "/f1bF8CHzEu621bPSIg6XiUNAabh.jpg", 7.2999999999999998, new DateTime(2006, 1, 26, 0, 0, 0, 0, DateTimeKind.Unspecified), "Rang De Basanti" },
                    { 7979, null, "PG-13", "After spending years in California, Amir returns to his homeland in Afghanistan to help his old friend Hassan, whose son is in trouble.", 128, "English", "/dom2esWWW8C9jS2v7dOhW48LwHh.jpg", 7.2999999999999998, new DateTime(2007, 10, 4, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Kite Runner" },
                    { 7984, null, "R", "A small time thief from Belfast, Gerry Conlon, is falsely implicated in the IRA bombing of a pub that kills several people while he is in London. He and his four friends are coerced by British police into confessing their guilt. Gerry's father and other relatives in London are also implicated in the crime. He spends fifteen years in prison with his father trying to prove his innocence.", 133, "English", "/kUTImWLPIr6U4xhLsHrgky5vgJt.jpg", 7.9000000000000004, new DateTime(1993, 12, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), "In the Name of the Father" },
                    { 8055, null, "R", "The story of Michael Berg, a German lawyer who, as a teenager in the late 1950s, had an affair with an older woman, Hanna, who then disappeared only to resurface years later as one of the defendants in a war crimes trial stemming from her actions as a concentration camp guard late in the war. He alone realizes that Hanna is illiterate and may be concealing that fact at the expense of her freedom.", 124, "English", "/r0WURbmnhgKeBpHcpDULBgRedQM.jpg", 7.4000000000000004, new DateTime(2008, 1, 2, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Reader" },
                    { 8056, null, "U", "In 1941, the inhabitants of a small Jewish village in Central Europe organize a fake deportation train so that they can escape the Nazis and flee to Palestine.", 103, "French", "/anUwgyVrC7kUwN5OliazbC5qBfr.jpg", 7.2999999999999998, new DateTime(1998, 9, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), "Train of Life" },
                    { 8073, null, "12", "Cinephile slackers Franz and Arthur spend their days mimicking the antiheroes of Hollywood noirs and Westerns while pursuing the lovely Odile. The misfit trio upends convention at every turn, be it through choreographed dances in cafés or frolicsome romps through the Louvre. Eventually, their romantic view of outlaws pushes them to plan their own heist, but their inexperience may send them out in a blaze of glory -- which could be just what they want.", 97, "French", "/9oqyj79xmcypxLajJdefOtrYx64.jpg", 7.7000000000000002, new DateTime(1964, 8, 5, 0, 0, 0, 0, DateTimeKind.Unspecified), "Band of Outsiders" }
                });

            migrationBuilder.InsertData(
                table: "Movies",
                columns: new[] { "Id", "ActorId", "Certification", "Description", "Duration", "Language", "Picture", "Ratings", "ReleaseDate", "Title" },
                values: new object[,]
                {
                    { 8088, null, "R", "Harry Caine, a blind writer, reaches this moment in time when he has to heal his wounds from 14 years back. He was then still known by his real name, Mateo Blanco, and directing his last movie.", 127, "Spanish", "/uPTOKnc9bzPp1emH3TyuKOGIylQ.jpg", 7.2000000000000002, new DateTime(2009, 3, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "Broken Embraces" },
                    { 8094, null, "R", "Four women are given into the custody of the Magdalene sisterhood asylum to correct their sinful behavior: Crispina and Rose have given birth to a premarital child, Margaret got raped by her cousin and the orphan Bernadette had been repeatedly caught flirting with the boys. All have to work in a laundry under the strict supervision of the nuns, who break their wills through sadistic punishment.", 119, "English", "/akOnyPsfzcDvCwP3lzY35i2NIha.jpg", 7.5, new DateTime(2002, 9, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Magdalene Sisters" },
                    { 8290, null, "U", "During World War II, two French civilians and a downed British Bomber Crew set out from Paris to cross the demarcation line between Nazi-occupied Northern France and the South. From there they will be able to escape to England. First, they must avoid German troops - and the consequences of their own blunders.", 132, "French", "/91l4Sf3WJwrb0tSVPsOqnBXG8E6.jpg", 7.9000000000000004, new DateTime(1966, 12, 8, 0, 0, 0, 0, DateTimeKind.Unspecified), "Don't Look Now: We're Being Shot At" },
                    { 8321, null, "R", "Ray and Ken, two hit men, are in Bruges, Belgium, waiting for their next mission. While they are there they have time to think and discuss their previous assignment. When the mission is revealed to Ken, it is not what he expected.", 108, "English", "/jMiBBqk72VRo1Y39x2ZbbenEU3a.jpg", 7.5, new DateTime(2008, 2, 8, 0, 0, 0, 0, DateTimeKind.Unspecified), "In Bruges" },
                    { 8327, null, "R", "The Alchemist assembles together a group of people from all walks of life to represent the planets in the solar system. The occult adept's intention is to put his recruits through strange mystical rites and divest them of their worldly baggage before embarking on a trip to Lotus Island. There they ascend the Holy Mountain to displace the immortal gods who secretly rule the universe.", 114, "Spanish", "/bvuWgH7MGYHBBdNeZcFDDA8vjYY.jpg", 7.7000000000000002, new DateTime(1973, 11, 29, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Holy Mountain" },
                    { 8333, null, "R", "In New York, armed men hijack a subway car and demand a ransom for the passengers. Even if it's paid, how could they get away?", 104, "English", "/vNhywp9w1DVG6BytxKp4kjtaaGC.jpg", 7.4000000000000004, new DateTime(1974, 10, 2, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Taking of Pelham One Two Three" },
                    { 8337, null, "R", "Nada, a wanderer without meaning in his life, discovers a pair of sunglasses capable of showing the world the way it truly is. As he walks the streets of Los Angeles, Nada notices that both the media and the government are comprised of subliminal messages meant to keep the population subdued, and that most of the social elite are skull-faced aliens bent on world domination. With this shocking discovery, Nada fights to free humanity from the mind-controlling aliens.", 94, "English", "/ngnybFTuopfbfmmEeX9jjBQQmF6.jpg", 7.2999999999999998, new DateTime(1988, 11, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), "They Live" },
                    { 8342, null, "6", "Two soldiers from opposite sites get stuck between the front lines in the same trench. The UN is asked to free them and both sides agree on a ceasefire, but will they stick to it?", 98, "Bosnian", "/jRffyv5gaJb6Sna1S6UMRCPHuso.jpg", 7.5999999999999996, new DateTime(2001, 9, 8, 0, 0, 0, 0, DateTimeKind.Unspecified), "No Man's Land" },
                    { 8356, null, "12", "Nickie Ferrante's return to New York to marry a rich heiress is well publicized as are his many antics and affairs. He meets a nightclub singer Terry McKay who is also on her way home to her longtime boyfriend. She sees him as just another playboy and he sees her as stand-offish but over several days they soon find they've fallen in love. Nickie has never really worked in his life so they agree that they will meet again in six months time atop the Empire State building. This will give them time to deal with their current relationships and for Nickie to see if he can actually earn a living. He returns to painting and is reasonably successful. On the agreed date, Nickie is waiting patiently for Terry who is racing to join him. Fate intervenes however, resulting in misunderstanding and heartbreak and only fate can save their relationship.", 111, "English", "/jwbWglYHbjqUu8M9DjTYzTOFklt.jpg", 7.4000000000000004, new DateTime(1957, 7, 11, 0, 0, 0, 0, DateTimeKind.Unspecified), "An Affair to Remember" },
                    { 8358, null, "PG-13", "Chuck Nolan, a top international manager for FedEx, and Kelly, a Ph.D. student, are in love and heading towards marriage. Then Chuck's plane to Malaysia crashes at sea during a terrible storm. He's the only survivor, and finds himself marooned on a desolate island. With no way to escape, Chuck must find ways to survive in his new home.", 143, "English", "/4x4puNUAqBpi9sUMYL5dNPSdB6I.jpg", 7.5999999999999996, new DateTime(2000, 12, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), "Cast Away" },
                    { 8374, null, "R", "Tired of the crime overrunning the streets of Boston, Irish Catholic twin brothers Conner and Murphy are inspired by their faith to cleanse their hometown of evil with their own brand of zealous vigilante justice. As they hunt down and kill one notorious gangster after another, they become controversial folk heroes in the community. But Paul Smecker, an eccentric FBI agent, is fast closing in on their blood-soaked trail.", 108, "English", "/xj3jhyq3ZsfdVn79kXC1XKFVQlv.jpg", 7.2999999999999998, new DateTime(1999, 1, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Boondock Saints" },
                    { 8392, null, "G", "Two sisters move to the country with their father in order to be closer to their hospitalized mother, and discover the surrounding trees are inhabited by Totoros, magical spirits of the forest. When the youngest runs away from home, the older sister seeks help from the spirits to find her.", 86, "Japanese", "/rtGDOeG9LzoerkDGZF9dnVeLppL.jpg", 8.0999999999999996, new DateTime(1988, 4, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), "My Neighbor Totoro" },
                    { 8393, null, "PG", "A Coca-Cola bottle dropped from an airplane raises havoc among a normally peaceful tribe of African bushmen who believe it to be a utensil of the gods.", 109, "English", "/kO7YwEuyTfjXP8plVhmcLf3IlUq.jpg", 7.2000000000000002, new DateTime(1980, 9, 10, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Gods Must Be Crazy" },
                    { 8416, null, "R", "A weak-willed Italian man becomes a fascist flunky who goes abroad to arrange the assassination of his old teacher, now a political dissident.", 108, "Italian", "/4GNljod7zSzjQSlPmSThWUy25Vr.jpg", 7.7000000000000002, new DateTime(1970, 10, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Conformist" },
                    { 8422, null, "NR", "When a widow’s family moves to the big city, two of her sons become romantic rivals with deadly results.", 178, "Italian", "/pngL8AraChIDOiWnKF2o3S9kJzJ.jpg", 8.0999999999999996, new DateTime(1960, 10, 6, 0, 0, 0, 0, DateTimeKind.Unspecified), "Rocco and His Brothers" },
                    { 8424, null, "U", "As adults, best friends Julien and Sophie continue the odd game they started as children -- a fearless competition to outdo one another with daring and outrageous stunts. While they often act out to relieve one another's pain, their game might be a way to avoid the fact that they are truly meant for one another.", 93, "French", "/vvjC5LSMANKvGGDHjIWj1YomPdN.jpg", 7.2999999999999998, new DateTime(2003, 9, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), "Love Me If You Dare" },
                    { 8440, null, "R", "When a doctor decides to carry out an AIDS prevention program inside Latin America’s largest prison: the Casa de Detenção de São Paulo - Carandiru, he discovers the victim of one of the darkest days in Brazilian History when the State of São Paulo’s Military Police, with the excuse for law enforcement, shot to death 111 people. Based on real facts and on the book written by Dráuzio Varella.", 148, "Portuguese", "/dvL05T9KtkY6oPpMvrAmu18Nds3.jpg", 7.5, new DateTime(2003, 3, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), "Carandiru" },
                    { 8587, null, "G", "A young lion prince is cast out of his pride by his cruel uncle, who claims he killed his father. While the uncle rules with an iron paw, the prince grows up beyond the Savannah, living by a philosophy: No worries for the rest of your days. But when his past comes to haunt him, the young prince must decide his fate: Will he remain an outcast or face his demons and become what he needs to be?", 89, "English", "/sKCr78MXSLixwmZ8DyJLrpMsd15.jpg", 8.3000000000000007, new DateTime(1994, 6, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Lion King" },
                    { 8681, null, "PG-13", "While vacationing with a friend in Paris, an American girl is kidnapped by a gang of human traffickers intent on selling her into forced prostitution. Working against the clock, her ex-spy father must pull out all the stops to save her. But with his best years possibly behind him, the job may be more than he can handle.", 94, "English", "/wrJjDB8SSJJKcpXVf4KAxZIHvBZ.jpg", 7.4000000000000004, new DateTime(2008, 2, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), "Taken" },
                    { 8703, null, "0", "Popelka, a resourceful and independent young girl, is a servant in her stepmother’s house and confides her closest friend the owl. When she comes across three magical acorns, she’s granted a single wish for each one of them.", 82, "Czech", "/s4QqSS1r80cAbZKHUTtpu824Nfb.jpg", 7.7999999999999998, new DateTime(1973, 11, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), "Three Wishes for Cinderella" },
                    { 8740, null, "NR", "Rex and Saskia are enjoying a biking holiday in France when, stopping at a gas station, Saskia disappears.", 106, "Dutch", "/eE5bbuRJluooG2MjEAsLEYyuJoa.jpg", 7.5, new DateTime(1988, 10, 27, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Vanishing" },
                    { 8741, null, "R", "The story of a group of men, an Army Rifle company called C-for-Charlie, who change, suffer, and ultimately make essential discoveries about themselves during the fierce World War II battle of Guadalcanal. It follows their journey, from the surprise of an unopposed landing, through the bloody and exhausting battles that follow, to the ultimate departure of those who survived.", 171, "English", "/seMydAaoxQP6F0xbE1jOcTmn5Jr.jpg", 7.4000000000000004, new DateTime(1998, 3, 5, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Thin Red Line" },
                    { 8810, null, "R", "Max Rockatansky returns as the heroic loner who drives the dusty roads of a postapocalyptic Australian Outback in an unending search for gasoline. Arrayed against him and the other scraggly defendants of a fuel-depot encampment are the bizarre warriors commanded by the charismatic Lord Humungus, a violent leader whose scruples are as barren as the surrounding landscape.", 96, "English", "/ffzRLeZaKP6YCaTVieWeSLccC4y.jpg", 7.4000000000000004, new DateTime(1981, 12, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), "Mad Max 2" },
                    { 8832, null, "NR", "Italy, early nineties. Calm, clever and inscrutable, politician Giulio Andreotti has been synonymous with power for decades. He has survived to everything: electoral battles, terrorist massacres, loss of friends, slanderous accusations; but now certain repentant mobsters implicate him in the crimes of Cosa Nostra.", 113, "Italian", "/6Rb4Uel3gziuDEgJ71xfZelayVP.jpg", 7.7000000000000002, new DateTime(2008, 5, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), "Il Divo" },
                    { 8844, null, "PG", "When siblings Judy and Peter discover an enchanted board game that opens the door to a magical world, they unwittingly invite Alan -- an adult who's been trapped inside the game for 26 years -- into their living room. Alan's only hope for freedom is to finish the game, which proves risky as all three find themselves running from giant rhinoceroses, evil monkeys and other terrifying creatures.", 104, "English", "/vgpXmVaVyUL7GGiDeiK1mKEKzcX.jpg", 7.2000000000000002, new DateTime(1995, 12, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Jumanji" },
                    { 8923, null, "R", "After being wrongfully expelled from Harvard University, American Matt Buckner flees to his sister's home in England. Once there, he is befriended by her charming and dangerous brother-in-law, Pete Dunham, and introduced to the underworld of British football hooliganism. Matt learns to stand his ground through a friendship that develops against the backdrop of this secret and often violent world. 'Green Street Hooligans' is a story of loyalty, trust and the sometimes brutal consequences of living close to the edge.", 109, "English", "/tfLj69EoP1b8ZWfLyg5FGJ5LC38.jpg", 7.2000000000000002, new DateTime(2005, 9, 9, 0, 0, 0, 0, DateTimeKind.Unspecified), "Green Street Hooligans" },
                    { 9008, null, "R", "Tells the true story of a 60 Minutes television series exposé of the tobacco industry, as seen through the eyes of a real tobacco executive, Jeffrey Wigand.", 157, "English", "/w695X0FvTlBCS7GSLHNILnrfqPm.jpg", 7.5, new DateTime(1999, 3, 10, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Insider" },
                    { 9016, null, "PG", "When space galleon cabin boy Jim Hawkins discovers a map to an intergalactic \"loot of a thousand worlds,\" a cyborg cook named John Silver teaches him to battle supernovas and space storms. But, soon, Jim realizes Silver is a pirate intent on mutiny!", 95, "English", "/zMKatZ0c0NCoKzfizaCzVUcbKMf.jpg", 7.5, new DateTime(2002, 11, 26, 0, 0, 0, 0, DateTimeKind.Unspecified), "Treasure Planet" },
                    { 9023, null, "G", "As a wild stallion travels across the frontiers of the Old West, he befriends a young human and finds true love with a mare.", 83, "English", "/cUgYrz4twiJ3QgVGpRfey984NIB.jpg", 7.7000000000000002, new DateTime(2002, 5, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), "Spirit: Stallion of the Cimarron" },
                    { 9028, null, "18", "A mute gunslinger fights in the defense of a group of outlaws and a vengeful young widow, against a group of ruthless bounty hunters.", 106, "Italian", "/m7sbmp9n65X8IikJe1ed108t2lQ.jpg", 7.5, new DateTime(1968, 2, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Great Silence" },
                    { 9040, null, "R", "The real-life struggle of an honest New York City cop against a corrupt system.", 130, "English", "/76rLcn53Fjdh4Dji9EIeJ98aYj1.jpg", 7.5999999999999996, new DateTime(1973, 12, 5, 0, 0, 0, 0, DateTimeKind.Unspecified), "Serpico" },
                    { 9056, null, "PG-13", "A virtuous Hong Kong police officer must clear his name after he is framed for murder.", 101, "Cantonese", "/1ttiBVbzQl9eQ640JnNPHwfm7EZ.jpg", 7.4000000000000004, new DateTime(1985, 12, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), "Police Story" },
                    { 9075, null, "R", "In the Nazi-occupied Netherlands during World War II, a Jewish singer infiltrates the regional Gestapo headquarters for the Dutch resistance.", 145, "Dutch", "/fKBeM6vjMD79G3wAXSpw3pBHsit.jpg", 7.5, new DateTime(2006, 9, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "Black Book" },
                    { 9078, null, "G", "Wart is a young boy who aspires to be a knight's squire. On a hunting trip he falls in on Merlin, a powerful but amnesiac wizard who has plans for him beyond mere squiredom. He starts by trying to give him an education, believing that once one has an education, one can go anywhere. Needless to say, it doesn't quite work out that way.", 79, "English", "/7lyeeuhGAJSNXYEW34S8mJ1bwI8.jpg", 7.2000000000000002, new DateTime(1963, 12, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Sword in the Stone" },
                    { 9081, null, "R", "Waking Life is about a young man in a persistent lucid dream-like state. The film follows its protagonist as he initially observes and later participates in philosophical discussions that weave together issues like reality, free will, our relationships with others, and the meaning of life.", 99, "English", "/2MRM4PL6H7yraAkwyUEe2EqoQH3.jpg", 7.5999999999999996, new DateTime(2001, 10, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), "Waking Life" },
                    { 9267, null, "PG", "A collection of Monty Python's Flying Circus skits from the first two seasons of their British TV series.", 88, "English", "/ajbdFQLvJTlNu4LnVWGnNMb4mZ8.jpg", 7.2999999999999998, new DateTime(1971, 9, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), "And Now for Something Completely Different" },
                    { 9277, null, "PG", "Set in the 1930s this intricate caper deals with an ambitious small-time crook and a veteran con man who seek revenge on a vicious crime lord who murdered one of their gang.", 129, "English", "/fpxhmgeCuPQOeatfeCPwtOwUwlb.jpg", 8.0, new DateTime(1973, 12, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Sting" },
                    { 9289, null, "G", "The retelling of June 6, 1944, from the perspectives of the Germans, US, British, Canadians, and the Free French. Marshall Erwin Rommel, touring the defenses being established as part of the Reich's Atlantic Wall, notes to his officers that when the Allied invasion comes they must be stopped on the beach. \"For the Allies as well as the Germans, it will be the longest day\"", 178, "English", "/iWgaYG9NtV9ZC3fIXMUif7SLPJK.jpg", 7.5999999999999996, new DateTime(1962, 9, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Longest Day" },
                    { 9299, null, "18", "While doing a thesis about violence, Ángela finds a snuff video where a girl is tortured until death. Soon she discovers that the girl was a former student in her faculty...", 125, "Spanish", "/3d4CQ0l4izm0u0eOU1zMGbtrzV5.jpg", 7.4000000000000004, new DateTime(1996, 4, 11, 0, 0, 0, 0, DateTimeKind.Unspecified), "Thesis" },
                    { 9323, null, "NR", "In the year 2029, the barriers of our world have been broken down by the net and by cybernetics, but this brings new vulnerability to humans in the form of brain-hacking. When a highly-wanted hacker known as 'The Puppetmaster' begins involving them in politics, Section 9, a group of cybernetically enhanced cops, are called in to investigate and stop the Puppetmaster.", 83, "Japanese", "/9gC88zYUBARRSThcG93MvW14sqx.jpg", 7.9000000000000004, new DateTime(1995, 11, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), "Ghost in the Shell" },
                    { 9325, null, "G", "The boy Mowgli makes his way to the man-village with Bagheera, the wise panther. Along the way he meets jazzy King Louie, the hypnotic snake Kaa and the lovable, happy-go-lucky bear Baloo, who teaches Mowgli \"The Bare Necessities\" of life and the true meaning of friendship.", 78, "English", "/xzpNa3RjKHfIijeqVuL72IgBvwy.jpg", 7.2999999999999998, new DateTime(1967, 10, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Jungle Book" },
                    { 9340, null, "PG", "A young teenager named Mikey Walsh finds an old treasure map in his father's attic. Hoping to save their homes from demolition, Mikey and his friends Data Wang, Chunk Cohen, and Mouth Devereaux run off on a big quest to find the secret stash of Pirate One-Eyed Willie.", 114, "English", "/eBU7gCjTCj9n2LTxvCSIXXOvHkD.jpg", 7.5, new DateTime(1985, 6, 7, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Goonies" }
                });

            migrationBuilder.InsertData(
                table: "Movies",
                columns: new[] { "Id", "ActorId", "Certification", "Description", "Duration", "Language", "Picture", "Ratings", "ReleaseDate", "Title" },
                values: new object[,]
                {
                    { 9343, null, "AL", "Fitzcarraldo is a dreamer who plans to build an opera house in Iquitos, in the Peruvian Amazon, so, in order to finance his project, he embarks on an epic adventure to collect rubber, a very profitable product, in a remote and unexplored region of the rainforest.", 157, "German", "/oBCnYEKcg1rMhr5JjDnrRpilvDd.jpg", 7.5999999999999996, new DateTime(1982, 3, 2, 0, 0, 0, 0, DateTimeKind.Unspecified), "Fitzcarraldo" },
                    { 9361, null, "R", "As the British and French soldiers battle for control of the American colonies in the 18th century, the settlers and native Americans are forced to take sides. Cora and her sister Alice unwittingly walk into trouble but are reluctantly saved by Hawkeye, an orphaned settler adopted by the last of the Mohicans.", 112, "English", "/fYVQRcgnOv998bKEplzrD3faGgt.jpg", 7.4000000000000004, new DateTime(1992, 9, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Last of the Mohicans" },
                    { 9366, null, "R", "An FBI undercover agent infilitrates the mob and finds himself identifying more with the mafia life at the expense of his regular one.", 127, "English", "/xtKLvpOfARi1XVm8u2FTdhY5Piq.jpg", 7.5, new DateTime(1997, 2, 27, 0, 0, 0, 0, DateTimeKind.Unspecified), "Donnie Brasco" },
                    { 9377, null, "PG-13", "After high school slacker Ferris Bueller successfully fakes an illness in order to skip school for the day, he goes on a series of adventures throughout Chicago with his girlfriend Sloane and best friend Cameron, all the while trying to outwit his wily school principal and fed-up sister.", 103, "English", "/kKhvDqvxaXSJXWjVKjCTeHvNKd3.jpg", 7.5999999999999996, new DateTime(1986, 6, 11, 0, 0, 0, 0, DateTimeKind.Unspecified), "Ferris Bueller's Day Off" },
                    { 9385, null, "APTA", "Asterix and Obelix depart on an adventure to complete twelve impossible tasks to prove to Caesar that they are as strong as the Gods. You'll roar with laughter as they outwit, outrun, and generally outrage the very people who are trying to prove them \"only human\".", 82, "French", "/7cZQZOYZFJcLjZnxWjO5PcUtmDZ.jpg", 7.4000000000000004, new DateTime(1976, 6, 26, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Twelve Tasks of Asterix" },
                    { 9394, null, "G", "The simple story has the pair coming to the rescue of peace-loving Mormons when land-hungry Major Harriman sends his bullies to harass them into giving up their fertile valley. Trinity and Bambino manage to save the Mormons and send the bad guys packing with slapstick humor instead of excessive violence, saving the day.", 106, "Italian", "/gH4hcL9ZEkqiXtlgY6HoYLVTAii.jpg", 7.5999999999999996, new DateTime(1970, 12, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), "They Call Me Trinity" },
                    { 9421, null, "G", "For Pierre Brochant and his friends, Wednesday is “Idiots' Day”. The idea is simple: each person has to bring along an idiot. The one who brings the most spectacular idiot wins the prize. Tonight, Brochant is ecstatic. He has found a gem. The ultimate idiot, “A world champion idiot!”. What Brochant doesn’t know is that Pignon is a real jinx, a past master in the art of bringing on catastrophes...", 80, "French", "/7ukFDHExWul2Zz3L0OH8CaZCp2Z.jpg", 7.7999999999999998, new DateTime(1998, 4, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Dinner Game" },
                    { 9426, null, "R", "When Seth Brundle makes a huge scientific and technological breakthrough in teleportation, he decides to test it on himself. Unbeknownst to him, a common housefly manages to get inside the device and the two become one.", 96, "English", "/wLnulyRMhZfrXr7qaufBFv5H1us.jpg", 7.2999999999999998, new DateTime(1986, 8, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Fly" },
                    { 9428, null, "R", "Royal Tenenbaum and his wife Etheline had three children and then they separated. All three children are extraordinary --- all geniuses. Virtually all memory of the brilliance of the young Tenenbaums was subsequently erased by two decades of betrayal, failure, and disaster. Most of this was generally considered to be their father's fault. \"The Royal Tenenbaums\" is the story of the family's sudden, unexpected reunion one recent winter.", 110, "English", "/pAKi4Ywdz6mqeD0tm6GOBH3vXap.jpg", 7.5, new DateTime(2001, 10, 5, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Royal Tenenbaums" },
                    { 9444, null, "G", "This animated adventure retells the story of the lost daughter of Russia's last czar. The evil Rasputin places a curse on the Romanov family, and Anastasia and her grandmother, Empress Maria, get separated. After growing up in an orphanage, Anastasia encounters two Russian men seeking a reward offered by Empress Maria for the return of her granddaughter. The trio travels to Paris, where they find that the empress has grown skeptical of imposters.", 94, "English", "/lQwTsdtJwxanuJPdS4Ltx5ngUBJ.jpg", 7.5999999999999996, new DateTime(1997, 11, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), "Anastasia" },
                    { 9454, null, "PG-13", "A unique 16th century woman, Danielle possesses a love of books, and can easily quote from Sir Thomas More’s UTOPIA. An intriguing mix of tomboyish athleticism and physical beauty, she has more than enough charm to capture the heart of a prince ... after beaning him with an apple.", 121, "English", "/j1GHqM07QY8SU0ixW6oCMT9ZBI4.jpg", 7.2999999999999998, new DateTime(1998, 7, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "EverAfter" },
                    { 9461, null, "R", "A martial artist agrees to spy on a reclusive crime lord using his invitation to a tournament there as cover.", 102, "English", "/zN7OOSARMLVzl9xJqkW2CcZ3xhY.jpg", 7.4000000000000004, new DateTime(1973, 8, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), "Enter the Dragon" },
                    { 9462, null, "R", "Tang Lung arrives in Rome to help his cousins in the restaurant business. They are being pressured to sell their property to the syndicate, who will stop at nothing to get what they want. When Tang arrives he poses a new threat to the syndicate, and they are unable to defeat him. The syndicate boss hires the best Japanese and European martial artists to fight Tang, but he easily finishes them off.", 100, "Cantonese", "/m7AIITQ624sfldI4SsX4htXPH1f.jpg", 7.5, new DateTime(1972, 6, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Way of the Dragon" },
                    { 9470, null, "R", "Set in Canton, China in the 1940s, the story revolves in a town ruled by the Axe Gang, Sing who desperately wants to become a member. He stumbles into a slum ruled by eccentric landlords who turns out to be the greatest kung-fu masters in disguise. Sing's actions eventually cause the Axe Gang and the slumlords to engage in an explosive kung-fu battle. Only one side will win and only one hero will emerge as the greatest kung-fu master of all.", 99, "Cantonese", "/exbyTbrvRUDKN2mcNEuVor4VFQW.jpg", 7.2999999999999998, new DateTime(2004, 2, 10, 0, 0, 0, 0, DateTimeKind.Unspecified), "Kung Fu Hustle" },
                    { 9474, null, "PG", "Jack Beauregard, one of the greatest gunman of the Old West, only wants to retire in peace and move to Europe. But a young gunfighter, known as \"Nobody\", who idolizes Beauregard, wants him to go out in glory. So he arranges for Jack to face the 150-man gang known as The Wild Bunch and earn his place in history.", 117, "Italian", "/rCoO8HqyJiFMhsAOUjjnw8gMgj9.jpg", 7.2999999999999998, new DateTime(1973, 12, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), "My Name Is Nobody" },
                    { 9475, null, "R", "Charlie Simms is a student at a private preparatory school who comes from a poor family. To earn the money for his flight home to Gresham, Oregon for Christmas, Charlie takes a job over Thanksgiving looking after retired U.S. Army officer Lieutenant Colonel Frank Slade, a cantankerous middle-aged man who lives with his niece and her family.", 156, "English", "/4adI7IaveWb7EidYXfLb3MK3CgO.jpg", 7.7000000000000002, new DateTime(1992, 12, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), "Scent of a Woman" },
                    { 9479, null, "PG", "Tired of scaring humans every October 31 with the same old bag of tricks, Jack Skellington, the spindly king of Halloween Town, kidnaps Santa Claus and plans to deliver shrunken heads and other ghoulish gifts to children on Christmas morning. But as Christmas approaches, Jack's rag-doll girlfriend, Sally, tries to foil his misguided plans.", 76, "English", "/oQffRNjK8e19rF7xVYEN8ew0j7b.jpg", 7.7999999999999998, new DateTime(1993, 10, 9, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Nightmare Before Christmas" },
                    { 9495, null, "R", "Exactly one year after young rock guitarist Eric Draven and his fiancée are brutally killed by a ruthless gang of criminals, Draven—watched over by a hypnotic crow—returns from the grave to exact revenge.", 102, "English", "/wF2Tnf0bdYrzCKVbWh0mFwPJS6k.jpg", 7.5, new DateTime(1994, 5, 11, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Crow" },
                    { 9504, null, "R", "When an office full of Chicago real estate salesmen is given the news that all but the top two will be fired at the end of the week, the atmosphere begins to heat up. Shelley Levene, who has a sick daughter, does everything in his power to get better leads from his boss, John Williamson, but to no avail. When his coworker Dave Moss comes up with a plan to steal the leads, things get complicated for the tough-talking salesmen.", 100, "English", "/zcaEDx8KlVfh4vKfMNLhiSi5Oz4.jpg", 7.4000000000000004, new DateTime(1992, 9, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Glengarry Glen Ross" },
                    { 9509, null, "R", "Jaded ex-CIA operative John Creasy reluctantly accepts a job as the bodyguard for a 10-year-old girl in Mexico City. They clash at first, but eventually bond, and when she's kidnapped he's consumed by fury and will stop at nothing to save her life.", 146, "English", "/v8H6dPqXhHWW137ubxqD4HdHTib.jpg", 7.4000000000000004, new DateTime(2004, 4, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), "Man on Fire" },
                    { 9516, null, "R", "Sobering and incisive, this cautionary drama centers on a street tough 18-year-old facing a moral quandary while trying to turn his life around.", 97, "English", "/3LMphX9ZcidYfdAyBYrjJQUtHZq.jpg", 7.5, new DateTime(1993, 5, 26, 0, 0, 0, 0, DateTimeKind.Unspecified), "Menace II Society" },
                    { 9539, null, "R", "A young woman’s quest for revenge against the people who kidnapped and tortured her as a child leads her and her best friend, also a victim of child abuse, on a terrifying journey into a living hell of depravity.", 99, "French", "/AtKUBX1POUsCNf74VA1wtxdyDzG.jpg", 7.2999999999999998, new DateTime(2008, 9, 3, 0, 0, 0, 0, DateTimeKind.Unspecified), "Martyrs" },
                    { 9549, null, "PG", "A chronicle of the original Mercury astronauts in the formation of America's space program: Alan Shepherd, the first American in space; Gus Grissom, the benighted astronaut for whom nothing works out as planned; John Glenn, the straight-arrow 'boy scout' of the bunch who was the first American to orbit the earth; and the remaining pilots: Deke Slayton, Scott Carpenter and Wally Schirra.", 193, "English", "/btqTjNRxecYgQ1FGfVlLqSSNjz.jpg", 7.5, new DateTime(1983, 10, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Right Stuff" },
                    { 9550, null, "PG-13", "In 9th century China, a corrupt government wages war against a rebel army called the Flying Daggers. A romantic warrior breaks a beautiful rebel out of prison to help her rejoin her fellows, but things are not what they seem.", 119, "Mandarin", "/unwvBq1MjoT1wbVqu8hpIt3B2iZ.jpg", 7.2999999999999998, new DateTime(2004, 5, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), "House of Flying Daggers" },
                    { 9552, null, "R", "12-year-old Regan MacNeil begins to adapt an explicit new personality as strange events befall the local area of Georgetown. Her mother becomes torn between science and superstition in a desperate bid to save her daughter, and ultimately turns to her last hope: Father Damien Karras, a troubled priest who is struggling with his own faith.", 122, "English", "/4ucLGcXVVSVnsfkGtbLY4XAius8.jpg", 7.7000000000000002, new DateTime(1973, 5, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Exorcist" },
                    { 9559, null, "PG-13", "A kidnapped boy strikes up a friendship with his captor: an escaped convict on the run from the law, headed by an honorable U.S. Marshal.", 138, "English", "/kWX2CYM5TbWaZwll4ysh7OjVUmJ.jpg", 7.5, new DateTime(1993, 11, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), "A Perfect World" },
                    { 9571, null, "R", "The adventures of a group of Texas teens on their last day of school in 1976, centering on student Randall Floyd, who moves easily among stoners, jocks and geeks. Floyd is a star athlete, but he also likes smoking weed, which presents a conundrum when his football coach demands he sign a \"no drugs\" pledge.", 102, "English", "/yJDJ2svbSHECzhr5tEV9JZTblhV.jpg", 7.4000000000000004, new DateTime(1993, 9, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), "Dazed and Confused" },
                    { 9587, null, "PG", "With their father away as a chaplain in the Civil War, Jo, Meg, Beth and Amy grow up with their mother in somewhat reduced circumstances. They are a close family who inevitably have their squabbles and tragedies. But the bond holds even when, later, male friends start to become a part of the household.", 115, "English", "/1ZzH1XMcKAe5NdrKL5MfcqZHHsZ.jpg", 7.2999999999999998, new DateTime(1994, 12, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), "Little Women" },
                    { 9589, null, "R", "This movie portrays the drug scene in Berlin in the 70s, following tape recordings of Christiane F. 14 years old Christiane lives with her mother and little sister in a typical multi-storey apartment building in Berlin. She's fascinated by the 'Sound', a new disco with most modern equipment. Although she's legally too young, she asks a friend to take her. There she meets Detlef, who's in a clique where everybody's on drugs. Step by step she gets drawn deeper into the scene.", 131, "German", "/pxjCfoKO48JJN7L3QieYGOwWDig.jpg", 7.2999999999999998, new DateTime(1981, 4, 2, 0, 0, 0, 0, DateTimeKind.Unspecified), "Christiane F." },
                    { 9603, null, "PG-13", "Shallow, rich and socially successful Cher is at the top of her Beverly Hills high school's pecking scale. Seeing herself as a matchmaker, Cher first coaxes two teachers into dating each other. Emboldened by her success, she decides to give hopelessly klutzy new student Tai a makeover. When Tai becomes more popular than she is, Cher realizes that her disapproving ex-stepbrother was right about how misguided she was -- and falls for him.", 97, "English", "/8AwVTcgpTnmeOs4TdTWqcFDXEsA.jpg", 7.2999999999999998, new DateTime(1995, 7, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), "Clueless" },
                    { 9609, null, "PG-13", "Two drifters, one a gentle but slow giant, try to make money working the fields during the Depression so they can fulfill their dreams.", 110, "English", "/suX9HIS22oJf0qoZV7DUvDWtWnV.jpg", 7.2999999999999998, new DateTime(1992, 9, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), "Of Mice and Men" },
                    { 9652, null, "PG-13", "David Locke is a world-weary American journalist who has been sent to cover a conflict in northern Africa, but he makes little progress with the story. When he discovers the body of a stranger who looks similar to him, Locke assumes the dead man's identity. However, he soon finds out that the man was an arms dealer, leading Locke into dangerous situations. Aided by a beautiful woman, Locke attempts to avoid both the police and criminals out to get him.", 126, "Italian", "/rakeEvAOCyvm00qRkdCYRjtlfvQ.jpg", 7.4000000000000004, new DateTime(1975, 2, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Passenger" },
                    { 9662, null, "PG-13", "When her grandson is kidnapped during the Tour de France, Madame Souza and her beloved pooch Bruno team up with the Belleville Sisters--an aged song-and-dance team from the days of Fred Astaire--to rescue him.", 80, "French", "/flHYQswYEIvBL2QsQLEJJzTJDyS.jpg", 7.4000000000000004, new DateTime(2003, 6, 11, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Triplets of Belleville" },
                    { 9665, null, "R", "Robert Gould Shaw leads the US Civil War's first all-black volunteer company, fighting prejudices of both his own Union army and the Confederates.", 122, "English", "/pGDzBjZvzmSCIEduQBfESLMiwtp.jpg", 7.5, new DateTime(1989, 12, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Glory" },
                    { 9693, null, "R", "In 2027, in a chaotic world in which humans can no longer procreate, a former activist agrees to help transport a miraculously pregnant woman to a sanctuary at sea, where her child's birth may help scientists save the future of humankind.", 109, "English", "/k9IAS4TehZFcKi4HVByxZNPfqex.jpg", 7.5999999999999996, new DateTime(2006, 9, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), "Children of Men" },
                    { 9702, null, "R", "Based on the true life experiences of poet Jimmy Santiago Baca, the film focuses on half-brothers Paco and Cruz, and their bi-racial cousin Miklo. It opens in 1972, as the three are members of an East L.A. gang known as the \"Vatos Locos\", and the story focuses on how a violent crime and the influence of narcotics alter their lives. Miklo is incarcerated and sent to San Quentin, where he makes a \"home\" for himself. Cruz becomes an exceptional artist, but a heroin addiction overcomes him with tragic results. Paco becomes a cop and an enemy to his \"carnal\", Miklo.", 180, "English", "/gvP6R6juhe2IpCG7QGDgjyUvm0g.jpg", 8.0999999999999996, new DateTime(1993, 2, 5, 0, 0, 0, 0, DateTimeKind.Unspecified), "Bound by Honor" },
                    { 9764, null, "G", "A military explorer meets and befriends a Goldi man in Russia’s unmapped forests. A deep and abiding bond evolves between the two men, one civilized in the usual sense, the other at home in the glacial Siberian woods.", 141, "Russian", "/i6Z4A77eO22hD0rOUu7NlCMdZBr.jpg", 8.1999999999999993, new DateTime(1975, 8, 2, 0, 0, 0, 0, DateTimeKind.Unspecified), "Dersu Uzala" },
                    { 9800, null, "PG-13", "Two competing lawyers join forces to sue a prestigious law firm for AIDS discrimination. As their unlikely friendship develops their courage overcomes the prejudice and corruption of their powerful adversaries.", 126, "English", "/tFe5Yoo5zT495okA49bq1vPPkiV.jpg", 7.7999999999999998, new DateTime(1993, 12, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), "Philadelphia" },
                    { 9806, null, "PG", "Bob Parr has given up his superhero days to log in time as an insurance adjuster and raise his three children with his formerly heroic wife in suburbia. But when he receives a mysterious assignment, it's time to get back into costume.", 115, "English", "/2LqaLgk4Z226KkgPJuiOQ58wvrm.jpg", 7.7000000000000002, new DateTime(2004, 11, 5, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Incredibles" },
                    { 9833, null, "PG-13", "Deformed since birth, a bitter man known only as the Phantom lives in the sewers underneath the Paris Opera House. He falls in love with the obscure chorus singer Christine, and privately tutors her while terrorizing the rest of the opera house and demanding Christine be given lead roles. Things get worse when Christine meets back up with her childhood acquaintance Raoul and the two fall in love", 143, "English", "/aTsp2VTaCBiGs8w05OTXfD97FRZ.jpg", 7.2999999999999998, new DateTime(2004, 12, 8, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Phantom of the Opera" },
                    { 9912, null, "PG-13", "The life story of New Zealander Burt Munro, who spent years building a 1920 Indian motorcycle—a bike which helped him set the land-speed world record at Utah's Bonneville Salt Flats in 1967.", 127, "English", "/vUIwPFAAXeCUuS040uGC0xSatcG.jpg", 7.5999999999999996, new DateTime(2005, 10, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), "The World's Fastest Indian" },
                    { 9918, null, "PG", "In 1966, Texas Western coach Don Haskins led the first all-black starting line-up for a college basketball team to the NCAA national championship.", 118, "English", "/bGRSV5tStxDNPRLCewnOeeiZzrY.jpg", 7.5, new DateTime(2006, 1, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), "Glory Road" }
                });

            migrationBuilder.InsertData(
                table: "Movies",
                columns: new[] { "Id", "ActorId", "Certification", "Description", "Duration", "Language", "Picture", "Ratings", "ReleaseDate", "Title" },
                values: new object[,]
                {
                    { 10009, null, "G", "When an impulsive boy named Kenai is magically transformed into a bear, he must literally walk in another's footsteps until he learns some valuable life lessons. His courageous and often zany journey introduces him to a forest full of wildlife, including the lovable bear cub Koda, hilarious moose Rutt and Tuke, woolly mammoths and rambunctious rams.", 85, "English", "/9VvLgj28J5m04y5gO0mt5np4yF8.jpg", 7.2000000000000002, new DateTime(2003, 10, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), "Brother Bear" },
                    { 10020, null, "G", "Follow the adventures of Belle, a bright young woman who finds herself in the castle of a prince who's been turned into a mysterious beast. With the help of the castle's enchanted staff, Belle soon learns the most important lesson of all -- that true beauty comes from within.", 84, "English", "/fVf2YzecYSjY19hXkd2RhrEL7mI.jpg", 7.7000000000000002, new DateTime(1991, 11, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), "Beauty and the Beast" },
                    { 10024, null, "PG-13", "Sara and Brian live an idyllic life with their young son and daughter. But their family is rocked by sudden, heartbreaking news that forces them to make a difficult and unorthodox choice in order to save their baby girl's life. The parents' desperate decision raises both ethical and moral questions and rips away at the foundation of their relationship. Their actions ultimately set off a court case that threatens to tear the family apart, while revealing surprising truths that challenge everyone's perceptions of love and loyalty and give new meaning to the definition of healing.", 109, "English", "/atRGqnG7pe0hZP97RWDLrT2hRGZ.jpg", 7.4000000000000004, new DateTime(2009, 6, 26, 0, 0, 0, 0, DateTimeKind.Unspecified), "My Sister's Keeper" },
                    { 10086, null, "18", "The activities of rampaging, indiscriminate serial killer Ben are recorded by a willingly complicit documentary team, who eventually become his accomplices and active participants. Ben provides casual commentary on the nature of his work and arbitrary musings on topics of interest to him, such as music or the conditions of low-income housing, and even goes so far as to introduce the documentary crew to his family. But their reckless indulgences soon get the better of them.", 96, "French", "/lrIjWsdDO03wdKHV9cSqNNkINtt.jpg", 7.4000000000000004, new DateTime(1992, 8, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), "Man Bites Dog" },
                    { 10098, null, "NR", "A tramp cares for a boy after he's abandoned as a newborn by his mother. Later the mother has a change of heart and aches to be reunited with her son.", 53, "English", "/drgMcyTsySQBnUPGaBThCHGdlWT.jpg", 8.1999999999999993, new DateTime(1921, 1, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Kid" },
                    { 10110, null, "PG", "Jamie Graham, a privileged English boy, is living in Shanghai when the Japanese invade and force all foreigners into prison camps. Jamie is captured with an American sailor, who looks out for him while they are in the camp together. Even though he is separated from his parents and in a hostile environment, Jamie maintains his dignity and youthful spirits, providing a beacon of hope for the others held captive with him.", 153, "English", "/gEaCzjwHoPgyQFcwHql7o5YLHAU.jpg", 7.5, new DateTime(1987, 12, 9, 0, 0, 0, 0, DateTimeKind.Unspecified), "Empire of the Sun" },
                    { 10112, null, "G", "When Madame Adelaide Bonfamille leaves her fortune to Duchess and her children—Bonfamille’s beloved family of cats—the butler plots to steal the money and kidnaps the legatees, leaving them out on a country road. All seems lost until the wily Thomas O’Malley Cat and his jazz-playing alley cats come to the aristocats’ rescue.", 78, "English", "/1BVOSmQUhphMgnTxnXyfQ9tL1Sc.jpg", 7.2999999999999998, new DateTime(1970, 12, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Aristocats" },
                    { 10139, null, "R", "The true story of Harvey Milk, the first openly gay man ever elected to public office. In San Francisco in the late 1970s, Harvey Milk becomes an activist for gay rights and inspires others to join him in his fight for equal rights that should be available to all Americans.", 128, "English", "/ot4ImF4b7QbS6XsTdMH3pWxNmX2.jpg", 7.2999999999999998, new DateTime(2008, 11, 5, 0, 0, 0, 0, DateTimeKind.Unspecified), "Milk" },
                    { 10144, null, "G", "This colorful adventure tells the story of an impetuous mermaid princess named Ariel who falls in love with the very human Prince Eric and puts everything on the line for the chance to be with him. Memorable songs and characters -- including the villainous sea witch Ursula.", 83, "English", "/9nJ9rm6RwYgIggnGVy8Dej4olef.jpg", 7.4000000000000004, new DateTime(1989, 11, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Little Mermaid" },
                    { 10149, null, "R", "Writer Paul Benjamin is nearly hit by a bus when he leaves Auggie Wren's smoke shop. Stranger Rashid Cole  saves his life, and soon middle-aged Paul tells homeless Rashid that he wouldn't mind a short-term housemate. Still grieving over his wife's murder, Paul is moved by both Rashid's quest to reconnect with his father and Auggie's discovery that a woman who might be his daughter is about to give birth.", 112, "English", "/phvnN7OPEnlHoAZe8nsSqPDD8B0.jpg", 7.2000000000000002, new DateTime(1995, 6, 9, 0, 0, 0, 0, DateTimeKind.Unspecified), "Smoke" },
                    { 10161, null, "R", "In this true story told through flashbacks, Christy Brown is born with crippling cerebral palsy into a poor, working-class Irish family. Able only to control movement in his left foot and to speak in guttural sounds, he is mistakenly believed to have a intellectual disability for the first ten years of his life.", 103, "English", "/GRAAl0bMQFoFIjV3aunc5jsM5u.jpg", 7.5999999999999996, new DateTime(1989, 4, 7, 0, 0, 0, 0, DateTimeKind.Unspecified), "My Left Foot: The Story of Christy Brown" },
                    { 10191, null, "PG", "As the son of a Viking leader on the cusp of manhood, shy Hiccup Horrendous Haddock III faces a rite of passage: he must kill a dragon to prove his warrior mettle. But after downing a feared dragon, he realizes that he no longer wants to destroy it, and instead befriends the beast – which he names Toothless – much to the chagrin of his warrior father", 98, "English", "/ygGmAO60t8GyqUo9xYeYxSZAR3b.jpg", 7.7999999999999998, new DateTime(2010, 3, 10, 0, 0, 0, 0, DateTimeKind.Unspecified), "How to Train Your Dragon" },
                    { 10193, null, "G", "Woody, Buzz, and the rest of Andy's toys haven't been played with in years. With Andy about to go to college, the gang find themselves accidentally left at a nefarious day care center. The toys must band together to escape and return home to Andy.", 103, "English", "/4cpGytCB0eqvRks4FAlJoUJiFPG.jpg", 7.7999999999999998, new DateTime(2010, 6, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), "Toy Story 3" },
                    { 10227, null, "e 10", "Clumsy Monsieur Hulot finds himself perplexed by the intimidating complexity of a gadget-filled Paris. He attempts to meet with a business contact but soon becomes lost. His roundabout journey parallels that of an American tourist, and as they weave through the inventive urban environment, they intermittently meet, developing an interest in one another. They eventually get together at a chaotic restaurant, along with several other quirky characters.", 115, "French", "/kQOrS0DLUXYsqPMedM2G6NJcJBq.jpg", 7.7999999999999998, new DateTime(1967, 12, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), "PlayTime" },
                    { 10229, null, "PG", "When the popular, restless Landon Carter is forced to participate in the school drama production he falls in love with Jamie Sullivan, the daughter of the town's minister. Jamie has a \"to-do\" list for her life and also a very big secret she must keep from Landon.", 101, "English", "/8lUYMvWdHA0Q0k5F76RQCeCBUkA.jpg", 7.7000000000000002, new DateTime(2002, 1, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "A Walk to Remember" },
                    { 10234, null, "R", "Two psychotic young men take a mother, father, and son hostage in their vacation cabin and force them to play sadistic \"games\" with one another for their own amusement.", 109, "German", "/o8Sxq6dYiYDuH5N6NjjPTTE6oIN.jpg", 7.4000000000000004, new DateTime(1997, 5, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), "Funny Games" },
                    { 10238, null, "R", "As Agnes slowly dies of cancer, her sisters are so deeply immersed in their own psychic pains that they can't offer her the support she needs. Maria is wracked with guilt at her husband's attempted suicide, caused by his discovery of her extramarital affair. The self-loathing, suicidal Karin seems to regard her sister with revulsion. Only Anna, the deeply religious maid who lost her young child, seems able to offer Agnes solace and empathy.", 95, "Swedish", "/a1bMgB09YDvvRN9SitCclUYragr.jpg", 8.0, new DateTime(1972, 12, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), "Cries and Whispers" },
                    { 10242, null, "NR", "Two aging film actresses live as virtual recluses in an old Hollywood mansion. Jane Hudson, a successful child star, cares for her crippled sister Blanche, whose career in later years eclipsed that of Jane. Now the two live together, their relationship affected by simmering subconscious thoughts of mutual envy, hate and revenge.", 135, "English", "/u8iJz5KqSPuTFE7yPbJwyzF0zHs.jpg", 8.0, new DateTime(1962, 10, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "What Ever Happened to Baby Jane?" },
                    { 10312, null, "PG-13", "The true story of Dr. Hunter \"Patch\" Adams, who in the 1970s found that humor is the best medicine, and was willing to do just anything to make his patients laugh—even if it meant risking his own career.", 115, "English", "/xN1aKur5ddWQSXTqvzDPJD2TCxe.jpg", 7.2999999999999998, new DateTime(1998, 12, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "Patch Adams" },
                    { 10315, null, "PG", "The Fantastic Mr. Fox bored with his current life, plans a heist against the three local farmers. The farmers, tired of sharing their chickens with the sly fox, seek revenge against him and his family.", 87, "English", "/njbTizADSZg4PqeyJdDzZGooikv.jpg", 7.7000000000000002, new DateTime(2009, 10, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), "Fantastic Mr. Fox" },
                    { 10322, null, "PG", "A simple-minded gardener named Chance has spent all his life in the Washington D.C. house of an old man. When the man dies, Chance is put out on the street with no knowledge of the world except what he has learned from television.", 130, "English", "/yFHi5wiCB45loSa1D1O6KAFMC3A.jpg", 7.7000000000000002, new DateTime(1979, 12, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), "Being There" },
                    { 10331, null, "NR", "A group of people try to survive an attack of bloodthirsty zombies while trapped in a rural Pennsylvania farmhouse.", 96, "English", "/rSBkU4g4uvZQIMOSpvrmvR4VwhA.jpg", 7.7000000000000002, new DateTime(1968, 10, 4, 0, 0, 0, 0, DateTimeKind.Unspecified), "Night of the Living Dead" },
                    { 10360, null, "MA15+", "The story of Bobby Sands, the IRA member who led the 1981 hunger strike during The Troubles in which Irish Republican prisoners tried to win political status.", 96, "English", "/gXSZaacDkHTmvJJvq0VwsbqlHXI.jpg", 7.2999999999999998, new DateTime(2008, 5, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Hunger" },
                    { 10363, null, "PG-13", "Tom Ripley is a talented mimic, moocher, forger and all-around criminal improviser; but there's more to Tom Ripley than even he can guess.", 115, "French", "/7n1KNXs4OFfeVLjJ3g10M8oK1fM.jpg", 7.5999999999999996, new DateTime(1960, 3, 10, 0, 0, 0, 0, DateTimeKind.Unspecified), "Purple Noon" },
                    { 10376, null, "R", "The story of a virtuoso piano player who lives his entire life aboard an ocean liner. Born and raised on the ship, 1900 (Tim Roth) learned about the outside world through interactions with passengers, never setting foot on land, even for the love of his life. Years later, the ship may be destroyed, and a former band member fears that 1900 may still be aboard, willing to go down with the ship.", 120, "Italian", "/iOcbJ5pxokOPDRgieVDbsFMrCc6.jpg", 8.3000000000000007, new DateTime(1998, 10, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Legend of 1900" },
                    { 10377, null, "R", "Two carefree pals traveling through Alabama are mistakenly arrested, and charged with murder. Fortunately, one of them has a cousin who's a lawyer - Vincent Gambini, a former auto mechanic from Brooklyn who just passed his bar exam after his sixth try. When he arrives with his leather-clad girlfriend , to try his first case, it's a real shock - for him and the Deep South!", 120, "English", "/iwSURa8nS2ujwrU3s1lfxxX7voH.jpg", 7.5, new DateTime(1992, 3, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), "My Cousin Vinny" },
                    { 10386, null, "PG", "In the small town of Rockwell, Maine in October 1957, a giant metal machine befriends a nine-year-old boy and ultimately finds its humanity by unselfishly saving people from their own fears and prejudices.", 86, "English", "/kPwxXszZDhCShmb82tCjkV15XsV.jpg", 7.9000000000000004, new DateTime(1999, 8, 6, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Iron Giant" },
                    { 10400, null, "R", "The story of Rubin \"Hurricane\" Carter, a boxer wrongly imprisoned for murder, and the people who aided in his fight to prove his innocence.", 146, "English", "/zhnxjsNnnpsBMF5V1H7Pzkec45Y.jpg", 7.4000000000000004, new DateTime(1999, 9, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Hurricane" },
                    { 10404, null, "U", "China in the 1920s. After her father's death, 19 year old Songlian is forced to marry the much older lord of a powerful family. With three wives already, each living in a separate house within the great castle, there is fierce competition for his attention and the privileges that are gained. This competition gets out of hand...", 125, "Mandarin", "/j6MGZpg55cTqlHHwahBtzI2qQg1.jpg", 8.0, new DateTime(1991, 12, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), "Raise the Red Lantern" },
                    { 10435, null, "PG-13", "An elderly Charlie Chaplin discusses his autobiography with his editor, recounting his amazing journey from his poverty-stricken childhood to world-wide success after the ingenious invention of the Little Tramp.", 143, "English", "/yEbD5ibsuZOZF522bb3RXtOYg35.jpg", 7.4000000000000004, new DateTime(1992, 2, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), "Chaplin" },
                    { 10437, null, "G", "A retelling of the classic Dickens tale of Ebenezer Scrooge, miser extraordinaire. He is held accountable for his dastardly ways during night-time visitations by the Ghosts of Christmas Past, Present, and future.", 85, "English", "/ssrV29QSVVJuemBHho0Qx7pFYak.jpg", 7.4000000000000004, new DateTime(1992, 12, 10, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Muppet Christmas Carol" },
                    { 10440, null, "PG", "A middle-aged couple suspects foul play when their neighbor's wife suddenly drops dead.", 104, "English", "/zrzBIlMyAP7Ac9W5qAy5ssAUdK4.jpg", 7.2999999999999998, new DateTime(1993, 5, 2, 0, 0, 0, 0, DateTimeKind.Unspecified), "Manhattan Murder Mystery" },
                    { 10452, null, "16", "The night of August 24, 1572, is known as the Massacre of St. Bartholomew. In France a religious war is raging. In order to impose peace a forced wedding is arranged between Margot de Valois, sister of the immature Catholic King Charles IX, and the Hugenot King Henri of Navarre. Catherine of Medici maintains her behind-the-scenes power by ordering assaults, poisonings, and instigations to incest.", 162, "French", "/vRXtJaEqwHAQTP2m0RnHvBxNCf6.jpg", 7.2999999999999998, new DateTime(1994, 5, 11, 0, 0, 0, 0, DateTimeKind.Unspecified), "Queen Margot" },
                    { 10474, null, "R", "A high school basketball player’s life turns upside down after free-falling into the harrowing world of drug addiction.", 102, "English", "/9qX10tQz0hvppk30CDrz73fZTPQ.jpg", 7.2999999999999998, new DateTime(1995, 4, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Basketball Diaries" },
                    { 10494, null, "R", "A retired pop singer turned actress' sense of reality is shaken when she is stalked by an obsessed fan and seemingly a ghost of her past.", 81, "Japanese", "/79vujbsWEbX4dzffBV541QXN6sf.jpg", 8.1999999999999993, new DateTime(1997, 7, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "Perfect Blue" },
                    { 10501, null, "PG", "After a failed swindle, two con-men end up with a map to El Dorado, the fabled \"city of gold,\" and an unintended trip to the New World.  Much to their surprise, the map does lead the pair to the mythical city, where the startled inhabitants promptly begin to worship them as gods.  The only question is, do they take the worshipful natives for all they're worth, or is there a bit more to El Dorado than riches?", 89, "English", "/ryXm7xp4aqQyda0FU2eMfHehPBg.jpg", 7.2000000000000002, new DateTime(2000, 3, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Road to El Dorado" },
                    { 10511, null, "PG-13", "An Irish immigrant family adjusts to life in the United States, a chance to get over the lost son. They have no money and the apartment is in bad condition.", 105, "English", "/cUhMjWQyyApA0pFinogCsE2wy8g.jpg", 7.2000000000000002, new DateTime(2003, 10, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "In America" },
                    { 10515, null, "PG", "A young boy and a girl with a magic crystal must race against pirates and foreign agents in a search for a legendary floating castle.", 125, "Japanese", "/npOnzAbLh6VOIu3naU5QaEcTepo.jpg", 8.0, new DateTime(1986, 8, 2, 0, 0, 0, 0, DateTimeKind.Unspecified), "Castle in the Sky" },
                    { 10518, null, "R", "A graduate student and obsessive runner in New York is drawn into a mysterious plot involving his brother, a member of the secretive Division.", 125, "English", "/uPNgubSiri2yvBQRPtP77ViYjN.jpg", 7.2999999999999998, new DateTime(1976, 10, 8, 0, 0, 0, 0, DateTimeKind.Unspecified), "Marathon Man" },
                    { 10549, null, "PG-13", "Hamlet, Prince of Denmark, returns home to find his father murdered and his mother now marrying the murderer... his uncle. Meanwhile, war is brewing.", 242, "English", "/ilurgUOp6SCl4cuhfjctj1qxlfZ.jpg", 7.5, new DateTime(1996, 12, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "Hamlet" },
                    { 10604, null, "NR", "An uptight English writer traveling to Crete on a matter of business finds his life changed forever when he meets the gregarious Alexis Zorba.", 142, "Greek", "/jAYOY38TRDprIgu7vgES0FFJJSl.jpg", 7.5, new DateTime(1964, 12, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), "Zorba the Greek" },
                    { 10633, null, "PG-13", "An African American detective is asked to investigate a murder in a racist southern town.", 109, "English", "/fvqHTabYej3LwzKRRZCm6jV3g0O.jpg", 7.7000000000000002, new DateTime(1967, 8, 2, 0, 0, 0, 0, DateTimeKind.Unspecified), "In the Heat of the Night" }
                });

            migrationBuilder.InsertData(
                table: "Movies",
                columns: new[] { "Id", "ActorId", "Certification", "Description", "Duration", "Language", "Picture", "Ratings", "ReleaseDate", "Title" },
                values: new object[,]
                {
                    { 10637, null, "PG", "After leading his football team to 15 winning seasons, coach Bill Yoast is demoted and replaced by Herman Boone – tough, opinionated and as different from the beloved Yoast as he could be. The two men learn to overcome their differences and turn a group of hostile young men into champions.", 113, "English", "/825ohvC4wZ3gCuncCaqkWeQnK8h.jpg", 7.5999999999999996, new DateTime(2000, 9, 29, 0, 0, 0, 0, DateTimeKind.Unspecified), "Remember the Titans" },
                    { 10647, null, "PG-13", "Like some other kids, 12-year-old Trevor McKinney believed in the goodness of human nature. Like many other kids, he was determined to change the world for the better. Unlike most other kids, he succeeded.", 122, "English", "/q5xZpLih6L5rAIcT5r6WYB6Os7F.jpg", 7.2999999999999998, new DateTime(2000, 10, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), "Pay It Forward" },
                    { 10654, null, "PG", "\"Hair\" is a 1979 musical war comedy-drama film adaptation of the 1968 Broadway musical \"Hair: An American Tribal Love-Rock Musical\" about a Vietnam War draftee, Claude, who meets and befriends a tribe of long-haired hippies on his way to the army induction center.  Claude heads to New York upon receiving his draft notice, leaving the family ranch in Oklahoma. He arrives in New York where he is rapidly indoctrinated into the youth subculture before reporting in for boot camp.", 121, "English", "/qrZIlVCL9UyEBsgOGbisNzuWjX.jpg", 7.2999999999999998, new DateTime(1979, 3, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), "Hair" },
                    { 10669, null, "R", "Intent on seeing the Cahulawassee River before it's turned into one huge lake, outdoor fanatic Lewis Medlock takes his friends on a river-rafting trip they'll never forget into the dangerous American back-country.", 109, "English", "/2TrAzNJlHyNYYSkQf6asg3rs2Xr.jpg", 7.2999999999999998, new DateTime(1972, 7, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Deliverance" },
                    { 10674, null, "G", "A tomboyish girl disguises herself as a young man so she can fight with the Imperial Chinese Army against the invading Huns. With help from wise-cracking dragon Mushu, Mulan just might save her country -- and win the heart of handsome Captain Li Shang.", 88, "English", "/bJ0DxWQDLdjSJmFHwtximVdgJ5P.jpg", 7.9000000000000004, new DateTime(1998, 6, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), "Mulan" },
                    { 10681, null, "G", "WALL·E is the last robot left on an Earth that has been overrun with garbage and all humans have fled to outer space. For 700 years he has continued to try and clean up the mess, but has developed some rather interesting human-like qualities. When a ship arrives with a sleek new type of robot, WALL·E thinks he's finally found a friend and stows away on the ship when it leaves.", 98, "English", "/3g8vyePqVatTaUSnrNnrrwguhxM.jpg", 8.0, new DateTime(2008, 6, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), "WALL·E" },
                    { 10683, null, "NR", "The lives of many individuals connected by the desire for happiness, often from sources usually considered dark or evil.", 139, "English", "/rYfUcEV88Z3gENrfYTE6i8yBkDr.jpg", 7.5, new DateTime(1998, 10, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), "Happiness" },
                    { 10693, null, "G", "Leaving the safety of their nursery behind, Wendy, Michael and John follow Peter Pan to a magical world where childhood lasts forever. But while in Neverland, the kids must face Captain Hook and foil his attempts to get rid of Peter for good.", 77, "English", "/6UTZmeQcxbtW32MyR5nKIx7ID4f.jpg", 7.2000000000000002, new DateTime(1953, 2, 5, 0, 0, 0, 0, DateTimeKind.Unspecified), "Peter Pan" },
                    { 10705, null, "PG-13", "Gritty adaption of William Shakespeare's play about the English King's bloody conquest of France.", 137, "English", "/pSHqyWCpXC9cNwxtdkGmWxhvBql.jpg", 7.2999999999999998, new DateTime(1989, 10, 5, 0, 0, 0, 0, DateTimeKind.Unspecified), "Henry V" },
                    { 10722, null, "R", "The story revolves around a Basque Roman Catholic priest dedicated to committing as many sins as possible (Angulo), a death metal salesman from Carabanchel (Segura), and the Italian host of a TV show on the occult (De Razza). These go on a literal \"trip\" through Christmas-time Madrid to hunt for and prevent the reincarnation of the Antichrist.", 103, "Spanish", "/5qfTmgFdTCOYMw4ExtVLgFfjutg.jpg", 7.2999999999999998, new DateTime(1995, 10, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Day of the Beast" },
                    { 10728, null, "6", "God and Satan war over earth; to settle things, they wager on the soul of Faust, a learned and prayerful alchemist.", 116, "German", "/y2zle61QtznvwqnnQcYxXypDZAq.jpg", 8.0, new DateTime(1926, 10, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), "Faust" },
                    { 10734, null, "PG", "San Francisco Bay, January 18, 1960. Frank Lee Morris is transferred to Alcatraz, a maximum security prison located on a rocky island. Although no one has ever managed to escape from there, Frank and other inmates begin to carefully prepare an escape plan.", 113, "English", "/uORr2GXQnyqgBOg6tVsRCJD2qxc.jpg", 7.5, new DateTime(1979, 1, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "Escape From Alcatraz" },
                    { 10747, null, "PG", "After avenging his family's brutal murder, Wales is pursued by a pack of soldiers. He prefers to travel alone, but ragtag outcasts are drawn to him - and Wales can't bring himself to leave them unprotected.", 135, "English", "/92BZIFPbyCPNhExyFScxA3xF1dy.jpg", 7.5, new DateTime(1976, 7, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Outlaw Josey Wales" },
                    { 10754, null, "16", "Jacek climbs into the taxi driven by Waldemar, tells him to drive to a remote location, then brutally strangles him, seemingly without motive.", 85, "Polish", "/k7sk4yNdoXY7iwp1M9QTZuBDiJS.jpg", 7.7000000000000002, new DateTime(1988, 3, 11, 0, 0, 0, 0, DateTimeKind.Unspecified), "A Short Film About Killing" },
                    { 10757, null, "U", "Rahul, the adoptive son of business magnate Yash Raichand, feels eternal gratitude to his father for rescuing him from a life of poverty. Yet, when Yash forbids his love of poor Anjali, Rahul marries her and moves to London with new wife and sister-in-law, breaking the heart of his mother. Ten years later, Rahul's younger brother comes to London intent on brokering peace between father and son.", 210, "Hindi", "/lRl7wrJmkOzMTDVYFSIpUcsIjPQ.jpg", 7.7999999999999998, new DateTime(2001, 12, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), "Kabhi Khushi Kabhie Gham" },
                    { 10774, null, "R", "When veteran anchorman Howard Beale is forced to retire his 25-year post because of his age, he announces to viewers that he will kill himself during his farewell broadcast. Network executives rethink their decision when his fanatical tirade results in a spike in ratings.", 122, "English", "/l3opUgZaoRyu9O1sBRJvsArhcaz.jpg", 7.9000000000000004, new DateTime(1976, 11, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "Network" },
                    { 10775, null, "R", "Chan Wing Yan, a young police officer, has been sent undercover as a mole in the local mafia. Lau Kin Ming, a young mafia member, infiltrates the police force. Years later, their older counterparts, Chen Wing Yan and Inspector Lau Kin Ming, respectively, race against time to expose the mole within their midst.", 101, "Cantonese", "/gix9thDBXfjJ8M7rYbihqbQGBcP.jpg", 7.7999999999999998, new DateTime(2002, 12, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), "Infernal Affairs" },
                    { 10778, null, "R", "A tale of murder, crime and punishment set in the summer of 1949. Ed Crane, a barber in a small California town, is dissatisfied with his life, but his wife Doris' infidelity and a mysterious opportunity presents him with a chance to change it.", 116, "English", "/lrCgt8NNMyFsfmXyXiSSCRXNH4u.jpg", 7.5999999999999996, new DateTime(2001, 10, 26, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Man Who Wasn't There" },
                    { 10784, null, "PG", "Inside the Kit Kat Club of 1931 Berlin, starry-eyed singer Sally Bowles and an impish emcee sound the clarion call to decadent fun, while outside a certain political party grows into a brutal force.", 124, "English", "/1RmUfX3LcS897GhUWrWp5nRADo4.jpg", 7.5, new DateTime(1972, 2, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), "Cabaret" },
                    { 10787, null, "16", "Working in Dr. Cranley’s laboratory, scientist Jack Griffin was always given the latitude to conduct some of his own experiments. His sudden departure, however, has Cranley’s daughter Flora worried about him. Griffin has taken a room at the nearby Lion’s Head Inn, hoping to reverse an experiment he conducted on himself that made him invisible. But the experimental drug has also warped his mind, making him aggressive and dangerous. He’s prepared to do whatever it takes to restore his appearance.", 71, "English", "/a8WoUk92OLHnU5sODmdGaOi5iaH.jpg", 7.5, new DateTime(1933, 11, 3, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Invisible Man" },
                    { 10794, null, "PG", "Hrundi V. Bakshi, an accident-prone actor from India, is accidentally put the name on the guest list for an upcoming party at the home of a Hollywood film director. Unfortunately, from the moment he arrives, one thing after another goes wrong with a compounding affect.", 99, "English", "/pC6FB4fLIVRCpMzIbUf1xOVobmz.jpg", 7.4000000000000004, new DateTime(1968, 4, 4, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Party" },
                    { 10795, null, "NR", "A man receives a mysterious e-mail appearing to be from his wife, who was murdered years earlier. As he frantically tries to find out whether she's alive, he finds himself being implicated in her death.", 131, "French", "/fr2wEeO1H8dzx6EDfzYTRBIvZaE.jpg", 7.2999999999999998, new DateTime(2006, 11, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "Tell No One" },
                    { 10835, null, "R", "Mob assassin Jeffrey is no ordinary hired gun; the best in his business, he views his chosen profession as a calling rather than simply a job. So, when beautiful nightclub chanteuse Jennie is blinded in the crossfire of his most recent hit, Jeffrey chooses to retire after one last job to pay for his unintended victim's sight-restoring operation. But when Jeffrey is double-crossed, he reluctantly joins forces with a rogue policeman to make things right.", 110, "Cantonese", "/8hTxlSqMAHBXAh1eB69ir0BXhzE.jpg", 7.7000000000000002, new DateTime(1989, 7, 6, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Killer" },
                    { 10843, null, "R", "An ordinary word processor has the worst night of his life after he agrees to visit a girl in Soho whom he met that evening at a coffee shop.", 97, "English", "/9NyT0qHwVDsazubfSwLxt6fR7Ym.jpg", 7.5, new DateTime(1985, 9, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), "After Hours" },
                    { 10849, null, "PG", "Cecilia is a waitress in New Jersey, living a dreary life during the Great Depression. Her only escape from her mundane reality is the movie theatre. After losing her job, Cecilia goes to see 'The Purple Rose of Cairo' in hopes of raising her spirits, where she watches dashing archaeologist Tom Baxter time and again.", 82, "English", "/i37qc5kZug85dK3qwgfFvqdky7E.jpg", 7.4000000000000004, new DateTime(1985, 3, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Purple Rose of Cairo" },
                    { 10860, null, "PG", "This heart wrenching drama is about a beauty shop, in Louisana owned by Truvy, and the tragedies of all of her clients.", 119, "English", "/7ExUSN9s9gX9bhVM17zDLEizano.jpg", 7.2999999999999998, new DateTime(1989, 11, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Steel Magnolias" },
                    { 10867, null, "R", "On the day in 1940 that Italy enters the war, two things happen to the 12-year-old Renato: he gets his first bike, and he gets his first look at Malèna. She is a beautiful, silent outsider who's moved to this Sicilian town to be with her husband, Nico. He promptly goes off to war, leaving her to the lustful eyes of the men and the sharp tongues of the women. During the next few years, as Renato grows toward manhood, he watches Malèna suffer and prove her mettle. He sees her loneliness, then grief when Nico is reported dead, the effects of slander on her relationship with her father, her poverty and search for work, and final humiliations. Will Renato learn courage from Malèna and stand up for her?", 109, "Italian", "/zdnjZa9HfBxlQnCX4dqCbbzxsLI.jpg", 7.2999999999999998, new DateTime(2000, 3, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), "Malena" },
                    { 10886, null, "16", "Irena, a Ukrainian woman coming to Italy looking for a job as a maid. She does everything she can to become a beloved nanny for an adorable little girl, Thea. However, that is just the very beginning of her unknown journey.", 118, "Italian", "/piBn5ydvdfCHSfys6N1A7LNwQft.jpg", 7.2999999999999998, new DateTime(2006, 10, 9, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Unknown Woman" },
                    { 10907, null, "PG", "Robin Hood fights nobly for justice against the evil Sir Guy of Gisbourne while striving to win the hand of the beautiful Maid Marian.", 102, "English", "/aiT75HgtN97FOamxOA7qcz4jX2t.jpg", 7.5, new DateTime(1938, 5, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Adventures of Robin Hood" },
                    { 10911, null, "NR", "A team of allied saboteurs are assigned an impossible mission: infiltrate an impregnable Nazi-held island and destroy the two enormous long-range field guns that prevent the rescue of 2,000 trapped British soldiers.", 158, "English", "/7KFvnGCZ3zt0dYPRqsFsiGUH7PR.jpg", 7.4000000000000004, new DateTime(1961, 4, 27, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Guns of Navarone" },
                    { 10950, null, "PG-13", "Although Sam has the mental capacity of a 7-year-old, he has a daughter with a homeless woman who abandons them when they leave the hospital, leaving Sam to raise Lucy on his own. But as Lucy grows up, Sam's limitations start to become a problem and the authorities take her away. Sam shames high-priced lawyer, Rita into taking his case pro bono and in turn teaches her the value of love and family.", 132, "English", "/wSgAn3zhgwuTOhhvvqcdxVqTLts.jpg", 7.5, new DateTime(2001, 12, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), "I Am Sam" },
                    { 10975, null, "PG-13", "Agent Jackie is hired to find WWII Nazi gold hidden in the Sahara desert. He teams up with three bungling women (the 3 stooges?) who are all connected in some way. However a team of mercenaries have ideas on the ownership of the gold. A battle / chase ensues as to who gets there first. Lots of choreographed Kung-Fu and quirky Chan humor.", 106, "Cantonese", "/9EdhTpPj8pZNxG1HPIXhO1CNLMH.jpg", 7.2999999999999998, new DateTime(1991, 2, 7, 0, 0, 0, 0, DateTimeKind.Unspecified), "Operation Condor" },
                    { 10994, null, "PG-13", "A teenager journeys through a series of foster homes after her mother goes to prison for committing a crime of passion.", 109, "English", "/oGJDrJ9gMSs87iwE0sRZrG6EBhf.jpg", 7.2999999999999998, new DateTime(2002, 10, 11, 0, 0, 0, 0, DateTimeKind.Unspecified), "White Oleander" },
                    { 10997, null, "R", "Abandoned by his prostitute mother in 1920, Douzi was raised by a theater troupe. There he meets Shitou and over the following years the two develop an act entitled \"Farewell My Concubine\" that brings them fame and fortune. When Shitou marries Juxian, Doutzi becomes jealous, the beginnings of the acting duo's explosive breakup and tragic fall take root.", 171, "Mandarin", "/nlsYtgAgZMKxpq4TOkGsZuRqBx2.jpg", 8.0, new DateTime(1993, 10, 26, 0, 0, 0, 0, DateTimeKind.Unspecified), "Farewell My Concubine" },
                    { 11005, null, "PG-13", "Dr. Malcolm Sayer, a shy research physician, uses an experimental drug to \"awaken\" the catatonic victims of a rare disease. Leonard is the first patient to receive the controversial treatment. His awakening, filled with awe and enthusiasm, proves a rebirth for Sayer too, as the exuberant patient reveals life's simple but unutterably sweet pleasures to the introverted doctor.", 120, "English", "/9gztZXuHLG6AJ0fgqGd7Q43cWRI.jpg", 7.7999999999999998, new DateTime(1990, 12, 4, 0, 0, 0, 0, DateTimeKind.Unspecified), "Awakenings" },
                    { 11010, null, "M/12", "Simple Italian postman learns to love poetry while delivering mail to a famous poet; he uses this to woo local beauty Beatrice.", 108, "Italian", "/cUaCpjVDefYShKyLmkcDsiPaBHn.jpg", 8.0, new DateTime(1994, 4, 7, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Postman" },
                    { 11016, null, "NR", "A hurricane swells outside, but it's nothing compared to the storm within the hotel at Key Largo. There, sadistic mobster Johnny Rocco holes up - and holds at gunpoint hotel owner James Temple, his widowed daughter-in-law Nora, and ex-GI Frank McCloud.", 100, "English", "/rySfmQQZhS7RswOiJcJrww6FcHy.jpg", 7.5999999999999996, new DateTime(1948, 7, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), "Key Largo" },
                    { 11020, null, "PG", "In the early 1900s, Miranda attends a girls boarding school in Australia. One Valentine's Day, the school's typically strict headmistress treats the girls to a picnic field trip to an unusual but scenic volcanic formation called Hanging Rock. Despite rules against it, Miranda and several other girls venture off. It's not until the end of the day that the faculty realizes the girls and one of the teachers have disappeared mysteriously.", 117, "English", "/7BAXwmFN4pZDNb9N6kzmAAwdssi.jpg", 7.2999999999999998, new DateTime(1975, 9, 2, 0, 0, 0, 0, DateTimeKind.Unspecified), "Picnic at Hanging Rock" },
                    { 11030, null, "PG", "Fictional documentary about the life of human chameleon Leonard Zelig, a man who becomes a celebrity in the 1920s due to his ability to look and act like whoever is around him. Clever editing places Zelig in real newsreel footage of Woodrow Wilson, Babe Ruth, and others.", 79, "English", "/fnOZEV7DmWSM1XgmWs4EgrpSvn1.jpg", 7.5, new DateTime(1983, 7, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Zelig" },
                    { 11031, null, "R", "\"This Is Spinal Tap\" shines a light on the self-contained universe of a metal band struggling to get back on the charts, including everything from its complicated history of ups and downs, gold albums, name changes and undersold concert dates, along with the full host of requisite groupies, promoters, hangers-on and historians, sessions, release events and those special behind-the-scenes moments that keep it all real.", 82, "English", "/z2LA8eBTSuuPC4NBhIZRNIwpimH.jpg", 7.5, new DateTime(1984, 5, 4, 0, 0, 0, 0, DateTimeKind.Unspecified), "This Is Spinal Tap" },
                    { 11036, null, "PG-13", "An epic love story centered around an older man who reads aloud to a woman with Alzheimer's. From a faded notebook, the old man's words bring to life the story about a couple who is separated by World War II, and is then passionately reunited, seven years later, after they have taken different paths.", 123, "English", "/rNzQyW4f8B8cQeg7Dgj3n6eT5k9.jpg", 7.9000000000000004, new DateTime(2004, 6, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Notebook" },
                    { 11040, null, "PG-13", "Jack Crabb, looking back from extreme old age, tells of his life being raised by Indians and fighting with General Custer.", 139, "English", "/pLvUVqadEI9cPrRlTru6ee71EWU.jpg", 7.5999999999999996, new DateTime(1970, 12, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), "Little Big Man" }
                });

            migrationBuilder.InsertData(
                table: "Movies",
                columns: new[] { "Id", "ActorId", "Certification", "Description", "Duration", "Language", "Picture", "Ratings", "ReleaseDate", "Title" },
                values: new object[,]
                {
                    { 11044, null, "R", "An Innuit hunter races his sled home with a fresh-caught halibut. This fish pervades the entire film, in real and imaginary form. Meanwhile, Axel tags fish in New York as a naturalist's gofer. He's happy there, but a messenger arrives to bring him to Arizona for his uncle's wedding. It's a ruse to get Axel into the family business. In Arizona, Axel meets two odd women: vivacious, needy, and plagued by neuroses and familial discord. He gets romantically involved with one, while the other, rich but depressed, plays accordion tunes to a gaggle of pet turtles", 142, "English", "/tk10wjRTYSzik5iApNPCIQdpozs.jpg", 7.2999999999999998, new DateTime(1993, 1, 6, 0, 0, 0, 0, DateTimeKind.Unspecified), "Arizona Dream" },
                    { 11046, null, "PG", "World War II is raging, and an American general has been captured and is being held hostage in the Schloss Adler, a Bavarian castle that's nearly impossible to breach. It's up to a group of skilled Allied soldiers to liberate the general before it's too late.", 155, "English", "/dnyiVS4Ad4w4rfS4Bm1YalEdonx.jpg", 7.5999999999999996, new DateTime(1968, 12, 4, 0, 0, 0, 0, DateTimeKind.Unspecified), "Where Eagles Dare" },
                    { 11049, null, "PG", "Four talented alien musicians are kidnapped by a record producer who disguises them as humans. Shep, a space pilot in love with bass player Stella, follows them to Earth. Reprogrammed to forget their real identities and renamed The Crescendolls, the group quickly becomes a huge success playing soulless corporate pop. At a concert, Shep manages to free all the musicians except Stella, and the band sets out to rediscover who they really are -- and to rescue Stella.", 68, "Japanese", "/AsvPgdcSlHocAbMp3yGZXjPiKKF.jpg", 7.9000000000000004, new DateTime(2003, 5, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), "Interstella 5555: The 5tory of the 5ecret 5tar 5ystem" },
                    { 11072, null, "R", "A town—where everyone seems to be named Johnson—stands in the way of the railroad. In order to grab their land, robber baron Hedley Lemar sends his henchmen to make life in the town unbearable. After the sheriff is killed, the town demands a new sheriff from the Governor, so Hedley convinces him to send the town the first black sheriff in the west.", 93, "English", "/nb1MLEOXVFBKTM4J9GLoksqgDBk.jpg", 7.2999999999999998, new DateTime(1974, 2, 7, 0, 0, 0, 0, DateTimeKind.Unspecified), "Blazing Saddles" },
                    { 11101, null, "12", "\"Stalingrad\" follows the progress of a German Platoon through the brutal fighting of the Battle of Stalingrad. After having half their number wiped out and after being placed under the command of a sadistic Captain, the Lieutenant of the platoon leads his men to desert. The men of the platoon attempt to escape from the city which is now surrounded by the Soviet Army.", 134, "German", "/bIYx88ZLP95FtDUrVd9fEeUyAK9.jpg", 7.2999999999999998, new DateTime(1993, 1, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), "Stalingrad" },
                    { 11104, null, "PG-13", "Two melancholic Hong Kong policemen fall in love: one with a mysterious underworld figure, the other with a beautiful and ethereal server at a late-night restaurant he frequents.", 103, "Cantonese", "/43I9DcNoCzpyzK8JCkJYpHqHqGG.jpg", 8.0, new DateTime(1994, 7, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), "Chungking Express" },
                    { 11113, null, "G", "A snobbish phonetics professor agrees to a wager that he can take a flower girl and make her presentable in high society.", 170, "English", "/bTXVc29lGSNclf94VIZ49W4gGKl.jpg", 7.5999999999999996, new DateTime(1964, 10, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), "My Fair Lady" },
                    { 11159, null, "15", "With both her adoptive parents now dead, a Black optometrist decides to make contact with her birth mother, but is shocked to find out that she is white.", 142, "English", "/mfWfW6DfD4oBTFmGAndaTkuPUO5.jpg", 7.5, new DateTime(1996, 5, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), "Secrets & Lies" },
                    { 11167, null, "12", "Loner Mark Lewis works at a film studio during the day and, at night, takes racy photographs of women. Also he's making a documentary on fear, which involves recording the reactions of victims as he murders them. He befriends Helen, the daughter of the family living in the apartment below his, and he tells her vaguely about the movie he is making.", 101, "English", "/tqV6rCGWTQkQcKox6msBedyQC18.jpg", 7.5, new DateTime(1960, 5, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), "Peeping Tom" },
                    { 11171, null, "NC-17", "A teenage hustler and a young man obsessed with alien abductions cross paths, together discovering a horrible, liberating truth.", 108, "English", "/wgSwDqhl6Rt3cuSCwt5sNpPna3x.jpg", 7.5, new DateTime(2004, 5, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), "Mysterious Skin" },
                    { 11178, null, "12", "A dweeby, mild-mannered man comes to the aid of a drunk young woman on a subway platform. Little does he know how much trouble he’s in for…", 123, "Korean", "/xoT7YL5sxBvonPQRL5zMojt3aNg.jpg", 7.5, new DateTime(2001, 7, 27, 0, 0, 0, 0, DateTimeKind.Unspecified), "My Sassy Girl" },
                    { 11190, null, "11", "A story of two Russian boys whose father suddenly returns home after a 12-year absence. He takes the boys on a holiday to a remote island on a lake that turns into a test of manhood of almost mythic proportions.", 110, "Russian", "/7V8iHBs34cPYw7ohpLqliF9x8Gv.jpg", 7.5999999999999996, new DateTime(2003, 6, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Return" },
                    { 11197, null, "NR", "Stockholm, the fifties. Though academically bright, violent pupil Erik Ponti is expelled from his state school with the headmaster’s words “there’s only one word for people like you – evil… what you need is a good thrashing, and more”. In fact already Erik frequently receives a ‘good’ thrashing at the hands of his sadistic stepfather – so he is packed off by his mother to boardingschool", 113, "Swedish", "/gruXA29fquPuRHbam75kXQMaGju.jpg", 7.2999999999999998, new DateTime(2003, 5, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), "Evil" },
                    { 11202, null, "PG", "\"Patton\" tells the tale of General George S. Patton, famous tank commander of World War II. The film begins with patton's career in North Africa and progresses through the invasion of Germany and the fall of the Third Reich. Side plots also speak of Patton's numerous faults such his temper and habit towards insubordination.", 172, "English", "/rLM7jIEPTjj4CF7F1IrzzNjLUCu.jpg", 7.5, new DateTime(1970, 1, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "Patton" },
                    { 11206, null, "NR", "After a flight back home, Sam Hendrix returns with a doll he innocently acquired along the way. As it turns out, the doll is actually stuffed with heroin, and a group of criminals led by the ruthless Roat has followed Hendrix back to his place to retrieve it. When Hendrix leaves for business, the crooks make their move -- and find his blind wife, Susy, alone in the apartment. Soon, a life-threatening game begins between Susy and the thugs.", 108, "English", "/cNW3ewCB52KkxzSE47PcE5Bqvmr.jpg", 7.4000000000000004, new DateTime(1967, 10, 26, 0, 0, 0, 0, DateTimeKind.Unspecified), "Wait Until Dark" },
                    { 11216, null, "PG", "A filmmaker recalls his childhood, when he fell in love with the movies at his village's theater and formed a deep friendship with the theater's projectionist.", 124, "Italian", "/8SRUfRUi6x4O68n0VCbDNRa6iGL.jpg", 8.5, new DateTime(1988, 11, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), "Cinema Paradiso" },
                    { 11220, null, "15", "In this bifurcated crime narrative, a disillusioned hitman attempts to escape from his violent lifestyle against the wishes of his partner, who is infatuated with him, and an eccentric mute repeatedly encounters, then subsequently falls for a depressed woman looking for the prostitute who supposedly stole her ex-boyfriend's affections.", 98, "Cantonese", "/yyM9BPdwttK5LKZSLvHae7QPKo1.jpg", 7.7000000000000002, new DateTime(1995, 9, 6, 0, 0, 0, 0, DateTimeKind.Unspecified), "Fallen Angels" },
                    { 11230, null, "PG-13", "A mischievous young man is sent to hone his martial arts skills with an older, alcoholic kung fu master.", 111, "Cantonese", "/cf43J2SH8tECZVl9N5n0Q6Ckche.jpg", 7.2999999999999998, new DateTime(1978, 10, 5, 0, 0, 0, 0, DateTimeKind.Unspecified), "Drunken Master" },
                    { 11236, null, "G", "A young British girl born and reared in India loses her neglectful parents in an earthquake. She is returned to England to live at her uncle's castle. Her uncle is very distant due to the loss of his wife ten years before. Neglected once again, she begins exploring the estate and discovers a garden that has been locked and neglected. Aided by one of the servants' boys, she begins restoring the garden, and eventually discovers some other secrets of the manor.", 102, "English", "/2B8yOYHrp0AopX3gk4b7jWH3Q5a.jpg", 7.2999999999999998, new DateTime(1993, 8, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Secret Garden" },
                    { 11293, null, "PG", "During the Great Depression, a con man finds himself saddled with a young girl—who may or may not be his daughter—and the two forge an unlikely partnership.", 102, "English", "/3GHG0kTcBWHKdXjj3RdK8GjBCd6.jpg", 7.9000000000000004, new DateTime(1973, 5, 9, 0, 0, 0, 0, DateTimeKind.Unspecified), "Paper Moon" },
                    { 11299, null, "R", "The year is 2071. Following a terrorist bombing, a deadly virus is released on the populace of Mars and the government has issued the largest bounty in history, for the capture of whoever is behind it. The bounty hunter crew of the spaceship Bebop; Spike, Faye, Jet and Ed, take the case with hopes of cashing in the bounty. However, the mystery surrounding the man responsible, Vincent, goes deeper than they ever imagined, and they aren't the only ones hunting him.", 115, "Japanese", "/7i9sIU6ASTw2zwvvNuM0FJzmpKs.jpg", 7.7000000000000002, new DateTime(2001, 9, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "Cowboy Bebop: The Movie" },
                    { 11305, null, "R", "In Memphis, Tennessee, over the course of a single night, the Arcade Hotel, run by an eccentric night clerk and a clueless bellboy, is visited by a young Japanese couple traveling in search of the roots of rock; an Italian woman in mourning who stumbles upon a fleeing charlatan girl; and a comical trio of accidental thieves looking for a place to hide…", 106, "English", "/f11xq7dBGhz9UDc3dabldAGeXVH.jpg", 7.2999999999999998, new DateTime(1989, 9, 6, 0, 0, 0, 0, DateTimeKind.Unspecified), "Mystery Train" },
                    { 11321, null, "PG-13", "An IRS agent with a fateful secret embarks on an extraordinary journey of redemption by forever changing the lives of seven strangers.", 123, "English", "/pCVpsCEYtvtlg1I9h3rtglKgThu.jpg", 7.5999999999999996, new DateTime(2008, 12, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), "Seven Pounds" },
                    { 11324, null, "R", "World War II soldier-turned-U.S. Marshal Teddy Daniels investigates the disappearance of a patient from a hospital for the criminally insane, but his efforts are compromised by his troubling visions and also by a mysterious doctor.", 138, "English", "/kve20tXwUZpu4GUX8l6X7Z4jmL6.jpg", 8.1999999999999993, new DateTime(2010, 2, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), "Shutter Island" },
                    { 11327, null, "R", "Billy Hayes is caught attempting to smuggle drugs out of Turkey. The Turkish courts decide to make an example of him, sentencing him to more than 30 years in prison. Hayes has two opportunities for release: the appeals made by his lawyer, his family, and the American government, or the \"Midnight Express\".", 121, "English", "/vtXJf6DP2rk1yDx369MSAvwl9Cs.jpg", 7.5999999999999996, new DateTime(1978, 8, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Midnight Express" },
                    { 11330, null, "15", "In this third installment of the 'Pusher' trilogy, we follow Milo, the drug lord from the two first films. He is aging, he is planning his daughter's 25th birthday and his shipment of heroin turns out to be 10.000 pills of ecstasy. When Milo tries to sell the pills anyway, all Hell breaks loose and his only chance is to ask for help from his ex-henchman and old friend Radovan", 108, "Danish", "/1Uem8i51uivMGRmajCEmmNCBEmu.jpg", 7.2999999999999998, new DateTime(2005, 8, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), "Pusher III" },
                    { 11344, null, "18", "Kim Sun-woo is an enforcer and manager for a hotel owned by a cold, calculative crime boss, Kang who assigns Sun-Woo to a simple errand while he is away on a business trip; to shadow his young mistress, Heesoo, for fear that she may be cheating on him with a younger man with the mandate that he must kill them both if he discovers their affair.", 120, "Korean", "/nXxEcDxMSC0x2LtGfZs701FYHyN.jpg", 7.5999999999999996, new DateTime(2005, 3, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "A Bittersweet Life" },
                    { 11349, null, "NR", "Sam Bowden witnesses a rape committed by Max Cady and testifies against him. When released after 8 years in prison, Cady begins stalking Bowden and his family but is always clever enough not to violate the law.", 105, "English", "/y5ewkEGCSomX8EeDMemsrlU3Rdy.jpg", 7.5, new DateTime(1962, 4, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), "Cape Fear" },
                    { 11356, null, "G", "In New York, Felix, a neurotic news writer who just broke up with his wife, is urged by his chaotic friend Oscar, a sports journalist, to move in with him, but their lifestyles are as different as night and day are, so Felix's ideas about housekeeping soon begin to irritate Oscar.", 106, "English", "/oo1qNDo9SGx1yYiJ35CgIIVla3a.jpg", 7.5999999999999996, new DateTime(1968, 5, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Odd Couple" },
                    { 11362, null, "PG-13", "Edmond Dantés's life and plans to marry the beautiful Mercedes are shattered when his best friend, Fernand, deceives him. After spending 13 miserable years in prison, Dantés escapes with the help of a fellow inmate and plots his revenge, cleverly insinuating himself into the French nobility.", 131, "English", "/aoKzR82lgcle1NmlayZ9wURhwFa.jpg", 7.5999999999999996, new DateTime(2002, 1, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Count of Monte Cristo" },
                    { 11368, null, "R", "The owner of a seedy small-town Texas bar discovers that one of his employees is having an affair with his wife. A chaotic chain of misunderstandings, lies and mischief ensues after he devises a plot to have them murdered.", 97, "English", "/n8D1gVXUgmW4kkDzUzzoezAmUUa.jpg", 7.4000000000000004, new DateTime(1984, 9, 7, 0, 0, 0, 0, DateTimeKind.Unspecified), "Blood Simple" },
                    { 11416, null, "PG", "When a Spanish Jesuit goes into the South American wilderness to build a mission in the hope of converting the Indians of the region, a slave hunter is converted and joins his mission. When Spain sells the colony to Portugal, they are forced to defend all they have built against the Portugese aggressors.", 126, "English", "/5p63Lw35ivwcOfzax6AvjcoFzFh.jpg", 7.4000000000000004, new DateTime(1986, 9, 29, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Mission" },
                    { 11421, null, "NR", "A story of two love affairs. A father's love for his five sons. And one son's love for his father, a love so strong it compels him to live a lie. That son is Zac Beaulieu, born on the 25th of December 1960, different from all his brothers, but desperate to fit in. During the next 20 years, life takes Zac on a surprising and unexpected journey that ultimately leads him to accept his true nature and, even more importantly, leads his father to love him for who he really is.", 127, "French", "/inbU8Yg54ycgx4kRXx2LkDupCPY.jpg", 7.5999999999999996, new DateTime(2005, 5, 27, 0, 0, 0, 0, DateTimeKind.Unspecified), "C.R.A.Z.Y." },
                    { 11423, null, "15", "1986 Gyunggi Province. The body of a young woman is found brutally raped and murdered. Two months later, a series of rapes and murders commences under similar circumstances. And in a country that had never known such crimes, the dark whispers about a serial murderer grow louder. A special task force is set up in the area, with two local detectives Park Doo-Man and Jo Young-Goo joined by a detective from Seoul who requested to be assigned to the case.", 131, "Korean", "/lp3Qzzq1zzy6ToJul9DGBBd8ua1.jpg", 8.0999999999999996, new DateTime(2003, 5, 2, 0, 0, 0, 0, DateTimeKind.Unspecified), "Memories of Murder" },
                    { 11426, null, "NR", "In 1941 Hawaii, a private is cruelly punished for not boxing on his unit's team, while his captain's wife and second in command are falling in love.", 118, "English", "/aNOE27x6C4yeAW9Y2vPnM2OR0Ql.jpg", 7.2999999999999998, new DateTime(1953, 8, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), "From Here to Eternity" },
                    { 11450, null, "PG-13", "Lawyer Richard Goodwin discovers that 'Twenty-One', a successful TV quiz show, is rigged and decides to expose the team behind the show.", 133, "English", "/yoGJo1h3Hl2exXPVcG9UXWDENtX.jpg", 7.2999999999999998, new DateTime(1994, 8, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "Quiz Show" },
                    { 11471, null, "R", "A reforming ex-gangster tries to reconcile with his estranged policeman brother, but the ties to his former gang are difficult to break.", 95, "Mandarin", "/bvkaWqq2txWdpxJC9tIvF3rbqxJ.jpg", 7.5, new DateTime(1986, 8, 2, 0, 0, 0, 0, DateTimeKind.Unspecified), "A Better Tomorrow" },
                    { 11474, null, "R", "Prominent gang leader Cyrus calls a meeting of New York's gangs to set aside their turf wars and take over the city. At the meeting, a rival leader kills Cyrus, but a Coney Island gang called the Warriors is wrongly blamed for Cyrus' death. Before you know it, the cops and every gangbanger in town is hot on the Warriors' trail.", 93, "English", "/fCDXAJcPvpsMd5CL1kBKkkNGW3X.jpg", 7.7000000000000002, new DateTime(1979, 2, 9, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Warriors" },
                    { 11481, null, "NR", "Beautiful young manicurist Carole suffers from androphobia (the pathological fear of interaction with men). When her sister and roommate, Helen, leaves their London flat to go on an Italian holiday with her married boyfriend, Carole withdraws into her apartment. She begins to experience frightful hallucinations, her fear gradually mutating into madness.", 105, "English", "/goeiyoq9mlvcq0HmpRQsuApa9QZ.jpg", 7.5, new DateTime(1965, 6, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "Repulsion" },
                    { 11482, null, "R", "A quiet and inconspicuous man rents an apartment in France where the previous tenant committed suicide, and begins to suspect his landlord and neighbors are trying to subtly change him into the last tenant so that he too will kill himself.", 125, "French", "/ochT2dykUUsk7RGrJjnJItLvreO.jpg", 7.7000000000000002, new DateTime(1976, 5, 26, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Tenant" },
                    { 11499, null, "R", "For three years after being forced from office, Nixon remained silent. But in summer 1977, the steely, cunning former commander-in-chief agreed to sit for one all-inclusive interview to confront the questions of his time in office and the Watergate scandal that ended his presidency. Nixon surprised everyone in selecting Frost as his televised confessor, intending to easily outfox the breezy British showman and secure a place in the hearts and minds of Americans. Likewise, Frost's team harboured doubts about their boss's ability to hold his own. But as the cameras rolled, a charged battle of wits resulted.", 122, "English", "/nLrRrHZQ40tWqLTY3kxgS4x7GUw.jpg", 7.2999999999999998, new DateTime(2008, 10, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Frost/Nixon" },
                    { 11502, null, "NR", "On their way to an afternoon on the lake, husband and wife Andrzej and Krystyna nearly run over a young hitchhiker. Inviting the young man onto the boat with them, Andrzej begins to subtly torment him; the hitchhiker responds by making overtures toward Krystyna. When the hitchhiker is accidentally knocked overboard, the husband's panic results in unexpected consequences. This was the first feature directed by Roman Polanski.", 94, "Polish", "/tkdeCwZhy9hzzVjZFjw0RPGWUIg.jpg", 7.2000000000000002, new DateTime(1962, 3, 9, 0, 0, 0, 0, DateTimeKind.Unspecified), "Knife in the Water" }
                });

            migrationBuilder.InsertData(
                table: "Movies",
                columns: new[] { "Id", "ActorId", "Certification", "Description", "Duration", "Language", "Picture", "Ratings", "ReleaseDate", "Title" },
                values: new object[,]
                {
                    { 11506, null, "15", "Traveling through an unnamed European country on the brink of war, sickly, intellectual Ester, her sister Anna and Anna's young son, Johan, check into a near-empty hotel. A basic inability to communicate among the three seems only to worsen during their stay. Anna provokes her sister by enjoying a dalliance with a local man, while the boy, left to himself, has a series of enigmatic encounters that heighten the growing air of isolation.", 95, "Swedish", "/zgTxBxd2q0X6AKFgk2HQ90HaXJu.jpg", 7.5999999999999996, new DateTime(1963, 9, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Silence" },
                    { 11528, null, "PG", "In the summer of 1962, a new kid in town is taken under the wing of a young baseball prodigy and his rowdy team, resulting in many adventures.", 101, "English", "/dQkE6saKpkBxKsuGG2bU3CXQwMX.jpg", 7.5, new DateTime(1993, 4, 7, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Sandlot" },
                    { 11537, null, "PG", "Everyone abuses and humiliates a downtrodden orphan (Chan) until he befriends an old man, who turns out to be the last master of the \"snake fist\" fighting style. Jackie becomes the old man's student and finds himself in battle with the master of the \"eagle's claw\" style, who has vowed to destroy the snake fist clan.", 98, "Cantonese", "/7NhjRt8IgQVKw2FgBP1MzzSu5Qv.jpg", 7.2999999999999998, new DateTime(1978, 3, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "Snake in the Eagle's Shadow" },
                    { 11544, null, "PG", "As Stitch, a runaway genetic experiment from a faraway planet, wreaks havoc on the Hawaiian Islands, he becomes the mischievous adopted alien \"puppy\" of an independent little girl named Lilo and learns about loyalty, friendship, and 'ohana, the Hawaiian tradition of family.", 85, "English", "/d73UqZWyw3MUMpeaFcENgLZ2kWS.jpg", 7.5, new DateTime(2002, 6, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), "Lilo & Stitch" },
                    { 11545, null, "R", "When a beautiful first-grade teacher arrives at a prep school, she soon attracts the attention of an ambitious teenager named Max, who quickly falls in love with her. Max turns to the father of two of his schoolmates for advice on how to woo the teacher. However, the situation soon gets complicated when Max's new friend becomes involved with her, setting the two pals against one another in a war for her attention.", 93, "English", "/dfSdVJRvye1npQYCHMD9hKfYhhy.jpg", 7.4000000000000004, new DateTime(1998, 12, 11, 0, 0, 0, 0, DateTimeKind.Unspecified), "Rushmore" },
                    { 11549, null, "NR", "A small-town doctor learns that the population of his community is being replaced by emotionless alien duplicates.", 80, "English", "/mheETi9JZKa8VNkdXBxuKlTWuAh.jpg", 7.5, new DateTime(1956, 2, 5, 0, 0, 0, 0, DateTimeKind.Unspecified), "Invasion of the Body Snatchers" },
                    { 11562, null, "PG-13", "An ophthalmologist's mistress threatens to reveal their affair to his wife, while a married documentary filmmaker is infatuated by another woman.", 104, "English", "/6vC6MLYUICH57MmEVi1UaNaj2Qs.jpg", 7.5999999999999996, new DateTime(1989, 10, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), "Crimes and Misdemeanors" },
                    { 11577, null, "R", "Pat Garrett is hired as a lawman on behalf of a group of wealthy New Mexico cattle barons to bring down his old friend Billy the Kid.", 106, "English", "/eUZbn652KXfWMwh6Oe4PdeJfKuS.jpg", 7.2999999999999998, new DateTime(1973, 5, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), "Pat Garrett & Billy the Kid" },
                    { 11589, null, "PG", "A misfit group of World War II American soldiers goes AWOL to rob a bank behind German lines.", 144, "English", "/hleMxFKSC42yT0TClS4G29HV11n.jpg", 7.4000000000000004, new DateTime(1970, 6, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), "Kelly's Heroes" },
                    { 11602, null, "15", "Karin hopes to recover from her recent stay at a mental hospital by spending the summer at her family's cottage on a tiny island. Her husband, Martin, cares for her but is frustrated by her physical withdrawal. Her younger brother, Minus, is confused by Karin's vulnerability and his own budding sexuality. Their father, David, cannot overcome his haughty remoteness. Beset by visions, Karin descends further into madness.", 91, "Swedish", "/rYD30Fm4vAcBqk1kTsxHw1s8P29.jpg", 7.9000000000000004, new DateTime(1961, 6, 6, 0, 0, 0, 0, DateTimeKind.Unspecified), "Through a Glass Darkly" },
                    { 11610, null, "PG", "A mild mannered film critic is dumped by his wife and his ego is crushed. His hero persona is the tough guy played by Humphrey Bogart in many of his movies and the apparition of Bogart begins showing up to give him advice. With the encouragement of his two married friends, he actually tries dating again, with less than satisfactory results, until he relaxes.", 85, "English", "/yTN2zBb64cQjjLpFR6FGWWc9nKG.jpg", 7.5999999999999996, new DateTime(1972, 5, 4, 0, 0, 0, 0, DateTimeKind.Unspecified), "Play It Again, Sam" },
                    { 11615, null, "R", "A man against capital punishment is accused of murdering a fellow activist and is sent to death row.", 130, "English", "/9vN7ww3Qc179gaSFUjYkGJjSJLQ.jpg", 7.4000000000000004, new DateTime(2003, 2, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Life of David Gale" },
                    { 11621, null, "PG", "In Italy in the 1930s, sky pirates in biplanes terrorize wealthy cruise ships as they sail the Adriatic Sea. The only pilot brave enough to stop the scourge is the mysterious Porco Rosso, a former World War I flying ace who was somehow turned into a pig during the war. As he prepares to battle the pirate crew's American ace, Porco Rosso enlists the help of spunky girl mechanic Fio Piccolo and his longtime friend Madame Gina.", 94, "Japanese", "/byKAndF6KQSDpGxp1mTr23jPbYp.jpg", 7.7999999999999998, new DateTime(1992, 7, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), "Porco Rosso" },
                    { 11644, null, "R", "Jack Terry is a master sound recordist who works on grade-B horror movies. Late one evening, he is recording sounds for use in his movies when he hears something unexpected through his sound equipment and records it. Curiosity gets the better of him when the media become involved, and he begins to unravel the pieces of a nefarious conspiracy. As he struggles to survive against his shadowy enemies and expose the truth, he does not know whom he can trust.", 108, "English", "/gauWJfmA63L2k60u0UbDyUCVSwI.jpg", 7.2999999999999998, new DateTime(1981, 7, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), "Blow Out" },
                    { 11645, null, "R", "With Ran, legendary director Akira Kurosawa reimagines Shakespeare's King Lear as a singular historical epic set in sixteenth-century Japan. Majestic in scope, the film is Kurosawa's late-life masterpiece, a profound examination of the folly of war and the crumbling of one family under the weight of betrayal, greed, and the insatiable thirst for power.", 160, "Japanese", "/jK7aLEh1StwcLBK22NCHuDmCq90.jpg", 8.0999999999999996, new DateTime(1985, 6, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "Ran" },
                    { 11656, null, "15", "Devout Christians Töre and Märeta send their only daughter, the virginal Karin, and their foster daughter, the unrepentant Ingeri, to deliver candles to a distant church. On their way through the woods, the girls encounter a group of savage goat herders who brutally rape and murder Karin as Ingeri remains hidden. When the killers unwittingly seek refuge in the farmhouse of Töre and Märeta, Töre plots a fitting revenge.", 90, "Swedish", "/aYhl4Ybhw6VQm32ze6qyWylcUQm.jpg", 7.9000000000000004, new DateTime(1960, 2, 8, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Virgin Spring" },
                    { 11657, null, "U", "When French criminal Corey gets released from prison, he resolves to never return. He is quickly pulled back into the underworld, however, after a chance encounter with escaped murderer Vogel. Along with former policeman and current alcoholic Jansen, they plot an intricate jewel heist. All the while, quirky Police Commissioner Mattei, who was the one to lose custody of Vogel, is determined to find him.", 140, "French", "/sTqNuY39TpVEFbrtIAM9Zldxnt4.jpg", 7.5999999999999996, new DateTime(1970, 10, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), "Le Cercle Rouge" },
                    { 11658, null, "R", "When two brothers are forced to fight in the Korean War, the elder decides to take the riskiest missions if it will help shield the younger from battle.", 149, "Korean", "/vyG8qpimh3XSlxc6OmPq8LJRJl.jpg", 8.0, new DateTime(2004, 2, 5, 0, 0, 0, 0, DateTimeKind.Unspecified), "Tae Guk Gi: The Brotherhood of War" },
                    { 11659, null, "R", "Spanning nearly four decades, from 1966 to 2003, this generational epic follows the different life paths of two Italian brothers from a middle-class family through some of the most significant events of recent Italian history.", 366, "Italian", "/ltmcFRvTeAgBgMLUGa15KzDSQqs.jpg", 8.3000000000000007, new DateTime(2003, 6, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Best of Youth" },
                    { 11661, null, "PG-13", "France, 1914, during World War I. On Christmas Eve, an extraordinary event takes place in the bloody no man's land that the French and the Scots dispute with the Germans…", 116, "French", "/9Ka8lKCIiWjnZiMslPQeakS5UhW.jpg", 7.4000000000000004, new DateTime(2005, 11, 9, 0, 0, 0, 0, DateTimeKind.Unspecified), "Joyeux Noel" },
                    { 11663, null, "R", "Jimmy Rabbitte, just a tick out of school, gets a brilliant idea: to put a soul band together in Barrytown, his slum home in north Dublin. First he needs musicians and singers: things slowly start to click when he finds three fine-voiced females virtually in his back yard, a lead singer (Deco) at a wedding, and, responding to his ad, an aging trumpet player, Joey \"The Lips\" Fagan.", 118, "English", "/1voMaFayTb1KaIRKqEC8y5oaHFE.jpg", 7.2999999999999998, new DateTime(1991, 8, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Commitments" },
                    { 11673, null, "PG-13", "Embarrassed by his large nose, a romantic poet/soldier romances his cousin by proxy.", 137, "French", "/5v214T8VMGNnPTaGCqlZJtV5jav.jpg", 7.2999999999999998, new DateTime(1990, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "Cyrano de Bergerac" },
                    { 11686, null, "PG", "Set in 19th-century Russia, Allen is a cowardly serf drafted into the Napoleonic war, who would rather write poetry and obsess over his beautiful but pretentious cousin. Allen's cowardice serves him well when he hides in a cannon and is shot into a tent of French soldiers, making him a national hero. A hilarious parody of Russian literature, Love and Death is a must-see for fans of Allen's films.", 85, "English", "/oJXFd1UHZoOQ1UtoLxbyBLGJDox.jpg", 7.7000000000000002, new DateTime(1975, 6, 10, 0, 0, 0, 0, DateTimeKind.Unspecified), "Love and Death" },
                    { 11688, null, "G", "Kuzco is a self-centered emperor who summons Pacha from a village and to tell him that his home will be destroyed to make room for Kuzco's new summer home. Kuzco's advisor, Yzma, tries to poison Kuzco and accidentally turns him into a llama, who accidentally ends up in Pacha's village. Pacha offers to help Kuzco if he doesn't destroy his house, and so they form an unlikely partnership.", 78, "English", "/wwbgkXQBEKtnyIJapk6gUgWkVw8.jpg", 7.5, new DateTime(2000, 12, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Emperor's New Groove" },
                    { 11697, null, "PG-13", "A senator, who became famous for killing a notorious outlaw, returns for the funeral of an old friend and tells the truth about his deed.", 123, "English", "/cEv3vMnUKreaM16C07ygEXR4u1y.jpg", 7.7000000000000002, new DateTime(1962, 4, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Man Who Shot Liberty Valance" },
                    { 11704, null, "G", "A widowed field mouse must move her family -- including an ailing son -- to escape a farmer's plow. Aided by a crow and a pack of superintelligent, escaped lab rats, the brave mother struggles to transplant her home to firmer ground.", 82, "English", "/bqH0pbnt92C8WJ3lwLhllQZndeY.jpg", 7.5, new DateTime(1982, 6, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Secret of NIMH" },
                    { 11712, null, "NR", "Toshiro Mifune swaggers and snarls to brilliant comic effect in Kurosawa's tightly paced, beautifully composed \"Sanjuro.\" In this companion piece and sequel to \"Yojimbo,\" jaded samurai Sanjuro helps an idealistic group of young warriors weed out their clan's evil influences, and in the process turns their image of a proper samurai on its ear.", 96, "Japanese", "/zW47oIH3bc3ggmmmzTvKqM4Fqjk.jpg", 8.0, new DateTime(1962, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "Sanjuro" },
                    { 11713, null, "R", "Chen Zhen returns to the international compound of China only to learn of his beloved teacher's death. This is compounded by the continual racist harassment by the Japanese population in the area. Unlike his friends, he confronts it head on with his mastery of martial arts while investigating his teacher's murder.", 108, "Mandarin", "/mqhooEqZvo7eJoLsTstXbxbsG63.jpg", 7.2999999999999998, new DateTime(1972, 3, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), "Fist of Fury" },
                    { 11773, null, "NR", "In a small English village everyone suddenly falls unconscious. When they awake every woman of child bearing age is pregnant. The resulting children have the same strange blond hair, eyes and a strong connection to each other.", 77, "English", "/8aKOlvk7GGwprapNJQ4EzsbESZ1.jpg", 7.2999999999999998, new DateTime(1960, 6, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), "Village of the Damned" },
                    { 11778, null, "R", "A group of working-class friends decide to enlist in the Army during the Vietnam War and finds it to be hellish chaos -- not the noble venture they imagined. Before they left, Steven married his pregnant girlfriend -- and Michael and Nick were in love with the same woman. But all three are different men upon their return.", 184, "English", "/wT3DeCZ3Ax5VYhKu6ajyEvA1hXG.jpg", 8.0, new DateTime(1978, 3, 9, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Deer Hunter" },
                    { 11782, null, "R", "A cop who loses his partner in a shoot-out with gun smugglers goes on a mission to catch them. In order to get closer to the leaders of the ring he joins forces with an undercover cop who's working as a gangster hitman. They use all means of excessive force to find them.", 126, "Cantonese", "/9MRkgYjjUqd7eP2UOqFVOF0S5vd.jpg", 7.5999999999999996, new DateTime(1992, 4, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), "Hard Boiled" },
                    { 11787, null, "e Livre", "The story of Elwood P. Dowd who makes friends with a spirit taking the form of a human-sized rabbit named Harvey that only he sees (and a few privileged others on occasion also.) After his sister tries to commit him to a mental institution, a comedy of errors ensues. Elwood and Harvey become the catalysts for a family mending its wounds and for romance blossoming in unexpected places.", 104, "English", "/dgd82hYmpiXDM1G867HqNaWe8wj.jpg", 7.7000000000000002, new DateTime(1950, 12, 4, 0, 0, 0, 0, DateTimeKind.Unspecified), "Harvey" },
                    { 11798, null, "NR", "A story about a troubled boy growing up in England, set in 1983. He comes across a few skinheads on his way home from school, after a fight. They become his new best friends, even like family. Based on experiences of director Shane Meadows.", 101, "English", "/eULrtiN6kw61JgJCezy9lc3ygsP.jpg", 7.5, new DateTime(2006, 9, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), "This Is England" },
                    { 11816, null, "PG", "For Norman and Ethel Thayer, this summer on golden pond is filled with conflict and resolution. When their daughter Chelsea arrives, the family is forced to renew the bonds of love and overcome the generational friction that has existed for years. Norman must find his way through his anger and fear of growing old, while Chelsea struggles to rebuild their relationship. Ethel's consistent support of her \"Knight in shining armor\" is inspirational in its simplicity. This is a movie to ponder and always keep in your heart.", 109, "English", "/ic4f03J6pnf9cpQmVDABFhUpbCU.jpg", 7.2999999999999998, new DateTime(1981, 12, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "On Golden Pond" },
                    { 11829, null, "PG", "The two brothers Trinity and Bambino are exchanged by two federal agents and take advantage of the situation to steal a huge booty hidden in a monastery by a gang of outlaws.", 117, "Italian", "/5dRaKhuNJvuGq0udMmGTI9bF8Sz.jpg", 7.5, new DateTime(1971, 10, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), "Trinity Is Still My Name" },
                    { 11841, null, "M", "The anti-Ching patriots, under the guidance of Ho Kuang-han, have secretly set up their base in Canton, disguised as school masters. During a brutal Manchu attack, Lui manages to escape, and devotes himself to learning the martial arts in order to seek revenge.", 115, "Cantonese", "/hv29eb8g7iCDr0WgAcDdwZinuoY.jpg", 7.5, new DateTime(1978, 2, 2, 0, 0, 0, 0, DateTimeKind.Unspecified), "The 36th Chamber of Shaolin" },
                    { 11850, null, "PG", "Matthew Bennell notices that several of his friends are complaining that their close relatives are in some way different. When questioned later they themselves seem changed, as they deny everything or make lame excuses. As the invaders increase in number they become more open and Bennell, who has by now witnessed an attempted 'replacement', realises that he and his friends must escape or suffer the same fate.", 116, "English", "/5oNHdVo0vTsaC47Jv2Wb4eeo4V4.jpg", 7.2000000000000002, new DateTime(1978, 12, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), "Invasion of the Body Snatchers" },
                    { 11854, null, "U", "Anjali is left heartbroken when her best friend and secret crush, Rahul, falls in love with Tina. Years later, Tina's young daughter tries to fulfil her mother's last wish of uniting Rahul and Anjali.", 185, "Hindi", "/5FmtHHDGPofW5Zjns1EM1D8503c.jpg", 7.7000000000000002, new DateTime(1998, 10, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), "Kuch Kuch Hota Hai" },
                    { 11868, null, "NR", "After Jonathan Harker attacks Dracula at his castle, the vampire travels to a nearby city, where he preys on the family of Harker's fiancée. The only one who may be able to protect them is Dr. van Helsing, Harker's friend and fellow-student of vampires, who is determined to destroy Dracula, whatever the cost.", 82, "English", "/1L45hwUu1P4NRhbRRrE5d9oHamm.jpg", 7.2000000000000002, new DateTime(1958, 5, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), "Dracula" },
                    { 11878, null, "NR", "A nameless ronin, or samurai with no master, enters a small village in feudal Japan where two rival businessmen are struggling for control of the local gambling trade. Taking the name Sanjuro Kuwabatake, the ronin convinces both silk merchant Tazaemon and sake merchant Tokuemon to hire him as a personal bodyguard, then artfully sets in motion a full-scale gang war between the two ambitious and unscrupulous men.", 110, "Japanese", "/tN7kYPjRhDolpui9sc9Eq9n5b2O.jpg", 8.1999999999999993, new DateTime(1961, 4, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "Yojimbo" },
                    { 11881, null, "NR", "Kris Kringle, seemingly the embodiment of Santa Claus, is asked to portray the jolly old fellow at Macy's following his performance in the Thanksgiving Day parade. His portrayal is so complete that many begin to question if he truly is Santa Claus, while others question his sanity.", 96, "English", "/v9rDydAqGrhFtXpvMXjVDmw7atZ.jpg", 7.4000000000000004, new DateTime(1947, 6, 11, 0, 0, 0, 0, DateTimeKind.Unspecified), "Miracle on 34th Street" },
                    { 11886, null, "G", "With King Richard off to the Crusades, Prince John and his slithering minion, Sir Hiss, set about taxing Nottingham's citizens with support from the corrupt sheriff - and staunch opposition by the wily Robin Hood and his band of merry men.", 83, "English", "/x9AvkYek0bGdxQSZ8W3lAjGrREm.jpg", 7.2999999999999998, new DateTime(1973, 11, 8, 0, 0, 0, 0, DateTimeKind.Unspecified), "Robin Hood" }
                });

            migrationBuilder.InsertData(
                table: "Movies",
                columns: new[] { "Id", "ActorId", "Certification", "Description", "Duration", "Language", "Picture", "Ratings", "ReleaseDate", "Title" },
                values: new object[,]
                {
                    { 11898, null, "U", "When his mother eloped with an Italian opera singer, Louis Mazzini was cut off from her aristocratic family. After the family refuses to let her be buried in the family mausoleum, Louis avenges his mother's death by attempting to murder every family member who stands between himself and the family fortune. But when he finds himself torn between his longtime love and the widow of one of his victims, his plans go awry.", 104, "English", "/eBvpyRjD3DcCsWgdV6Y9oqPS7dO.jpg", 7.7000000000000002, new DateTime(1949, 6, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), "Kind Hearts and Coronets" },
                    { 11901, null, "R", "A gunfighting stranger comes to the small settlement of Lago. After gunning down three gunmen who tried to kill him, the townsfolk decide to hire the Stranger to hold off three outlaws who are on their way.", 105, "English", "/oGLFi7D8PlPYKXzbPtp8qCseJFn.jpg", 7.5, new DateTime(1973, 4, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), "High Plains Drifter" },
                    { 11902, null, "16", "Black marketeers Marko and Blacky manufacture and sell weapons to the Communist resistance in WWII Belgrade, living the good life along the way. Marko's surreal duplicity propels him up the ranks of the Communist Party, and he eventually abandons Blacky and steals his girlfriend. After a lengthy stay in a below-ground shelter, the couple reemerges during the Yugoslavian Civil War of the 1990s as Marko realizes that the situation is ripe for exploitation.", 170, "Serbian", "/8Uz28500yRt9ZJpT5hKOkuu18pl.jpg", 7.7999999999999998, new DateTime(1995, 4, 11, 0, 0, 0, 0, DateTimeKind.Unspecified), "Underground" },
                    { 11906, null, "R", "An American newcomer to a prestigious German ballet academy comes to realize that the school is a front for something sinister amid a series of grisly murders.", 99, "Italian", "/5ya8jTbNZTrCFUx9OwpNBjCivXY.jpg", 7.5, new DateTime(1977, 2, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "Suspiria" },
                    { 11943, null, "PG", "A mountain man who wishes to live the life of a hermit becomes the unwilling object of a long vendetta by Indians when he proves to be the match of their warriors in one-to-one combat on the early frontier.", 108, "English", "/tFiA48c0pqDAv34r9TB4OVGntZz.jpg", 7.2999999999999998, new DateTime(1972, 9, 10, 0, 0, 0, 0, DateTimeKind.Unspecified), "Jeremiah Johnson" },
                    { 11948, null, "R", "Island of Java, 1942, during World War II. British Major Jack Celliers arrives at a Japanese prison camp, run by the strict Captain Yonoi. Colonel John Lawrence, who has a profound knowledge of Japanese culture, and Sergeant Hara, brutal and simpleton, will witness the struggle of wills between two men from very different backgrounds who are tragically destined to clash.", 124, "Japanese", "/aWafmO9YSYww8rXbKOgCrtzjyJv.jpg", 7.4000000000000004, new DateTime(1983, 5, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), "Merry Christmas, Mr. Lawrence" },
                    { 11951, null, "R", "Kowalski works for a car delivery service, and takes delivery of a 1970 Dodge Challenger to drive from Colorado to San Francisco. Shortly after pickup, he takes a bet to get the car there in less than 15 hours.", 99, "English", "/oz6F2cD7DLh3V7QnfyNTEB9EDmR.jpg", 7.2000000000000002, new DateTime(1971, 1, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Vanishing Point" },
                    { 11953, null, "PG", "Akira Kurosawa's lauded feudal epic presents the tale of a petty thief who is recruited to impersonate Shingen, an aging warlord, in order to avoid attacks by competing clans. When Shingen dies, his generals reluctantly agree to have the impostor take over as the powerful ruler. He soon begins to appreciate life as Shingen, but his commitment to the role is tested when he must lead his troops into battle against the forces of a rival warlord.", 180, "Japanese", "/92Jv6K8prJ3LvNrO9GzB3VCpC1w.jpg", 7.7999999999999998, new DateTime(1980, 4, 26, 0, 0, 0, 0, DateTimeKind.Unspecified), "Kagemusha" },
                    { 11963, null, "R", "A bookish CIA researcher finds all his co-workers dead, and must outwit those responsible until he figures out who he can really trust.", 117, "English", "/zinwtZqdb7gnc4zMu8dfkK1fMN3.jpg", 7.2999999999999998, new DateTime(1975, 9, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), "Three Days of the Condor" },
                    { 11969, null, "R", "Legendary marshal Wyatt Earp, now a weary gunfighter, joins his brothers Morgan and Virgil to pursue their collective fortune in the thriving mining town of Tombstone. But Earp is forced to don a badge again and get help from his notorious pal Doc Holliday when a gang of renegade brigands and rustlers begins terrorizing the town.", 130, "English", "/wu1VoC8qPJ89jaZM394xt8G3s1Y.jpg", 7.5999999999999996, new DateTime(1993, 12, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "Tombstone" },
                    { 11970, null, "G", "Bestowed with superhuman strength, a young mortal named Hercules sets out to prove himself a hero in the eyes of his father, the great god Zeus. Along with his friends Pegasus, a flying horse, and Phil, a personal trainer, Hercules is tricked by the hilarious, hotheaded villain Hades, who's plotting to take over Mount Olympus!", 93, "English", "/hdOS8bvta2DmDF8NHcgKWQDx0OX.jpg", 7.5, new DateTime(1997, 6, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), "Hercules" },
                    { 11978, null, "R", "Against formidable odds -- and an old-school diving instructor embittered by the U.S. Navy's new, less prejudicial policies -- Carl Brashear sets his sights on becoming the Navy's first African-American master diver in this uplifting true story. Their relationship starts out on the rocks, but fate ultimately conspires to bring the men together into a setting of mutual respect, triumph and honor.", 129, "English", "/wNUAnXV1mzOOfvnVBIYsalkk078.jpg", 7.4000000000000004, new DateTime(2000, 9, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), "Men of Honor" },
                    { 11986, null, "16", "Betty Blue, a mentally unbalanced and sexually aggressive free spirit who becomes involved with Zorg, a repairman moonlighting as a writer. The two engage in a variety of sexual encounters, and grow more passionate toward each other. Betty finds Zorg’s book and is aggressively supportive; over time, but her instability catches up with her.", 185, "French", "/1jTxGJpBprjThrRNhBkjZgyTyIY.jpg", 7.2999999999999998, new DateTime(1986, 4, 9, 0, 0, 0, 0, DateTimeKind.Unspecified), "Betty Blue" },
                    { 12093, null, "R", "Lilja lives in poverty and dreams of a better life. Her mother moves to the United States and abandons her to her aunt, who neglects her. Lilja hangs out with her friends, Natasha and Volodya, who is suicidal. Desperate for money, she starts working as a prostitute, and later meets Andrei. He offers her a good job in Sweden, but when Lilja arrives her life quickly enters a downward spiral.", 109, "Swedish", "/1uqtBLEXFO6qxofV9Hm1SigE3WH.jpg", 7.7000000000000002, new DateTime(2002, 8, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), "Lilya 4-ever" },
                    { 12102, null, "PG", "Ted Kramer is a career man for whom his work comes before his family. His wife Joanna cannot take this anymore, so she decides to leave him. Ted is now faced with the tasks of housekeeping and taking care of himself and their young son Billy.", 105, "English", "/6IVQjDTbr7pXx2AR8jovbYwpyiF.jpg", 7.5, new DateTime(1979, 12, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), "Kramer vs. Kramer" },
                    { 12104, null, "R", "A troubled rock star descends into madness in the midst of his physical and social isolation from everyone.", 95, "English", "/3QcwzfyIYI8a94yP26jQ2TWsXGI.jpg", 8.0, new DateTime(1982, 7, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), "Pink Floyd: The Wall" },
                    { 12105, null, "G", "The Blue Meanies take over Pepperland, draining it of all its color and music, firing anti-music missiles, bonking people with green apples, and turning the inhabitants to stone by way of the pointed finger of a giant blue glove. As the only survivor, the Lord Admiral escapes in the yellow submarine and goes to Liverpool to enlist the help of the Beatles.", 90, "English", "/sgYUMZp6oYR3gdWjcS1gpxjWvwX.jpg", 7.2000000000000002, new DateTime(1968, 7, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), "Yellow Submarine" },
                    { 12140, null, "PG-13", "Groundbreaking director Mamoru Oshii continues to push the boundaries of art and anime with this universally acclaimed cyber thriller following cyborg detective Batou as he tries to unravel the reasons for a murderous robot revolt in the year 2032. A quest for a killer that becomes a mind bending search for the meaning of life.", 100, "Japanese", "/1ZJRbLDVr90KLtKdmTT4WZhT26E.jpg", 7.4000000000000004, new DateTime(2004, 3, 6, 0, 0, 0, 0, DateTimeKind.Unspecified), "Ghost in the Shell 2: Innocence" },
                    { 12162, null, "R", "Forced to play a dangerous game of cat-and-mouse in the chaos of war, an elite Army bomb squad unit must come together in a city where everyone is a potential enemy and every object could be a deadly bomb.", 131, "English", "/m2duGsKjBOl3BB8uFOTnRUzdEhg.jpg", 7.2999999999999998, new DateTime(2008, 10, 10, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Hurt Locker" },
                    { 12163, null, "R", "Aging wrestler Randy \"The Ram\" Robinson is long past his prime but still ready and rarin' to go on the pro-wrestling circuit. After a particularly brutal beating, however, Randy hangs up his tights, pursues a serious relationship with a long-in-the-tooth stripper, and tries to reconnect with his estranged daughter. But he can't resist the lure of the ring and readies himself for a comeback.", 109, "English", "/6OTR8dSoNGjWohJNo3UhIGd3Tj.jpg", 7.5, new DateTime(2008, 9, 7, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Wrestler" },
                    { 12169, null, "U", "A sprawling drama centered on five key days in a family's life.", 114, "French", "/w6pi0wqfNnwbCWc98jW3opwl0dF.jpg", 7.5999999999999996, new DateTime(2008, 7, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), "The First Day of the Rest of Your Life" },
                    { 12207, null, "R", "Returning home with his father after a shopping expedition, Wong Fei-Hong is unwittingly caught up in the battle between foreigners who wish to export ancient Chinese artifacts and loyalists who don't want the pieces to leave the country. Fei-Hong must fight against the foreigners using his Drunken Boxing style, and overcome his father's antagonism as well.", 102, "Cantonese", "/zZODgJHFtzs6wwa4cp6Nezb5AGe.jpg", 7.4000000000000004, new DateTime(1994, 2, 3, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Legend of Drunken Master" },
                    { 12405, null, "R", "Jamal Malik is an impoverished Indian teen who becomes a contestant on the Hindi version of ‘Who Wants to Be a Millionaire?’ but, after he wins, he is suspected of cheating.", 120, "English", "/5WU6uusqJrLfiBaNs3KpF4o8Lnj.jpg", 7.7000000000000002, new DateTime(2008, 5, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), "Slumdog Millionaire" },
                    { 12429, null, "G", "The son of a sailor, 5-year old Sosuke lives a quiet life on an oceanside cliff with his mother Lisa. One fateful day, he finds a beautiful goldfish trapped in a bottle on the beach and upon rescuing her, names her Ponyo. But she is no ordinary goldfish. The daughter of a masterful wizard and a sea goddess, Ponyo uses her father's magic to transform herself into a young girl and quickly falls in love with Sosuke, but the use of such powerful sorcery causes a dangerous imbalance in the world. As the moon steadily draws nearer to the earth and Ponyo's father sends the ocean's mighty waves to find his daughter, the two children embark on an adventure of a lifetime to save the world and fulfill Ponyo's dreams of becoming human.", 100, "Japanese", "/yp8vEZflGynlEylxEesbYasc06i.jpg", 7.7000000000000002, new DateTime(2008, 7, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), "Ponyo" },
                    { 12444, null, "PG-13", "Harry, Ron and Hermione walk away from their last year at Hogwarts to find and destroy the remaining Horcruxes, putting an end to Voldemort's bid for immortality. But with Harry's beloved Dumbledore dead and Voldemort's unscrupulous Death Eaters on the loose, the world is more dangerous than ever.", 146, "English", "/iGoXIpQb7Pot00EEdwpwPajheZ5.jpg", 7.7999999999999998, new DateTime(2010, 10, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), "Harry Potter and the Deathly Hallows: Part 1" },
                    { 12445, null, "PG-13", "Harry, Ron and Hermione continue their quest to vanquish the evil Voldemort once and for all. Just as things begin to look hopeless for the young wizards, Harry discovers a trio of magical objects that endow him with powers to rival Voldemort's formidable skills.", 130, "English", "/da22ZBmrDOXOCDRvr8Gic8ldhv4.jpg", 8.0999999999999996, new DateTime(2011, 7, 7, 0, 0, 0, 0, DateTimeKind.Unspecified), "Harry Potter and the Deathly Hallows: Part 2" },
                    { 12477, null, "NR", "In the final months of World War II, 14-year-old Seita and his sister Setsuko are orphaned when their mother is killed during an air raid in Kobe, Japan. After a falling out with their aunt, they move into an abandoned bomb shelter. With no surviving relatives and their emergency rations depleted, Seita and Setsuko struggle to survive.", 89, "Japanese", "/fs9rvMCDCqZMr6AGciakP0Ds7og.jpg", 8.4000000000000004, new DateTime(1988, 4, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), "Grave of the Fireflies" },
                    { 12481, null, "R", "Chen is a city boy who moves with his cousins to work at an ice factory. He does this with a family promise never to get involved in any fight. However, when members of his family begin disappearing after meeting the management of the factory, the resulting mystery and pressures force him to break that vow and take on the villainy of the Big Boss.", 100, "Mandarin", "/5rrvonvaiCcxN6ZnrKEoJYl6Yrx.jpg", 7.2999999999999998, new DateTime(1971, 10, 2, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Big Boss" },
                    { 12491, null, "18", "A pimp with no other means to provide for himself finds his life spiralling out of control when his prostitute is sent to prison.", 117, "Italian", "/vYFrdrYHwUFT1ibBFmSJfB6lPQE.jpg", 7.7999999999999998, new DateTime(1961, 8, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Accattone" },
                    { 12493, null, "12", "An executive of a shoe company becomes a victim of extortion when his chauffeur's son is kidnapped and held for ransom.", 142, "Japanese", "/tgNjemQPG96uIezpiUiXFcer5ga.jpg", 8.3000000000000007, new DateTime(1963, 3, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "High and Low" },
                    { 12498, null, "R", "Karl Childers is a mentally disabled man who has been in the custody of the state mental hospital since the age of 12 for killing his mother and her lover. Although thoroughly institutionalized, Karl is deemed fit to be released into the outside world.", 135, "English", "/y7kYNk6gJMkPx1YfXhXw6fMTstf.jpg", 7.5999999999999996, new DateTime(1996, 8, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Sling Blade" },
                    { 12516, null, "PG", "A collection of magical tales based upon the actual dreams of director Akira Kurosawa.", 120, "Japanese", "/j0NQsYqnqvhTtBj7vhCa9iKT0NA.jpg", 7.7000000000000002, new DateTime(1990, 5, 11, 0, 0, 0, 0, DateTimeKind.Unspecified), "Dreams" },
                    { 12548, null, "T", "Five young men dream of success as they drift lazily through life in a small Italian village. Fausto, the group's leader, is a womanizer; Riccardo craves fame; Alberto is a hopeless dreamer; Moraldo fantasizes about life in the city; and Leopoldo is an aspiring playwright. As Fausto chases a string of women, to the horror of his pregnant wife, the other four blunder their way from one uneventful experience to the next.", 103, "Italian", "/4bSqvgj7e9adaRu0ZQ4yQgOAjaN.jpg", 7.7000000000000002, new DateTime(1953, 8, 26, 0, 0, 0, 0, DateTimeKind.Unspecified), "I Vitelloni" },
                    { 12622, null, "18", "A detective breaks all rules of ethical conduct while investigating a colleague’s involvement in drug pushing and Yakuza activities.", 103, "Japanese", "/1vBbE1rLdYkD3t53E5Guk0DpILQ.jpg", 7.2999999999999998, new DateTime(1989, 8, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), "Violent Cop" },
                    { 12761, null, "11", "After a seven-year absence, Charlotte Andergast travels to Sweden to reunite with her daughter Eva. The pair have a troubled relationship: Charlotte sacrificed the responsibilities of motherhood for a career as a classical pianist. Over an emotional night, the pair reopen the wounds of the past. Charlotte gets another shock when she finds out that her mentally impaired daughter, Helena, is out of the asylum and living with Eva.", 93, "Swedish", "/6beNbtCXv3GkzHkxkGYf38ib7v8.jpg", 8.0, new DateTime(1978, 10, 8, 0, 0, 0, 0, DateTimeKind.Unspecified), "Autumn Sonata" },
                    { 12762, null, "PG", "A hapless talent manager named Danny Rose, by helping a client, gets dragged into a love triangle involving the mob. His story is told in flashback, an anecdote shared amongst a group of comedians over lunch at New York's Carnegie Deli. Rose's one-man talent agency represents countless incompetent entertainers, including a one-legged tap dancer, and one slightly talented one: washed-up lounge singer Lou Canova (Nick Apollo Forte), whose career is on the rebound.", 84, "English", "/oLP0VZg39QGESwrTLon2JmfBafQ.jpg", 7.2999999999999998, new DateTime(1984, 1, 27, 0, 0, 0, 0, DateTimeKind.Unspecified), "Broadway Danny Rose" },
                    { 12776, null, "R", "Good hearted but not very wordly-wise, Dante is happy driving the school bus for a group of mentally handicapped children, while feeling he is somehow missing out on life and love. So he is very excited when after nearly being knocked down by her car he meets Maria, who seems immediately enamoured of him. He is soon invited to her sumptuous Palermo villa, little suspecting that this is part of a plot. He bears an amazing likeness to Maria's stool-pigeon gangster husband and it would be convenient for them if the mobster, in the shape of Dante, was seen to be dead and buried.", 102, "Italian", "/im7KfvlvYf8Grlemc9lOMqgt4cG.jpg", 7.4000000000000004, new DateTime(1991, 10, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), "Johnny Stecchino" },
                    { 12837, null, "PG-13", "Set in South Carolina in 1964, this is the tale of Lily Owens a 14 year-old girl who is haunted by the memory of her late mother. To escape her lonely life and troubled relationship with her father, Lily flees with Rosaleen, her caregiver and only friend, to a South Carolina town that holds the secret to her mother's past.", 114, "English", "/m1LGEeoYfc6crbfG8WmTKg9SVqL.jpg", 7.4000000000000004, new DateTime(2008, 9, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Secret Life of Bees" },
                    { 12900, null, "e 14", "The historical recreation of the 1942 Wannsee Conference, in which Nazi and SS leaders gathered in a Berlin suburb to discuss the \"Final Solution to the Jewish Question\". Led by SS-General Reinhard Heydrich, this group of high ranking German officials came to the historic and far reaching decision that the Jews of Europe were to be exterminated in what would come to be known as the Holocaust.", 96, "English", "/Onqn8XXyhANuy1LIL7AIN6unQk.jpg", 7.2999999999999998, new DateTime(2001, 5, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), "Conspiracy" },
                    { 13002, null, "G", "King Randolph sends for his cousin Duchess Rowena to help turn his daughters, Princess Genevieve and her 11 sisters, into better ladies. But the Duchess takes away all the sisters fun, including the sisters favorite pastime: dancing.Thinking all hope is lost they find a secret passageway to a magical land were they can dance the night away.", 83, "English", "/opxyzBkB44ubRRyhdrvkoUFWuIj.jpg", 7.7000000000000002, new DateTime(2006, 9, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), "Barbie in The 12 Dancing Princesses" },
                    { 13004, null, "G", "Liana and Alexa (Barbie and Teresa) are best friends who share everything, including their love of singing. One day while walking through the forest home from the village, the girls meet an old beggar who gives them a magical mirror. As they clean the mirror and sing, a musical apprentice muse named Melody appears in the mirror's surface, and tells the girls about the secret of the Diamond Castle.", 78, "English", "/dvjFM3GgYm3gDZ6Ulw0JurDYs4r.jpg", 7.2999999999999998, new DateTime(2008, 9, 3, 0, 0, 0, 0, DateTimeKind.Unspecified), "Barbie and the Diamond Castle" },
                    { 13008, null, "R", "The true story of suburban housewife Gertrude Baniszewski, who kept a teenage girl locked in the basement of her Indiana home during the 1960s.", 97, "English", "/aGATXFPK09klLs0JmxLKtCSyg24.jpg", 7.2999999999999998, new DateTime(2007, 7, 27, 0, 0, 0, 0, DateTimeKind.Unspecified), "An American Crime" }
                });

            migrationBuilder.InsertData(
                table: "Movies",
                columns: new[] { "Id", "ActorId", "Certification", "Description", "Duration", "Language", "Picture", "Ratings", "ReleaseDate", "Title" },
                values: new object[,]
                {
                    { 13041, null, "NR", "El Topo decides to confront warrior Masters on a trans-formative desert journey he begins with his 6 year old son, who must bury his childhood totems to become a man.", 125, "Spanish", "/4ea7sUzZaQNRuIm4M6EqWLQWfnX.jpg", 7.2999999999999998, new DateTime(1970, 12, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), "El Topo" },
                    { 13042, null, "G", "Dignity. Poise. Mystery. We expect nothing less from the great turn-of-the-century magician, Presto. But when Presto neglects to feed his rabbit one too many times, the magician finds he isn't the only one with a few tricks up his sleeve!", 5, "English", "/asmKQG2qhpVM1KD6x5kODAZPmZl.jpg", 7.7999999999999998, new DateTime(2008, 6, 27, 0, 0, 0, 0, DateTimeKind.Unspecified), "Presto" },
                    { 13060, null, "G", "When an overconfident teen alien gets behind the controls of a spaceship, he must attempt to abduct a slumbering farmer under the watchful eye of a critical instructor. But abducting humans requires precision and a gentle touch, and within a few missteps it's painfully clear why more humans don't go missing every year.", 5, "English", "/iwI3R8ZR3MQ5dnTx9tHSiS81i4W.jpg", 7.5, new DateTime(2006, 12, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), "Lifted" },
                    { 13151, null, "NR", "The Mystery Gang reunite and visit Moonscar Island, a remote island with a dark secret. Daphne wants more than just a villain in a costume, and they get more than they ever expected.", 77, "English", "/y9CySYOtHl8mDu0GQ2eT2EcjFE9.jpg", 7.5, new DateTime(1998, 9, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), "Scooby-Doo on Zombie Island" },
                    { 13183, null, "R", "In a gritty and alternate 1985 the glory days of costumed vigilantes have been brought to a close by a government crackdown, but after one of the masked veterans is brutally murdered, an investigation into the killer is initiated. The reunited heroes set out to prevent their own destruction, but in doing so uncover a sinister plot that puts all of humanity in grave danger.", 163, "English", "/aZvOkdo203bm1kpcY0A0Tn074ER.jpg", 7.2999999999999998, new DateTime(2009, 3, 5, 0, 0, 0, 0, DateTimeKind.Unspecified), "Watchmen" },
                    { 13187, null, "G", "When Charlie Brown complains about the overwhelming materialism that he sees amongst everyone during the Christmas season, Lucy suggests that he become director of the school Christmas pageant. Charlie Brown accepts, but is a frustrating struggle. When an attempt to restore the proper spirit with a forlorn little fir Christmas tree fails, he needs Linus' help to learn the meaning of Christmas.", 25, "English", "/1nt7BHPhoGtaNacI5sz9Y88Xigu.jpg", 7.7000000000000002, new DateTime(1965, 12, 9, 0, 0, 0, 0, DateTimeKind.Unspecified), "A Charlie Brown Christmas" },
                    { 13223, null, "R", "Widower Walt Kowalski is a grumpy, prejudiced, tough-minded, unhappy, old, Korean War veteran who can't get along with either his kids or his neighbours. His prize possession is a 1972 Gran Torino he keeps in mint condition. When his neighbour, Thao—a young Hmong teenager under pressure from his gang member cousin—tries to steal his Gran Torino, Walt sets out to reform the youth and takes steps to protect Thao and his family from the gangs that infest their neighborhood.", 116, "English", "/89eFUED55UqZA3JqYEofA22fWlQ.jpg", 8.0, new DateTime(2008, 12, 9, 0, 0, 0, 0, DateTimeKind.Unspecified), "Gran Torino" },
                    { 13310, null, "R", "Set in 1982 in the suburb of Blackeberg, Stockholm, twelve-year-old Oskar is a lonely outsider, bullied at school by his classmates; at home, Oskar dreams of revenge against a trio of bullies. He befriends his twelve-year-old, next-door neighbor Eli, who only appears at night in the snow-covered playground outside their building.", 115, "Swedish", "/7IG4WjaAOVDlLvLUkh513HSwhW8.jpg", 7.5, new DateTime(2008, 1, 26, 0, 0, 0, 0, DateTimeKind.Unspecified), "Let the Right One In" },
                    { 13321, null, "12", "During World War II, a small group of survivors is stranded in a lifeboat together after the ship they were traveling on is destroyed by a German U-boat.", 96, "English", "/AoeTcnHohATkwWbs0ZQbrmojJSu.jpg", 7.4000000000000004, new DateTime(1944, 1, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), "Lifeboat" },
                    { 13353, null, "G", "This classic \"Peanuts\" tale focuses on the thumb-sucking, blanket-holding Linus, and his touching faith in the \"Great Pumpkin.\" When Linus discovers that no one else believes in the creature, he sets out to prove that the Pumpkin's no myth—by spending the night alone in a pumpkin patch.", 25, "English", "/59wp9OWexYsxlSPHYmVLsl5xlFt.jpg", 7.5, new DateTime(1966, 10, 27, 0, 0, 0, 0, DateTimeKind.Unspecified), "It's the Great Pumpkin, Charlie Brown" },
                    { 13363, null, "NR", "An impromptu goodbye party for Professor John Oldman becomes a mysterious interrogation after the retiring scholar reveals to his colleagues he never ages and has walked the earth for 14,000 years.", 87, "English", "/V086R82gNgWrotaXZFO4JhdgB1.jpg", 7.7000000000000002, new DateTime(2007, 6, 10, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Man from Earth" },
                    { 13377, null, "NR", "Bitter and hateful, the Grinch is irritated at the thought of a nearby village having a happy time celebrating Christmas. Disguised as Santa Claus, with his dog made to look like a reindeer, he decides to raid the village to steal all the Christmas things.", 26, "English", "/7ir0iRuPK9OEuH569cp0nF5CJce.jpg", 7.4000000000000004, new DateTime(1966, 12, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), "How the Grinch Stole Christmas!" },
                    { 13382, null, "G", "Sam the snowman tells us the story of a young red-nosed reindeer who, after being ousted from the reindeer games because of his glowing nose, teams up with Hermey, an elf who wants to be a dentist, and Yukon Cornelius, the prospector. They run into the Abominable Snowman and find a whole island of misfit toys. Rudoph vows to see if he can get Santa to help the toys, and he goes back to the North Pole on Christmas Eve. But Santa's sleigh is fogged in. But when Santa looks over Rudolph, he gets a very bright idea...", 52, "English", "/WvJj5TsW3lPJcbbvZtJazsFhvY.jpg", 7.2999999999999998, new DateTime(1964, 12, 6, 0, 0, 0, 0, DateTimeKind.Unspecified), "Rudolph the Red-Nosed Reindeer" },
                    { 13384, null, "PG-13", "A young, English working-class boy spends his free time caring for and training his pet falcon.", 110, "English", "/ygncVzlnDO1yEKAj9iHjifvD3HA.jpg", 7.5, new DateTime(1970, 4, 3, 0, 0, 0, 0, DateTimeKind.Unspecified), "Kes" },
                    { 13386, null, "T", "Gaetano, giovane napoletano, decide di lasciare casa, lavoro ed amici, per cercare altri momenti di vita e conoscere altre persone. Arriva a Firenze, a casa della zia. In un ambulatorio, dove capita per caso, conosce Marta e se ne innammora. Dopo una serie di divertenti situazioni (un vecchio amico dalla parlantina inarrestabile arriva da Napoli; la matura zia ed il suo attempato amante; un giovane prete Americano che vuole coinvolgerlo per forza nelle sue visite evangeliche; l'incontro con Riccardino, un giovane frustrato da una madre oppressiva; il padre che aspetta il miracolo della ricrescita di una mano amputata; etc.) Gaetano decide di restare a Firenze e di fare da padre al figlio che Marta aspetta, anche se la ragazza non vuole rivelare con esattezza il nome del padre.", 110, "Italian", "/gnSz9NuEzN80KCJv5IR8Wpyp593.jpg", 7.7000000000000002, new DateTime(1981, 3, 5, 0, 0, 0, 0, DateTimeKind.Unspecified), "I'm Starting from Three" },
                    { 13398, null, "PG-13", "During a Christmas Eve in Tokyo, three homeless people, middle-aged alcoholic Gin, former drag queen Hana, and dependent runaway girl Miyuki, discover an abandoned newborn while looking through the garbage. With only a handful of clues to the baby's identity, the three misfits search the city to find its parents.", 93, "Japanese", "/ukhvxpVcBsb1MpRRwiqEIwyKdUX.jpg", 7.9000000000000004, new DateTime(2003, 12, 29, 0, 0, 0, 0, DateTimeKind.Unspecified), "Tokyo Godfathers" },
                    { 13403, null, "R", "Raised a boy in East Berlin, Hedwig undergoes a personal transformation in order to emigrate to the U.S., where she reinvents herself as an “internationally ignored” but divinely talented rock diva, inhabiting a “beautiful gender of one.”", 95, "English", "/jafIFAW8sHQkzWPGoMDR4892dFI.jpg", 7.5999999999999996, new DateTime(2001, 7, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), "Hedwig and the Angry Inch" },
                    { 13413, null, "G", "What lengths will a robot undergo to do his job? BURN·E is a dedicated hard working robot who finds himself locked out of his ship. BURN·E quickly learns that completing a simple task can often be a very difficult endeavor.", 8, "English", "/sDdyTrcfF4UgQp6BuleU1ikjC3v.jpg", 7.5999999999999996, new DateTime(2008, 11, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), "BURN·E" },
                    { 13446, null, "R", "Two out-of-work actors -- the anxious, luckless Marwood and his acerbic, alcoholic friend, Withnail -- spend their days drifting between their squalid flat, the unemployment office and the pub. When they take a holiday \"by mistake\" at the country house of Withnail's flamboyantly gay uncle, Monty, they encounter the unpleasant side of the English countryside: tedium, terrifying locals and torrential rain.", 108, "English", "/d84vd2476PN4f0vITioIG8mmpxX.jpg", 7.4000000000000004, new DateTime(1987, 6, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), "Withnail & I" },
                    { 13466, null, "PG", "Based on the true story of Homer Hickam, a coal miner's son who was inspired by the first Sputnik launch to take up rocketry against his father's wishes, and eventually became a NASA scientist.", 108, "English", "/vjRSVHAqQo6t7faNVQj3WNSJWUv.jpg", 7.5999999999999996, new DateTime(1999, 2, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), "October Sky" },
                    { 13475, null, "PG-13", "The fate of the galaxy rests in the hands of bitter rivals. One, James Kirk, is a delinquent, thrill-seeking Iowa farm boy. The other, Spock, a Vulcan, was raised in a logic-based society that rejects all emotion. As fiery instinct clashes with calm reason, their unlikely but powerful partnership is the only thing capable of leading their crew through unimaginable danger, boldly going where no one has gone before. The human adventure has begun again.", 127, "English", "/lV5OpzAss1z06YNagOVap1I35mH.jpg", 7.4000000000000004, new DateTime(2009, 5, 6, 0, 0, 0, 0, DateTimeKind.Unspecified), "Star Trek" },
                    { 13528, null, "NR", "A newlywed fears she's going mad when strange things start happening at the family mansion.", 114, "English", "/gQXHGJRdIQ2PBpIskIxGoLBSTX5.jpg", 7.5, new DateTime(1944, 5, 4, 0, 0, 0, 0, DateTimeKind.Unspecified), "Gaslight" },
                    { 13562, null, null, "Fifth Avenue socialite Irene Bullock needs a \"forgotten man\" to win a scavenger hunt, and no one is more forgotten than Godfrey Park, who resides in a dump by the East River. Irene hires Godfrey as a servant for her riotously unhinged family, to the chagrin of her spoiled sister, Cornelia, who tries her best to get Godfrey fired. As Irene falls for her new butler, Godfrey turns the tables and teaches the frivolous Bullocks a lesson or two.", 95, "English", "/wtfOW7fIxBZWY78rvUoPpWhMSiR.jpg", 7.7000000000000002, new DateTime(1936, 9, 2, 0, 0, 0, 0, DateTimeKind.Unspecified), "My Man Godfrey" },
                    { 13597, null, "PG", "When teen Sarah is forced to babysit Toby, her baby stepbrother, she summons Jareth the Goblin King to take him away. When he is actually kidnapped, Sarah is given just thirteen hours to solve a labyrinth and rescue him.", 102, "English", "/AdWRVEkLV9RlUK8tREclkIIOfjT.jpg", 7.2999999999999998, new DateTime(1986, 6, 27, 0, 0, 0, 0, DateTimeKind.Unspecified), "Labyrinth" },
                    { 13635, null, "R", "Jacques Mesrine, a loyal son and dedicated soldier, is back home and living with his parents after serving in the Algerian War. Soon he is seduced by the neon glamour of sixties Paris and the easy money it presents. Mentored by Guido, Mesrine turns his back on middle class law-abiding and soon moves swiftly up the criminal ladder.", 113, "French", "/zCyuiyIhbhgEOZde81qTgXbO0pw.jpg", 7.4000000000000004, new DateTime(2008, 10, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), "Mesrine: Killer Instinct" },
                    { 13689, null, "PG-13", "A chance encounter with a stranger changes the life of a college gymnast.", 120, "English", "/r4VQCZe3aSo7TmmsxcyLqaoMR1l.jpg", 7.4000000000000004, new DateTime(2006, 3, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Peaceful Warrior" },
                    { 13754, null, "R", "When mysterious foreign entrepreneurs appear with the intention of tearing down Treasure Town and replacing it with an amusement park, Black and White face their greatest adversaries yet. It is up to the destructive Black to save the fate of the city and up to the gentle White to save Black from his own dark nature. On the street of an unnamed city, literally high-flying urchins Black and White look to protect their turf from invasion from other gangs. While he can be tough in a fight or wielding a weapon, White is an 11-year-old who can't even dress himself. Slightly older, Black is more worldly and treats his buddy with paternal love. Both look on their city as \"our town.\" Also prone to seeing the city as his property is world-weary yakuza leader Suzuki, aka the Rat. Feeling the town has become too placid, Suzuki plots his return, much to the consternation of local police.", 103, "Japanese", "/e2x1YDuZPpQiaQS25Ego7xMZYOI.jpg", 7.5, new DateTime(2006, 12, 11, 0, 0, 0, 0, DateTimeKind.Unspecified), "Tekkonkinkreet" },
                    { 13855, null, "PG-13", "Joong-ho is a dirty detective turned pimp in financial trouble as several of his girls have recently disappeared without clearing their debts. While trying to track them down, he finds a clue that the vanished girls were all called up by the same client whom one of his girls is meeting with right now.", 125, "Korean", "/4bWVILPrb7gaqwA2j6xIcg4Ak3D.jpg", 7.7999999999999998, new DateTime(2008, 2, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Chaser" },
                    { 13929, null, "G", "An aging codger named Geri plays a daylong game of chess in the park against himself. Somehow, he begins losing to his livelier opponent. But just when the game's nearly over, Geri manages to turn the tables.", 4, "English", "/8PdCk3T9EkcKniUviDogWFCXx28.jpg", 7.7999999999999998, new DateTime(1997, 11, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), "Geri's Game" },
                    { 13930, null, "G", "One by one, a flock of small birds perches on a telephone wire. Sitting close together has problems enough, and then comes along a large dopey bird that tries to join them. The birds of a feather can't help but make fun of him - and their clique mentality proves embarrassing in the end.", 3, "English", "/k2aSiXWIWp9h7Tx7tpYuCdqY4fU.jpg", 7.5, new DateTime(2000, 11, 2, 0, 0, 0, 0, DateTimeKind.Unspecified), "For the Birds" },
                    { 13932, null, "NR", "The Parrs' baby Jack-Jack is thought to be normal, not having any super-powers like his parents or siblings. But when an outsider is hired to watch him, Jack-Jack shows his true potential.", 5, "English", "/mRTPU9IcQGn3KRopyvaC1HGPAPJ.jpg", 7.2999999999999998, new DateTime(2005, 3, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Jack-Jack Attack" },
                    { 13933, null, "G", "With one coin to make a wish at the piazza fountain, a peasant girl encounters two competing street performers who'd prefer the coin find its way into their tip jars. The little girl, Tippy, is caught in the middle as a musical duel ensues between the one-man-bands.", 4, "English", "/cFW3kixCdiBvZw8HgRcV9sVbPsx.jpg", 7.2999999999999998, new DateTime(2005, 6, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), "One Man Band" },
                    { 13980, null, "NR", "Pursued by formidable Chinese assassins, young Kotaro and his dog run into No Name, a mysterious stranger who gets pulled into the chase. The unlikely companions form a bond over saving the dog from a poison attack, but chaos erupts when the assassins find Kotaro, and No Name must face his past before a horrible fate is met again.", 103, "Japanese", "/lMsUYZq5ITW3rAqF3tB7v74KEnH.jpg", 7.5, new DateTime(2007, 9, 29, 0, 0, 0, 0, DateTimeKind.Unspecified), "Sword of the Stranger" },
                    { 14047, null, "PG-13", "The true story of a brilliant but politically radical debate team coach who uses the power of words to transform a group of underdog African-American college students into a historical powerhouse that took on the Harvard elite.", 126, "English", "/nuF3DDlZzNb2qq0tEsYU0zpXf8K.jpg", 7.2000000000000002, new DateTime(2007, 12, 27, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Great Debaters" },
                    { 14069, null, "12A", "When 17-year-old Makoto Konno gains the ability to, quite literally, \"leap\" backwards through time, she immediately sets about improving her grades and preventing personal mishaps. However, she soon realises that changing the past isn't as simple as it seems, and eventually, will have to rely on her new powers to shape the future of herself and her friends.", 98, "Japanese", "/fS41b13LZEtL9VYUlMobXZqvk41.jpg", 7.7999999999999998, new DateTime(2006, 7, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Girl Who Leapt Through Time" },
                    { 14092, null, "12", "In the year 2029, Section 9, a group of cybernetically enhanced cops, are called in to investigate and stop a highly-wanted hacker known as 'The Puppetmaster'.  Ghost in the Shell 2.0 is a reproduced version of its original 1995 counterpart. Among a numerous enhancements, for the film's 2.0 release, were a number of scenes were overhauled with 3D animation, visual improvements, and soundtrack rerecorded in 6.1 surround sound.", 85, "Japanese", "/4Vzlmvb9EyTnr5kN8mFVCMs8f3I.jpg", 7.4000000000000004, new DateTime(2008, 7, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), "Ghost in the Shell 2.0" },
                    { 14160, null, "PG", "Carl Fredricksen spent his entire life dreaming of exploring the globe and experiencing life to its fullest. But at age 78, life seems to have passed him by, until a twist of fate (and a persistent 8-year old Wilderness Explorer named Russell) gives him a new lease on life.", 96, "English", "/eAdO0qa9m0NFSVLZ26PvCwmPlsr.jpg", 7.9000000000000004, new DateTime(2009, 5, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), "Up" },
                    { 14163, null, "U", "A team of rag-tag girls with their own agenda form Team India competing for international fame in field hockey. Their coach, the ex-men's Indian National team captain, returns from a life of shame after being unjustly accused of match fixing in his last match. Can he give the girls the motivation required to win, while dealing with the shadows of his own past?", 153, "Hindi", "/mmFMgEsTRCAGAtwffGpuo3mJsxN.jpg", 7.4000000000000004, new DateTime(2007, 8, 10, 0, 0, 0, 0, DateTimeKind.Unspecified), "Chak De! India" },
                    { 14202, null, "PG-13", "A British medical doctor fights a cholera outbreak in a small Chinese village, while also being trapped at home in a loveless marriage to an unfaithful wife.", 125, "English", "/k41IvHDLgZO2ae7RuU77wQjScIj.jpg", 7.2999999999999998, new DateTime(2006, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Painted Veil" },
                    { 14257, null, "PG", "Don Sallust (Louis de Funès) is minister of the King of Spain. It is a being disingenuous, hypocritical and greedy that collects the taxes himself, he turns in part to his advantage. He is hated by the people he oppresse.Accusé by Queen, a beautiful princess Bavarian, of having an illegitimate child to one of her maids of honor, he was stripped of his duties and ordered to retire to a monastery. Decided to revenge, it comes in contact with his nephew seducing Caesar ...", 108, "French", "/vKypDRMd0SC99YowXzAPkJ89xkr.jpg", 7.5, new DateTime(1971, 12, 8, 0, 0, 0, 0, DateTimeKind.Unspecified), "Delusions of Grandeur" },
                    { 14282, null, "R", "Jubei is a masterless ninja who travels the land alone, lending his services to those with gold—or a worthy cause. His fearsome abilities have served him well, but a plot to overthrow the government threatens to end his wandering ways—and possibly his life.", 94, "Japanese", "/qzZEnaXwv4wss2QalEo4Uf9BAwh.jpg", 7.5999999999999996, new DateTime(1993, 6, 5, 0, 0, 0, 0, DateTimeKind.Unspecified), "Ninja Scroll" },
                    { 14283, null, "R", "Spans 300 years in the life of one famed musical instrument that winds up in present-day Montreal on the auction block. Crafted by the Italian master Bussotti (Cecchi) in 1681, the red violin derives its unusual color from the human blood mixed into the finish. With this legacy, the violin travels to Austria, England, China, and Canada, leaving both beauty and tragedy in its wake.", 131, "French", "/dnU8nB2NffHJtMT0vqmrBxruH9n.jpg", 7.5999999999999996, new DateTime(1998, 9, 10, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Red Violin" }
                });

            migrationBuilder.InsertData(
                table: "Movies",
                columns: new[] { "Id", "ActorId", "Certification", "Description", "Duration", "Language", "Picture", "Ratings", "ReleaseDate", "Title" },
                values: new object[,]
                {
                    { 14433, null, "NR", "In 1879, during the Anglo-Zulu War, man-of-the-people Lt. Chard and snooty Lt. Bromhead are in charge of defending the isolated and vastly outnumbered Natal outpost of Rorke's Drift from tribal hordes.", 138, "English", "/43ddKmYjzNrvS7xvHVwtq03N6xP.jpg", 7.4000000000000004, new DateTime(1964, 1, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), "Zulu" },
                    { 14438, null, "PG", "In Albany, the marriage of Caleb and Catherine Holt is in crisis and they decide to divorce. However, Caleb's father, John, proposes that his son delays their separation process for forty days and follow a procedure called \"The Love Dare\" to make them love each other again.", 122, "English", "/hfoCG75j1YaNyfZGPg0rWy3nFmU.jpg", 7.2999999999999998, new DateTime(2008, 9, 26, 0, 0, 0, 0, DateTimeKind.Unspecified), "Fireproof" },
                    { 14447, null, "G", "Wallace and Gromit have a brand new business - a bakery. Although business is booming, Gromit is concerned by the news that 12 local bakers have 'disappeared' this year - but Wallace isn't worried. He's too distracted and in love with local beauty and bread enthusiast, Piella Bakewell, to be of much help. Gromit must be the sleuth and solve the escalating murder mystery.", 30, "English", "/aCRoffkRpWRlArR7dAkxabaimLr.jpg", 7.2000000000000002, new DateTime(2008, 12, 3, 0, 0, 0, 0, DateTimeKind.Unspecified), "A Matter of Loaf and Death" },
                    { 14534, null, "PG", "Rudy grew up in a steel mill town where most people ended up working, but wanted to play football at Notre Dame instead. There were only a couple of problems. His grades were a little low, his athletic skills were poor, and he was only half the size of the other players. But he had the drive and the spirit of 5 people and has set his sights upon joining the team.", 114, "English", "/fAbfTCRpjHe2rprXBly55KL1dL9.jpg", 7.2999999999999998, new DateTime(1993, 9, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), "Rudy" },
                    { 14537, null, "NR", "An unusual request for ritual suicide on a feudal lord's property leads to the unwinding of a greater mystery that challenges the clan's integrity.", 135, "Japanese", "/fRqVjso3rdEcxZHXWE2xazDAtjI.jpg", 8.4000000000000004, new DateTime(1962, 9, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Harakiri" },
                    { 14554, null, "NR", "One-armed war veteran John J. Macreedy steps off a train at the sleepy little town of Black Rock.  Once there, he begins to unravel a web of lies, secrecy, and murder.", 81, "English", "/4qqUW66A2tfvtYpX8KOnun93FYz.jpg", 7.2999999999999998, new DateTime(1955, 1, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), "Bad Day at Black Rock" },
                    { 14574, null, "PG-13", "When his family moves from their home in Berlin to a strange new house in Poland, young Bruno befriends Shmuel, a boy who lives on the other side of the fence where everyone seems to be wearing striped pajamas. Unaware of Shmuel's fate as a Jewish prisoner or the role his own Nazi father plays in his imprisonment, Bruno embarks on a dangerous journey inside the camp's walls.", 94, "English", "/2C8QCXdMlojTxZjfBlINr4FWcb6.jpg", 7.9000000000000004, new DateTime(2008, 5, 7, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Boy in the Striped Pyjamas" },
                    { 14580, null, "NR", "Tough cop Dave Bannion takes on a politically powerful crime syndicate.", 89, "English", "/xJZJukxMOuNxl2f7TeAYxDHi921.jpg", 7.7000000000000002, new DateTime(1953, 10, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Big Heat" },
                    { 14624, null, "PG", "When his wealthy grandfather finally dies, Jason Stevens fully expects to benefit when it comes to the reading of the will. But instead of a sizable inheritance, Jason receives a test, a series of tasks he must complete before he can get any money.", 114, "English", "/8BdVk1u110lwHFELTEO9HrPrIDa.jpg", 7.5999999999999996, new DateTime(2007, 3, 9, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Ultimate Gift" },
                    { 14638, null, "16", "Two hit men walk into a diner asking for a man called \"the Swede\". When the killers find the Swede, he's expecting them and doesn't put up a fight. Since the Swede had a life insurance policy, an investigator, on a hunch, decides to look into the murder. As the Swede's past is laid bare, it comes to light that he was in love with a beautiful woman who may have lured him into pulling off a bank robbery overseen by another man.", 105, "English", "/uXnuc6pW01s1MDwb6QwBWg2JQeX.jpg", 7.2999999999999998, new DateTime(1946, 8, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Killers" },
                    { 14645, null, "U", "Félix, disguised as Father Christmas, hands out leaflets advertising a sexy Christmas party. His place is taken by an African Santa Claus and he returns to his caravan only to find his girlfriend Josette about to leave him. When he comes after her, she takes refuge at \"SOS Distress\", run by two neurotics, Thérèse and Pierre.", 88, "French", "/ufN34G7D47oSegsCk5me9SZS9Y1.jpg", 7.4000000000000004, new DateTime(1982, 8, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "Santa Claus Is a Stinker" },
                    { 14696, null, "16", "In 16th century Japan, peasants Genjuro and Tobei sell their earthenware pots to a group of soldiers in a nearby village, in defiance of a local sage's warning against seeking to profit from warfare. Genjuro's pursuit of both riches and the mysterious Lady Wakasa, as well as Tobei's desire to become a samurai, run the risk of destroying both themselves and their wives, Miyagi and Ohama.", 96, "Japanese", "/7Kk1ZsrAul2Lg7Pe45XOcUf2ARQ.jpg", 8.0999999999999996, new DateTime(1953, 3, 26, 0, 0, 0, 0, DateTimeKind.Unspecified), "Ugetsu" },
                    { 14736, null, "PG-13", "A young African-American couple navigates the tricky paths of romance and athletics in this drama. Quincy McCall and Monica Wright grew up in the same neighborhood and have known each other since childhood. As they grow into adulthood, they fall in love, but they also share another all-consuming passion: basketball. They've followed the game all their lives and have no small amount of talent on the court. As Quincy and Monica struggle to make their relationship work, they follow separate career paths though high school and college basketball and, they hope, into stardom in big-league professional ball.", 124, "English", "/zNZWNX19FZ5QyedprVM0ldsXFiP.jpg", 7.5999999999999996, new DateTime(2000, 4, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), "Love & Basketball" },
                    { 14756, null, "R", "A semi-biographical account of Yip Man, the first martial arts master to teach the Chinese martial art of Wing Chun. The film focuses on events surrounding Ip that took place in the city of Foshan between the 1930s to 1940s during the Second Sino-Japanese War. Directed by Wilson Yip, the film stars Donnie Yen in the lead role, and features fight choreography by Sammo Hung.", 106, "Cantonese", "/uw7C72BIViBMUzzXeSYkxhaOQUS.jpg", 7.7000000000000002, new DateTime(2008, 12, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), "Ip Man" },
                    { 14784, null, "R", "In a hospital on the outskirts of 1920s Los Angeles, an injured stuntman begins to tell a fellow patient, a little girl with a broken arm, a fantastic story about 5 mythical heroes. Thanks to his fractured state of mind and her vivid imagination, the line between fiction and reality starts to blur as the tale advances.", 117, "English", "/jUx4P4Q1VsQ07rLz7sOlSyNm4F3.jpg", 7.5999999999999996, new DateTime(2006, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Fall" },
                    { 14811, null, "G", "This lavishly produced and critically acclaimed screen adaptation of the international stage sensation tells the life-affirming story of Tevye (Topol), a poor milkman whose love, pride and faith help him face the oppression of turn-of-the-century Czarist Russia. Nominated for eight Academy Awards.", 181, "English", "/v65PHx7Q6Jx0anyNeUOX07SJic9.jpg", 7.7000000000000002, new DateTime(1971, 11, 3, 0, 0, 0, 0, DateTimeKind.Unspecified), "Fiddler on the Roof" },
                    { 14813, null, "G", "It is an adaptation of the Charles Dickens classic A Christmas Carol, featuring Scrooge McDuck as his namesake and inspiration Ebenezer Scrooge and Mickey Mouse as Bob Cratchit. This film was based on a 1972 audio musical entitled Disney's A Christmas Carol. It is a twenty-four minute animated short film produced by Walt Disney Productions as an accompaniment to a re-release of The Rescuers.", 26, "English", "/6QH10DqZ0feBW2phvrtoLqT1s0k.jpg", 7.5999999999999996, new DateTime(1983, 10, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), "Mickey's Christmas Carol" },
                    { 14836, null, "PG", "When Coraline moves to an old house, she feels bored and neglected by her parents. She finds a hidden door with a bricked up passage. During the night, she crosses the passage and finds a parallel world where everybody has buttons instead of eyes, with caring parents and all her dreams coming true. When the Other Mother invites Coraline to stay in her world forever, the girl refuses and finds that the alternate reality where she is trapped is only a trick to lure her.", 100, "English", "/gPMh5rsVrDDAYMDbTcz6Up1DQ4z.jpg", 7.7000000000000002, new DateTime(2009, 2, 5, 0, 0, 0, 0, DateTimeKind.Unspecified), "Coraline" },
                    { 14919, null, "PG", "When a powerful criminal, who is connected to Bruce Wayne's ex-girlfriend, blames the Dark Knight for killing a crime lord, Batman decides to fight against him.", 76, "English", "/l4jaQjkgznu2Rz05X18f24UjPNW.jpg", 7.5, new DateTime(1993, 12, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "Batman: Mask of the Phantasm" },
                    { 15003, null, "16", "Zen, an autistic teenage girl with powerful martial arts skills, gets money to pay for her sick mother Zin's treatment by seeking out all the people who owe Zin money and making them pay.", 93, "Thai", "/g8CBVNFdJOGINQW2KuOvl5NAPS5.jpg", 7.2999999999999998, new DateTime(2008, 2, 6, 0, 0, 0, 0, DateTimeKind.Unspecified), "Chocolate" },
                    { 15014, null, "R", "Eccentric and full of manias, Michele is a young high school professor who defines himself as “not used to happiness”. He realizes his life is meaningless if he doesn’t have a woman by his side but, after a series of rather disastrous experiences, he feels more alone than ever. Then, out of the blue, a new French teacher called Bianca arrives at school. Amongst uncertainties and contradictions, the two start dating. In the meantime, a series of homicides take place and a police officer begins to suspect that Michele is involved. Bianca will save him providing an alibi at the right moment, but then, everything goes wrong again.", 96, "Italian", "/g8fzVIq6FWwyu0EqKBaGN6AXelY.jpg", 7.5999999999999996, new DateTime(1984, 2, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), "Bianca" },
                    { 15080, null, "PG", "It’s 1982, and Taeko is 27 years old, unmarried, and has lived her whole life in Tokyo. She decides to visit her family in the countryside, and as the train travels through the night, memories flood back of her younger years: the first immature stirrings of romance, the onset of puberty, and the frustrations of math and boys. At the station she is met by young farmer Toshio, and the encounters with him begin to reconnect her to forgotten longings. In lyrical switches between the present and the past, Taeko contemplates the arc of her life, and wonders if she has been true to the dreams of her childhood self.", 118, "Japanese", "/51igUXKleGkpzIJMaKXpxtEHngd.jpg", 7.2999999999999998, new DateTime(1991, 7, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), "Only Yesterday" },
                    { 15097, null, "U", "A second-class horror movie has to be shown at Cannes Film Festival, but, before each screening, the projectionist is killed by a mysterious fellow, with hammer and sickle, just as it happens in the film to be shown.", 93, "French", "/jBzDbxsEiCUCiYcpDLpvbQ6kN2U.jpg", 7.5, new DateTime(1994, 3, 9, 0, 0, 0, 0, DateTimeKind.Unspecified), "Fear City: A Family-Style Comedy" },
                    { 15121, null, "G", "In the years before the Second World War, a tomboyish postulant at an Austrian abbey becomes a governess in the home of a widowed naval captain with seven children, and brings a new love of life and music into the home.", 175, "English", "/xvXiJggaxRrU4jLjTXCmqnqEsGd.jpg", 7.7000000000000002, new DateTime(1965, 3, 29, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Sound of Music" },
                    { 15137, null, "PG-13", "After the Second Impact, Tokyo-3 is being attacked by giant creatures called Angels that seek to eradicate humankind. The child Shinji's objective is to fight the Angels by piloting one of the mysterious Evangelion mecha units. A remake of the first six episodes of GAINAX's famous 1996 anime series.  The film was retitled \"Evangelion: 1.01\" for its DVD release and \"Evangelion: 1.11\" for a release with additional scenes.", 101, "Japanese", "/pETU4GurpeEjBOM8oytMH0yNBHx.jpg", 7.7000000000000002, new DateTime(2007, 9, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "Evangelion: 1.0 You Are (Not) Alone" },
                    { 15152, null, "NR", "Secret agent OSS 117 foils Nazis, beds local beauties, and brings peace to the Middle East.", 99, "French", "/dDVHVZVEbTV4JsB8ZjdXNmMK7rA.jpg", 7.2999999999999998, new DateTime(2006, 4, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), "OSS 117: Cairo, Nest of Spies" },
                    { 15165, null, "G", "In her first animated musical featuring seven original songs, Barbie comes to life in this modern re-telling of a classic tale of mistaken identity and the power of friendship. Based on the story by Mark Twain,", 85, "English", "/xHYsUwUe4MaNc6mbNBGTkqZSnPk.jpg", 7.5, new DateTime(2004, 9, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), "Barbie as The Princess & the Pauper" },
                    { 15196, null, "PG", "Clue finds six colorful dinner guests gathered at the mansion of their host, Mr. Boddy -- who turns up dead after his secret is exposed: He was blackmailing all of them. With the killer among them, the guests and Boddy's chatty butler must suss out the culprit before the body count rises.", 94, "English", "/aRxbYOYHS8T73nzR8hsLousoplR.jpg", 7.2999999999999998, new DateTime(1985, 12, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), "Clue" },
                    { 15244, null, "AL", "A captured French Resistance fighter during World War II engineers a daunting escape from prison.", 101, "French", "/yPVp405f3FzLyLJW73rcn9FhWyH.jpg", 8.0, new DateTime(1956, 11, 11, 0, 0, 0, 0, DateTimeKind.Unspecified), "A Man Escaped" },
                    { 15251, null, "R", "Taped live and in concert at Constitution Hall in Washington, D.C. in August, 1983, Eddie Murphy: Delirious captures Eddie Murphy's wild and outrageous stand-up comedy act, which he performed in New York and eighteen other cities across the U.S. to standing-room-only audiences. Eddie's comedy was groundbreaking, completely new, razor sharp and definitely funny.Eddie Murphy pontificates in his own vulgarly hilarious fashion on everything from bizarre sexual fantasies to reliving the family barbecue, and is peppered with Eddie's one-of-a-kind wit. Laugh along as Eddie reminiscences of hot childhood days and the ice cream man intermixed with classic vocal parodies of top American entertainers.Experience Eddie Murphy at his best, live and red hot! Delirious! Uncensored and Uncut!", 69, "English", "/qnNXoflFXeUg692kulMKVJVRzYf.jpg", 7.7999999999999998, new DateTime(1983, 8, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), "Eddie Murphy: Delirious" },
                    { 15255, null, "R", "Sequel to the 2002 film. This time, Heavyweight Champ George \"Iceman\" Chambers (White) is sent to a Russian jail on trumped-up drug charges. In order to win his freedom he must fight against the jailhouse fighting champ Uri Boyka (Adkins) in a battle to the death. This time he is not fighting for a title, he is fighting for his life!", 93, "English", "/ySuVrhk9vUKeBzXJbR29WoK1NNS.jpg", 7.2000000000000002, new DateTime(2006, 4, 11, 0, 0, 0, 0, DateTimeKind.Unspecified), "Undisputed II: Last Man Standing" },
                    { 15265, null, "NR", "A young boy discovers a stray balloon, which seems to have a mind of its own, on the streets of Paris. The two become inseparable, yet the world’s harsh realities finally interfere.", 34, "French", "/3XrEggEOEnKGi8hTOau44vcvbmV.jpg", 7.7999999999999998, new DateTime(1956, 8, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Red Balloon" },
                    { 15359, null, "PG-13", "On the mystical island of Themyscira, a proud and fierce warrior race of Amazons have raised a daughter of untold beauty, grace and strength: Princess Diana. When an Army fighter pilot, Steve Trevor, crash-lands on the island, the rebellious and headstrong Diana defies Amazonian law by accompanying Trevor back to civilization.", 74, "English", "/u6sI0yLJXkmrbSJzVRCmmfa4nhx.jpg", 7.2999999999999998, new DateTime(2009, 3, 3, 0, 0, 0, 0, DateTimeKind.Unspecified), "Wonder Woman" },
                    { 15362, null, "12", "The story of Jacques Mesrine, France's public enemy No. 1 during the 1970s. After nearly two decades of legendary criminal feats -- from multiple bank robberies and to prison breaks -- Mesrine was gunned down by the French police in Paris.", 133, "French", "/k9lhZ0PhY78nzwG034rNpsLXlpW.jpg", 7.4000000000000004, new DateTime(2008, 11, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), "Mesrine: Public Enemy #1" },
                    { 15370, null, "G", "Haru, a schoolgirl bored by her ordinary routine, saves the life of an unusual cat and suddenly her world is transformed beyond anything she ever imagined. The Cat King rewards her good deed with a flurry of presents, including a very shocking proposal of marriage to his son! Haru embarks on an unexpected journey to the Kingdom of Cats where her eyes are opened to a whole other world.", 75, "Japanese", "/avPMO5cnaGHgLaNiAIhy33WoQLm.jpg", 7.2000000000000002, new DateTime(2002, 7, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Cat Returns" },
                    { 15371, null, "PG", "After a successful robbery leaves famed thief Lupin the Third and his partner Jigen with nothing but a large amount of expertly crafted counterfeit bills, he decides to track down the forgers responsible—and steal any other treasures he may find in the Castle of Cagliostro, including the 'damsel in distress' he finds imprisoned there.", 102, "Japanese", "/hSFdyWptoDHuXlFZGzIrfVell4Q.jpg", 7.5, new DateTime(1979, 12, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Lupin the Third: The Castle of Cagliostro" },
                    { 15383, null, "16", "Betrayed by an informant, Philippe Gerbier finds himself trapped in a torturous Nazi prison camp. Though Gerbier escapes to rejoin the Resistance in occupied Marseilles, France, and exacts his revenge on the informant, he must continue a quiet, seemingly endless battle against the Nazis in an atmosphere of tension, paranoia and distrust.", 145, "French", "/aqNZWM9bspt8zaDvVRIRiWxRVJ7.jpg", 8.0, new DateTime(1969, 9, 10, 0, 0, 0, 0, DateTimeKind.Unspecified), "Army of Shadows" },
                    { 15384, null, "R", "The battle of Red Cliff continues and the alliance between Xu and East Wu is fracturing.  With Cao Cao's massive forces on their doorstep, will the kingdoms of Xu and East Wu survive?", 136, "Mandarin", "/h4WZHa5K941lAthsa29g0RFJJtV.jpg", 7.2999999999999998, new DateTime(2009, 1, 7, 0, 0, 0, 0, DateTimeKind.Unspecified), "Red Cliff Part II" },
                    { 15472, null, "R", "Swedish thriller based on Stieg Larsson's novel about a male journalist and a young female hacker. In the opening of the movie, Mikael Blomkvist, a middle-aged publisher for the magazine Millennium, loses a libel case brought by corrupt Swedish industrialist Hans-Erik Wennerström. Nevertheless, he is hired by Henrik Vanger in order to solve a cold case, the disappearance of Vanger's niece", 152, "Swedish", "/j4Ra0SvYM08winX6fxn6AknlygV.jpg", 7.5999999999999996, new DateTime(2009, 2, 27, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Girl with the Dragon Tattoo" },
                    { 15600, null, "PG", "Based on the real-life experiences of Ed Horman. A conservative American businessman travels to Chile to investigate the sudden disappearance of his son after a right-wing military takeover. Accompanied by his son's wife he uncovers a trail of cover-ups that implicate the US State department which supports the right-wing dictatorship.", 123, "English", "/gKk7maNvN8xGPU1kUHiLq1mNoHF.jpg", 7.4000000000000004, new DateTime(1982, 2, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), "Missing" },
                    { 15601, null, "NR", "When Scooby and the gang get trapped in a video game created for them, they must fight against the 'Phantom Virus.' To escape the game they must go level by level and defeat the game once and for all.", 75, "English", "/mKmFscYvGLMnZ5TslwxCge5oELO.jpg", 7.2000000000000002, new DateTime(2001, 10, 9, 0, 0, 0, 0, DateTimeKind.Unspecified), "Scooby-Doo! and the Cyber Chase" },
                    { 15764, null, "R", "Stingo, a young writer, moves to Brooklyn in 1947 to begin work on his first novel. As he becomes friendly with Sophie and her lover Nathan, he learns that she is a Holocaust survivor. Flashbacks reveal her harrowing story, from pre-war prosperity to Auschwitz. In the present, Sophie and Nathan's relationship increasingly unravels as Stingo grows closer to Sophie and Nathan's fragile mental state becomes ever more apparent.", 151, "English", "/6zayvLCWvF8ImK5UqwRUbETcpVU.jpg", 7.4000000000000004, new DateTime(1982, 12, 8, 0, 0, 0, 0, DateTimeKind.Unspecified), "Sophie's Choice" }
                });

            migrationBuilder.InsertData(
                table: "Movies",
                columns: new[] { "Id", "ActorId", "Certification", "Description", "Duration", "Language", "Picture", "Ratings", "ReleaseDate", "Title" },
                values: new object[,]
                {
                    { 15774, null, "L", "NASA employee Mohan Bhargav comes to India to take his grandmother along with him at his home abroad. During his stay at his native place, he comes across various social issues faced by the villagers and decides to take a stand for them, to improve their quality of life.", 189, "Hindi", "/yUSL24kpHc9Nls4Pohia4shgcIM.jpg", 7.4000000000000004, new DateTime(2004, 12, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), "Swades" },
                    { 15794, null, "NR", "A psychopathic criminal with a mother complex makes a daring break from prison and then leads his old gang in a chemical plant payroll heist. After the heist, events take a crazy turn.", 114, "English", "/cHpWtei3cX1IYLBArNWHJ7xev1q.jpg", 7.7000000000000002, new DateTime(1949, 9, 2, 0, 0, 0, 0, DateTimeKind.Unspecified), "White Heat" },
                    { 15859, null, "12", "A young couple's love is tested when Sun-jin is diagnosed with a rare form of Alzheimer's disease.", 115, "Korean", "/s9ulpxLbkeJTTYxqLVUl6PreLGN.jpg", 7.7000000000000002, new DateTime(2004, 11, 5, 0, 0, 0, 0, DateTimeKind.Unspecified), "A Moment to Remember" },
                    { 15916, null, null, "A mysterious young girl wanders a desolate, otherworldly landscape, carrying a large egg.", 71, "Japanese", "/s65qAjKy6JqLqQUDj3Liuih0r1D.jpg", 7.7999999999999998, new DateTime(1985, 12, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), "Angel's Egg" },
                    { 15917, null, "PG", "Devdas is sent away by his father so he can improve himself but upon his return his father still doesn’t welcome him back. Devdas and Paro are in love but Paro is a lower caste and is set to be married to an older widower. Devdas is devastated & leaves home. He becomes an alcoholic womanizer and falls in love with a courtesan. Paro tries to get Devdas away from drinking before he self destructs.", 185, "Hindi", "/dUBFi7bnLRfm4WaTh4ZoF2tbBJj.jpg", 7.5999999999999996, new DateTime(2002, 7, 11, 0, 0, 0, 0, DateTimeKind.Unspecified), "Devdas" },
                    { 15919, null, "NR", "Marty, a butcher who lives in the Bronx with his mother is unmarried at 34. Good-natured but socially awkward he faces constant badgering from family and friends to get married but has reluctantly resigned himself to bachelorhood. Marty meets Clara, an unattractive school teacher, realising their emotional connection, he promises to call but family and friends try to convince him not to.", 90, "English", "/8tnGO5VoAQII4DbE3hozWKhV4BY.jpg", 7.5, new DateTime(1955, 4, 11, 0, 0, 0, 0, DateTimeKind.Unspecified), "Marty" },
                    { 15999, null, "R", "D has been hired to track down Meier Link, a notoriously powerful vampire who has abducted a woman, Charlotte Elbourne. D's orders are strict - find Charlotte, at any cost. For the first time, D faces serious competition. The Markus Brothers, a family of Vampire Hunters, were hired for the same bounty. D Must intercept Meier and conquer hostile forces on all sides in a deadly race against time.", 103, "Japanese", "/4hJUWgdmoFsNpzyTN6QjoZcaivO.jpg", 7.4000000000000004, new DateTime(2000, 8, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "Vampire Hunter D: Bloodlust" },
                    { 16052, null, "PG", "In this biographical drama, Selena Quintanilla is born into a musical Mexican-American family in Texas. Her father, Abraham, realizes that his young daughter is talented and begins performing with her at small venues. She finds success and falls for her guitarist, Chris Perez, who draws the ire of her father. Seeking mainstream stardom, Selena begins recording an English-language album which, tragically, she would never complete.", 127, "English", "/j8xX3yBAFOayfSaImgLZPnAcdWz.jpg", 7.7000000000000002, new DateTime(1997, 3, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), "Selena" },
                    { 16085, null, "G", "The story of the life of comedienne Fanny Brice, from her early days in the Jewish slums of the Lower East Side, to the height of her career with the Ziegfeld Follies, including her marriage to and eventual divorce from her second husband, Nick Arnstein.", 149, "English", "/rXFRIv35SgcmaUqRjmGniwSopRW.jpg", 7.2999999999999998, new DateTime(1968, 9, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), "Funny Girl" },
                    { 16234, null, "PG-13", "The Joker is back with a vengeance, and Gotham's newest Dark Knight, Terry McGinnis, needs answers as he stands alone to face Gotham's most infamous Clown Prince of Crime.", 76, "English", "/7RlBs0An83fqAuKfwH5gKMcqgMc.jpg", 7.4000000000000004, new DateTime(2000, 12, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), "Batman Beyond: Return of the Joker" },
                    { 16237, null, null, "America's coolest heroes, the Teen Titans, go to Tokyo to track down the mysterious Japanese criminal Brushogun.", 75, "English", "/uUIczHTpnBDC6Mbp0dFGDZldcc1.jpg", 7.5999999999999996, new DateTime(2006, 9, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Teen Titans: Trouble in Tokyo" },
                    { 16305, null, "NR", "Successful movie director John L. Sullivan, convinced he won't be able to film his ambitious masterpiece until he has suffered, dons a hobo disguise and sets off on a journey, aiming to \"know trouble\" first-hand. When all he finds is a train ride back to Hollywood and a beautiful blonde companion, he redoubles his efforts, managing to land himself in more trouble than he bargained for when he loses his memory and ends up a prisoner on a chain gang.", 91, "English", "/lHl3HDlqSVyoe7mSq0LATTIuWLy.jpg", 7.5999999999999996, new DateTime(1941, 11, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Sullivan's Travels" },
                    { 16306, null, "PG", "On the planet Ygam, the Draags, extremely technologically and spiritually advanced blue humanoids, consider the tiny Oms, human beings descendants of Terra's inhabitants, as ignorant animals. Those who live in slavery are treated as simple pets and used to entertain Draag children; those who live hidden in the hostile wilderness of the planet are periodically hunted and ruthlessly slaughtered as if they were vermin.", 72, "French", "/prq0j1S0K07UjwLZLF6oMGflRUI.jpg", 7.7999999999999998, new DateTime(1973, 12, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "Fantastic Planet" },
                    { 16307, null, "R", "Police sergeant Neil Howie is called to an island village in search of a missing girl whom the locals claim never existed. Stranger still, however, are the rituals that take place there.", 94, "English", "/vs9I9RFIGYaIn3XQXkuNy2BrTCt.jpg", 7.2999999999999998, new DateTime(1973, 12, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Wicker Man" },
                    { 16320, null, "PG-13", "When the renegade crew of Serenity agrees to hide a fugitive on their ship, they find themselves in an action-packed battle between the relentless military might of a totalitarian regime who will destroy anything – or anyone – to get the girl back and the bloodthirsty creatures who roam the uncharted areas of space. But... the greatest danger of all may be on their ship.", 119, "English", "/2ZOm4cedJanmN85ZiWrwZPUNv0d.jpg", 7.4000000000000004, new DateTime(2005, 9, 3, 0, 0, 0, 0, DateTimeKind.Unspecified), "Serenity" },
                    { 16328, null, "PG", "Joe, a young American soldier, is hit by a mortar shell on the last day of World War I. He lies in a hospital bed with a fate worse than death as a quadruple amputee who has lost his arms, legs, eyes, ears, mouth and nose. Unbeknown to his doctors, he remains conscious and able to think, thereby reliving his life through strange dreams and memories.", 111, "English", "/ryIY3FPmTtXu9g6W4I69qCdkxKj.jpg", 7.5, new DateTime(1971, 8, 4, 0, 0, 0, 0, DateTimeKind.Unspecified), "Johnny Got His Gun" },
                    { 16372, null, "NR", "A young governess for two children becomes convinced that the house and grounds are haunted.", 100, "English", "/amWo1n1N5ziPY4AFa7AFQpOWPGb.jpg", 7.4000000000000004, new DateTime(1961, 12, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Innocents" },
                    { 16391, null, "NR", "A group of Anglican nuns, led by Sister Clodagh, are sent to a mountain in the Himalayas. The climate in the region is hostile and the nuns are housed in an odd old palace. They work to establish a school and a hospital, but slowly their focus shifts. Sister Ruth falls for a government worker, Mr. Dean, and begins to question her vow of celibacy. As Sister Ruth obsesses over Mr. Dean, Sister Clodagh becomes immersed in her own memories of love.", 100, "English", "/37TXnILqURzYqpFjLY5qzLgEF0n.jpg", 7.7999999999999998, new DateTime(1947, 5, 26, 0, 0, 0, 0, DateTimeKind.Unspecified), "Black Narcissus" },
                    { 16520, null, "G", "Widowed Welsh mother Anna Loenowens becomes a governess and English tutor to the wives and many children of the stubborn King Mongkut of Siam. Anna and the King have a clash of personalities as she works to teach the royal family about the English language, customs and etiquette, and rushes to prepare a party for a group of European diplomats who must change their opinions about the King.", 133, "English", "/v3sj9BKlV38Yk0MqQMBdNVtZAhr.jpg", 7.2999999999999998, new DateTime(1956, 6, 29, 0, 0, 0, 0, DateTimeKind.Unspecified), "The King and I" },
                    { 16563, null, "G", "In 1850 Oregon, when a backwoodsman brings a wife home to his farm, his six brothers decide that they want to get married too.", 102, "English", "/yh7kjN7ysSeFMWRDl0izqq6j8Ie.jpg", 7.2999999999999998, new DateTime(1954, 7, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), "Seven Brides for Seven Brothers" },
                    { 16619, null, "R", "Beth, Calvin, and their son Conrad are living in the aftermath of the death of the other son. Conrad is overcome by grief and misplaced guilt to the extent of a suicide attempt. He is in therapy. Beth had always preferred his brother and is having difficulty being supportive to Conrad. Calvin is trapped between the two trying to hold the family together.", 124, "English", "/kPt2AQiSP39g3I1TtAnjSGQwN9S.jpg", 7.5999999999999996, new DateTime(1980, 9, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), "Ordinary People" },
                    { 16633, null, "PG", "Young writer Richard Collier is met on the opening night of his first play by an old lady who begs him to \"Come back to me\". Mystified, he tries to find out about her, and learns that she is a famous stage actress from the early 1900s. Becoming more and more obsessed with her, by self-hypnosis he manages to travel back in time—where he meets her.", 103, "English", "/5Uov0nLJb8khO9BIsSCkEzMW9jD.jpg", 7.4000000000000004, new DateTime(1980, 10, 2, 0, 0, 0, 0, DateTimeKind.Unspecified), "Somewhere in Time" },
                    { 16642, null, "PG", "In 1910, a Chicago steel worker accidentally kills his supervisor and flees to the Texas panhandle with his girlfriend and little sister to work harvesting wheat in the fields of a stoic farmer. A love triangle, a swarm of locusts, a hellish fire—Malick captures it all with dreamlike authenticity, creating at once a timeless American idyll and a gritty evocation of turn-of-the-century labor.", 94, "English", "/dUug5qbctb2ruuClpdQitzkIxbc.jpg", 7.5999999999999996, new DateTime(1978, 9, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), "Days of Heaven" },
                    { 16646, null, "L", "A French marquis wanders through a vast labyrinth of corridors, theaters and ballrooms at a reception for a Persian ambassador.", 99, "Russian", "/fC8VAxlHL0OmwTQXw6YnMIZkGbd.jpg", 7.4000000000000004, new DateTime(2002, 5, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), "Russian Ark" },
                    { 16672, null, "18", "An entomologist suffers extreme psychological and sexual torture after being taken captive by the residents of a poor seaside village.", 147, "Japanese", "/rE6vtXBDXy3cjyFmxfsDese0Eo4.jpg", 8.3000000000000007, new DateTime(1964, 2, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Woman in the Dunes" },
                    { 16804, null, "PG-13", "Daigo, a cellist, is laid off from his orchestra and moves with his wife back to his small hometown where the living is cheaper. Thinking he’s applying for a job at a travel agency he finds he’s being interviewed for work with departures of a more permanent nature – as an undertaker’s assistant.", 130, "Japanese", "/mms4nMZuPYOyEengRxCaEk7SXMd.jpg", 7.7999999999999998, new DateTime(2008, 9, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), "Departures" },
                    { 16858, null, "R", "Joe Gideon is at the top of the heap, one of the most successful directors and choreographers in musical theater. But he can feel his world slowly collapsing around him - his obsession with work has almost destroyed his personal life, and only his bottles of pills keep him going.", 123, "English", "/culCEdj4srLljefgn4XKd6k3C5t.jpg", 7.4000000000000004, new DateTime(1979, 12, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), "All That Jazz" },
                    { 16859, null, "G", "A young witch, on her mandatory year of independent life, finds fitting into a new community difficult while she supports herself by running an air courier service.", 103, "Japanese", "/7nO5DUMnGUuXrA4r2h6ESOKQRrx.jpg", 7.7999999999999998, new DateTime(1989, 7, 29, 0, 0, 0, 0, DateTimeKind.Unspecified), "Kiki's Delivery Service" },
                    { 16869, null, "R", "In Nazi-occupied France during World War II, a group of Jewish-American soldiers known as \"The Basterds\" are chosen specifically to spread fear throughout the Third Reich by scalping and brutally killing Nazis. The Basterds, lead by Lt. Aldo Raine soon cross paths with a French-Jewish teenage girl who runs a movie theater in Paris which is targeted by the soldiers.", 153, "English", "/7sfbEnaARXDDhKm0CZ7D7uc2sbo.jpg", 8.1999999999999993, new DateTime(2009, 8, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), "Inglourious Basterds" },
                    { 16958, null, "NR", "Recently paroled from prison, legendary burglar \"Doc\" Riedenschneider, with funding from Alonzo Emmerich, a crooked lawyer, gathers a small group of veteran criminals together in the Midwest for a big jewel heist.", 112, "English", "/kIkPJnMVvFPt08siIJB5G8h8WDO.jpg", 7.5, new DateTime(1950, 6, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Asphalt Jungle" },
                    { 17057, null, "NR", "An aspiring actress begins to suspect that her temperamental boyfriend is a murderer.", 94, "English", "/mR72XsO7EQu3uH8TeqPxMd9V8mW.jpg", 7.5999999999999996, new DateTime(1950, 5, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), "In a Lonely Place" },
                    { 17159, null, "R", "Eddie Murphy delights, shocks and entertains with dead-on celebrity impersonations, observations on '80s love, sex and marriage, a remembrance of Mom's hamburgers and much more.", 90, "English", "/irVU3PHIdg36Rh8tSKnKCdmHLEO.jpg", 7.2999999999999998, new DateTime(1987, 11, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "Eddie Murphy Raw" },
                    { 17295, null, "NR", "Tracing the struggle of the Algerian Front de Liberation Nationale to gain freedom from French colonial rule as seen through the eyes of Ali from his start as a petty thief to his rise to prominence in the organisation and capture by the French in 1957. The film traces the rebels' struggle and the increasingly extreme measures taken by the French government to quell the revolt.", 121, "Italian", "/9fHkCuYEKsu7j0xsI2HbBvlZNZc.jpg", 8.0, new DateTime(1966, 9, 8, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Battle of Algiers" },
                    { 17431, null, "R", "With only three weeks left in his three year contract, Sam Bell is getting anxious to finally return to Earth. He is the only occupant of a Moon-based manufacturing facility along with his computer and assistant, GERTY. When he has an accident however, he wakens to find that he is not alone.", 97, "English", "/cJ6JnuLwCNbiAAOBuHDjRTP7bQJ.jpg", 7.5999999999999996, new DateTime(2009, 6, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), "Moon" },
                    { 17483, null, "12", "Forced to give up his dreams of art school, Zach works dead-end jobs to support his sister and her son. Questioning his life, he paints, surfs and hangs out with his best friend, Gabe. When Gabe's older brother returns home for the summer, Zach suddenly finds himself drawn into a relationship he didn't expect.", 97, "English", "/eYA8KiSnIAbxtoIgg4lpZjB0dfz.jpg", 7.7999999999999998, new DateTime(2007, 6, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), "Shelter" },
                    { 17529, null, "G", "The murder of her father sends a teenage tomboy on a mission of 'justice', which involves avenging her father's death. She recruits a tough old marshal, 'Rooster' Cogburn because he has 'true grit', and a reputation of getting the job done.", 128, "English", "/aM8s7NckrZvxR9IGYNk4nRYEoiV.jpg", 7.4000000000000004, new DateTime(1969, 6, 11, 0, 0, 0, 0, DateTimeKind.Unspecified), "True Grit" },
                    { 17654, null, "R", "Thirty years ago, aliens arrive on Earth. Not to conquer or give aid, but to find refuge from their dying planet. Separated from humans in a South African area called District 9, the aliens are managed by Multi-National United, which is unconcerned with the aliens' welfare but will do anything to master their advanced technology. When a company field agent contracts a mysterious virus that begins to alter his DNA, there is only one place he can hide: District 9.", 112, "English", "/tuGlQkqLxnodDSk6mp5c2wvxUEd.jpg", 7.4000000000000004, new DateTime(2009, 8, 5, 0, 0, 0, 0, DateTimeKind.Unspecified), "District 9" },
                    { 17809, null, "R", "Chen Zhen, a Chinese engineering student in Kyoto, who braves the insults and abuse of his Japanse fellow students for his local love Mitsuko Yamada, daughter of the director, returns in 1937 to his native Shangai, under Japanse protectorate -in fact military occupation- after reading about the death of his kung-fu master Hou Ting-An in a fight against the Japanese champion Ryuichi Akutagawa.", 103, "Mandarin", "/Aqa1Yuog2OFrduwSffxZc2w4Tnk.jpg", 7.4000000000000004, new DateTime(1994, 12, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), "Fist of Legend" },
                    { 17814, null, "R", "The lone inhabitants of an abandoned police station are under attack by the overwhelming numbers of a seemingly unstoppable street gang.", 91, "English", "/hT4Ry5rN1eoAEvZaevuFAYY7SYa.jpg", 7.2999999999999998, new DateTime(1976, 11, 5, 0, 0, 0, 0, DateTimeKind.Unspecified), "Assault on Precinct 13" },
                    { 18079, null, "R", "Two con artists try to swindle a stamp collector by selling him a sheet of counterfeit rare stamps (the \"nine queens\").", 114, "Spanish", "/tabMRXUTTBmprGax6ON2r9yBN0D.jpg", 7.7999999999999998, new DateTime(2000, 8, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Nine Queens" },
                    { 18148, null, "NR", "The elderly Shukishi and his wife, Tomi, take the long journey from their small seaside village to visit their adult children in Tokyo. Their elder son, Koichi, a doctor, and their daughter, Shige, a hairdresser, don't have much time to spend with their aged parents, and so it falls to Noriko, the widow of their younger son who was killed in the war, to keep her in-laws company.", 137, "Japanese", "/g2YbTYKpY7N2yDSk7BfXZ18I5QV.jpg", 8.3000000000000007, new DateTime(1953, 11, 3, 0, 0, 0, 0, DateTimeKind.Unspecified), "Tokyo Story" },
                    { 18311, null, "NR", "Yuddy, a Hong Kong playboy known for breaking girls' hearts, tries to find solace and the truth after discovering the woman who raised him isn't his mother.", 94, "Cantonese", "/acfLUO8E61u0ooWS6htbzTHDBcI.jpg", 7.2999999999999998, new DateTime(1990, 12, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Days of Being Wild" }
                });

            migrationBuilder.InsertData(
                table: "Movies",
                columns: new[] { "Id", "ActorId", "Certification", "Description", "Duration", "Language", "Picture", "Ratings", "ReleaseDate", "Title" },
                values: new object[,]
                {
                    { 18320, null, "PG", "As the only legitimate heir of England's King William, teenage Victoria gets caught up in the political machinations of her own family. Victoria's mother wants her to sign a regency order, while her Belgian uncle schemes to arrange a marriage between the future monarch and Prince Albert, the man who will become the love of her life.", 105, "English", "/iGyuReyij3bPCtzJdSjTR8PR0pa.jpg", 7.2000000000000002, new DateTime(2009, 3, 4, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Young Victoria" },
                    { 18329, null, "PG-13", "A gay couple takes a trip to Argentina in search of a new beginning, but instead begins drifting even further apart.", 96, "Mandarin", "/jIv3EiZIC2tkBmjQ747Lyf5c61b.jpg", 7.5999999999999996, new DateTime(1997, 5, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Happy Together" },
                    { 18333, null, "15", "An artist in crisis is haunted by nightmares from the past on a windy island. Between midnight and dawn, he tells his wife about his most painful memories.", 90, "Swedish", "/shdLRnyJ1UbySD8V9OOXnJyOm3U.jpg", 7.5999999999999996, new DateTime(1968, 2, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), "Hour of the Wolf" },
                    { 18438, null, "12", "Mr. Kim is jobless, lost in debt and has been dumped by his girlfriend. He decides to end it all by jumping into the Han River - only to find himself washed up on a small, mid-river island. He soon abandons thoughts of suicide or rescue and begins a new life as a castaway. His antics catch the attention of a young woman whose apartment overlooks the river. Her discovery changes both their lives.", 119, "Korean", "/gGzovvmOEyNVUu4WEHtw9wfDsqI.jpg", 8.0, new DateTime(2009, 5, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), "Castaway on the Moon" },
                    { 18491, null, "MA15+", "The second of two theatrically released follow-ups to the Neon Genesis Evangelion series. Comprising of two alternate episodes which were first intended to take the place of episodes 25 and 26, this finale answers many of the questions surrounding the series, while also opening up some new possibilities.", 87, "Japanese", "/m9PTii0XWCIKZBBrCrOn8RLTK0w.jpg", 8.4000000000000004, new DateTime(1997, 7, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), "Neon Genesis Evangelion: The End of Evangelion" },
                    { 18785, null, "R", "When three friends finally come to after a raucous night of bachelor-party revelry, they find a baby in the closet and a tiger in the bathroom. But they can't seem to locate their best friend, Doug – who's supposed to be tying the knot. Launching a frantic search for Doug, the trio perseveres through a nasty hangover to try to make it to the church on time.", 100, "English", "/sSiHLVPbNWvsn3zsrJqeugfQOvh.jpg", 7.2999999999999998, new DateTime(2009, 6, 2, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Hangover" },
                    { 18900, null, "R", "After a botched robbery results in the brutal murder of a rural family, two drifters elude police, in the end coming to terms with their own mortality and the repercussions of their vile atrocity.", 134, "English", "/hXRyR0kfB64aj2y76JBjRSRQYOw.jpg", 7.5999999999999996, new DateTime(1967, 12, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), "In Cold Blood" },
                    { 18917, null, null, "A quiet young English girl named Alice finds herself in an alternate version of her own reality after chasing a white rabbit. She becomes surrounded by living inanimate objects and stuffed dead animals, and must find a way out of this nightmare- no matter how twisted or odd that way must be. A memorably bizarre screen version of Lewis Carroll’s novel ‘Alice’s Adventures in Wonderland’.", 86, "Czech", "/8o460rJZt7GY3j7QmLPeJrQWNwD.jpg", 7.5, new DateTime(1988, 8, 3, 0, 0, 0, 0, DateTimeKind.Unspecified), "Alice" },
                    { 18925, null, "PG", "A losing coach with an underdog football team faces their giants of fear and failure on and off the field to surprising results.", 111, "English", "/33gkfCURxgBBpiAnrWua4Txmrvs.jpg", 7.4000000000000004, new DateTime(2006, 9, 29, 0, 0, 0, 0, DateTimeKind.Unspecified), "Facing the Giants" },
                    { 18947, null, "R", "The Boat That Rocked is an ensemble comedy, where the romance is between the young people of the 60s, and pop music. It's about a band of DJs that captivate Britain, playing the music that defines a generation and standing up to a government that  wanted control of popular culture via the British Broadcasting Corporation. Loosely based on the events in Britain in the 60's when the Labour government of Harold Wilson, wanted to bring the pirate radio stations under control, enough to see the passage of the Marine Broadcasting Offences Act on 15 August 1967. Also known as \"Pirate Radio\".", 135, "English", "/oT2XDQ08SzbhXGIsjyKPfuiKYo.jpg", 7.2999999999999998, new DateTime(2009, 4, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Boat That Rocked" },
                    { 18988, null, "PG", "1183 AD: King Henry II's three sons all want to inherit the throne, but he won't commit to a choice. They and his wife variously plot to force him.  An aging and conniving King Henry II of England and Ireland plans a reunion where he hopes to name his successor. He summons the following people for the holiday at his chateau and primary residence in Chinon, Anjou, within the Angevin Empire of medieval France: his scheming but imprisoned wife, Queen Eleanor of Aquitaine; his mistress, Princess Alais, whom he wishes to marry; his three sons, gay Richard the Lionheart , Geoffrey, and John, all of whom desire the throne; and the young, but crafty King Philip II of France, who is also Alais' half-brother.", 134, "English", "/jGBUg9xHKn7YSQfxsClAJWpymYV.jpg", 7.5, new DateTime(1968, 10, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Lion in Winter" },
                    { 19026, null, "L", "Once upon a time there were two children nursed by same woman. Azur, a blonde, blue-eyed son of a noblewoman and Asmar, the dark skinned and dark-eyed child of the nurse. As kids, they fought and loved each other as brothers do. As grown ups, they mercilessly become rivals in the quest years later, when Azur is being haunted by memories of the legendary Djinn-fairy, and takes it upon himself to journey all the way to Asmar's homeland to seek it out. Now reunited, he finds that she has since become a successful merchant, while Asmar is now a member of the royal guard. However, Asmar also longs to find the Djinn-fairy, and only one of the two youths can be successful in their que", 99, "French", "/1fHS31OqjfqUi0ltay1U5TMsEgT.jpg", 7.7000000000000002, new DateTime(2006, 5, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), "Azur & Asmar: The Princes' Quest" },
                    { 19067, null, "PG", "In 1800, as Napoleon Bonaparte rises to power in France, a rivalry erupts between Armand and Gabriel, two lieutenants in the French Army, over a perceived insult. For over a decade, they engage in a series of duels amidst larger conflicts, including the failed French invasion of Russia in 1812, and shifts in the political and social systems of Europe.", 100, "English", "/rph2FaQyyqw2oikYNVuzEAgeFxU.jpg", 7.4000000000000004, new DateTime(1977, 8, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Duellists" },
                    { 19100, null, "U", "Set in 1992, a manager Vincent has to run a children's holiday camp for three weeks and to face the unexpected concerning the place, his colleagues, various problems linked to children about the rooms, trips, their belongings...", 103, "French", "/lTOm5grqVEIIkUzAsDHcKLrEkcv.jpg", 7.4000000000000004, new DateTime(2006, 6, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), "Those Happy Days" },
                    { 19101, null, "G", "When her father enlists to fight for the British in WWI, young Sara Crewe goes to New York to attend the same boarding school her late mother attended. She soon clashes with the severe headmistress, Miss Minchin, who attempts to stifle Sara's creativity and sense of self- worth.", 97, "English", "/1bK5wt5eHeWTGHsrEpahRG6HFI6.jpg", 7.5999999999999996, new DateTime(1995, 5, 10, 0, 0, 0, 0, DateTimeKind.Unspecified), "A Little Princess" },
                    { 19223, null, "T", "Onoff is a famous writer, now a recluse. The Inspector is suspicious when Onoff is brought into the station one night, disoriented and suffering a kind of amnesia. In an isolated, rural police station, the Inspector tries to establish the events surrounding a killing, to reach a startling resolution.", 108, "French", "/yBIc2Mc0Ds5HiYD1YOXGD3xTTUI.jpg", 7.7000000000000002, new DateTime(1994, 5, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "A Pure Formality" },
                    { 19236, null, "NC-17", "A young man is confined in a mental hospital. Through a flashback we see that he was traumatized as a child, when he and his family were circus performers: he saw his father cut off the arms of his mother, a religious fanatic and leader of the heretical church of Santa Sangre (\"Holy Blood\"), and then commit suicide. Back in the present, he escapes and rejoins his surviving and armless mother.", 123, "English", "/sF4nk70J0FGBHlf0WTPWx7LS37l.jpg", 7.2999999999999998, new DateTime(1989, 11, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), "Santa Sangre" },
                    { 19404, null, "G", "Raj is a rich, carefree, happy-go-lucky second generation NRI. Simran is the daughter of Chaudhary Baldev Singh, who in spite of being an NRI is very strict about adherence to Indian values. Simran has left for India to be married to her childhood fiancé. Raj leaves for India with a mission at his hands, to claim his lady love under the noses of her whole family. Thus begins a saga.", 190, "Hindi", "/2CAL2433ZeIihfX1Hb2139CX0pW.jpg", 8.6999999999999993, new DateTime(1995, 10, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), "Dilwale Dulhania Le Jayenge" },
                    { 19426, null, "16", "Rome, 1957. A woman, Cabiria, is robbed and left to drown by her boyfriend, Giorgio. Rescued, she resumes her life and tries her best to find happiness in a cynical world. Even when she thinks her struggles are over and she has found happiness and contentment, things may not be what they seem.", 110, "Italian", "/xF4oCG3PLNbcrtPZbqB3BtkIbKg.jpg", 8.0999999999999996, new DateTime(1957, 10, 3, 0, 0, 0, 0, DateTimeKind.Unspecified), "Nights of Cabiria" },
                    { 19542, null, "NR", "In this classic drama, Vicky Page is an aspiring ballerina torn between her dedication to dance and her desire to love. While her imperious instructor, Boris Lermontov, urges to her to forget anything but ballet, Vicky begins to fall for the charming young composer Julian Craster. Eventually Vicky, under great emotional stress, must choose to pursue either her art or her romance, a decision that carries serious consequences.", 133, "English", "/7kUiA3FlSnZcsULjz1PhPZbo2gp.jpg", 8.0999999999999996, new DateTime(1948, 7, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Red Shoes" },
                    { 19666, null, "PG", "In 1890s India, an arrogant British commander challenges the harshly taxed residents of Champaner to a high-stakes cricket match.", 224, "Hindi", "/yNX9lFRAFeNLNRIXdqZK9gYrYKa.jpg", 7.4000000000000004, new DateTime(2001, 6, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Lagaan: Once Upon a Time in India" },
                    { 19908, null, "R", "Columbus has made a habit of running from what scares him. Tallahassee doesn't have fears. If he did, he'd kick their ever-living ass. In a world overrun by zombies, these two are perfectly evolved survivors. But now, they're about to stare down the most terrifying prospect of all: each other.", 88, "English", "/dUkAmAyPVqubSBNRjRqCgHggZcK.jpg", 7.2999999999999998, new DateTime(2009, 10, 7, 0, 0, 0, 0, DateTimeKind.Unspecified), "Zombieland" },
                    { 19913, null, "PG-13", "Tom, greeting-card writer and hopeless romantic, is caught completely off-guard when his girlfriend, Summer, suddenly dumps him. He reflects on their 500 days together to try to figure out where their love affair went sour, and in doing so, Tom rediscovers his true passions in life.", 95, "English", "/f9mbM0YMLpYemcWx6o2WeiYQLDP.jpg", 7.2000000000000002, new DateTime(2009, 7, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), "(500) Days of Summer" },
                    { 19995, null, "PG-13", "In the 22nd century, a paraplegic Marine is dispatched to the moon Pandora on a unique mission, but becomes torn between following orders and protecting an alien civilization.", 162, "English", "/6EiRUJpuoeQPghrs3YNktfnqOVh.jpg", 7.5, new DateTime(2009, 12, 10, 0, 0, 0, 0, DateTimeKind.Unspecified), "Avatar" },
                    { 20108, null, "U", "The story of a donkey Balthazar as he is passed from owner to owner, some kind and some cruel but all with motivations beyond his understanding. Balthazar, whose life parallels that of his first keeper, Marie, is truly a beast of burden, suffering the sins of humankind. But despite his powerlessness, he accepts his fate nobly.", 96, "French", "/yjjimOb9fFA5DQ0EAtZdY1CN9bf.jpg", 7.7000000000000002, new DateTime(1966, 5, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "Au Hasard Balthazar" },
                    { 20123, null, "16", "In this luminous tale set in the former Yugoslavia, Perhan, an engaging young Romany with telekinetic powers, is seduced by the quick-cash world of petty crime that threatens to destroy him and those he loves.", 142, "Serbo-Croatian", "/zqmXRqHHSTqOnrjyvnEr0P028o5.jpg", 7.9000000000000004, new DateTime(1988, 12, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), "Time of the Gypsies" },
                    { 20126, null, "R", "A musician witnesses the murder of a famous psychic, and then teams up with a fiesty reporter to find the killer while evading attempts on their lives by the unseen killer bent on keeping a dark secret buried.", 127, "Italian", "/wq7RxV5gMvgO0EKeWpNhegnpJBh.jpg", 7.9000000000000004, new DateTime(1975, 3, 7, 0, 0, 0, 0, DateTimeKind.Unspecified), "Deep Red" },
                    { 20139, null, "NR", "A private school for young girls is scandalized when one spiteful student, Mary Tilford, accuses the two young women who run the school of having a lesbian relationship.", 108, "English", "/goyEWixvULM2IRN4KsKibyrJE4J.jpg", 7.9000000000000004, new DateTime(1961, 12, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Children's Hour" },
                    { 20246, null, "NR", "A man working for the War Crimes Commission suspects that an important Nazi official has folded himself into a quaint Connecticut town.", 96, "English", "/eDwHUFDXqDkziPeISJcSaOqZWjm.jpg", 7.4000000000000004, new DateTime(1946, 7, 2, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Stranger" },
                    { 20271, null, "T", "Ferdinando Cefalù is desperate to marry his cousin, Angela, but he is married to Rosalia and divorce is illegal in Italy. To get around the law, he tries to trick his wife into having an affair so he can catch her and murder her, as he knows he would be given a light sentence for killing an adulterous woman. He persuades a painter to lure his wife into an affair, but Rosalia proves to be more faithful than he expected.", 104, "Italian", "/vZbdSpUFyFiDBBTY0AiSrN9f303.jpg", 8.0, new DateTime(1961, 12, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), "Divorce Italian Style" },
                    { 20312, null, "R", "An aspiring painter meets various characters and learns valuable lessons while traveling across America.", 116, "English", "/oQB6EunMq8pqtMy1BJ6FG6GR5Ae.jpg", 7.2999999999999998, new DateTime(2002, 4, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), "Interstate 60" },
                    { 20334, null, "NR", "Two employees at a gift shop can barely stand one another, without realising that they are falling in love through the post as each other's anonymous pen pal.", 99, "English", "/bvTCgevhkxaUOJdMf20bYhXJYcU.jpg", 7.7999999999999998, new DateTime(1940, 1, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Shop Around the Corner" },
                    { 20453, null, "12세 이상 관람가", "In the tradition of “Ferris Bueller’s Day Off” comes this refreshing comedy about a rebellious prankster with a crafty mind and a heart of gold. Rascal. Joker. Dreamer. Genius... You've never met a college student quite like \"Rancho.\" From the moment he arrives at India's most prestigious university, Rancho's outlandish schemes turn the campus upside down—along with the lives of his two newfound best friends. Together, they make life miserable for \"Virus,\" the school’s uptight and heartless dean. But when Rancho catches the eye of the dean's sexy daughter, Virus sets his sights on flunking out the \"3 idiots\" once and for all.", 170, "Hindi", "/k1iWMypGjk1b59oCHLtyfd4hw99.jpg", 8.0, new DateTime(2009, 12, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), "3 Idiots" },
                    { 20530, null, "AL", "Noriko is perfectly happy living at home with her widowed father, Shukichi, and has no plans to marry -- that is, until her aunt Masa convinces Shukichi that unless he marries off his 27-year-old daughter soon, she will likely remain alone for the rest of her life. When Noriko resists Masa's matchmaking, Shukichi is forced to deceive his daughter and sacrifice his own happiness to do what he believes is right.", 110, "Japanese", "/iNtRSY2AGjW1VDXDR79bKsNUdus.jpg", 8.1999999999999993, new DateTime(1949, 9, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), "Late Spring" },
                    { 20532, null, null, "In medieval Japan a compassionate governor is sent into exile. His wife and children try to join him, but are separated, and the children grow up amid suffering and oppression.", 124, "Japanese", "/rSlZ8iM4vRM0sZrrJNmjln4kZir.jpg", 8.3000000000000007, new DateTime(1954, 3, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Sansho the Bailiff" },
                    { 20620, null, "R", "A secret organisation offers wealthy people a second chance at life. The customer picks out someone they want to be and the organisation surgically alters the customer to look like the intended person, stages the customer's death, gets rid of the intended person and the customer takes on a new life.", 107, "English", "/mZtEXN7b7DWsn0BEqIKB10eZFi9.jpg", 7.2999999999999998, new DateTime(1966, 10, 5, 0, 0, 0, 0, DateTimeKind.Unspecified), "Seconds" },
                    { 20722, null, null, "La Maison en Petits Cubes tells the story of a grandfather's memories as he adds more blocks to his house to stem the flooding waters.", 12, "Japanese", "/1FhBKs0aOXkbAB8veAyqVZqbNe1.jpg", 8.0, new DateTime(2008, 6, 10, 0, 0, 0, 0, DateTimeKind.Unspecified), "La Maison en Petits Cubes" },
                    { 20803, null, "12+", "Shurik Timofeev builds a working model of a time machine. By accident, Ivan Bunsha, an apartment complex manager, and George Miloslavsky, a petty burglar, are transferred to 16th century Moscow, while Tsar Ivan the Terrible goes into the year 1973.", 93, "Russian", "/xZJ5TwUY1SORUKnf8Mdd1wsXviC.jpg", 8.0, new DateTime(1973, 9, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), "Ivan Vasilyevich Changes His Profession" },
                    { 20914, null, "R", "Four middle-aged friends in Florence organize together idle pranks (called zingarate, \"gypsy shenanigans\") in a continuous attempt to prolong childhood during their adult life.", 140, "Italian", "/8Pm8SLjq2UHCwisd56ipHtzvZI1.jpg", 8.1999999999999993, new DateTime(1975, 8, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "My Friends" },
                    { 20941, null, "R", "A young boy, in an effort to have a normal childhood in 1980's El Salvador, is caught up in a dramatic fight for his life as he desperately tries to avoid the war which is raging all around him", 120, "Spanish", "/itvJGid1nVNV3e2yIqzWX5xameM.jpg", 8.0, new DateTime(2004, 11, 5, 0, 0, 0, 0, DateTimeKind.Unspecified), "Innocent Voices" },
                    { 21032, null, "G", "An outcast half-wolf risks his life to prevent a deadly epidemic from ravaging Nome, Alaska.", 78, "English", "/dCVcdb5oxDizqFLz0F7TE60NoC9.jpg", 7.2999999999999998, new DateTime(1995, 12, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), "Balto" },
                    { 21135, null, null, "This romantic drama by Michelangelo Antonioni follows the love life of Vittoria, a beautiful literary translator living in Rome. After splitting from her writer boyfriend, Riccardo, Vittoria meets Piero, a lively stockbroker, on the hectic floor of the Roman stock exchange. Though Vittoria and Piero begin a relationship, it is not one without difficulties, and their commitment to one another is tested during an eclipse.", 126, "Italian", "/oXoe0Fp92Yw3mMJ9Vq0hPlaMELg.jpg", 7.7999999999999998, new DateTime(1962, 4, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), "L'Eclisse" }
                });

            migrationBuilder.InsertData(
                table: "Movies",
                columns: new[] { "Id", "ActorId", "Certification", "Description", "Duration", "Language", "Picture", "Ratings", "ReleaseDate", "Title" },
                values: new object[,]
                {
                    { 21191, null, "R", "Sayra, a Honduran teen, hungers for a better life. Her chance for one comes when she is reunited with her long-estranged father, who intends to emigrate to Mexico and then enter the United States. Sayra's life collides with a pair of Mexican gangmembers who have boarded the same American-bound train.", 96, "Spanish", "/wncX4fshBUDvB2CaW3AYG7i3nUd.jpg", 7.5999999999999996, new DateTime(2009, 3, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), "Sin nombre" },
                    { 21334, null, "0", "Zohre's shoes are gone; her older brother Ali lost them. They are poor, there are no shoes for Zohre until they come up with an idea: they will share one pair of shoes, Ali's. School awaits...", 89, "Persian", "/jWqh1CJWAEcxckMRrf6ARhIEh0R.jpg", 7.9000000000000004, new DateTime(1997, 8, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "Children of Heaven" },
                    { 21348, null, "U", "Drawn from elements of West African folk tales, it depicts how a newborn boy, Kirikou, saves his village from the evil witch Karaba.", 70, "French", "/9RNrozaagFmpm6m0CP7q4XDcIXj.jpg", 7.2999999999999998, new DateTime(1998, 12, 9, 0, 0, 0, 0, DateTimeKind.Unspecified), "Kirikou and the Sorceress" },
                    { 21450, null, "NR", "An unemployed Brit vents his rage on unsuspecting strangers as he embarks on a nocturnal London odyssey.", 131, "English", "/xOx8xig7zywnLhqEzSdnhzg97va.jpg", 7.5, new DateTime(1993, 9, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), "Naked" },
                    { 21484, null, "R", "A young woman left her family for an unspecified reason. The husband determines to find out the truth and starts following his wife. At first, he suspects that a man is involved. But gradually, he finds out more and more strange behaviors and bizarre incidents that indicate something more than a possessed love affair.", 123, "French", "/cwZJUi57NTWwXdPBXjxmj3wQCC.jpg", 7.4000000000000004, new DateTime(1981, 5, 27, 0, 0, 0, 0, DateTimeKind.Unspecified), "Possession" },
                    { 21575, null, "R", "Sentenced to six years in prison, Malik El Djebena is alone in the world and can neither read nor write. On his arrival at the prison, he seems younger and more brittle than the others detained there. At once he falls under the sway of a group of Corsicans who enforce their rule in the prison. As the 'missions' go by, he toughens himself and wins the confidence of the Corsican group.", 155, "French", "/6TsOz1pUjwroHxuYA8OdebPZpdy.jpg", 7.5999999999999996, new DateTime(2009, 8, 26, 0, 0, 0, 0, DateTimeKind.Unspecified), "A Prophet" },
                    { 21634, null, "PG", "Bobby Griffith was his mother's favorite son, the perfect all-American boy growing up under deeply religious influences in Walnut Creek, California. Bobby was also gay. Struggling with a conflict no one knew of, much less understood, Bobby finally came out to his family.", 90, "English", "/1viFwXluAettogGDsTrSUUg29lZ.jpg", 8.0999999999999996, new DateTime(2009, 1, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), "Prayers for Bobby" },
                    { 21641, null, "R", "Taking over Leeds United, Brian Clough's abrasive approach and his clear dislike of the players' dirty style of play make it certain there is going to be friction. Glimpses of his earlier career help explain both his hostility to previous manager Don Revie and how much he is missing right-hand man Peter Taylor.", 97, "English", "/ftlbCma6QoRiZgiflVmLuPKHrkq.jpg", 7.2999999999999998, new DateTime(2009, 3, 27, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Damned United" },
                    { 21734, null, "PG", "A bored teen living in Santa Rosa, California, Charlotte \"Charlie\" Newton, is frustrated because nothing seems to be happening in her life and that of her family. Then, she receives wonderful news: her uncle (for whom she was named), Charlie Oakley, is arriving for a visit. But Uncle Charlie may not be the man he seems to be.", 108, "English", "/ptyWagbWE8jSGyV2tGEzAdVbRCj.jpg", 7.5999999999999996, new DateTime(1943, 1, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Shadow of a Doubt" },
                    { 21832, null, "NR", "Originally a collection of clips from the Neon Genesis Evangelion TV series, Death was created as a precursor to the re-worked ending of the series. Rebirth was intended as that re-worked ending, but after production overruns Rebirth became only the first half of the first part of The End of Evangelion, with some minor differences.", 101, "Japanese", "/lXBjqzo6c4NyLuJtqOiH39kswji.jpg", 7.5999999999999996, new DateTime(1997, 3, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Neon Genesis Evangelion: Death and Rebirth" },
                    { 22164, null, "R", "In Los Angeles, an ex-con takes the underground fighting world by storm in his quest to fulfill a promise to a dead friend.", 93, "English", "/4XoqjwKhqN3GlGt0fQtcY2OhkZq.jpg", 7.2999999999999998, new DateTime(2009, 2, 7, 0, 0, 0, 0, DateTimeKind.Unspecified), "Blood and Bone" },
                    { 22504, null, "U", "The kingdom of Takicardie quakes under the rule of the tyrannical King Charles V-et-III-font-VIII-et-VIII-font-XIV, whose favourite pastime is shooting birds. His archenemy is a cheeky mockingbird, whose favourite pastime is thwarting the king’s attempts to shoot birds. One night, a portrait of the king comes to life and disposes of the real king, taking his place. The portrait king falls in love with a young shepherdess in another painting and intends to marry her. But, alas, the shepherdess has fallen in love with a chimneysweep and together they elope from the king’s palace. Enraged, the king sends his police to capture them and once they are within his power he forces the shepherdess to marry him. The mockingbird must use all his guile and courage to once more thwart the king and bring his evil reign to an end.", 83, "French", "/yDbfVUrb9b0Dkm1TptWtzkujXBk.jpg", 7.7999999999999998, new DateTime(1980, 3, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), "The King and the Mockingbird" },
                    { 22538, null, "PG-13", "As bass guitarist for a garage-rock band, Scott Pilgrim has never had trouble getting a girlfriend; usually, the problem is getting rid of them. But when Ramona Flowers skates into his heart, he finds she has the most troublesome baggage of all: an army of ex-boyfriends who will stop at nothing to eliminate him from her list of suitors.", 112, "English", "/g5IoYeudx9XBEfwNL0fHvSckLBz.jpg", 7.4000000000000004, new DateTime(2010, 8, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), "Scott Pilgrim vs. the World" },
                    { 22584, null, "NR", "A Martinique charter boat skipper gets mixed up with the underground French resistance operatives during WWII.", 100, "English", "/m6EjBAY7gA6tx5RMutXGtZWFzyI.jpg", 7.5, new DateTime(1945, 1, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), "To Have and Have Not" },
                    { 22596, null, "NR", "When a store clerk organizes a contest to climb the outside of a tall building, circumstances force him to make the perilous climb himself.", 74, "English", "/jWoeNjQPtRZJbS0LRPesY9uizgS.jpg", 7.7999999999999998, new DateTime(1923, 4, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "Safety Last!" },
                    { 22683, null, "NR", "Gifted Hands: The Ben Carson Story is a movie based on the life story of world-renowned neurosurgeon Ben Carson from 1961 to 1987.", 86, "English", "/cvuy284WV0B0t78Ay3GRtto51Vd.jpg", 7.7999999999999998, new DateTime(2009, 2, 7, 0, 0, 0, 0, DateTimeKind.Unspecified), "Gifted Hands: The Ben Carson Story" },
                    { 22803, null, "R", "A frustrated man decides to take justice into his own hands after a plea bargain sets one of his family's killers free. He targets not only the killer but also the district attorney and others involved in the deal.", 109, "English", "/fcEXcip7v0O1ndV4VUdFqJSqbOg.jpg", 7.2999999999999998, new DateTime(2009, 10, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Law Abiding Citizen" },
                    { 22843, null, "NR", "Under constant attack by monstrous creatures called Angels that seek to eradicate humankind, U.N. Special Agency NERV introduces two new EVA pilots to help defend the city of Tokyo-3: the mysterious Makinami Mari Illustrous and the intense Asuka Langley Shikinami. Meanwhile, Gendo Ikari and SEELE proceed with a secret project that involves both Rei and Shinji.", 112, "Japanese", "/7VLYN2CfJpB6PrcuzDKKqdGSUi6.jpg", 7.9000000000000004, new DateTime(2009, 6, 26, 0, 0, 0, 0, DateTimeKind.Unspecified), "Evangelion: 2.0 You Can (Not) Advance" },
                    { 22881, null, "PG-13", "The story of Michael Oher, a homeless and traumatized boy who became an All American football player and first round NFL draft pick with the help of a caring woman and her family.", 129, "English", "/bMgq7VBriuBFknXEe9E9pVBYGZq.jpg", 7.5999999999999996, new DateTime(2009, 11, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Blind Side" },
                    { 23550, null, "R", "When Antonia's husband Massimo is killed in a car accident, she accidentally discovers that he has been having a same-sex affair with a produce wholesaler named Michele.", 106, "Italian", "/cRShNiSEMT7KBQovVCoZYrKpXQ1.jpg", 7.2999999999999998, new DateTime(2001, 3, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), "His Secret Life" },
                    { 23832, null, "16", "A group of rogues steal a scroll granting its bearer the property of the land of Aurocastro in Apulia (south of Italy). They elect a shaggy knight, Brancaleone from Norcia, as their leader, and decide to get possession of this supposedly wealthy land. Many adventures will occurr during the journey.", 120, "Italian", "/yDc3AREBRCjP3GXOeCwHpCSDYM7.jpg", 7.7000000000000002, new DateTime(1966, 4, 7, 0, 0, 0, 0, DateTimeKind.Unspecified), "For Love and Gold" },
                    { 24160, null, "T", "The four old friends meet on the grave of the fifth of them, Perozzi, who died at the end of the first episode. Time has passed but they are still up for adventures and cruel jokes, and while they recall the one they created together with the late friend, new ones are on their way, starting right there at the cemetery.", 130, "Italian", "/cUXEfnzCqMw7OpPhRHFtwVND6hK.jpg", 7.7000000000000002, new DateTime(1982, 12, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), "My Friends Act II" },
                    { 24167, null, "U", "Widowed shopkeeper Cesira and her 13-year-old daughter Rosetta flee from the allied bombs in Rome during the second World War; they travel to the remote village where Cesira was born. During their journey and in the village and onward, the mother does everything she can to protect Rosetta. Meanwhile, a sensitive young intellectual, Michele, falls in love with Cesira.", 100, "Italian", "/biWDAUQD58enMEcyO2BqIVSycF4.jpg", 7.9000000000000004, new DateTime(1960, 12, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), "Two Women" },
                    { 24188, null, "6", "Roberto, a shy law student in Rome, meets Bruno, a forty-year-old exuberant, capricious man, who takes him for a drive through the Roman and Tuscany countries in the summer. Along the way, they end up knowing each other and entering each other's lives. A twist at the end puts everything into perspective.", 105, "Italian", "/44ZtEB1warv5SSbxX2b92EGNfqK.jpg", 8.3000000000000007, new DateTime(1962, 12, 4, 0, 0, 0, 0, DateTimeKind.Unspecified), "Il Sorpasso" },
                    { 24226, null, "R", "Frank Galvin is a down-on-his-luck lawyer and reduced to drinking and ambulance chasing, when a former associate reminds him of his obligations in a medical malpractice suit by serving it to Galvin on a silver platter—all parties are willing to settle out of court. Blundering his way through the preliminaries, Galvin suddenly realizes that the case should actually go to court—to punish the guilty, to get a decent settlement for his clients... and to restore his standing as a lawyer.", 129, "English", "/iYEuFP1bpj5yOenKliiRFcNO3VE.jpg", 7.4000000000000004, new DateTime(1982, 12, 8, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Verdict" },
                    { 24238, null, "NR", "A tale of friendship between two unlikely pen pals: Mary, a lonely, eight-year-old girl living in the suburbs of Melbourne, and Max, a forty-four-year old, severely obese man living in New York. In the mid-1970s, a homely, friendless Australian girl of 8 picks a name out of a Manhattan phone book and writes to him; she includes a chocolate bar. He writes back, with chocolate. Thus begins a 20-year correspondence. Will the two ever meet face to face?", 92, "English", "/b4LKlquh0ls5Rgb27QLPlkC7Oya.jpg", 7.7999999999999998, new DateTime(2009, 2, 9, 0, 0, 0, 0, DateTimeKind.Unspecified), "Mary and Max" },
                    { 24382, null, "T", "Best friends Peppe and Mario are thieves, but they're not very good at it. Still, Peppe thinks that he's finally devised a master heist that will make them rich. With the help of some fellow criminals, he plans to dig a tunnel from a rented apartment to the pawnshop next door, where they can rob the safe. But his plan is far from foolproof, and the fact that no one in the group has any experience digging tunnels proves to be the least of their problems.", 106, "Italian", "/f5OxD8Nl0pR3DcYHtYhHRfpsmjl.jpg", 8.1999999999999993, new DateTime(1958, 6, 6, 0, 0, 0, 0, DateTimeKind.Unspecified), "Big Deal on Madonna Street" },
                    { 24428, null, "PG-13", "When an unexpected enemy emerges and threatens global safety and security, Nick Fury, director of the international peacekeeping agency known as S.H.I.E.L.D., finds himself in need of a team to pull the world back from the brink of disaster. Spanning the globe, a daring recruitment effort begins!", 143, "English", "/RYMX2wcKCBAr24UyPD7xwmjaTn.jpg", 7.7000000000000002, new DateTime(2012, 4, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Avengers" },
                    { 24480, null, "G", "Everyone knows that the stork delivers babies, but where do the storks get the babies from? The answer lies up in the stratosphere, where cloud people sculpt babies from clouds and bring them to life. Gus, a lonely and insecure grey cloud, is a master at creating \"dangerous\" babies. Crocodiles, porcupines, rams and more - Gus's beloved creations are works of art, but more than a handful for his loyal delivery stork partner, Peck. As Gus's creations become more and more rambunctious, Peck's job gets harder and harder. How will Peck manage to handle both his hazardous cargo and his friend's fiery temperament?", 5, "English", "/pHHWwdv77IUlyGlfEZxkB3yJcij.jpg", 7.9000000000000004, new DateTime(2009, 5, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), "Partly Cloudy" },
                    { 24653, null, "12", "Lugano, Switzerland. Titta Di Girolamo is a discreet and sullen man who has been living for almost a decade in a modest hotel room, a prisoner of an atrocious routine, apparently without purpose. His past is a mystery, nobody knows what he does for a living, he answers indiscreet questions evasively. What secrets does this enigmatic man hide?", 100, "Italian", "/2ubdrvMHcRTFzkUdmSIuvupLqRS.jpg", 7.5999999999999996, new DateTime(2004, 9, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Consequences of Love" },
                    { 24657, null, "U", "Alexander, a journalist, philosopher and retired actor, celebrates a birthday with friends and family when it is announced that nuclear war has begun.", 146, "Swedish", "/v7nEBG4ulpGol1QKC5EHnLomFa.jpg", 7.7000000000000002, new DateTime(1986, 5, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Sacrifice" },
                    { 25188, null, "R", "High school seniors and best friends, Sonny and Duane, live in a dying Texas town. The handsome Duane is dating a local beauty, while Sonny is having an affair with the coach's wife. As graduation nears and both boys contemplate their futures. Duane eyes the army and Sonny takes over a local business. Each struggles to figure out if he can escape this dead-end town and build a better life somewhere else.", 119, "English", "/sq2HpOW7PLWmOcofQrA9NoEyZI0.jpg", 7.7000000000000002, new DateTime(1971, 10, 3, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Last Picture Show" },
                    { 25237, null, "NR", "The invasion of a village in Byelorussia by German forces sends young Florya into the forest to join the weary Resistance fighters, against his family's wishes. There he meets a girl, Glasha, who accompanies him back to his village. On returning home, Florya finds his family and fellow peasants massacred. His continued survival amidst the brutal debris of war becomes increasingly nightmarish, a battle between despair and hope.", 142, "Russian", "/90A8sXK9QZVJ7Rj8nLdsj5NuO5s.jpg", 8.3000000000000007, new DateTime(1985, 9, 3, 0, 0, 0, 0, DateTimeKind.Unspecified), "Come and See" },
                    { 25253, null, "U", "An aging gangster, Fernand Naudin is hoping for a quiet retirement when he suddenly inherits a fortune from an old friend, a former gangster supremo known as the Mexican. If he is ambivalent about his new found wealth, Fernand is positively nonplussed to discover that he has also inherited his benefactor’s daughter, Patricia. Unfortunately, not only does Fernand have to put up with the thoroughly modern Patricia and her nauseating boyfriend, but he also had to contend with the Mexican’s trigger-happy former employees, who are determined to make a claim.", 105, "French", "/1aZixNERm68Y5ZMzTxWl1PdDyFo.jpg", 7.7999999999999998, new DateTime(1963, 11, 27, 0, 0, 0, 0, DateTimeKind.Unspecified), "Crooks in Clover" },
                    { 25364, null, "NR", "A frustrated former big-city journalist now stuck working for an Albuquerque newspaper exploits a story about a man trapped in a cave to revitalize his career, but the situation quickly escalates into an out-of-control media circus.", 111, "English", "/1NwZ6Sx4Eq7eT02abcI7YqfXdJk.jpg", 7.9000000000000004, new DateTime(1951, 6, 29, 0, 0, 0, 0, DateTimeKind.Unspecified), "Ace in the Hole" },
                    { 25376, null, "R", "A retired legal counselor writes a novel hoping to find closure for one of his past unresolved homicide cases and for his unreciprocated love with his superior - both of which still haunt him decades later.", 130, "Spanish", "/r3FctmAMk2tbrwxuWdpeLrZLwIz.jpg", 8.0, new DateTime(2009, 8, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Secret in Their Eyes" },
                    { 25403, null, "T", "Nanni Moretti recalls in his diary three slice of life stories characterized by a sharply ironic look: in the first one he wanders through a deserted Rome, in the second he visits a reclusive friend on an island, and in the last he has to grapple with an unknown illness.", 100, "Italian", "/rAjbgSUvZDoy5jPbC5jD6pWvlyZ.jpg", 7.5, new DateTime(1993, 10, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), "Caro diario" },
                    { 25468, null, "PG", "Wallace Shawn and Andre Gregory, apparently playing themselves, share their lives over the course of an evening meal at a restaurant.", 110, "English", "/jLza5FLlGRlF0Py6d0cXP4RP66B.jpg", 7.5999999999999996, new DateTime(1981, 10, 11, 0, 0, 0, 0, DateTimeKind.Unspecified), "My Dinner with Andre" },
                    { 25538, null, "U", "Each member of a family in Taipei asks hard questions about life's meaning as they live through everyday quandaries.", 174, "Mandarin", "/hTPkCpK9SLGDMXRbUwzoep0MxOx.jpg", 8.0, new DateTime(2000, 9, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), "Yi Yi" },
                    { 25606, null, "T", "A good-natured but unlucky Italian is constantly going on a difficult situations, but never lose his mood.", 108, "Italian", "/7RUzOGm3juTEFLcpk91r5NvhcyN.jpg", 7.7999999999999998, new DateTime(1975, 3, 27, 0, 0, 0, 0, DateTimeKind.Unspecified), "White Collar Blues" },
                    { 25623, null, null, "Hoping to find a sense of connection to her late mother, Gorgeous takes a trip to the country to visit her aunt at their ancestral house. She invites her six friends, Prof, Melody, Mac, Fantasy, Kung Fu, and Sweet, to join her. The girls soon discover that there is more to the old house than meets the eye.", 88, "Japanese", "/lhnQOGDYZJ4r4FJV74tsa4sqKam.jpg", 7.4000000000000004, new DateTime(1977, 8, 26, 0, 0, 0, 0, DateTimeKind.Unspecified), "House" },
                    { 25673, null, "NR", "An ambitious young man wins an heiress's heart but has to cope with his former girlfriend's pregnancy.", 122, "English", "/dtA0uDcCYMTtdEXRriBw0Sl0LZM.jpg", 7.2999999999999998, new DateTime(1951, 6, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), "A Place in the Sun" }
                });

            migrationBuilder.InsertData(
                table: "Movies",
                columns: new[] { "Id", "ActorId", "Certification", "Description", "Duration", "Language", "Picture", "Ratings", "ReleaseDate", "Title" },
                values: new object[,]
                {
                    { 25793, null, "R", "Set in Harlem in 1987, Claireece \"Precious\" Jones is a 16-year-old African American girl born into a life no one would want. She's pregnant for the second time by her absent father; at home, she must wait hand and foot on her mother, an angry woman who abuses her emotionally and physically. School is chaotic and Precious has reached the ninth grade with good marks and a secret; She can't read.", 110, "English", "/60wotd9fKVUGidpClFAyXWV8TKc.jpg", 7.2999999999999998, new DateTime(2009, 11, 6, 0, 0, 0, 0, DateTimeKind.Unspecified), "Precious" },
                    { 25846, null, "T", "Giuseppe Tornatore traces three generations of a Sicilian family in in the Sicilian town of Bagheria (known as Baarìa in the local Sicilian dialect), from the 1930s to the 1980s, to tell the story of the loves, dreams and delusions of an unusual community.", 150, "Italian", "/n7YkB7IpXrKG6qMTppZgXGn5ORs.jpg", 7.2999999999999998, new DateTime(2009, 9, 2, 0, 0, 0, 0, DateTimeKind.Unspecified), "Baarìa" },
                    { 25866, null, "U", "In this Frenco-Italian gangster parody, a shop keeper on his way to an Italian holiday suffers a crash which totals his car. The culprit can only compensate his ruined trip by driving an American friends car from Napels to Bordeaux, but as it happens to be filled with such contraband as stolen money, jewelry and drugs, the involuntary and unwitting companions in crime soon attract all but recreational attention from the \"milieu\".", 111, "French", "/3UstvghyA6ywebZ4ti22guRscuP.jpg", 7.4000000000000004, new DateTime(1965, 3, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Sucker" },
                    { 26022, null, "PG-13", "Rizwan Khan, a Muslim from the Borivali section of Mumbai, has Asperger's syndrome. He marries a Hindu single mother, Mandira, in San Francisco. After 9/11, Rizwan is detained by authorities at LAX who treat him as a terrorist because of his condition and his race.", 165, "Hindi", "/5Y36lCiNyyV71mjq6LavgiggbhT.jpg", 8.0999999999999996, new DateTime(2010, 2, 11, 0, 0, 0, 0, DateTimeKind.Unspecified), "My Name Is Khan" },
                    { 26280, null, "14A", "Hubert, a brash 17-year-old, is confused and torn by a love-hate relationship with his mother that consumes him more and more each day. After distressing ordeals and tragic episodes, Hubert will find his mother on the banks of Saint Lawrence river, where he grew up, and where a murder will be committed: the murder of childhood.", 96, "French", "/w4nkNjeDFtxNYg80YD8IrtAstoJ.jpg", 7.5999999999999996, new DateTime(2009, 6, 5, 0, 0, 0, 0, DateTimeKind.Unspecified), "I Killed My Mother" },
                    { 26371, null, "R", "After his lover rejects him, a young man trapped by the oppressiveness of Edwardian society tries to come to terms with and accept his sexuality.", 140, "English", "/4MI2y8XViPrDiKs1p0QC4bTeZzf.jpg", 7.5, new DateTime(1987, 8, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), "Maurice" },
                    { 26451, null, "16", "Rome, Italy. After committing a heinous crime, a senior police officer exposes evidence incriminating him because his moral commitment prevents him from circumventing the law and the social order it protects.", 111, "Italian", "/vPTZwlq1IC4o1DCsEZEl2uGljzm.jpg", 8.3000000000000007, new DateTime(1970, 10, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), "Investigation of a Citizen Above Suspicion" },
                    { 26596, null, "16", "On the outskirts of town, the hard-nosed Vienna owns a saloon frequented by the undesirables of the region, including Dancin' Kid and his gang. Another patron of Vienna's establishment is Johnny Guitar, a former gunslinger and her lover. When a heist is pulled in town that results in a man's death, Emma Small, Vienna's rival, rallies the townsfolk to take revenge on Vienna's saloon – even without proof of her wrongdoing.", 110, "English", "/oxzEtTh44J4CxSFniuBdzshLXyy.jpg", 7.5, new DateTime(1954, 5, 26, 0, 0, 0, 0, DateTimeKind.Unspecified), "Johnny Guitar" },
                    { 26617, null, "R", "A drop-out from upper-class America picks up work along the way on oil-rigs when his life isn't spent in a squalid succession of bars, motels, and other points of interest.", 98, "English", "/AciLTjLqyHiEA0lq35CV4Atnm4v.jpg", 7.2000000000000002, new DateTime(1970, 9, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), "Five Easy Pieces" },
                    { 26638, null, "NR", "Amid the modern wastelands and toxic factories of Italy, wife and mother Giuliana desperately tries to conceal her tenuous grip on reality from those around her, especially her successful yet neglectful husband, Ugo. Ugo's old pal, Corrado, shows up in town on a business trip and is more sensitive to Giuliana's anxieties. They begin an affair, but it does little to quell Giuliana's existential fears, and her mental state rapidly deteriorates.", 117, "Italian", "/swyZQsvpeAbKUC4iOXEnCgUTuMg.jpg", 7.4000000000000004, new DateTime(1964, 9, 4, 0, 0, 0, 0, DateTimeKind.Unspecified), "Red Desert" },
                    { 26842, null, "PG", "Handsomely-mounted historical epic concerns the birth of the Islamic faith and the story of the prophet Mohammed.", 178, "English", "/qVCBMg4ZuLPnWhIWJHD9IP4nIuY.jpg", 7.2999999999999998, new DateTime(1976, 3, 9, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Message" },
                    { 26963, null, "NR", "Adventure awaits 12 year old Brendan who must fight Vikings and a serpent god to find a crystal and complete the legendary Book of Kells. In order to finish Brother Aiden's book, Brendan must overcome his deepest fears on a secret quest that will take him beyond the abbey walls and into the enchanted forest where dangerous mythical creatures hide. Will Brendan succeed in his quest?", 71, "English", "/yd97XgZ9DbKF80vJU2hg8gRqae8.jpg", 7.4000000000000004, new DateTime(2009, 2, 9, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Secret of Kells" },
                    { 27040, null, null, "A woman returning home falls asleep and has vivid dreams that may or may not be happening in reality. Through repetitive images and complete mismatching of the objective view of time and space, her dark inner desires play out on-screen.", 14, "English", "/8yXHYjCETselsH2KWwrVYcjzPjr.jpg", 7.9000000000000004, new DateTime(1943, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "Meshes of the Afternoon" },
                    { 27205, null, "PG-13", "Cobb, a skilled thief who commits corporate espionage by infiltrating the subconscious of his targets is offered a chance to regain his old life as payment for a task considered to be impossible: \"inception\", the implantation of another person's idea into a target's subconscious.", 148, "English", "/9gk7adHYeDvHkCSEqAvQNLV5Uge.jpg", 8.3000000000000007, new DateTime(2010, 7, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Inception" },
                    { 27327, null, "PG", "In this rock opera hybrid of Phantom of the Opera and Faust, fledgling singer-songwriter Winslow Leach finds himself double-crossed by the nefarious music producer Swan, who steals both his music and the girl Leach wants to sing it, Phoenix, for the grand opening of his rock palace, The Paradise. After Swan sends Leach to prison for trespassing, Leach endures a freak accident which leaves him disfigured and plans his revenge on both Swan and The Paradise, becoming the Phantom of the Paradise.", 92, "English", "/qDOtGWeSQNwB3dG7Amt1K0JW0az.jpg", 7.5, new DateTime(1974, 10, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Phantom of the Paradise" },
                    { 27632, null, "NR", "A vengeful witch and her fiendish servant return from the grave and begin a bloody campaign to possess the body of the witch's beautiful look-alike descendant. Only the girl's brother and a handsome doctor stand in her way.", 87, "Italian", "/wpwETIDNFZQrWYvPjAqv8xOaHtK.jpg", 7.5, new DateTime(1960, 8, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), "Black Sunday" },
                    { 27670, null, "NR", "A teacher (Saverio) and a schoolkeeper (Mario) get lost in the Italian countryside. They find themselves in the late 15th century, they met Leonardo da Vinci and try to teach him how to play cards, they try to stop Columbus, they sing beatles's song etc...", 113, "Italian", "/aTHhTvqMRSnbaILwCXVeSqMLcDO.jpg", 7.7999999999999998, new DateTime(1984, 12, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), "Nothing Left to Do but Cry" },
                    { 28055, null, "18", "Inspector Sylvester is assigned to investigate the violent murder of a fashion house model Isabella, by a masked assailant. As the investigation proceeds all of the house’s various sins, including corruption, abortions, blackmail and drug addiction, begin to come to light. It turns out that Isabella had kept a diary detailing these vices, and now almost every employee becomes nervous.", 88, "Italian", "/1svQx4zHRjFTwy320O5vk4Re1Hg.jpg", 7.4000000000000004, new DateTime(1964, 4, 10, 0, 0, 0, 0, DateTimeKind.Unspecified), "Blood and Black Lace" },
                    { 28162, null, "PG", "When a young airman miraculously survives bailing out of his aeroplane without a parachute, he falls in love with an American radio operator. But the officials in the other world realise their mistake, and dispatch an angel to collect him.", 104, "English", "/diYVom5WuqNzhlRceem8onA197e.jpg", 7.7999999999999998, new DateTime(1946, 12, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "A Matter of Life and Death" },
                    { 28178, null, "G", "A drama based on the true story of a college professor's bond with the abandoned dog he takes into his home.", 93, "English", "/cuuzSt0dzY6k9xduN9tTSCIUvZ7.jpg", 8.0, new DateTime(2009, 6, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), "Hachi: A Dog's Tale" },
                    { 28422, null, null, "The story of a teenage boy named Yu, who falls for Yoko, a girl he runs into while working as an \"up-skirt\" photographer in an offshoot of the porn industry. His attempts to woo her are complicated by a spot of cross-dressing - which convinces Yoko that she is lesbian - dalliances with kung-fu and crime, and a constant struggle with the guilt that's a legacy of his Catholic upbringing.", 237, "Japanese", "/3QSGUdzG374H7pOxIdKNBpeLEUk.jpg", 8.1999999999999993, new DateTime(2009, 1, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Love Exposure" },
                    { 28580, null, "NR", "Don Birnam, a long-time alcoholic, has been sober for ten days and appears to be over the worst... but his craving has just become more insidious. Evading a country weekend planned by his brother and girlfriend, he begins a four-day bender that just might be his last - one way or another.", 101, "English", "/5fZWKQREZ3QVNjBKMLa7NmqufnE.jpg", 7.5999999999999996, new DateTime(1945, 11, 29, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Lost Weekend" },
                    { 28874, null, "PG", "Kenji is your typical teenage misfit. He’s good at math, bad with girls, and spends most of his time hanging out in the all-powerful online community known as OZ. His second life is the only life he has — until the girl of his dreams, Natsuki, hijacks him for a starring role as a fake fiancé at her family reunion. Things only get stranger from there. A late-night email containing a cryptic mathematic riddle leads to the unleashing of a rogue AI intent on using the virtual world of OZ to destroy the real world. As Armageddon looms on the horizon, Kenji and his new “family” set aside their differences and band together to save the worlds they inhabit in this “near-perfect blend of social satire and science fiction.”", 114, "Japanese", "/yHy8TrRLnuBZ4t2C0l0pSpRXVHO.jpg", 7.5, new DateTime(2009, 8, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "Summer Wars" },
                    { 28971, null, "G", "A fading music hall comedian tries to help a despondent ballet dancer learn to walk and to again feel confident about life.", 137, "English", "/sC31TDVXloovIsLLiTvVJERvjFS.jpg", 8.0, new DateTime(1952, 10, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), "Limelight" },
                    { 28978, null, "G", "Charlie, a wandering tramp, becomes a circus handyman - soon the star of the show - and falls in love with the circus owner's stepdaughter.", 72, "English", "/3FywbVq2qGqbYHPCy2NJcOf0gmp.jpg", 8.0999999999999996, new DateTime(1928, 1, 6, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Circus" },
                    { 29259, null, null, "Four prison inmates have been hatching a plan to literally dig out of jail when another prisoner, Claude Gaspard, is moved into their cell. They take a risk and share their plan with the newcomer. Over the course of three days, the prisoners and friends break through the concrete floor using a bed post and begin to make their way through the sewer system -- yet their escape is anything but assured.", 132, "French", "/8kxtOm7D992iAaOzUoWmNQwbXjs.jpg", 8.3000000000000007, new DateTime(1960, 3, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), "Le Trou" },
                    { 29264, null, "U", "After a lavish dinner party, the guests find themselves mysteriously unable to leave the room.", 94, "Spanish", "/ttA4HFg4SaGWvE7dx5GLuYCvSiv.jpg", 8.0, new DateTime(1962, 5, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Exterminating Angel" },
                    { 29455, null, "15", "A Swedish pastor fails a loving woman, a suicidal fisherman and God.", 80, "Swedish", "/wDxrEssdjFWYwIZLbr06RQNcg1q.jpg", 7.9000000000000004, new DateTime(1963, 2, 11, 0, 0, 0, 0, DateTimeKind.Unspecified), "Winter Light" },
                    { 29458, null, null, "The true story of Peppino Impastato, a young political activist who opposed the Mafia in the small town of Cinisi, Sicily.  \"One hundred steps\" was the distance between Impastato's house and the house of Mafia boss Tano Badalamenti.", 114, "Italian", "/bOlvydlHIKQO7h29O6tXL1m05Xa.jpg", 7.7999999999999998, new DateTime(2000, 9, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "One Hundred Steps" },
                    { 29845, null, "R", "Mabel Longhetti, desperate and lonely, is married to a Los Angeles municipal construction worker, Nick. Increasingly unstable, especially in the company of others, she craves happiness, but her extremely volatile behavior convinces Nick that she poses a danger to their family and decides to commit her to an institution for six months. Alone with a trio of kids to raise on his own, he awaits her return, which holds more than a few surprises.", 155, "English", "/6EJ4JoTxnH1QmGTE9pPzgtW1cLW.jpg", 7.7999999999999998, new DateTime(1974, 9, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), "A Woman Under the Influence" },
                    { 30018, null, "18", "A mother lives quietly with her son. One day, a girl is brutally killed, and the boy is charged with the murder. Now, it's his mother's mission to prove him innocent.", 129, "Korean", "/reAEOWk7UA14V1LMKWlK5pzsJui.jpg", 7.7999999999999998, new DateTime(2009, 5, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), "Mother" },
                    { 30020, null, "6", "A middle-aged Tehranian man, Mr. Badii is intent on killing himself and seeks someone to bury him after his demise. Driving around the city, the seemingly well-to-do Badii meets with numerous people, including a Muslim student, asking them to take on the job, but initially he has little luck. Eventually, Badii finds a man who is up for the task because he needs the money, but his new associate soon tries to talk him out of committing suicide.", 99, "Persian", "/u6GYH4HyR0BVwpqFuTOc2g4KB1L.jpg", 7.5999999999999996, new DateTime(1997, 9, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), "Taste of Cherry" },
                    { 30061, null, "PG-13", "A heroic version of Lex Luthor from an alternate universe appears to recruit the Justice League to help save his Earth from the Crime Syndicate, an evil version of the League. What ensues is the ultimate battle of good versus evil in a war that threatens both planets and, through a devious plan launched by Batman's counterpart Owlman, puts the balance of all existence in peril.", 75, "English", "/5Cjrxbv0BIxzgKFC9PYcgmPtnMV.jpg", 7.4000000000000004, new DateTime(2010, 2, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), "Justice League: Crisis on Two Earths" },
                    { 30197, null, "PG", "Broadway producer, Max Bialystock and his accountant, Leo Bloom plan to make money by charming little old ladies to invest in a production many times over what it will actually cost, and then put on a sure-fire flop, so nobody will ask for their money back – and what can be a more certain flop than a tasteless musical celebrating Hitler.", 88, "English", "/5TYUsAygWKtufAC78ep2AiohEiR.jpg", 7.2000000000000002, new DateTime(1967, 11, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Producers" },
                    { 30497, null, "R", "When Sally hears that her grandfather's grave may have been vandalized, she and her paraplegic brother, Franklin, set out with their friends to investigate. After a detour to their family's old farmhouse, they discover a group of crazed, murderous outcasts living next door. As the group is attacked one by one by the chainsaw-wielding Leatherface, who wears a mask of human skin, the survivors must do everything they can to escape.", 83, "English", "/9s8uSm5K1W0vhGPHv2icM6SFib8.jpg", 7.2999999999999998, new DateTime(1974, 10, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Texas Chain Saw Massacre" },
                    { 30588, null, "U", "The film is about an unemployed banker, Henri Verdoux, and his sociopathic methods of attaining income. While being both loyal and competent in his work, Verdoux has been laid-off. To make money for his wife and child, he marries wealthy widows and then murders them. His crime spree eventually works against him when two particular widows break his normal routine.", 124, "English", "/6LcFw7KyghfBo2vqk3cpdqPu4PW.jpg", 8.0, new DateTime(1947, 9, 26, 0, 0, 0, 0, DateTimeKind.Unspecified), "Monsieur Verdoux" },
                    { 30959, null, "M/16", "Taking its title from an archaic Japanese word meaning \"ghost story,\" this anthology adapts four folk tales. A penniless samurai marries for money with tragic results. A man stranded in a blizzard is saved by Yuki the Snow Maiden, but his rescue comes at a cost. Blind musician Hoichi is forced to perform for an audience of ghosts. An author relates the story of a samurai who sees another warrior's reflection in his teacup.", 183, "Japanese", "/vmYhFcA2YC15hoL44hQziba75Ij.jpg", 7.7999999999999998, new DateTime(1964, 12, 29, 0, 0, 0, 0, DateTimeKind.Unspecified), "Kwaidan" },
                    { 31011, null, "NR", "Nemo Nobody leads an ordinary existence with his wife and 3 children; one day, he wakes up as a mortal centenarian in the year 2092.", 141, "English", "/qNkIONc4Rgmzo23ph7qWp9QfVnW.jpg", 7.9000000000000004, new DateTime(2009, 11, 6, 0, 0, 0, 0, DateTimeKind.Unspecified), "Mr. Nobody" },
                    { 31216, null, "AL", "I CAN'T THINK STRAIGHT is a 2007 romance movie about a London-based Jordanian of Palestinian descent, Tala, who is preparing for an elaborate wedding. A turn of events causes her to have an affair and subsequently fall in love with another woman, Leyla, a British Indian.", 80, "English", "/1kapga6rkM5wNuQBYw7sdE42CrA.jpg", 7.5999999999999996, new DateTime(2008, 6, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "I Can't Think Straight" },
                    { 31411, null, "PG", "A photographer takes up newsreel shooting to impress a secretary.", 76, "English", "/prhMP7VVxpQTzOFIPsbnr41IDTN.jpg", 8.0, new DateTime(1928, 9, 10, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Cameraman" },
                    { 31417, null, null, "Dr. Génessier is riddled with guilt after an accident that he caused disfigures the face of his daughter, the once beautiful Christiane, who outsiders believe is dead. Dr. Génessier, along with accomplice and laboratory assistant Louise, kidnaps young women and brings them to the Génessier mansion. After rendering his victims unconscious, Dr. Génessier removes their faces and attempts to graft them on to Christiane's.", 84, "French", "/8y7Z9Gvcq52uOlJlUWyn2epGGRd.jpg", 7.5999999999999996, new DateTime(1960, 1, 11, 0, 0, 0, 0, DateTimeKind.Unspecified), "Eyes Without a Face" },
                    { 31442, null, "16+", "In WW2, twelve year old Soviet orphan Ivan Bondarev works for the Soviet army as a scout behind the German lines and strikes a friendship with three sympathetic Soviet officers.", 95, "Russian", "/vmRWSLP1DE9WTta0hfzIafJ0dID.jpg", 7.9000000000000004, new DateTime(1962, 5, 9, 0, 0, 0, 0, DateTimeKind.Unspecified), "Ivan's Childhood" }
                });

            migrationBuilder.InsertData(
                table: "Movies",
                columns: new[] { "Id", "ActorId", "Certification", "Description", "Duration", "Language", "Picture", "Ratings", "ReleaseDate", "Title" },
                values: new object[,]
                {
                    { 31522, null, "16", "Longing for a baby, a stripper pursues another man in order to make her boyfriend jealous.", 83, "French", "/xrZu21hriGJQY3qY8nifh2smVHu.jpg", 7.5, new DateTime(1961, 9, 6, 0, 0, 0, 0, DateTimeKind.Unspecified), "A Woman Is a Woman" },
                    { 31682, null, "T", "While on a boating trip, Scott Carey is exposed to a radioactive cloud. Nothing seems amiss at first, but several months later Scott realizes that he's shrunk in height by several inches. He sees a doctor, who admits that he's baffled. As Scott continues to shrink, decreasing to three feet tall, he becomes bitter, and lashes out at his wife, Louise. He begins to fear a cure will never be found -- since even as he becomes a national sensation, he's still shrinking.", 81, "English", "/vI7IdqfvsyoQAjAzRWS2fYvUoOu.jpg", 7.4000000000000004, new DateTime(1957, 2, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Incredible Shrinking Man" },
                    { 31767, null, "R", "A dramatised historical account of the rise and fall of Urbain Grandier, a 17th-century Roman Catholic priest accused of  witchcraft following alleged demonic possessions of sexually repressed nuns.", 111, "English", "/m6otjenPyLxqbKZyg1AvLKsJ45J.jpg", 7.5, new DateTime(1971, 7, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Devils" },
                    { 32085, null, "G", "Young Vincent Malloy dreams of being just like Vincent Price and loses himself in macabre daydreams that annoy his mother.", 6, "English", "/a9JJnAtgMlp8FxQRnEqqc6U6adm.jpg", 8.0, new DateTime(1982, 10, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "Vincent" },
                    { 32480, null, "T", "The marquess of Grillo is a good-natured, clever and women-loving man who is always inventing stories and cracking all types of jokes. The film tells the story of his life.", 135, "Italian", "/8JiJu0DHFYATN8aQFe62ufCxOc8.jpg", 7.7999999999999998, new DateTime(1981, 12, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Marquis of Grillo" },
                    { 32909, null, "12", "When barbarian hordes threaten her homeland, the brave and cunning Mulan disguises herself as a male soldier to swell the ranks in her aging father's stead. The warrior's remarkable courage drives her through powerful battle scenes and brutal wartime strategy. Mulan loses dear friends to the enemy's blade as she rises to become one of her country's most valuable leaders — but can she win the war before her secret is exposed?", 115, "Mandarin", "/cnaoBXyHN1RCXbQ2TVA7U1dt2TG.jpg", 7.5, new DateTime(2009, 11, 26, 0, 0, 0, 0, DateTimeKind.Unspecified), "Mulan: Rise of a Warrior" },
                    { 33273, null, "16", "The story of two men on different sides of a prison riot -- the inmate leading the rebellion and the young guard trapped in the revolt, who poses as a prisoner in a desperate attempt to survive the ordeal.", 110, "Spanish", "/koap5B3bQHQi3yaZ39vpWR66TGP.jpg", 7.5, new DateTime(2009, 11, 6, 0, 0, 0, 0, DateTimeKind.Unspecified), "Cell 211" },
                    { 33320, null, "PG", "Documentary filmmaker Genya Tachibana has tracked down the legendary actress Chiyoko Fujiwara, who mysteriously vanished at the height of her career. When he presents her with a key she had lost and thought was gone forever, the filmmaker could not have imagined that it would not only unlock the long-held secrets of Chiyoko’s life... but also his own.", 87, "Japanese", "/3UPXyiztvOxIzAdGmuCe8YRTr5e.jpg", 7.9000000000000004, new DateTime(2002, 8, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Millennium Actress" },
                    { 33602, null, "12", "A biopic of Temple Grandin, an autistic woman who has become one of top scientists in humane livestock handling.", 108, "English", "/gQhQ6yEkUkDDo1zugpq46PJN8xZ.jpg", 7.7999999999999998, new DateTime(2010, 2, 6, 0, 0, 0, 0, DateTimeKind.Unspecified), "Temple Grandin" },
                    { 33701, null, null, "In this sequel to Les Bronzes (1978) summer has passed, but that doesn't mean the fun has to end for Bernard, Nathalie, Gigi, Jerome, Popeye, Jean-Claude, and Christiane.", 90, "French", "/v0KfYebLSCAHn3mpo92G7DjwFBZ.jpg", 7.2999999999999998, new DateTime(1979, 11, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), "French Fried Vacation 2" },
                    { 33997, null, "12", "The autobiography of a Somalian nomad who was sold in marriage at 13, fled from Africa a while later to become finally an American supermodel and is now at the age of 38, the UN spokeswoman against female genital mutilation.", 120, "English", "/xjeWO3QLyFZGnM7phfkOMINZ8Is.jpg", 7.4000000000000004, new DateTime(2009, 9, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), "Desert Flower" },
                    { 34106, null, "NR", "Alice, the only relatively normal member of the eccentric Sycamore family, falls in love with Tony Kirby, but his wealthy banker father and snobbish mother strongly disapprove of the match. When the Kirbys are invited to dinner to become better acquainted with their future in-laws, things don't turn out the way Alice had hoped.", 126, "English", "/ysTiFXwTowOdDOUu9ikE21LPmdy.jpg", 7.5, new DateTime(1938, 9, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "You Can't Take It with You" },
                    { 34647, null, "NR", "This psychedelic tour of life after death is seen entirely from the point of view of Oscar, a young American drug dealer and addict living in Tokyo with his prostitute sister, Linda. When Oscar is killed by police during a bust gone bad, his spirit journeys from the past -- where he sees his parents before their deaths -- to the present -- where he witnesses his own autopsy -- and then to the future, where he looks out for his sister from beyond the grave.", 161, "English", "/krKnsfvSJM1PL40tLicRhVQ6kuG.jpg", 7.4000000000000004, new DateTime(2009, 6, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), "Enter the Void" },
                    { 34653, null, "R", "The life of George Falconer, a British college professor, is reeling with the recent and sudden loss of his longtime partner. This traumatic event makes George challenge his own will to live as he seeks the console of his close girl friend Charley, who is struggling with her own questions about life.", 97, "English", "/vhoM2LmcPlzcgBIztqqsSAYwaF7.jpg", 7.2999999999999998, new DateTime(2009, 10, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), "A Single Man" },
                    { 35690, null, "PG", "A drama centered on a rebellious girl who is sent to a Southern beach town for the summer to stay with her father. Through their mutual love of music, the estranged duo learn to reconnect.", 107, "English", "/deOzvJHnSSl8FI1HEJjPGgOsS9U.jpg", 7.2000000000000002, new DateTime(2010, 3, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Last Song" },
                    { 36040, null, "PG", "Under the pretense of having a picnic, a geologist takes his teenage daughter and 6-year-old son into the Australian outback and attempts to shoot them. When he fails, he turns the gun on himself, and the two city-bred children must contend with harsh wilderness alone. They are saved by a chance encounter with an Aborigine boy who shows them how to survive, and in the process underscores the disharmony between nature and modern life.", 95, "English", "/24vooYt5StgtgcQObVr1GHuM5gy.jpg", 7.2999999999999998, new DateTime(1971, 7, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "Walkabout" },
                    { 36557, null, "PG-13", "Le Chiffre, a banker to the world's terrorists, is scheduled to participate in a high-stakes poker game in Montenegro, where he intends to use his winnings to establish his financial grip on the terrorist market. M sends Bond—on his maiden mission as a 00 Agent—to attend this game and prevent Le Chiffre from winning. With the help of Vesper Lynd and Felix Leiter, Bond enters the most important poker game in his already dangerous career.", 144, "English", "/fQTZNBNDEQjOZhsP0SQkrnBa3Io.jpg", 7.5, new DateTime(2006, 11, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), "Casino Royale" },
                    { 36685, null, "R", "Sweethearts Brad and Janet, stuck with a flat tire during a storm, discover the eerie mansion of Dr. Frank-N-Furter, a transvestite scientist. As their innocence is lost, Brad and Janet meet a houseful of wild characters, including a rocking biker and a creepy butler. Through elaborate dances and rock songs, Frank-N-Furter unveils his latest creation: a muscular man named 'Rocky'.", 100, "English", "/3pyE6ZqDbuJi7zrNzzQzcKTWdmN.jpg", 7.5999999999999996, new DateTime(1975, 8, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Rocky Horror Picture Show" },
                    { 36940, null, "T", "The film tells the story of the Michelucci family, from the nineteen-seventies to the present day: the central character is the stunningly beautiful Anna, the lively, frivolous and sometimes embarrassing mother of Bruno and Valeria. Everything begins in the Summer of 1971, at the annual Summer beauty pageant held at Livorno’s most popular bathing establishment. Anna is unexpectedly crowned “Most Beautiful Mother”, unwittingly stirring the violent jealousy of her husband. From then on, chaos strikes the family and for Anna, Bruno and his sister Valeria, it is the start of an adventure that will only end thirty years later.", 122, "Italian", "/10MQjSuqDBNiPtxxO3zBqERw0q3.jpg", 7.2999999999999998, new DateTime(2010, 1, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "The First Beautiful Thing" },
                    { 37094, null, "R", "On the day of his daughter's birthday, William \"D-Fens\" Foster is trying to get to the home of his estranged ex-wife to see his daughter. His car breaks down, so he leaves his car in a traffic jam in Los Angeles and decides to walk. He goes to a convenience store and tries to get some change for a phone call, but the Korean owner does not oblige, tipping Foster over the edge. The unstable Foster, so frustrated with the various flaws he sees in society, begins to psychotically and violently lash out against them.", 113, "English", "/7ujqyF96Zg3rfrsh9M0cEF0Yzqj.jpg", 7.2999999999999998, new DateTime(1993, 2, 26, 0, 0, 0, 0, DateTimeKind.Unspecified), "Falling Down" },
                    { 37135, null, "G", "Tarzan was a small orphan who was raised by an ape named Kala since he was a child. He believed that this was his family, but on an expedition Jane Porter is rescued by Tarzan. He then finds out that he's human. Now Tarzan must make the decision as to which family he should belong to...", 88, "English", "/a0Syo09bmNJgehjfeVL6meR9Mjh.jpg", 7.4000000000000004, new DateTime(1999, 6, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), "Tarzan" },
                    { 37165, null, "PG", "Truman Burbank is the star of The Truman Show, a 24-hour-a-day reality TV show that broadcasts every aspect of his life without his knowledge. His entire life has been an unending soap opera for consumption by the rest of the world. And everyone he knows, including his wife and his best friend is really an actor, paid to be part of his life.", 103, "English", "/dOmxN9xhLITi43j2xGFEcsgv7QM.jpg", 8.0999999999999996, new DateTime(1998, 6, 4, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Truman Show" },
                    { 37181, null, "12", "The mysterious disappearance of a kindergarten teacher during a picnic in the north of Iran is followed by a series of misadventures for her fellow travelers.", 119, "Persian", "/ctLrMQrg3kss2JO7OIr7RVdN5an.jpg", 7.5, new DateTime(2009, 6, 6, 0, 0, 0, 0, DateTimeKind.Unspecified), "About Elly" },
                    { 37247, null, "PG", "Benjamin, a recent college graduate very worried about his future, finds himself in a love triangle with an older woman and her daughter.", 106, "English", "/qtVvdSsm2hvau6ItLe4gWdFKe2M.jpg", 7.7000000000000002, new DateTime(1967, 12, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Graduate" },
                    { 37257, null, "NR", "When Leonard Vole is arrested for the sensational murder of a rich, middle-aged widow, the famous Sir Wilfrid Robarts agrees to appear on his behalf. Sir Wilfrid, recovering from a near-fatal heart attack, is supposed to be on a diet of bland, civil suits—but the lure of the criminal courts is too much for him, especially when the case is so difficult.", 116, "English", "/bCj4EfuehAlgBwVd3diyWyhuuau.jpg", 8.3000000000000007, new DateTime(1957, 12, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), "Witness for the Prosecution" },
                    { 37472, null, "R", "Having defeated the best fighters of the Imperial Japanese army in occupied Shanghai, Ip Man and his family settle in post-war Hong Kong. Struggling to make a living, Master Ip opens a kung fu school to bring his celebrated art of Wing Chun to the troubled youth of Hong Kong. His growing reputation soon brings challenges from powerful enemies, including pre-eminent Hung Gar master, Hung Quan.", 108, "Cantonese", "/5FCY2ueDzU6b39byAGb3NRvr0zG.jpg", 7.4000000000000004, new DateTime(2010, 4, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), "Ip Man 2" },
                    { 37719, null, "NR", "The Marx Brothers take on high society and the opera world to bring two lovers together. A sly business manager and two wacky friends of two opera singers help them achieve success while humiliating their stuffy and snobbish enemies.", 96, "English", "/dzqBOSsUvZfoPU65fofXHJfOyhK.jpg", 7.5, new DateTime(1935, 11, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "A Night at the Opera" },
                    { 37769, null, null, "The frustrating adventures of a humble employee who all the time has to fullfill the wishes and desires of his bosses.", 110, "Italian", "/c51PWa2X6QoxE3q7zai0vayvrUO.jpg", 7.5, new DateTime(1976, 4, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Second Tragic Fantozzi" },
                    { 37775, null, "T", "Three Italian have to move from their current city to vote to local elections elsewhere. Pasquale is an Italian emigrant living in Munich (Germany). He has to vote in Matera, Basilicata (south of Italy). He is genuinely happy to come back in Italy, even if just for some days; but the country he is dreaming is different from the reality he meets. Furio move from Torino to Roma with all his family. He is so niggler and heavy that Magda, his wife, is thinking to escape. Mimmo is a young good fellow, moving with his grand mother, from Verona to Roma. His trip is disturbed by worries about her health, while she is very calm. Written by 1felco", 110, "English", "/tS5ca077KEMbJHBVNLa1nCnycXJ.jpg", 7.4000000000000004, new DateTime(1981, 2, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), "Bianco, rosso e Verdone" },
                    { 37797, null, "G", "Shizuku lives a simple life, dominated by her love for stories and writing. One day she notices that all the library books she has have been previously checked out by the same person: 'Seiji Amasawa'.", 111, "Japanese", "/sap0BXb6dJUhkDbJEd6nurMQrwq.jpg", 7.9000000000000004, new DateTime(1995, 7, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Whisper of the Heart" },
                    { 37799, null, "PG-13", "On a fall night in 2003, Harvard undergrad and computer programming genius Mark Zuckerberg sits down at his computer and heatedly begins working on a new idea. In a fury of blogging and programming, what begins in his dorm room as a small site among friends soon becomes a global social network and a revolution in communication. A mere six years and 500 million friends later, Mark Zuckerberg is the youngest billionaire in history... but for this entrepreneur, success leads to both personal and legal complications.", 121, "English", "/n0ybibhJtQ5icDqTp8eRytcIHJx.jpg", 7.2999999999999998, new DateTime(2010, 10, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Social Network" },
                    { 37903, null, "R", "Strange events happen in a small village in the north of Germany during the years just before World War I, which seem to be ritual punishment. The abused and suppressed children of the villagers seem to be at the heart of this mystery.", 144, "German", "/54dlnGDexrwAFlDb8HWKfmmX4LB.jpg", 7.5, new DateTime(2009, 10, 6, 0, 0, 0, 0, DateTimeKind.Unspecified), "The White Ribbon" },
                    { 38142, null, "普遍級", "Three moments in Takaki's life: his relationship with Akari and their forced separation; his friendship with Kanae, who is secretly in love with him; the demands and disappointments of adulthood, an unhappy life in a cold city.", 63, "Japanese", "/t0ISGhwZtghakg46TWCOWBTIflZ.jpg", 7.2999999999999998, new DateTime(2007, 3, 3, 0, 0, 0, 0, DateTimeKind.Unspecified), "5 Centimeters per Second" },
                    { 38234, null, "R", "Russian inmate Boyka, now severely hobbled by the knee injury suffered at the end of Undisputed 2. No longer the feared prison fighter he was, he has declined so far that he is now good only for cleaning toilets. But when a new prison fight tournament begins - an international affair, matching the best fighters from prisons around the globe, enticing them with the promise of freedom for the winner - Boyka must reclaim his dignity and fight for his position in the tournament.", 96, "English", "/g8KB77SPA7SyU8eid6TAEpt9skU.jpg", 7.4000000000000004, new DateTime(2010, 5, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), "Undisputed III: Redemption" },
                    { 38251, null, "T", "Greek Sea, World War II. An Italian ship leaves a handful of soldiers in a little island; their mission is to spot enemy ships and to hold the island in case of attack. The village of the island seems abandoned and there isn't a single enemy in sight, so the soldiers begin to relax a little. Things change when their ship is hit and destroyed by the enemy, and the soldiers find themselves abandoned there.", 96, "Italian", "/oSPA3SwWiMiy7DfOLQ1fluW7gYx.jpg", 7.7000000000000002, new DateTime(1991, 1, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Mediterraneo" },
                    { 38286, null, "T", "Three friends –Aldo, Giovanni, and Giacomo– travel from Milan to Gallipoli for Giacomo's wedding, with a valuable cargo: the father of the bride, an overbearing, rich businessman who is both their employer and father-in-law, has given them the task of delivering him a wooden leg, the work of a famous artist.", 98, "Italian", "/47FnOHM0PLubcolYrHmGlP0wi2A.jpg", 8.0, new DateTime(1997, 12, 27, 0, 0, 0, 0, DateTimeKind.Unspecified), "Three Men and a Leg" },
                    { 38396, null, "T", "Fugitive convict Aldo ends up in a car in Milan with policeman Giacomo and failed toymaker Giovanni, taking them hostages. While hunted down by the police over around half of Italy, they will eventually become friends.", 108, "Italian", "/tyIxqze2fSqXif2nrNTmOumXRE9.jpg", 7.5, new DateTime(1998, 12, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), "That's Life" },
                    { 38528, null, "T", "Bruno Fioretti, known as \"Mandrake\", is an inveterate gambler who never misses a day at the horse racing track in Rome. He is doubly unlucky: he bets too much on one horse, and his wife is sleeping with his best friend because Mandrake is always at the track. Penniless and cuckolded, Mandrake decides to make one last bet.", 94, "Italian", "/mEamwj656Kr8bRq66aQtMniJCG9.jpg", 7.2999999999999998, new DateTime(1976, 10, 29, 0, 0, 0, 0, DateTimeKind.Unspecified), "Horse Fever" },
                    { 38700, null, "R", "Marcus and Mike are forced to confront new threats, career changes, and midlife crises as they join the newly created elite team AMMO of the Miami police department to take down the ruthless Armando Armas, the vicious leader of a Miami drug cartel.", 124, "English", "/y95lQLnuNKdPAzw9F9Ab8kJ80c3.jpg", 7.2000000000000002, new DateTime(2020, 1, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Bad Boys for Life" },
                    { 38757, null, "PG", "When the kingdom's most wanted-and most charming-bandit Flynn Rider hides out in a mysterious tower, he's taken hostage by Rapunzel, a beautiful and feisty tower-bound teen with 70 feet of magical, golden hair. Flynn's curious captor, who's looking for her ticket out of the tower where she's been locked away for years, strikes a deal with the handsome thief and the unlikely duo sets off on an action-packed escapade, complete with a super-cop horse, an over-protective chameleon and a gruff gang of pub thugs.", 100, "English", "/ym7Kst6a4uodryxqbGOxmewF235.jpg", 7.5999999999999996, new DateTime(2010, 11, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), "Tangled" },
                    { 38985, null, "PG", "Four men from different parts of the globe, all hiding from their pasts in the same remote South American town, agree to risk their lives transporting several cases of dynamite (which is so old that it is dripping unstable nitroglycerin) across dangerous jungle terrain.", 122, "English", "/2b7oexm173SF1FSEq0DdgxZZNRH.jpg", 7.5, new DateTime(1977, 6, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), "Sorcerer" },
                    { 39107, null, "PG", "Not paying attention to his job, a young demon allows the evil cleansing machine to overflow and explode, turning the young demon into the infamous monster Janemba. Goku and Vegeta make solo attempts to defeat the monster, but realize their only option is fusion.", 55, "Japanese", "/7AHvaEAeQfkfJ4OqcBePxa2ao09.jpg", 7.4000000000000004, new DateTime(1995, 3, 4, 0, 0, 0, 0, DateTimeKind.Unspecified), "Dragon Ball Z: Fusion Reborn" }
                });

            migrationBuilder.InsertData(
                table: "Movies",
                columns: new[] { "Id", "ActorId", "Certification", "Description", "Duration", "Language", "Picture", "Ratings", "ReleaseDate", "Title" },
                values: new object[,]
                {
                    { 39323, null, "NR", "Bardock, Son Goku's father, is a low-ranking Saiyan soldier who was given the power to see into the future by the last remaining alien on a planet he just destroyed. He witnesses the destruction of his race and must now do his best to stop Frieza's impending massacre.", 48, "Japanese", "/yCjp8HJ4XANcB0FxoOztq9cF1pS.jpg", 7.4000000000000004, new DateTime(1990, 10, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), "Dragon Ball Z: Bardock - The Father of Goku" },
                    { 39324, null, "NR", "It has been thirteen years since the Androids began their killing rampage and Son Gohan is the only person fighting back. He takes Bulma's son Trunks as a student and even gives his own life to save Trunks's. Now Trunks must figure out a way to change this apocalyptic future", 48, "Japanese", "/AfUkiiR0UKeiPXPgTx9bRO4snTB.jpg", 7.5, new DateTime(1993, 2, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), "Dragon Ball Z: The History of Trunks" },
                    { 39356, null, "NR", "It's 1984, and Michael Jackson is king - even in Waihau Bay, New Zealand. Here we meet Boy, an 11-year-old who lives on a farm with his gran, a goat, and his younger brother, Rocky (who thinks he has magic powers). Shortly after Gran leaves for a week, Boy's father, Alamein, appears out of the blue. Having imagined a heroic version of his father during his absence, Boy comes face to face with the real version-an incompetent hoodlum who has returned to find a bag of money he buried years before.", 87, "English", "/jOcwOnCwTbCvJm7jAbeSo4Jgv0H.jpg", 7.4000000000000004, new DateTime(2010, 2, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), "Boy" },
                    { 39486, null, "PG", "Housewife and mother Penny Chenery agrees to take over her ailing father's Virginia-based Meadow Stables, despite her lack of horse-racing knowledge. Against all odds, Chenery - with the help of veteran trainer Lucien Laurin - manages to navigate the male-dominated business, ultimately fostering the first Triple Crown winner in 25 years.", 123, "English", "/9bpAR3ALEfaqosxbi9zpuv9FH7F.jpg", 7.2999999999999998, new DateTime(2010, 8, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), "Secretariat" },
                    { 40096, null, "14", "The lively Jack the Cricket and the sly Chicó are poor guys living in the hinterland who cheat a bunch of people in a small in Northeastern Brazil. When they die, they have to be judged by Christ, the Devil and the Virgin Mary before they are admitted to paradise.", 104, "Portuguese", "/m8eFedsS7vQCZCS8WGp5n1bVD0q.jpg", 8.5, new DateTime(2000, 9, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "A Dog's Will" },
                    { 40619, null, "G", "When Day, a sunny fellow, encounters Night, a stranger of distinctly darker moods, sparks fly! Day and Night are frightened and suspicious of each other at first, and quickly get off on the wrong foot. But as they discover each other's unique qualities--and come to realize that each of them offers a different window onto the same world-the friendship helps both to gain a new perspective.", 6, "English", "/eQ1QUZfblOrusXVfbzzCuUaM7ix.jpg", 7.7999999999999998, new DateTime(2010, 6, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), "Day & Night" },
                    { 40662, null, "PG-13", "One part vigilante, one part criminal kingpin, Red Hood begins cleaning up Gotham with the efficiency of Batman, but without following the same ethical code.", 75, "English", "/dEujs48u3n4cmh15ITtHHDFxSaS.jpg", 7.7999999999999998, new DateTime(2010, 7, 27, 0, 0, 0, 0, DateTimeKind.Unspecified), "Batman: Under the Red Hood" },
                    { 40794, null, "16", "Tommaso is the youngest son of the Cantones, a large, traditional southern Italian family operating a pasta-making business since the 1960s. On a trip home from Rome, where he studies literature and lives with his boyfriend, Tommaso decides to tell his parents the truth about himself. But when he is finally ready to come out in front of the entire family, his older brother Antonio ruins his plans.", 110, "Italian", "/gYSXvD0sB2MRXF5YreSWtdcW4Jv.jpg", 7.4000000000000004, new DateTime(2010, 2, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), "Loose Cannons" },
                    { 40823, null, "6", "André, 19, lives in Porto Alegre, Brazil, and works as a photocopier operator. He likes to see his neighbor Sílvia with a pair of binoculars. She works selling clothes. Becoming attracted to her, he tries to get nearer, and goes to her shop to buy something, but finds out that he can't afford it. So he puts the photocopier to other uses, and begins to envisage fishy schemes to earn some money.", 123, "Portuguese", "/8si8hwcxLiqa9M3zUGuvgxNQNwC.jpg", 7.2999999999999998, new DateTime(2003, 6, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Man Who Copied" },
                    { 41050, null, "AL", "A day in the life of an unfaithful married couple and their steadily deteriorating relationship in Milan.", 122, "Italian", "/8FDSk6VUqhg8ZyCNx0HhPUwepVK.jpg", 8.0, new DateTime(1961, 1, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), "La Notte" },
                    { 41201, null, "PG", "A French illusionist travels to Scotland to work. He meets a young woman in a small village. Their ensuing adventure in Edinburgh changes both their lives forever.", 80, "French", "/Ac2tNYW9sRaOhmtMJQuhf2mvo00.jpg", 7.2999999999999998, new DateTime(2010, 2, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Illusionist" },
                    { 41411, null, "U", "A faithful retelling of the 1942 \"Vel' d'Hiv Roundup\" and the events surrounding it.", 115, "French", "/zR3qTRRf1kqY9qep4NNcLQjyM8r.jpg", 7.5999999999999996, new DateTime(2010, 3, 10, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Round Up" },
                    { 41498, null, "PG-13", "20 years after his escape from Impel Down, the legendary pirate Shiki, the Golden Lion, reappears causing massive upheaval to the Marines. During his long seclusion, he was able to come up with a scheme to bring the World Government to his knees. On his way to execute the plan, Shiki crosses paths with the Straw Hat Pirates and becomes so impressed with Nami's knowledge of meteorology that he abducts her to forcedly enlist her into his crew. Luffy and the gang end up on a strange land populated with monstrous beasts as they desperately search for Shiki and Nami.", 114, "Japanese", "/z9S39hH4IOX9Hmtn3zho3Wdqem8.jpg", 7.5999999999999996, new DateTime(2009, 12, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), "One Piece Film: Strong World" },
                    { 42229, null, "NR", "The film is set during the late 1930s: the occasion is the first meeting between Mussolini and Hitler. Left alone in her tenement home when her fascist husband runs off to attend the historic event, Antonietta strikes up a friendship with her neighbor Gabriele. As the day segues into night, Antonietta and Gabriele develop a very special relationship that will radically alter both of their outlooks on life.", 106, "Italian", "/6ZzkiTbuf2ltEPunhQolGIcckyS.jpg", 8.1999999999999993, new DateTime(1977, 8, 11, 0, 0, 0, 0, DateTimeKind.Unspecified), "A Special Day" },
                    { 42269, null, "T", "Gianni, Nicola and Antonio become close friends in 1944 while fighting the Nazis. After the end of the war, full of illusions, they settle down. The movie is a the story of the life of these three idealists and how they deal with the inevitable disillusionments of life.", 124, "Italian", "/zGGWYpiKNwjpKxelPxOMqJnUgDs.jpg", 8.4000000000000004, new DateTime(1974, 12, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), "We All Loved Each Other So Much" },
                    { 42801, null, "T", "Three tales of very different women using their sexuality as a means to getting what they want.", 119, "Italian", "/dTYi1VK6ROM9tBiyIijFTHjuRnL.jpg", 7.7000000000000002, new DateTime(1963, 12, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), "Yesterday, Today and Tomorrow" },
                    { 43641, null, "PG", "Chosen the world’s protector against the Seven Deadly Enemies of Man – pride, envy, greed, hatred, selfishness, laziness and injustice – young Billy Batson accepts his destiny as Captain Marvel. Battling alongside Superman against nefarious Black Adam, Billy soon discovers the challenge super heroes ultimately face: is it revenge or justice?", 25, "English", "/3MgwChvi42N1RnhQE9A4pQVHyUY.jpg", 7.2999999999999998, new DateTime(2010, 11, 9, 0, 0, 0, 0, DateTimeKind.Unspecified), "Superman/Shazam!: The Return of Black Adam" },
                    { 43904, null, null, "Capricious small-town girl Juliette and barge captain Jean marry after a whirlwind courtship, and she comes to live aboard his boat, L'Atalante. As they make their way down the Seine, Jean grows weary of Juliette's flirtations with his all-male crew, and Juliette longs to escape the monotony of the boat and experience the excitement of a big city. When she steals away to Paris by herself, her husband begins to think their marriage was a mistake.", 89, "French", "/qg3PQG6QeFpcg45XhYQpsYcabna.jpg", 7.5999999999999996, new DateTime(1934, 4, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), "L'Atalante" },
                    { 43920, null, "NR", "Three juvenile delinquents arrive at a correctional center and are put under the care of an experienced guard.", 91, "English", "/uyV9XhPpOE5MsvpTAd9FU585oIx.jpg", 7.5, new DateTime(2010, 4, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), "Dog Pound" },
                    { 43949, null, "PG", "When Juli meets Bryce in the second grade, she knows it's true love. After spending six years trying to convince Bryce the same, she's ready to give up - until he starts to reconsider.", 89, "English", "/8CfXNu3U9Io1FA6Qx9tC9CxVEPW.jpg", 7.7999999999999998, new DateTime(2010, 8, 6, 0, 0, 0, 0, DateTimeKind.Unspecified), "Flipped" },
                    { 44214, null, "R", "A journey through the psyche of a young ballerina whose starring role as the duplicitous swan queen turns out to be a part for which she becomes frighteningly perfect.", 108, "English", "/8XYghKF0xkxp5A7QtK2F5vffdpZ.jpg", 7.5999999999999996, new DateTime(2010, 12, 3, 0, 0, 0, 0, DateTimeKind.Unspecified), "Black Swan" },
                    { 44264, null, "PG-13", "Following the murder of her father by a hired hand, a 14-year-old farm girl sets out to capture the killer. To aid her, she hires the toughest U.S. Marshal she can find—a man with 'true grit'—Reuben J. 'Rooster' Cogburn.", 110, "English", "/rxeRwN7dxHSLE0asOEIc1Q5Mcxy.jpg", 7.2999999999999998, new DateTime(2010, 12, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), "True Grit" },
                    { 44716, null, "R", "The lives of two Danish families cross each other, and an extraordinary but risky friendship comes into bud. But loneliness, frailty and sorrow lie in wait.", 118, "Danish", "/dJpPpgf2z5lNw6xVxvfWm0lexNH.jpg", 7.2000000000000002, new DateTime(2010, 8, 26, 0, 0, 0, 0, DateTimeKind.Unspecified), "In a Better World" },
                    { 45269, null, "R", "The King's Speech tells the story of the man who became King George VI, the father of Queen Elizabeth II. After his brother abdicates, George ('Bertie') reluctantly assumes the throne. Plagued by a dreaded stutter and considered unfit to be king, Bertie engages the help of an unorthodox speech therapist named Lionel Logue. Through a set of unexpected techniques, and as a result of an unlikely friendship, Bertie is able to find his voice and boldly lead the country into war.", 118, "English", "/uQ538BfYLDJh3GXlzRZLo0j7PFj.jpg", 7.7000000000000002, new DateTime(2010, 9, 6, 0, 0, 0, 0, DateTimeKind.Unspecified), "The King's Speech" },
                    { 45317, null, "R", "Boxer \"Irish\" Micky Ward's unlikely road to the world light welterweight title. His Rocky-like rise was shepherded by half-brother Dicky, a boxer-turned-trainer who rebounded in life after nearly being KO'd by drugs and crime.", 116, "English", "/jcQYWWi2y1vNsGlJJ2jNcFq0y1n.jpg", 7.4000000000000004, new DateTime(2010, 12, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Fighter" },
                    { 45612, null, "PG-13", "Decorated soldier Captain Colter Stevens wakes up in the body of an unknown man, discovering he's involved in a mission to find the bomber of a Chicago commuter train. He learns he's part of a top-secret experimental program that enables him to experience the final 8 minutes of another person's life. Colter re-lives the train incident over and over again, gathering more clues each time.", 93, "English", "/lovYULpg7HOA1gcWTAMkVt7pA9p.jpg", 7.2999999999999998, new DateTime(2011, 3, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Source Code" },
                    { 45958, null, "R", "This is a story of a man in free fall. On the road to redemption, darkness lights his way. Connected with the afterlife, Uxbal is a tragic hero and father of two who's sensing the danger of death. He struggles with a tainted reality and a fate that works against him in order to forgive, for love, and forever.", 148, "Spanish", "/8cj0Q2uFfpTkCw4gMqqcTBpdoqF.jpg", 7.2999999999999998, new DateTime(2010, 10, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), "Biutiful" },
                    { 46738, null, "R", "A mother's last wishes send twins Jeanne and Simon on a journey to Middle East in search of their tangled roots. Adapted from Wajdi Mouawad's acclaimed play, Incendies tells the powerful and moving tale of two young adults' voyage to the core of deep-rooted hatred, never-ending wars and enduring love.", 131, "French", "/jO6VMoZco5jaAVm2QJ2VgPolUnx.jpg", 8.0999999999999996, new DateTime(2010, 9, 4, 0, 0, 0, 0, DateTimeKind.Unspecified), "Incendies" },
                    { 46838, null, "R", "Two hillbillies are suspected of being killers by a group of paranoid college kids camping near the duo's West Virginian cabin. As the body count climbs, so does the fear and confusion as the college kids try to seek revenge against the pair.", 89, "English", "/8shwLEDzajJGSfLgbpac8x8xn1U.jpg", 7.2999999999999998, new DateTime(2010, 1, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), "Tucker and Dale vs. Evil" },
                    { 47735, null, "15", "Monika from Stockholm falls in love with Harry, a young man on holiday. When she becomes pregnant they are forced into a marriage, which begins to fall apart soon after they take up residence in a cramped little flat.", 96, "Swedish", "/82hLsn67V9TjgrLOZCFL7247pJd.jpg", 7.4000000000000004, new DateTime(1953, 2, 9, 0, 0, 0, 0, DateTimeKind.Unspecified), "Summer with Monika" },
                    { 47796, null, "6", "After years spent working as a prostitute in her Italian village, middle-aged Mamma Roma has saved enough money to buy herself a fruit stand so that she can have a respectable middle-class life and reestablish contact with the 16-year-old son she abandoned when he was an infant. But her former pimp threatens to expose her sordid past, and her troubled son seems destined to fall into a life of crime and violence.", 110, "Italian", "/queRmW1WkOQd6TRFQ0xROC48s3h.jpg", 7.9000000000000004, new DateTime(1962, 8, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Mamma Roma" },
                    { 47931, null, "16", "After a bloody invasion of the BOPE in the High-Security Penitentiary Bangu 1 in Rio de Janeiro to control a rebellion of interns, the Lieutenant-Colonel Roberto Nascimento and the second in command Captain André Matias are accused by the Human Right Aids member Diogo Fraga of execution of prisoners. Matias is transferred to the corrupted Military Police and Nascimento is exonerated from the BOPE by the Governor.", 115, "Portuguese", "/89nThdmRxWYqglPRtJt1kZjP6UE.jpg", 7.9000000000000004, new DateTime(2010, 10, 8, 0, 0, 0, 0, DateTimeKind.Unspecified), "Elite Squad: The Enemy Within" },
                    { 48035, null, "15", "The three sons of devout Danish farmer Morten have widely disparate religious beliefs. Youngest son Anders shares his father's religion, but eldest son Mikkel has lost his faith, while middle child Johannes has become delusional and proclaims that he is Jesus Christ himself. When Mikkel's wife, Inger goes into a difficult childbirth, everyone's beliefs are put to the test.", 125, "Danish", "/e3oh96Zrqdaku8DoD10pXZHLZoU.jpg", 8.0, new DateTime(1955, 1, 9, 0, 0, 0, 0, DateTimeKind.Unspecified), "Ordet" },
                    { 49020, null, "R", "15-year-old deep-thinking Welsh schoolboy Oliver Tate struggles to initiate and maintain a relationship with Jordana, his devilish, dark-haired classmate at their Swansea high school. As his parents' marriage begins to fall apart, similar problems arise in his relationship with Jordana.", 97, "English", "/vmt5vG9dSmswmzHSYvn1S4Nl4uG.jpg", 7.4000000000000004, new DateTime(2011, 3, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), "Submarine" },
                    { 49026, null, "PG-13", "Following the death of District Attorney Harvey Dent, Batman assumes responsibility for Dent's crimes to protect the late attorney's reputation and is subsequently hunted by the Gotham City Police Department. Eight years later, Batman encounters the mysterious Selina Kyle and the villainous Bane, a new terrorist leader who overwhelms Gotham's finest. The Dark Knight resurfaces to protect a city that has branded him an enemy.", 165, "English", "/vzvKcPQ4o7TjWeGIn0aGC9FeVNu.jpg", 7.7000000000000002, new DateTime(2012, 7, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Dark Knight Rises" },
                    { 49051, null, "PG-13", "Bilbo Baggins, a hobbit enjoying his quiet life, is swept into an epic quest by Gandalf the Grey and thirteen dwarves who seek to reclaim their mountain home from Smaug, the dragon.", 169, "English", "/yHA9Fc37VmpUA5UncTxxo3rTGVA.jpg", 7.2999999999999998, new DateTime(2012, 11, 26, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Hobbit: An Unexpected Journey" },
                    { 49361, null, "18", "A reporter and a promiscuous young woman try to solve a series of child killings in a remote southern Italian town rife with superstition and a distrust of outsiders.", 105, "Italian", "/l6OXiP8RNc1xdqmycBdX0NBsnMS.jpg", 7.5, new DateTime(1972, 9, 29, 0, 0, 0, 0, DateTimeKind.Unspecified), "Don't Torture a Duckling" },
                    { 49538, null, "PG-13", "Before Charles Xavier and Erik Lensherr took the names Professor X and Magneto, they were two young men discovering their powers for the first time. Before they were arch-enemies, they were closest of friends, working together with other mutants (some familiar, some new), to stop the greatest threat the world has ever known.", 132, "English", "/yoKdvhqVw45oEF34No2cD7aP3sx.jpg", 7.2999999999999998, new DateTime(2011, 6, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "X-Men: First Class" },
                    { 49687, null, "NR", "In Naples, in the Second World War, the wolf businessman Domenico Soriano meets the seventeen years old whore Filumena Marturano in a brothel during an allied bombing. Two years later, in the post-war, they meet each other by chance and begin a long affair. For twenty-two years, Filumena is his mistress and administrates his shops in Naples while Domenico is traveling. When Domenico decides to marry the young cashier of his bakery, Filumena lures him as if she were near to death and he marries her. Later he annuls their matrimony, and she tells him that she has three sons that she raised secretly, one of them is his legitimate son but she does not disclose his identity. The middle-age Domenico uses the most different subterfuges trying to find which teenager might be his son.", 102, "Italian", "/1VVQFXwr4i6QSAoPnCs9UmGTUVw.jpg", 7.7999999999999998, new DateTime(1964, 12, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), "Marriage Italian Style" },
                    { 49797, null, "R", "Kyung-chul is a dangerous psychopath who kills for pleasure. He has committed infernal serial murders in diabolic ways that one cannot even imagine and his victims range from young women to even children. The police have chased him for a long time, but were unable to catch him. One day, Joo-yeon, daughter of a retired police chief becomes his prey and is found dead in a horrific state. Her fiance Soo-hyun, a top secret agent, decides to track down the murderer himself. He promises himself that he will do everything in his power to take bloody vengeance against the killer, even if it means that he must become a monster himself to get this monstrous and inhumane killer.", 141, "Korean", "/s2XXP0GRdEHB21lK9MQBn9drGez.jpg", 7.7999999999999998, new DateTime(2010, 8, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), "I Saw the Devil" },
                    { 49992, null, "U", "A seagull is caught by the black tide of a sinking petrol ship. She manages to fly inland and falls down in a garden by a cat. Moribund, she asks the cat to fulfill three promises: that when she lays her egg he must not eat it; that he must take care of it until it hatches; that he would teach the newborn how to fly.", 75, "Italian", "/NTRdPpEf3ttvo1lkdDcltEtDGy.jpg", 7.5999999999999996, new DateTime(1998, 12, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), "Lucky and Zorba" },
                    { 50014, null, "PG-13", "Aibileen Clark is a middle-aged African-American maid who has spent her life raising white children and has recently lost her only son; Minny Jackson is an African-American maid who has often offended her employers despite her family's struggles with money and her desperate need for jobs; and Eugenia \"Skeeter\" Phelan is a young white woman who has recently moved back home after graduating college to find out her childhood maid has mysteriously disappeared. These three stories intertwine to explain how life in Jackson, Mississippi revolves around \"the help\"; yet they are always kept at a certain distance because of racial lines.", 146, "English", "/7XLSwxpfpPoJyTdJVot6a42TS2V.jpg", 8.1999999999999993, new DateTime(2011, 8, 9, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Help" }
                });

            migrationBuilder.InsertData(
                table: "Movies",
                columns: new[] { "Id", "ActorId", "Certification", "Description", "Duration", "Language", "Picture", "Ratings", "ReleaseDate", "Title" },
                values: new object[,]
                {
                    { 50531, null, "T", "Friends and aspiring actors Aldo, Giovanni, and Giacomo work dead-end jobs – as extra in operas, living statue at a department store, and voice actor for bit parts, respectively – while focusing on their passion project: staging an adaptation of 'Cyrano de Bergerac'. However, love for the same woman will end their friendship. Three years later, Giovanni and Giacomo reunite to travel from Milan to Sicily after hearing that Aldo is dying.", 100, "Italian", "/qCBmNunSpKRlPyjOZXbqTN1usTH.jpg", 7.7000000000000002, new DateTime(2000, 12, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Ask Me If I Am Happy" },
                    { 50646, null, "PG-13", "Cal Weaver is living the American dream. He has a good job, a beautiful house, great children and a beautiful wife, named Emily. Cal's seemingly perfect life unravels, however, when he learns that Emily has been unfaithful and wants a divorce. Over 40 and suddenly single, Cal is adrift in the fickle world of dating. Enter, Jacob Palmer, a self-styled player who takes Cal under his wing and teaches him how to be a hit with the ladies.", 118, "English", "/coKTdJdnl3XcxWY9ofyfkf05rYP.jpg", 7.2000000000000002, new DateTime(2011, 7, 29, 0, 0, 0, 0, DateTimeKind.Unspecified), "Crazy, Stupid, Love." },
                    { 50848, null, "U", "Bahia Benmahmoud, a free-spirited young woman, has a particular way of seeing political engagement, as she doesn't hesitate to sleep with those who don't agree with her to convert them to her cause - which is a lot of people, as all right-leaning people are concerned. Generally, it works pretty well. Until the day she meets Arthur Martin, a discreet forty-something who doesn't like taking risks. She imagines that with a name like that, he's got to be slightly fascist. But names are deceitful and appearances deceiving.", 100, "French", "/qnUyni6Cc5bQbgyvvof6yNwoIUd.jpg", 7.2999999999999998, new DateTime(2010, 11, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Names of Love" },
                    { 51241, null, "M", "Francis is a young gay man, Marie is a young straight woman and the two of them are best friends -- until the day the gorgeous Nicolas walks into a Montreal coffee shop. The two friends, instantly and equally infatuated, compete for Nicolas' indeterminate affections, a conflict that climaxes when the trio visit the vacation home of Nicolas' mother. The frothy comedy unfolds through narrative, fantasy sequences and confessional monologues.", 97, "French", "/kBGbvzrP4lNV4BZc2wscmglNno2.jpg", 7.2999999999999998, new DateTime(2010, 5, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), "Heartbeats" },
                    { 51497, null, "PG-13", "Former cop Brian O'Conner partners with ex-con Dom Toretto on the opposite side of the law. Since Brian and Mia Toretto broke Dom out of custody, they've blown across many borders to elude authorities. Now backed into a corner in Rio de Janeiro, they must pull one last job in order to gain their freedom.", 130, "English", "/h0Xsy4aomjMO47RpoHv8lnfbkoE.jpg", 7.2000000000000002, new DateTime(2011, 4, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), "Fast Five" },
                    { 51608, null, "R", "His only friend called him 'the man from nowhere'... Taesik, a former special agent becomes a loner after losing his wife in a miserable accident and lives a bitter life running a pawnshop. He only has a few customers and a friend named Somi, a little girl next door. As Taesik spends more and more time with Somi, he gets attached to her. Then Somi is kidnapped by a gang, and as Taesik tries to save Somi by becoming deeply associated with the gang his mysterious past is revealed...", 119, "Korean", "/9QJ3cPpYgoPfhRnRPxpQUfx790r.jpg", 7.7000000000000002, new DateTime(2010, 8, 4, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Man from Nowhere" },
                    { 51739, null, "G", "14-year-old Arrietty and the rest of the Clock family live in peaceful anonymity as they make their own home from items \"borrowed\" from the house's human inhabitants. However, life changes for the Clocks when a human boy discovers Arrietty.", 94, "Japanese", "/xGz75oFXt4OmFgvQ7kVjaPboRJr.jpg", 7.5999999999999996, new DateTime(2010, 7, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Secret World of Arrietty" },
                    { 51828, null, "PG-13", "A romantic comedy centered on Dexter and Emma, who first meet during their graduation in 1988 and proceed to keep in touch regularly. The film follows what they do on July 15 annually, usually doing something together.", 107, "English", "/n9jMwSg4IavdD8wqdYnyW5w3Mvp.jpg", 7.4000000000000004, new DateTime(2011, 3, 2, 0, 0, 0, 0, DateTimeKind.Unspecified), "One Day" },
                    { 52345, null, null, "Lisbela is a young woman who loves going to the movies. Leléu is a con man, going from town to town selling all sort of things and performing as master of ceremonies for some cheesy numbers, such as the woman who gets transformed into a gorilla. He gets involved with Linaura, a sexy and beautiful woman who happens to be the wife of the most frightening hitman of the place. The hitman finds out his wife's affair and goes after Leléu, who has to leave in a hurry. In another town, he meets and falls instantly in love with Lisbela, who is engaged to Douglas, a hillbilly who tries hard to pass for a cosmopolitan Rio de Janeiro dweller.", 106, "Portuguese", "/cZoykE7XMqPBdZBfM6ncSVMT8Wh.jpg", 7.7999999999999998, new DateTime(2003, 8, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), "Lisbela and the Prisoner" },
                    { 52629, null, null, "Benjamin Garcia, Benny is deported from the United States. Back home and against a bleak picture, Benny gets involved in the drug business, in which he has for the first time in his life, a spectacular rise surrounded by money, women, violence and fun. But very soon he will discover that criminal life does not always keep its promises.", 145, "Spanish", "/eh004yF4wv8pBJ8mw8yVy1rMm4M.jpg", 7.5999999999999996, new DateTime(2010, 9, 3, 0, 0, 0, 0, DateTimeKind.Unspecified), "El Infierno" },
                    { 53457, null, "PG-13", "On the night of 16 July 1942, ten year old Sarah and her parents are being arrested and transported to the Velodrome d'Hiver in Paris where thousands of other jews are being sent to get deported. Sarah however managed to lock her little brother in a closet just before the police entered their apartment. Sixty years later, Julia Jarmond, an American journalist in Paris, gets the assignment to write an article about this raid, a black page in the history of France. She starts digging archives and through Sarah's file discovers a well kept secret about her own in-laws.", 111, "French", "/peGUaf6HrX7jSi1HifX64QJb7pm.jpg", 7.2999999999999998, new DateTime(2010, 9, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), "Sarah's Key" },
                    { 53565, null, "G", "Mickey Mouse, piloting a steamboat, delights his passenger, Minnie, by making musical instruments out of the menagerie on deck.", 8, "English", "/lEv1OuIzPwbXbj8OGHgJb5hYYXC.jpg", 7.2999999999999998, new DateTime(1928, 11, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), "Steamboat Willie" },
                    { 54138, null, "PG-13", "When the crew of the Enterprise is called back home, they find an unstoppable force of terror from within their own organization has detonated the fleet and everything it stands for, leaving our world in a state of crisis.  With a personal score to settle, Captain Kirk leads a manhunt to a war-zone world to capture a one man weapon of mass destruction. As our heroes are propelled into an epic chess game of life and death, love will be challenged, friendships will be torn apart, and sacrifices must be made for the only family Kirk has left: his crew.", 132, "English", "/7XrRkhMa9lQ71RszzSyVrJVvhyS.jpg", 7.2999999999999998, new DateTime(2013, 5, 5, 0, 0, 0, 0, DateTimeKind.Unspecified), "Star Trek Into Darkness" },
                    { 54186, null, "R15+", "A psychological thriller of a grieving mother turned cold-blooded avenger with a twisty master plan to pay back those who were responsible for her daughter's death.", 107, "Japanese", "/xQcnx6jMuPRCeidotgVy6YIls6p.jpg", 7.7000000000000002, new DateTime(2010, 6, 4, 0, 0, 0, 0, DateTimeKind.Unspecified), "Confessions" },
                    { 55823, null, "T", "Italy, 1916. Oreste Jacovacci and Giovanni Busacca are called, as all the Italian youths, to serve the army in the WWI. They both try in every way to avoid serving the army.", 137, "Italian", "/1CiX92V4St4PTViqjvEwMhW2Y2s.jpg", 8.0999999999999996, new DateTime(1959, 10, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Great War" },
                    { 55960, null, "T", "Antonio, Peppino and Lucia are three brothers who live in the country near Naples. Lucia's son, Gianni, goes to Naples to study medicine, but there he knows a ballet dancer. They fall in love and, when she goes to Milan, Gianni follows her. Informed of this and afraid that their nephew will stop studying, the three Caponi brothers leave for Milan to persuade Gianni to come back and continue studying and abandon the \"Malafemmina\" (bad girl).", 106, "Italian", "/rHsc35TLPliJAvbnmu8dvddiu96.jpg", 8.0999999999999996, new DateTime(1956, 8, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), "Toto, Peppino, and the Hussy" },
                    { 56231, null, null, "A conscientious factory worker gets his finger cut off by a machine. The accident causes him to become more involved in political and revolutionary groups.", 125, "Italian", "/jraybJM1LuBAVr4J3GKFeyabZF8.jpg", 7.9000000000000004, new DateTime(1971, 9, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Working Class Goes to Heaven" },
                    { 56831, null, "R", "A deeply religious black ex-con thwarts the suicide attempt of an asocial white college professor who tries to throw himself in front of an oncoming subway train, 'The Sunset Limited.' As the one attempts to connect on a rational, spiritual and emotional level, the other remains steadfast in his hard-earned despair. Locked in a philosophical debate, both passionately defend their personal credos and try to convert the other.", 90, "English", "/8cwqylJVbCfMflcjXQ71CwsXdpf.jpg", 7.2000000000000002, new DateTime(2011, 2, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Sunset Limited" },
                    { 57158, null, "PG-13", "The Dwarves, Bilbo and Gandalf have successfully escaped the Misty Mountains, and Bilbo has gained the One Ring. They all continue their journey to get their gold back from the Dragon, Smaug.", 161, "English", "/xQYiXsheRCDBA39DOrmaw1aSpbk.jpg", 7.5999999999999996, new DateTime(2013, 12, 11, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Hobbit: The Desolation of Smaug" },
                    { 57212, null, "PG-13", "Follows a young man named Albert and his horse, Joey, and how their bond is broken when Joey is sold to the cavalry and sent to the trenches of World War One. Despite being too young to enlist, Albert heads to France to save his friend.", 146, "English", "/7KHz6JlJhrFAPesmUkgdnLrSr8Y.jpg", 7.2999999999999998, new DateTime(2011, 12, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "War Horse" },
                    { 57361, null, "18", "A North Korean man takes an assassination job in the South to make money and find his missing wife. But when the job is botched, he is forced to go on the run from the police and the gangsters who paid him.", 157, "Korean", "/16Pkg2ChCdACbBKVIAPAZtLL6eb.jpg", 7.4000000000000004, new DateTime(2010, 12, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Yellow Sea" },
                    { 58451, null, null, "Mastro Geppetto is a poor carpenter with no wife and no children. The man is very lonely, and when trading a piece of wood with his colleague Mastro Ciliegia, he decides to build himself a puppet to make him company.", 135, "Italian", "/bpRjLfH1pUhHi7zpu2C4wIWw7kQ.jpg", 7.5, new DateTime(1972, 12, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Adventures of Pinocchio" },
                    { 58857, null, "R", "A bravado period action film set at the end of Japan's feudal era in which a group of unemployed samurai are enlisted to bring down a sadistic lord and prevent him from ascending to the throne and plunging the country into a war-torn future.", 141, "Japanese", "/yUsVsiVXUwClk4vSCx80vrdO6MV.jpg", 7.2999999999999998, new DateTime(2010, 9, 9, 0, 0, 0, 0, DateTimeKind.Unspecified), "13 Assassins" },
                    { 59421, null, "18", "A woman subject to mental, physical, and sexual abuse on a remote island seeks a way out.", 115, "Korean", "/3ZgFJY1kje1XhXPvC8UtRKA2tX.jpg", 7.2000000000000002, new DateTime(2010, 8, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), "Bedevilled" },
                    { 59436, null, "PG-13", "A romantic comedy about a family traveling to the French capital for business. The party includes a young engaged couple forced to confront the illusion that a life different from their own is better.", 94, "English", "/4wBG5kbfagTQclETblPRRGihk0I.jpg", 7.5, new DateTime(2011, 5, 11, 0, 0, 0, 0, DateTimeKind.Unspecified), "Midnight in Paris" },
                    { 59440, null, "PG-13", "The youngest son of an alcoholic former boxer returns home, where he's trained by his father for competition in a mixed martial arts tournament – a path that puts the fighter on a collision course with his estranged, older brother.", 140, "English", "/iM8n4nZJPR2abpnyZ36FUgHiRjr.jpg", 7.7999999999999998, new DateTime(2011, 9, 9, 0, 0, 0, 0, DateTimeKind.Unspecified), "Warrior" },
                    { 60243, null, "PG-13", "A married couple are faced with a difficult decision - to improve the life of their child by moving to another country or to stay in Iran and look after a deteriorating parent who has Alzheimer's disease.", 123, "Persian", "/wQVvASmpm8jGhJBQU20OkoMcNzi.jpg", 8.0, new DateTime(2011, 3, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "A Separation" },
                    { 61202, null, "UA", "Three friends who were inseparable in childhood decide to go on a three-week-long bachelor road trip to Spain, in order to re-establish their bond and explore thrilling adventures, before one of them gets married. What will they learn of themselves and each other during the adventure?", 166, "Hindi", "/hKO9O715wYxjkQSEv47giCYcyO8.jpg", 7.5999999999999996, new DateTime(2011, 7, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Zindagi Na Milegi Dobara" },
                    { 61791, null, "PG-13", "Scientist Will Rodman is determined to find a cure for Alzheimer's, the disease which has slowly consumed his father. Will feels certain he is close to a breakthrough and tests his latest serum on apes, noticing dramatic increases in intelligence and brain activity in the primate subjects – especially Caesar, his pet chimpanzee.", 105, "English", "/7HBHA1YMhTmfMX91i1hauakIKo5.jpg", 7.2999999999999998, new DateTime(2011, 8, 3, 0, 0, 0, 0, DateTimeKind.Unspecified), "Rise of the Planet of the Apes" },
                    { 61979, null, "12", "Story of two young people who belong to different worlds. It is the chronicle of a love improbable, almost impossible but inevitable dragging in a frantic journey they discover the first great love. Babi is a girl from upper-middle class that is educated in goodness and innocence . Hache is a rebellious boy, impulsive, unconscious, has a appetite for risk and danger embodied in endless fights and illegal motorbike races, the limit of common sense", 122, "Spanish", "/57D3h8wb3LMURTyG0dv2VtHfvCM.jpg", 7.7999999999999998, new DateTime(2010, 12, 3, 0, 0, 0, 0, DateTimeKind.Unspecified), "Three Steps Above Heaven" },
                    { 63310, null, "R", "Young Limburg cattle farmer, Jacky Vanmarsenille, is approached by an unscrupulous veterinarian to make a shady deal with a notorious West-Flemish beef trader. But the assassination of a federal policeman, and an unexpected confrontation with a mysterious secret from his past, set in motion a chain of events with far-reaching consequences.", 129, "Dutch", "/j9XzaLtFAJIozDH4MQwxaR2aDvJ.jpg", 7.2000000000000002, new DateTime(2011, 2, 2, 0, 0, 0, 0, DateTimeKind.Unspecified), "Bullhead" },
                    { 63311, null, "R", "A brilliant plastic surgeon creates a synthetic skin that withstands any kind of damage. His guinea pig: a mysterious and volatile woman who holds the key to his obsession.", 120, "Spanish", "/Ap9bE10BHo3URGXN8RMkueseuQF.jpg", 7.5, new DateTime(2011, 8, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Skin I Live In" },
                    { 64682, null, "PG-13", "An adaptation of F. Scott Fitzgerald's Long Island-set novel, where Midwesterner Nick Carraway is lured into the lavish world of his neighbor, Jay Gatsby. Soon enough, however, Carraway will see through the cracks of Gatsby's nouveau riche existence, where obsession, madness, and tragedy await.", 143, "English", "/nimh1rrDDLhgpG8XAYoUZXHYwb6.jpg", 7.4000000000000004, new DateTime(2013, 5, 10, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Great Gatsby" },
                    { 64690, null, "R", "Driver is a skilled Hollywood stuntman who moonlights as a getaway driver for criminals. Though he projects an icy exterior, lately he's been warming up to a pretty neighbor named Irene and her young son, Benicio. When Irene's husband gets out of jail, he enlists Driver's help in a million-dollar heist. The job goes horribly wrong, and Driver must risk his life to protect Irene and Benicio from the vengeful masterminds behind the robbery.", 100, "English", "/602vevIURmpDfzbnv5Ubi6wIkQm.jpg", 7.5999999999999996, new DateTime(2011, 6, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), "Drive" },
                    { 64956, null, "NR", "The Cobol Job is a fourteen-minute animated prequel to Christopher Nolan’s award-winning movie: Inception, detailing the heist on Mr. Kaneda's mind by Nash, Cobb, Arthur, and several Cobol Engineering thugs.", 15, "English", "/sNxqwtyHMNQwKWoFYDqcYTui5Ok.jpg", 7.2999999999999998, new DateTime(2010, 12, 7, 0, 0, 0, 0, DateTimeKind.Unspecified), "Inception: The Cobol Job" },
                    { 65218, null, "G", "The story follows five disparate high school students - Olivia, Mo, Charlie, Stella, and Wen who meet in detention. They realize they are destined to rock, and ultimately form a band that becomes a champion for students sidelined by the high school elite.", 106, "English", "/nrGiOFh7wk2x726tiN8kQ6nhF5b.jpg", 7.4000000000000004, new DateTime(2011, 12, 6, 0, 0, 0, 0, DateTimeKind.Unspecified), "Lemonade Mouth" },
                    { 65229, null, "AL", "A French family moves to a new neighborhood with during the summer holidays. The story follows a 10-year-old gender non-conforming child, Laure, who experiments with their gender presentation, adopting the name Mikäel.", 82, "French", "/ogBGBOhq6vozE5rqETFBcZWFXmd.jpg", 7.2999999999999998, new DateTime(2011, 4, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), "Tomboy" },
                    { 65754, null, "R", "This English-language adaptation of the Swedish novel by Stieg Larsson follows a disgraced journalist, Mikael Blomkvist, as he investigates the disappearance of a weary patriarch's niece from 40 years ago. He is aided by the pierced, tattooed, punk computer hacker named Lisbeth Salander. As they work together in the investigation, Blomkvist and Salander uncover immense corruption beyond anything they have ever imagined.", 158, "English", "/vbLedKc1BUF4FOH1GyHW62FulCc.jpg", 7.2999999999999998, new DateTime(2011, 12, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Girl with the Dragon Tattoo" },
                    { 67884, null, "12", "A comedy that chronicles a chance encounter between Robert and a Chinese named Jun who wanders lost through the city of Buenos Aires in search of his uncle after being assaulted by a taxi driver and his henchmen.", 93, "Spanish", "/wSrMT1YrcMH4NdzH7IdJaQzgzJc.jpg", 7.2999999999999998, new DateTime(2011, 3, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), "Chinese Take-Away" },
                    { 68718, null, "R", "With the help of a German bounty hunter, a freed slave sets out to rescue his wife from a brutal Mississippi plantation owner.", 165, "English", "/4E4TTsCXVFyhBtYu9fKy0gIT3Ih.jpg", 8.0999999999999996, new DateTime(2012, 12, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "Django Unchained" },
                    { 68734, null, "R", "As the Iranian revolution reaches a boiling point, a CIA 'exfiltration' specialist concocts a risky plan to free six Americans who have found shelter at the home of the Canadian ambassador.", 120, "English", "/2HVkfkgY1nvWTCRj3H1zTmlghUG.jpg", 7.2999999999999998, new DateTime(2012, 10, 11, 0, 0, 0, 0, DateTimeKind.Unspecified), "Argo" },
                    { 69735, null, "PG-13", "When Bruce Wayne and James Gordon move to Gotham City, the idealistic Wayne declares war on the city’s criminals, swiftly becoming Batman in the process.", 64, "English", "/mLZRhulJcDsxZWTdfx0trtk6y07.jpg", 7.2999999999999998, new DateTime(2011, 9, 27, 0, 0, 0, 0, DateTimeKind.Unspecified), "Batman: Year One" }
                });

            migrationBuilder.InsertData(
                table: "Movies",
                columns: new[] { "Id", "ActorId", "Certification", "Description", "Duration", "Language", "Picture", "Ratings", "ReleaseDate", "Title" },
                values: new object[,]
                {
                    { 70670, null, "R", "An accomplished headhunter risks everything to obtain a valuable painting owned by a former mercenary..", 100, "Norwegian", "/ll32Hyillq6VSC1F7v4m2uZjGKI.jpg", 7.2999999999999998, new DateTime(2011, 8, 4, 0, 0, 0, 0, DateTimeKind.Unspecified), "Headhunters" },
                    { 71157, null, "NR", "Paris, France. Fred and his colleagues, members of the BPM, the Police Child Protection Unit, dedicated to pursuing all sorts of offenses committed against the weakest, must endure the scrutiny of Melissa, a photographer commissioned to graphically document the daily routine of the team.", 123, "French", "/jt5iH1ffawf3NXX0YVgfSexQH8H.jpg", 7.9000000000000004, new DateTime(2011, 10, 6, 0, 0, 0, 0, DateTimeKind.Unspecified), "Polisse" },
                    { 71859, null, "R", "After her son Kevin commits a horrific act, troubled mother Eva reflects on her complicated relationship with her disturbed son as he grew from a toddler into a teenager.", 113, "English", "/auAmiRmbBQ5QIYGpWgcGBoBQY3b.jpg", 7.5999999999999996, new DateTime(2011, 9, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), "We Need to Talk About Kevin" },
                    { 71883, null, "PG-13", "The most dangerous and exciting car race in the universe is held only once every five years. And that's tonight. The competitors are lined up at the starting block. In his vehicle, JP, the most daredevil driver on the circuit, is ready for the green light. Female driver Sonoshee, with whom he is secretly in love, is also on the starting line. She will stop at nothing to get on to that podium. In this race, not only is anything possible, but also anything is allowed. In fact, their adversaries have modified their vehicles to equip them with highly destructive weapons; with such participants, it is hardly surprising that Redline is forbidden by the authorities, who will try anything to halt the proceedings. These speed addicts have to put themselves in mortal danger to achieve their aim: eternal glory for those who finally mount the podium.", 102, "Japanese", "/yUkH0y9OsY7J08Dvfzi1P0di559.jpg", 7.4000000000000004, new DateTime(2009, 8, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), "Redline" },
                    { 72213, null, "PG-13", "As law enforcement officers, Adam Mitchell, Nathan Hayes, and their partners are confident and focused. They willingly stand up to the worst the streets have to offer. Yet at the end of the day, they face a challenge that none of them are truly prepared to tackle: fatherhood. They know that God desires to turn the hearts of fathers to their children, but their children are beginning to drift further and further away from them. When tragedy hits home, these men are left wrestling with their hopes, their fears, their faith, and their fathering. Can a new found urgency help these dads draw closer to God ... and to their children? COURAGEOUS is the fourth release of Sherwood Pictures, the movie making ministry of Sherwood Church in Albany, Georgia.", 129, "English", "/CkwRzUmxvMZvkzzGE45nqLGTm8.jpg", 7.4000000000000004, new DateTime(2011, 9, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Courageous" },
                    { 72478, null, "NR", "Dominik is an ordinary boy. He's got loads of friends, the hottest girl in school, rich parents and money to spend on brand-name clothes. But one innocent kiss with a mate changes everything. He begins to isolate himself from the outside world, spending all his time on his computer. He meets an anonymous girl who introduces him to the \"suicide room\", a place from which there is no escape. Caught in a trap woven of his own emotions, Dominik becomes entangled in a web of intrigue and gradually loses what he cherishes most.", 117, "Polish", "/24a6wmwFr8AicQaBdK9LSEPahgb.jpg", 7.4000000000000004, new DateTime(2011, 3, 4, 0, 0, 0, 0, DateTimeKind.Unspecified), "Suicide Room" },
                    { 73456, null, "G", "Barbie stars as Blair Willows, a kind-hearted girl who is chosen to attend Princess Charm School: a magical, modern place that teaches dancing, how to have tea parties, and proper princess manners. Blair loves her classes -- as well as the helpful magical sprites and her new friends, Princesses Hadley and Isla. But when royal teacher Dame Devin discovers that Blair looks a lot like the kingdom’s missing princess, she turns Blair’s world upside down to stop her from claiming the throne. Now Blair, Hadley and Delancy must find an enchanted crown to prove Blair’s true identity in this charming and magical princess story!", 79, "English", "/lI2jPbssax6XX5vDqB9mTJHGzfH.jpg", 7.4000000000000004, new DateTime(2011, 8, 11, 0, 0, 0, 0, DateTimeKind.Unspecified), "Barbie: Princess Charm School" },
                    { 73624, null, "PG-13", "Zero (Wagner Moura) is a brilliant scientist, but unfortunate because 20 years ago was publicly humiliated and lost in college Helena (Alinne Moraes) the love of his life. One day, an accidental experience with one of his inventions makes him travel in time, more precisely, to the past. After the chance to change his story, Zero returns to this totally changed.", 106, "Portuguese", "/zWJvHrWK8p8gvVyqEukIejc4JIE.jpg", 7.2999999999999998, new DateTime(2011, 9, 2, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Man from the Future" },
                    { 74308, null, "NR", "A chronicle of three weeks in the lives of several high school teachers, administrators and students through the eyes of substitute teacher, Henry Barthes. Henry roams from school to school, imparting modes of knowledge, but never staying long enough to form any semblance of sentient attachment.", 98, "English", "/1J3lh04ux1hUUu1U9eWYsRibGky.jpg", 7.5, new DateTime(2011, 4, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), "Detachment" },
                    { 74643, null, "PG-13", "Hollywood, 1927: As silent movie star George Valentin wonders if the arrival of talking pictures will cause him to fade into oblivion, he sparks with Peppy Miller, a young dancer set for a big break.", 100, "English", "/khtVL4abxYczXAWbo1wAz13CLx3.jpg", 7.4000000000000004, new DateTime(2011, 10, 8, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Artist" },
                    { 74879, null, "12", "In the rural area around the Anatolian town of Keskin, the local prosecutor, police commissar, and doctor lead a search for a victim of a murder to whom a suspect named Kenan and his mentally challenged brother confessed. However, the search is proving more difficult than expected as Kenan is fuzzy as to the body's exact location. As the group continues looking, its members can't help but chat among themselves about both trivia and their deepest concerns in an investigation that is proving more trying than any of them expected.", 157, "Turkish", "/jKnV5JDArGn6UyrI9HiYzs7Zykn.jpg", 7.5999999999999996, new DateTime(2011, 9, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), "Once Upon a Time in Anatolia" },
                    { 75233, null, "NR", "One day in the life of Anders, a young recovering drug addict, who takes a brief leave from his treatment center to interview for a job and catch up with old friends in Oslo.", 95, "Norwegian", "/iKAm2TIUYbTaWZKueHAkqQP05Ds.jpg", 7.5, new DateTime(2011, 8, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Oslo, August 31st" },
                    { 75629, null, "15세 이상 관람가", "Fourteen years after Third Impact, Shinji Ikari awakens to a world he does not remember. He hasn't aged. Much of Earth is laid in ruins, NERV has been dismantled, and people who he once protected have turned against him. Befriending the enigmatic Kaworu Nagisa, Shinji continues the fight against the angels and realizes the fighting is far from over, even when it could be against his former allies. The characters' struggles continue amidst the battles against the angels and each other, spiraling down to what could inevitably be the end of the world.", 96, "Japanese", "/51OA5sEGlYtd6jStIOvarJNM9rS.jpg", 7.5999999999999996, new DateTime(2012, 11, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), "Evangelion: 3.0 You Can (Not) Redo" },
                    { 75656, null, "PG-13", "An FBI agent and an Interpol detective track a team of illusionists who pull off bank heists during their performances and reward their audiences with the money.", 116, "English", "/tWsNYbrqy1p1w6K9zRk0mSchztT.jpg", 7.4000000000000004, new DateTime(2013, 5, 29, 0, 0, 0, 0, DateTimeKind.Unspecified), "Now You See Me" },
                    { 76203, null, "R", "In the pre-Civil War United States, Solomon Northup, a free black man from upstate New York, is abducted and sold into slavery. Facing cruelty as well as unexpected kindnesses Solomon struggles not only to stay alive, but to retain his dignity. In the twelfth year of his unforgettable odyssey, Solomon’s chance meeting with a Canadian abolitionist will forever alter his life.", 134, "English", "/xdANQijuNrJaw1HA61rDccME4Tm.jpg", 7.9000000000000004, new DateTime(2013, 10, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), "12 Years a Slave" },
                    { 76341, null, "R", "An apocalyptic story set in the furthest reaches of our planet, in a stark desert landscape where humanity is broken, and most everyone is crazed fighting for the necessities of life. Within this world exist two rebels on the run who just might be able to restore order.", 121, "English", "/8tZYtuWezp8JbcsvHYO0O46tFbo.jpg", 7.5, new DateTime(2015, 5, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), "Mad Max: Fury Road" },
                    { 76543, null, "NR", "The story of Joseph, a man plagued by violence and a rage that is driving him to self-destruction. As Joseph's life spirals into turmoil a chance of redemption appears in the form of Hannah, a Christian charity shop worker. Their relationship develops to reveal that Hannah is hiding a secret of her own with devastating results on both of their lives.", 93, "English", "/eEVMDYJH1AJ8ZK2IhkLGBb4nRA8.jpg", 7.2999999999999998, new DateTime(2011, 10, 7, 0, 0, 0, 0, DateTimeKind.Unspecified), "Tyrannosaur" },
                    { 76589, null, "PG-13", "An adaptation of Mark Waid's \"Tower of Babel\" story from the JLA comic. Vandal Savage steals confidential files Batman has compiled on the members of the Justice League, and learns all their weaknesses.", 77, "English", "/seCbcjdZYUl8SRKjeWfyi2ngzFj.jpg", 7.4000000000000004, new DateTime(2012, 2, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), "Justice League: Doom" },
                    { 76696, null, "PG-13", "Martin is a neurotic web designer taking baby steps out of the isolation of his one-room apartment and his virtual reality. Mariana is an artist fresh out of a a long relationship. They are perfect for each other, live on the same street, in opposite buildings, but they never meet. Can the movement of a modern city of three million people bring them together?", 95, "Spanish", "/seVQVigIvMnifmIyPqQeZl6uM7x.jpg", 7.7000000000000002, new DateTime(2011, 2, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "Sidewalls" },
                    { 76758, null, "R", "A Westerner finds refuge with a group of women in a church during Japan's rape of Nanking in 1937. Posing as a priest, he attempts to lead the women to safety.", 146, "Mandarin", "/7NVgVX663tdareijAiv0eLiLn6d.jpg", 7.5, new DateTime(2011, 12, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Flowers of War" },
                    { 77016, null, "R", "Two young officers are marked for death after confiscating a small cache of money and firearms from the members of a notorious cartel during a routine traffic stop.", 109, "English", "/pDeVKQICkcdwwjHxGj0MeS14YJ6.jpg", 7.2999999999999998, new DateTime(2012, 9, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), "End of Watch" },
                    { 77338, null, "R", "A true story of two men who should never have met – a quadriplegic aristocrat who was injured in a paragliding accident and a young man from the projects.", 113, "French", "/ttx4GQl0azO6NJFWj4XNZCQOY7S.jpg", 8.3000000000000007, new DateTime(2011, 11, 2, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Intouchables" },
                    { 79120, null, "18", "After a drunken house party with his straight mates, Russell heads out to a gay club. Just before closing time he picks up Glen but what's expected to be just a one-night stand becomes something else, something special.", 96, "English", "/9IXvuqpJeOjYRyMt42G1NrK0QzU.jpg", 7.2999999999999998, new DateTime(2011, 9, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), "Weekend" },
                    { 80184, null, "12", "A Spanish orchestra conductor deals with the mysterious disappearance of his girlfriend.", 92, "Spanish", "/7aMvCD4TkQ8rKqrJiuPCJnHinrk.jpg", 7.2000000000000002, new DateTime(2011, 9, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Hidden Face" },
                    { 80278, null, "PG-13", "In December 2004, close-knit family Maria, Henry and their three sons begin their winter vacation in Thailand. But the day after Christmas, the idyllic holiday turns into an incomprehensible nightmare when a terrifying roar rises from the depths of the sea, followed by a wall of black water that devours everything in its path. Though Maria and her family face their darkest hour, unexpected displays of kindness and courage ameliorate their terror.", 113, "English", "/5dtla4cclnzfhou3IADsHERLEyk.jpg", 7.2999999999999998, new DateTime(2012, 9, 9, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Impossible" },
                    { 81188, null, "PG", "When an evil spirit known as Pitch lays down the gauntlet to take over the world, the immortal Guardians must join forces for the first time to protect the hopes, beliefs and imagination of children all over the world.", 97, "English", "/kUBkmlWriPbNMijL2m3LtmPYPTb.jpg", 7.2999999999999998, new DateTime(2012, 11, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), "Rise of the Guardians" },
                    { 81401, null, "16", "A monumental windstorm and an abused horse's refusal to work or eat signal the beginning of the end for a poor farmer and his daughter.", 155, "Hungarian", "/2kSElneXSKmMsGL55k0CbPGqLbu.jpg", 7.7999999999999998, new DateTime(2011, 2, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Turin Horse" },
                    { 81481, null, "18", "Based on actual events that took place at Gwangju Inhwa School for the hearing-impaired, where young deaf students were the victims of repeated sexual assaults by faculty members over a period of five years in the early 2000s.", 125, "Korean", "/mbMp0oIFmYnw0i5gzRoKt8cH5ve.jpg", 8.0999999999999996, new DateTime(2011, 9, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), "Silenced" },
                    { 82690, null, "PG", "Wreck-It Ralph is the 9-foot-tall, 643-pound villain of an arcade video game named Fix-It Felix Jr., in which the game's titular hero fixes buildings that Ralph destroys. Wanting to prove he can be a good guy and not just a villain, Ralph escapes his game and lands in Hero's Duty, a first-person shooter where he helps the game's hero battle against alien invaders. He later enters Sugar Rush, a kart racing game set on tracks made of candies, cookies and other sweets. There, Ralph meets Vanellope von Schweetz who has learned that her game is faced with a dire threat that could affect the entire arcade, and one that Ralph may have inadvertently started.", 101, "English", "/zWoIgZ7mgmPkaZjG0102BSKFIqQ.jpg", 7.2999999999999998, new DateTime(2012, 11, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "Wreck-It Ralph" },
                    { 82695, null, "PG-13", "An adaptation of the successful stage musical based on Victor Hugo's classic novel set in 19th-century France, in which a paroled prisoner named Jean Valjean seeks redemption.", 158, "English", "/dU8UbgPHnnSA4gHJXNqEhKCNc6b.jpg", 7.4000000000000004, new DateTime(2012, 12, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), "Les Misérables" },
                    { 82702, null, "PG", "The thrilling second chapter of the epic How To Train Your Dragon trilogy brings back the fantastical world of Hiccup and Toothless five years later. While Astrid, Snotlout and the rest of the gang are challenging each other to dragon races (the island's new favorite contact sport), the now inseparable pair journey through the skies, charting unmapped territories and exploring new worlds. When one of their adventures leads to the discovery of a secret ice cave that is home to hundreds of new wild dragons and the mysterious Dragon Rider, the two friends find themselves at the center of a battle to protect the peace.", 102, "English", "/d13Uj86LdbDLrfDoHR5aDOFYyJC.jpg", 7.7000000000000002, new DateTime(2014, 6, 9, 0, 0, 0, 0, DateTimeKind.Unspecified), "How to Train Your Dragon 2" },
                    { 83389, null, "PG", "A group of Yokohama students fight to save their school's clubhouse from the wrecking ball during preparations for the 1964 Tokyo Olympic Games. While working there, Umi and Shun gradually become attracted to each other but have to face a sudden trial. Even so, they keep going without fleeing the difficulties of reality.", 91, "Japanese", "/rRLYX4RZIyloHSJwvZKAhphAjiB.jpg", 7.5, new DateTime(2011, 7, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), "From Up on Poppy Hill" },
                    { 83564, null, "G", "A young boy comes of age in the most peculiar of circumstances. Tonight is the very first time his Papa and Grandpa are taking him to work. In an old wooden boat they row far out to sea, and with no land in sight, they stop and wait. A big surprise awaits the boy as he discovers his family's most unusual line of work. Should he follow the example of his Papa, or his Grandpa? Will he be able to find his own way in the midst of their conflicting opinions and timeworn traditions?", 7, "English", "/hCaUWmS7GyQAyfNfsJdZyZrEc5U.jpg", 7.9000000000000004, new DateTime(2012, 2, 10, 0, 0, 0, 0, DateTimeKind.Unspecified), "La luna" },
                    { 83666, null, "PG-13", "Set on an island off the coast of New England in the summer of 1965, Moonrise Kingdom tells the story of two twelve-year-olds who fall in love, make a secret pact, and run away together into the wilderness. As various authorities try to hunt them down, a violent storm is brewing off-shore – and the peaceful island community is turned upside down in more ways than anyone can handle.", 94, "English", "/wOgmhrSUwOuZJsQXf2GsI923N0f.jpg", 7.7000000000000002, new DateTime(2012, 5, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), "Moonrise Kingdom" },
                    { 84892, null, "PG-13", "Pittsburgh, Pennsylvania, 1991. High school freshman Charlie is a wallflower, always watching life from the sidelines, until two senior students, Sam and her stepbrother Patrick, become his mentors, helping him discover the joys of friendship, music and love.", 103, "English", "/aKCvdFFF5n80P2VdS7d8YBwbCjh.jpg", 7.7999999999999998, new DateTime(2012, 9, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Perks of Being a Wallflower" },
                    { 85350, null, "R", "The film tells a story of a divorced couple trying to raise their young son. The story follows the boy for twelve years, from first grade at age 6 through 12th grade at age 17-18, and examines his relationship with his parents as he grows.", 165, "English", "/1rlqd3j5UC4r1TF3UmcKupMyuxR.jpg", 7.5, new DateTime(2014, 6, 5, 0, 0, 0, 0, DateTimeKind.Unspecified), "Boyhood" },
                    { 86837, null, "PG-13", "Georges and Anne are in their eighties. They are cultivated, retired music teachers. Their daughter, who is also a musician, lives abroad with her family. One day, Anne has a stroke, and the couple's bond of love is severely tested.", 127, "French", "/6aMbUAZJJkoIPsaG99D8mn65tZV.jpg", 7.7999999999999998, new DateTime(2012, 7, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "Amour" },
                    { 87827, null, "PG", "The story of an Indian boy named Pi, a zookeeper's son who finds himself in the company of a hyena, zebra, orangutan, and a Bengal tiger after a shipwreck sets them adrift in the Pacific Ocean.", 127, "English", "/leKQao68zra3SY2cPHZLzEbdLKT.jpg", 7.4000000000000004, new DateTime(2012, 11, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), "Life of Pi" },
                    { 88273, null, "R", "A young queen falls in love with her physician, and they start a revolution that changes their nation forever.", 137, "Danish", "/AafVGIirBlCw8Whb4DSPSLX9nGW.jpg", 7.4000000000000004, new DateTime(2012, 3, 29, 0, 0, 0, 0, DateTimeKind.Unspecified), "A Royal Affair" },
                    { 90369, null, "PG-13", "A girl dying of leukemia compiles a list of things she'd like to do before passing away. Topping the list is her desire to lose her virginity.", 103, "English", "/oOBHF6qWtMkzwpnrLDTKJPAb3zH.jpg", 7.4000000000000004, new DateTime(2012, 5, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "Now Is Good" },
                    { 92060, null, null, "A night at the movies turns into a nightmare when Michael and his date are attacked by a hoard of bloody-thirsty zombies.", 14, "English", "/qjWV4Aq4t0SMhuRpkJ4q3D6byXq.jpg", 8.0999999999999996, new DateTime(1983, 11, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), "Michael Jackson's Thriller" },
                    { 92321, null, null, "One hot summer day a little girl gets lost in an enchanted forest of the mountain god where spirits reside. A young boy appears before her, but she cannot touch him for fear of making him disappear. And so a wondrous adventure awaits...", 45, "Japanese", "/mDqzHV8UXWWNpZkoAbKmKX1ZxEE.jpg", 8.4000000000000004, new DateTime(2011, 9, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), "Hotarubi no Mori e" }
                });

            migrationBuilder.InsertData(
                table: "Movies",
                columns: new[] { "Id", "ActorId", "Certification", "Description", "Duration", "Language", "Picture", "Ratings", "ReleaseDate", "Title" },
                values: new object[,]
                {
                    { 94047, null, "R", "Jun-shik, who works for Tatsuo’s grandfather’s farm while Korea is colonized by Japan, dreams about participating in the Tokyo Olympics as a marathon runner. Tatsuo also aims to become a marathon runner, so the two become rivals. But the war breaks out and they both are forced to enlist in the army. Tatsuo becomes the head of defense in Jun-shik’s unit and he devises a scheme but fails. Jun-shik and Tatsuo are held captive by the Soviets. They run away but soon are captured by the Germans and forced to separate. In 1944, they meet again on the shores of Normandy.", 137, "Korean", "/3moPqIC1EBFilLI3YJNa5Nfel3e.jpg", 8.0, new DateTime(2011, 12, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), "My Way" },
                    { 94329, null, "R", "Deep in the heart of Jakarta's slums lies an impenetrable safe house for the world's most dangerous killers and gangsters. Until now, the run-down apartment block has been considered untouchable to even the bravest of police. Cloaked under the cover of pre-dawn darkness and silence, an elite swat team is tasked with raiding the safe house in order to take down the notorious drug lord that runs it.  But when a chance encounter with a spotter blows their cover and news of their assault reaches the drug lord, the building's lights are cut and all the exits blocked. Stranded on the sixth floor with no way out, the unit must fight their way through the city's worst to survive their mission. Starring Indonesian martial arts sensation Iko Uwais.", 101, "Indonesian", "/Abnm1Ws3JH0ReCfEhLMPwPcMcGO.jpg", 7.4000000000000004, new DateTime(2012, 3, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Raid" },
                    { 96721, null, "R", "A biographical drama centered on the rivalry between Formula 1 drivers James Hunt and Niki Lauda during the 1976 Formula One motor-racing season.", 123, "English", "/uWcMgxO3p3qwVFUxsRz1HbTzGvT.jpg", 7.7000000000000002, new DateTime(2013, 9, 2, 0, 0, 0, 0, DateTimeKind.Unspecified), "Rush" },
                    { 99861, null, "PG-13", "When Tony Stark tries to jumpstart a dormant peacekeeping program, things go awry and Earth’s Mightiest Heroes are put to the ultimate test as the fate of the planet hangs in the balance. As the villainous Ultron emerges, it is up to The Avengers to stop him from enacting his terrible plans, and soon uneasy alliances and unexpected action pave the way for an epic and unique global adventure.", 141, "English", "/4ssDuvEDkSArWEdyBl2X5EHvYKU.jpg", 7.2999999999999998, new DateTime(2015, 4, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), "Avengers: Age of Ultron" },
                    { 100271, null, "PG", "Clinging to an unfinished letter written by her recently deceased father, young Momo moves with her mother from bustling Tokyo to the remote Japanese island of Shio. Upon their arrival, she begins to explore her new habitat, meeting local children and learning their routines and customs. However, it's not long before several bizarre occurrences crop up around the previously tranquil island. Orchards are found ransacked, prized trinkets start disappearing and, worst of all, each morning after her mother leaves for work, Momo hears strange mumblings coming from the attic of their home. Annoyed by these creepy goings-on and her mother's refusal to believe them, Momo embarks on a strange and supernatural adventure to discover the source of the mischief, which leads her to a trio of troublesome imps: the flatulent lizard Kawa, the childlike Mame and their hulking ogre leader Iwa. Momo also learns that her visit to the island is in some way connected to her father's mysterious letter.", 120, "Japanese", "/zDCinQ7NkgicoFtDisTZ3FYG0cL.jpg", 7.5, new DateTime(2011, 9, 10, 0, 0, 0, 0, DateTimeKind.Unspecified), "A Letter to Momo" },
                    { 100402, null, "PG-13", "After the cataclysmic events in New York with The Avengers, Steve Rogers, aka Captain America is living quietly in Washington, D.C. and trying to adjust to the modern world. But when a S.H.I.E.L.D. colleague comes under attack, Steve becomes embroiled in a web of intrigue that threatens to put the world at risk. Joining forces with the Black Widow, Captain America struggles to expose the ever-widening conspiracy while fighting off professional assassins sent to silence him at every turn. When the full scope of the villainous plot is revealed, Captain America and the Black Widow enlist the help of a new ally, the Falcon. However, they soon find themselves up against an unexpected and formidable enemy—the Winter Soldier.", 136, "English", "/5r1zWuzbsVAYSPzvCecAReGhN7k.jpg", 7.7000000000000002, new DateTime(2014, 3, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), "Captain America: The Winter Soldier" },
                    { 101299, null, "PG-13", "Katniss Everdeen has returned home safe after winning the 74th Annual Hunger Games along with fellow tribute Peeta Mellark. Winning means that they must turn around and leave their family and close friends, embarking on a \"Victor's Tour\" of the districts. Along the way Katniss senses that a rebellion is simmering, but the Capitol is still very much in control as President Snow prepares the 75th Annual Hunger Games (The Quarter Quell) - a competition that could change Panem forever.", 146, "English", "/7c1JtraYsjMMnk8Md0IMoyRzqZJ.jpg", 7.4000000000000004, new DateTime(2013, 11, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Hunger Games: Catching Fire" },
                    { 103663, null, "R", "A teacher lives a lonely life, all the while struggling over his son’s custody. His life slowly gets better as he finds love and receives good news from his son, but his new luck is about to be brutally shattered by an innocent little lie.", 116, "Danish", "/jkixsXzRh28q3PCqFoWcf7unghT.jpg", 8.0999999999999996, new DateTime(2012, 9, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Hunt" },
                    { 106646, null, "R", "A New York stockbroker refuses to cooperate in a large securities fraud case involving corruption on Wall Street, corporate banking world and mob infiltration. Based on Jordan Belfort's autobiography.", 180, "English", "/sOxr33wnRuKazR9ClHek73T8qnK.jpg", 8.0, new DateTime(2013, 12, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Wolf of Wall Street" },
                    { 109424, null, "PG-13", "The true story of Captain Richard Phillips and the 2009 hijacking by Somali pirates of the US-flagged MV Maersk Alabama, the first American cargo ship to be hijacked in two hundred years.", 134, "English", "/2x8ida0rHokUv80Ah4eBNb2eXas.jpg", 7.5999999999999996, new DateTime(2013, 10, 10, 0, 0, 0, 0, DateTimeKind.Unspecified), "Captain Phillips" },
                    { 109445, null, "PG", "Young princess Anna of Arendelle dreams about finding true love at her sister Elsa’s coronation. Fate takes her on a dangerous journey in an attempt to end the eternal winter that has fallen over the kingdom. She's accompanied by ice delivery man Kristoff, his reindeer Sven, and snowman Olaf. On an adventure where she will find out what friendship, courage, family, and true love really means.", 102, "English", "/yald8Lsb4uCRvjIH3spzR84Kdwf.jpg", 7.2999999999999998, new DateTime(2013, 11, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), "Frozen" },
                    { 109689, null, "12", "Sequel to \"Three Steps Above Heaven\". The sexy Gin is the new love of Hache, but this can not forget his former girlfriend, so the love triangle is inevitable.", 130, "Spanish", "/z13I3sWzOoKBDAEpJ7iK9bSznQn.jpg", 7.2000000000000002, new DateTime(2012, 6, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), "I Want You" },
                    { 110160, null, "PG-13", "The story of an impossible love between a woman named Fred and a transgender woman named Laurence who reveals her inner desire to become her true self.", 168, "French", "/d8BpJ9qOQE7VFFqaV1XDdGfMsP7.jpg", 7.7000000000000002, new DateTime(2012, 5, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), "Laurence Anyways" },
                    { 110416, null, "PG", "The story of the last Seal Child’s journey home. After their mother’s disappearance, Ben and Saoirse are sent to live with Granny in the city. When they resolve to return to their home by the sea, their journey becomes a race against time as they are drawn into a world Ben knows only from his mother’s folktales. But this is no bedtime story; these fairy folk have been in our world far too long. It soon becomes clear to Ben that Saoirse is the key to their survival.", 93, "English", "/3DBX7QOEzWPNcDhqXInk6GBEvhK.jpg", 8.0, new DateTime(2014, 9, 6, 0, 0, 0, 0, DateTimeKind.Unspecified), "Song of the Sea" },
                    { 110420, null, "PG", "After her werewolf lover unexpectedly dies in an accident, a woman must find a way to raise the son and daughter that she had with him. However, their inheritance of their father's traits prove to be a challenge for her.", 117, "Japanese", "/nqqovhsvsWbsb7LcGaIGDRZrwgB.jpg", 8.3000000000000007, new DateTime(2012, 7, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), "Wolf Children" },
                    { 111083, null, "15", "A woman’s body disappears mysteriously from the morgue without a trace. Police inspector Jaime Peña investigates the strange occurrence with the help of Álex Ulloa, the widower of the missing woman.", 112, "Spanish", "/du9zczcShf4WIuljDR0Aib7AYtX.jpg", 7.5999999999999996, new DateTime(2012, 10, 4, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Body" },
                    { 111969, null, "R", "An acclaimed writer, his ex-wife, and their teenaged children come to terms with the complexities of love in all its forms over the course of one tumultuous year.", 97, "English", "/6vG0eCHT2e4uH035g1s6JTouU6R.jpg", 7.4000000000000004, new DateTime(2013, 6, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), "Stuck in Love" },
                    { 112198, null, "U", "Vincent, a wealthy real estate agent, is invited to dinner by his sister Elizabeth and her husband Peter, both professors in Paris. Claude, a childhood friend and trombonist in a symphony orchestra, is also present. Vincent brings news from the prenatal examination of his and his wife Anna's unborn son.  The name chosen by the soon-to-be parents strongly offends the others for many reasons. The dispute between the guests quickly escalates and before long the resurgence of old grudges and hidden secrets is unavoidable ...", 109, "French", "/w5JWQo7ArqmoegKYiQbv8TeAJmg.jpg", 7.2999999999999998, new DateTime(2012, 4, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "What's in a Name" },
                    { 112949, null, "PG-13", "A young woman with a mysterious past lands in Southport, North Carolina where her bond with a widower forces her to confront the dark secret that haunts her.", 115, "English", "/2CbJ3HTb6SFbMeguYH52UQSHOwY.jpg", 7.2999999999999998, new DateTime(2013, 2, 7, 0, 0, 0, 0, DateTimeKind.Unspecified), "Safe Haven" },
                    { 113082, null, "16", "Guts, an immensely strong sword-for-hire, has little direction in his life, simply fighting one battle after the next. However, this all changes suddenly when he meets and is bested by Griffith, a beautiful and charismatic young man who leads the Band of the Hawk mercenary army. After Guts joins the Band and the relationship between the two men begins to blossom, Casca, the tough, lone swordswoman in the Band of the Hawk, struggles to accept Guts and the influence he has on the world around her.  While the two men begin to fight together, Griffith continues to rise to power, all seemingly in order to reach his mysterious, prophesied goals. What lengths will Guts and Griffith go to in order to reach these goals, and where will fate take the two men?", 76, "Japanese", "/vES8WAzjowrMT8gwnoEaCioZXXk.jpg", 7.2999999999999998, new DateTime(2012, 2, 3, 0, 0, 0, 0, DateTimeKind.Unspecified), "Berserk: The Golden Age Arc I - The Egg of the King" },
                    { 113833, null, "NC-17", "The story of the onset of the HIV-AIDS crisis in New York City in the early 1980s, taking an unflinching look at the nation's sexual politics as gay activists and their allies in the medical community fight to expose the truth about the burgeoning epidemic to a city and nation in denial.", 133, "English", "/qhugciu9LSc1g3FeS2FrR55wPi4.jpg", 7.9000000000000004, new DateTime(2014, 5, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Normal Heart" },
                    { 114150, null, "PG-13", "College student Beca knows she does not want to be part of a clique, but that's exactly where she finds herself after arriving at her new school. Thrust in among mean gals, nice gals and just plain weird gals, Beca finds that the only thing they have in common is how well they sing together. She takes the women of the group out of their comfort zone of traditional arrangements and into a world of amazing harmonic combinations in a fight to the top of college music competitions.", 112, "English", "/ntRIoh8Qf1BI1AYGx0STfq0wUmb.jpg", 7.2999999999999998, new DateTime(2012, 9, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), "Pitch Perfect" },
                    { 118340, null, "PG-13", "Light years from Earth, 26 years after being abducted, Peter Quill finds himself the prime target of a manhunt after discovering an orb wanted by Ronan the Accuser.", 121, "English", "/r7vmZjiyZw9rpJMQJdXpjgiCOk9.jpg", 7.9000000000000004, new DateTime(2014, 7, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Guardians of the Galaxy" },
                    { 118406, null, "PG-13", "Sixteen years ago, a mysterious masked ninja unleashes a powerful creature known as the Nine-Tailed Demon Fox on the Hidden Leaf Village Konoha, killing many people. In response, the Fourth Hokage Minato Namikaze and his wife Kushina Uzumaki, the Demon Fox's living prison or Jinchūriki, manage to seal the creature inside their newborn son Naruto Uzumaki. With the Tailed Beast sealed, things continued as normal. However, in the present day, peace ended when a group of ninja called the Akatsuki attack Konoha under the guidance of Tobi, the mysterious masked man behind Fox's rampage years ago who intends on executing his plan to rule the world by shrouding it in illusions.", 109, "Japanese", "/xLal6fXNtiJN6Zw6qk21xAtdOeN.jpg", 7.5, new DateTime(2012, 7, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), "Naruto Shippuden the Movie: Road to Ninja" },
                    { 118412, null, "16", "The Band of the Hawk participates in the Midland war campaign. On the bloody battlefield, they conquer decisive victories that lead them to Doldrey, an old fortress that will decide the outcome of the war.", 98, "Japanese", "/gzVQQaDazukAcmiFx6l9WLj1kwo.jpg", 7.4000000000000004, new DateTime(2012, 6, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), "Berserk: The Golden Age Arc II - The Battle for Doldrey" },
                    { 119450, null, "PG-13", "A group of scientists in San Francisco struggle to stay alive in the aftermath of a plague that is wiping out humanity, while Caesar tries to maintain dominance over his community of intelligent apes.", 130, "English", "/ie14Sm0hRI5f7Te2KIfU64NyCPr.jpg", 7.2999999999999998, new DateTime(2014, 6, 26, 0, 0, 0, 0, DateTimeKind.Unspecified), "Dawn of the Planet of the Apes" },
                    { 120467, null, "R", "The Grand Budapest Hotel tells of a legendary concierge at a famous European hotel between the wars and his friendship with a young employee who becomes his trusted protégé. The story involves the theft and recovery of a priceless Renaissance painting, the battle for an enormous family fortune and the slow and then sudden upheavals that transformed Europe during the first half of the 20th century.", 100, "English", "/eWdyYQreja6JGCzqHWXpWHDrrPo.jpg", 8.0, new DateTime(2014, 2, 26, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Grand Budapest Hotel" },
                    { 121642, null, "R", "Full-throttle melodrama about an ill-starred romance set against the backdrop of the siege of Sarajevo. A mother brings her teenage son to Sarajevo, where his father died in the Bosnian conflict years ago.", 127, "Italian", "/5GejiOMytAU50rPVQHLKRaVXijr.jpg", 7.2999999999999998, new DateTime(2012, 9, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), "Twice Born" },
                    { 121875, null, "R", "A sixteen-year-old boy insinuates himself into the house of a fellow student from his literature class and writes about it in essays for his French teacher. Faced with this gifted and unusual pupil, the teacher rediscovers his enthusiasm for his work, but the boy’s intrusion will unleash a series of uncontrollable events.", 105, "French", "/6NCBSCCcyef9aNcABsVGZwuehSC.jpg", 7.2999999999999998, new DateTime(2012, 9, 26, 0, 0, 0, 0, DateTimeKind.Unspecified), "In the House" },
                    { 121986, null, "R", "An aspiring dancer moves to New York City and becomes caught up in a whirlwind of flighty fair-weather friends, diminishing fortunes and career setbacks.", 86, "English", "/jrq1NoKvsxWCcffVOjegiYwloFN.jpg", 7.4000000000000004, new DateTime(2013, 5, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), "Frances Ha" },
                    { 122906, null, "R", "The night after another unsatisfactory New Year party, Tim's father tells his son that the men in his family have always had the ability to travel through time. Tim can't change history, but he can change what happens and has happened in his own life – so he decides to make his world a better place... by getting a girlfriend. Sadly, that turns out not to be as easy as he thinks.", 123, "English", "/iR1bVfURbN7r1C46WHFbwCkVve.jpg", 7.9000000000000004, new DateTime(2013, 9, 4, 0, 0, 0, 0, DateTimeKind.Unspecified), "About Time" },
                    { 122917, null, "PG-13", "Immediately after the events of The Desolation of Smaug, Bilbo and the dwarves try to defend Erebor's mountain of treasure from others who claim it: the men of the ruined Laketown and the elves of Mirkwood. Meanwhile an army of Orcs led by Azog the Defiler is marching on Erebor, fueled by the rise of the dark lord Sauron. Dwarves, elves and men must unite, and the hope for Middle-Earth falls into Bilbo's hands.", 144, "English", "/xT98tLqatZPQApyRmlPL12LtiWp.jpg", 7.2999999999999998, new DateTime(2014, 12, 10, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Hobbit: The Battle of the Five Armies" },
                    { 123025, null, "PG-13", "Batman has not been seen for ten years. A new breed of criminal ravages Gotham City, forcing 55-year-old Bruce Wayne back into the cape and cowl. But, does he still have what it takes to fight crime in a new era?", 76, "English", "/kkjTbwV1Xnj8wBL52PjOcXzTbnb.jpg", 7.7999999999999998, new DateTime(2012, 8, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), "Batman: The Dark Knight Returns, Part 1" },
                    { 126319, null, "PG", "Celestine is a little mouse trying to avoid a dental career; Ernest is a big bear craving an artistic outlet. When Celestine meets Ernest, they overcome their natural enmity by forging a life of crime together.", 78, "French", "/uSvv6OiqGAT7MBFsZLxmZv6NYRZ.jpg", 7.7999999999999998, new DateTime(2012, 12, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), "Ernest & Celestine" },
                    { 127501, null, "PG", "He is cute. He's shrewd. The girls love him. The cops hate him. He can't speak but is always talked about. His naughty antics will make you scream, but he will never listen. Cos he can't! Next summer ride a rollercoaster of emotions with Barfii - the Chalu Chaplin!", 151, "Hindi", "/8lVuWmArvr41CvyvpgI3elD5iB1.jpg", 7.5, new DateTime(2012, 9, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), "Barfi!" },
                    { 127533, null, "IIB", "Former legendary assassin Kenshin Himura has now become a wandering samurai. Offering aid & protecting those in need as atonement for his past deeds. During this time Kenshin Himura comes across and aides Kaoru Kamiya (Emi Takei). Her father opened the Kamiya Kasshin-ryu, a kendo school located in Tokyo and Kaoru is now an instructor there. Kaoru then invites Kenshin to stay at her dojo. Their relationship develops further, but Kenshin is still haunted by his violent past...", 134, "Japanese", "/vo3Zs07PZfKNsTrU0pcPZONJcN5.jpg", 7.5999999999999996, new DateTime(2012, 8, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "Rurouni Kenshin Part I: Origins" },
                    { 127585, null, "PG-13", "The ultimate X-Men ensemble fights a war for the survival of the species across two time periods as they join forces with their younger selves in an epic battle that must change the past – to save our future.", 132, "English", "/bvN8iUpHyBIvniUk4e52SUZMA7Z.jpg", 7.5, new DateTime(2014, 5, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "X-Men: Days of Future Past" },
                    { 129112, null, "PG", "Wadjda is a 10-year-old girl living in a suburb of Riyadh, the capital of Saudi Arabia. Although she lives in a conservative world, Wadjda is fun loving, entrepreneurial and always pushing the boundaries of what she can get away with. After a fight with her friend Abdullah, a neighborhood boy she shouldn't be playing with, Wadjda sees a beautiful green bicycle for sale. She wants the bicycle desperately so that she can beat Abdullah in a race. But Wadjda's mother won't allow it, fearing repercussions from a society that sees bicycles as dangerous to a girl's virtue. So Wadjda decides to try and raise the money herself...", 98, "Arabic", "/w4iCIZ1kWSOCt0yELjfUMNAToUF.jpg", 7.2999999999999998, new DateTime(2012, 8, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Wadjda" },
                    { 129670, null, "R", "An aging, booze-addled father takes a trip from Montana to Nebraska with his estranged son in order to claim what he believes to be a million-dollar sweepstakes prize.", 115, "English", "/3WdcebeFY1ProN3MxKuaT78CK8w.jpg", 7.5, new DateTime(2013, 9, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), "Nebraska" },
                    { 132344, null, "R", "It has been nine years since we last met Jesse and Celine, the French-American couple who once met on a train in Vienna. Now, live in Paris with twin daughters, but have spent a summer in Greece on the invitation of an author colleague of Jesse's. When the vacation is over and Jesse must send his teenage son off to the States, he begins to question his life decisions, and his relationship with Celine is at risk.", 109, "English", "/6wTw6762kAVTkyQWoHRUuUiRpBp.jpg", 7.5, new DateTime(2013, 4, 5, 0, 0, 0, 0, DateTimeKind.Unspecified), "Before Midnight" },
                    { 132363, null, "PG-13", "A look at the life of Cecil Gaines who served eight presidents as the White House's head butler from 1952 to 1986, and had a unique front-row seat as political and racial history was made.", 132, "English", "/TTtg1JzS8OJjbmiKTyCSlfYw0M.jpg", 7.4000000000000004, new DateTime(2013, 8, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Butler" },
                    { 137106, null, "PG", "An ordinary Lego mini-figure, mistakenly thought to be the extraordinary MasterBuilder, is recruited to join a quest to stop an evil Lego tyrant from gluing the universe together.", 100, "English", "/lbctonEnewCYZ4FYoTZhs8cidAl.jpg", 7.4000000000000004, new DateTime(2014, 2, 6, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Lego Movie" }
                });

            migrationBuilder.InsertData(
