                values: new object[,]
                {
                    { 137113, null, "PG-13", "Major Bill Cage is an officer who has never seen a day of combat when he is unceremoniously demoted and dropped into combat. Cage is killed within minutes, managing to take an alpha alien down with him. He awakens back at the beginning of the same day and is forced to fight and die again... and again - as physical contact with the alien has thrown him into a time loop.", 113, "English", "/uUHvlkLavotfGsNtosDy8ShsIYF.jpg", 7.5999999999999996, new DateTime(2014, 5, 27, 0, 0, 0, 0, DateTimeKind.Unspecified), "Edge of Tomorrow" },
                    { 137182, null, "12", "The loss of their young daughter threatens to destroy the love and faith of two married musicians.", 112, "Dutch", "/negBN3VXOSmnSp4kncYJvCuJKf4.jpg", 7.7000000000000002, new DateTime(2012, 10, 9, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Broken Circle Breakdown" },
                    { 138843, null, "R", "Paranormal investigators Ed and Lorraine Warren work to help a family terrorized by a dark presence in their farmhouse. Forced to confront a powerful entity, the Warrens find themselves caught in the most terrifying case of their lives.", 112, "English", "/wVYREutTvI2tmxr6ujrHT704wGF.jpg", 7.5, new DateTime(2013, 3, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Conjuring" },
                    { 140420, null, "G", "An urban office worker finds that paper airplanes are instrumental in meeting a girl in ways he never expected.", 7, "English", "/cotIVIwA72zGbyJFacCIBXBWssG.jpg", 8.0, new DateTime(2012, 11, 2, 0, 0, 0, 0, DateTimeKind.Unspecified), "Paperman" },
                    { 140607, null, "PG-13", "Thirty years after defeating the Galactic Empire, Han Solo and his allies face a new threat from the evil Kylo Ren and his army of Stormtroopers.", 136, "English", "/wqnLdwVXoBjKibFRR5U3y0aDUhs.jpg", 7.4000000000000004, new DateTime(2015, 12, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Star Wars: The Force Awakens" },
                    { 140823, null, "PG-13", "Author P.L. Travers looks back on her childhood while reluctantly meeting with Walt Disney, who seeks to adapt her Mary Poppins books for the big screen.", 125, "English", "/qfhiVU59BSPCdOZwPNs29Z8S23K.jpg", 7.4000000000000004, new DateTime(2013, 11, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), "Saving Mr. Banks" },
                    { 142061, null, "PG-13", "Batman has stopped the reign of terror that The Mutants had cast upon his city.  Now an old foe wants a reunion and the government wants The Man of Steel to put a stop to Batman.", 78, "English", "/arEZYd6uMOFTILne9Ux0A8qctMe.jpg", 8.0, new DateTime(2013, 1, 3, 0, 0, 0, 0, DateTimeKind.Unspecified), "Batman: The Dark Knight Returns, Part 2" },
                    { 146233, null, "R", "Keller Dover faces a parent's worst nightmare when his 6-year-old daughter, Anna, and her friend go missing. The only lead is an old motorhome that had been parked on their street. The head of the investigation, Detective Loki, arrests the driver, but a lack of evidence forces Loki to release his only suspect. Dover, knowing that his daughter's life is at stake, decides that he has no choice but to take matters into his own hands.", 153, "English", "/tuZhZ6biFMr5n9YSVuHOJnNL1uU.jpg", 8.0, new DateTime(2013, 9, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), "Prisoners" },
                    { 149870, null, "PG-13", "A lifelong love of flight inspires Japanese aviation engineer Jiro Horikoshi, whose storied career includes the creation of the A-6M World War II fighter plane.", 126, "Japanese", "/jcjNEfMVwBrqDpj0hys1XmTwfpM.jpg", 7.7999999999999998, new DateTime(2013, 7, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Wind Rises" },
                    { 149871, null, "PG", "Found inside a shining stalk of bamboo by an old bamboo cutter and his wife, a tiny girl grows rapidly into an exquisite young lady. The mysterious young princess enthralls all who encounter her - but ultimately she must confront her fate, the punishment for her crime.", 137, "Japanese", "/mWRQNlWXYYfd2z4FRm99MsgHgiA.jpg", 8.0999999999999996, new DateTime(2013, 11, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Tale of the Princess Kaguya" },
                    { 150540, null, "PG", "Growing up can be a bumpy road, and it's no exception for Riley, who is uprooted from her Midwest life when her father starts a new job in San Francisco. Riley's guiding emotions— Joy, Fear, Anger, Disgust and Sadness—live in Headquarters, the control centre inside Riley's mind, where they help advise her through everyday life and tries to keep things positive, but the emotions conflict on how best to navigate a new city, house and school.", 95, "English", "/lRHE0vzf3oYJrhbsHXjIkF4Tl5A.jpg", 7.9000000000000004, new DateTime(2015, 6, 9, 0, 0, 0, 0, DateTimeKind.Unspecified), "Inside Out" },
                    { 152532, null, "R", "Loosely based on the true-life tale of Ron Woodroof, a drug-taking, women-loving, homophobic man who in 1986 was diagnosed with HIV/AIDS and given thirty days to live.", 117, "English", "/7Fdh7gUq3plvQqxRbNYhWvDABXA.jpg", 7.9000000000000004, new DateTime(2013, 11, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), "Dallas Buyers Club" },
                    { 152601, null, "R", "In the not so distant future, Theodore, a lonely writer purchases a newly developed operating system designed to meet the user's every needs. To Theodore's surprise, a romantic relationship develops between him and his operating system. This unconventional love story blends science fiction and romance in a sweet tale that explores the nature of love and the ways that technology isolates and connects us all.", 126, "English", "/yk4J4aewWYNiBhD49WD7UaBBn37.jpg", 7.9000000000000004, new DateTime(2013, 12, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), "Her" },
                    { 152603, null, "R", "A depressed musician reunites with his lover in the desolate streets of Detroit. Though their romance has endured several centuries, it is tested by the arrival of her capricious and unpredictable younger sister.", 123, "English", "/kffoWJ7FfPRlFFBGixOMbq3blQp.jpg", 7.2999999999999998, new DateTime(2013, 12, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), "Only Lovers Left Alive" },
                    { 152742, null, "R", "Virgil Oldman is a world renowned antiques expert and auctioneer. An eccentric genius, he leads a solitary life, going to extreme lengths to keep his distance from the messiness of human relationships. When appointed by the beautiful but emotionally damaged Claire to oversee the valuation and sale of her family’s priceless art collection, Virgil allows himself to form an attachment to her – and soon he is engulfed by a passion which will rock his bland existence to the core.", 124, "English", "/yfbsINSfotAHaeWKJbfsVKSckvq.jpg", 7.9000000000000004, new DateTime(2013, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Best Offer" },
                    { 152780, null, "PG-13", "After four years apart, Ahmad returns to his wife Marie in Paris in order to progress their divorce. During his brief stay, he cannot help noticing the strained relationship between Marie and her daughter Lucie. As he attempts to improve matters between mother and daughter Ahmad unwittingly lifts the lid on a long buried secret...", 130, "French", "/8nff89qjYN3Hck5G33xeRPsM8TZ.jpg", 7.2999999999999998, new DateTime(2013, 5, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Past" },
                    { 157336, null, "PG-13", "The adventures of a group of explorers who make use of a newly discovered wormhole to surpass the limitations on human space travel and conquer the vast distances involved in an interstellar voyage.", 169, "English", "/gEU2QniE6E77NI6lCU6MxlNBvIx.jpg", 8.3000000000000007, new DateTime(2014, 11, 5, 0, 0, 0, 0, DateTimeKind.Unspecified), "Interstellar" },
                    { 157354, null, "R", "Oakland, California. Young Afro-American Oscar Grant crosses paths with family members, friends, enemies and strangers before facing his fate on the platform at Fruitvale Station, in the early morning hours of New Year's Day 2009.", 82, "English", "/dvHYetUIshAPtMhtVtBT7dW5hqh.jpg", 7.4000000000000004, new DateTime(2013, 7, 26, 0, 0, 0, 0, DateTimeKind.Unspecified), "Fruitvale Station" },
                    { 158445, null, "15", "A story about a mentally ill man wrongfully accused of murder and his relationship with his lovingly adorable 6 year old daughter.", 127, "Korean", "/4Ht6RBo4fUmSo2tWE6umtNll58z.jpg", 8.1999999999999993, new DateTime(2013, 1, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), "Miracle in Cell No. 7" },
                    { 160885, null, "T", "", 0, "Italian", "/cr4zdQlqAaybwKTNnmVUWcs1cCU.jpg", 8.0, new DateTime(1999, 5, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), "Tel chi el telùn" },
                    { 165213, null, "NR", "An undercover cop has his loyalties tested when the boss of the corporate gang he's spent years infiltrating dies.", 134, "Korean", "/5Ai3BMJlDGOlZXbcDv3vnOM1CSp.jpg", 7.4000000000000004, new DateTime(2013, 2, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), "New World" },
                    { 166428, null, "PG", "As Hiccup fulfills his dream of creating a peaceful dragon utopia, Toothless’ discovery of an untamed, elusive mate draws the Night Fury away. When danger mounts at home and Hiccup’s reign as village chief is tested, both dragon and rider must make impossible decisions to save their kind.", 104, "English", "/xvx4Yhf0DVH8G4LzNISpMfFBDy2.jpg", 7.7999999999999998, new DateTime(2019, 1, 3, 0, 0, 0, 0, DateTimeKind.Unspecified), "How to Train Your Dragon: The Hidden World" },
                    { 166666, null, "18", "A young Austrian girl is kidnapped and held in captivity for eight years. Based on the real-life case of Natascha Kampusch.", 111, "German", "/jQ7aucozEWiz1cBCdZtcYSJfWC7.jpg", 7.2999999999999998, new DateTime(2013, 2, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), "3096 Days" },
                    { 167073, null, "PG-13", "In 1950s Ireland and New York, young Eilis Lacey has to choose between two men and two countries.", 111, "English", "/5iMZlbhF6SLc5NOsHv82PFSIuoY.jpg", 7.2999999999999998, new DateTime(2015, 10, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), "Brooklyn" },
                    { 167581, null, "NR", "A promising career with the police, a baby on the way... Marc's life seems to be right on track. Then he meets fellow policeman Kay and during their regular jogs Marc experiences a never-before-felt sense of ease and effortlessness -- and what it means to fall in love with another man.", 100, "German", "/utZcONU4ZIuQJJFA12i8RcNriKF.jpg", 7.7000000000000002, new DateTime(2013, 5, 27, 0, 0, 0, 0, DateTimeKind.Unspecified), "Free Fall" },
                    { 168259, null, "PG-13", "Deckard Shaw seeks revenge against Dominic Toretto and his family for his comatose brother.", 137, "English", "/ktofZ9Htrjiy0P6LEowsDaxd3Ri.jpg", 7.2999999999999998, new DateTime(2015, 4, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "Furious 7" },
                    { 169813, null, "R", "Grace, a compassionate young supervisor at a foster care facility, helps at-risk teens. But when a new charge dredges up memories of her own troubled past, Grace's tough exterior begins eroding.", 96, "English", "/qKnsyaJZLXfiL2JhIJEkpA8C3LU.jpg", 7.7999999999999998, new DateTime(2013, 8, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), "Short Term 12" },
                    { 169881, null, "R", "England, 1021. Rob Cole, a boy born in a miserable mining town, swears to become a physician and vanquish disease and death. His harsh path of many years, a quest for knowledge besieged by countless challenges and sacrifices, leads him to the remote Isfahan, in Persia, where he meets Ibn Sina, the greatest healer of his time.", 155, "English", "/6koFQEuyZKNYcBMSVEHYtAeIpUE.jpg", 7.2999999999999998, new DateTime(2013, 12, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Physician" },
                    { 176241, null, "16", "The movie covers the events which occurred in between the downfall of The Company and the finale of the TV series. It details the arrest and incarceration of Sara Tancredi, the final escape plan which Michael devises for Sara, and reveals the ultimate fate of Gretchen Morgan.", 89, "English", "/h1QRyGuWVXM4Cr3FyPISSjMCBkA.jpg", 7.5, new DateTime(2009, 5, 26, 0, 0, 0, 0, DateTimeKind.Unspecified), "Prison Break: The Final Break" },
                    { 176983, null, "PG-13", "Zephyr, now known as Z, rides the seas with only one goal: Destroy all pirates and their dreams at becoming King of Pirates. When Luffy and his crew encounter him at sea, not only are they utterly defeated by the man with an arm made of Seastone, Nami, Robin, and Chopper are turned 10 years younger due to Z's minion Ain. Luffy is so determined to win against him that he does not even notice Z's master plan that could sacrifice thousands of lives.", 108, "Japanese", "/gLyelbsRYljP2iWiD5iubA02kBA.jpg", 7.4000000000000004, new DateTime(2012, 12, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "One Piece Film: Z" },
                    { 177572, null, "PG", "The special bond that develops between plus-sized inflatable robot Baymax, and prodigy Hiro Hamada, who team up with a group of friends to form a band of high-tech heroes.", 102, "English", "/2mxS4wUimwlLmI1xp6QW6NSU361.jpg", 7.7999999999999998, new DateTime(2014, 10, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), "Big Hero 6" },
                    { 177945, null, "G", "Ryota Nonomiya is a successful businessman driven by money. He learns that his biological son was switched with another child after birth. He must make a life-changing decision and choose his true son or the boy he raised as his own.", 120, "Japanese", "/r0nejXOf6e4leWhnLuEQOmC5hrX.jpg", 7.5999999999999996, new DateTime(2013, 9, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), "Like Father, Like Son" },
                    { 179144, null, "T", "Jep Gambardella has seduced his way through the lavish nightlife of Rome for decades, but after his 65th birthday and a shock from the past, Jep looks past the nightclubs and parties to find a timeless landscape of absurd, exquisite beauty.", 142, "Italian", "/1cmOc3ZPkuCTOTqHEsRr3Pk81Um.jpg", 7.5, new DateTime(2013, 5, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Great Beauty" },
                    { 179150, null, "16", "A wanna-be director is given 48 hours by a producer to find the best groan of pain, worthy of an Oscar, as the only condition to back his film.", 95, "French", "/l6aty0lfqsTefZ5xduwT7D44N1q.jpg", 7.2999999999999998, new DateTime(2014, 8, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), "Reality" },
                    { 180147, null, "PG-13", "Tells the \"riches to rags\" story of the Nobles, three upper-class twenty-somethings that appear to have no limits to their checkbooks, and no direction in their lives. Until one day, their father tries to teach them a lesson by staging a financial scandal that forces the whole family to escape to an old house in the poor side of town, and leads the \"kids\" to do what they haven't done before: get jobs.", 108, "Spanish", "/wsj9TvkL6Uh9leY08nuyE4OhOXW.jpg", 7.7999999999999998, new DateTime(2013, 3, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), "We Are the Nobles" },
                    { 180299, null, "R", "After fighting his way through an apartment building populated by an army of dangerous criminals and escaping with his life, SWAT team member Rama goes undercover, joining a powerful Indonesian crime syndicate to protect his family and uncover corrupt members of his own force.", 150, "Indonesian", "/olA39iaXISiKEkACdELgr0ZRvIF.jpg", 7.5999999999999996, new DateTime(2014, 3, 27, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Raid 2" },
                    { 183011, null, "PG-13", "The Flash finds himself in a war-torn alternate timeline and teams up with alternate versions of his fellow heroes to restore the timeline.", 75, "English", "/zmpE3mfhv0NOnI872q66kuuGeZW.jpg", 7.9000000000000004, new DateTime(2013, 7, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Justice League: The Flashpoint Paradox" },
                    { 185789, null, "NR", "Initially, \"Mulholland Dr.\" was to mark David Lynch's return to television. It is a retooling of a script originally shot as a 94-minute pilot for a TV series (co-written with TV screenwriter Joyce Eliason) for the channel ABC, which had approved the script, but chose not even to air the pilot once it was done in 1999, despite Lynch's labours to cut the project to their liking. It was left in limbo until 18 month later French company Studio Canal Plus (also producer of 'The Straight Story') agreed to pay ABC $7 million for the pilot, and budget a few million more to turn the pilot into a two-hour, 27-minute movie. The cost of the film doubled to $14 million as sets had to be reconstructed and actors recalled.", 88, "English", "/oGXtT5UW8lDWt8uxlww2zw9GmBs.jpg", 7.9000000000000004, new DateTime(1999, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "Mulholland Dr." },
                    { 190859, null, "R", "U.S. Navy SEAL Chris Kyle takes his sole mission—protect his comrades—to heart and becomes one of the most lethal snipers in American history. His pinpoint accuracy not only saves countless lives but also makes him a prime target of insurgents. Despite grave danger and his struggle to be a good husband and father to his family back in the States, Kyle serves four tours of duty in Iraq. However, when he finally returns home, he finds that he cannot leave the war behind.", 133, "English", "/i1U46OwMc6vlm7OoSUKfqUH615e.jpg", 7.4000000000000004, new DateTime(2014, 12, 11, 0, 0, 0, 0, DateTimeKind.Unspecified), "American Sniper" },
                    { 191714, null, "PG", "A mistaken delivery in Mumbai's famously efficient lunchbox delivery system (Mumbai's Dabbawallahs) connects a young housewife to a stranger in the dusk of his life. They build a fantasy world together through notes in the lunchbox. Gradually, this fantasy threatens to overwhelm their reality.", 104, "Hindi", "/jSOiz1h97i3qwjZJXY8SeLvjPsl.jpg", 7.2999999999999998, new DateTime(2013, 9, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Lunchbox" },
                    { 193756, null, "R", "Four Navy SEALs on a covert mission to neutralize a high-level Taliban operative must make an impossible moral decision in the mountains of Afghanistan that leads them into an enemy ambush. As they confront unthinkable odds, the SEALs must find reserves of strength and resilience to fight to the finish.", 121, "English", "/zaBIrloyhGK7iNTZMb3f9SARsl8.jpg", 7.4000000000000004, new DateTime(2013, 12, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), "Lone Survivor" },
                    { 194662, null, "R", "A fading actor best known for his portrayal of a popular superhero attempts to mount a comeback by appearing in a Broadway play. As opening night approaches, his attempts to become more altruistic, rebuild his career, and reconnect with friends and family prove more difficult than expected.", 120, "English", "/lvWL5ZRlYFh7M7fOvYswcRqyprI.jpg", 7.5, new DateTime(2014, 8, 27, 0, 0, 0, 0, DateTimeKind.Unspecified), "Birdman or (The Unexpected Virtue of Ignorance)" }
                });

            migrationBuilder.InsertData(
                table: "Movies",
                columns: new[] { "Id", "ActorId", "Certification", "Description", "Duration", "Language", "Picture", "Ratings", "ReleaseDate", "Title" },
                values: new object[,]
                {
                    { 197082, null, "NR", "An enigmatic actress may have a hidden agenda when she auditions for a part in a misogynistic writer's play.", 96, "French", "/9yOGNHS3cUWFi8vaLicLNzNRMld.jpg", 7.4000000000000004, new DateTime(2013, 5, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), "Venus in Fur" },
                    { 198277, null, "R", "Gretta, a budding songwriter, finds herself alone after her boyfriend Dave ditches her. Her life gains purpose when Dan, a record label executive, notices her talent.", 104, "English", "/qx4HXHXt528hS4rwePZbZo20xqZ.jpg", 7.2999999999999998, new DateTime(2013, 9, 7, 0, 0, 0, 0, DateTimeKind.Unspecified), "Begin Again" },
                    { 198375, null, "PG-13", "Takao, who is training to become a shoemaker, skipped school and is sketching shoes in a Japanese-style garden. He meets a mysterious woman, Yukino, who is older than him. Then, without arranging the times, the two start to see each other again and again, but only on rainy days. They deepen their relationship and open up to each other. But the end of the rainy season soon approaches...", 46, "Japanese", "/8ciSABYn5ANts75wny70HGIyrz5.jpg", 7.5999999999999996, new DateTime(2013, 5, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Garden of Words" },
                    { 200085, null, "R", "A case of the flu quickly morphs into a pandemic. As the death toll mounts and the living panic, the government plans extreme measures to contain it.", 122, "Korean", "/mvTXhTddHIZbOU9pmrcPODI1kRx.jpg", 7.5, new DateTime(2013, 8, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Flu" },
                    { 200481, null, "G", "It is just another evening commute until the rain starts to fall, and the city comes alive to the sound of dripping rain pipes, whistling awnings and gurgling gutters.", 7, "English", "/733mPs3eaPOKhU2V3I5LVsqUgrt.jpg", 7.5999999999999996, new DateTime(2013, 2, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Blue Umbrella" },
                    { 200727, null, "R", "Since the moment they met at age 5, Rosie and Alex have been best friends, facing the highs and lows of growing up side by side. A fleeting shared moment, one missed opportunity, and the decisions that follow send their lives in completely different directions. As each navigates the complexities of life, love, and everything in between, they always find their way back to each other - but is it just friendship, or something more?", 102, "English", "/rpD0t7DhzJVadnzgxSYrqljQTL2.jpg", 7.7999999999999998, new DateTime(2014, 10, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), "Love, Rosie" },
                    { 203217, null, "12", "After another spat with her kids, Dona Hermínia decides to take some time off from them and hides away in her aunt's house, where she reminisces about her kids in an age when they still needed her.", 85, "Portuguese", "/5cF5v8N0wMALMcgEHpBZHyYQZDl.jpg", 7.7999999999999998, new DateTime(2013, 6, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), "My Mom is a Character: The Film" },
                    { 203833, null, "PG-13", "While subjected to the horrors of WWII Germany, young Liesel finds solace by stealing books and sharing them with others. Under the stairs in her home, a Jewish refugee is being sheltered by her adoptive parents.", 131, "English", "/wj4U5sMLcJMa3WR9CpRR9e2sdgZ.jpg", 7.5, new DateTime(2013, 11, 8, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Book Thief" },
                    { 205220, null, "PG-13", "A woman searches for her adult son, who was taken away from her decades ago when she was forced to live in a convent.", 98, "English", "/eBUv2GmGdXmCk1AaSOmyiu70hN8.jpg", 7.4000000000000004, new DateTime(2013, 11, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "Philomena" },
                    { 205587, null, "R", "A successful lawyer returns to his hometown for his mother's funeral only to discover that his estranged father, the town's judge, is suspected of murder.", 141, "English", "/tefUxj4Gg9hgQNgfEYd7kJQrIlD.jpg", 7.2999999999999998, new DateTime(2014, 10, 8, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Judge" },
                    { 205596, null, "PG-13", "Based on the real life story of legendary cryptanalyst Alan Turing, the film portrays the nail-biting race against time by Turing and his brilliant team of code-breakers at Britain's top-secret Government Code and Cypher School at Bletchley Park, during the darkest days of World War II.", 113, "English", "/zSqJ1qFq8NXFfi7JeIYMlzyR0dx.jpg", 8.0, new DateTime(2014, 11, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Imitation Game" },
                    { 205601, null, "PG", "BELLE is inspired by the true story of Dido Elizabeth Belle, the illegitimate mixed race daughter of a Royal Navy Admiral. Raised by her aristocratic great-uncle Lord Mansfield and his wife, Belle's lineage affords her certain privileges, yet the color of her skin prevents her from fully participating in the traditions of her social standing. Left to wonder if she will ever find love, Belle falls for an idealistic young vicar's son bent on change who, with her help, shapes Lord Mansfield's role as Lord Chief Justice to end slavery in England", 105, "English", "/sTOuax6d5f9LDpZ8RvwHvQ88d1N.jpg", 7.2000000000000002, new DateTime(2013, 5, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "Belle" },
                    { 206487, null, "R", "Predestination chronicles the life of a Temporal Agent sent on an intricate series of time-travel journeys designed to prevent future killers from committing their crimes. Now, on his final assignment, the Agent must stop the one criminal that has eluded him throughout time and prevent a devastating attack in which thousands of lives will be lost.", 97, "English", "/kvzYw2CBCPnrLWGSwsYyoS0lFcH.jpg", 7.4000000000000004, new DateTime(2014, 8, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), "Predestination" },
                    { 207703, null, "R", "The story of a super-secret spy organization that recruits an unrefined but promising street kid into the agency's ultra-competitive training program just as a global threat emerges from a twisted tech genius.", 129, "English", "/ay7xwXn1G9fzX9TUBlkGA584rGi.jpg", 7.5999999999999996, new DateTime(2014, 12, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), "Kingsman: The Secret Service" },
                    { 209274, null, "PG-13", "Anna, a young novitiate in 1960s Poland, is on the verge of taking her vows when she discovers a family secret dating back to the years of the German occupation.", 82, "Polish", "/okrTjEMQMgdULUQ1VpxIIk7lz72.jpg", 7.2999999999999998, new DateTime(2013, 10, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "Ida" },
                    { 210577, null, "R", "With his wife's disappearance having become the focus of an intense media circus, a man sees the spotlight turned on him when it's suspected that he may not be innocent.", 149, "English", "/qymaJhucquUwjpb8oiqynMeXnID.jpg", 7.9000000000000004, new DateTime(2014, 10, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "Gone Girl" },
                    { 211387, null, "12", "The film takes place one year after the events of Captain America: The First Avenger, in which Agent Carter, a member of the Strategic Scientific Reserve, is in search of the mysterious Zodiac.", 15, "English", "/5WOxsdb6uF9cDZ319Kdcru2C0eC.jpg", 7.4000000000000004, new DateTime(2013, 9, 8, 0, 0, 0, 0, DateTimeKind.Unspecified), "Marvel One-Shot: Agent Carter" },
                    { 211954, null, "PG-13", "Valentin is Acapulco's resident playboy, until a former fling leaves a baby on his doorstep and him heading with her out of Mexico.", 115, "Spanish", "/8Gq5KWyJEAmqaoTPMuWhfAfWqm0.jpg", 7.7000000000000002, new DateTime(2013, 7, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), "Instructions Not Included" },
                    { 212167, null, "12세 이상 관람가", "In an underground world where tunnels extend everywhere, even though they live in dark and confined spaces, people wear protective clothes and lead quiet and enjoyable lives. Patema, a princess in her underground village, loves to explore the tunnels. Her favorite place is a \"danger zone\" that her village prohibits people from entering. Even though she's scolded, Patema's curiosity can't be held back. No one ever explained what the supposed danger was. On her usual trip to the \"danger zone,\" Patema faces unexpected events. When hidden secrets come to light, the story begins to unfold.", 98, "Japanese", "/1ZpDVSY15o0TWVj7qbvFf5BU8jE.jpg", 7.4000000000000004, new DateTime(2013, 11, 9, 0, 0, 0, 0, DateTimeKind.Unspecified), "Patema Inverted" },
                    { 216156, null, "PG-13", "A council case worker looks for the relatives of those found dead and alone.", 92, "English", "/wyz2x1TbVKAMpjePFC6fg7Cj7ZH.jpg", 7.5999999999999996, new DateTime(2013, 11, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), "Still Life" },
                    { 217993, null, "PG-13", "The world is under attack by an alien armada led by the powerful Apokoliptian, Darkseid. A group of superheroes consisting of Superman, Batman, Wonder Woman, The Flash, Green Lantern, Cyborg, and Shazam must set aside their differences and gather together to defend Earth.", 79, "English", "/eu6zEhpt9QVgZk8T4FJCwKCbJkq.jpg", 7.5, new DateTime(2014, 2, 2, 0, 0, 0, 0, DateTimeKind.Unspecified), "Justice League: War" },
                    { 220289, null, "NR", "On the night of an astronomical anomaly, eight friends at a dinner party experience a troubling chain of reality bending events.", 89, "English", "/nhigAje0Bf9YnSwJQ9zwXEAchOe.jpg", 7.2999999999999998, new DateTime(2013, 9, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), "Coherence" },
                    { 221731, null, "IIB", "Kenshin has settled into his new life with Kaoru and his other friends when he is approached with a request from the Meiji government. Makoto Shishio, a former assassin like Kenshin, was betrayed, set on fire and left for dead. He survived, and is now in Kyoto, plotting with his gathered warriors to overthrow the new government. Against Kaoru's wishes, Kenshin reluctantly agrees to go to Kyoto and help keep his country from falling back into civil war.", 138, "Japanese", "/gI2xYpJPQOsmFblvowkW2IgEHkC.jpg", 7.5999999999999996, new DateTime(2014, 8, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "Rurouni Kenshin Part II: Kyoto Inferno" },
                    { 221732, null, "G", "Shishio has set sail in his ironclad ship to bring down the Meiji government and return Japan to chaos, carrying Kaoru with him. In order to stop him in time, Kenshin trains with his old master to learn his final technique.", 135, "Japanese", "/3Xq7xmYZwNJfSODpec6OzYaxaA3.jpg", 7.7000000000000002, new DateTime(2014, 9, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), "Rurouni Kenshin Part III: The Legend Ends" },
                    { 222935, null, "PG-13", "Despite the tumor-shrinking medical miracle that has bought her a few years, Hazel has never been anything but terminal, her final chapter inscribed upon diagnosis. But when a patient named Augustus Waters suddenly appears at Cancer Kid Support Group, Hazel's story is about to be completely rewritten.", 126, "English", "/clmvI4B5JB2ToPGtiHodaLMFaoM.jpg", 7.5999999999999996, new DateTime(2014, 5, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Fault in Our Stars" },
                    { 227306, null, "PG-13", "A chronicle of the life of Louis Zamperini, an Olympic runner who was taken prisoner by Japanese forces during World War II.", 137, "English", "/vAlHUjHwLWMV5mg4epGR9WSIfiy.jpg", 7.5, new DateTime(2014, 12, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "Unbroken" },
                    { 227932, null, "12", "Dona Hermínia is back, but now rich and famous since she is the host of her own successful TV show. However, the overprotective character will have to deal with her children's departures, as Marcelina and Juliano decide to move out. In counterpart, she will welcome, as a visitor, her sister Lúcia Helena, who's been living in New York.", 96, "Portuguese", "/eDApDWU6r9zxk9MZLc6rfnBb3vu.jpg", 7.7000000000000002, new DateTime(2016, 12, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), "My Mom is a Character 2" },
                    { 228150, null, "R", "In the last months of World War II, as the Allies make their final push in the European theatre, a battle-hardened U.S. Army sergeant named 'Wardaddy' commands a Sherman tank called 'Fury' and its five-man crew on a deadly mission behind enemy lines. Outnumbered and outgunned, Wardaddy and his men face overwhelming odds in their heroic attempts to strike at the heart of Nazi Germany.", 135, "English", "/pfte7wdMobMF4CVHuOxyu6oqeeA.jpg", 7.5, new DateTime(2014, 10, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Fury" },
                    { 228194, null, "PG", "A story centered around an Indian family who moves to France and opens a restaurant across the street from a Michelin-starred French restaurant.", 122, "English", "/1vFhSr7INoulu18smHqicft05i8.jpg", 7.2999999999999998, new DateTime(2014, 8, 6, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Hundred-Foot Journey" },
                    { 228203, null, "PG", "A track coach in a small California town transforms a team of athletes into championship contenders.", 128, "English", "/1dGTRBhihGEedY0drHtVXiAL1wP.jpg", 7.4000000000000004, new DateTime(2015, 2, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), "McFarland, USA" },
                    { 228205, null, "PG-13", "The lives of a young couple intertwine with a much older man as he reflects back on a lost love while he's trapped in an automobile crash.", 128, "English", "/dz5TTMJPOOa9ZYnXNx4mX6mmJpn.jpg", 7.5999999999999996, new DateTime(2015, 4, 9, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Longest Ride" },
                    { 228326, null, "PG", "The journey of Manolo, a young man who is torn between fulfilling the expectations of his family and following his heart. Before choosing which path to follow, he embarks on an incredible adventure that spans three fantastical worlds where he must face his greatest fears.", 95, "English", "/puTDvsUADxCA5NjJuwgEWqQ3xGA.jpg", 7.5, new DateTime(2014, 10, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Book of Life" },
                    { 234200, null, "R", "Set in the summer of 1984 – Margaret Thatcher is in power and the National Union of Mineworkers (NUM) is on strike. At the Gay Pride March in London, a group of gay and lesbian activists decides to raise money to support the families of the striking miners. But there is a problem. The Union seems embarrassed to receive their support.", 122, "English", "/mrITqHNw0XzT7egAPByDuiE3QZf.jpg", 7.7999999999999998, new DateTime(2014, 9, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), "Pride" },
                    { 237791, null, "NR", "Leonardo is a blind teenager dealing with an overprotective mother while trying to live a more independent life. To the disappointment of his best friend, Giovana, he plans to go on an exchange program abroad. When Gabriel, a new student in town, arrives at their classroom, new feelings blossom in Leonardo making him question his plans.", 96, "Portuguese", "/2BhhlAYwKvONGW7tr16ZhnD0sym.jpg", 8.0999999999999996, new DateTime(2014, 3, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Way He Looks" },
                    { 238628, null, "PG-13", "War in Abkhazia 1990. An Estonian man Ivo has stayed behind to harvest his crops of tangerines. In a bloody conflict at his door, a wounded man is left behind, and Ivo is forced to take him in.", 87, "Estonian", "/jNKUXcwZr1vpgq7sGTCEqdngo4Z.jpg", 7.7000000000000002, new DateTime(2013, 10, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), "Tangerines" },
                    { 239571, null, "PG-13", "A pair of former high school sweethearts reunite after many years when they return to visit their small hometown.", 117, "English", "/8QBWh2Iwf1iUfsu2NfCue2V1hpV.jpg", 7.4000000000000004, new DateTime(2014, 10, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Best of Me" },
                    { 239877, null, "T", "While Arturo tries to gain the love of Flora, he witnesses the history of Sicily from 1969 to 1992, miraculously dodging the crimes of the Mafia and supporting as a journalist the heroic struggle of the judges and policemen who fought this infamous organization.", 90, "Italian", "/AtjMj0P9k17HROr2hp9DWgt4XnF.jpg", 7.4000000000000004, new DateTime(2013, 11, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Mafia Kills Only in Summer" },
                    { 242582, null, "R", "When Lou Bloom, desperate for work, muscles into the world of L.A. crime journalism, he blurs the line between observer and participant to become the star of his own story. Aiding him in his effort is Nina, a TV-news veteran.", 118, "English", "/j9HrX8f7GbZQm1BrBiR40uFQZSb.jpg", 7.7000000000000002, new DateTime(2014, 10, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), "Nightcrawler" },
                    { 242643, null, "PG-13", "Batman works desperately to find a bomb planted by the Joker while Amanda Waller sends her newly-formed Suicide Squad to break into Arkham Asylum and recover vital information stolen by the Riddler.", 75, "English", "/mmQZekxr9gJ7c0Grkx6xgKvrpDy.jpg", 7.4000000000000004, new DateTime(2014, 8, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), "Batman: Assault on Arkham" },
                    { 242828, null, "PG", "Upon being sent to live with relatives in the countryside due to an illness, an emotionally distant adolescent girl becomes obsessed with an abandoned mansion and infatuated with a girl who lives there - a girl who may or may not be real.", 103, "Japanese", "/vug1dvDI1tSa60Z8qjCuUE7ntkO.jpg", 8.0, new DateTime(2014, 7, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), "When Marnie Was There" },
                    { 244063, null, "0", "Two teen track stars discover first love as they train for the biggest relay race of their young lives.", 78, "Dutch", "/khyK1mS3PoZ9q97VQ2BvR4YuNKN.jpg", 7.5999999999999996, new DateTime(2014, 1, 8, 0, 0, 0, 0, DateTimeKind.Unspecified), "Boys" },
                    { 244088, null, "T", "The destinies of two families are irrevocably tied together after a cyclist is hit off the road by a jeep in the night before Christmas Eve.", 111, "Italian", "/nQxQ2N2wXksZnHa2ZzdwCbDtmkE.jpg", 7.5, new DateTime(2014, 1, 9, 0, 0, 0, 0, DateTimeKind.Unspecified), "Human Capital" }
                });

            migrationBuilder.InsertData(
                table: "Movies",
                columns: new[] { "Id", "ActorId", "Certification", "Description", "Duration", "Language", "Picture", "Ratings", "ReleaseDate", "Title" },
                values: new object[,]
                {
                    { 244267, null, "R", "I Origins follows a molecular biologist studying the evolution of the human eye.  He finds his work permeating his life after a brief encounter with an exotic young woman who slips away from him.  As his research continues years later with his lab partner, they make a stunning scientific discovery that has far reaching implications and complicates both his scientific and and spiritual beliefs.  Traveling half way around the world, he risks everything he has ever known to validate his theory.", 106, "English", "/gPkbUkfVMPu6r4wwCxdqv4sPszy.jpg", 7.5999999999999996, new DateTime(2014, 7, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), "I Origins" },
                    { 244403, null, "R", "A grieving father in a downward spiral stumbles across a box of his recently deceased son's demo tapes and lyrics. Shocked by the discovery of this unknown talent, he forms a band in the hope of finding some catharsis.", 105, "English", "/4jhqpyUXgJvtE31xJnI57oTi5Vb.jpg", 7.2999999999999998, new DateTime(2014, 10, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), "Rudderless" },
                    { 244786, null, "R", "Under the direction of a ruthless instructor, a talented young drummer begins to pursue perfection at any cost, even his humanity.", 107, "English", "/E1fpfU9cMCgFYL3QPvJr3vt20X.jpg", 8.4000000000000004, new DateTime(2014, 10, 10, 0, 0, 0, 0, DateTimeKind.Unspecified), "Whiplash" },
                    { 245168, null, "PG-13", "Based on true events about the foot soldiers of the early feminist movement who were forced underground to evade the State.", 106, "English", "/vETQNfswR1R7SOIpGuFDv66xfb7.jpg", 7.2999999999999998, new DateTime(2015, 10, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), "Suffragette" },
                    { 245891, null, "R", "Ex-hitman John Wick comes out of retirement to track down the gangsters that took everything from him.", 101, "English", "/fZPSd91yGE9fCcCe6OoQr6E3Bev.jpg", 7.2999999999999998, new DateTime(2014, 10, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), "John Wick" },
                    { 245913, null, "PG", "The life story of Brazilian football legend, Pele.", 107, "English", "/b1XoAl8TJi7zbKO3GUzRUBrpSxq.jpg", 7.4000000000000004, new DateTime(2016, 5, 6, 0, 0, 0, 0, DateTimeKind.Unspecified), "Pelé: Birth of a Legend" },
                    { 246741, null, "R", "Vampire housemates try to cope with the complexities of modern life and show a newly turned hipster some of the perks of being undead.", 86, "English", "/32QNWU2RoB7El5m2cjo3TnmvUxJ.jpg", 7.5999999999999996, new DateTime(2014, 6, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), "What We Do in the Shadows" },
                    { 249164, null, "PG-13", "Mia Hall, a talented young cellist, thought the most difficult decision she would ever have to make would be whether to pursue her musical dreams at prestigious Juilliard or follow her heart to be with the love of her life, Adam, a rock singer/guitarist. However, a car wreck changes everything in an instant, and now Mia's life hangs in the balance. Suspended between life and death, Mia faces a choice that will decide her future.", 106, "English", "/7Twh8h3Wh7GC9npTAEUThgkxkWL.jpg", 7.4000000000000004, new DateTime(2014, 8, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), "If I Stay" },
                    { 250219, null, "T", "A university researcher is fired because of the cuts to university. To earn a living he decides to produce drugs recruiting his former colleagues, who despite their skills are living at the margins of society.", 100, "Italian", "/8yCx5OSw3ckFhZP4guriUFxqrDB.jpg", 7.4000000000000004, new DateTime(2014, 2, 6, 0, 0, 0, 0, DateTimeKind.Unspecified), "I Can Quit Whenever I Want" },
                    { 250480, null, "G", "Whether we’re young or forever young at heart, the Hundred Acre Wood calls to that place in each of us that still believes in magic. Join pals Pooh, Piglet, Kanga, Roo, Owl, Rabbit, Tigger and Christopher Robin as they enjoy their days together and sing their way through adventures.", 74, "English", "/2xwaFVLv5geVrFd81eUttv7OutF.jpg", 7.2999999999999998, new DateTime(1977, 3, 11, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Many Adventures of Winnie the Pooh" },
                    { 250538, null, "PG-13", "A young refugee of the Sudanese Civil War who wins a lottery for relocation to the United States with three other lost boys. Encountering the modern world for the first time, they develop an unlikely friendship with a brash American woman assigned to help them, but the young man struggles to adjust to this new life and his feelings of guilt about the brother he left behind.", 110, "English", "/askWAWASRPuy3qPAbklWY7GA5hz.jpg", 7.2999999999999998, new DateTime(2014, 6, 27, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Good Lie" },
                    { 251516, null, "18", "During an unfortunate series of events, a friend of Kung Fury is assassinated by the most dangerous kung fu master criminal of all time, Adolf Hitler, a.k.a Kung Führer.  Kung Fury decides to travel back in time to Nazi Germany in order to kill Hitler and end the Nazi empire once and for all.", 31, "English", "/nbWY6797LUxXRSYwamHp8V0X4dA.jpg", 7.5, new DateTime(2015, 5, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), "Kung Fury" },
                    { 256040, null, "PG-13", "The young Shivudu is left as a foundling in a small village by his mother. By the time he’s grown up, it has become apparent that he possesses exceptional gifts. He meets the beautiful warrior princess Avanthika and learns that her queen has been held captive for the last 25 years. Shividu sets off to rescue her, discovering his own origins in the process.", 158, "Telugu", "/9BAjt8nSSms62uOVYn1t3C3dVto.jpg", 7.5, new DateTime(2015, 7, 10, 0, 0, 0, 0, DateTimeKind.Unspecified), "Bāhubali: The Beginning" },
                    { 258480, null, "R", "In 1950s New York, a department-store clerk who dreams of a better life falls for an older, married woman.", 118, "English", "/uHwjbztkPEW3lcfsbKGO3XlaPjL.jpg", 7.5, new DateTime(2015, 11, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), "Carol" },
                    { 259316, null, "PG-13", "In 1926, Newt Scamander arrives at the Magical Congress of the United States of America with a magically expanded briefcase, which houses a number of dangerous creatures and their habitats. When the creatures escape from the briefcase, it sends the American wizarding authorities after Newt, and threatens to strain even further the state of magical and non-magical relations.", 132, "English", "/h6NYfVUyM6CDURtZSnBpz647Ldd.jpg", 7.4000000000000004, new DateTime(2016, 11, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), "Fantastic Beasts and Where to Find Them" },
                    { 259693, null, "R", "Lorraine and Ed Warren travel to north London to help a single mother raising four children alone in a house plagued by malicious spirits.", 134, "English", "/zEqyD0SBt6HL7W9JQoWwtd5Do1T.jpg", 7.2000000000000002, new DateTime(2016, 5, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Conjuring 2" },
                    { 259761, null, null, "A woman prepares for bed, but realizes that something may be lurking in the shadows.", 3, "Swedish", "/wDINYGPa4S64TapSDXjNvwLrGVV.jpg", 7.2999999999999998, new DateTime(2013, 12, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Lights Out" },
                    { 260513, null, "PG", "Elastigirl springs into action to save the day, while Mr. Incredible faces his greatest challenge yet – taking care of the problems of his three children.", 118, "English", "/9lFKBtaVIhP7E2Pk0IY1CwTKTMZ.jpg", 7.5, new DateTime(2018, 6, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), "Incredibles 2" },
                    { 263115, null, "R", "In the near future, a weary Logan cares for an ailing Professor X in a hideout on the Mexican border. But Logan's attempts to hide from the world and his legacy are upended when a young mutant arrives, pursued by dark forces.", 137, "English", "/fnbjcRDYn6YviCcePDnGdyAkYsB.jpg", 7.7999999999999998, new DateTime(2017, 2, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), "Logan" },
                    { 264644, null, "R", "Held captive for 7 years in an enclosed space, a woman and her young son finally gain their freedom, allowing the boy to experience the outside world for the first time.", 118, "English", "/pCURNjeomWbMSdiP64gj8NVVHTQ.jpg", 8.0999999999999996, new DateTime(2015, 10, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), "Room" },
                    { 264660, null, "R", "Caleb, a coder at the world's largest internet company, wins a competition to spend a week at a private mountain retreat belonging to Nathan, the reclusive CEO of the company. But when Caleb arrives at the remote location he finds that he will have to participate in a strange and fascinating experiment in which he must interact with the world's first true artificial intelligence, housed in the body of a beautiful robot girl.", 108, "English", "/9goPE2IoMIXxTLWzl7aizwuIiLh.jpg", 7.5999999999999996, new DateTime(2015, 1, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), "Ex Machina" },
                    { 265169, null, "12", "Aydin, a retired actor, owns a small hotel in central Anatolia with his young wife Nihal and his sister Necla, who is coping with her recent divorce. During the winter, snow covers the ground and boredom brings the return of old memories, pushing Aydin to flee…", 196, "Turkish", "/c4OKvnYOHlKdMvLh8DhoabtAwnR.jpg", 7.7000000000000002, new DateTime(2014, 6, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), "Winter Sleep" },
                    { 265177, null, "R", "A peculiar neighbor offers hope to a recent widow who is struggling to raise a teenager who is unpredictable and, sometimes, violent.", 138, "French", "/cIX50NQG37o4Dh0MWAkOVSTqwu5.jpg", 8.3000000000000007, new DateTime(2014, 5, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), "Mommy" },
                    { 265180, null, "R", "In a Russian coastal town, Kolya is forced to fight the corrupt mayor when he is told that his house will be demolished. He recruits a lawyer friend to help, but the man's arrival brings further misfortune for Kolya and his family.", 141, "Russian", "/dwmHSBBiu2ow271zrQ33rPKZDSC.jpg", 7.5, new DateTime(2014, 9, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), "Leviathan" },
                    { 265195, null, "R", "Six deadly stories that explore the extremities of human behaviour involving distressed people seeking revenge.", 122, "Spanish", "/pvSty5MCAxdj8LlAEXCDfM1YNOl.jpg", 7.9000000000000004, new DateTime(2014, 8, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), "Wild Tales" },
                    { 265712, null, "G", "In the suburbs of Tokyo some time ago, there lived a clumsy boy about 10 years old. There appeared in front of him named Sewashi, Nobita's descendant of four generations later from the 22nd century, and Doraemon, a 22nd century cat-type caretaker robot who helps people with its secret gadgets. Sewashi claims that his family is suffering from the debts Nobita made even to his generation, so in order to change this disastrous future, he brought along Doraemon as Nobita's caretaker to bring happiness to his future, although Doraemon is not happy about this. And so Sewashi installed an accomplishment program into Doraemon forcing him to take care of Nobita. Unless he makes Nobita happy, Doraemon can no longer go back to the 22nd century. This is how the life of Doraemon and Nobita begins. Will Doraemon succeed this mission and return to the 22nd century?", 90, "Japanese", "/jArnRnllnxbvE2CEV8jc2hhwweS.jpg", 7.2999999999999998, new DateTime(2014, 8, 8, 0, 0, 0, 0, DateTimeKind.Unspecified), "Stand by Me Doraemon" },
                    { 266856, null, "PG-13", "The Theory of Everything is the extraordinary story of one of the world’s greatest living minds, the renowned astrophysicist Stephen Hawking, who falls deeply in love with fellow Cambridge student Jane Wilde.", 123, "English", "/kJuL37NTE51zVP3eG5aGMyKAIlh.jpg", 7.9000000000000004, new DateTime(2014, 11, 26, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Theory of Everything" },
                    { 269149, null, "PG", "Determined to prove herself, Officer Judy Hopps, the first bunny on Zootopia's police force, jumps at the chance to crack her first case - even if it means partnering with scam-artist fox Nick Wilde to solve the mystery.", 109, "English", "/hlK0e0wAQ3VLuJcsfIYPvb4JVud.jpg", 7.7000000000000002, new DateTime(2016, 2, 11, 0, 0, 0, 0, DateTimeKind.Unspecified), "Zootopia" },
                    { 269258, null, "6", "Before eleven years old Tilda's parents can put her beloved grandfather in an old people's home due to his progressing Alzheimer disease, she takes him on one last adventure that subliminally threatens to tear her family apart.", 139, "German", "/82T8Yax4blLICBPRcdzeJ6tZzxa.jpg", 7.5999999999999996, new DateTime(2014, 12, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "Head Full of Honey" },
                    { 271110, null, "PG-13", "Following the events of Age of Ultron, the collective governments of the world pass an act designed to regulate all superhuman activity. This polarizes opinion amongst the Avengers, causing two factions to side with Iron Man or Captain America, which causes an epic battle between former allies.", 147, "English", "/rAGiXaUfPzY7CDEyNKUofk3Kw2e.jpg", 7.4000000000000004, new DateTime(2016, 4, 27, 0, 0, 0, 0, DateTimeKind.Unspecified), "Captain America: Civil War" },
                    { 271674, null, "NR", "France, 1940. In the first days of occupation, beautiful Lucile Angellier is trapped in a stifled existence with her controlling mother-in-law as they both await news of her husband: a prisoner of war. Parisian refugees start to pour into their small town, soon followed by a regiment of German soldiers who take up residence in the villagers' own homes. Lucile initially tries to ignore Bruno von Falk, the handsome and refined German officer staying with them. But soon, a powerful love draws them together and leads them into the tragedy of war.", 103, "English", "/w5dV1p5yZfNMuBOgVleLi5VgOG6.jpg", 7.4000000000000004, new DateTime(2015, 3, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), "Suite Française" },
                    { 271706, null, "PG-13", "Beyond the human realm, there is a magical race of beings who control the tides and the changing of the seasons. One of these beings, a young girl named Chun, seeks something more—she wants to experience the human world! At sixteen, she finally gets her chance and transforms into a dolphin in order to explore the world that has her fascinated. But she soon discovers that it’s a dangerous place and nearly gets killed in a vortex. Luckily, her life is spared when a young boy sacrifices himself to save her. Moved by his kindness and courage, she uses magic to bring him back to life only to learn that this power comes at a serious price. On a new adventure, she’ll have to make her own sacrifices in order to protect his soul until it is ready to return to the human world.", 101, "Mandarin", "/fRCdXh9MZutj1JJPZlUXMex6AuB.jpg", 7.5, new DateTime(2016, 7, 8, 0, 0, 0, 0, DateTimeKind.Unspecified), "Big Fish & Begonia" },
                    { 273248, null, "R", "Bounty hunters seek shelter from a raging blizzard and get caught up in a plot of betrayal and deception.", 188, "English", "/k61oZC6IPUhgACGFwxNqdkbrf2M.jpg", 7.7000000000000002, new DateTime(2015, 12, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Hateful Eight" },
                    { 273481, null, "R", "An idealistic FBI agent is enlisted by a government task force to aid in the escalating war against drugs at the border area between the U.S. and Mexico.", 122, "English", "/tw0lXhbNkklvseuJ4aYldkVyXV7.jpg", 7.4000000000000004, new DateTime(2015, 9, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), "Sicario" },
                    { 273895, null, "PG-13", "\"Selma,\" as in Alabama, the place where segregation in the South was at its worst, leading to a march that ended in violence, forcing a famous statement by President Lyndon B. Johnson that ultimately led to the signing of the Voting Rights Act.", 127, "English", "/yCZaJNKTxu5VGbJu4fwu2yIBQAz.jpg", 7.5, new DateTime(2014, 12, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "Selma" },
                    { 274109, null, "16", "Spain, 2003. An accidental discovery leads Clarence to travel from the snowy mountains of Huesca to Equatorial Guinea, to visit the land where her father Jacobo and her uncle Kilian spent most of their youth, the island of Fernando Poo.", 164, "Spanish", "/alqjIcwpXPTamDoQBxKzmpIo94W.jpg", 7.5, new DateTime(2015, 12, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "Palm Trees in the Snow" },
                    { 277216, null, "R", "In 1987, five young men, using brutally honest rhymes and hardcore beats, put their frustration and anger about life in the most dangerous place in America into the most powerful weapon they had: their music.  Taking us back to where it all began, Straight Outta Compton tells the true story of how these cultural rebels—armed only with their lyrics, swagger, bravado and raw talent—stood up to the authorities that meant to keep them down and formed the world’s most dangerous group, N.W.A.  And as they spoke the truth that no one had before and exposed life in the hood, their voice ignited a social revolution that is still reverberating today.", 147, "English", "/9B63hMwU6iICtNDTISCaZQ5US7R.jpg", 7.7999999999999998, new DateTime(2015, 8, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), "Straight Outta Compton" },
                    { 277834, null, "PG", "In Ancient Polynesia, when a terrible curse incurred by Maui reaches an impetuous Chieftain's daughter's island, she answers the Ocean's call to seek out the demigod to set things right.", 107, "English", "/4JeejGugONWpJkbnvL12hVoYEDa.jpg", 7.5999999999999996, new DateTime(2016, 11, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), "Moana" },
                    { 281957, null, "R", "In the 1820s, a frontiersman, Hugh Glass, sets out on a path of vengeance against those who left him for dead after a bear mauling.", 157, "English", "/ji3ecJphATlVgWNY0B0RVXZizdf.jpg", 7.5, new DateTime(2015, 12, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Revenant" },
                    { 282848, null, null, "Orbiting a quiet backwater planet, the massed forces of the universe's deadliest species gather, drawn to a mysterious message that echoes out to the stars. And amongst them, the Doctor. Rescuing Clara from a family Christmas dinner, the Time Lord and his best friend must learn what this enigmatic signal means for his own fate and that of the universe.", 60, "English", "/7blrzLLfj34vV45HYmPccvhNSRZ.jpg", 8.0999999999999996, new DateTime(2013, 12, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "Doctor Who: The Time of the Doctor" },
                    { 283587, null, "R", "A drama based on the experiences of Agu, a child fighting in the civil war of an unnamed, fictional West African country. Follows the journey of Agu as he's forced to join a group of soldiers. While Agu fears his commander and many of the men around him, his fledgling childhood has been brutally shattered by the war raging through his country, and he is at first torn between conflicting revulsion and fascination. Depicts the mechanics of war and does not shy away from explicit, visceral detail, painting a complex, difficult picture of Agu as a child soldier.", 137, "English", "/8CgowbCv28a0laVTnPoOrvzVnB7.jpg", 7.5999999999999996, new DateTime(2015, 9, 11, 0, 0, 0, 0, DateTimeKind.Unspecified), "Beasts of No Nation" },
                    { 283591, null, "PG-13", "The hidden memoir of an elderly woman confined to a mental hospital reveals the history of her passionate yet tortured life, and of the religious and political upheavals in Ireland during the 1920s and 30s.", 108, "English", "/iVoZqwvGAwxvGVbYV5y04wpiBob.jpg", 7.2999999999999998, new DateTime(2016, 11, 4, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Secret Scripture" }
                });

            migrationBuilder.InsertData(
                table: "Movies",
                columns: new[] { "Id", "ActorId", "Certification", "Description", "Duration", "Language", "Picture", "Ratings", "ReleaseDate", "Title" },
                values: new object[,]
                {
                    { 283995, null, "PG-13", "The Guardians must fight to keep their newfound family together as they unravel the mysteries of Peter Quill's true parentage.", 137, "English", "/y4MBh0EjBlMuOzv9axM4qJlmhzz.jpg", 7.5999999999999996, new DateTime(2017, 4, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), "Guardians of the Galaxy Vol. 2" },
                    { 284052, null, "PG-13", "After his career is destroyed, a brilliant but arrogant surgeon gets a new lease on life when a sorcerer takes him under her wing and trains him to defend the world against evil.", 115, "English", "/xf8PbyQcR5ucXErmZNzdKR0s8ya.jpg", 7.4000000000000004, new DateTime(2016, 10, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "Doctor Strange" },
                    { 284053, null, "PG-13", "Thor is imprisoned on the other side of the universe and finds himself in a race against time to get back to Asgard to stop Ragnarok, the destruction of his home-world and the end of Asgardian civilization, at the hands of a powerful new threat, the ruthless Hela.", 131, "English", "/rzRwTcFvttcN1ZpX2xv4j3tSdJu.jpg", 7.5999999999999996, new DateTime(2017, 10, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "Thor: Ragnarok" },
                    { 284054, null, "PG-13", "King T'Challa returns home to the reclusive, technologically advanced African nation of Wakanda to serve as his country's new leader. However, T'Challa soon finds that he is challenged for the throne by factions within his own country as well as without. Using powers reserved to Wakandan kings, T'Challa assumes the Black Panther mantle to join with ex-girlfriend Nakia, the queen-mother, his princess-kid sister, members of the Dora Milaje (the Wakandan 'special forces') and an American secret agent, to prevent Wakanda from being dragged into a world war.", 134, "English", "/uxzzxijgPIY7slzFvMotPv8wjKA.jpg", 7.4000000000000004, new DateTime(2018, 2, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), "Black Panther" },
                    { 284293, null, "PG-13", "Alice Howland, happily married with three grown children, is a renowned linguistics professor who starts to forget words. When she receives a devastating diagnosis, Alice and her family find their bonds tested.", 101, "English", "/gcuSaQyp6G64frR0Usvbr7zDehU.jpg", 7.5, new DateTime(2014, 12, 5, 0, 0, 0, 0, DateTimeKind.Unspecified), "Still Alice" },
                    { 284427, null, "NR", "Benjamin, a young German computer whiz, is invited to join a subversive hacker group that wants to be noticed on the world's stage.", 105, "German", "/nMHCJiVFjUmQWC116Ze96u5IhfX.jpg", 7.7000000000000002, new DateTime(2014, 9, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "Who Am I" },
                    { 284689, null, "PG-13", "Testament of Youth is a powerful story of love, war and remembrance, based on the First World War memoir by Vera Brittain, which has become the classic testimony of that war from a woman’s point of view. A searing journey from youthful hopes and dreams to the edge of despair and back again, it’s a film about young love, the futility of war and how to make sense of the darkest times.", 129, "English", "/a6kFsaDCulCLfYHmKLDKTYaddM4.jpg", 7.4000000000000004, new DateTime(2014, 10, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), "Testament of Youth" },
                    { 286192, null, "G", "The story follows the love story of two volcanoes, Uku and Lele. It features a song, \"Lava\", which is written by Murphy and performed by Kuana Torres Kahele and Napua Greig, who voice the two volcanoes.", 7, "English", "/blZSkXNN4CzRBxdxXnz3YpUjnJp.jpg", 7.4000000000000004, new DateTime(2014, 10, 10, 0, 0, 0, 0, DateTimeKind.Unspecified), "Lava" },
                    { 286217, null, "PG-13", "During a manned mission to Mars, Astronaut Mark Watney is presumed dead after a fierce storm and left behind by his crew. But Watney has survived and finds himself stranded and alone on the hostile planet. With only meager supplies, he must draw upon his ingenuity, wit and spirit to subsist and find a way to signal to Earth that he is alive.", 144, "English", "/5BHuvQ6p9kfc091Z8RiFNhCwL4b.jpg", 7.7000000000000002, new DateTime(2015, 9, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Martian" },
                    { 289222, null, "PG-13", "The account of keepers of the Warsaw Zoo, Jan and Antonina Zabinski, who helped save hundreds of people and animals during the Nazi invasion.", 126, "English", "/50KGpMiIvSkF4WHOgp0gM6r6sMU.jpg", 7.4000000000000004, new DateTime(2017, 3, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Zookeeper's Wife" },
                    { 290098, null, "NR", "1930s Korea, in the period of Japanese occupation, a young woman is hired as a handmaiden to a Japanese heiress who lives a secluded life on a large countryside estate with her domineering uncle, but she's involved in something greater that will soon be revealed.", 145, "Korean", "/dLlH4aNHdnmf62umnInL8xPlPzw.jpg", 8.3000000000000007, new DateTime(2016, 6, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Handmaiden" },
                    { 290542, null, "R", "A drama centered on a classical pianist who has been diagnosed with ALS and the brash college student who becomes her caregiver.", 104, "English", "/jvrdukoeCuVckHlbAxU0MPoIzPI.jpg", 7.4000000000000004, new DateTime(2014, 10, 10, 0, 0, 0, 0, DateTimeKind.Unspecified), "You're Not You" },
                    { 290762, null, "PG-13", "The friendship between two life-long girlfriends is put to the test when one starts a family and the other falls ill.", 112, "English", "/1MKaJQcgqxn80Iq7tP0Cc4jfgVL.jpg", 7.4000000000000004, new DateTime(2015, 9, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), "Miss You Already" },
                    { 292011, null, "R", "Richard Jewell thinks quick, works fast, and saves hundreds, perhaps thousands, of lives after a domestic terrorist plants several pipe bombs and they explode during a concert, only to be falsely suspected of the crime by sloppy FBI work and sensational media coverage.", 131, "English", "/5Lgkm8jt4roAFPZQ52fKMhVmDaZ.jpg", 7.5, new DateTime(2019, 12, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), "Richard Jewell" },
                    { 293299, null, "G", "This Oscar-winning animated short film tells the story of one man's love life as seen through the eyes of his best friend and dog, Winston, and revealed bite by bite through the meals they share.", 6, "English", "/6hAgSxgd2YIK5pYhwowtnlGpwbe.jpg", 7.9000000000000004, new DateTime(2014, 10, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "Feast" },
                    { 293660, null, "R", "Deadpool tells the origin story of former Special Forces operative turned mercenary Wade Wilson, who after being subjected to a rogue experiment that leaves him with accelerated healing powers, adopts the alter ego Deadpool. Armed with his new abilities and a dark, twisted sense of humor, Deadpool hunts down the man who nearly destroyed his life.", 108, "English", "/fSRb7vyIP8rQpL0I47P3qUsEKX3.jpg", 7.5999999999999996, new DateTime(2016, 2, 9, 0, 0, 0, 0, DateTimeKind.Unspecified), "Deadpool" },
                    { 293670, null, "15", "A stranger arrives in a little village and soon after a mysterious sickness starts spreading. A policeman is drawn into the incident and is forced to solve the mystery in order to save his daughter.", 156, "Korean", "/tAyQODgkQHsxgKFF3yhGQ2WsABA.jpg", 7.2999999999999998, new DateTime(2016, 5, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Wailing" },
                    { 293863, null, "PG-13", "After 29-year-old Adaline recovers from a nearly lethal accident, she inexplicably stops growing older. As the years stretch on and on, Adaline keeps her secret to herself  until she meets a man who changes her life.", 112, "English", "/MbILysGhjAbnZi1Okae9wYqLMx.jpg", 7.4000000000000004, new DateTime(2015, 4, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Age of Adaline" },
                    { 296096, null, "PG-13", "A small town girl is caught between dead-end jobs. A high-profile, successful man becomes wheelchair bound following an accident. The man decides his life is not worth living until the girl is hired for six months to be his new caretaker. Worlds apart and trapped together by circumstance, the two get off to a rocky start. But the girl becomes determined to prove to the man that life is worth living and as they embark on a series of adventures together, each finds their world changing in ways neither of them could begin to imagine.", 110, "English", "/Ia3dzj5LnCj1ZBdlVeJrbKJQxG.jpg", 7.9000000000000004, new DateTime(2016, 6, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "Me Before You" },
                    { 296098, null, "PG-13", "During the Cold War, the Soviet Union captures U.S. pilot Francis Gary Powers after shooting down his U-2 spy plane. Sentenced to 10 years in prison, Powers' only hope is New York lawyer James Donovan, recruited by a CIA operative to negotiate his release. Donovan boards a plane to Berlin, hoping to win the young man's freedom through a prisoner exchange. If all goes well, the Russians would get Rudolf Abel, the convicted spy who Donovan defended in court.", 141, "English", "/1pNAmSWKLosPyuVqh0zx43Pzqh5.jpg", 7.2000000000000002, new DateTime(2015, 10, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Bridge of Spies" },
                    { 297222, null, "PG-13", "A stranger in the city asks questions no one has asked before. Known only by his initials, the man's innocent questions and childlike curiosity take him on a journey of love, laughter and letting go.", 153, "Hindi", "/hUitxmc1klkZF4zYHAz3oT9e7mT.jpg", 7.7000000000000002, new DateTime(2014, 12, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), "PK" },
                    { 297762, null, "PG-13", "An Amazon princess comes to the world of Man in the grips of the First World War to confront the forces of evil and bring an end to human conflict.", 141, "English", "/imekS7f1OuHyUP2LAiTEM0zBzUz.jpg", 7.2999999999999998, new DateTime(2017, 5, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Wonder Woman" },
                    { 298582, null, "6", "Based on the true life story of California gymnast Ariana Berlin. As she zoned in on her Olympic goals, 14 year old Ariana Berlin's life took a sharp turn when she was involved in a debilitating car accident. Gaining her confidence and movement back through learning hip hop dance, she unexpectedly found herself called back to the gymnastics world thanks to world renowned UCLA Coach Valorie Kondos Field. With Val's help, Ariana was eventually able to secure a spot on the UCLA gymnastics team and win an NCAA championship, a lifelong goal that she had always dreamed of. This is a wonderfully inspiring story of persistence, confidence, and the heart and courage to make a somewhat impossible comeback in life.", 94, "English", "/e9c2JOwJlWUfIZRaxIWE2BZt5GV.jpg", 7.4000000000000004, new DateTime(2015, 9, 11, 0, 0, 0, 0, DateTimeKind.Unspecified), "Full Out" },
                    { 299534, null, "PG-13", "After the devastating events of Avengers: Infinity War, the universe is in ruins due to the efforts of the Mad Titan, Thanos. With the help of remaining allies, the Avengers must assemble once more in order to undo Thanos' actions and restore order to the universe once and for all, no matter what consequences may be in store.", 181, "English", "/ulzhLuWrPK07P1YkdWQLZnQh1JL.jpg", 8.3000000000000007, new DateTime(2019, 4, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), "Avengers: Endgame" },
                    { 299536, null, "PG-13", "As the Avengers and their allies have continued to protect the world from threats too large for any one hero to handle, a new danger has emerged from the cosmic shadows: Thanos. A despot of intergalactic infamy, his goal is to collect all six Infinity Stones, artifacts of unimaginable power, and use them to inflict his twisted will on all of reality. Everything the Avengers have fought for has led up to this moment - the fate of Earth and existence itself has never been more uncertain.", 149, "English", "/7WsyChQLEftFiDOVTGkv3hFpyyt.jpg", 8.3000000000000007, new DateTime(2018, 4, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "Avengers: Infinity War" },
                    { 301528, null, "G", "Woody has always been confident about his place in the world and that his priority is taking care of his kid, whether that's Andy or Bonnie. But when Bonnie adds a reluctant new toy called \"Forky\" to her room, a road trip adventure alongside old and new friends will show Woody how big the world can be for a toy.", 100, "English", "/w9kR8qbmQ01HwnvK4alvnQ2ca0L.jpg", 7.5999999999999996, new DateTime(2019, 6, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), "Toy Story 4" },
                    { 302528, null, "R", "With the aid of a fellow Auschwitz survivor and a hand-written letter, an elderly man with dementia goes in search of the person responsible for the death of his family.", 94, "English", "/x496Ip0weJYfsEX23eNyzG4MjXV.jpg", 7.4000000000000004, new DateTime(2015, 10, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), "Remember" },
                    { 303483, null, "6", "Based on a true story.  In Léon Blum high school in Créteil (France), a history teacher decides to have her weakest 10th grade class take a national history competition. This will change them.", 105, "French", "/f1pCWBUmlBzdvhfp8IGoVQZBdub.jpg", 7.4000000000000004, new DateTime(2014, 12, 3, 0, 0, 0, 0, DateTimeKind.Unspecified), "Once in a Lifetime" },
                    { 303867, null, null, "A little girl is taken on a mind-bending tour of her distant future. 2016 Academy Award nominee for Best Animated Short Film and winner of the Short Film Grand Prize at the 2015 Sundance Film Festival.", 17, "English", "/9dTn63fu6L7deMhII6w8mB1wMn8.jpg", 7.9000000000000004, new DateTime(2015, 1, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), "World of Tomorrow" },
                    { 304357, null, "PG-13", "Maria Altmann, an octogenarian Jewish refugee, takes on the Austrian government to recover a world famous painting of her aunt plundered by the Nazis during World War II, she believes rightfully belongs to her family. She did so not just to regain what was rightfully hers, but also to obtain some measure of justice for the death, destruction, and massive art theft perpetrated by the Nazis.", 109, "English", "/6eoj6bozvgwNuDV3vOrqlvrCrX.jpg", 7.4000000000000004, new DateTime(2015, 3, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), "Woman in Gold" },
                    { 306745, null, "PG-13", "New Jersey car mechanic Stacie Andree and her police detective girlfriend Laurel Hester both battle to secure Hester's pension benefits after she was diagnosed with a terminal illness.", 103, "English", "/794PfYjTz3yxMRdTRmdFYt6w6ff.jpg", 7.2999999999999998, new DateTime(2015, 10, 2, 0, 0, 0, 0, DateTimeKind.Unspecified), "Freeheld" },
                    { 306819, null, "R", "When Gerda Wegener asks her husband Einar to fill in as a portrait model, Einar discovers the person she's meant to be and begins living her life as Lili Elbe. Having realized her true self and with Gerda's love and support, Lili embarks on a groundbreaking journey as a transgender pioneer.", 119, "English", "/mXZZIacI5FC8thzSC0lgQBQ2uAX.jpg", 7.5999999999999996, new DateTime(2015, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Danish Girl" },
                    { 307081, null, "R", "Billy \"The Great\" Hope, the reigning junior middleweight boxing champion, has an impressive career, a loving wife and daughter, and a lavish lifestyle. However, when tragedy strikes, Billy hits rock bottom, losing his family, his house and his manager. He soon finds an unlikely savior in Tick Willis, a former fighter who trains the city's toughest amateur boxers. With his future on the line, Hope fights to reclaim the trust of those he loves the most.", 123, "English", "/r6QlMEQGNvM0YpbN04qhx5xdMiQ.jpg", 7.4000000000000004, new DateTime(2015, 3, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), "Southpaw" },
                    { 308369, null, "PG-13", "Greg is coasting through senior year of high school as anonymously as possible, avoiding social interactions like the plague while secretly making spirited, bizarre films with Earl, his only friend. But both his anonymity and friendship threaten to unravel when his mother forces him to befriend a classmate with leukemia.", 105, "English", "/p0cMBeUZVkkDEMkXfpbCMz9hE0v.jpg", 7.5999999999999996, new DateTime(2015, 6, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), "Me and Earl and the Dying Girl" },
                    { 309809, null, "PG", "Based on the best-seller book 'The Little Prince', the movie tells the story of a little girl that lives with resignation in a world where efficiency and work are the only dogmas. Everything will change when accidentally she discovers her neighbor that will tell her about the story of the Little Prince that he once met.", 108, "English", "/je5Z7gbFTzrs3FPHINo9yGiHoVo.jpg", 7.5999999999999996, new DateTime(2015, 7, 29, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Little Prince" },
                    { 310569, null, "0", "After leaving her daughter Jessica in a small town in Pernambuco to be raised by relatives, Val spends the next 13 years working as a nanny to Fabinho in São Paulo. She has financial stability but has to live with the guilt of having not raised Jessica herself. As Fabinho’s university entrance exams approach, Jessica reappears in her life and seems to want to give her mother a second chance. However, Jessica has not been raised to be a servant and her very existence will turn Val’s routine on its head. With precision and humour, the subtle and powerful forces that keep rigid class structures in place and how the youth may just be the ones to shake it all up.", 110, "Portuguese", "/9VverEpwOolwWa5lnm9BrfhoG2V.jpg", 8.0999999999999996, new DateTime(2015, 2, 8, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Second Mother" },
                    { 312221, null, "PG-13", "The former World Heavyweight Champion Rocky Balboa serves as a trainer and mentor to Adonis Johnson, the son of his late friend and former rival Apollo Creed.", 133, "English", "/iBq4od6j1ZAvDVO7hwmHT2Xf2Bt.jpg", 7.4000000000000004, new DateTime(2015, 11, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "Creed" },
                    { 313106, null, null, "In 2013, something terrible is awakening in London's National Gallery; in 1562, a murderous plot is afoot in Elizabethan England; and somewhere in space an ancient battle reaches its devastating conclusion. All of reality is at stake as the Doctor's own dangerous past comes back to haunt him.", 77, "English", "/qkhP3bhxQQjs1bGEWNts64DOUkK.jpg", 8.3000000000000007, new DateTime(2013, 11, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), "Doctor Who: The Day of the Doctor" },
                    { 313297, null, "PG", "Kubo mesmerizes the people in his village with his magical gift for spinning wild tales with origami. When he accidentally summons an evil spirit seeking vengeance, Kubo is forced to go on a quest to solve the mystery of his fallen samurai father and his mystical weaponry, as well as discover his own magical powers.", 102, "English", "/la6QA9tk4Foq8OBH2Dyh5dTcw6H.jpg", 7.7000000000000002, new DateTime(2016, 8, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), "Kubo and the Two Strings" },
                    { 313369, null, "PG-13", "Mia, an aspiring actress, serves lattes to movie stars in between auditions and Sebastian, a jazz musician, scrapes by playing cocktail party gigs in dingy bars, but as success mounts they are faced with decisions that begin to fray the fragile fabric of their love affair, and the dreams they worked so hard to maintain in each other threaten to rip them apart.", 129, "English", "/uDO8zWDhfWwoFdKS4fzkUJt0Rf0.jpg", 7.9000000000000004, new DateTime(2016, 11, 29, 0, 0, 0, 0, DateTimeKind.Unspecified), "La La Land" },
                    { 314365, null, "R", "The true story of how the Boston Globe uncovered the massive scandal of child molestation and cover-up within the local Catholic Archdiocese, shaking the entire Catholic Church to its core.", 129, "English", "/h45kCMzpkbSNO8ZlYtrLEjSkoYK.jpg", 7.7999999999999998, new DateTime(2015, 11, 6, 0, 0, 0, 0, DateTimeKind.Unspecified), "Spotlight" },
                    { 315465, null, "PG-13", "Kyuta, a boy living in Shibuya, and Kumatetsu, a lonesome beast from Jutengai, an imaginary world. One day, Kyuta forays into the imaginary world and, as he's looking for his way back, meets Kumatetsu who becomes his spirit guide. That encounter leads them to many adventures.", 119, "Japanese", "/zWG1MfusMOR4CXMsBxWhGFC4TkQ.jpg", 8.0, new DateTime(2015, 7, 11, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Boy and the Beast" }
                });

            migrationBuilder.InsertData(
                table: "Movies",
                columns: new[] { "Id", "ActorId", "Certification", "Description", "Duration", "Language", "Picture", "Ratings", "ReleaseDate", "Title" },
                values: new object[,]
                {
                    { 315635, null, "PG-13", "Following the events of Captain America: Civil War, Peter Parker, with the help of his mentor Tony Stark, tries to balance his life as an ordinary high school student in Queens, New York City, with fighting crime as his superhero alter ego Spider-Man as a new threat, the Vulture, emerges.", 133, "English", "/c24sv2weTHPsmDa7jEMN0m2P3RT.jpg", 7.4000000000000004, new DateTime(2017, 7, 5, 0, 0, 0, 0, DateTimeKind.Unspecified), "Spider-Man: Homecoming" },
                    { 315846, null, "PG", "A story that revolves around three sisters who live in their grandmother's home and the arrival of their 13-year-old half sister.", 128, "Japanese", "/pYkyK6C2xFrWlzf9vvB2LvbxGhr.jpg", 7.5, new DateTime(2015, 6, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), "Our Little Sister" },
                    { 316029, null, "PG", "The story of American showman P.T. Barnum, founder of the circus that became the famous traveling Ringling Bros. and Barnum & Bailey Circus.", 105, "English", "/b9CeobiihCx1uG1tpw8hXmpi7nm.jpg", 8.0, new DateTime(2017, 12, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Greatest Showman" },
                    { 317442, null, "PG-13", "Two years after the events of the Fourth Great Ninja War, the moon that Hagoromo Otsutsuki created long ago to seal away the Gedo Statue begins to descend towards the world, threatening to become a meteor that would destroy everything on impact. Amidst this crisis, a direct descendant of Kaguya Otsutsuki named Toneri Otsutsuki attempts to kidnap Hinata Hyuga but ends up abducting her younger sister Hanabi. Naruto and his allies now mount a rescue mission before finding themselves embroiled in a final battle to decide the fate of everything.", 114, "Japanese", "/bAQ8O5Uw6FedtlCbJTutenzPVKd.jpg", 7.7999999999999998, new DateTime(2014, 12, 6, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Last: Naruto the Movie" },
                    { 317557, null, "PG", "A young girl overcomes her disadvantaged upbringing in the slums of Uganda to become a Chess master.", 124, "English", "/tJhLQMcEzwDmxqQxr1n81a3sfd8.jpg", 7.2000000000000002, new DateTime(2016, 9, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), "Queen of Katwe" },
                    { 318121, null, "R", "Having suffered a tragedy, Ben becomes a caregiver to earn money. His first client, Trevor, is a hilarious 18-year-old with muscular dystrophy. One paralyzed emotionally, one paralyzed physically, Ben and Trevor hit the road on a trip into the western states. The folks they collect along the way will help them test their skills for surviving outside their calculated existence. Together, they come to understand the importance of hope and the necessity of true friendship.", 97, "English", "/zZ0eda1GyHILNSoq9KF5u0hcq6O.jpg", 7.2999999999999998, new DateTime(2016, 6, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Fundamentals of Caring" },
                    { 318781, null, "R", "A young woman's desperate search for her abducted boyfriend draws her into the infamous Colonia Dignidad, a sect nobody ever escaped from.", 106, "English", "/lFmlp1AKv0avKmvDcvt8V4nMUY6.jpg", 7.2999999999999998, new DateTime(2016, 2, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), "Colonia" },
                    { 318846, null, "R", "The men who made millions from a global economic meltdown.", 131, "English", "/isuQWbJPbjybBEWdcCaBUPmU0XO.jpg", 7.2999999999999998, new DateTime(2015, 12, 11, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Big Short" },
                    { 319373, null, "12", "Sentaro runs a small bakery that serves dorayaki pastries filled with sweet red bean paste (“an”). When an old lady, Tokue, offers to help in the kitchen he reluctantly accepts. She will soon prove to have magic in her hands…", 113, "Japanese", "/fOfAbH25PasLXh2xGrp7TAs4sk7.jpg", 7.4000000000000004, new DateTime(2015, 5, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Sweet Bean" },
                    { 320007, null, "12", "A young Spanish woman who has newly moved to Berlin finds her flirtation with a local guy turn potentially deadly as their night out with his friends reveals a dangerous secret.", 138, "German", "/h27gzn8K3U4xXEMh0FmSFxqpDMz.jpg", 7.7000000000000002, new DateTime(2015, 6, 11, 0, 0, 0, 0, DateTimeKind.Unspecified), "Victoria" },
                    { 321528, null, "PG-13", "Damian Wayne is having a hard time coping with his father's \"no killing\" rule. Meanwhile, Gotham is going through hell with threats such as the insane Dollmaker, and the secretive Court of Owls.", 72, "English", "/aGp9XDXmVM5lCKHWtgBC15S7XLr.jpg", 7.2000000000000002, new DateTime(2015, 4, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), "Batman vs. Robin" },
                    { 323272, null, "PG", "The family-friendly movie explores the transformational role prayer plays in the lives of the Jordan family. Tony and Elizabeth Jordan, a middle-class couple who seemingly have it all – great jobs, a beautiful daughter, their dream home. But appearances can be deceiving. In reality, the Jordan’s marriage has become a war zone and their daughter is collateral damage. With the help of Miss Clara, an older, wiser woman, Elizabeth discovers she can start fighting for her family instead of against them. Through a newly energized faith, Elizabeth and Tony’s real enemy doesn’t have a prayer.", 120, "English", "/unxQeVUi5DH01r7ZNvAHwpvX7UK.jpg", 7.9000000000000004, new DateTime(2015, 8, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), "War Room" },
                    { 323661, null, "PG", "When a faun named Mune becomes the Guardian of the Moon, little did he had unprepared experience with the Moon and an accident that could put both the Moon and the Sun in danger, including a corrupt titan named Necross who wants the Sun for himself and placing the balance of night and day in great peril. Now with the help of a wax-child named Glim and the warrior, Sohone who also became the Sun Guardian, they go out on an exciting journey to get the Sun back and restore the Moon to their rightful place in the sky.", 86, "French", "/4vzqow7mVUahqA4hHoe2UpQOxy.jpg", 7.2000000000000002, new DateTime(2015, 2, 5, 0, 0, 0, 0, DateTimeKind.Unspecified), "Mune: Guardian of the Moon" },
                    { 323677, null, "PG-13", "Based on the story of Jesse Owens, the athlete whose quest to become the greatest track and field athlete in history thrusts him onto the world stage of the 1936 Olympics, where he faces off against Adolf Hitler's vision of Aryan supremacy.", 134, "English", "/3pKLVyz6LGQU8xEDhYHSHsfy5Bg.jpg", 7.2000000000000002, new DateTime(2016, 2, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), "Race" },
                    { 324786, null, "R", "WWII American Army Medic Desmond T. Doss, who served during the Battle of Okinawa, refuses to kill people and becomes the first Conscientious Objector in American history to receive the Congressional Medal of Honor.", 139, "English", "/fTuxNlgEm04PPFkr1xfK94Jn8BW.jpg", 8.0999999999999996, new DateTime(2016, 10, 7, 0, 0, 0, 0, DateTimeKind.Unspecified), "Hacksaw Ridge" },
                    { 324857, null, "PG", "Miles Morales is juggling his life between being a high school student and being a spider-man. When Wilson \"Kingpin\" Fisk uses a super collider, others from across the Spider-Verse are transported to this dimension.", 117, "English", "/iiZZdoQBEYBv6id8su7ImL0oCbD.jpg", 8.4000000000000004, new DateTime(2018, 12, 6, 0, 0, 0, 0, DateTimeKind.Unspecified), "Spider-Man: Into the Spider-Verse" },
                    { 327331, null, "R", "The story of Mötley Crüe and their rise from the Sunset Strip club scene of the early 1980s to superstardom.", 108, "English", "/xGY5rr8441ib0lT9mtHZn7e8Aay.jpg", 7.5999999999999996, new DateTime(2019, 3, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Dirt" },
                    { 329819, null, "U", "The film tells the story of Malony and his education as he grows from a six-year-old into an 18-year-old. A minors’ judge and a caseworker work tirelessly to try to save the young offender.", 119, "French", "/5TIzJYIs1zIDkqSwFHdAT0Vfk63.jpg", 7.2999999999999998, new DateTime(2015, 5, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), "Standing Tall" },
                    { 329865, null, "PG-13", "Taking place after alien crafts land around the world, an expert linguist is recruited by the military to determine whether they come in peace or are a threat.", 116, "English", "/x2FJsf1ElAgr63Y3PNPtJrcmpoe.jpg", 7.5, new DateTime(2016, 11, 10, 0, 0, 0, 0, DateTimeKind.Unspecified), "Arrival" },
                    { 330457, null, "PG", "Elsa, Anna, Kristoff and Olaf head far into the forest to learn the truth about an ancient mystery of their kingdom.", 103, "English", "/mINJaa34MtknCYl5AjtNJzWj8cD.jpg", 7.2999999999999998, new DateTime(2019, 11, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), "Frozen II" },
                    { 330459, null, "PG-13", "A rogue band of resistance fighters unite for a mission to steal the Death Star plans and bring a new hope to the galaxy.", 133, "English", "/5jX3p0apUG5bkMHtnKZch0xpkBS.jpg", 7.5, new DateTime(2016, 12, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), "Rogue One: A Star Wars Story" },
                    { 331482, null, "PG", "Four sisters come of age in America in the aftermath of the Civil War.", 135, "English", "/yn5ihODtZ7ofn8pDYfxCmxh8AXI.jpg", 7.9000000000000004, new DateTime(2019, 12, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "Little Women" },
                    { 332562, null, "R", "Seasoned musician Jackson Maine discovers — and falls in love with — struggling artist Ally. She has just about given up on her dream to make it big as a singer — until Jack coaxes her into the spotlight. But even as Ally's career takes off, the personal side of their relationship is breaking down, as Jack fights an ongoing battle with his own internal demons.", 136, "English", "/wrFpXMNBRj2PBiN4Z5kix51XaIZ.jpg", 7.5, new DateTime(2018, 10, 3, 0, 0, 0, 0, DateTimeKind.Unspecified), "A Star Is Born" },
                    { 333339, null, "PG-13", "When the creator of a popular video game system dies, a virtual contest is created to compete for his fortune.", 140, "English", "/pU1ULUq8D3iRxl1fdX2lZIzdHuI.jpg", 7.5999999999999996, new DateTime(2018, 3, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), "Ready Player One" },
                    { 334533, null, "R", "A father living in the forests of the Pacific Northwest with his six young kids tries to assimilate back into society.", 118, "English", "/2sFME73GaD8UsUxPUKe60cPdLif.jpg", 8.0, new DateTime(2016, 7, 2, 0, 0, 0, 0, DateTimeKind.Unspecified), "Captain Fantastic" },
                    { 334541, null, "R", "After his older brother passes away, Lee Chandler is forced to return home to care for his 16-year-old nephew. There he is compelled to deal with a tragic past that separated him from his family and the community where he was born and raised.", 138, "English", "/e8daDzP0vFOnGyKmve95Yv0D0io.jpg", 7.5, new DateTime(2016, 11, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), "Manchester by the Sea" },
                    { 334543, null, "PG-13", "A five-year-old Indian boy gets lost on the streets of Calcutta, thousands of kilometers from home. He survives many challenges before being adopted by a couple in Australia; 25 years later, he sets out to find his lost family.", 118, "English", "/kCELJH1tCmaRLqvwIgKDb09aEaw.jpg", 8.0999999999999996, new DateTime(2016, 1, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), "Lion" },
                    { 335578, null, "R", "In the days following the surrender of Germany in May 1945, a group of young German prisoners of war is handed over to the Danish authorities and subsequently sent to the West Coast, where they are ordered to remove the more than two million mines that the Germans had placed in the sand along the coast. With their bare hands, crawling around in the sand, the boys are forced to perform the dangerous work under the leadership of a Danish sergeant.", 100, "Danish", "/7TOYH2VDnYbXpBKlrkdQZUSC3Du.jpg", 7.7999999999999998, new DateTime(2015, 12, 3, 0, 0, 0, 0, DateTimeKind.Unspecified), "Land of Mine" },
                    { 335984, null, "R", "Thirty years after the events of the first film, a new blade runner, LAPD Officer K, unearths a long-buried secret that has the potential to plunge what's left of society into chaos. K's discovery leads him on a quest to find Rick Deckard, a former LAPD blade runner who has been missing for 30 years.", 164, "English", "/gajva2L0rPYkEWjzgFlBXCAVBE5.jpg", 7.5, new DateTime(2017, 10, 4, 0, 0, 0, 0, DateTimeKind.Unspecified), "Blade Runner 2049" },
                    { 336804, null, "PG-13", "In a Turkish village, five orphaned sisters live under strict rule while members of their family prepare their arranged marriages.", 97, "Turkish", "/sXg3JjxCkgWw5B4VVk8lfcYImne.jpg", 7.9000000000000004, new DateTime(2015, 6, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), "Mustang" },
                    { 336808, null, "AL", "The epic story of the first contact, encounter, approach, betrayal and, eventually, life-transcending friendship, between Karamakate, an Amazonian shaman, last survivor of his people, and two scientists that, over the course of 40 years, travel through the Amazon in search of a sacred plant that can heal them. Inspired by the journals of the first explorers of the Colombian Amazon, Theodor Koch-Grunberg and Richard Evans Schultes.", 125, "Spanish", "/t3Lmw8jvm7tpik0lSkub8hU4oRW.jpg", 7.7999999999999998, new DateTime(2015, 5, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "Embrace of the Serpent" },
                    { 337703, null, "6", "The dialogue-less film follows the major life stages of a castaway on a deserted tropical island populated by turtles, crabs and birds.", 80, "French", "/wOBU3SLjQ9358Km9YWYasPZyebp.jpg", 7.5, new DateTime(2016, 6, 29, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Red Turtle" },
                    { 337960, null, "NR", "Tim and John fell in love while teenagers at their all-boys high school. John was captain of the rugby team, Tim an aspiring actor playing a minor part in Romeo and Juliet. Their romance endured for 15 years in the face of everything life threw at it - the separations, the discrimination, the temptations, the jealousies and the losses - until the only problem that love can't solve tried to destroy them.", 128, "English", "/vxORWSHeLpsK8jDyFWuJifKacsj.jpg", 7.7999999999999998, new DateTime(2015, 8, 27, 0, 0, 0, 0, DateTimeKind.Unspecified), "Holding the Man" },
                    { 338189, null, "16+", "Louis, a terminally ill writer, returns home after a long absence to tell his family that he is dying.", 96, "French", "/zD9TQOqZrgTjI7XfHPNjNSki7C0.jpg", 7.2000000000000002, new DateTime(2016, 8, 26, 0, 0, 0, 0, DateTimeKind.Unspecified), "It's Only the End of the World" },
                    { 338766, null, "R", "A divorced dad and his ex-con brother resort to a desperate scheme in order to save their family's farm in West Texas.", 102, "English", "/ljRRxqy2aXIkIBXLmOVifcOR021.jpg", 7.2999999999999998, new DateTime(2016, 8, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), "Hell or High Water" },
                    { 339380, null, "PG-13", "Young lawyer Ruth Bader Ginsburg teams with her husband Marty to bring a groundbreaking case before the U.S. Court of Appeals and overturn a century of sex discrimination.", 120, "English", "/izY9Le3QWtu7xkHq7bjJnuE5yGI.jpg", 7.4000000000000004, new DateTime(2018, 12, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "On the Basis of Sex" },
                    { 339403, null, "R", "After being coerced into working for a crime boss, a young getaway driver finds himself taking part in a heist doomed to fail.", 113, "English", "/rmnQ9jKW72bHu8uKlMjPIb2VLMI.jpg", 7.5, new DateTime(2017, 6, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), "Baby Driver" },
                    { 339877, null, "PG-13", "The film brings the paintings of Vincent van Gogh to life to tell his remarkable story. Every one of the 65,000 frames of the film is an oil-painting hand-painted by 125 professional oil-painters who travelled from all across the world to the Loving Vincent studios in Poland and Greece to be a part of the production. As remarkable as Vincent’s brilliant paintings are his passionate and ill-fated life and mysterious death.", 95, "English", "/56sq57kDm7XgyXBYrgJLumo0Jac.jpg", 8.0999999999999996, new DateTime(2017, 6, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), "Loving Vincent" },
                    { 339984, null, "PG", "When Christy discovers her 10-year-old daughter Anna has a rare, incurable disease, she becomes a ferocious advocate for her daughter’s healing as she searches for a solution. After Anna has a freak accident and falls three stories, a miracle unfolds in the wake of her dramatic rescue that leaves medical specialists mystified, her family restored and their community inspired.", 119, "English", "/hz9VF1TfaM0D04pYneSXUkNeOZv.jpg", 7.4000000000000004, new DateTime(2016, 3, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), "Miracles from Heaven" },
                    { 340666, null, "R", "Susan Morrow receives a book manuscript from her ex-husband – a man she left 20 years earlier – asking for her opinion of his writing. As she reads, she is drawn into the fictional life of Tony Hastings, a mathematics professor whose family vacation turns violent.", 116, "English", "/mdLDgQBD0va09npSQX5Zgo2evXM.jpg", 7.5, new DateTime(2016, 11, 4, 0, 0, 0, 0, DateTimeKind.Unspecified), "Nocturnal Animals" },
                    { 342470, null, "16", "Two teens facing personal struggles form a powerful bond as they embark on a cathartic journey chronicling the wonders of Indiana.", 108, "English", "/4SafxuMKQiw4reBiWKVZJpJn80I.jpg", 7.7000000000000002, new DateTime(2020, 2, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), "All the Bright Places" },
                    { 342737, null, "R", "In 1979 Santa Barbara, California, Dorothea Fields is a determined single mother in her mid-50s who is raising her adolescent son, Jamie, at a moment brimming with cultural change and rebellion. Dorothea enlists the help of two younger women – Abbie, a free-spirited punk artist living as a boarder in the Fields' home and Julie, a savvy and provocative teenage neighbour – to help with Jamie's upbringing.", 119, "English", "/mso2rEr9i0MilRIOao5HaWFipS9.jpg", 7.4000000000000004, new DateTime(2016, 12, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), "20th Century Women" }
                });

            migrationBuilder.InsertData(
                table: "Movies",
                columns: new[] { "Id", "ActorId", "Certification", "Description", "Duration", "Language", "Picture", "Ratings", "ReleaseDate", "Title" },
                values: new object[,]
                {
                    { 345920, null, "PG-13", "Retreating from life after a tragedy, a man questions the universe by writing to Love, Time and Death. Receiving unexpected answers, he begins to see how these things interlock and how even loss can reveal moments of meaning and beauty.", 97, "English", "/oqtZbYtaUdDt1udekxRHlny5FA2.jpg", 7.2999999999999998, new DateTime(2016, 12, 6, 0, 0, 0, 0, DateTimeKind.Unspecified), "Collateral Beauty" },
                    { 345938, null, "PG-13", "After suffering a family tragedy, Mack Phillips spirals into a deep depression causing him to question his innermost beliefs. Facing a crisis of faith, he receives a mysterious letter urging him to an abandoned shack deep in the Oregon wilderness. Despite his doubts, Mack journeys to the shack and encounters an enigmatic trio of strangers led by a woman named Papa. Through this meeting, Mack finds important truths that will transform his understanding of his tragedy and change his life forever.", 132, "English", "/doAzav9kfdtsoSdw1MDFvjKq3J4.jpg", 7.4000000000000004, new DateTime(2017, 3, 3, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Shack" },
                    { 346364, null, "R", "In a small town in Maine, seven children known as The Losers Club come face to face with life problems, bullies and a monster that takes the shape of a clown called Pennywise.", 135, "English", "/9E2y5Q7WlCVNEhP5GiVTjhEhx1o.jpg", 7.2000000000000002, new DateTime(2017, 9, 6, 0, 0, 0, 0, DateTimeKind.Unspecified), "It" },
                    { 346648, null, "PG", "Paddington, now happily settled with the Browns, picks up a series of odd jobs to buy the perfect present for his Aunt Lucy, but it is stolen.", 104, "English", "/zuXMvSQq9F7H29qzuUm0qyUqw6m.jpg", 7.5, new DateTime(2017, 11, 9, 0, 0, 0, 0, DateTimeKind.Unspecified), "Paddington 2" },
                    { 347201, null, "PG-13", "Boruto is the son of the 7th Hokage Naruto who completely rejects his father. Behind this, he has feelings of wanting to surpass Naruto, who is respected as a hero. He ends up meeting his father's friend Sasuke, and requests to become... his apprentice!? The curtain on the story of the new generation written by Masashi Kishimoto rises!", 100, "Japanese", "/1k6iwC4KaPvTBt1JuaqXy3noZRY.jpg", 7.7000000000000002, new DateTime(2015, 8, 7, 0, 0, 0, 0, DateTimeKind.Unspecified), "Boruto: Naruto the Movie" },
                    { 348678, null, "PG-13", "Despite being deposed as president of his condominium association, grumpy 59-year-old Ove continues to watch over his neighbourhood with an iron fist. When pregnant Parvaneh and her family move into the terraced house opposite Ove and she accidentally back into Ove’s mailbox, it sets off a series of unexpected changes in his life.", 116, "Swedish", "/7DBMfL397QIvZQoTDe9JmwIa1v9.jpg", 7.5, new DateTime(2015, 12, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "A Man Called Ove" },
                    { 348892, null, "PG-13", "A young mute girl from Pakistan loses herself in India with no way to head back. A devoted man with a magnanimous spirit undertakes the task to get her back to her motherland and unite her with her family.", 159, "Hindi", "/4v1UPQJy3YL3A2YCg2MrVLgamj8.jpg", 7.7999999999999998, new DateTime(2015, 7, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), "Bajrangi Bhaijaan" },
                    { 350312, null, "UA", "When Mahendra, the son of Bāhubali, learns about his heritage, he begins to look for answers. His story is juxtaposed with past events that unfolded in the Mahishmati Kingdom.", 168, "Telugu", "/sXf30F2HFpsFPXlNz7jpOySSV9I.jpg", 7.2000000000000002, new DateTime(2017, 4, 27, 0, 0, 0, 0, DateTimeKind.Unspecified), "Bāhubali 2: The Conclusion" },
                    { 352173, null, "R", "A simple, street-smart man tries to protect his family from a tough cop looking for his missing son.", 163, "Hindi", "/gIClWRv5OSe8rl5Koi0AeUcCZ9Z.jpg", 7.9000000000000004, new DateTime(2015, 7, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Drishyam" },
                    { 353081, null, "PG-13", "When an IMF mission ends badly, the world is faced with dire consequences. As Ethan Hunt takes it upon himself to fulfill his original briefing, the CIA begin to question his loyalty and his motives. The IMF team find themselves in a race against time, hunted by assassins while trying to prevent a global catastrophe.", 147, "English", "/AkJQpZp9WoNdj7pLYSj1L0RcMMN.jpg", 7.4000000000000004, new DateTime(2018, 7, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), "Mission: Impossible - Fallout" },
                    { 354857, null, "M/12", "To save the universe, and their friendship, Mordecai and Rigby must defeat an evil volleyball coach.", 70, "English", "/p44RoW4naoE1nlSGOqqT0J2pc09.jpg", 7.7999999999999998, new DateTime(2015, 9, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "Regular Show: The Movie" },
                    { 354912, null, "PG", "Despite his family’s baffling generations-old ban on music, Miguel dreams of becoming an accomplished musician like his idol, Ernesto de la Cruz. Desperate to prove his talent, Miguel finds himself in the stunning and colorful Land of the Dead following a mysterious chain of events. Along the way, he meets charming trickster Hector, and together, they set off on an extraordinary journey to unlock the real story behind Miguel's family history.", 105, "English", "/gGEsBPAijhVUFoiNpgZXqRVWJt2.jpg", 8.1999999999999993, new DateTime(2017, 10, 27, 0, 0, 0, 0, DateTimeKind.Unspecified), "Coco" },
                    { 356296, null, "T", "A gangster known as \"Samurai\" wants to turn the waterfront of Rome into a new Las Vegas. All the local mob bosses have agreed to work for this common goal. But peace is not to last long.", 130, "Italian", "/6pYuT17u2aDeS51PUcLTdbiXVYj.jpg", 7.2999999999999998, new DateTime(2015, 10, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), "Suburra" },
                    { 359156, null, null, "A story set in the 90s and in the outskirts of Rome to Ostia. A world where money, luxury cars, night clubs, cocaine and synthetic drugs are easy to run. A world in which Vittorio and Cesare, in their early twenties, act in search of their success.", 100, "Italian", "/taSfNqBkM6fVexayWLKcqHxMg7a.jpg", 7.9000000000000004, new DateTime(2015, 9, 8, 0, 0, 0, 0, DateTimeKind.Unspecified), "Don't Be Bad" },
                    { 359724, null, "PG-13", "American car designer Carroll Shelby and the British-born driver Ken Miles work together to battle corporate interference, the laws of physics, and their own personal demons to build a revolutionary race car for Ford Motor Company and take on the dominating race cars of Enzo Ferrari at the 24 Hours of Le Mans in France in 1966.", 153, "English", "/dR1Ju50iudrOh3YgfwkAU1g2HZe.jpg", 8.0, new DateTime(2019, 11, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), "Ford v Ferrari" },
                    { 359784, null, "PG-13", "Canadian folk artist Maud Lewis falls in love with a fishmonger while working for him as a live-in housekeeper.", 115, "English", "/wu9RPdV0uEemFEewJQ6fWwJ9ZcU.jpg", 7.7999999999999998, new DateTime(2017, 4, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), "Maudie" },
                    { 359940, null, "R", "After seven months have passed without a culprit in her daughter's murder case, Mildred Hayes makes a bold move, painting three signs leading into her town with a controversial message directed at Bill Willoughby, the town's revered chief of police. When his second-in-command Officer Jason Dixon, an immature mother's boy with a penchant for violence, gets involved, the battle between Mildred and Ebbing's law enforcement is only exacerbated.", 115, "English", "/vgvw6w1CtcFkuXXn004S5wQsHRl.jpg", 8.0999999999999996, new DateTime(2017, 11, 10, 0, 0, 0, 0, DateTimeKind.Unspecified), "Three Billboards Outside Ebbing, Missouri" },
                    { 360365, null, "AL", "A teen star ventures out to the Italian countryside for a summer and emerges a new artist.", 95, "Spanish", "/iH1d41fxNGPZ53kvQ6GRUFNwp0F.jpg", 7.2000000000000002, new DateTime(2016, 5, 4, 0, 0, 0, 0, DateTimeKind.Unspecified), "Tini: The New Life of Violetta" },
                    { 360606, null, "G", "Two teen rival babysitters, Jenny and Lola, team up to hunt down one of their kids who accidentally ran away into the big city without any supervision.", 95, "English", "/xuCPo0krpAcK2s1uMCZs93turdk.jpg", 7.2999999999999998, new DateTime(2016, 6, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), "Adventures in Babysitting" },
                    { 360814, null, "PG", "Dangal is an extraordinary true story based on the life of Mahavir Singh and his two daughters, Geeta and Babita Phogat. The film traces the inspirational journey of a father who trains his daughters to become world class wrestlers.", 161, "Hindi", "/lHd3W8E5aKoki9pDP7tN7yEh3c0.jpg", 8.0, new DateTime(2016, 12, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), "Dangal" },
                    { 363579, null, "15", "Set in the late 1920s, The Age of Shadows follows the cat-and-mouse game that unfolds between a group of resistance fighters trying to bring in explosives from Shanghai to destroy key Japanese facilities in Seoul, and Japanese agents trying to stop them.", 140, "Korean", "/6muQ6lCytv0qldjA7aDT8EpPmtF.jpg", 7.4000000000000004, new DateTime(2016, 9, 7, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Age of Shadows" },
                    { 364111, null, "PG", "A young girl had her voice magically taken away so that she would never hurt people with it, but her outlook changes when she encounters music and friendship. Will Naruse be able to convey the anthem of her heart?", 119, "Japanese", "/7bJHM6t6j3YLjDNTwe4hyghKqSr.jpg", 7.5999999999999996, new DateTime(2015, 9, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Anthem of the Heart" },
                    { 364137, null, "12", "An Iranian family survives the shah and the ayatollah and moves to France. This story follows the family through it all. Despite the politics, revolution, prison, beatings, assassinations and suicides this is a comedy.", 102, "French", "/aPYtRdJwt85OgZIUBZ5tHgmfyCO.jpg", 7.5999999999999996, new DateTime(2015, 11, 4, 0, 0, 0, 0, DateTimeKind.Unspecified), "All Three of Us" },
                    { 364433, null, "T", "After accidentally coming into contact with radioactive waste, small-time crook Enzo Ceccotti gains superpowers. A misanthropic, introverted brute, he uses his new powers for personal gain until he meets Alessia, a mentally challenged girl who believes Enzo’s the hero from her favorite Japanese anime series, Steel Jeeg.", 112, "Italian", "/5V54GvHclEuO4qJ13tEaFqaFTxP.jpg", 7.5, new DateTime(2016, 2, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "They Call Me Jeeg" },
                    { 364689, null, "PG", "Ferdinand, a little bull, prefers sitting quietly under a cork tree just smelling the flowers versus jumping around, snorting, and butting heads with other bulls. As Ferdinand grows big and strong, his temperament remains mellow, but one day five men come to choose the \"biggest, fastest, roughest bull\" for the bullfights in Madrid and Ferdinand is mistakenly chosen.  Based on the classic 1936 children's book by Munro Leaf.", 108, "English", "/rMm94JsRfcOPiPVsTRcBiiVBOhz.jpg", 7.2000000000000002, new DateTime(2017, 12, 9, 0, 0, 0, 0, DateTimeKind.Unspecified), "Ferdinand" },
                    { 366170, null, "12", "Yugi and Kaiba have a special duel that transcends dimensions.", 120, "Japanese", "/nFQkn1KE0Is3FUW0yPPgdVvCnlo.jpg", 7.5, new DateTime(2016, 4, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), "Yu-Gi-Oh!: The Dark Side of Dimensions" },
                    { 369299, null, "12", "After a one-night stand results in pregnancy, a young woman decides to become partners with the emotionally immature father-to-be.", 113, "Spanish", "/zWp8QZ1KxNrirNK9MF1EAIHjqVw.jpg", 7.5, new DateTime(2016, 5, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), "Don't Blame the Kid" },
                    { 369557, null, "PG-13", "A boy growing up in Dublin during the 1980s escapes his strained family life by starting a band to impress the mysterious girl he likes.", 106, "English", "/sUWpVlrvzU2SJbnVZqIeKulPKwk.jpg", 7.9000000000000004, new DateTime(2016, 3, 11, 0, 0, 0, 0, DateTimeKind.Unspecified), "Sing Street" },
                    { 371645, null, "PG-13", "Ricky is a defiant young city kid who finds himself on the run with his cantankerous foster uncle in the wild New Zealand bush. A national manhunt ensues, and the two are forced to put aside their differences and work together to survive.", 101, "English", "/skQqcMa1nSt7aqRRJiSy44KGSC1.jpg", 7.7000000000000002, new DateTime(2016, 3, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Hunt for the Wilderpeople" },
                    { 372058, null, "PG", "High schoolers Mitsuha and Taki are complete strangers living separate lives. But one night, they suddenly switch places. Mitsuha wakes up in Taki’s body, and he in hers. This bizarre occurrence continues to happen randomly, and the two must adjust their lives around each other.", 106, "Japanese", "/q719jXXEzOoYaps6babgKnONONX.jpg", 8.5999999999999996, new DateTime(2016, 8, 26, 0, 0, 0, 0, DateTimeKind.Unspecified), "Your Name." },
                    { 374461, null, "PG-13", "A unique friendship develops when a little girl and her dying mother inherit a cook - Mr. Church. What begins as an arrangement that should only last six months, instead spans fifteen years.", 104, "English", "/liaOLbeqKVM3cTmeBXf21ffLApZ.jpg", 7.2999999999999998, new DateTime(2016, 9, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), "Mr. Church" },
                    { 374473, null, "R", "A middle aged carpenter, who requires state welfare after injuring himself, is joined by a single mother in a similar scenario.", 100, "English", "/nu3WVABXz2W85N6JXTZOT1aWS3b.jpg", 7.7000000000000002, new DateTime(2016, 10, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), "I, Daniel Blake" },
                    { 374720, null, "PG-13", "The story of the miraculous evacuation of Allied soldiers from Belgium, Britain, Canada and France, who were cut off and surrounded by the German army from the beaches and harbour of Dunkirk between May 26th and June 4th 1940 during World War II.", 107, "English", "/ebSnODDg9lbsMIaWg2uAbjn7TO5.jpg", 7.5, new DateTime(2017, 7, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), "Dunkirk" },
                    { 375262, null, "R", "England, early 18th century. The close relationship between Queen Anne and Sarah Churchill is threatened by the arrival of Sarah's cousin, Abigail Hill, resulting in a bitter rivalry between the two cousins to be the Queen's favourite.", 119, "English", "/cwBq0onfmeilU5xgqNNjJAMPfpw.jpg", 7.5999999999999996, new DateTime(2018, 11, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Favourite" },
                    { 375315, null, "PG-13", "Forced out of their apartment due to dangerous works on a neighboring building, Emad and Rana move into a new flat in the center of Tehran. An incident linked to the previous tenant will dramatically change the young couple’s life.", 125, "Persian", "/z2AFU8rv7HmNosDvnVcMrG7OlVN.jpg", 7.2999999999999998, new DateTime(2016, 6, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Salesman" },
                    { 375572, null, "T", "Giulia De Martino is a pilot. At seventeen she partecipates in the GT Championship, under the guidance of her father Mario. But one day everything changes and Giulia has to face alone both the track and her own life.", 119, "Italian", "/nicStobkEYh9iJO6CC3UqolQRsK.jpg", 7.5999999999999996, new DateTime(2016, 4, 7, 0, 0, 0, 0, DateTimeKind.Unspecified), "Italian Race" },
                    { 375785, null, "PG-13", "An American hypochondriac who is working as a baggage handler is forced to confront his fears when a British teenager with a terminal illness enlists him to help her carry out her eccentric bucket list.", 97, "English", "/9hIA3dgyOWj1MLXYrJ7SZ6lckM9.jpg", 7.5999999999999996, new DateTime(2019, 2, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "Then Came You" },
                    { 375794, null, "PG-13", "After his release from prison, bank robber Zequi sets off to recover the stolen money that was buried by his dizzy accomplice. He's horrified to learn that a high school gymnasium is now standing over the site where the loot is stashed. Needing to infiltrate the building, Zequi lands a job as a substitute teacher for a group of wild and unruly students. As the ex-con tries to lay down the law, he starts to realize that life in jail may have been easier than trying to deal with rebellious teens.", 100, "Spanish", "/6HfyXfIEywLa2HvcswKi44dDKxL.jpg", 7.7999999999999998, new DateTime(2016, 9, 2, 0, 0, 0, 0, DateTimeKind.Unspecified), "No Manches Frida" },
                    { 376290, null, "R", "An ambitious lobbyist faces off against the powerful gun lobby in an attempt to pass gun control legislation.", 132, "English", "/ptfvQlqe2xJiMSewSj52qAVq5z0.jpg", 7.5, new DateTime(2016, 11, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "Miss Sloane" },
                    { 376867, null, "R", "The tender, heartbreaking story of a young man’s struggle to find himself, told across three defining chapters in his life as he experiences the ecstasy, pain, and beauty of falling in love, while grappling with his own sexuality.", 111, "English", "/rcICfiL9fvwRjoWHxW8QeroLYrJ.jpg", 7.4000000000000004, new DateTime(2016, 10, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), "Moonlight" },
                    { 377263, null, "PG-13", "In the aftermath of WWI, a young German who grieves the death of her fiancé in France meets a mysterious French man who visits the fiance’s grave to lay flowers.", 113, "French", "/tBCL7di8Y1BA9RAzQSoKOjtdPqj.jpg", 7.4000000000000004, new DateTime(2016, 9, 7, 0, 0, 0, 0, DateTimeKind.Unspecified), "Frantz" },
                    { 377273, null, "16", "Clara, a 65-year-old widow and retired music critic, was born into a wealthy and traditional family in Recife, Brazil. She is the last resident of the Aquarius, an original two-story building, built in the 1940s, in the upper-class, seaside Boa Viagem Avenue. All the neighboring apartments have already been acquired by a company which has other plans for that plot.", 147, "Portuguese", "/9hwkjmtl3HCXe7JW2BVSyjLXHCo.jpg", 7.5, new DateTime(2016, 9, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "Aquarius" }
                });

            migrationBuilder.InsertData(
                table: "Movies",
                columns: new[] { "Id", "ActorId", "Certification", "Description", "Duration", "Language", "Picture", "Ratings", "ReleaseDate", "Title" },
                values: new object[,]
                {
                    { 378064, null, "PG-13", "Shouya Ishida starts bullying the new girl in class, Shouko Nishimiya, because she is deaf. But as the teasing continues, the rest of the class starts to turn on Shouya for his lack of compassion. When they leave elementary school, Shouko and Shouya do not speak to each other again... until an older, wiser Shouya, tormented by his past behaviour, decides he must see Shouko once more. He wants to atone for his sins, but is it already too late...?", 130, "Japanese", "/tuFaWiqX0TXoWu7DGNcmX3UW7sT.jpg", 8.4000000000000004, new DateTime(2016, 9, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), "A Silent Voice: The Movie" },
                    { 378108, null, "PG-13", "Japan, 1943, during World War II. Young Suzu leaves her village near Hiroshima to marry and live with her in-laws in Kure, a military harbor. Her creativity to overcome deprivation quickly makes her indispensable at home. Inhabited by an ancestral wisdom, Suzu impregnates the simple gestures of everyday life with poetry and beauty. The many hardships, the loss of loved ones, the frequent air raids of the enemy, nothing alters her enthusiasm…", 130, "Japanese", "/9Z4H4M2F8OQTB04YC1Opds8MFBb.jpg", 8.0999999999999996, new DateTime(2016, 11, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), "In This Corner of the World" },
                    { 379019, null, "0", "An ambitious young man struggles to achieve his dream of becoming an employee in a Munich luxury hotel despite being strongly visually impaired.", 111, "German", "/uneNYyni8wSflliNVOrz7VOnMHu.jpg", 7.5999999999999996, new DateTime(2017, 1, 26, 0, 0, 0, 0, DateTimeKind.Unspecified), "My Blind Date with Life" },
                    { 379170, null, "PG-13", "Sherlock Holmes and Dr. Watson find themselves in 1890s London in this holiday special.", 90, "English", "/EJe9ZNCmypWjQZ99cGsNvhC8t0.jpg", 7.9000000000000004, new DateTime(2016, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "Sherlock: The Abominable Bride" },
                    { 379291, null, "PG-13", "Robin is sent by Batman to work with the Teen Titans after his volatile behavior botches up a Justice League mission. The Titans must then step up to face Trigon after he possesses the League and threatens to conquer the world.", 78, "English", "/3G6RPpafXApTzn56cbVqLBp9uSz.jpg", 7.2999999999999998, new DateTime(2016, 3, 29, 0, 0, 0, 0, DateTimeKind.Unspecified), "Justice League vs. Teen Titans" },
                    { 380225, null, "T", "Beatrice is a blabbermouth and a so-called billionaire countess who likes to believe she’s in intimacy with world leaders. Donatella is a young quiet tattooed woman, locked in her own mystery. They are both patients of a mental institution and subject to custodial measures.", 116, "Italian", "/pSVdOFu22jGWRHyCoJwIJTYuDBD.jpg", 7.4000000000000004, new DateTime(2016, 5, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), "Like Crazy" },
                    { 381284, null, "PG", "The untold story of Katherine G. Johnson, Dorothy Vaughan and Mary Jackson – brilliant African-American women working at NASA and serving as the brains behind one of the greatest operations in history – the launch of astronaut John Glenn into orbit. The visionary trio crossed all gender and race lines to inspire generations to dream big.", 127, "English", "/9lfz2W2uGjyow3am00rsPJ8iOyq.jpg", 8.0, new DateTime(2016, 12, 10, 0, 0, 0, 0, DateTimeKind.Unspecified), "Hidden Figures" },
                    { 381288, null, "PG-13", "Though Kevin has evidenced 23 personalities to his trusted psychiatrist, Dr. Fletcher, there remains one still submerged who is set to materialize and dominate all the others. Compelled to abduct three teenage girls led by the willful, observant Casey, Kevin reaches a war for survival among all of those contained within him — as well as everyone around him — as the walls between his compartments shatter apart.", 117, "English", "/bqb9WsmZmDIKxqYmBJ9lj7J6hzn.jpg", 7.2999999999999998, new DateTime(2016, 11, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Split" },
                    { 381289, null, "PG", "A dog goes on quest to discover his purpose in life over the course of several lifetimes with multiple owners.", 100, "English", "/3jcNvhtVQe5Neoffdic39fRactM.jpg", 7.5, new DateTime(2017, 1, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), "A Dog's Purpose" },
                    { 381341, null, "T", "During a dinner, a group of friends decide to share whatever text message or phone call they will receive during the evening - and all hell breaks loose.", 97, "Italian", "/3wknM629Vryofb1HNo2YnLQnQyn.jpg", 7.9000000000000004, new DateTime(2016, 2, 11, 0, 0, 0, 0, DateTimeKind.Unspecified), "Perfect Strangers" },
                    { 382591, null, "8", "A man without attachments or responsibilities suddenly finds himself with an abandoned baby and leaves for London to try and find the mother. Eight years later after he and his daughter become inseparable Gloria's mother reappears.", 118, "French", "/aFgtdhuzgI2eqnIVWtRB03x3pnt.jpg", 7.7999999999999998, new DateTime(2016, 12, 7, 0, 0, 0, 0, DateTimeKind.Unspecified), "Two Is a Family" },
                    { 382614, null, "PG-13", "Susan, a single mother of two, works as a waitress in a small town. Her son, Henry, is an 11-year-old genius who not only manages the family finances but acts as emotional support for his mother and younger brother. When Henry discovers that the girl next door has a terrible secret, he implores Susan to take matters into her own hands.", 105, "English", "/suLFg4UjvM5BoDipg2Wu3gZ802T.jpg", 7.5, new DateTime(2017, 6, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Book of Henry" },
                    { 382748, null, "PG", "Leo Borlock is an average student at Mica High School. He gets decent grades, is a member of the school's marching band and has always been content flying under the radar. But all that changes when he meets Stargirl Caraway, a confident and colorful new student with a penchant for the ukulele, who stands out in a crowd. She is kind, finds magic in the mundane and touches the lives of others with the simplest of gestures. Her eccentricities and infectious personality charm Leo and the student body, and she quickly goes from being ignored and ridiculed to accepted and praised, then back again, sending Leo on a rollercoaster ride of emotions.", 107, "English", "/gwsrtzSrr7G6xjxsa7IwaAMHpEF.jpg", 7.5999999999999996, new DateTime(2020, 3, 10, 0, 0, 0, 0, DateTimeKind.Unspecified), "Stargirl" },
                    { 383498, null, "R", "Wisecracking mercenary Deadpool battles the evil and powerful Cable and other bad guys to save a boy's life.", 119, "English", "/to0spRl1CMDvyUbOnbb4fTk3VAd.jpg", 7.5, new DateTime(2018, 5, 10, 0, 0, 0, 0, DateTimeKind.Unspecified), "Deadpool 2" },
                    { 385103, null, "PG", "In Scooby-Doo’s greatest adventure yet, see the never-before told story of how lifelong friends Scooby and Shaggy first met and how they joined forces with young detectives Fred, Velma, and Daphne to form the famous Mystery Inc. Now, with hundreds of cases solved, Scooby and the gang face their biggest, toughest mystery ever: an evil plot to unleash the ghost dog Cerberus upon the world. As they race to stop this global “dogpocalypse,” the gang discovers that Scooby has a secret legacy and an epic destiny greater than anyone ever imagined.", 94, "English", "/jHo2M1OiH9Re33jYtUQdfzPeUkx.jpg", 7.2999999999999998, new DateTime(2020, 7, 8, 0, 0, 0, 0, DateTimeKind.Unspecified), "Scoob!" },
                    { 387426, null, "PG-13", "A young girl named Mija risks everything to prevent a powerful, multi-national company from kidnapping her best friend - a massive animal named Okja.", 122, "English", "/pHlRr2MfjK77VIIAO7p0R4jhsJI.jpg", 7.5, new DateTime(2017, 6, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), "Okja" },
                    { 389015, null, "R", "Competitive ice skater Tonya Harding rises amongst the ranks at the U. S. Figure Skating Championships, but her future in the sport is thrown into doubt when her ex-husband intervenes.", 120, "English", "/6gNXwSHxaksR1PjVZRqNapmkgj3.jpg", 7.5, new DateTime(2017, 12, 8, 0, 0, 0, 0, DateTimeKind.Unspecified), "I, Tonya" },
                    { 391713, null, "R", "Lady Bird McPherson, a strong willed, deeply opinionated, artistic 17 year old comes of age in Sacramento. Her relationship with her mother and her upbringing are questioned and tested as she plans to head off to college.", 94, "English", "/iySFtKLrWvVzXzlFj7x1zalxi5G.jpg", 7.2999999999999998, new DateTime(2017, 9, 8, 0, 0, 0, 0, DateTimeKind.Unspecified), "Lady Bird" },
                    { 392982, null, "PG-13", "Thurgood Marshall, the first African-American Supreme Court Justice, battles through one of his career-defining cases.", 118, "English", "/2KfdXsXTCbMie0wB1mSmIX60C2F.jpg", 7.2999999999999998, new DateTime(2017, 10, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), "Marshall" },
                    { 393559, null, "PG-13", "After his mother’s death, Zucchini is befriended by a kind police officer, Raymond, who accompanies him to his new foster home filled with other orphans his age. There, with the help of his newfound friends, Zucchini eventually learns to trust and love as he searches for a new family of his own.", 66, "French", "/2uu8fIzl76C9MFiUQhjKYSLKVq.jpg", 7.7999999999999998, new DateTime(2016, 10, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), "My Life as a Zucchini" },
                    { 393729, null, "16", "In a ghetto where religion and drug trafficking rub shoulders, Dounia has a lust for power and success. Supported by Maimouna, her best friend, she decides to follow in the footsteps of Rebecca, a respected dealer. But her encounter with Djigui, a young, disturbingly sensual dancer, throws her off course.", 105, "French", "/6P12dmdR0XFXXOPx1HsI8kT6yMX.jpg", 7.9000000000000004, new DateTime(2016, 8, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Divines" },
                    { 394117, null, "R", "The story of a precocious six year-old and her ragtag group of friends whose summer break is filled with childhood wonder, possibility and a sense of adventure while the adults around them struggle with hard times.", 112, "English", "/bnSTP1PY2fDyat0eUa4QouuGV7F.jpg", 7.4000000000000004, new DateTime(2017, 10, 6, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Florida Project" },
                    { 395834, null, "R", "An FBI agent teams with the town's veteran game tracker to investigate a murder that occurred on a Native American reservation.", 107, "English", "/pySivdR845Hom4u4T2WNkJxe6Ad.jpg", 7.4000000000000004, new DateTime(2017, 8, 3, 0, 0, 0, 0, DateTimeKind.Unspecified), "Wind River" },
                    { 395991, null, "PG-13", "Members of the Granite Mountain Hotshots battle deadly wildfires to save an Arizona town.", 134, "English", "/rwJVB0muOMhkI5pTt9wwr4XCMBY.jpg", 7.2999999999999998, new DateTime(2017, 9, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), "Only the Brave" },
                    { 396263, null, "NC-17", "Somewhere in Tokyo, there is a room. In that room is a black sphere. Periodically, people who should otherwise have died are transferred to the room. There, the sphere gives them special suits and weapons, and sends them out on a mission to kill aliens here on Earth. While these missions take place, the rest of the world is largely oblivious to them. These missions are lethal - few participants survive them. The sphere calls the shots, and it's not the slightest bit nice. Its name... Gantz.", 95, "Japanese", "/pmYUrlTc6KwZKSHMXuyCvZF19tf.jpg", 7.2999999999999998, new DateTime(2016, 10, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), "Gantz:O" },
                    { 396535, null, "15", "Martial law is declared when a mysterious viral outbreak pushes Korea into a state of emergency. Those on an express train to Busan, a city that has successfully fended off the viral outbreak, must fight for their own survival…", 118, "Korean", "/3H1WFCuxyNRP35oiL2qqwhAXxc0.jpg", 7.7999999999999998, new DateTime(2016, 7, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), "Train to Busan" },
                    { 397567, null, "M", "Having died unexpectedly, firefighter Ja-hong is taken to the afterlife by 3 afterlife guardians. Only when he passes 7 trials over 49 days and proves he was innocent in human life, he’s able to reincarnate, and his 3 afterlife guardians are by his side to defend him in trial.", 139, "Korean", "/gJSvIsI6oQfFim0PGyuuiCYfqKs.jpg", 8.0, new DateTime(2017, 12, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), "Along with the Gods: The Two Worlds" },
                    { 398818, null, "R", "In 1980s Italy, a relationship begins between seventeen-year-old teenage Elio and the older adult man hired as his father's research assistant.", 132, "English", "/tcNniniS4rfqrLH0oORikJfnIwY.jpg", 8.3000000000000007, new DateTime(2017, 9, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "Call Me by Your Name" },
                    { 398924, null, "U", "In occupied France, Maurice and Joseph, two young Jewish brothers left to their own devices demonstrate an incredible amount of cleverness, courage, and ingenuity to escape the enemy invasion and to try to reunite their family once again.", 110, "French", "/57C8wLEoeJ9vVqZarsfx54YEWxS.jpg", 7.9000000000000004, new DateTime(2017, 1, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), "A Bag of Marbles" },
                    { 398978, null, "R", "Pennsylvania, 1956. Frank Sheeran, a war veteran of Irish origin who works as a truck driver, accidentally meets mobster Russell Bufalino. Once Frank becomes his trusted man, Bufalino sends him to Chicago with the task of helping Jimmy Hoffa, a powerful union leader related to organized crime, with whom Frank will maintain a close friendship for nearly twenty years.", 209, "English", "/mbm8k3GFhXS0ROd9AD1gqYbIFbM.jpg", 7.7000000000000002, new DateTime(2019, 11, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Irishman" },
                    { 399055, null, "R", "An other-worldly story, set against the backdrop of Cold War era America circa 1962, where a mute janitor working at a lab falls in love with an amphibious man being held captive there and devises a plan to help him escape.", 123, "English", "/9zfwPffUXpBrEP26yp0q1ckXDcj.jpg", 7.2999999999999998, new DateTime(2017, 12, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Shape of Water" },
                    { 399106, null, "G", "A mother bird tries to teach her little one how to find food by herself. In the process, she encounters a traumatic experience that she must overcome in order to survive.", 6, "English", "/9tzpqQic0VJt4JCAJ5ZGrfs1qWV.jpg", 8.1999999999999993, new DateTime(2016, 6, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), "Piper" },
                    { 399174, null, "PG-13", "In the future, an outbreak of canine flu leads the mayor of a Japanese city to banish all dogs to an island that's a garbage dump. The outcasts must soon embark on an epic journey when a 12-year-old boy arrives on the island to find his beloved pet.", 101, "English", "/c0nUX6Q1ZB0P2t1Jo6EeFSVnOGQ.jpg", 7.9000000000000004, new DateTime(2018, 3, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), "Isle of Dogs" },
                    { 399404, null, "PG-13", "A thrilling and inspiring true story begins on the eve of World War II as, within days of becoming Prime Minister of Great Britain, Winston Churchill must face one of his most turbulent and defining trials: exploring a negotiated peace treaty with Nazi Germany, or standing firm to fight for the ideals, liberty and freedom of a nation. As the unstoppable Nazi forces roll across Western Europe and the threat of invasion is imminent, and with an unprepared public, a skeptical King, and his own party plotting against him, Churchill must withstand his darkest hour, rally a nation, and attempt to change the course of world history.", 125, "English", "/z0K8uoNbrYKkbaP7wIeadJ4BmSL.jpg", 7.4000000000000004, new DateTime(2017, 11, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), "Darkest Hour" },
                    { 399566, null, "PG-13", "In a time when monsters walk the Earth, humanity’s fight for its future sets Godzilla and Kong on a collision course that will see the two most powerful forces of nature on the planet collide in a spectacular battle for the ages.", 113, "English", "/pgqgaUx1cJb5oZQQ5v0tNARCeBp.jpg", 8.4000000000000004, new DateTime(2021, 3, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), "Godzilla vs. Kong" },
                    { 400090, null, "R", "In 1825, Clare, a 21-year-old Irish convict, chases a British soldier through the rugged Tasmanian wilderness, bent on revenge for a terrible act of violence he committed against her family. She enlists the services of an Aboriginal tracker who is also marked by trauma from his own violence-filled past.", 136, "English", "/hWA8QwSM1kJYMoTANEPoqrqBapg.jpg", 7.2999999999999998, new DateTime(2018, 9, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Nightingale" },
                    { 400160, null, "PG", "When his best friend Gary is suddenly snatched away, SpongeBob takes Patrick on a madcap mission far beyond Bikini Bottom to save their pink-shelled pal.", 95, "English", "/jlJ8nDhMhCYJuzOw3f52CP1W8MW.jpg", 7.7999999999999998, new DateTime(2020, 8, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), "The SpongeBob Movie: Sponge on the Run" },
                    { 400617, null, "R", "Renowned British dressmaker Reynolds Woodcock comes across Alma, a young, strong-willed woman, who soon becomes a fixture in his life as his muse and lover.", 130, "English", "/yZ8j8xKk2xQ1d88hB8YG6LZfRQj.jpg", 7.2999999999999998, new DateTime(2017, 12, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "Phantom Thread" },
                    { 400928, null, "PG-13", "Frank, a single man raising his child prodigy niece Mary, is drawn into a custody battle with his mother.", 101, "English", "/9Ts7Vc4wLlpI9oox9mkVUE1tBHy.jpg", 8.0999999999999996, new DateTime(2017, 4, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), "Gifted" },
                    { 401104, null, "16", "A young woman dealing with anorexia meets an unconventional doctor who challenges her to face her condition and embrace life.", 107, "English", "/rgPysl0uMpxllv43r4udHuRAhn4.jpg", 7.2000000000000002, new DateTime(2017, 1, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), "To the Bone" },
                    { 401306, null, "U", "The second part of the Seventh Company adventures.", 80, "French", "/y6tHLaSlwbXbhqQvzu3O1Xz0MBX.jpg", 7.2999999999999998, new DateTime(1975, 12, 10, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Seventh Company Has Been Found" },
                    { 403450, null, "T", "It's 1943 and World War II is raging in Europe. In New York, Arturo and Flora the daughter of a restaurant owner are in love, but she is promised in marriage to the son of a Mafia boss. There is a way around this, but to be able to marry Flora, Arturo needs to get permission from her father, who lives in a village in Sicily. Arturo doesn't have any money, so the only way he can get to Sicily is to enlist in the U.S. Army, which is preparing for a landing on the island.", 99, "Italian", "/bmy7S1xTY9yLJTg48pxucx790xZ.jpg", 7.4000000000000004, new DateTime(2016, 10, 27, 0, 0, 0, 0, DateTimeKind.Unspecified), "At War for Love" }
                });

