                    { 404368, null, "PG", "Video game bad guy Ralph and fellow misfit Vanellope von Schweetz must risk it all by traveling to the World Wide Web in search of a replacement part to save Vanellope's video game, Sugar Rush. In way over their heads, Ralph and Vanellope rely on the citizens of the internet — the netizens — to help navigate their way, including an entrepreneur named Yesss, who is the head algorithm and the heart and soul of trend-making site BuzzzTube.", 112, "English", "/qEnH5meR381iMpmCumAIMswcQw2.jpg", 7.2000000000000002, new DateTime(2018, 11, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), "Ralph Breaks the Internet" },
                    { 404378, null, "NR", "James Bowen, a homeless busker and recovering drug addict, has his life transformed when he meets a stray ginger cat.", 103, "English", "/6ltgCFYvw0wL7460ldFMMZv4txj.jpg", 7.9000000000000004, new DateTime(2016, 11, 4, 0, 0, 0, 0, DateTimeKind.Unspecified), "A Street Cat Named Bob" },
                    { 406385, null, "T", "Pietro Zinni is asked by the police to revive the old gang to create a task force that will stop the spread of smart drugs.", 120, "Italian", "/dNjjYoG548jXR4GS5HfLQkVymid.jpg", 7.4000000000000004, new DateTime(2017, 2, 2, 0, 0, 0, 0, DateTimeKind.Unspecified), "I Can Quit Whenever I Want 2: Masterclass" },
                    { 406997, null, "PG", "The story of August Pullman – a boy with facial differences – who enters fifth grade, attending a mainstream elementary school for the first time.", 113, "English", "/ouYgAatYH4JzIThj6FI3UYf31RI.jpg", 8.1999999999999993, new DateTime(2017, 11, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), "Wonder" },
                    { 407445, null, "PG-13", "Based on the true story of Robin, a handsome, brilliant and adventurous man whose life takes a dramatic turn when polio leaves him paralyzed.", 118, "English", "/wLu2N0QVfSpk10RJ17HLHyRUmww.jpg", 7.5, new DateTime(2017, 10, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), "Breathe" },
                    { 407448, null, "R", "A police raid in Detroit in 1967 results in one of the largest citizens' uprisings in the history of the United States.", 143, "English", "/7APLVpsGzXPJw16ZuBtXICxq8B9.jpg", 7.2999999999999998, new DateTime(2017, 7, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), "Detroit" },
                    { 407449, null, "0", "Follows the journey of a 90-year-old atheist and the quirky characters that inhabit his off-the-map desert town. He finds himself at the precipice of life, thrust into a journey of self-exploration.", 88, "English", "/lPRZHQc0LfCUVVs5A3rCbubdCoj.jpg", 7.2999999999999998, new DateTime(2017, 9, 29, 0, 0, 0, 0, DateTimeKind.Unspecified), "Lucky" },
                    { 408220, null, "R", "Beings with supernatural powers join together to fight against supernatural villains.", 75, "English", "/mI3Oxpub6vNQ71FIR2GS4d8XXgj.jpg", 7.2999999999999998, new DateTime(2017, 1, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), "Justice League Dark" },
                    { 408647, null, "PG-13", "Tara Markov is a girl who has power over earth and stone; she is also more than she seems. Is the newest Teen Titan an ally or a threat? And what are the mercenary Deathstroke's plans for the Titans?", 84, "English", "/4MumpGZmbTvHFzxyJ9MtSpqD4FH.jpg", 7.5, new DateTime(2017, 3, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Teen Titans: The Judas Contract" },
                    { 411088, null, "R", "A young businessman wakes up in a hotel room, locked from the inside, along with his lover, who was murdered while he was unconscious. He hires a prestigious lawyer, and over the course of one evening, they must work together to build a defense case for him before he is taken to jail.", 106, "Spanish", "/fptnZJbLzKUHeNlYrAynbyoL5YJ.jpg", 8.1999999999999993, new DateTime(2016, 9, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Invisible Guest" },
                    { 412656, null, "PG-13", "Two unlikely companions embark on a perilous adventure through the badlands of an unexplored planet as they try to escape a dangerous and disorienting reality, where all inner thoughts are seen and heard by everyone.", 109, "English", "/9kg73Mg8WJKlB9Y2SAJzeDKAnuB.jpg", 7.5, new DateTime(2021, 2, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), "Chaos Walking" },
                    { 413279, null, null, "Discover what Thor was up to during the events of Captain America: Civil War.", 3, "English", "/o8ZrKMFAb4KLBH1pwdLK8XZ4oE0.jpg", 7.5999999999999996, new DateTime(2016, 8, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), "Team Thor" },
                    { 413594, null, "PG-13", "In 2026, four years after the infamous Sword Art Online incident, a revolutionary new form of technology has emerged: the Augma, a device that utilizes an Augmented Reality system. Unlike the Virtual Reality of the NerveGear and the Amusphere, it is perfectly safe and allows players to use it while they are conscious, creating an instant hit on the market. The most popular application for the Augma is the game Ordinal Scale, which immerses players in a fantasy role-playing game with player rankings and rewards.  Following the new craze, Kirito's friends dive into the game, and despite his reservations about the system, Kirito eventually joins them. While at first it appears to be just fun and games, they soon find out that the game is not all that it seems...", 119, "Japanese", "/2szdEK0Mr0RG0nWGFVTseNQHbnP.jpg", 7.7000000000000002, new DateTime(2017, 2, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), "Sword Art Online: The Movie - Ordinal Scale" },
                    { 414419, null, "R", "An assassin is shot and almost killed by her ruthless employer, Bill, and other members of their assassination circle – but she lives to plot her vengeance.  Kill Bill: The Whole Bloody Affair is a complete edit of the two-part martial arts action films Kill Bill: Vol. 1 and Kill Bill: Vol. 2. The film was originally scheduled to be released as one part. However, due to the film's over 4 hour running time, it was split into two parts.", 247, "English", "/zomX76Pf3nUaTzRBk5BveLk1QPu.jpg", 8.0, new DateTime(2011, 3, 27, 0, 0, 0, 0, DateTimeKind.Unspecified), "Kill Bill: The Whole Bloody Affair" },
                    { 414425, null, "R", "In the post–World War II South, two families are pitted against a barbaric social hierarchy and an unrelenting landscape as they simultaneously fight the battle at home and the battle abroad.", 135, "English", "/7cL7UgVMeP9xDSxU2NyAqeAQAbt.jpg", 7.5, new DateTime(2017, 11, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), "Mudbound" },
                    { 416144, null, "R", "Mumbai, India, November 26, 2008. While several terrorists spread hatred and death through the city, others attack the Taj Mahal Palace Hotel. Both hotel staff and guests risk their lives, making unthinkable sacrifices to protect themselves and keep everyone safe while help arrives.", 123, "English", "/v32SC4HFZtlDRWXMaR2V2dWqAXJ.jpg", 7.5999999999999996, new DateTime(2019, 3, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), "Hotel Mumbai" },
                    { 416477, null, "R", "Pakistan-born comedian Kumail Nanjiani and grad student Emily Gardner fall in love but struggle as their cultures clash. When Emily contracts a mysterious illness, Kumail finds himself forced to face her feisty parents, his family's expectations, and his true feelings.", 120, "English", "/qquEFkFbQX1i8Bal260EgGCnZ0f.jpg", 7.4000000000000004, new DateTime(2017, 3, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Big Sick" },
                    { 417261, null, "PG", "After being gone for a decade, a country star returns home to the love he left behind.", 104, "English", "/bKqdggnIPeOI15VqtBZTkvh4hA9.jpg", 7.5999999999999996, new DateTime(2018, 1, 26, 0, 0, 0, 0, DateTimeKind.Unspecified), "Forever My Girl" },
                    { 417320, null, "G", "When the pressure to be royal becomes too much for Mal, she returns to the Isle of the Lost where her archenemy Uma, Ursula's daughter, has taken her spot as self-proclaimed queen.", 111, "English", "/8BNyZlBk4Hs92z6UrvFDjvx3yMb.jpg", 7.4000000000000004, new DateTime(2017, 7, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), "Descendants 2" },
                    { 417678, null, "PG-13", "A teenager who's lived a sheltered life because she's allergic to everything, falls for the boy who moves in next door.", 96, "English", "/c8W3Go48Mw0GoNXsGK4W9hNO4Vf.jpg", 7.2999999999999998, new DateTime(2017, 5, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), "Everything, Everything" },
                    { 419430, null, "R", "Chris and his girlfriend Rose go upstate to visit her parents for the weekend. At first, Chris reads the family's overly accommodating behavior as nervous attempts to deal with their daughter's interracial relationship, but as the weekend progresses, a series of increasingly disturbing discoveries lead him to a truth that he never could have imagined.", 104, "English", "/tFXcEccSQMf3lfhfXKSU9iRBpa3.jpg", 7.5999999999999996, new DateTime(2017, 2, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), "Get Out" },
                    { 419478, null, "PG-13", "Katie, a 17-year-old, has been sheltered since childhood and confined to her house during the day by a rare disease that makes even the smallest amount of sunlight deadly. Fate intervenes when she meets Charlie and they embark on a summer romance.", 91, "English", "/vPG2zEKPXhovPW9S91SRnwr5JM1.jpg", 7.7999999999999998, new DateTime(2018, 3, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), "Midnight Sun" },
                    { 420622, null, "R", "The unconventional life of Dr. William Marston, the Harvard psychologist and inventor who helped invent the modern lie detector test and created Wonder Woman in 1941.", 108, "English", "/tbrzHlnE8dNpllLWEe9bwDGNzLe.jpg", 7.2999999999999998, new DateTime(2017, 10, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), "Professor Marston and the Wonder Women" },
                    { 420809, null, "PG", "Maleficent and her goddaughter Aurora begin to question the complex family ties that bind them as they are pulled in different directions by impending nuptials, unexpected allies, and dark new forces at play.", 119, "English", "/vloNTScJ3w7jwNwtNGoG8DbTThv.jpg", 7.4000000000000004, new DateTime(2019, 10, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), "Maleficent: Mistress of Evil" },
                    { 420814, null, "PG", "Christopher Robin, the boy who had countless adventures in the Hundred Acre Wood, has grown up and lost his way. Now it’s up to his spirited and loveable stuffed animals, Winnie The Pooh, Tigger, Piglet, and the rest of the gang, to rekindle their friendship and remind him of endless days of childlike wonder and make-believe, when doing nothing was the very best something.", 104, "English", "/i6Ytex4d3CdfIKJFxB5v5vh24vb.jpg", 7.4000000000000004, new DateTime(2018, 8, 2, 0, 0, 0, 0, DateTimeKind.Unspecified), "Christopher Robin" },
                    { 423612, null, "18A", "The story of Kurt, a young art student who falls in love with fellow student, Ellie. Ellie’s father, Professor Seeband, a famous doctor, is dismayed at his daughter’s choice of boyfriend, and vows to destroy the relationship. What neither of them knows is that their lives are already connected through a terrible crime Seeband committed decades ago.", 189, "German", "/fn0Tp9SG0IQ3Nx8iHPYPiseLMWd.jpg", 7.9000000000000004, new DateTime(2018, 10, 3, 0, 0, 0, 0, DateTimeKind.Unspecified), "Never Look Away" },
                    { 424694, null, "PG-13", "Singer Freddie Mercury, guitarist Brian May, drummer Roger Taylor and bass guitarist John Deacon take the music world by storm when they form the rock 'n' roll band Queen in 1970. Hit songs become instant classics. When Mercury's increasingly wild lifestyle starts to spiral out of control, Queen soon faces its greatest challenge yet – finding a way to keep the band together amid the success and excess.", 135, "English", "/lHu1wtNaczFPGFDTrjCSzeLPTKN.jpg", 8.0, new DateTime(2018, 10, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), "Bohemian Rhapsody" },
                    { 425373, null, "PG", "After the tragic death of star volleyball player Caroline \"Line\" Found, a team of dispirited high school girls must band together under the guidance of their tough-love coach in hopes of winning the state championship!", 100, "English", "/cIVYjwi8QcZ9AQk4WRYgW4iUmXb.jpg", 7.4000000000000004, new DateTime(2018, 4, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Miracle Season" },
                    { 426426, null, "R", "In 1970s Mexico City, two domestic workers help a mother of four while her husband is away for an extended period of time.", 135, "Spanish", "/kxZUWtJGbGqaUdXCYg2CTs8wyEc.jpg", 7.7000000000000002, new DateTime(2018, 8, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "Roma" },
                    { 426618, null, "PG-13", "Germany, 1944. Leyna, the 15-year old daughter of a white German mother and a black African father, meets Lutz, a compassionate member of the Hitler Youth whose father is a prominent Nazi soldier, and they form an unlikely connection in this quickly changing world.", 122, "English", "/omKzydOrom9kpdfQUE0G9Y9sPl0.jpg", 8.0999999999999996, new DateTime(2018, 9, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), "Where Hands Touch" },
                    { 428493, null, "15", "A young farmer in rural Yorkshire numbs his daily frustrations with binge drinking and casual sex, until the arrival of a Romanian migrant worker.", 105, "English", "/uKShYyGsleXAZ6e6gK5jF6Wa2tW.jpg", 7.7000000000000002, new DateTime(2017, 9, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "God's Own Country" },
                    { 428836, null, "PG-13", "Ophelia comes of age as lady-in-waiting for Queen Gertrude, and her singular spirit captures Hamlet's affections. As lust and betrayal threaten the kingdom, Ophelia finds herself trapped between true love and controlling her own destiny.", 114, "English", "/7ItW1N2L2YIWVlZh1cg2Ylh3i8f.jpg", 7.5, new DateTime(2018, 1, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), "Ophelia" },
                    { 429174, null, "18+", "Zhenya and Boris are going through a vicious divorce marked by resentment, frustration and recriminations. Already embarking on new lives, each with a new partner, they are impatient to start again, to turn the page – even if it means threatening to abandon their 12-year-old son Alyosha. Until, after witnessing one of their fights, Alyosha disappears...", 122, "Russian", "/oBUsLGZoGuLKMuHj19mjG9iCDoq.jpg", 7.4000000000000004, new DateTime(2017, 6, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "Loveless" },
                    { 429210, null, "16", "1980s. Brazilian television exploding in color and auditorium programs not so politically correct. In the middle of this fervor, Augusto Mendes, a young rising actor, seeks his place in the sun. From porn studios to soap operas, he finally finds success and fame when he becomes \"Bingo\", a TV host clown from one of the audience leader TV shows for children. It turns out that behind the rice powder and red nose, nobody knows who he is.", 113, "Portuguese", "/nCy3jMTTsvDzasiuOWrXoP5gyNI.jpg", 8.0, new DateTime(2017, 8, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), "Bingo: The King of the Mornings" },
                    { 429450, null, "R", "When an earthquake hits a Korean village housing a run-down nuclear power plant, a man risks his life to save the country from imminent disaster.", 136, "Korean", "/elTrkTm5GjynK3H26cpOZsWDYjy.jpg", 7.4000000000000004, new DateTime(2016, 12, 7, 0, 0, 0, 0, DateTimeKind.Unspecified), "Pandora" },
                    { 429617, null, "PG-13", "Peter Parker and his friends go on a summer trip to Europe. However, they will hardly be able to rest - Peter will have to agree to help Nick Fury uncover the mystery of creatures that cause natural disasters and destruction throughout the continent.", 129, "English", "/4q2NNj4S5dG2RLF9CpXsej7yXl.jpg", 7.5, new DateTime(2019, 6, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), "Spider-Man: Far from Home" },
                    { 430424, null, "12", "In November 1918, a few days before the Armistice, when Lieutenant Pradelle orders a senseless attack, he causes a useless disaster; but his outrageous act also binds the lives of two soldiers who have nothing more in common than the battlefield: Édouard saves Albert, although at a high cost. They become companions in misfortune who will attempt to survive in a changing world. Pradelle, in his own way, does the same.", 113, "French", "/pkO5YoznMR9neuHVzhxHK9JJpAj.jpg", 7.9000000000000004, new DateTime(2017, 10, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "See You Up There" },
                    { 431580, null, "PG", "A group of misfits encounter a young Yeti named Everest, and they set off to reunite the magical creature with his family on the mountain of his namesake.", 97, "English", "/20djTLqppfBx5WYA67Y300S6aPD.jpg", 7.5999999999999996, new DateTime(2019, 9, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), "Abominable" },
                    { 431693, null, "PG", "Super spy Lance Sterling and scientist Walter Beckett are almost exact opposites. Lance is smooth, suave and debonair. Walter is… not. But what Walter lacks in social skills he makes up for in smarts and invention, creating the awesome gadgets Lance uses on his epic missions. But when events take an unexpected turn, Walter and Lance suddenly have to rely on each other in a whole new way.", 102, "English", "/30YacPAcxpNemhhwX0PVUl9pVA3.jpg", 7.7999999999999998, new DateTime(2019, 12, 4, 0, 0, 0, 0, DateTimeKind.Unspecified), "Spies in Disguise" },
                    { 431937, null, "18+", "How did Sarah and Victor get along for more than 45 years? Who was this enigmatic woman living in the shadow of her husband? Love, ambition, betrayals and secrets feed the story of this extraordinary couple, as they experience both the large and small moments of the last century's history.", 120, "French", "/53Zy4zL31TSjxjQ0awxVQTOVtBn.jpg", 7.5, new DateTime(2017, 3, 8, 0, 0, 0, 0, DateTimeKind.Unspecified), "Mr & Mme Adelman" },
                    { 432517, null, null, "Long buried secrets finally come to light as someone has been playing a very long game indeed. Sherlock and John face their greatest ever challenge. Is the game finally over?", 90, "English", "/dbsS4oBDwLTVTuIiqwTls9wD1I1.jpg", 8.3000000000000007, new DateTime(2017, 1, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Sherlock: The Final Problem" },
                    { 432616, null, "6", "From his childhood in Poland to his adolescence in Nice to his years as a student in Paris and his tough training as a pilot during World War II, this tragi-comedy tells the romantic story of Romain Gary, one of the most famous French novelists and sole writer to have won the Goncourt Prize for French literature two times.", 130, "French", "/vkRt22pxIow6dtDLyS2sJKJIL3b.jpg", 7.5, new DateTime(2017, 12, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), "Promise at Dawn" }
                });

            migrationBuilder.InsertData(
                table: "Movies",
                columns: new[] { "Id", "ActorId", "Certification", "Description", "Duration", "Language", "Picture", "Ratings", "ReleaseDate", "Title" },
                values: new object[,]
                {
                    { 433247, null, "R", "A 5-year-old girl embarks on a harrowing quest for survival amid the sudden rise and terrifying reign of the Khmer Rouge in Cambodia.", 136, "English", "/5370jxJfZQY8TUZiiGkpNgvRwU9.jpg", 7.4000000000000004, new DateTime(2017, 2, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), "First They Killed My Father" },
                    { 433471, null, "G", "A Pixar short about a lost-and-found box and the unseen monster within.", 6, "English", "/zAQmOmQPWyvU34B3gcK163P4jmH.jpg", 7.7000000000000002, new DateTime(2017, 6, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), "Lou" },
                    { 433498, null, "R", "Henri “Papillon” Charrière, a safecracker from the Parisian underworld, is wrongfully convicted and sentenced to life imprisonment in the penal colony of French Guiana, where he forges a strong friendship with Louis Dega, a counterfeiter who needs his protection.", 134, "English", "/ahF5c6vyP8HWMqIwlhecbRALkjq.jpg", 7.4000000000000004, new DateTime(2017, 9, 7, 0, 0, 0, 0, DateTimeKind.Unspecified), "Papillon" },
                    { 434616, null, "U", "After a serious sport accident in a swimming pool, Ben, now an incomplete quadriplegic, arrives in a rehabilitation center. He meets with other handicapped persons (tetraplegics, paraplegics, traumatized crania), all victims of accidents, as well as a handicapped since his early childhood. They go through impotence, despair and resignation, with their daily struggle to learn how to move a finger or to hold a fork. Some of them slowly find a little mobility while others receive the verdict of the handicap for life. Despite everything, hope and friendship help them endure their difficulties.", 110, "French", "/bsfTP1UFMZJTeZTnwfkPdMCj4QZ.jpg", 7.5, new DateTime(2017, 3, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "Patients" },
                    { 435129, null, "PG-13", "A headstrong young girl in Afghanistan, ruled by the Taliban, disguises herself as a boy in order to provide for her family.", 94, "English", "/2d6qmkJz9AWqmk9wBWtd2uFX89t.jpg", 7.9000000000000004, new DateTime(2017, 11, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Breadwinner" },
                    { 435577, null, "NR", "After a failed anti-Nazi sabotage mission leaves his eleven comrades dead, a Norwegian resistance fighter finds himself fleeing the Gestapo through the snowbound reaches of Scandinavia.", 136, "Norwegian", "/kADyKVfPTh6b537dsUVhTcKZcy8.jpg", 7.2999999999999998, new DateTime(2017, 12, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "The 12th Man" },
                    { 436343, null, "18+", "Two introverted people find out by pure chance that they share the same dream every night. They are puzzled, incredulous, a bit frightened. As they hesitantly accept this strange coincidence, they try to recreate in broad daylight what happens in their dream.", 116, "Hungarian", "/uguWEoZelSSckxgiQctlkZ6gpfU.jpg", 7.2999999999999998, new DateTime(2017, 3, 2, 0, 0, 0, 0, DateTimeKind.Unspecified), "On Body and Soul" },
                    { 437068, null, "15", "May, 1980. Man-seob is a taxi driver in Seoul who lives from hand to mouth, raising his young daughter alone. One day, he hears that there is a foreigner who will pay big money for a drive down to Gwangju city. Not knowing that he’s a German journalist with a hidden agenda, Man-seob takes the job.", 138, "Korean", "/iXVaWbxmyPk4KZGZk5GGDGFieMX.jpg", 8.0999999999999996, new DateTime(2017, 8, 2, 0, 0, 0, 0, DateTimeKind.Unspecified), "A Taxi Driver" },
                    { 437586, null, "R", "Stevie is a sweet 13-year-old about to explode. His mom is loving and attentive, but a little too forthcoming about her romantic life. His big brother is a taciturn and violent bully. So Stevie searches his working-class Los Angeles suburb for somewhere to belong. He finds it at the Motor Avenue skate shop.", 86, "English", "/3HkP9ale8G43vqOF3F6wt5h86RN.jpg", 7.5, new DateTime(2018, 10, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), "mid90s" },
                    { 439584, null, "T", "Has been an year since Pietro Zinni's gang got caught in the Sopox production laboratory and each of them locked up in different jails. From Regina Coeli jail, Pietro keep warning the authorities a fool syntetized nerve gas and he is ready to make a killing, but no one takes him seriously.", 102, "Italian", "/h2TYQdxJZbbjXPEJ3B43WbSG47z.jpg", 7.5, new DateTime(2017, 11, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "I Can Quit Whenever I Want 3: Ad Honorem" },
                    { 440298, null, "R", "A man and a woman meet in the ruins of post-war Poland. With vastly different backgrounds and temperaments, they are fatally mismatched and yet drawn to each other.", 88, "Polish", "/6rbS8oPIgUMhQgIX8oGVTtlNgLR.jpg", 7.5, new DateTime(2018, 6, 8, 0, 0, 0, 0, DateTimeKind.Unspecified), "Cold War" },
                    { 440596, null, "PG-13", "A romantic drama based on the story of Carley Allison, a promising 18 year old figure skater and singer who made medical history in her fight against a rare 1 in 3.5 billion type of sarcoma.", 95, "English", "/uHErYJ2TfP0ihIEMpD2zCvbVIIB.jpg", 7.4000000000000004, new DateTime(2017, 2, 10, 0, 0, 0, 0, DateTimeKind.Unspecified), "Kiss and Cry" },
                    { 441130, null, "PG", "In a time of superstition and magic, when wolves are seen as demonic and nature an evil to be tamed, a young apprentice hunter comes to Ireland with her father to wipe out the last pack. But when she saves a wild native girl, their friendship leads her to discover the world of the Wolfwalkers and transform her into the very thing her father is tasked to destroy.", 103, "English", "/vqGiNbdc2sDwsnivMMYzwAoSSu6.jpg", 8.5999999999999996, new DateTime(2020, 10, 26, 0, 0, 0, 0, DateTimeKind.Unspecified), "Wolfwalkers" },
                    { 442065, null, "R", "The incredible true story of Vietnam War hero William H. Pitsenbarger, a U.S. Air Force Pararescuemen medic who personally saved over sixty men. Thirty-two years later, Pentagon staffer Scott Huffman investigates a Congressional Medal of Honor request for Pitsenbarger and uncovers a high-level conspiracy behind the decades-long denial of the medal, prompting Huffman to put his own career on the line to seek justice for the fallen airman.", 110, "English", "/bMG8c80lyEkBXVgyHVqsdQhjgf6.jpg", 7.7000000000000002, new DateTime(2020, 1, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Last Full Measure" },
                    { 445030, null, "R", "In ancient Disboard, Riku is an angry, young warrior intent on saving humanity from the warring Exceed, the sixteen sentient species, fighting to establish the \"One True God\" amongst the Old Deus. In a lawless land, humanity's lack of magic and weak bodies have made them easy targets, leaving them on the brink of extinction. One day, hope returns to humanity when Riku finds a powerful female Ex-machina, whom he names Schwi. Exiled from her Cluster because of her research into human emotions, Schwi is convinced that humanity has only survived due to the power of these feelings. Forming an unlikely partnership in the midst of the overwhelming chaos, Riku and Schwi must now find the answers to their individual shortcomings in each other, and discover for themselves what it truly means to be human as they fight for their lives against all odds. Each with a powerful new ally in tow, it is now up to them to prevent the extinction of the human race and establish peace throughout Disboard!", 106, "Japanese", "/cCBB6BGRj5nCTaEgogDtkHfjOLK.jpg", 7.9000000000000004, new DateTime(2017, 7, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "No Game No Life: Zero" },
                    { 446159, null, "12", "Bacurau, a small town in the Brazilian sertão, mourns the loss of its matriarch, Carmelita, who lived to be 94. Days later, its inhabitants notice that their community has vanished from most maps.", 131, "Portuguese", "/tBa4zMGzZUco26XT3WfZZCwQ76i.jpg", 7.9000000000000004, new DateTime(2019, 8, 29, 0, 0, 0, 0, DateTimeKind.Unspecified), "Bacurau" },
                    { 446893, null, "PG", "Queen Poppy and Branch make a surprising discovery — there are other Troll worlds beyond their own, and their distinct differences create big clashes between these various tribes. When a mysterious threat puts all of the Trolls across the land in danger, Poppy, Branch, and their band of friends must embark on an epic quest to create harmony among the feuding Trolls to unite them against certain doom.", 90, "English", "/7W0G3YECgDAfnuiHG91r8WqgIOe.jpg", 7.5, new DateTime(2020, 3, 11, 0, 0, 0, 0, DateTimeKind.Unspecified), "Trolls World Tour" },
                    { 447332, null, "PG-13", "A family is forced to live in silence while hiding from creatures that hunt by sound.", 91, "English", "/nAU74GmpUk7t5iklEp3bufwDq4n.jpg", 7.4000000000000004, new DateTime(2018, 4, 3, 0, 0, 0, 0, DateTimeKind.Unspecified), "A Quiet Place" },
                    { 447362, null, "PG-13", "A 17 year old finds out that his girlfriend is dying, so he sets out to give her an entire life, in the last year she has left.", 107, "English", "/xNcjlHPRNoqbpaYis0Y3zX4Hq0x.jpg", 8.4000000000000004, new DateTime(2020, 11, 27, 0, 0, 0, 0, DateTimeKind.Unspecified), "Life in a Year" },
                    { 449176, null, "PG-13", "Everyone deserves a great love story. But for seventeen-year old Simon Spier it's a little more complicated: he's yet to tell his family or friends he's gay and he doesn't know the identity of the anonymous classmate he's fallen for online.", 110, "English", "/5YUYg5q7QfC4IoNwNUtiwdiYKPr.jpg", 8.0999999999999996, new DateTime(2018, 2, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), "Love, Simon" },
                    { 449924, null, "NR", "Following the death of his wife, Ip Man travels to San Francisco to ease tensions between the local kung fu masters and his star student, Bruce Lee, while searching for a better future for his son.", 107, "Cantonese", "/b5cz6BoyHrgBnhfDHOW5hXRWbln.jpg", 7.2000000000000002, new DateTime(2019, 12, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), "Ip Man 4: The Finale" },
                    { 451480, null, "12A", "Free-spirited writer Juliet Ashton forms a life-changing bond with the delightful and eccentric Guernsey Literary and Potato Peel Pie Society, when she decides to write about the book club they formed during the occupation of Guernsey in WWII.", 124, "English", "/55oz5d6NdH7ohbM1I1Euh1Tt6PN.jpg", 7.5, new DateTime(2018, 4, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Guernsey Literary & Potato Peel Pie Society" },
                    { 451499, null, "PG-13", "Paris 1930.\r Paul has only ever had one and the same horizon: the high walls of the orphanage, an austere building in the Parisian working class suburbs. Entrusted to a joyful country woman, Célestine, and her husband, Borel, the rather stiff gamekeeper of a vast estate in Sologne, the city child, recalcitrant and stubborn, arrives in a mysterious and disturbing world, that of a soverign and wild region.\r The huge forest, misty ponds, heaths, and fields all belong to the Count de la Fresnaye, an elderly taciturn man who lives alone in his manor.", 116, "French", "/rBjy3aR5EvKVvbuwfiZyK3w7vvJ.jpg", 7.5, new DateTime(2017, 2, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), "School of Life" },
                    { 451657, null, "12", "In the midst of a divorce, Miriam Besson decides to ask for exclusive custody of her son, in order to protect him from a father that she is accusing of violence. The judge-in-charge of the file grants a shared custody to the father whom it considers abused. Taken as a hostage between his parents, Julien Besson will do everything to prevent the worst from happening.", 93, "French", "/Aovc3FHXPzjWb3XZSNDfC2CPLKM.jpg", 7.5999999999999996, new DateTime(2018, 1, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "Custody" },
                    { 451915, null, "R", "After he and his first wife separate, journalist David Sheff struggles to help their teenage son, who goes from experimenting with drugs to becoming devastatingly addicted to methamphetamine.", 121, "English", "/i7gsLrNxpSf8NF5IZIrcOEfMyA3.jpg", 7.5, new DateTime(2018, 10, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), "Beautiful Boy" },
                    { 451945, null, "12", "Paris, in the early 1990s: a group of young activists is desperately tied to finding the cure against an unknown lethal disease. They target the pharmaceutical labs that are retaining potential cures, and multiply direct actions, with the hope of saving their lives as well as the ones of future generations.", 135, "French", "/azLtGx5ZhdTSP2b4oNLWtiE51OW.jpg", 7.7999999999999998, new DateTime(2017, 8, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), "BPM (Beats per Minute)" },
                    { 453278, null, "R", "Once a rising star of the rodeo circuit, and a gifted horse trainer, young cowboy Brady is warned that his riding days are over after a horse crushed his skull at a rodeo. In an attempt to regain control of his own fate, Brady undertakes a search for a new identity and what it means to be a man in the heartland of the United States.", 103, "English", "/cFsrA0Is5xode2INrPj1VJcQ18n.jpg", 7.4000000000000004, new DateTime(2017, 5, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Rider" },
                    { 454626, null, "PG", "Based on the global blockbuster videogame franchise from Sega, Sonic the Hedgehog tells the story of the world’s speediest hedgehog as he embraces his new home on Earth. In this live-action adventure comedy, Sonic and his new best friend team up to defend the planet from the evil genius Dr. Robotnik and his plans for world domination.", 99, "English", "/aQvJ5WPzZgYVDrxLX4R6cLJCEaQ.jpg", 7.5, new DateTime(2020, 2, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), "Sonic the Hedgehog" },
                    { 454983, null, "PG13", "When teenager Elle's first kiss leads to a forbidden romance with the hottest boy in high school, she risks her relationship with her best friend.", 105, "English", "/7Dktk2ST6aL8h9Oe5rpk903VLhx.jpg", 7.2999999999999998, new DateTime(2018, 5, 11, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Kissing Booth" },
                    { 455661, null, null, "A closeted boy runs the risk of being outed by his own heart after it pops out of his chest to chase down the boy of his dreams.", 4, "English", "/wJUJROdLOtOzMixkjkx1aaZGSLl.jpg", 8.1999999999999993, new DateTime(2017, 6, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "In a Heartbeat" },
                    { 455714, null, "PG-13", "Lynn, a brilliant student, after helping her friends to get the grades they need, develops the idea of starting a much bigger exam-cheating business.", 130, "Thai", "/mgyvwqn5SYKhfg5kofZDfgH8R0q.jpg", 7.9000000000000004, new DateTime(2017, 5, 3, 0, 0, 0, 0, DateTimeKind.Unspecified), "Bad Genius" },
                    { 456929, null, "7", "A disgraced basketball coach is given the chance to coach Los Amigos, a team of players who are intellectually disabled, and soon realizes they just might have what it takes to make it to the national championships.", 124, "Spanish", "/m5z4Ud6Ya5EY3Eg3OBbVBaDKWK.jpg", 7.5, new DateTime(2018, 4, 6, 0, 0, 0, 0, DateTimeKind.Unspecified), "Champions" },
                    { 457601, null, "T", "An aimless young troublemaker, Alessandro, squanders his days gambling and getting into fights, and he often spends his nights in jail. With few prospects, he begrudgingly accepts a job as a companion to Giorgio, an elderly poet suffering from Alzheimer’s. On their daily walks, the two banter and become friends, and Alessandro quickly learns more about this forgotten poet as the old man’s memory drifts. After learning a secret from Giorgio’s past, Alessandro and his friends work to uncover the mystery of this tale, an unexpected history lesson and a touching coming-of-age adventure.", 106, "Italian", "/1FOuI1i7jWb4MNfPgIERrsUGYrM.jpg", 7.5, new DateTime(2017, 5, 11, 0, 0, 0, 0, DateTimeKind.Unspecified), "Everything You Want" },
                    { 458131, null, "6", "Centers on the unlikely relationship between Ann Atwater, an outspoken civil rights activist, and C.P. Ellis, a local Ku Klux Klan leader who reluctantly co-chaired a community summit, battling over the desegregation of schools in Durham, North Carolina during the racially-charged summer of 1971. The incredible events that unfolded would change Durham and the lives of Atwater and Ellis forever.", 133, "English", "/4pA9318BY7CSnXVi3xKBtPYMe1T.jpg", 7.4000000000000004, new DateTime(2019, 4, 5, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Best of Enemies" },
                    { 458156, null, "R", "Super-assassin John Wick returns with a $14 million price tag on his head and an army of bounty-hunting killers on his trail. After killing a member of the shadowy international assassin’s guild, the High Table, John Wick is excommunicado, but the world’s most ruthless hit men and women await his every turn.", 130, "English", "/ziEuG1essDuWuC5lpWUaw1uXY2O.jpg", 7.4000000000000004, new DateTime(2019, 5, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "John Wick: Chapter 3 - Parabellum" },
                    { 458220, null, "R", "After 12 years in prison, former high school football star Eddie Palmer returns home to put his life back together—and forms an unlikely bond with Sam, an outcast boy from a troubled home. But Eddie's past threatens to ruin his new life and family.", 110, "English", "/xSDdRAjxKAGi8fUBLOqSrBhJmF0.jpg", 8.0, new DateTime(2021, 1, 29, 0, 0, 0, 0, DateTimeKind.Unspecified), "Palmer" },
                    { 458302, null, "6+", "The adventures of the young Rémi, an orphan, collected by the gentle Madam Barberin. At the age of 10 years, he is snatched from his adoptive mother and entrusted to the signor Vitalis, a mysterious itinerant musician. Has its sides, he will learn the harsh life of acrobat and sing to win his bread. Accompanied by the faithful dog capi and of the small monkey Joli-Coeur, his long trip through France, made for meetings, friendships and mutual assistance, leads him to the secret of its origins.", 109, "French", "/mQYXlxlUTmOP4FWt52qkZZb8JNM.jpg", 8.0999999999999996, new DateTime(2018, 9, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Remi, Nobody's Boy" },
                    { 463257, null, "PG-13", "A down-on-his-luck crab fisherman embarks on a journey to get a young man with Down syndrome to a professional wrestling school in rural North Carolina and away from the retirement home where he’s lived for the past two and a half years.", 97, "English", "/qyQcRGvdW3VtxHR4fSDgPOePEip.jpg", 7.4000000000000004, new DateTime(2019, 8, 9, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Peanut Butter Falcon" },
                    { 465136, null, "PG-13", "16-year old Rhiannon falls in love with a mysterious spirit named “A” that inhabits a different body every day. Feeling an unmatched connection, Rhiannon and “A” work each day to find each other, not knowing what the next day will bring.", 97, "English", "/4UnME3icxSspwL0UoGZNSyyp7Xs.jpg", 7.2000000000000002, new DateTime(2018, 2, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), "Every Day" },
                    { 466272, null, "R", "Los Angeles, 1969. TV star Rick Dalton, a struggling actor specializing in westerns, and stuntman Cliff Booth, his best friend, try to survive in a constantly changing movie industry. Dalton is the neighbor of the young and promising actress and model Sharon Tate, who has just married the prestigious Polish director Roman Polanski…", 162, "English", "/8j58iEBw9pOXFD2L0nt0ZXeHviB.jpg", 7.5, new DateTime(2019, 7, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), "Once Upon a Time… in Hollywood" },
                    { 466282, null, "PG-13", "Lara Jean's love life goes from imaginary to out of control when her secret letters to every boy she's ever fallen for are mysteriously mailed out.", 100, "English", "/hKHZhUbIyUAjcSrqJThFGYIR6kI.jpg", 7.7999999999999998, new DateTime(2018, 8, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), "To All the Boys I've Loved Before" },
                    { 468284, null, "14", "After an emotional exchange between a Lebanese Christian and a Palestinian refugee escalates, the men end up in a court case that gets national attention.", 112, "French", "/w9mlrckg3ZU2rsAlKUbLD1CgBTk.jpg", 7.5999999999999996, new DateTime(2017, 9, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Insult" }
                });

            migrationBuilder.InsertData(
                table: "Movies",
                columns: new[] { "Id", "ActorId", "Certification", "Description", "Duration", "Language", "Picture", "Ratings", "ReleaseDate", "Title" },
                values: new object[,]
                {
                    { 470044, null, "PG-13", "Raised in a poverty-stricken slum, a 16-year-old girl named Starr now attends a suburban prep school. After she witnesses a police officer shoot her unarmed best friend, she's torn between her two very different worlds as she tries to speak her truth.", 133, "English", "/2icwBom0t5nmOuZI9FVXF3gkMK0.jpg", 8.3000000000000007, new DateTime(2018, 10, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Hate U Give" },
                    { 470878, null, "PG", "Growing up in Texas, Bart Millard suffers physical and emotional abuse at the hands of his father. His childhood and relationship with his dad inspires him to write the hit song \"I Can Only Imagine\" as singer of the Christian band MercyMe.", 110, "English", "/veZszwMZu8d3WMU6TJX9sV5w1Y4.jpg", 7.5, new DateTime(2018, 2, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), "I Can Only Imagine" },
                    { 471707, null, "M/16", "A pious 20-year-old juvenile delinquent is sent to work at a sawmill in a small town; on arrival, he dresses up as a priest and accidentally takes over the local parish. The arrival of this young, charismatic preacher is an opportunity for the local community to begin the healing process after a tragedy that happened a year prior.", 116, "Polish", "/6VZlm8sEwxkE3L5nXxz17QLj1sF.jpg", 7.7999999999999998, new DateTime(2019, 9, 10, 0, 0, 0, 0, DateTimeKind.Unspecified), "Corpus Christi" },
                    { 474395, null, "PG", "All the major DC superheroes are starring in their own films, all but the Teen Titans, so Robin is determined to remedy this situation by getting over his role as a sidekick and becoming a movie star. Thus, with a few madcap ideas and an inspirational song in their hearts, the Teen Titans head to Hollywood to fulfill their dreams.", 85, "English", "/mFHihhE9hlvJEk2f1AqdLRaYHd6.jpg", 7.4000000000000004, new DateTime(2018, 7, 27, 0, 0, 0, 0, DateTimeKind.Unspecified), "Teen Titans Go! To the Movies" },
                    { 475215, null, "PG", "The movie follows a 4-year old boy who is struggling to cope with the arrival of a little sister in the family until things turn magical. A mysterious garden in the backyard of the boy's home becomes a gateway allowing the child to travel back in time and encounter his mother as a little girl and his great-grandfather as a young man. These fantasy-filled adventures allow the child to change his perspective and help him become the big brother he was meant to be.", 98, "Japanese", "/b9XvI4Nehzi0nXyNVD6DtT39P6l.jpg", 7.2999999999999998, new DateTime(2018, 6, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), "Mirai" },
                    { 475557, null, "R", "During the 1980s, a failed stand-up comedian is driven insane and turns to a life of crime and chaos in Gotham City while becoming an infamous psychopathic crime figure.", 122, "English", "/udDclJoHjfjb8Ekgsd4FDteOkCU.jpg", 8.1999999999999993, new DateTime(2019, 10, 2, 0, 0, 0, 0, DateTimeKind.Unspecified), "Joker" },
                    { 475888, null, "NR", "Dr. Jean Markham returns to the town she left as a teenager to take over her late father's medical practice. When a school-yard scuffle lands Charlie in her surgery, she invites him to visit the hives in her garden and tell his secrets to the bees, as she once did. The new friendship between the boy and the bee keeper brings his mother Lydia into Jean's world.", 106, "English", "/Rj6zpHhMU1zFW3v28U4PSRSRgP.jpg", 7.5, new DateTime(2019, 5, 3, 0, 0, 0, 0, DateTimeKind.Unspecified), "Tell It to the Bees" },
                    { 475946, null, "PG-13", "This animated short revolves around the events causing an electrical systems failure on the west coast of the US. According to Blade Runner 2049’s official timeline, this failure leads to cities shutting down, financial and trade markets being thrown into chaos, and food supplies dwindling. There’s no proof as to what caused the blackouts, but Replicants — the bio-engineered robots featured in the original Blade Runner, are blamed.", 15, "English", "/zzRjnUOVXyjp2WudgT7KxJLYh9D.jpg", 7.2999999999999998, new DateTime(2017, 9, 26, 0, 0, 0, 0, DateTimeKind.Unspecified), "Blade Runner: Black Out 2022" },
                    { 476292, null, "NR", "Maquia is a member of a special race called the Iorph who can live for hundreds of years. However, Maquia has always felt lonely despite being surrounded by her people, as she was orphaned from a young age. She daydreams about the outside world, but dares not travel from her home due to the warnings of the clan's chief.  One day the kingdom of Mezarte invades her homeland. They already have what is left of the giant dragons, the Renato, under their control, and now their king wishes to add the immortality to his bloodline.  They ravage the Iorph homeland and kill most of its inhabitants. Caught in the midst of the attack, Maquia is carried off by one of the Renato. It soon dies, and she is left deserted in a forest, now truly alone save for the cries of a single baby off in the distance. Maquia finds the baby in a destroyed village and decides to raise him as her own, naming him Ariel. Although she knows nothing of the human world, how to raise a child that ages much faster than her.", 115, "Japanese", "/hL3NqRE2ccR4Y2sYSJTrmalRjrz.jpg", 8.4000000000000004, new DateTime(2018, 2, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), "Maquia: When the Promised Flower Blooms" },
                    { 476299, null, "R", "A mother of two inherits a home from her aunt. On the first night in the new home she is confronted with murderous intruders and fights for her daughters’ lives. Sixteen years later the daughters reunite at the house, and that is when things get strange . . .", 91, "English", "/tt9YSQlArAj6849SQQJ5ryNgcJs.jpg", 7.2999999999999998, new DateTime(2018, 3, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Ghostland" },
                    { 476968, null, "PG-13", "Risking his life, Luke ventures to Rome to visit Paul -- the apostle who's bound in chains and held captive in Nero's darkest and bleakest prison cell. Haunted by the shadows of his past misdeeds, Paul wonders if he's been forgotten as he awaits his grisly execution. Before Paul's death, Luke resolves to write another book that details the birth of what will come to be known as the church.", 108, "English", "/2NUXG94dGMKYgJL1BkJGKynMb3l.jpg", 7.2999999999999998, new DateTime(2018, 3, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), "Paul, Apostle of Christ" },
                    { 479226, null, "15", "Copenhagen, Denmark, 2018. A frightening discovery is made in an old apartment. The subsequent investigation of Department Q members leads them to an infamous institution for girls that was suddenly closed in the early sixties.", 118, "Danish", "/uTdaeGpznkLfyhAzLlrdssD621R.jpg", 7.2000000000000002, new DateTime(2018, 10, 4, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Purity of Vengeance" },
                    { 481432, null, "PG-13", "Purehearted teen Lazzaro is content living as a sharecropper in rural Italy, but an unlikely friendship with the marquise’s son will change his world.", 125, "Italian", "/j4x1O6G0cbchHQwNsEZ0DntOJMJ.jpg", 7.4000000000000004, new DateTime(2018, 5, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Happy as Lazzaro" },
                    { 481848, null, "PG", "Buck is a big-hearted dog whose blissful domestic life is turned upside down when he is suddenly uprooted from his California home and transplanted to the exotic wilds of the Yukon during the Gold Rush of the 1890s. As the newest rookie on a mail delivery dog sled team—and later its leader—Buck experiences the adventure of a lifetime, ultimately finding his true place in the world and becoming his own master.", 100, "English", "/33VdppGbeNxICrFUtW2WpGHvfYc.jpg", 7.5999999999999996, new DateTime(2020, 2, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Call of the Wild" },
                    { 483184, null, "T", "Marcello, a small and gentle dog groomer, finds himself involved in a dangerous relationship of subjugation with Simone, a former violent boxer who terrorizes the entire neighborhood. In an effort to reaffirm his dignity, Marcello will submit to an unexpected act of vengeance.", 103, "Italian", "/eaZq1G8sJHv9f9a5IzioQlS3REX.jpg", 7.5999999999999996, new DateTime(2018, 5, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), "Dogman" },
                    { 483980, null, "G", "Two star-crossed freshmen – a zombie, Zed and a cheerleader, Addison – each outsiders in their unique ways, befriend each other and work together to show their high school and the Seabrook community what they can achieve when they embrace their differences.", 94, "English", "/6S9O5U7Ietqh6zTtZhGbhbA3Pze.jpg", 7.5999999999999996, new DateTime(2018, 2, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), "Z-O-M-B-I-E-S" },
                    { 483983, null, "12", "Two families attempt a daredevil plan to escape the GDR with a homemade hot air balloon, but it crashes just before the border. The Stasi finds traces of this attempt to escape and immediately starts investigations, while the two families are forced to build a new escape balloon. With each passing day the Stasi is closer on their heels – a nerve-wracking race against time begins.", 125, "German", "/nRs8A0zp0jU211j8Zay3ApIzlpx.jpg", 7.5, new DateTime(2018, 9, 27, 0, 0, 0, 0, DateTimeKind.Unspecified), "Balloon" },
                    { 484468, null, "10", "With nuclear war looming, a military expert in underwater acoustics strives to prove things aren't as they seem—or sound—using only his ears.", 115, "French", "/8bxIzp9w9l9ZzGVwNaIKOaem05A.jpg", 7.5999999999999996, new DateTime(2019, 2, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Wolf's Call" },
                    { 484747, null, "U", "Odette is a 8-yr-old girl who loves to dance and draw. Once she has become an adult, Odette realizes she was abused, and immerses herself body and soul in her career as a dancer while trying to deal with her past.", 103, "French", "/yDEbvbal7kmap5oxyekJ05EsNdi.jpg", 7.5, new DateTime(2018, 11, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), "Little Tickles" },
                    { 484751, null, "15세이상관람가", "Franck is a firefighter in Paris. He saves people. He lives at the station with his wife, who is about to have twins. He’s happy. During a call out to a fire, be puts himself in danger, to save his men. He’s going to have to learn to live again and accept to be the one being saved, this time.", 116, "French", "/tvvkvqqbmjdQ3XWkyZWno9ZywdW.jpg", 7.5999999999999996, new DateTime(2018, 11, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), "Through the Fire" },
                    { 486589, null, "PG", "Princes who have been turned into Dwarfs seek the red shoes of a lady in order to break the spell, although it will not be easy.", 92, "English", "/MBiKqTsouYqAACLYNDadsjhhC0.jpg", 7.5999999999999996, new DateTime(2019, 7, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "Red Shoes And The Seven Dwarfs" },
                    { 486947, null, "R", "Police officer Asger Holm, demoted to desk work as an alarm dispatcher, answers a call from a panicked woman who claims to have been kidnapped. Confined to the police station and with the phone as his only tool, Asger races against time to get help and find her.", 86, "Danish", "/42QPG6p7oLcLd4LQOPeSTLhqfMx.jpg", 7.2999999999999998, new DateTime(2018, 6, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Guilty" },
                    { 487558, null, "R", "Colorado Springs, late 1970s. Ron Stallworth, an African American police officer, and Flip Zimmerman, his Jewish colleague, run an undercover operation to infiltrate the Ku Klux Klan.", 135, "English", "/8jxqAvSDoneSKRczaK8v9X5gqBp.jpg", 7.5999999999999996, new DateTime(2018, 7, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "BlacKkKlansman" },
                    { 487670, null, "PG-13", "When a hulking monster arrives on Earth and begins a mindless rampage, the Justice League is quickly called in to stop it. But it soon becomes apparent that only Superman can stand against the monstrosity.", 81, "English", "/y0uxSHaSFmt6XaBJgjkeLqe7aM.jpg", 7.5, new DateTime(2018, 7, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Death of Superman" },
                    { 488623, null, "15", "Seoul, South Korea, 1997. When the young but extremely anxious student Jin-seok, his parents and his successful older brother Yoo-seok move to a new home, mysterious and frightening events begin to happen around them, unexplained events that threaten to ruin their seemingly happy lives. Unable to understand what is happening, Jin-seok wonders if he is losing his mind.", 108, "Korean", "/cBgj41y1RvmW1zJCEX0uNWL0UjW.jpg", 8.0, new DateTime(2017, 11, 29, 0, 0, 0, 0, DateTimeKind.Unspecified), "Forgotten" },
                    { 489418, null, "U", "Théo is given up for adoption by his biological mother on the very day he is born. After this anonymous birth, the mother has two months to change her mind… Or not. The child welfare services and adoption service spring into action… The former have to take care of the baby and support it during this limbo-like time, this period of uncertainty, while the latter must find a woman to become his adoptive mother. She is called Alice, and she has spent the last ten years fighting to have a child.", 112, "French", "/andgp8cnHZPAwx3zPUDaZ0pn6Go.jpg", 7.5, new DateTime(2018, 12, 5, 0, 0, 0, 0, DateTimeKind.Unspecified), "In Safe Hands" },
                    { 489925, null, "R", "Thirteen-year-old Kayla endures the tidal wave of contemporary suburban adolescence as she makes her way through the last week of middle school — the end of her thus far disastrous eighth grade year — before she begins high school.", 94, "English", "/xTa9cLhGHfQ7084UvoPQ2bBXKqd.jpg", 7.2000000000000002, new DateTime(2018, 1, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), "Eighth Grade" },
                    { 489930, null, "R", "Collin must make it through his final three days of probation for a chance at a new beginning. He and his troublemaking childhood best friend, Miles, work as movers, and when Collin witnesses a police shooting, the two men’s friendship is tested as they grapple with identity and their changed realities in the rapidly-gentrifying neighborhood they grew up in.", 95, "English", "/c4UvwoMmQiztTqeUnExDU5hoCdP.jpg", 7.5, new DateTime(2018, 7, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), "Blindspotting" },
                    { 489999, null, "PG-13", "After David Kim's 16-year-old daughter goes missing, a local investigation is opened and a detective is assigned to the case. But 37 hours later and without a single lead, David decides to search the one place no one has looked yet, where all secrets are kept today: his daughter's laptop.", 102, "English", "/pk9R56ZFlofbBzfwBnHlDyg5DMs.jpg", 7.5999999999999996, new DateTime(2018, 8, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), "Searching" },
                    { 490132, null, "PG-13", "Tony Lip, a bouncer in 1962, is hired to drive pianist Don Shirley on a tour through the Deep South in the days when African Americans, forced to find alternate accommodations and services due to segregation laws below the Mason-Dixon Line, relied on a guide called The Negro Motorist Green Book.", 130, "English", "/7BsvSuDQuoqhWmU2fL7W2GOcZHU.jpg", 8.3000000000000007, new DateTime(2018, 11, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), "Green Book" },
                    { 491418, null, "PG-13", "When Pete and Ellie decide to start a family, they stumble into the world of foster care adoption. They hope to take in one small child but when they meet three siblings, including a rebellious 15 year old girl, they find themselves speeding from zero to three kids overnight.", 118, "English", "/dic3GdmMpxxfkCQfvZnasb5ZkSG.jpg", 7.5999999999999996, new DateTime(2018, 11, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), "Instant Family" },
                    { 491480, null, "M/12", "Against all the odds, a thirteen year old boy in Malawi invents an unconventional way to save his family and village from famine.", 113, "English", "/yOr7RxHw15MMXNxGMXSmngDqHyI.jpg", 8.0, new DateTime(2019, 3, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Boy Who Harnessed the Wind" },
                    { 491584, null, "NR", "Deliveryman Jongsu is out on a job when he runs into Haemi, a girl who once lived in his neighborhood. She asks if he'd mind looking after her cat while she's away on a trip to Africa. On her return she introduces to Jongsu an enigmatic young man named Ben, who she met during her trip. And one day Ben tells Jongsu about his most unusual hobby...", 148, "Korean", "/8ak33l6lfvBPmWOMH9sUCOaC6lq.jpg", 7.4000000000000004, new DateTime(2018, 5, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), "Burning" },
                    { 492188, null, "R", "A stage director and an actress struggle through a grueling, coast-to-coast divorce that pushes them to their personal extremes.", 137, "English", "/pZekG6xabTmZxjmYw10wN84Hp8d.jpg", 7.7999999999999998, new DateTime(2019, 11, 6, 0, 0, 0, 0, DateTimeKind.Unspecified), "Marriage Story" },
                    { 496243, null, "R", "All unemployed, Ki-taek's family takes peculiar interest in the wealthy and glamorous Parks for their livelihood until they get entangled in an unexpected incident.", 133, "Korean", "/7IiTTgloJzvGI1TAYymCfbfl3vT.jpg", 8.5, new DateTime(2019, 5, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Parasite" },
                    { 497582, null, "PG-13", "While searching for her missing mother, intrepid teen Enola Holmes uses her sleuthing skills to outsmart big brother Sherlock and help a runaway lord.", 123, "English", "/riYInlsq2kf1AWoGm80JQW5dLKp.jpg", 7.5, new DateTime(2020, 9, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), "Enola Holmes" },
                    { 498248, null, "PG", "A young girl from London moves to Africa with her parents where she befriends a lion cub.", 98, "French", "/zXfwBeYe0RnqsJ0dnBoFTB4SSrG.jpg", 7.4000000000000004, new DateTime(2018, 8, 2, 0, 0, 0, 0, DateTimeKind.Unspecified), "Mia and the White Lion" },
                    { 498249, null, "16", "Wael, a former street child, makes a living from small scams with his adoptive mother and partner-in-crime Monique. When this unconventional duo swindles the wrong guy, Victor, an old acquaintance of Monique now in charge of a support organization for troubled teens, they have no choice but to become his interim secretary and educator in order to redeem themselves.", 100, "French", "/4OCg7ISCuWnPT2HsAbrjR8YiADj.jpg", 7.9000000000000004, new DateTime(2018, 11, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), "Bad Seeds" },
                    { 499631, null, null, "A biopic on the personal and artistic life of Italian songwriter Fabrizio De André.", 188, "Italian", "/fjiczyRh6Qc74JnfUr2R846YbKU.jpg", 7.5, new DateTime(2018, 1, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), "Fabrizio De André: Principe libero" },
                    { 499932, null, "R", "In Knockemstiff, Ohio and its neighboring backwoods, sinister characters converge around young Arvin Russell as he fights the evil forces that threaten him and his family.", 138, "English", "/bVL7LGq528h3KzeNI90HOVbV5uW.jpg", 7.2999999999999998, new DateTime(2020, 9, 11, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Devil All the Time" },
                    { 500006, null, "15", "The movie tells the story about a girl who has to hide and survive from a right wing terrorist while looking for her little sister during the terrorist attacks in Norway on the island Utøya, July 22nd.", 92, "Norwegian", "/bpa91Opnvl4XxUCycyNGvhwRWqC.jpg", 7.2999999999999998, new DateTime(2018, 3, 9, 0, 0, 0, 0, DateTimeKind.Unspecified), "Utøya: July 22" },
                    { 500664, null, "R", "A brutal mugging leaves Grey Trace paralyzed in the hospital and his beloved wife dead. A billionaire inventor soon offers Trace a cure — an artificial intelligence implant called STEM that will enhance his body. Now able to walk, Grey finds that he also has superhuman strength and agility — skills he uses to seek revenge against the thugs who destroyed his life.", 100, "English", "/8fDtXi6gVw8WUMWGT9XFz7YwkuE.jpg", 7.5, new DateTime(2018, 6, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "Upgrade" }
                });

            migrationBuilder.InsertData(
                table: "Movies",
                columns: new[] { "Id", "ActorId", "Certification", "Description", "Duration", "Language", "Picture", "Ratings", "ReleaseDate", "Title" },
                values: new object[,]
                {
                    { 502033, null, "R", "Metal drummer Ruben begins to lose his hearing. When a doctor tells him his condition will worsen, he thinks his career and life is over. His girlfriend Lou checks the former addict into a rehab for the deaf hoping it will prevent a relapse and help him adapt to his new life. After being welcomed and accepted just as he is, Ruben must choose between his new normal and the life he once knew.", 121, "English", "/y89kFMNYXNKMdlZjR2yg7nQtcQH.jpg", 7.7999999999999998, new DateTime(2020, 11, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), "Sound of Metal" },
                    { 502425, null, "PG-13", "South Africa, 1978. Tim Jenkin and Stephen Lee, two white political activists from the African National Congress imprisoned by the apartheid regime, put a plan in motion to escape from the infamous Pretoria Prison.", 102, "English", "/5vePsmbekQ1ysXS6f0lhzgCwvc4.jpg", 7.4000000000000004, new DateTime(2020, 3, 6, 0, 0, 0, 0, DateTimeKind.Unspecified), "Escape From Pretoria" },
                    { 502897, null, "18+", "Leningrad, one summer in the early eighties. Smuggling LP’s by Lou Reed and David Bowie, the underground rock scene is boiling ahead of the Perestroika. Mike and his beautiful wife Natasha meet with young Viktor Tsoï. Together with friends, they will change the destiny of rock’n’roll in the Soviet Union.", 126, "Russian", "/4rOkRmIhoPoyKUa5kDrIPizcglk.jpg", 7.5999999999999996, new DateTime(2018, 6, 7, 0, 0, 0, 0, DateTimeKind.Unspecified), "Leto" },
                    { 503314, null, "PG", "Earth is peaceful following the Tournament of Power. Realizing that the universes still hold many more strong people yet to see, Goku spends all his days training to reach even greater heights. Then one day, Goku and Vegeta are faced by a Saiyan called 'Broly' who they've never seen before. The Saiyans were supposed to have been almost completely wiped out in the destruction of Planet Vegeta, so what's this one doing on Earth? This encounter between the three Saiyans who have followed completely different destinies turns into a stupendous battle, with even Frieza (back from Hell) getting caught up in the mix.", 101, "Japanese", "/f03YksE4NggUjG75toz4H1YAGRf.jpg", 7.7999999999999998, new DateTime(2018, 12, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), "Dragon Ball Super: Broly" },
                    { 503919, null, "R", "Two lighthouse keepers try to maintain their sanity while living on a remote and mysterious New England island in the 1890s.", 109, "English", "/3nk9UoepYmv1G9oP18q6JJCeYwN.jpg", 7.5, new DateTime(2019, 10, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Lighthouse" },
                    { 504253, null, "G", "Spring time in April and the last of the cherry blossoms are still in bloom. The usually aloof bookworm with no interest in others comes across a book in a hospital waiting room. Handwritten on the cover are the words: \"Living with Dying.\" He soon discovers that it is a diary kept by his very popular and genuinely cheerful classmate, Sakura Yamauchi, who reveals to him that she is secretly suffering from a pancreatic illness and only has a limited time left. It is at this moment that she gains just one more person to share her secret. Trying to maintain a normal life as much as possible, Sakura is determined to live her life to the fullest until the very last day. As her free spirit and unpredictable actions throw him for a loop, his heart begins to gradually change.", 108, "Japanese", "/vHdVU0HyyB6k6kuYt8qjwTz9one.jpg", 8.3000000000000007, new DateTime(2018, 9, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "I Want to Eat Your Pancreas" },
                    { 504608, null, "R", "The story of Elton John's life, from his years as a prodigy at the Royal Academy of Music through his influential and enduring musical partnership with Bernie Taupin.", 121, "English", "/f4FF18ia7yTvHf2izNrHqBmgH8U.jpg", 7.4000000000000004, new DateTime(2019, 5, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), "Rocketman" },
                    { 505192, null, "R", "After one of their shoplifting sessions, Osamu and his son come across a little girl in the freezing cold. At first reluctant to shelter the girl, Osamu’s wife agrees to take care of her after learning of the hardships she faces. Although the family is poor, barely making enough money to survive through petty crime, they seem to live happily together until an unforeseen incident reveals hidden secrets, testing the bonds that unite them.", 121, "Japanese", "/4nfRUOv3LX5zLn98WS1WqVBk9E9.jpg", 7.9000000000000004, new DateTime(2018, 6, 2, 0, 0, 0, 0, DateTimeKind.Unspecified), "Shoplifters" },
                    { 505262, null, "PG-13", "All Might and Deku accept an invitation to go abroad to a floating and mobile manmade city, called 'I Island', where they research quirks as well as hero supplemental items at the special 'I Expo' convention that is currently being held on the island. During that time, suddenly, despite an iron wall of security surrounding the island, the system is breached by a villain, and the only ones able to stop him are the students of Class 1-A.", 96, "Japanese", "/hC4nTxdhXqFWzgqynGvvXVMiMNp.jpg", 8.0, new DateTime(2018, 8, 3, 0, 0, 0, 0, DateTimeKind.Unspecified), "My Hero Academia: Two Heroes" },
                    { 506528, null, "PG-13", "The extraordinary tale of Harriet Tubman's escape from slavery and transformation into one of America's greatest heroes. Her courage, ingenuity and tenacity freed hundreds of slaves and changed the course of history.", 125, "English", "/rsUs58bDqpJJxZSOebZOMN9gzw2.jpg", 7.2999999999999998, new DateTime(2019, 11, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "Harriet" },
                    { 506574, null, "G", "The teenagers of Disney's most infamous villains return to the Isle of the Lost to recruit a new batch of villainous offspring to join them at Auradon Prep.", 106, "English", "/7IRy0iHdaS0JI3ng4ZYlk5gLSFn.jpg", 7.9000000000000004, new DateTime(2019, 8, 2, 0, 0, 0, 0, DateTimeKind.Unspecified), "Descendants 3" },
                    { 507505, null, "NR", "Buenos Aires, Argentina, 1971. Carlos Robledo Puch is a 19-year-old boy with an angelic face, but a vocational thief as well, who acts ruthlessly, without remorse. When he meets Ramón, they follow together a dark path of crime and death.", 115, "Spanish", "/iYrcnrxv80L9JbV9YfVv45VpNM2.jpg", 7.5, new DateTime(2018, 8, 9, 0, 0, 0, 0, DateTimeKind.Unspecified), "El Angel" },
                    { 507569, null, "12", "Traveling in search of the rare ingredient, “sky fish”  Meliodas and Hawk arrive at a palace that floats above the clouds. The people there are busy preparing a ceremony, meant to protect their home from a ferocious beast that awakens once every 3,000 years. But before the ritual is complete, the Six Knights of Black—a Demon Clan army—removes the seal on the beast, threatening the lives of everyone in the Sky Palace.", 99, "Japanese", "/63NOOAkaZAK8h93Sg7Ucq6XLJGP.jpg", 7.5999999999999996, new DateTime(2018, 8, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Seven Deadly Sins: Prisoners of the Sky" },
                    { 508439, null, "PG", "In a suburban fantasy world, two teenage elf brothers embark on an extraordinary quest to discover if there is still a little magic left out there.", 103, "English", "/f4aul3FyD3jv3v4bul1IrkWZvzq.jpg", 7.7999999999999998, new DateTime(2020, 2, 29, 0, 0, 0, 0, DateTimeKind.Unspecified), "Onward" },
                    { 508442, null, "PG", "Joe Gardner is a middle school teacher with a love for jazz music. After a successful gig at the Half Note Club, he suddenly gets into an accident that separates his soul from his body and is transported to the You Seminar, a center in which souls develop and gain passions before being transported to a newborn child. Joe must enlist help from the other souls-in-training, like 22, a soul who has spent eons in the You Seminar, in order to get back to Earth.", 101, "English", "/2NNebYVf8XAbJzVZTM3razRaZKA.jpg", 8.3000000000000007, new DateTime(2020, 12, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "Soul" },
                    { 508570, null, "PG", "Ivan is a 400-pound silverback gorilla who shares a communal habitat in a suburban shopping mall with Stella the elephant, Bob the dog, and various other animals. He has few memories of the jungle where he was captured, but when a baby elephant named Ruby arrives, it touches something deep within him. Ruby is recently separated from her family in the wild, which causes him to question his life, where he comes from and where he ultimately wants to be.", 93, "English", "/wDOyGAiTaXvjKGmnmXsoFO7zItt.jpg", 7.5, new DateTime(2020, 8, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), "The One and Only Ivan" },
                    { 508642, null, "15", "An internet broadcaster recruits a handful of people for their 'experience the horror' show at Gonjiam Psychiatric Hospital, a place selected as one of the '7 freakiest places on the planet'. They are to explore the haunted asylum and stream it live on their online show.", 94, "Korean", "/KPrZ8lbgbMD7gr1pkMKoNbtcCK.jpg", 7.2000000000000002, new DateTime(2018, 3, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), "Gonjiam: Haunted Asylum" },
                    { 508933, null, "R", "In his first special in seven years, Ricky Gervais slings his trademark snark at celebrity, mortality and a society that takes everything personally.", 79, "English", "/132n3tTclF2tTyjWNlkesqZDMcU.jpg", 7.7999999999999998, new DateTime(2018, 3, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), "Ricky Gervais: Humanity" },
                    { 508965, null, "PG", "When Jesper distinguishes himself as the Postal Academy's worst student, he is sent to Smeerensburg, a small village located on an icy island above the Arctic Circle, where grumpy inhabitants barely exchange words, let alone letters. Jesper is about to give up and abandon his duty as a postman when he meets local teacher Alva and Klaus, a mysterious carpenter who lives alone in a cabin full of handmade toys.", 96, "English", "/q125RHUDgR4gjwh1QkfYuJLYkL.jpg", 8.3000000000000007, new DateTime(2019, 11, 8, 0, 0, 0, 0, DateTimeKind.Unspecified), "Klaus" },
                    { 512263, null, "15", "The story of a child star attempting to mend his relationship with his law-breaking, alcohol-abusing father over the course of a decade, loosely based on Shia LaBeouf’s life.", 94, "English", "/3BZ2rBn31kWER45ZMj7OTe9keMm.jpg", 7.2999999999999998, new DateTime(2019, 11, 8, 0, 0, 0, 0, DateTimeKind.Unspecified), "Honey Boy" },
                    { 512895, null, "PG", "The love story between a pampered Cocker Spaniel named Lady and a streetwise mongrel named Tramp. Lady finds herself out on the street after her owners have a baby and is saved from a pack by Tramp, who tries to show her to live her life footloose and collar-free.", 111, "English", "/8wBEye516IKul9sW7JKGcFXVGfV.jpg", 7.4000000000000004, new DateTime(2019, 11, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), "Lady and the Tramp" },
                    { 513434, null, "16", "Things go badly for a hack director and film crew shooting a low budget zombie movie in an abandoned Second World War Japanese facility, when they are attacked by real zombies.", 96, "Japanese", "/rws34k2bqYVo2B5MkhKAbV8925j.jpg", 7.7000000000000002, new DateTime(2017, 11, 4, 0, 0, 0, 0, DateTimeKind.Unspecified), "One Cut of the Dead" },
                    { 514439, null, "PG", "Tragedy strikes when a woman named Joyce's son falls through the ice on a frozen lake and is trapped underwater for over 15 minutes. After being rushed to the hospital, the 14-year-old boy continues to fight for his life as Joyce, her husband and their pastor stay by his bedside and pray for a miracle.", 116, "English", "/10dFF29MceYj2gqjJZfDRvA79DY.jpg", 7.5999999999999996, new DateTime(2019, 4, 10, 0, 0, 0, 0, DateTimeKind.Unspecified), "Breakthrough" },
                    { 514754, null, "G", "An aging Chinese mom suffering from empty nest syndrome gets another chance at motherhood when one of her dumplings springs to life as a lively, giggly dumpling boy.", 8, "English", "/tKz7XRXvdy1i7pW4eotaWZSrAx2.jpg", 7.5999999999999996, new DateTime(2018, 6, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Bao" },
                    { 515001, null, "PG-13", "A World War II satire that follows a lonely German boy whose world view is turned upside down when he discovers his single mother is hiding a young Jewish girl in their attic. Aided only by his idiotic imaginary friend, Adolf Hitler, Jojo must confront his blind nationalism.", 108, "English", "/7GsM4mtM0worCtIVeiQt28HieeN.jpg", 8.0999999999999996, new DateTime(2019, 10, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), "Jojo Rabbit" },
                    { 515916, null, "18+", "A 15-year-old girl, assigned male at birth, dreams of becoming a ballerina and will push her body to its limits in order for her dream to succeed.", 105, "Dutch", "/a6WKjZ1eHrKV8u1DYqjW4yUPuC.jpg", 7.2999999999999998, new DateTime(2018, 9, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), "Girl" },
                    { 516486, null, "PG-13", "A first-time captain leads a convoy of allied ships carrying thousands of soldiers across the treacherous waters of the “Black Pit” to the front lines of WW2. With no air cover protection for 5 days, the captain and his convoy must battle the surrounding enemy Nazi U-boats in order to give the allies a chance to win the war.", 91, "English", "/kjMbDciooTbJPofVXgAoFjfX8Of.jpg", 7.5, new DateTime(2020, 7, 10, 0, 0, 0, 0, DateTimeKind.Unspecified), "Greyhound" },
                    { 517814, null, "U", "Zain, a 12-year-old boy scrambling to survive on the streets of Beirut, sues his parents for having brought him into such an unjust world, where being a refugee with no documents means that your rights can easily be denied.", 126, "Arabic", "/mFnfTVADj8yOxwzprYOmTPselk8.jpg", 8.3000000000000007, new DateTime(2018, 10, 6, 0, 0, 0, 0, DateTimeKind.Unspecified), "Capernaum" },
                    { 518068, null, "12", "In the afterlife, one guardian helps a man through his trials, while his two colleagues help a former guardian on earth.", 141, "Korean", "/9BnqBHFGDv3WlCPB2qQwzAWdy7y.jpg", 8.0999999999999996, new DateTime(2018, 8, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "Along with the Gods: The Last 49 Days" },
                    { 519010, null, "16", "Salvador Mallo, a filmmaker in the twilight of his career, remembers his life: his mother, his lovers, the actors he worked with. The sixties in a small village in Valencia, the eighties in Madrid, the present, when he feels an immeasurable emptiness, facing his mortality, the incapability of continuing filming, the impossibility of separating creation from his own life. The need of narrating his past can be his salvation.", 114, "Spanish", "/cMlueArJXXwZbeLpb4NhC3pxmBk.jpg", 7.5, new DateTime(2019, 3, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), "Pain and Glory" },
                    { 519035, null, "PG13", "After an accident at the hair salon, Violet realizes she's not living life to the fullest. A soulful barber helps her put the pieces back together.", 100, "English", "/lxXsGqxUwSxypffv8hn3r332jf4.jpg", 7.2999999999999998, new DateTime(2018, 9, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), "Nappily Ever After" },
                    { 519141, null, "U", "Two childhood best friends are asked to share a kiss for the purposes of a student short film. Soon, a lingering doubt sets in, confronting both men with their preferences, threatening the brotherhood of their social circle, and, eventually, changing their lives.", 119, "French", "/zTe9g2IGkx9WWZd2Kv0x0lUE4bV.jpg", 7.2999999999999998, new DateTime(2019, 10, 9, 0, 0, 0, 0, DateTimeKind.Unspecified), "Matthias & Maxime" },
                    { 520172, null, "PG-13", "A young woman's plans to propose to her girlfriend while at her family's annual holiday party are upended when she discovers her partner hasn't yet come out to her conservative parents.", 102, "English", "/vzec9kkOSE93tygyfOktedkeOQ.jpg", 7.5999999999999996, new DateTime(2020, 11, 26, 0, 0, 0, 0, DateTimeKind.Unspecified), "Happiest Season" },
                    { 520736, null, "R", "\"Loro\", in two parts, is a period movie that chronicles, as a fiction story, events likely happened in Italy (or even made up) between 2006 and 2010.  \"Loro\" wants to suggest in portraits and glimps, through a composite constellation of characters, a moment in history, now definitively ended, which can be described in a very summary picture of the events as amoral, decadent but extraordinarily alive.  Additionally, \"Loro\" wishes to tell the story of some Italians, fresh and ancient people at the same time: souls from a modern imaginary Purgatory who, moved by heterogeneous intents like ambition, admiration, affection, curiosity, personal interests, establish to try and orbit around the walking Paradise that is the man named Silvio Berlusconi.", 120, "Italian", "/alZtZ2cOmSen1CCitIsEA0OMVHz.jpg", 7.2999999999999998, new DateTime(2018, 5, 10, 0, 0, 0, 0, DateTimeKind.Unspecified), "Loro 2" },
                    { 522212, null, "PG-13", "The powerful true story of Harvard-educated lawyer Bryan Stevenson, who goes to Alabama to defend the disenfranchised and wrongly condemned — including Walter McMillian, a man sentenced to death despite evidence proving his innocence. Bryan fights tirelessly for Walter with the system stacked against them.", 137, "English", "/4YJNp1cquIkX8JxFwkKNEFQ9tgr.jpg", 8.0, new DateTime(2019, 12, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "Just Mercy" },
                    { 522369, null, "16+", "Ricky and his family have been fighting an uphill struggle against debt since the 2008 financial crash. An opportunity to wrestle back some independence appears with a shiny new van and the chance to run a franchise as a self-employed delivery driver. It's hard work, and his wife's job as a carer is no easier. The family unit is strong but when both are pulled in different directions everything comes to breaking point.", 100, "English", "/7ZhrE1RFiOWn4QuJsHFkuEgndOo.jpg", 7.4000000000000004, new DateTime(2019, 10, 4, 0, 0, 0, 0, DateTimeKind.Unspecified), "Sorry We Missed You" },
                    { 522518, null, "PG", "A dog finds the meaning of his own existence through the lives of the humans he meets.", 120, "English", "/wquJChp0NpoqthYdE3YjXNNxvVC.jpg", 8.0999999999999996, new DateTime(2019, 5, 3, 0, 0, 0, 0, DateTimeKind.Unspecified), "A Dog's Journey" },
                    { 522627, null, "R", "American expat Mickey Pearson has built a highly profitable marijuana empire in London. When word gets out that he’s looking to cash out of the business forever it triggers plots, schemes, bribery and blackmail in an attempt to steal his domain out from under him.", 113, "English", "/jtrhTYB7xSrJxR1vusu99nvnZ1g.jpg", 7.7000000000000002, new DateTime(2019, 12, 3, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Gentlemen" },
                    { 522924, null, "PG", "A family dog—with a near-human soul and a philosopher's mind—evaluates his life through the lessons learned by his human owner, a race-car driver.", 109, "English", "/mi5VN4ww0JZgRFJIaPxxTGKjUg7.jpg", 8.4000000000000004, new DateTime(2019, 8, 8, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Art of Racing in the Rain" },
                    { 523781, null, "PG-13", "Diagnosed with a mental illness halfway through his senior year of high school, a witty, introspective teen struggles to keep it a secret while falling in love with a brilliant classmate who inspires him to open his heart and not be defined by his condition.", 111, "English", "/mMICdcRBxiEUUpdAFCYRezE3Dy5.jpg", 8.1999999999999993, new DateTime(2020, 8, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), "Words on Bathroom Walls" },
                    { 524047, null, "PG-13", "John Garrity, his estranged wife and their young son embark on a perilous journey to find sanctuary as a planet-killing comet hurtles toward Earth. Amid terrifying accounts of cities getting levelled, the Garrity's experience the best and worst in humanity. As the countdown to the global apocalypse approaches zero, their incredible trek culminates in a desperate and last-minute flight to a possible safe haven.", 120, "English", "/bNo2mcvSwIvnx8K6y1euAc1TLVq.jpg", 7.2000000000000002, new DateTime(2020, 7, 29, 0, 0, 0, 0, DateTimeKind.Unspecified), "Greenland" },
                    { 527641, null, "PG-13", "Seventeen-year-old Stella spends most of her time in the hospital as a cystic fibrosis patient. Her life is full of routines, boundaries and self-control — all of which get put to the test when she meets Will, an impossibly charming teen who has the same illness. There's an instant flirtation, though restrictions dictate that they must maintain a safe distance between them. As their connection intensifies, so does the temptation to throw the rules out the window and embrace that attraction.", 116, "English", "/kreTuJBkUjVWePRfhHZuYfhNE1T.jpg", 8.3000000000000007, new DateTime(2019, 3, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Five Feet Apart" }
                });

            migrationBuilder.InsertData(
                table: "Movies",
                columns: new[] { "Id", "ActorId", "Certification", "Description", "Duration", "Language", "Picture", "Ratings", "ReleaseDate", "Title" },
                values: new object[,]
                {
                    { 527774, null, "PG", "Long ago, in the fantasy world of Kumandra, humans and dragons lived together in harmony. But when an evil force threatened the land, the dragons sacrificed themselves to save humanity. Now, 500 years later, that same evil has returned and it’s up to a lone warrior, Raya, to track down the legendary last dragon to restore the fractured land and its divided people.", 107, "English", "/lPsD10PP4rgUGiGR4CCXA6iY0QQ.jpg", 8.3000000000000007, new DateTime(2021, 3, 3, 0, 0, 0, 0, DateTimeKind.Unspecified), "Raya and the Last Dragon" },
                    { 529203, null, "PG", "Searching for a safer habitat, the prehistoric Crood family discovers an idyllic, walled-in paradise that meets all of its needs. Unfortunately, they must also learn to live with the Bettermans -- a family that's a couple of steps above the Croods on the evolutionary ladder. As tensions between the new neighbors start to rise, a new threat soon propels both clans on an epic adventure that forces them to embrace their differences, draw strength from one another, and survive together.", 95, "English", "/tbVZ3Sq88dZaCANlUcewQuHQOaE.jpg", 7.5, new DateTime(2020, 11, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Croods: A New Age" },
                    { 529216, null, "12", "During a mysterious thunderstorm, Vera, a young mother, manages to save a life in danger, but her good deed causes a disturbing chain of unexpected consequences.", 128, "Spanish", "/oLO9y7GoyAVUVoAWD6jCgY7GQfs.jpg", 7.5, new DateTime(2018, 11, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Mirage" },
                    { 530915, null, "R", "At the height of the First World War, two young British soldiers must cross enemy territory and deliver a message that will stop a deadly attack on hundreds of soldiers.", 119, "English", "/iZf0KyrE25z1sage4SYFLCCrMi9.jpg", 7.9000000000000004, new DateTime(2019, 12, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "1917" },
                    { 531428, null, "R", "On an isolated island in Brittany at the end of the eighteenth century, a female painter is obliged to paint a wedding portrait of a young woman.", 120, "French", "/2LquGwEhbg3soxSCs9VNyh5VJd9.jpg", 8.3000000000000007, new DateTime(2019, 6, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), "Portrait of a Lady on Fire" },
                    { 532067, null, null, "It is not strange that the Demon Lord's forces fear the Crimson Demons, the clan from which Megumin and Yunyun originate. Even if the Demon Lord's generals attack their village, the Crimson Demons can just easily brush them off with their supreme mastery of advanced and overpowered magic.  When Yunyun receives a seemingly serious letter regarding a potential disaster coming to her hometown, she immediately informs Kazuma Satou and the rest of his party. After a series of wacky misunderstandings, it turns out to be a mere prank by her fellow demon who wants to be an author. Even so, Megumin becomes worried about her family and sets out toward the Crimson Demons' village with the gang.  There, Kazuma and the others decide to sightsee the wonders of Megumin's birthplace. However, they soon come to realize that the nonsense threat they received might have been more than just a joke.", 90, "Japanese", "/j73LuQcA21KvkVFcroWWMN8tTJv.jpg", 8.5, new DateTime(2019, 8, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "KonoSuba: God's Blessing on this Wonderful World! Legend of Crimson" },
                    { 533444, null, "15", "A controlling father’s attempts to ensure that his two children succeed in high school backfire after his son experiences a career-ending sports injury. Their familial bonds are eventually placed under severe strain by an unexpected tragedy.", 136, "English", "/3xbjL0z8iH8e8L3USyeKGQrBfuZ.jpg", 7.5999999999999996, new DateTime(2019, 11, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Waves" },
                    { 534780, null, "R", "A series of mysterious events changes the life of a blind pianist who now must report a crime that was actually never witnessed by him.", 139, "Hindi", "/kbqTKqz3amub4GUE5qLEQFFR8Ro.jpg", 7.7999999999999998, new DateTime(2018, 10, 5, 0, 0, 0, 0, DateTimeKind.Unspecified), "Andhadhun" },
                    { 535356, null, null, "In 1901, Marcela Gracia Ibeas took on the identity of Mario Sánchez to marry her lover of fifteen years, Elisa Sanchez Loriga.", 118, "Spanish", "/sVa1eRRXGU85KMudwPkm6QWI3gv.jpg", 7.4000000000000004, new DateTime(2019, 5, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), "Elisa & Marcela" },
                    { 536743, null, "R", "While on a forgettable first date together in Ohio, a black man and a black woman are pulled over for a minor traffic infraction. The situation escalates, with sudden and tragic results.", 131, "English", "/qfIJOmsiBcum6EGosiy5gTF6ihk.jpg", 7.2000000000000002, new DateTime(2019, 11, 27, 0, 0, 0, 0, DateTimeKind.Unspecified), "Queen & Slim" },
                    { 537056, null, "PG-13", "A mysterious new villain known only as Hush uses a gallery of villains to destroy Batman's crime-fighting career as well as Bruce Wayne's personal life, which has been further complicated by a  relationship with Selina Kyle/Catwoman.", 82, "English", "/eiVQORVyVuNNZHPAELuWtlXoQsD.jpg", 7.2999999999999998, new DateTime(2019, 7, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), "Batman: Hush" },
                    { 537061, null, "L", "Steven, now 16 years old, thinks his time defending the Earth is over. But when a new threat comes to Beach City, Steven faces his biggest challenge yet!", 82, "English", "/8mRgpubxHqnqvENK4Bei30xMDvy.jpg", 8.4000000000000004, new DateTime(2019, 9, 2, 0, 0, 0, 0, DateTimeKind.Unspecified), "Steven Universe: The Movie" },
                    { 538362, null, "T", "The incredible true story behind the most controversial Italian court cases in recent years. Stefano Cucchi was arrested for a minor crime and mysteriously found dead during his detention. In one week's time, a family is changed forever.", 100, "Italian", "/rwPgE6fLxuJmPWi8fFjgENJMAjr.jpg", 8.0999999999999996, new DateTime(2018, 9, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), "On My Skin" },
                    { 539517, null, "R", "A decade after a tragic mistake, family man Chas and occult detective John Constantine set out to cure Chas’s daughter Trish from a mysterious supernatural coma. With the help of the mysterious Nightmare Nurse, the influential Queen of Angels, and brutal Aztec God Mictlantecuhtli, the pair just might have a chance at outsmarting the demon Beroul to save Trish’s soul. In a world of shadows and dark magic, not everything is what it seems, and there’s always a price to pay. The path to redemption is never easy, and if Constantine is to succeed, he must navigate through the dark urban underbelly of Los Angeles, outwit the most cunning spawns of hell, and come face to face with arch-nemesis Nergal – all while battling his own inner demons!", 90, "English", "/tZIMe2pYug1cS9e7AZnd1bTTidM.jpg", 7.7999999999999998, new DateTime(2018, 10, 4, 0, 0, 0, 0, DateTimeKind.Unspecified), "Constantine: City of Demons - The Movie" },
                    { 544401, null, "R", "Cherry drifts from college dropout to army medic in Iraq - anchored only by his true love, Emily. But after returning from the war with PTSD, his life spirals into drugs and crime as he struggles to find his place in the world.", 140, "English", "/pwDvkDyaHEU9V7cApQhbcSJMG1w.jpg", 7.5999999999999996, new DateTime(2021, 2, 26, 0, 0, 0, 0, DateTimeKind.Unspecified), "Cherry" },
                    { 544510, null, "R", "Paris, France, December 1897. The young playwright Edmond Rostand feels like a failure. Inspiration has abandoned him. Married and father of two children, desperate and penniless, he persuades the great actor Constant Coquelin to perform the main role in his new play. But there is a problem: Coquelin wants to premiere it at Christmas and Edmond has not written a single word.", 113, "French", "/9Y1VxSfJdu8fqQqgX0x6OObxvUw.jpg", 7.5999999999999996, new DateTime(2019, 1, 9, 0, 0, 0, 0, DateTimeKind.Unspecified), "Cyrano, My Love" },
                    { 545609, null, "R", "Tyler Rake, a fearless mercenary who offers his services on the black market, embarks on a dangerous mission when he is hired to rescue the kidnapped son of a Mumbai crime lord.", 116, "English", "/wlfDxbGEsW58vGhFljKkcR5IxDj.jpg", 7.4000000000000004, new DateTime(2020, 4, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), "Extraction" },
                    { 546121, null, "PG-13", "Chloe, a teenager who is confined to a wheelchair, is homeschooled by her mother, Diane. Chloe soon becomes suspicious of her mother and begins to suspect that she may be harboring a dark secret.", 90, "English", "/ilHG4EayOVoYeKqslspY3pR4wzC.jpg", 7.5, new DateTime(2020, 11, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), "Run" },
                    { 546554, null, "PG-13", "When renowned crime novelist Harlan Thrombey is found dead at his estate just after his 85th birthday, the inquisitive and debonair Detective Benoit Blanc is mysteriously enlisted to investigate. From Harlan's dysfunctional family to his devoted staff, Blanc sifts through a web of red herrings and self-serving lies to uncover the truth behind Harlan's untimely death.", 131, "English", "/pThyQovXQrw2m0s9x82twj48Jq4.jpg", 7.7999999999999998, new DateTime(2019, 11, 27, 0, 0, 0, 0, DateTimeKind.Unspecified), "Knives Out" },
                    { 547016, null, "R", "Four undying warriors who've secretly protected humanity for centuries become targeted for their mysterious powers just as they discover a new immortal.", 125, "English", "/cjr4NWURcVN3gW5FlHeabgBHLrY.jpg", 7.2999999999999998, new DateTime(2020, 7, 10, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Old Guard" },
                    { 547258, null, "U", "In 1993, Max was 13 when he was offered his first camera. For 25 years he will not stop filming. The bunch of friends, the loves, the successes, the failures. From the 90s to the 2010s, it is the portrait of a whole generation that is emerging through its objective.", 108, "French", "/cBJDYlzDnt0BcVzzusFvMI7RWDP.jpg", 7.4000000000000004, new DateTime(2019, 9, 4, 0, 0, 0, 0, DateTimeKind.Unspecified), "Play" },
                    { 549053, null, "PG-13", "Kate is a young woman who has a habit of making bad decisions, and her last date with disaster occurs after she accepts work as Santa's elf for a department store. However, after she meets Tom there, her life takes a new turn.", 102, "English", "/kDEjffiKgjuGo2DRzsqfjvW0CQh.jpg", 7.2999999999999998, new DateTime(2019, 11, 7, 0, 0, 0, 0, DateTimeKind.Unspecified), "Last Christmas" },
                    { 550231, null, "PG", "A widow with three children hires a handyman to fix her house during a major storm. When not doing home repairs, he shares his philosophy of believing in the power of the universe to deliver what we want.", 107, "English", "/5mCqEeBA0MW7H6akFrFQXJu68rU.jpg", 7.4000000000000004, new DateTime(2020, 4, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Secret: Dare to Dream" },
                    { 551332, null, "PG-13", "Frustrated with the direction of the church, Cardinal Bergoglio requests permission to retire in 2012 from Pope Benedict. Instead, facing scandal and self-doubt, the introspective Pope Benedict summons his harshest critic and future successor to Rome to reveal a secret that would shake the foundations of the Catholic Church.", 125, "English", "/4d4mTSfDIFIbUbMLUfaKodvxYXA.jpg", 7.5999999999999996, new DateTime(2019, 11, 27, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Two Popes" },
                    { 552095, null, "G", "When their latest scheme goes awry, Mayor Humdinger and his nephew Harold accidentally divert a meteor towards Adventure Bay. The meteor's golden energy grants the PAW Patrol superpowers. The heroic Mighty Pups are on a roll to super-save the day.", 44, "English", "/h09VT8gNfRBlr7S8l1lm27m4rus.jpg", 7.5, new DateTime(2019, 5, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), "PAW Patrol: Mighty Pups" },
                    { 552178, null, "PG-13", "A tenacious attorney uncovers a dark secret that connects a growing number of unexplained deaths to one of the world's largest corporations. In the process, he risks everything — his future, his family, and his own life — to expose the truth.", 127, "English", "/bzvzaHqKBSuGIIWhinTQPHvT0zf.jpg", 7.5, new DateTime(2019, 11, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), "Dark Waters" },
                    { 552532, null, "R", "Mouse desperately wants to join The Midnight Clique, the infamous Baltimore dirt bike riders who rule the summertime streets. When Midnight’s leader, Blax, takes 14-year-old Mouse under his wing, Mouse soon finds himself torn between the straight-and-narrow and a road filled with fast money and violence.", 125, "English", "/8oiMFMarbRpcusASIX4cjVXoZKI.jpg", 8.0999999999999996, new DateTime(2020, 1, 27, 0, 0, 0, 0, DateTimeKind.Unspecified), "Charm City Kings" },
                    { 554590, null, null, "A pair of seducers try to prove who has the best techniques while trying not to fall in love with each other.", 120, "Spanish", "/maqsygPJvhESIOQGclUAEEWxNC.jpg", 7.7999999999999998, new DateTime(2019, 8, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Tod@s Caen" },
                    { 554596, null, null, "Ex-con Zequi and company come back for a new adventure.", 102, "Spanish", "/rG7rDoTe1ZEa936eonDCkV76nkx.jpg", 8.0999999999999996, new DateTime(2019, 3, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "No Manches Frida 2" },
                    { 556574, null, "PG-13", "Presenting the tale of American founding father Alexander Hamilton, this filmed version of the original Broadway smash hit is the story of America then, told by America now.", 160, "English", "/h1B7tW0t399VDjAcWJh8m87469b.jpg", 8.5, new DateTime(2020, 7, 3, 0, 0, 0, 0, DateTimeKind.Unspecified), "Hamilton" },
                    { 556901, null, "NR", "In Teen Titans Go! vs Teen Titans, the comedic modern-day quintet takes on their 2003 counterparts when villains from each of their worlds join forces to pit the two Titan teams against each other. They'll need to set aside their differences and work together to combat Trigon, Hexagon, Santa Claus (that's right, Santa!) and time itself in order to save the multiverse.", 76, "English", "/GWJEdzVC9aOBSOMF9NHodYxSsE.jpg", 8.0, new DateTime(2019, 7, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), "Teen Titans Go! vs. Teen Titans" },
                    { 556984, null, "R", "What was supposed to be a peaceful protest turned into a violent clash with the police. What followed was one of the most notorious trials in history.", 130, "English", "/ahf5cVdooMAlDRiJOZQNuLqa1Is.jpg", 7.7999999999999998, new DateTime(2020, 9, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Trial of the Chicago 7" },
                    { 560044, null, "PG", "When the four Willoughby children are abandoned by their selfish parents, they must learn how to adapt their Old-Fashioned values to the contemporary world in order to create something new: The Modern Family.", 92, "English", "/9WrMmjdZvpxLQh1tCQ9tOd1asOb.jpg", 7.2000000000000002, new DateTime(2020, 4, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Willoughbys" },
                    { 560050, null, "PG", "In this animated musical, a girl builds a rocket ship and blasts off, hoping to meet a mythical moon goddess.", 100, "English", "/lQfdytwN7eh0tXWjIiMceFdBBvD.jpg", 7.4000000000000004, new DateTime(2020, 10, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), "Over the Moon" },
                    { 564427, null, "12", "", 95, "Portuguese", "/5jFmp5RmaBAY0LoEYZb4KDp0GZc.jpg", 7.9000000000000004, new DateTime(2018, 12, 27, 0, 0, 0, 0, DateTimeKind.Unspecified), "Minha Vida em Marte" },
                    { 565310, null, "PG", "A headstrong Chinese-American woman returns to China when her beloved grandmother is given a terminal diagnosis. Billi struggles with her family's decision to keep grandma in the dark about her own illness as they all stage an impromptu wedding to see grandma one last time.", 100, "English", "/rYrFd9GfJWTtcwkqo3wL9srDHUe.jpg", 7.5, new DateTime(2019, 7, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Farewell" },
                    { 568160, null, "PG-13", "The summer of his high school freshman year, Hodaka runs away from his remote island home to Tokyo, and quickly finds himself pushed to his financial and personal limits. The weather is unusually gloomy and rainy every day, as if taking its cue from his life. After many days of solitude, he finally finds work as a freelance writer for a mysterious occult magazine. Then, one day, Hodaka meets Hina on a busy street corner. This bright and strong-willed girl possesses a strange and wonderful ability: the power to stop the rain and clear the sky.", 112, "Japanese", "/qgrk7r1fV4IjuoeiGS5HOhXNdLJ.jpg", 8.1999999999999993, new DateTime(2019, 6, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), "Weathering with You" },
                    { 572154, null, "PG-13", "In Fujisawa, Sakuta Azusagawa is in his second year of high school. Blissful days with his girlfriend and upperclassman, Mai Sakurajima, are interrupted by the appearance of his first crush, Shoko Makinohara.", 90, "Japanese", "/7Ai8vNEv4zEveh12JViGikoVPVV.jpg", 8.5, new DateTime(2019, 6, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Rascal Does Not Dream of a Dreaming Girl" },
                    { 573699, null, "G", "One day a young woman named Blanca is saved by Xuan, a snake catcher from a nearby village. She has lost her memory, and together they go on a journey to discover her real identity, developing deeper feelings for one another along the way. But as they learn more about her past, they uncover a darker plot of supernatural forces vying for power, with the fate of the world hanging in the balance.", 99, "Mandarin", "/30SLnoKmYNyRPkKCYowsrGLRnJA.jpg", 7.7000000000000002, new DateTime(2019, 1, 11, 0, 0, 0, 0, DateTimeKind.Unspecified), "White Snake" },
                    { 575452, null, "R", "Palermo, Sicily, 1980. Mafia member Tommaso Buscetta decides to move to Brazil with his family fleeing the constant war between the different clans of the criminal organization. But when, after living several misfortunes, he is forced to return to Italy, he makes a bold decision that will change his life and the destiny of Cosa Nostra forever.", 151, "Italian", "/o2e3hWoVm5DFttvPRYaD0G3jrwi.jpg", 7.7999999999999998, new DateTime(2019, 5, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Traitor" },
                    { 575604, null, "NR", "Connected by phone in the same home but 20 years apart, a serial killer puts another woman’s past — and life — on the line to change her own fate.", 112, "Korean", "/oz8hvZHg7tIdGwh0ErPRhobJKPR.jpg", 7.7000000000000002, new DateTime(2020, 11, 27, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Call" },
                    { 577922, null, "PG-13", "Armed with only one word - Tenet - and fighting for the survival of the entire world, the Protagonist journeys through a twilight world of international espionage on a mission that will unfold in something beyond real time.", 150, "English", "/k68nPLbIST6NP96JmTxmZijEvCA.jpg", 7.2999999999999998, new DateTime(2020, 8, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), "Tenet" }
                });

            migrationBuilder.InsertData(
                table: "Movies",
                columns: new[] { "Id", "ActorId", "Certification", "Description", "Duration", "Language", "Picture", "Ratings", "ReleaseDate", "Title" },
                values: new object[,]
                {
                    { 579245, null, "U", "For twenty years, Bruno and Malik have lived in a different world—the world of autistic children and teens. In charge of two separate nonprofit organizations (The Hatch & The Shelter), they train young people from underprivileged areas to be caregivers for extreme cases that have been refused by all other institutions. It’s an exceptional partnership, outside of traditional settings, for some quite extraordinary characters.", 114, "French", "/lcg4GhZCgntHSZRVFYQ1oShdpFw.jpg", 7.9000000000000004, new DateTime(2019, 10, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Specials" },
                    { 580175, null, "11", "Four high school teachers launch a drinking experiment: upholding a constant low level of intoxication.", 117, "Danish", "/fsn4cjpCvWuP9wU9hcFnK7M8RZC.jpg", 7.7999999999999998, new DateTime(2020, 9, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), "Another Round" },
                    { 581528, null, "18", "After barely surviving a violent attack by an elusive serial killer, crime boss Jang Dong-su finds himself forming an unlikely partnership with local detective Jung Tae-seok to catch the sadistic killer simply known as \"K\".", 110, "Korean", "/oHlM4abRm6BzrRcz9Nup1uidw9H.jpg", 7.2999999999999998, new DateTime(2019, 5, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Gangster, the Cop, the Devil" },
                    { 581734, null, "R", "A woman in her sixties embarks on a journey through the western United States after losing everything in the Great Recession, living as a van-dwelling modern-day nomad.", 108, "English", "/66GUmWpTHgAjyp4aBSXy63PZTiC.jpg", 7.5999999999999996, new DateTime(2020, 12, 26, 0, 0, 0, 0, DateTimeKind.Unspecified), "Nomadland" },
                    { 582014, null, "R", "A young woman, traumatized by a tragic event in her past, seeks out vengeance against those who crossed her path.", 113, "English", "/73QoFJFmUrJfDG2EynFjNc5gJxk.jpg", 7.5999999999999996, new DateTime(2020, 12, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), "Promising Young Woman" },
                    { 582927, null, "NC16", "In Monterrey, Mexico, a young street gang spends their days dancing to slowed-down cumbia and attending parties. After a mix-up with a local cartel, their leader is forced to migrate to the U.S. but quickly longs to return home.", 112, "Spanish", "/vyrkQmqQODkWXY9e4vDhzteDtIr.jpg", 7.7999999999999998, new DateTime(2019, 10, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), "I'm No Longer Here" },
                    { 583083, null, "12", "With college decisions looming, Elle juggles her long-distance romance with Noah, changing relationship with bestie Lee and feelings for a new classmate.", 132, "English", "/mb7wQv0adK3kjOUr9n93mANHhPJ.jpg", 7.9000000000000004, new DateTime(2020, 7, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Kissing Booth 2" },
                    { 583406, null, "R", "Bill O'Neal infiltrates the Black Panthers on the orders of FBI Agent Mitchell and J. Edgar Hoover. As Black Panther Chairman Fred Hampton ascends—falling for a fellow revolutionary en route—a battle wages for O’Neal’s soul.", 125, "English", "/iIgr75GoqFxe1X5Wz9siOODGe9u.jpg", 7.5, new DateTime(2021, 2, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), "Judas and the Black Messiah" },
                    { 583689, null, "PG-13", "Inspired by her mom's rebellious past and a confident new friend, a shy 16-year-old publishes an anonymous zine calling out sexism at her school.", 111, "English", "/aLBo1Ca9PggcWY98ItW5ZkdxTuA.jpg", 7.5, new DateTime(2021, 3, 3, 0, 0, 0, 0, DateTimeKind.Unspecified), "Moxie" },
                    { 585244, null, "PG", "The true-life story of Christian music star Jeremy Camp and his journey of love and loss that looks to prove there is always hope.", 115, "English", "/dqA2FCzz4OMmXLitKopzf476RVB.jpg", 7.7999999999999998, new DateTime(2020, 3, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), "I Still Believe" },
                    { 586863, null, "R", "Inspired by the 2005 riots in Paris, Stéphane, a recent transplant to the impoverished suburb of Montfermeil, joins the local anti-crime squad. Working alongside his unscrupulous colleagues Chris and Gwada, Stéphane struggles to maintain order amidst the mounting tensions between local gangs. When an arrest turns unexpectedly violent, the three officers must reckon with the aftermath and keep the neighborhood from spiraling out of control.", 103, "French", "/pUc2ZaIxvPHROjT0Trd6tpSnTme.jpg", 7.7000000000000002, new DateTime(2019, 11, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), "Les Misérables" },
                    { 586940, null, "U", "A story of Naoufel, a young man who is in love with Gabrielle. In another part of town, a severed hand escapes from a dissection lab, determined to find its body again.", 81, "French", "/z5dXCywyo8zEPNDkeQY7nbvkrz8.jpg", 7.5999999999999996, new DateTime(2019, 11, 6, 0, 0, 0, 0, DateTimeKind.Unspecified), "I Lost My Body" },
                    { 587792, null, "R", "When carefree Nyles and reluctant maid of honor Sarah have a chance encounter at a Palm Springs wedding, things get complicated when they find themselves unable to escape the venue, themselves, or each other.", 90, "English", "/yf5IuMW6GHghu39kxA0oFx7Bxmj.jpg", 7.2999999999999998, new DateTime(2020, 7, 10, 0, 0, 0, 0, DateTimeKind.Unspecified), "Palm Springs" },
                    { 587807, null, "PG", "Tom the cat and Jerry the mouse get kicked out of their home and relocate to a fancy New York hotel, where a scrappy employee named Kayla will lose her job if she can’t evict Jerry before a high-class wedding at the hotel. Her solution? Hiring Tom to get rid of the pesky mouse.", 101, "English", "/6KErczPBROQty7QoIsaa6wJYXZi.jpg", 7.2999999999999998, new DateTime(2021, 2, 11, 0, 0, 0, 0, DateTimeKind.Unspecified), "Tom & Jerry" },
                    { 589739, null, "G", "When dad has to unexpectedly step in for mom to do his daughter Zuri’s hair before a big event, what seems like a simple task is anything but as these locks have a mind of their own!", 7, "English", "/pm9uRa7031Z56unxNE8AqE8f2wg.jpg", 7.7999999999999998, new DateTime(2019, 8, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), "Hair Love" },
                    { 590223, null, "PG-13", "Seven years after the Monsterpocalypse, Joel Dawson, along with the rest of humanity, has been living underground ever since giant creatures took control of the land. After reconnecting over radio with his high school girlfriend Aimee, who is now 80 miles away at a coastal colony, Joel begins to fall for her again. As Joel realizes that there’s nothing left for him underground, he decides against all logic to venture out to Aimee, despite all the dangerous monsters that stand in his way.", 109, "English", "/r4Lm1XKP0VsTgHX4LG4syAwYA2I.jpg", 7.5999999999999996, new DateTime(2020, 10, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), "Love and Monsters" },
                    { 592350, null, "PG", "Class 1-A visits Nabu Island where they finally get to do some real hero work. The place is so peaceful that it's more like a vacation … until they're attacked by a villain with an unfathomable Quirk! His power is eerily familiar, and it looks like Shigaraki had a hand in the plan. But with All Might retired and citizens' lives on the line, there's no time for questions. Deku and his friends are the next generation of heroes, and they're the island's only hope.", 104, "Japanese", "/zGVbrulkupqpbwgiNedkJPyQum4.jpg", 8.5, new DateTime(2019, 12, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), "My Hero Academia: Heroes Rising" },
                    { 594328, null, "G", "Phineas and Ferb travel across the galaxy to rescue their older sister Candace, who has been abducted by aliens and taken to a utopia in a far-off planet, free of her pesky little brothers.", 84, "English", "/n6hptKS7Y0ZjkYwbqKOK3jz9XAC.jpg", 7.5999999999999996, new DateTime(2020, 8, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), "Phineas and Ferb the Movie: Candace Against the Universe" },
                    { 594634, null, "12", "Jessica knows exactly what her life is supposed to look like and where it takes her. But then she meets Danny. He has a complicated past and could confuse all their plans. Jessica has to decide.", 117, "German", "/zrpTa8JxNqd87G7HIqnynp9HpUc.jpg", 8.0999999999999996, new DateTime(2019, 10, 10, 0, 0, 0, 0, DateTimeKind.Unspecified), "Close to the Horizon" },
                    { 595671, null, "PG-13", "A pair of teenage girls in rural Pennsylvania travel to New York City to seek out medical help after an unintended pregnancy.", 101, "English", "/7yiSyQhhjTFphhfCUcn05tCQxyG.jpg", 7.2999999999999998, new DateTime(2020, 3, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), "Never Rarely Sometimes Always" },
                    { 595975, null, "18+", "Victor, a disillusioned sexagenarian, sees his life turned upside down on the day when Antoine, a brilliant entrepreneur, offers him a new kind of attraction: mixing theatrical artifices and historical reconstruction, this company offers his clients a chance to dive back into the era of their choice. Victor then chose to relive the most memorable week of his life: the one where, 40 years earlier, he met the great love.", 110, "French", "/mJJD5m0uHKqcWctQRcPoOuHvG6E.jpg", 7.5, new DateTime(2019, 11, 6, 0, 0, 0, 0, DateTimeKind.Unspecified), "La Belle Époque" },
                    { 596054, null, "12", "In a town in the Northwest of the province of Buenos Aires, a group of neighbors is organized to recover the economy of the area, but when the corralito is implemented in the country and they suffer a fraud, their hopes disappear. Now, they will unite to recover the lost money and give the blow of their lives to their greatest enemy.", 116, "Spanish", "/9MaAzW8sERDcIEYORE7jzeCew3P.jpg", 7.7999999999999998, new DateTime(2019, 8, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), "Heroic Losers" },
                    { 599521, null, "G", "Zed and Addison are back at Seabrook High, where, after a groundbreaking semester, they continue to steer both their school and community toward unity. But the arrival of a new group of outsiders – mysterious werewolves – threatens to shake up the newfound peace and causes a rift in Zed and Addison’s budding romance.", 84, "English", "/frTwEqSMWQ27oQeuiBO5PT0ZNqq.jpg", 8.0, new DateTime(2020, 2, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), "Z-O-M-B-I-E-S 2" },
                    { 600354, null, "PG-13", "A man refuses all assistance from his daughter as he ages and, as he tries to make sense of his changing circumstances, he begins to doubt his loved ones, his own mind and even the fabric of his reality.", 97, "English", "/uxWXW1YYQENSv7OzHB4Hds0bK3b.jpg", 8.3000000000000007, new DateTime(2021, 2, 26, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Father" },
                    { 606856, null, "PG", "The untold true story set in the winter of 1925 that takes you across the treacherous terrain of the Alaskan tundra for an exhilarating and uplifting adventure that will test the strength, courage and determination of one man, Leonhard Seppala, and his lead sled dog, Togo.", 113, "English", "/921q4gPNN4J6UxvKaw6SCNBe3F8.jpg", 8.1999999999999993, new DateTime(2019, 12, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), "Togo" },
                    { 609242, null, null, "In 2006, a group of thieves performed what is considered one of the most famous and smart bank heists in the history of Argentina. How they robbed the Rio bank is as surprising as what happened afterwards. This is their story.", 114, "Spanish", "/aSGwXbaTMxUhrfXT6xyZKqoklfB.jpg", 7.9000000000000004, new DateTime(2020, 1, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Heist of the Century" },
                    { 610120, null, "PG13", "In a short musical film directed by Paul Thomas Anderson, Thom Yorke of Radiohead stars in a mind-bending visual piece. Best played loud.", 15, "English", "/xCBOjFAzsz8d2kABIPfwIAOeJ5t.jpg", 7.4000000000000004, new DateTime(2019, 6, 27, 0, 0, 0, 0, DateTimeKind.Unspecified), "Anima" },
                    { 610461, null, null, "Regina, our young protagonist, always dreamed of getting married. And she did it - but the dream lasted much less than she thought and now she has to face life in a very funny way as a divorcee.", 93, "Spanish", "/wpC0bIYYfAY0wLa8sjlzIspMQr4.jpg", 8.1999999999999993, new DateTime(2020, 2, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), "Veinteañera, divorciada y fantástica" },
                    { 612368, null, "U", "Pierre is 25 when he returns from Wyoming to his fiancée and take over the family farm. Twenty years later, the farm expanded and so did the family.", 103, "French", "/5XllzxmnitQwAPFPidd8VXZYiY5.jpg", 7.2000000000000002, new DateTime(2019, 9, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "In the Name of the Land" },
                    { 612706, null, "PG13", "A brilliant but clumsy high school senior vows to get into her late father's alma mater by transforming herself and a misfit squad into dance champions.", 93, "English", "/b5XfICAvUe8beWExBz97i0Qw4Qh.jpg", 7.7000000000000002, new DateTime(2020, 8, 7, 0, 0, 0, 0, DateTimeKind.Unspecified), "Work It" },
                    { 613090, null, "NR", "A retired academic teacher tries to find the love of his youth after being diagnosed with Alzheimer's.", 101, "Spanish", "/AhxpEQ0C1UGqMWHBucw0Fj7S3mD.jpg", 7.5, new DateTime(2019, 9, 6, 0, 0, 0, 0, DateTimeKind.Unspecified), "Live Twice, Love Once" },
                    { 613504, null, "R", "Tessa finds herself struggling with her complicated relationship with Hardin; she faces a dilemma that could change their lives forever.", 105, "English", "/kiX7UYfOpYrMFSAGbI6j1pFkLzQ.jpg", 7.2999999999999998, new DateTime(2020, 9, 2, 0, 0, 0, 0, DateTimeKind.Unspecified), "After We Collided" },
                    { 614409, null, "PG-13", "Senior year of high school takes center stage as Lara Jean returns from a family trip to Korea and considers her college plans — with and without Peter.", 115, "English", "/zdkJs9j6yKo9di0kjtctM01fSMv.jpg", 7.9000000000000004, new DateTime(2021, 2, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), "To All the Boys: Always and Forever" },
                    { 614696, null, "15", "As a grisly virus rampages a city, a lone man stays locked inside his apartment, digitally cut off from seeking help and desperate to find a way out.", 98, "Korean", "/zqf711LsnQ5CcW3rISFw2t7OYzb.jpg", 7.4000000000000004, new DateTime(2020, 6, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), "#Alive" },
                    { 615643, null, "PG-13", "A Korean-American family moves to Arkansas in search of their own American Dream. With the arrival of their sly, foul-mouthed, but incredibly loving grandmother, the stability of their relationships is challenged even more in this new life in the rugged Ozarks, testing the undeniable resilience of family and what really makes a home.", 115, "English", "/9Bb6K6HINl3vEKCu8WXEZyHvvpq.jpg", 7.7000000000000002, new DateTime(2021, 2, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), "Minari" },
                    { 618344, null, "R", "Earth is decimated after intergalactic tyrant Darkseid has devastated the Justice League in a poorly executed war by the DC Super Heroes. Now the remaining bastions of good – the Justice League, Teen Titans, Suicide Squad and assorted others – must regroup, strategize and take the war to Darkseid in order to save the planet and its surviving inhabitants.", 90, "English", "/c01Y4suApJ1Wic2xLmaq1QYcfoZ.jpg", 8.4000000000000004, new DateTime(2020, 5, 5, 0, 0, 0, 0, DateTimeKind.Unspecified), "Justice League Dark: Apokolips War" },
                    { 618354, null, "PG-13", "It’s the dawn of a new age of heroes, and Metropolis has just met its first. But as Daily Planet intern Clark Kent – working alongside reporter Lois Lane – secretly wields his alien powers of flight, super-strength and x-ray vision in the battle for good, there’s even greater trouble on the horizon.", 86, "English", "/6Bbq8qQWpoApLZYWFFAuZ1r2gFw.jpg", 7.4000000000000004, new DateTime(2020, 8, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), "Superman: Man of Tomorrow" },
                    { 618355, null, "PG-13", "Set in the thick of the Cold War, Red Son introduces us to a Superman who landed in the USSR during the 1950s and grows up to become a Soviet symbol that fights for the preservation of Stalin’s brand of communism.", 84, "English", "/frSfz7olCSQsp2SmTyu2ciGGQiX.jpg", 7.2999999999999998, new DateTime(2020, 2, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), "Superman: Red Son" },
                    { 620683, null, "12", "Dona Hermínia will have to rediscover and reinvent herself because her children are forming new families. This supermom will have to deal with a new life scenario: Marcelina is pregnant and Juliano is getting married.", 111, "Portuguese", "/zw77BFPGJ73Lig8GwRzYj1XHq53.jpg", 8.3000000000000007, new DateTime(2019, 12, 26, 0, 0, 0, 0, DateTimeKind.Unspecified), "My Mom is a Character 3" },
                    { 621013, null, "R", "When a hopelessly romantic high school senior falls for a mysterious new classmate, it sets them both on an unexpected journey that teaches them about love, loss, and most importantly themselves.", 93, "English", "/q1MNlZYqhoD4U7sd7pjxD6SUf4z.jpg", 7.5999999999999996, new DateTime(2020, 8, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), "Chemical Hearts" },
                    { 627725, null, "PG-13", "In the 1960s, two entrepreneurs hatch an ingenious business plan to fight for housing integration—and equal access to the American Dream.", 120, "English", "/biXzsw22U6vSd0XktmZwAOc4uik.jpg", 7.5999999999999996, new DateTime(2020, 3, 6, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Banker" },
                    { 630220, null, "T", "Elisa is only forty when an incurable disease takes her from her husband and their daughter. Before her heart stops, Elisa finds a way to stay close to her: a gift for every birthday up to her adult age, 18 gifts to try to accompany her child's growth year after year.", 114, "Italian", "/lS7lqDT3NF2LcSPdxXNJY9pMxZ6.jpg", 7.5, new DateTime(2020, 1, 2, 0, 0, 0, 0, DateTimeKind.Unspecified), "18 Presents" }
                });

