                {
                    { 630566, null, "PG-13", "Young musician Zach Sobiech discovers his cancer has spread, leaving him just a few months to live. With limited time, he follows his dream and makes an album, unaware that it will soon be a viral music phenomenon.", 121, "English", "/d0OdD1I8qAfETvE9Rp9Voq7R8LR.jpg", 8.5, new DateTime(2020, 10, 9, 0, 0, 0, 0, DateTimeKind.Unspecified), "Clouds" },
                    { 635302, null, "R", "Tanjirō Kamado, joined with Inosuke Hashibira, a boy raised by boars who wears a boar's head, and Zenitsu Agatsuma, a scared boy who reveals his true power when he sleeps, boards the Infinity Train on a new mission with the Fire Hashira, Kyōjurō Rengoku, to defeat a demon who has been tormenting the people and killing the demon slayers who oppose it!", 117, "Japanese", "/yF45egpHwaYLn4jTyZAgk0Cmug9.jpg", 8.0999999999999996, new DateTime(2020, 10, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), "Demon Slayer the Movie: Mugen Train" },
                    { 637920, null, "16", "Separated from his daughter, a father with an intellectual disability must prove his innocence when he is jailed for the death of a commander's child.", 132, "Turkish", "/bOth4QmNyEkalwahfPCfiXjNh1r.jpg", 8.3000000000000007, new DateTime(2019, 10, 10, 0, 0, 0, 0, DateTimeKind.Unspecified), "Miracle in Cell No. 7" },
                    { 638507, null, "PG", "It's been ten years since the dragons moved to the Hidden World, and even though Toothless doesn't live in New Berk anymore, Hiccup continues the holiday traditions he once shared with his best friend. But the Vikings of New Berk were beginning to forget about their friendship with dragons. Hiccup, Astrid, and Gobber know just what to do to keep the dragons in the villagers' hearts. And across the sea, the dragons have a plan of their own...", 22, "English", "/kXj2Qrfm994yLeuADqbOieU1mUH.jpg", 8.1999999999999993, new DateTime(2019, 10, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "How to Train Your Dragon: Homecoming" },
                    { 640344, null, "T", "Luì and Sofì fight the terrible Signor S once again, this time he will be revealed to the public!!!", 0, "Italian", "/sfeQTIRkJjWt8IPDSBcPqkrcaas.jpg", 8.4000000000000004, new DateTime(2020, 1, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), "Me contro Te: Il film - La vendetta del Signor S" },
                    { 644479, null, null, "The film tells the story of Ariel, a 21-year-old who decides to form a rock band to compete for a prize of ten thousand dollars in a musical band contest, this as a last option when trying to get money to save their relationship and reunite with his ex-girlfriend, which breaks due to the trip she must make to Finland for an internship. Ariel with her friend Ortega, decides to make a casting to find the other members of the band, although they do not know nothing about music, thus forming a band with members that have diverse and opposite personalities.", 94, "Spanish", "/riAooJrFvVhotyaOgoI0WR7okSe.jpg", 8.5, new DateTime(2019, 11, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), "Dedicated to my ex" },
                    { 652722, null, "R", "Victor (William Levy) is one of the world’s most handsome  men, but he has a deep secret – he is a cold blooded assassin. Smooth talking and seductive, Victor was raised to do one thing only, which is to kill for money. When he is sent to the home of a brutal drug lord to collect payment for his most recent hit, he encounters the beautiful Sarai (Alicia Sanz), who has been forced to spend the last 9 years of her life with the drug lord.", 101, "Spanish", "/iqRUOtbDunNq7gTux3zXz25Krwp.jpg", 8.3000000000000007, new DateTime(2019, 12, 6, 0, 0, 0, 0, DateTimeKind.Unspecified), "In the Arms of an Assassin" },
                    { 654299, null, "PG13", "Returning to Earth as an imitator, the legendary Mexican artist Pedro Infante must prove that he is no longer a womanizer to enter paradise.", 112, "Spanish", "/xg6QZdlHrq2dtSK8cfnQQMnmpeY.jpg", 8.0999999999999996, new DateTime(2019, 12, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), "Out Of The Clear Blue Sky" },
                    { 656563, null, "NC16", "Working incognito at his rich dad's company to test his own merits, Teto falls for Paula and tells her he grew up poor, a lie that spins out of control.", 104, "Portuguese", "/wdgPgnPv6n7VaHXza54sWfWlQMU.jpg", 7.9000000000000004, new DateTime(2020, 4, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Rich in Love" },
                    { 659959, null, "M/14", "What do you dream of when you're 16-years-old and in a seaside resort in Normandy in the 1980s? A best friend? A lifelong teen pact? Scooting off on adventures on a boat or a motorbike? Living life at breakneck speed? No. You dream of death. Because you can't get a bigger kick than dying. And that's why you save it till the very end. The summer holidays are just beginning, and this story recounts how Alexis grew into himself.", 101, "French", "/ughGaKUpO61Eo0HDNq1pg6eNcfS.jpg", 7.5, new DateTime(2020, 7, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), "Summer of 85" },
                    { 661914, null, "R", "In the aftermath of Cassius Clay's defeat of Sonny Liston in 1964, the boxer meets with Malcolm X, Sam Cooke and Jim Brown to change the course of history in the segregated South.", 114, "English", "/1DLUb9PTDqXMSgsD7RmiJs7ZJIx.jpg", 7.2999999999999998, new DateTime(2020, 12, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), "One Night in Miami..." },
                    { 664767, null, "R", "After the vicious slaughter of his family by stone-cold mercenary Sub-Zero, Hanzo Hasashi is exiled to the torturous Netherrealm. There, in exchange for his servitude to the sinister Quan Chi, he’s given a chance to avenge his family – and is resurrected as Scorpion, a lost soul bent on revenge. Back on Earthrealm, Lord Raiden gathers a team of elite warriors – Shaolin monk Liu Kang, Special Forces officer Sonya Blade and action star Johnny Cage – an unlikely band of heroes with one chance to save humanity. To do this, they must defeat Shang Tsung’s horde of Outworld gladiators and reign over the Mortal Kombat tournament.", 80, "English", "/4VlXER3FImHeFuUjBShFamhIp9M.jpg", 8.4000000000000004, new DateTime(2020, 4, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), "Mortal Kombat Legends: Scorpion's Revenge" },
                    { 667520, null, "10", "Miyo \"Muge\" Sasaki is a peculiar second-year junior high student who has fallen in love with her classmate Kento Hinode. Muge resolutely pursues Kento every day, but he takes no notice of her. Nevertheless, while carrying a secret she can tell no one, Muge continues to pursue Kento. Muge discovers a magic mask that allows her to transform into a cat named Tarō. The magic lets Muge get close to Kento, but eventually it may also make her unable to transform back to a human.", 104, "Japanese", "/6inkRM1XGBG5vRhclCPWfMenp7N.jpg", 8.0999999999999996, new DateTime(2020, 6, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), "A Whisker Away" },
                    { 672647, null, "PG-13", "The film tells the story of quick-witted teen Mark, contentedly living the same day in an endless loop whose world is turned upside-down when he meets mysterious Margaret also stuck in the time loop. Mark and Margaret form a magnetic partnership, setting out to find all the tiny things that make that one day perfect. What follows is a love story with a fantastical twist, as the two struggle to figure out how -- and whether -- to escape their never-ending day.", 99, "English", "/6y3ev0rJFbHA1hU22UPmmfzBjrG.jpg", 7.2999999999999998, new DateTime(2021, 2, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), "The Map of Tiny Perfect Things" },
                    { 673595, null, "G", "Maggie and Marge are having a play-date at Springfield's finest toddler play park when Maggie becomes smitten with a little boy. It's love at first suck and Maggie dreams about seeing him again after a day full of make-believe romance.", 4, "English", "/k6fgOq7wPKujibXGWYlcIBgkcwQ.jpg", 7.5999999999999996, new DateTime(2020, 2, 29, 0, 0, 0, 0, DateTimeKind.Unspecified), "Playdate with Destiny" },
                    { 677638, null, "NR", "When Grizz, Panda, and Ice Bear's love of food trucks and viral videos get out of hand, the brothers are chased away from their home and embark on a trip to Canada, where they can live in peace.", 69, "English", "/kPzcvxBwt7kEISB9O4jJEuBn72t.jpg", 7.9000000000000004, new DateTime(2020, 6, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "We Bare Bears: The Movie" },
                    { 696374, null, null, "An intriguing and sinful exploration of seduction, forbidden love, and redemption, Gabriel's Inferno is a captivating and wildly passionate tale of one man's escape from his own personal hell as he tries to earn the impossible--forgiveness and love.", 122, "English", "/oyG9TL7FcRP4EZ9Vid6uKzwdndz.jpg", 8.6999999999999993, new DateTime(2020, 5, 29, 0, 0, 0, 0, DateTimeKind.Unspecified), "Gabriel's Inferno" },
                    { 707886, null, "G", "After failing to make it on Broadway, April returns to her hometown and reluctantly begins training a misfit group of young dancers for a competition.", 107, "English", "/Af2jt7m9GLFpR4V11xOsFmT8OKD.jpg", 7.7999999999999998, new DateTime(2020, 6, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), "Feel the Beat" },
                    { 713776, null, "PG", "Grieving parents journey through an emotional void as they mourn the loss of a child in the aftermath of a tragic school shooting.", 12, "English", "/85tDhACvKDQxQoJhBYLvDU0ik1n.jpg", 7.7999999999999998, new DateTime(2020, 3, 7, 0, 0, 0, 0, DateTimeKind.Unspecified), "If Anything Happens I Love You" },
                    { 724089, null, "R", "Professor Gabriel Emerson finally learns the truth about Julia Mitchell's identity, but his realization comes a moment too late. Julia is done waiting for the well-respected Dante specialist to remember her and wants nothing more to do with him. Can Gabriel win back her heart before she finds love in another's arms?", 105, "English", "/pci1ArYW7oJ2eyTo2NMYEKHHiCP.jpg", 8.6999999999999993, new DateTime(2020, 7, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), "Gabriel's Inferno Part II" },
                    { 746957, null, null, "An ad creative and a successful exec have a great marriage — until he wants to be a dad just as her star is rising. Then he brings someone new home.", 111, "Spanish", "/wpY2ZhxqsHYXjaaFUHzQ0nmIjYs.jpg", 8.0, new DateTime(2020, 10, 2, 0, 0, 0, 0, DateTimeKind.Unspecified), "You've Got This" },
                    { 755339, null, "12", "After taking a very nasty fall on Christmas Eve, grinchy Jorge blacks out and wakes up one year later, with no memory of the year that has passed. He soon realizes that he’s doomed to keep waking up on Christmas Eve after Christmas Eve, having to deal with the aftermath of what his other self has done the other 364 days of the year.", 101, "Portuguese", "/pv4e8yKGMJAaZihYPFUjYHsG8Ob.jpg", 7.5999999999999996, new DateTime(2020, 12, 3, 0, 0, 0, 0, DateTimeKind.Unspecified), "Just Another Christmas" },
                    { 755812, null, "NR", "During a school field trip, Ladybug and Cat Noir meet the American superheroes, whom they have to save from an akumatised super-villain. They discover that Miraculous exist in the United States too.", 55, "French", "/kIHgjAkuzvKBnmdstpBOo4AfZah.jpg", 8.3000000000000007, new DateTime(2020, 9, 26, 0, 0, 0, 0, DateTimeKind.Unspecified), "Miraculous World: New York, United HeroeZ" },
                    { 761053, null, null, "The final part of the film adaption of the erotic romance novel Gabriel's Inferno written by an anonymous Canadian author under the pen name Sylvain Reynard.", 105, "English", "/fYtHxTxlhzD4QWfEbrC1rypysSD.jpg", 8.6999999999999993, new DateTime(2020, 11, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), "Gabriel's Inferno Part III" },
                    { 778730, null, "16", "After a magical night together, Adri voluntarily turns himself into the psychiatric institution where Carla lives.", 102, "Spanish", "/hPBJckYsL1UOsz44InZ2wYJyJTy.jpg", 7.2999999999999998, new DateTime(2021, 2, 26, 0, 0, 0, 0, DateTimeKind.Unspecified), "Crazy About Her" },
                    { 791373, null, "R", "Determined to ensure Superman's ultimate sacrifice was not in vain, Bruce Wayne aligns forces with Diana Prince with plans to recruit a team of metahumans to protect the world from an approaching threat of catastrophic proportions.", 242, "English", "/tnAuB8q5vv7Ax9UAEje5Xi4BXik.jpg", 8.5999999999999996, new DateTime(2021, 3, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), "Zack Snyder's Justice League" }
